import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},C=["src","alt"],j={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,C)]),i("div",j,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-91a78216"]]),P=JSON.parse(`[{"page_url":"https://sv.wikipedia.org/wiki/Safirflugsnappare","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ficedula_sapphira_%28cropped%29.jpg","page_title":"Safirflugsnappare","context_page_description":"Safirflugsnappare är en liten asiatisk fågel i familjen flugsnappare inom ordningen tättingar. Den förekommer i bergstrakter från östra Himalaya vidare till centrala Kina och norra Indokina. IUCN kategoriserar den som livskraftig"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Leuchtt%C3%BCrme_in_Estland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Kaavi_tuletorn_2008.jpg","page_title":"Liste der Leuchttürme in Estland","context_page_description":"Diese Liste führt alle Leuchttürme in Estland auf, die auf der Leuchtturmkarte der estnischen Schifffahrtsbehörde verzeichnet sind.\\nLeuchtturm heißt auf estnisch tuletorn. Die Zusätze alumine und ülemine bezeichnen Unter- und Oberfeuer. Bei den Stationen, die durch Neubauten ersetzt wurden, ist ein zweites Baujahr angegeben. Die unzähligen Leuchtfeuerbaken sind nicht aufgeführt."},{"page_url":"https://es.wikipedia.org/wiki/Genas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Blason_ville_fr_Genas_%28Rh%C3%B4ne%29.svg","page_title":"Genas","context_page_description":"Genas es una comuna francesa situada en el departamento del Ródano, de la región de Auvernia-Ródano-Alpes. Es la cabecera y mayor población del cantón de su nombre y el sede de la comunidad de comunas de l'Est Lyonnais."},{"page_url":"https://it.wikipedia.org/wiki/Sarmati","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Sarmatia_Antiqua_%282%29.jpg","page_title":"Sarmati","context_page_description":"I Sàrmati furono un popolo iranico e quindi, come gli Sciti, facevano parte della famiglia linguistica iranica. Aperti alla cultura e alla religione persiana, si dividevano probabilmente in quattro tribù: Iazigi, Roxolani, Aorsi e Alani.\\nEssi in origine abitavano le steppe lungo il Volga, le regioni pedemontane degli Urali meridionali e la steppa del Kazakistan occidentale. Nei loro territori d'origine essi si scontrarono con i Battriani, i Parti e i Sogdiani. In diversi periodi e a diverse ondate essi si spinsero verso occidente.\\nLe popolazioni sarmatiche erano a loro volta suddivise in:\\nRoxolani, i quali si insediarono nei territori occupati dagli Sciti a nord e a nord ovest del Mar Nero e con essi, in un primo momento, stabilirono un rapporto di alleanza. Quando questo rapporto venne meno i Sarmati conquistarono i territori degli Sciti assoggettando la popolazione al loro potere.\\nIazigi, i quali si insediarono nei territori a ovest dei Daci, a sud dei Germani e sia a est sia a nord del Danubio tra il III secolo a.C. e il II d.C.\\nAorsi, dei quali si sa poco: è probabile che si fossero stanziati nei pressi del regno del Bosforo a sud-est degli Alani."},{"page_url":"https://hr.wikipedia.org/wiki/Kore%C5%A1nica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/HR-Koresnica-Bildstock.jpg","page_title":"Korešnica","context_page_description":"Korešnica sastavni je dio Žrnovnice u blizini grada Splita."},{"page_url":"https://zh.wikipedia.org/zh-cn/Iberochloe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Euchloe-tagisEM.JPG","page_title":"Iberochloe","context_page_description":"Iberochloe是粉蝶科粉蝶亚科襟粉蝶族里的一个属，尚无正式中文学名命名。共有2个物种，分布于欧亚地区。"},{"page_url":"https://eo.wikipedia.org/wiki/Tou%C3%ABt-sur-Var","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Touet_sur_var.jpg","page_title":"Touët-sur-Var","context_page_description":"Touët-sur-Var estas komunumo de Francio. Ĝi situas en la departemento Marbordaj Alpoj, en la regiono Provenco-Alpoj-Bordo Lazura. Fine de 2017 en la komunumo vivis 672 loĝantoj."},{"page_url":"https://sco.wikipedia.org/wiki/Marie_Anne_Mancini","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Marie_Anne_Mancini.jpg","page_title":"Marie Anne Mancini","context_page_description":"wis an Italian noblewoman whose mither Girolama Mazzarini wis the sister of Cardinal Mazarin, the chief minister o Fraunce. After her husband's death in 1650, Geronima brocht her children from Rome tae Paris in the hope of using the influence o her brither Cardinal Mazarin, tae gain them advantageous mairiages, a goal that ultimately was very successful. Marie Anne would mairy Godefroy Maurice de La Tour d'Auvergne, Duke o Bouillon in 1661 an they head childer. Marie Anne wis also a Patroness o Racine an o Jean de La Fontaine. She also raised her nephew Louis Joseph de Bourbon, Duke o Vendôme."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%80%E8%BF%91%E9%A1%9E%E5%9C%B0%E5%A4%AA%E9%99%BD%E7%B3%BB%E5%A4%96%E8%A1%8C%E6%98%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Artist%E2%80%99s_impression_of_a_cloud-covered_planet_inspired_by_the_data_of_Gliese_832_c.png","page_title":"最近類地太陽系外行星列表","context_page_description":"最近類地太陽系外行星列表中包含距離地球50光年內的類地太陽系外行星系統。\\n他們主要可能由矽酸鹽岩石和金屬所構成。類地行星在太陽系中是最接近太陽的內行星。\\n大多數列表中的行星的陸地成分尚未有科學共識，表中僅列出可能的陸地成分。\\n2012年9月，天文學家宣布 發現兩個行星環繞格利澤163，其中一顆格利澤163c，質量約地球的6.9倍，比地球還熱，被認為位於適居帶中。"},{"page_url":"https://en.wikipedia.org/wiki/Woods_Hole_Oceanographic_Institution","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Armstong_fromthefantail_406493.jpg","page_title":"Woods Hole Oceanographic Institution","context_page_description":"The Woods Hole Oceanographic Institution is a private, nonprofit research and higher education facility dedicated to the study of marine science and engineering. WHOI is dedicated to advancing knowledge of the ocean and its connection with the Earth system through a sustained commitment to excellence in science, engineering, and education, and to the application of this knowledge to problems facing society.\\nEstablished in 1930 in Woods Hole, Massachusetts, it is the largest independent oceanographic research institution in the U.S., with staff and students numbering about 1,400."},{"page_url":"https://it.wikipedia.org/wiki/Nicolae_Grigorescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Gheorghe_Grigorescu_-_Sfintii_Imparati_Constantin_si_Elena%2C_icoana_de_la_Baicoi.jpg","page_title":"Nicolae Grigorescu","context_page_description":"Nicolae Grigorescu è stato un pittore rumeno, considerato il fondatore della pittura rumena moderna, assieme a Ion Andreescu e Ștefan Luchian."},{"page_url":"https://cs.wikipedia.org/wiki/Karosa_B_831","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Brno%2C_M%C4%9Bsto_Brno%2C_Moravsk%C3%A9_n%C3%A1m%C4%9Bst%C3%AD%2C_Karosa_B_831.jpg","page_title":"Karosa B 831","context_page_description":"Karosa B 831 je městský autobus, který byl vyroben ve třech kusech národním podnikem Karosa Vysoké Mýto mezi lety 1987 a 1989. Mělo se jednat o nástupce typu Karosa B 731 a spolu s trolejbusem Škoda 17Tr se autobus B 831 měl stát součástí nové unifikované řady silničních vozidel pro městskou hromadnou dopravu. V současnosti existuje jediný vůz B 831, který je jako historický exponát v majetku Technického muzea v Brně."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89cole_secondaire_publique_De_La_Salle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%C3%89cole_secondaire_De_La_Salle%2C_Ottawa.jpg","page_title":"École secondaire publique De La Salle","context_page_description":"L'École secondaire publique De La Salle est une école du Conseil des écoles publiques de l'Est de l'Ontario. L'école est située à Ottawa, Ontario et elle accueille les élèves de la 7ᵉ à la 12ᵉ année."},{"page_url":"https://en.wikipedia.org/wiki/Tanyaporn_Prucksakorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Tanyaporn_Prucksakorn_7.jpg","page_title":"Tanyaporn Prucksakorn","context_page_description":"Tanyaporn Prucksakorn is a Thai female sport shooter who has competed at the 2008, 2012 and 2016 Summer Olympics. At all three Olympics, she competed in the 10 m air pistol and 25 m pistol events. She has been a competitive shooter since 2003, winning two World Cup silver medals, both at the Munich event."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D9%86%DA%A9%D9%88%D8%B1%D8%AF%DB%8C%D8%A7%D8%8C_%DA%A9%D8%A7%D9%86%D8%B2%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Our_Lady_of_Perpetual_Help_Catholic_Church_%28Concordia%2C_Kansas%29.JPG","page_title":"کانکوردیا، کانزاس","context_page_description":"کانکوردیا شهری در ایالت کانزاس کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۵٬۳۹۵ نفر بوده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Margherita_Buy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Margherita_Buy.jpg","page_title":"Margherita Buy","context_page_description":"Margherita Buy ist eine italienische Schauspielerin. Sie gehört zu den profiliertesten Darstellerinnen des italienischen Kinos. Bei vierzehn Nominierungen wurde ihr fünf Mal der bedeutendste italienische Filmpreis David di Donatello verliehen. Sechs Mal erhielt sie den Nastro d’Argento, den Preis der italienischen Filmjournalisten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%B1%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%9A%D1%83%D1%80%D0%B1%D0%B0%D0%BD_%D0%A1%D0%B0%D0%B9%D0%B3%D0%B8%D0%B4%D0%B0%D1%85%D0%BC%D0%B5%D0%B4%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kurban_Kurbanov_2012.jpg","page_title":"Курбанов, Курбан Сайгидахмедович","context_page_description":"Курбан Саидахмедович Курбанов — борец вольного стиля, призёр чемпионата мира, чемпион Азии. Заслуженный мастер спорта. Заместитель мэра города Махачкалы."},{"page_url":"https://war.wikipedia.org/wiki/Andrena_agilissima","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Andrenidae_-_Andrena_agilissima-2.JPG","page_title":"Andrena agilissima","context_page_description":"An Andrena agilissima in uska species han Andrenidae nga syahan ginhulagway ni Giovanni Antonio Scopoli hadton 1770. An Andrena agilissima in nahilalakip ha genus nga Andrena, ngan familia nga Andrenidae. Waray hini subspecies nga nakalista."},{"page_url":"https://es.wikipedia.org/wiki/Metroxylon_sagu","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Metrox_sagu_071124_1512_stbu.jpg","page_title":"Metroxylon sagu","context_page_description":"La palma de sagú es una especie de planta de la familia Arecaceae. En Filipinas se llama landán o yoro.​"},{"page_url":"https://sl.wikipedia.org/wiki/Jovsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Anacamptis_palustris.jpg","page_title":"Jovsi","context_page_description":"Jovsi so obsežna naravna ravnica razparceliranih mokrišč, ki se razprostirajo na površini okoli 4,5 km² med cesto Župelevec - Dobova, Kapelskimi goricami in reko Sotlo v občini Brežice. Ime izvira iz nemškega izraza Jauchsee.\\nZaradi naravovarstvenega pomena je območje zaščiteno in sicer kot:\\nposebno varstveno območje - Območje Natura 2000\\nekološko pomembno območje\\nnaravna vrednosta\\nnaravni spomenik\\nObmočje je tudi predlagano za Ramsarsko lokaliteto."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BC%D0%BC%D0%B5%D0%BB%D1%8C%D1%81%D0%B1%D0%B0%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rammelsb.jpg","page_title":"Раммельсбах","context_page_description":"Раммельсбах — Германия Федеративтік Республикасының Рейнланд-Пфальц жерінде орналасқан муниципалитет. Кузель ауданының құрамына енеді.\\nМуниципалитеттің тұрақты тұрғындарының саны 1605 адамды құрайды. Алып жатқан жер аумағы 2,64 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 07 3 36 079. Муниципалитеттің басшысы — Ксафер Юнг."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%91%A9%E7%BA%B3%E5%93%A5%E7%BB%9F%E6%B2%BB%E8%80%85%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/FlorestanI-1-.png","page_title":"摩纳哥统治者列表","context_page_description":"這是一份摩納哥領主和元首的列表。所有摩納哥統治者都屬於格里馬爾迪王朝。"},{"page_url":"https://en.wikipedia.org/wiki/1984_Summer_Olympics_opening_ceremony","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Olympic_Torch_Tower_of_the_Los_Angeles_Coliseum.jpg","page_title":"1984 Summer Olympics opening ceremony","context_page_description":"The opening ceremony of the 1984 Summer Olympic Games took place on the afternoon of Saturday 28 July in the Los Angeles Memorial Coliseum, Los Angeles. As mandated by the Olympic Charter, the proceedings combined the formal ceremonial opening of this international sporting event with an artistic spectacle to showcase the host nation's culture. The 1984 Games were formally opened by President Ronald Reagan. The spectacle was in front of 92,516 attendants. The ceremony was a $5 million production and titled Music of America."},{"page_url":"https://de.wikipedia.org/wiki/Van-der-Pol-System","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/VanDerPol_inhomogen.png","page_title":"Van-der-Pol-System","context_page_description":"Der Van-der-Pol-Oszillator ist ein schwingungsfähiges System mit nichtlinearer Dämpfung und Selbsterregung. Für kleine Amplituden ist die Dämpfung negativ; ab einem bestimmten Schwellwert der Amplitude wird die Dämpfung positiv, das System stabilisiert sich und geht in einen Grenzzyklus über. Benannt wurde das Modell nach dem niederländischen Physiker Balthasar van der Pol, der es 1927 als Ergebnis seiner Forschungen an Oszillatoren mit Vakuumröhren vorstellte."},{"page_url":"https://fi.wikipedia.org/wiki/Maisemavalokuvaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Adams_The_Tetons_and_the_Snake_River.jpg","page_title":"Maisemavalokuvaus","context_page_description":"Maisemavalokuvauksen kohteena voivat olla luonnonmaisemat, kaupunkimaisemat sekä maaseutumaisemat. Suomessa teollisuusmaisemat tai makromaisemat luokitellaan harvoin kuuluviksi maisemavalokuvauksen aiheiksi. Suomalaisessa valokuvauskulttuurissa yleisintä maisemavalokuvausta on luonnonmaisemien kuvaus. Suomen Luonnonvalokuvaajat ry:n järjestämässä Vuoden Luontokuva -kilpailussa ”Maisemat” on suosittu sarja.\\n1800–1900-lukujen vaihteessa maisemavalokuvauksella oli Suomessa suuri merkitys kansallisuusaatteen kuvittajana ja vahvistajana. Tuon ajan tunnettuja kuvaajia olivat I. K. Inha ja Daniel Nyblin. Kansallismaisemaksi Suomessa alettiin kutsua maisemamaalareiden ja -valokuvaajien tallentamia maisemia, joissa tiivistyivät suomalaisuuden tunnuskuvat.\\nYhdysvaltalainen maisemakuvaaja Ansel Adams on tullut tunnetuksi kansainvälisesti erityisesti Yosemiten kansallispuistosta otetuista maisemakuvistaan.\\nMaisemakuvan erityismuoto on panoraamakuva.\\nInternetissä on lukuisia maisemavalokuvausta käsitteleviä sivustoja ja keskustelufoorumeita."},{"page_url":"https://af.wikipedia.org/wiki/Streepmuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Four-striped_Grass_Mouse.JPG","page_title":"Streepmuis","context_page_description":"Die Streepmuis is 'n muis wat oor die hele Suid-Afrika voorkom behalwe in die grootste gedeelte van Limpopo en die noorde van KwaZulu-Natal."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/TP-5_Tunjungan.jpg","page_title":"List of tallest buildings in Indonesia","context_page_description":"This list of tallest buildings in Indonesia ranks skyscrapers in Indonesia by height. Jakarta is the capital city of Indonesia. There are 88 Highrise building have been built in Greater Jakarta and 26 more still under construction. Indonesia is ranked number 11th in the World by the number of 150m+ completed building and 9th in Asia. There are 4 Supertall building that are still under construction. The average building age is 8 years. The first Highrise in Jakarta is Wisma 46 and holds the longest record of the highest building in Jakarta for nearly 20 years. The tallest Building in Jakarta is Gama Tower since 2015."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Buffalo,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Hellenic_Orthodox_Church_of_the_Annunciation_Dec_09.JPG","page_title":"National Register of Historic Places listings in Buffalo, New York","context_page_description":"This is a list of the National Register of Historic Places listings in Buffalo, New York.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Buffalo, New York, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 238 properties and districts listed on the National Register in Erie County. The city of Buffalo is the location of 162 of these properties and districts; they are listed here, while the other properties and districts are listed separately. Another two properties in the city were formerly listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted August 14, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Bolt_Wood","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bolt_Wood_2.jpg","page_title":"Bolt Wood","context_page_description":"Bolt Wood is near to the western boundary of the Parish of Stockerston, Leicestershire, England. It is suggested that the woodland on this boundary is part of that mentioned in the Domesday Book. Bolt Wood was part of the extensive Royal medieval Leighfield Forest. The first written reference to Bolt Wood is in an undated charter probably dating before the reign of Henry VI, in which it is referred to as 'Boutewood'. An alternative date offered is between 1422 and 1461."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%A0%B5%E7%94%B8%E4%B9%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Sir_Henry_Pottinger.jpg","page_title":"砵甸乍","context_page_description":"砵甸乍（Henry Pottinger，1789年10月3號—1856年3月18號）係英國軍人兼官員。大清文件叫佢做璞鼎查，亦都叫璞世爵。1843年起，成為香港第一任督憲。"},{"page_url":"https://de.wikipedia.org/wiki/Mingary_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mingary_Plan.jpg","page_title":"Mingary Castle","context_page_description":"Mingary Castle, auch Mingarry Castle geschrieben, ist die Ruine einer Felsenburg, die rund 1,5 Kilometer südöstlich des kleinen Dorfes Kilchoan in Lochaber in den südlichen, schottischen Highlands steht. Sie ist damit die am westlichsten gelegene Befestigung des britischen Festlandes und zugleich eine der besterhaltenen schottischen Burganlagen des 13. Jahrhunderts.\\nObwohl die Wurzeln der Burg im 13. oder 14. Jahrhundert zu suchen sind, stammt die Mehrheit der heutige Bausubstanz aus dem 16. bis 18. Jahrhundert. Die Anlage war bis zu Beginn des 17. Jahrhunderts Sitz der MacIains of Ardnamurchan, einem Zweig der MacDonalds, Lords of the Isles. Auf einem etwa 24 Fuß hohen Felsen über dem Meer an der Südküste der Ardnamurchan-Halbinsel gelegen, war der Standort ein strategisch günstiger Platz, um die Einfahrt zum Mull-Sund sowie zum Loch Sunart und damit den Seeweg-Zugang zur Isle of Mull zu kontrollieren.\\nMingary ist die anglisierte Form des gälischen Namens Mhìogharraidh, dessen wahrscheinlichste Bedeutung von den beiden altnordischen Wörtern „mikil“ für „groß“ und „gardhr“ für „Hof“ bzw. „Haus“ herrührt und damit als „großes Haus“ gedeutet werden kann."},{"page_url":"https://ca.wikipedia.org/wiki/Pere_Colomer_i_Fors","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Pere_Colomer_i_Fors.jpg","page_title":"Pere Colomer i Fors","context_page_description":"Pere Colomer i Fors va ser un autor dramàtic català que va estrenar amb una certa regularitat entre finals del segle XIX i principis del segle xx."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D8%AA%D9%82%D8%A8%D9%84_%D8%B1%D9%8A%D8%AA%D9%8A%D9%86%D9%88%D9%8A%D8%AF_%D8%A3%D9%83%D8%B3_%D8%BA%D8%A7%D9%85%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Protein_RXRG_PDB_1by4.png","page_title":"مستقبل ريتينويد أكس غاما","context_page_description":"مستقبل ريتينويد أكس غاما ‏، كما يعرف باسم المستقبل النووي عائلة 2، مجموعة ب، عضو 3 ‏ وهو مستقبل نووي موجود عند الإنسان ومشفر بالمورثة RXRG."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B3%D1%96%D0%BC%D0%B5%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Siemiginowski_John_III_Sobieski_with_a_baton.jpg","page_title":"Регімент","context_page_description":"Регімент – 1 назва круглої дерев'яної палички завдовжки близько 40 см, яка за доби пізнього середньовіччя в деяких європейських країнах була символом верховного військового командування. Традиція використання такого Р. пов'язана, очевидно, із символічними атрибутами влади давньоримських консулів;\\n2 у Речі Посполитій – назва затяжного війська з іноземців, побудованого на організаційних засадах західноєвропейських армій. Наприкінці 16 ст. великий підрозділ затяжного війська почали називати \\"регіментом\\";\\nУ Речі Посполитій регіменти мали полковники іноземних підрозділів.\\nЗазвичай регімент був незвично яскравим, що допомагало у візуальному спілкуванні командуючого з частинами на полі бою.\\n3 Клейнод, яким позначалася гетьманська влада в Козацькій державі та в Речі Посполитій."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BB%D1%83%D0%B3%D1%83%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Gjwala.JPG","page_title":"Телугулер","context_page_description":"Андхралар, телугулер — халық. Ежелден Оңт. Үндістанның қазіргі Андхра-Прадеш штаты мен Майсур, Мадрас штаттары аумағында қоныстанған. Саны — 8 млн. шамасында. Дравид тілдері шоғырына жататын телугу тілінде сөйлейді. Б.з.б. 1-мың жылдықтың ортасында андхра, калинга тайпалары Солт. Үндістаннан оңт-ке қоныс аударып, телугу тайпасымен араласып, б.з.б. 2 ғ-дан бастап б.з. 3 ғ. аралығында біртұтас халық болып қалыптасқан. Б.з.б. 3 ғ-да ежелгі А. мемл. Маурья империясы құрамында болған кезде буддизм мен жайнизм сенімін қабылдаған. 4 ғ-дан бастап Гуптаның құрамына енгеннен кейін, индуизмді қабылдады. 1956 ж. А. бірыңғай Андхра-Прадеш штатына қайта бірікті. Негізгі кәсібі: суармалы егін ш. Күріш, темекі, арахис, мақта, үпілмәлік егеді, қой, буйвол өсіреді. Қазіргі уақытта А-дың көбі"},{"page_url":"https://id.wikipedia.org/wiki/National_Basketball_League_(Australia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/NZ_Breakers_colours.jpg","page_title":"National Basketball League (Australia)","context_page_description":"National Basketball League adalah liga bola basket profesional di Oseania yang saat ini terdiri atas 9 tim, di mana 8 berada di Australia dan 1 berada di Selandia Baru. Liga ini menjadi yang utama di kedua negara tersebut."},{"page_url":"https://en.wikipedia.org/wiki/Michael_J._Sheeran","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/SheeranWeb-2014Final.jpg","page_title":"Michael J. Sheeran","context_page_description":"Michael J. Sheeran, S.J., is a Jesuit priest, president of the Association of Jesuit Colleges and Universities, former president of Regis University in Denver, Colorado, and author of the book Beyond Majority Rule: Voteless Decisions in the Society of Friends.\\nSheeran was born in New York City in 1940, and entered the Society of Jesus at Florissant, Missouri, in 1957. He was ordained a Catholic priest in 1970.\\nIn 1968, Sheeran became interested in the Religious Society of Friends while studying religious communities which practice \\"communal discernment\\", a decision-making process which the Jesuit order also utilized when it was founded in 1540, but lost within a few generations.\\nDuring his doctoral work in the politics department at Princeton University, Sheeran spent two years conducting interviews, reading, and observing the communal discernment tradition, as exemplified in the voteless decisions of Quakers in their Philadelphia Yearly Meeting. This resulted in his book Beyond Majority Rule, which was published in 1983.\\nSheeran received his doctorate in politics from Princeton in 1977."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Lenk","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Biberach-esel.jpg","page_title":"Peter Lenk","context_page_description":"Peter Lenk ist ein deutscher Bildhauer aus Bodman-Ludwigshafen am Bodensee. Er stellt auf satirische Art von ihm empfundene gesellschaftliche Missstände dar."},{"page_url":"https://sv.wikipedia.org/wiki/Hokkaidoponny","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Hokkaido_Pony.jpg","page_title":"Hokkaidoponny","context_page_description":"Hokkaidoponnyn är en hästras av ponnytyp som härstammar från Japan men rasen har troligen sin bakgrund i Kina och Korea. Ponnyn kallades för Dosanko tidigare. Då Japanerna aldrig utmärkt sig speciellt inom ridsporten så är de flesta japanska ponnyraser, då även Hokkaido, inte speciellt utvecklade eller ens utavlade med andra raser, vilket gör den till en av världens äldsta hästraser även om dessa raser inte är speciellt fixerade."},{"page_url":"https://en.wikipedia.org/wiki/Emerald-chinned_hummingbird","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/MonographTrochi4Goul_0042a.jpg","page_title":"Emerald-chinned hummingbird","context_page_description":"The emerald-chinned hummingbird is a species of hummingbird in the family Trochilidae. It is found in El Salvador, Guatemala, Honduras, Mexico, and Nicaragua. Its natural habitats are subtropical or tropical moist montane forest and heavily degraded former forest."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D9%88%D8%B1%D8%A8%D8%A7%D8%BA%D9%87_%D9%84%D8%A7%D9%84%D9%88%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/H.colymba.jpg","page_title":"قورباغه لالوما","context_page_description":"قورباغه لالوما نام یک گونه از تیره قورباغه‌های درختی حقیقی است. این گونه در کاستاریکا، پاناما، و بخش‌هایی از کلمبیا حضور دارد. زیستگاه طبیعیش نیز در جنگل‌های مناطق پست و همچنین مناطق کوهستانی می‌باشد."},{"page_url":"https://fi.wikipedia.org/wiki/Apollon_Patrooksen_temppeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Temple_of_Apollo_Patroos.jpg","page_title":"Apollon Patrooksen temppeli","context_page_description":"Apollon Patrooksen temppeli oli antiikin aikainen kreikkalainen temppeli, joka sijaitsi Ateenan Agoran länsilaidalla. Se oli omistettu Apollon Patrookselle eli ”Isän Apollonille”.\\nTemppeli rakennettiin noin vuonna 338–326 eaa. Sen kohde Apollon Patroos oli Apollonin nimitys Ionin isänä. Ion oli kaikkien joonialaisten kantaisä ja ateenalaiset puolestaan kuuluivat joonialaisiin. Näin kyseessä oli ateenalaisten jumalallisen kantaisän temppeli. Temppeli rakennettiin 500-luvulla eaa. rakennetun varhaisemman ja pienemmän Apollonin temppelin paikalle. Varhaisempi temppeli oli todennäköisesti tuhoutunut persialaisten hyökkäyksessä vuonna 480 eaa.\\nTemppeli sijaitsi Zeuksen stoan ja Metroonin välissä. Rakennus edusti joonialaista tyyliä ja siinä oli etupuolella eli itäpuolella neljä tai kuusi joonialaista pylvästä. Se oli rakennettu kalkkikivestä ja sen pituus oli 16,5 metriä ja leveys 10 metriä. Temppelissä oli Eufranorin veistämä Apollonin kulttipatsas, joka on nykyisin Antiikin Agoran museossa. Välittömästi temppelin pohjoispuolella oli pieni ja jonkin verran varhaisempi Zeus Fratrioksen ja Athene Fratrian temppeli.\\nTemppelistä on säilynyt sen perustukset sekä vähäisiä muita osia."},{"page_url":"https://hy.wikipedia.org/wiki/Astrid_S","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Astrid_S._02_25_2019_-6_%2832317466737%29.jpg","page_title":"Astrid S","context_page_description":"Աստրիդ Սմեպլաս, հայտնի է նաև իր բեմական Astrid S բեմական անունով։ Նորվեգացի երգչուհի և երգահան, ով 2013 թվականի Pop Idol նախագծի նորվեգական տարբերակում զբաղեցրեց 5-րդ հորիզոնականը։"},{"page_url":"https://la.wikipedia.org/wiki/Clagenfurtum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Lindwurm_Brunnen.jpg","page_title":"Clagenfurtum","context_page_description":"Clagenfurtum est urbs et caput Carinthiae et sedes Dioecesis Gurcensis.\\nClagenfurti est Collegium Sapientiae et Pietatis."},{"page_url":"https://hu.wikipedia.org/wiki/Kis%C3%BAjsz%C3%A1ll%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sunset_in_Kis%C3%BAjsz%C3%A1ll%C3%A1s_-_2013.JPG","page_title":"Kisújszállás","context_page_description":"Kisújszállás város Jász-Nagykun-Szolnok megye Karcagi járásában. A név jelentése: kis jelző, a település viszonylag csekély kiterjedésével van kapcsolatban, az új ismételt vagy újabb megszállást jelez, míg a szállás szó a XIV.-XV. században a kunoknak és a jászoknak a magyarokénál kötetlenebb, és más szerkezetű falvait jelöli."},{"page_url":"https://es.wikipedia.org/wiki/Tustin_(California)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Orange_County_California_Incorporated_and_Unincorporated_areas_Tustin_Highlighted.svg","page_title":"Tustin (California)","context_page_description":"Tustin, fundada en la década de 1870, es una ciudad ubicada en el condado de Orange en el estado estadounidense de California. En el año 2004 tenía una población de 74.825 habitantes y una densidad poblacional de 2536,44 personas por km²."},{"page_url":"https://en.wikipedia.org/wiki/BMW_E9","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Stella5.JPG","page_title":"BMW E9","context_page_description":"The BMW E9 is a range of coupés produced from 1968 to 1975. Initially released as the 2800 CS model, the E9 was based on the BMW 2000 C / 2000 CS four-cylinder coupés, which were enlarged to fit the BMW M30 six-cylinder engine. The E9 bodywork was built by Karmann.\\nAs a racing car, the E9 was very successful in the European Touring Car Championship and the Deutsche Rennsport Meisterschaft, especially the 3.0 CSL homologation model.\\nThe E9 range was replaced by the E24 6 Series."},{"page_url":"https://fr.wikipedia.org/wiki/Escadron_de_transition_op%C3%A9rationnelle_2/8_Nice","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/DH100niceweb.jpg","page_title":"Escadron de transition opérationnelle 2/8 Nice","context_page_description":"L’escadron de transition opérationnelle 2/8 « Nice » est une unité de formation des pilotes de chasse de l'Armée de l'air française volant sur le biréacteur d’entraînement Alpha Jet depuis la base aérienne 120 de Cazaux.\\nDepuis le 25 août 2015, l'escadron fait à nouveau partie de la 8ᵉ escadre de chasse reformée le même jour sur la base de Cazaux.\\nNice, dans les Alpes-Maritimes, est la ville marraine de l'E.T.O. 02.008 « Nice » depuis le 25 octobre 1945."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B5%D0%BA%D1%81%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B9%D0%B1-%D0%B3%D0%B2%D0%B0%D1%80%D0%B4%D0%B8%D0%B8_%D0%BF%D0%BE%D0%BB%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/1861gir10-p19.png","page_title":"Кексгольмский лейб-гвардии полк","context_page_description":"Лейб-гвардии Кексгольмский Императора Австрийского полк,\\nс 26.07.1914 — лейб-гвардии Кексгольмский полк — полк Российской Императорской гвардии\\nСтаршинство — с 29 июня 1710 года\\nПолковой праздник — 29 июня"},{"page_url":"https://pl.wikipedia.org/wiki/K%C4%85p%C5%82awki","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/2008-02_K%C4%85p%C5%82awki_2.jpg","page_title":"Kąpławki","context_page_description":"Kąpławki – wieś w Polsce, położona w województwie warmińsko-mazurskim, w powiecie kętrzyńskim, w gminie Barciany.\\nW latach 1975–1998 wieś administracyjnie należała do województwa olsztyńskiego."},{"page_url":"https://uk.wikipedia.org/wiki/Paris_Match","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Paris_Match_1981_logo.svg","page_title":"Paris Match","context_page_description":"Парі Матч — інформаційно-розважальний ілюстрований тижневик, заснований в Парижі у 1949 р. генієм французького видавничого бізнесу Жаном Пруво. На сьогодні видання має світове розповсюдження з накладом майже 600 тис. примірників і вважається одним з найулюбленіших журналів франкомовних читачів.\\nParis Match зробив собі репутацію на найкращих фотографіях і найважливіших подіях в історії французької журналістики. Він почав виходити в 1926 р. як спортивний журнал і називався просто Match. Його творцем був легендарний французький журналіст Леон Бельбі, якому також належали неіснуючі нині газети L'intrasigeant і Lе Jour. У 1938 р. Бельбі продав видання Жану Пруво, власнику Paris-Soir.\\nНазва відноситься до прес-групи Hachette Filipacchi Medias, дочірньої компанії Lagardère Active Directory.\\nЗ червня 2009 року щотижня також доступна в цифровому вигляді."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B8%D1%81%D0%BE%D0%BA%D0%B8%D0%B9_(%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Commemorative.JPG","page_title":"Високий (Україна)","context_page_description":"Висо́кий — селище міського типу Харківського району Харківської області, знаходиться за 15 км на південний захід від Харкова.\\nОрган місцевої влади — Височанська селищна рада, якій підпорядковане селище Нова Березівка."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%AE%E7%A4%BA%E6%89%AB%E6%8F%8F%E9%87%8F%E7%83%AD%E6%B3%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Differential_scanning_calorimeter.jpg","page_title":"差示扫描量热法","context_page_description":"差示扫描量热法是一种热分析技术，借助补偿器测量使样品与参比物达到同样温度所需的加热速率与温度的关系。"},{"page_url":"https://en.wikipedia.org/wiki/Evans_Repeating_Rifle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Evans_Lever_Action_Carbine.jpg","page_title":"Evans Repeating Rifle","context_page_description":"The Evans Repeating Rifle was a lever-action repeating rifle designed by Warren R. Evans as a high capacity rifle."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D9%87%D8%AF%D9%86%D8%A7%D9%85%D9%87_%D9%85%D8%B3%DA%A9%D9%88_(%DB%B1%DB%B9%DB%B2%DB%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Treaty_of_Moscow_1921.jpg","page_title":"عهدنامه مسکو (۱۹۲۱)","context_page_description":"عهدنامه مسکو؛ عهدنامه‌ای بود که در ۱۶ مارس ۱۹۲۱ میلادی میان روسیه بلشویکی به رهبری ولادیمیر لنین و مجلس کبیر ملی ترکیه* به رهبری مصطفی کمال آتاترک در مسکو بسته شد و درباره مالکیت مناطقی مانند قارص، اردهان و آرتوین، باطوم، قره باغ و نخجوان بود."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D8%A3%D9%88%D9%82%D9%8A%D8%A7%D9%86%D9%88%D8%B3%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Urville-Viti-interior.jpg","page_title":"تاريخ أوقيانوسيا","context_page_description":"تاريخ أوقيانوسيا هو تاريخ أستراليا ونيوزيلاندا وبابوا غينيا الجديدة وفيجي وغيرها من دول أخرى تعد جزرًا تطل على المحيط الهادئ."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B0%D0%B2%D1%83%D0%BD_%D1%83_%D0%B1%D1%83%D0%B4%D1%96%D0%B2%D0%BD%D0%B8%D1%86%D1%82%D0%B2%D1%96_%D1%82%D0%B0_%D0%B0%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Regatta_Hotel.JPG","page_title":"Чавун у будівництві та архітектурі","context_page_description":"Чавун у будівництві та архітектурі — використання чавуну в будівництві та архітектурі як будівельного матеріалу для виготовлення як відповідальних несучих конструкцій, так і не відповідальних другорядних конструкцій і малих архітектурних форм та для суто декоративних і суміжних будівельних матеріалів.\\nПеріод використання чавуну як будівельного матеріалу припадає в основному на 1779—1880 роки, пізніше він був замінений якіснішими будівельними матеріалами — спочатку зварним залізом, потім сталлю і в багатьох сферах використання його вже давно є питанням історії. Хоча чавун у будівництві використовувався в багатьох країнах, лише в деяких з них він набув в цій сфері особливо широкого і різноманітного застосування. Тобто він був розповсюджений у країнах, де обсяги промислового виробництва заліза досягли високого рівня до винайдення способів виробництва сталі.\\nЧавун використовувався у мостобудуванні, конструюванні цивільних і промислових будівель та при спорудженні інших об'єктів. В перші десятиліття залізничного транспорту чавун був матеріалом, з якого виготовляли злізничні рейки."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A9nus_de_Milo","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Paris_Louvre_Venus_de_Milo_Debay_drawing-edit.png","page_title":"Vénus de Milo","context_page_description":"La Vénus de Milo est une statue en marbre représentant vraisemblablement la déesse Aphrodite, retrouvée sans ses bras dans l'île grecque de Milos en 1820. C'est une œuvre de l'époque hellénistique, créée vers 150-130 av. J.-C.\\nSon exposition au musée du Louvre en 1821 a fait sensation : c'était la première statue venue de Grèce dans les collections, et la première à être montrée incomplète. Sa célébrité est due à la grande beauté de son corps à demi dénudé, mais aussi aux polémiques suscitées par son identité et la position de ses bras. Parmi les nombreuses propositions pour restituer son attitude, les archéologues en privilégient deux, celle où la Vénus de Milo tient la pomme du jugement de Pâris ou celle où elle se regarde dans le bouclier d'Arès."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_belgischen_Nobelpreistr%C3%A4ger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Francois_Englert.jpg","page_title":"Liste der belgischen Nobelpreisträger","context_page_description":"Angeregt von Bertha von Suttner wird seit 1901 aus den Stiftungsgeldern des schwedischen Chemikers und Industriellen Alfred Nobel der Nobelpreis finanziert. Folgende Belgier erhielten die Auszeichnung:"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AF%87%E0%AE%B2%E0%AF%87%E0%AE%9A%E0%AF%81%E0%AE%A4%E0%AF%8D_%E0%AE%A4%E0%AF%87%E0%AE%B1%E0%AF%8D%E0%AE%B1%E0%AE%AE%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Thales%27_Theorem_Simple.svg","page_title":"தேலேசுத் தேற்றம்","context_page_description":"வடிவவியலில் தேலேசு தேற்றத்தின் கூற்று: ஒரு வட்டத்தின் மீது அமையும் மூன்றும் புள்ளிகள் A, B மற்றும் C. மேலும் கோடு AC, வட்டத்தின் விட்டம் எனில், கோணம் ABC செங்கோணமாக அமையும்.\\nஇத்தேற்றம் கிரேக்க கணிதவியலாளர் தேலேசு பெயரால் அழைக்கப்படுகிறது. பொதுவாக இத்தேற்றம் தேலேசுக்குரியதாகக் கருதப்பட்டாலும் சில சமயங்களில் இது கணிதவியலாளர் பித்தாகரசுக்குரியதாகவும் கருதப்படுகிறது."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%B7%D0%B1%D0%BE%D1%80%D0%B8_%D0%B7%D0%B0_%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D1%98%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA%D0%B0_%D0%A6%D1%80%D0%BD%D0%B5_%D0%93%D0%BE%D1%80%D0%B5_1997.","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Momir_Bulatovi%C4%87_%28cropped%29.jpg","page_title":"Избори за предсједника Црне Горе 1997.","context_page_description":"Избори за Предсједника Републике Црне Горе су били редовни избори за функцију Предсједника Републике Црне Горе, који су одржани у октобру 1997. године. Први изборни круг је одржан 5. октобра, а други 19. октобра. На изборима је учествовало осам кандидата. Иако је добио највише гласова у првом кругу, Момир Булатовић није освојио и законом прописану натполовичну већину, тако да су у други круг ушла двојица првопласираних кандидата, а побједу у другом кругу је однио Мило Ђукановић.\\nИзбори су били одржани недуго након политичког раскола у владајућој Демократској партији социјалиста Црне Горе, што је довело до значајних промјена у односу снага на политичкој сцени Црне Горе.\\nНајзначајније опозиционе и мањинске странке су 25. августа 1997. године склопиле споразум којим су се обавезале да на овим предсједничким изборима неће истицали сопствене кандидате, чиме су остварени предуслови за њихову активну или пасивну подршку Милу Ђукановићу. Поменути споразум су потписале: Народна странка, Либерални савез Црне Горе, Странка демократске акције Црне Горе, Демократски савез у Црној Гори, Демократска унија Албанаца и Социјалдемократска партија Црне Горе."},{"page_url":"https://en.wikipedia.org/wiki/List_of_UK_Rock_%26_Metal_Albums_Chart_number_ones_of_1999","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/GarbageAsHeavenIsWideManchester.JPG","page_title":"List of UK Rock & Metal Albums Chart number ones of 1999","context_page_description":"The UK Rock & Metal Albums Chart is a record chart which ranks the best-selling rock and heavy metal albums in the United Kingdom. Compiled and published by the Official Charts Company, the data is based on each album's weekly physical sales, digital downloads and streams. In 1999, there were 19 albums that topped the 52 published charts. The first number-one album of the year was Metallica's covers album Garage Inc., which remained at number one for the opening week of the year at the end of a five-week run which began in the week ending 5 December 1998. The final number-one album of the year was Live Era '87–'93, the first live album by American hard rock band Guns N' Roses, which spent the last three weeks of the year at number one.\\nThe most successful album on the UK Rock & Metal Albums Chart in 1999 was The Offspring's fourth studio album Americana, which spent a total of 17 weeks at number one over six spells, including a run of ten consecutive weeks between January and March. Americana was the best-selling rock and metal album of the year, ranking 50th in the UK End of Year Albums Chart."},{"page_url":"https://en.wikipedia.org/wiki/Chicama_Valley","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/ValleDeMoche.JPG","page_title":"Chicama Valley","context_page_description":"Chicama Valley is an area located at north of the Valley of Moche in La Libertad Region, northern Peru, it has agricultural resources where one of the main products is cane of sugar; this valley has been formed on both sides of the Chicama River."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%AA%D8%B1%D9%8A%D9%86_%D9%85%D8%A7%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Catherine_Mayer.jpg","page_title":"كاترين ماير","context_page_description":"كاترين ماير هي صحفية أمريكية، ولدت في عقد 1960 في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mammals_of_Burkina_Faso","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Tragelaphus_scriptus_%28taxobox%29.jpg","page_title":"List of mammals of Burkina Faso","context_page_description":"This is a list of the mammal species recorded in Burkina Faso. There are 147 mammal species in Burkina Faso, of which two are endangered, seven are vulnerable, and three are near threatened. One of the species listed for Burkina Faso can no longer be found in the wild.\\nThe following tags are used to highlight each species' conservation status as assessed by the International Union for Conservation of Nature:\\nSome species were assessed using an earlier set of criteria. Species assessed using this system have the following instead of near threatened and least concern categories:"},{"page_url":"https://en.wikipedia.org/wiki/Little_Boots","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Little_Boots_at_Rough_Trade_for_Record_Launch.jpg","page_title":"Little Boots","context_page_description":"Victoria Christina Hesketh, better known by her stage name Little Boots, is an English electropop singer-songwriter and DJ. She was previously a member of the band Dead Disco. Since performing as a solo artist she has released three albums, Hands, Nocturnes and Working Girl and a number of associated EPs and remixes. Hesketh has toured internationally both as a DJ-only act as well as with a full band. Hands reached number five on the UK Albums Chart and the singles \\"New in Town\\" and \\"Remedy\\" became top twenty hits."},{"page_url":"https://en.wikipedia.org/wiki/Missouri_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Missouri-bismarck-nd-2004-1.jpg","page_title":"Missouri River","context_page_description":"The Missouri River is the longest river in North America. Rising in the Rocky Mountains of western Montana, the Missouri flows east and south for 2,341 miles before entering the Mississippi River north of St. Louis, Missouri. The river drains a sparsely populated, semi-arid watershed of more than 500,000 square miles, which includes parts of ten U.S. states and two Canadian provinces. Although nominally considered a tributary of the Mississippi, the Missouri River above the confluence is much longer and carries a comparable volume of water. When combined with the lower Mississippi River, it forms the world's fourth longest river system.\\nFor over 12,000 years, people have depended on the Missouri River and its tributaries as a source of sustenance and transportation. More than ten major groups of Native Americans populated the watershed, most leading a nomadic lifestyle and dependent on enormous bison herds that roamed through the Great Plains. The first Europeans encountered the river in the late seventeenth century, and the region passed through Spanish and French hands before becoming part of the United States through the Louisiana Purchase."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%A1%83%E5%9C%92%E5%B8%82%E5%8D%80%E9%81%93%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/TW_THWty2.png","page_title":"桃園市區道列表","context_page_description":"桃园市区道列表列出桃园市的区道的起终点与里程。"},{"page_url":"https://ca.wikipedia.org/wiki/Rupert_Brooke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Rupert_Brooke_Q_71073.jpg","page_title":"Rupert Brooke","context_page_description":"Rupert Chawner Brooke va ser un poeta anglès conegut pels seus sonets de guerra idealistes escrits durant la primera guerra mundial, especialment \\"The Soldier\\"."},{"page_url":"https://de.wikipedia.org/wiki/Zwerchfellhernie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Cdh0002.jpg","page_title":"Zwerchfellhernie","context_page_description":"Bei einer Zwerchfellhernie werden durch eine Schwachstelle oder Lücke im Zwerchfell Bauchorgane in die Brusthöhle verlagert."},{"page_url":"https://vo.wikipedia.org/wiki/Yacolt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Clark_County_Washington_Incorporated_and_Unincorporated_areas_Yacolt_Highlighted.svg","page_title":"Yacolt","context_page_description":"Yacolt binon zif in komot: Clark, in tat: Washington, in Lamerikän."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Piratuba","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/1bras%C3%A3o_piratuba.jpg","page_title":"Piratuba","context_page_description":"Piratuba sī ūi-tī Pa-se Santa Catarina chiu ê chi̍t ê chū-tī-thé.\\nChe sī chi̍t phiⁿ koan-î Pa-se tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://ia.wikipedia.org/wiki/Ricardo_Garc%C3%ADa_C%C3%A1rcel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Ricardo_Garc%C3%ADa_C%C3%A1rcel.jpg","page_title":"Ricardo García Cárcel","context_page_description":"Ricardo García Cárcel es un historico e essayista espaniol. Ille obteneva le graduation de philosophia e litteratura in le Universitate de Valencia in 1970. Ille es professor de historia moderne al Universitate Autonome de Barcelona.\\nIlle anque es un academico correspondente del Academia Regal del Historia ab le anno 2001 e membro del Foro Babel."},{"page_url":"https://ro.wikipedia.org/wiki/Ceas_etan%C8%99_de_scufundare","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Seiko_SBBN007_Diver%27s_300m_on_a_4-ring_NATO_style_strap.jpg","page_title":"Ceas etanș de scufundare","context_page_description":"Ceasul de scufundare este un instrument esențial al echipamentului de scufundare autonomă, fiind utilizat la cronometrarea timpului de scufundare, a timpilor de decompresie și, împreună cu profundimetrul, la calculul vitezei de urcare a scafandrului către suprafața apei.\\nUn ceas de scufundare etanș trebuie să fie rezistent la o presiune de cel puțin 8 bar și să aibă o carcasă din oțel inoxidabil. Cadranul trebuie să fie ușor de citit, să fie fosforescent și să aibă un minutar bine vizibil. Cea mai mare parte a ceasurilor de scufundare sunt prevăzute cu o „lunetă“ mobilă, situată în jurul cadranului, pentru fixarea momentului inițial al cronometrării. De asemenea, ceasul de scufundare trebuie să aibă o brățară sau o curea reglabilă, destul de lungă pentru a putea fi atașată și peste mâneca costumului de scufundare din neopren. Există și ceasuri cu afișaj electronic luminos care simplifică citirea."},{"page_url":"https://pt.wikipedia.org/wiki/Governo_de_Hamburgo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/HH_Polizeihauptmeister_MZ.jpg","page_title":"Governo de Hamburgo","context_page_description":"O governo de Hamburgo é dividido em poderes executivo, legislativo e judiciário. Hamburgo é uma cidade-estado e município e, portanto, sua governança lida com vários detalhes da política da comunidade estadual e local. Tem lugar em duas fileiras — uma administração municipal e estadual e uma classificação local para os distritos. O chefe do governo da cidade-estado é o primeiro prefeito e presidente do Senado. Um ministério é chamado Behörde e um ministro do estado é um senador em Hamburgo. A legislatura é o parlamento estadual, chamado Hamburgische Bürgerschaft, e o poder judiciário é composto pelo supremo tribunal estadual e outros tribunais. A sede do governo é a Hamburg Rathaus. O Presidente do Parlamento de Hamburgo é a mais alta pessoa oficial da Cidade Livre e Hanseática de Hamburgo. Esta é uma diferença tradicional para os outros estados alemães. O presidente não está autorizado a exercer qualquer ocupação do executivo.\\nAntes de 1871, Hamburgo era um país totalmente soberano e seu governo um governo soberano. Ao ingressar no Império Alemão, a cidade-estado manteve a soberania parcial como um estado federal."},{"page_url":"https://ca.wikipedia.org/wiki/Blanzy-la-Salonnaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Blanzy_la_Salonnaise-08190_%28Ardennes%29_cropped.jpg","page_title":"Blanzy-la-Salonnaise","context_page_description":"Blanzy-la-Salonnaise és un municipi francès, situat al departament de les Ardenes i a la regió del Gran Est. L'any 2007 tenia 318 habitants."},{"page_url":"https://ca.wikipedia.org/wiki/Cyphotilapia_frontosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Frontosa_Cichlid.JPG","page_title":"Cyphotilapia frontosa","context_page_description":"Cyphotilapia frontosa és una espècie de peix de la família dels cíclids i de l'ordre dels perciformes."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_de_Gen%C3%A8ve","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Geneve_maison_Mallet_2011-08-17_13_26_57_PICT3895.JPG","page_title":"Liste des biens culturels d'importance nationale dans le canton de Genève","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton de Genève. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton de Genève. Il est trié par commune et inclus : 86 bâtiments séparés, 46 collections et 10 sites archéologiques."},{"page_url":"https://es.wikipedia.org/wiki/Croton_urucurana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Croton_urucurana_%282%29.jpg","page_title":"Croton urucurana","context_page_description":"El sangre de drago es una especie de árbol de la familia de las euforbiáceas."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B4%B9%E7%A7%91%E5%BA%93%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Map_commune_FR_insee_code_54190.png","page_title":"费科库尔","context_page_description":"費科庫爾是法國默爾特-摩澤爾省的一個市鎮，位於該省南部，屬於圖勒區。該市鎮總面積7.86平方公里，2009年時的人口為117人。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AE%BE%E0%AE%B0%E0%AF%8D%E0%AE%95%E0%AE%B0%E0%AF%8D_%E0%AE%93%E0%AE%B0%E0%AE%BF%E0%AE%AF%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AE%B2%E0%AF%8D_%E0%AE%86%E0%AE%AF%E0%AF%8D%E0%AE%B5%E0%AF%81_%E0%AE%A8%E0%AE%BF%E0%AE%B1%E0%AF%81%E0%AE%B5%E0%AE%A9%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/BORI%2C_Pune.jpg","page_title":"பண்டார்கர் ஓரியண்டல் ஆய்வு நிறுவனம்","context_page_description":"பண்டார்கர் ஓரியண்டல் ஆய்வு நிறுவனம் இந்தியாவில் மகாராஷ்டிரா மாநிலத்தில் புனேயில் அமைந்துள்ள ஓர் ஆய்வு மையம் ஆகும்.. இந்த மையம் ஜூலை 6, 1917 ஆம் நாளன்று நிறுவப்பட்டது. இதற்குஇந்தியாவில் இந்திவியலின் நிறுவனர் என்று நீண்ட காலமாக கருதப்பட்டு வருகின்ற ராமகிருஷ்ண கோபால் பண்டர்கர் பெயர் சூட்டப்பட்டது. இந்த நிறுவனம் பழைய சமஸ்கிருதம் மற்றும் பிரகிருத கையெழுத்துப் பிரதிகளின் தொகுப்பிற்கு நன்கு அறியப்பட்டதாகும்."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_im_Landkreis_Dillingen_an_der_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Buttenwiesen_Knoblauchsw%C3%A4ldle_014.jpg","page_title":"Liste der Landschaftsschutzgebiete im Landkreis Dillingen an der Donau","context_page_description":"Im Landkreis Dillingen an der Donau gibt es 17 Landschaftsschutzgebiete."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B9%D9%85%D8%B1_%D8%AE%D8%B6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Omar_Khadr_-_PD-Family-released.jpg","page_title":"عمر خضر","context_page_description":"عمر احمد خضر تبعه کانادا با پدر مصری الاصل و مادر عربستانی الاصل است. او در ۲۷ ژوئیه ۲۰۰۲ به جرم کشتن سروان کریستفر اسپیر با نارنجک در سن ۱۵ سالگی، توسط نیروهای آمریکایی در افغانستان بعد از ۴ ساعت درگیری در روستای ایوب خیل دستگیر شد. گفته شده‌است که این کار او به تحریک پدرش که یک مسلمان افراطی است صورت گرفته‌است.عمر ۸ سال در گوانتانامو زندانی و کوچکترین زندانی این زندان است. به‌طوری‌که به او کودک سرباز می‌گویند.\\nبر خلاف قوانین عفو بین‌الملل و آیین‌نامه یونیسف در مورد کودک سرباز، دولت کانادا تلاشی برای بازگرداندن او به کانادا نکرد.\\nدر سال ۲۰۰۹ فاش شد که دولت کانادا ۱ میلیون و ۳۰۰ هزار دلار پرداخته‌است تا عمر در گوانتانامو باقی بماند.\\nاو در مدت زندانی بودن در گوانتانامو توسط بازجوهایش تهدید به تجاوز جنسی شد و تا مدت زیادی دسترسی به وکیل نداشت.عمر در ۲۸ اکتبر ۲۰۱۰ در گوانتانامو محاکمه شد و بدون اینکه صحبتی از سن پایین او در هنگام ارتکاب جرم شود، او در مقابل قاضی و بیوه کریستفر اسپیر به جرم خود اعتراف کرد و گفت که «واقعاً برای رنجی که به آن‌ها وارد کرده متاسف است و فهمیده‌است که تنفر چیزی برای انسان به ارمغان نمی‌آورد و عشق و محبت بهتر از هر چیزی است».\\nاو به جرم قتل و توطئه برای اقدامات تروریستی به ۴۰ سال زندان محکوم شد."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B1%D0%B8%D1%82%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%BD%D1%96%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/%D0%97%D0%B1%D0%B8%D1%82%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D0%BD%D1%96%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA_%28%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC%D0%B0%D0%BB%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B5_%D0%B2%D0%BE%D0%B4%D0%BE%D1%81%D1%85%D0%BE%D0%B2%D0%B8%D1%89%D0%B5%29.JPG","page_title":"Збитенський орнітологічний заказник","context_page_description":"Зби́тенський орнітологі́чний зака́зник — орнітологічний заказник місцевого значення в Україні. Розташований у межах Острозького району Рівненської області, на південний захід від села Новомалин.\\nПлоща 200 га. Статус надано згідно з рішенням Рівненського облвиконкому від 13.10.1993 року, № 213. Перебуває у віданні ДП СЛАП «Остозький держспецлісгосп».\\nСтатус надано з метою збереження водно-болотного природного комплексу як місця гніздування різних видів птахів.\\nТериторія заказника входить до складу Дермансько-Острозького національного природного парку."},{"page_url":"https://de.wikipedia.org/wiki/Lehigh_Valley_International_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/1999_-_ABE_Airport_Airphoto.jpg","page_title":"Lehigh Valley International Airport","context_page_description":"Der Lehigh Valley International Airport ist ein öffentlicher Flughafen, welcher sich in Hanover Township, Lehigh County, Pennsylvania befindet.\\nEr liegt 6 km nordöstlich von Allentown in der Region Lehigh Valley in Pennsylvania, der Region mit der drittgrößten Bevölkerung des Staates.\\nDer Flughafen ist im Besitz der Lehigh-Northampton Airport Authority, welche ihn auch betreibt. Im Jahre 2018 verzeichnete der Flughafen 792.974 Passagiere. Für das Jahr 2019 stufte ihn die amerikanische Luftfahrtbehörde als \\"nonhub\\" ein, also als einen Flughafen, welcher 10.000 Fluggäste, aber weniger als 0,05 % der jährlichen Passagierzahlen der USA verzeichnet. In früheren Jahren wurde der Flughafen als \\"small hub\\" bezeichnet.\\nIn den vergangenen Jahren erhielt der Lehigh Valley International Airport immer größere Konkurrenz durch den Philadelphia International Airport und den Newark Liberty International Airport. Diese Flughäfen bieten eine größere Vielfalt an Flugzielen und manchmal auch günstigere Tarife an. Diese Konkurrenz wurde durch die Verlängerung der Interstate 78 im Jahr 1990 und durch die Eröffnung der Interstate 476 vergrößert."},{"page_url":"https://sv.wikipedia.org/wiki/Ufeus_lura","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Ufeus_hulstii_male.jpg","page_title":"Ufeus lura","context_page_description":"Ufeus lura är en fjärilsart som beskrevs av Dyar 1914. Ufeus lura ingår i släktet Ufeus och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Ada_Fija%C5%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ada_Fija%C5%82_Eurowizja_2011.jpg","page_title":"Ada Fijał","context_page_description":"Ada Fijał is a Polish television actor and singer. She was unsuccessful in a bid to represent Poland in the Eurovision Song Contest in 2011. She did appear in the Polish version of Dancing with the Stars."},{"page_url":"https://pt.wikipedia.org/wiki/Per_Teodor_Cleve","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Cleve_Per_Theodor.jpg","page_title":"Per Teodor Cleve","context_page_description":"Per Teodor Cleve foi um químico e geólogo sueco.\\nApós graduar-se no colegial, em Escocolmo, Cleve matriculou-se na Universidade de Uppsala em maio de 1858, onde recebeu seu Ph.D. em 1863. Em 1874, depois de vários cursos na Europa e América do Norte, tornou-se professor da Universidade de Uppsala.\\nCleve descobriu os elementos químicos hólmio e túlio em 1879. Em 1874 concluiu que o didímio era de fato dois elementos químicos: praseodímio e neodímio.\\nRecebeu em 1894 a Medalha Davy da Royal Society, \\"por suas pesquisas na química das terras raras”. O mineral cleveita foi nomeado pelo geólogo e explorador Adolf Erik Nordenskiöld, em 1878, em sua homenagem.\\nAvô materno de Ulf Svante von Euler, laureado com o Nobel de Fisiologia ou Medicina de 1970."},{"page_url":"https://de.wikipedia.org/wiki/La_Chapelle-Th%C3%A9mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Blason_de_La_Chapelle_Th%C3%A9mer.jpg","page_title":"La Chapelle-Thémer","context_page_description":"La Chapelle-Thémer ist eine französische Gemeinde mit 382 Einwohnern im Département Vendée in der Region Pays de la Loire; sie gehört zum Arrondissement Fontenay-le-Comte und zum Kanton La Châtaigneraie. Die Einwohner werden Théméraires genannt."},{"page_url":"https://cs.wikipedia.org/wiki/Fryderyk_Chopin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Chopin_deska2.jpg","page_title":"Fryderyk Chopin","context_page_description":"Fryderyk Franciszek Chopin, francouzsky Frédéric François Chopin, výslovnost česká [šopén], francouzská, dříve psáno rovněž „Szopen“ byl polský skladatel vážné hudby a klavírní virtuos období romantismu, který proslul jako „básník klavíru“.\\nJeho otec byl francouzský emigrant, matka pocházela ze zchudlého šlechtického rodu z Polska. Fryderyk Chopin prožil dětství ve Varšavě, kde se v roce 1816 začal učit hru na klavír u Čecha Vojtěcha Živného. Již v sedmi letech se pokoušel o své první skladby. Od roku 1822 byl žákem varšavského lycea a mezi léty 1826–1829 se učil u Józefa Elsnera hudební teorii na konzervatoři. Po škole slavil úspěch koncertováním ve Vídni a Drážďanech, na území dnešního Česka měl malý soukromý recitál v Teplicích. V roce 1830 opustil Polsko a vydal se do Vídně. V roce 1831 přesídlil do Paříže, kde působil také jako učitel hudby. Zde navázal vztah se spisovatelkou George Sandovou, se kterou se však nikdy neoženil, a po rozchodu s ní již nenavázal další vztah. V letech 1838–1839 pobýval na Mallorce, kde těžce onemocněl tuberkulózou. Často pobýval v lázních po celé Evropě, v roce 1848 cestoval i po Anglii a Skotsku."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Steinh%C3%B6fel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Sowjetischer_Ehrenfriedhof_Steinh%C3%B6fel_2016.jpg","page_title":"Liste der Baudenkmale in Steinhöfel","context_page_description":"In der Liste der Baudenkmale in Steinhöfel sind alle Baudenkmale der brandenburgischen Gemeinde Steinhöfel und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Steinhöfel aufgeführt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1973","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Stefano_Garzelli_en_el_Giro_de_Italia_2007.jpg","page_title":"Lijst van personen geboren in 1973","context_page_description":"Dit is een lijst van personen die geboren zijn in 1973.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Sch%C3%BCttorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Einwohnerentwicklung_von_Sch%C3%BCttorf_%281945_-_1959%29.svg","page_title":"Schüttorf","context_page_description":"Schüttorf is a town in the district of Grafschaft Bentheim in southwesternmost Lower Saxony near the Dutch border and the boundary with Westphalia. The town of Schüttorf forms with the surrounding communities the Joint Community of Schüttorf. It is the district's oldest town. It lies on the river Vechte, roughly 5 km east of Bad Bentheim, and 20 km southeast of Nordhorn."},{"page_url":"https://pl.wikipedia.org/wiki/Valdegov%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Uribarri_Gaubea.jpg","page_title":"Valdegovía","context_page_description":"Valdegovía – gmina w Hiszpanii, w prowincji Araba, w Kraju Basków, o powierzchni 238,27 km². W 2011 roku gmina liczyła 1067 mieszkańców."},{"page_url":"https://gl.wikipedia.org/wiki/Vertixe_Sonora_Ensemble","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Vertixe.JPG","page_title":"Vertixe Sonora Ensemble","context_page_description":"Vertixe Sonora Ensemble é un conxunto de cámara galego fundado no 2010. Trátase dunha agrupación especializada en música clásica contemporánea. O seu labor recolleuse no documental Correspondencias Sonoras do cineasta Manuel del Río."},{"page_url":"https://id.wikipedia.org/wiki/Silsilah_Kaisar_Tiongkok_(akhir)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%E6%98%8E%E7%A9%86%E5%AE%97.jpg","page_title":"Silsilah Kaisar Tiongkok (akhir)","context_page_description":"Berikut ini merupakan silsilah dari kaisar-kaisar Tiongkok dari tahun 1279 sampai 1912, yang ketiga dari tiga periode selama 700 tahun, dari penaklukkan Tiongkok oleh Mongol sampai akhir dari Dinasti Qing pada tahun 1912.\\nSilsilah Kaisar Tiongkok → Silsilah Kaisar Tiongkok → Silsilah Kaisar Tiongkok → Silsilah Kaisar Tiongkok (akhir)"},{"page_url":"https://sv.wikipedia.org/wiki/SSM_Holding","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Kvarteret_Timotejen%2C_V%C3%A4stberga%2C_aug_2019.jpg","page_title":"SSM Holding","context_page_description":"SSM Holding är ett svenskt fastighetsbolag med säte i Stockholm."},{"page_url":"https://nl.wikipedia.org/wiki/Oude_Sint-Clemenskerk_(Gerwen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sint_Clemenskerk_P1050889.JPG","page_title":"Oude Sint-Clemenskerk (Gerwen)","context_page_description":"De Sint-Clemenskerk is een kerkgebouw te Gerwen, gelegen aan Heuvel 23 aldaar.\\nOp deze plaats hebben drie kerken gestaan: De eerste stenen kerk van 1350-1400 was een eenvoudige zaalkerk. Vervolgens werd een driebeukige kruiskerk gebouwd van 1420-1440. In 1620 kwam, na een brand in 1612, de huidige kerk tot stand, waarbinnen zich nog resten bevinden van de voorgaande kerk, die in Kempense gotiek is uitgevoerd. De kerk werd van 1648-1798 voor de protestante eredienst gebruikt, daarna werd ze weer katholiek. Tussen 1887 en 1889 kreeg de kerk een neogotisch interieur. Vincent van Gogh beeldde deze kerk af in 1883.\\nIn 1967 bouwde de rooms-katholieke parochie een nieuwe en grotere Sint-Clemenskerk. De historisch waardevolle oude Sint Clemenskerk, die ondertussen geklasseerd werd als Rijksmonument, zou, naar werd beloofd, een nieuwe bestemming krijgen, die echter nog niet bekend was. Ze kwam dan ook leeg te staan, werd dichtgetimmerd, zwaar verwaarloosd en aan het verval en vandalisme overgegeven."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%9C%88%E8%9A%A3%E8%88%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Imperial_Encyclopaedia_-_Military_Administration_-_pic083_-_%E8%9C%88%E8%9A%A3%E8%88%B9%E5%9C%96.svg","page_title":"蜈蚣船","context_page_description":"蜈蚣船，是明清时期一种战船的名称，因两侧船桨众多仿如蜈蚣而得名。"},{"page_url":"https://it.wikipedia.org/wiki/Museo_Willet-Holthuysen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Willet-holthuysen2.jpg","page_title":"Museo Willet-Holthuysen","context_page_description":"Il Museo Willet-Holthuysen è una casa-museo del centro di Amsterdam, situata lungo il canale Herengracht.\\nIl museo, inaugurato nel 1962 e collocato in un edificio risalente al 1685, offre uno “spaccato” di vita in una casa signorile della capitale olandese tra il Settecento e l'Ottocento.\\nIl museo prende il nome dagli ultimi proprietari dell'edificio, i coniugi Abraham Willet e Sandrina Louisa Geertruida Holthuysen, collezionisti di dipinti, cristalli, argenteria, porcellane, ecc., i quali, privi di eredi, donarono la casa al comune di Amsterdam nel 1895, perché ne facessero un museo.\\nIn precedenza, la casa fu proprietà di signori appartenenti alle più ricche famiglie della città, come Jacob Hop, Isabella Hooft, Jean Deutz van Assendelft, Willem Gideon Deutz e Pietre Gerard Holthuysen"},{"page_url":"https://it.wikipedia.org/wiki/Gymnopilus_spectabilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Gymnopilus_spectabilis01.JPG","page_title":"Gymnopilus spectabilis","context_page_description":"Il Gymnopilus spectabilis è un fungo che cresce cespitoso prevalentemente su legname marcescente.\\nAnche conosciuto, unitamente ad alcune specie congeneri, come il \\"fungo della risata\\" per le sue proprietà allucinogene, pare che in alcune zone del Giappone detto fungo venga adoperato per rallegrare i commensali. Dicono che può essere dato alle donne per farle ridere e convincerle a ballare nude, questo afferma tale 'Nihachiro Sasaki, un anziano micologo giapponese noto per aver scoperto come coltivare il Maitake, meglio conosciuto come Grifola frondosa, un fungo commestibile con spiccate proprietà officinali."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D0%B8%D0%BA%D0%BE-%D0%A9%D1%83%D1%87%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%89%D0%B5_%D0%BB%D1%96%D1%82%D0%BE%D0%BF%D0%B8%D1%81%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BC%D1%96%D1%81%D1%82%D0%B0_%D0%A7%D1%83%D1%87%D0%B8%D0%BD%D0%B0_%2C_%D1%81._%D0%91%D0%B0%D0%BB%D0%B8%D0%BA%D0%BE-%D0%A9%D1%83%D1%87%D0%B8%D0%BD%D0%BA%D0%B0_01.JPG","page_title":"Балико-Щучинка","context_page_description":"Бали́ко-Щу́чинка — село в Україні, у Кагарлицькому районі Київської області. Населення становить 484 осіб."},{"page_url":"https://en.wikipedia.org/wiki/Reaseheath_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Reaseheath_Hall%2C_nr_Nantwich.jpg","page_title":"Reaseheath College","context_page_description":"Reaseheath College is a land-based further education and higher education college, mainly located on the outskirts of Nantwich in Cheshire, England.\\nThe college offers courses in Adventure Sports, Agriculture, Agricultural Engineering, Animal Management, Business and Events Management, Construction, Countryside, Equine, Floristry, Food, Horticulture, Motor Vehicle, Public Services and Sports Studies. Its main base is at Reaseheath, but there are also Outreach Centres at Church Farm, Wirral and Croft End Equestrian Centre, Oldham.\\nThe higher education courses Reaseheath College offers are in conjunction with the University of Chester.\\nResidential accommodation is available to both further and higher education students at the main college site.\\nThe Principal of the College is Marcus Clinton."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Ciudad_Real","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Alarcos_%28Ciudad_Real%29_cerro_y_asentamiento_%C3%ADbero_%28RPS_25-08-2012%29.png","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Ciudad Real","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Ciudad Real."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Klein_Trebbow","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Klein_Trebbow_Herrenhaus_2014-06-01_8a.jpg","page_title":"Liste der Baudenkmale in Klein Trebbow","context_page_description":"In der Liste der Baudenkmale in Klein Trebbow sind alle denkmalgeschützten Bauten der mecklenburgischen Gemeinde Klein Trebbow und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Denkmalliste des Kreises Nordwestmecklenburg mit dem Stand vom 24. November 1995."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%D9%84%DB%8C%D8%A7%D9%85_%D8%AA%D8%A7%D9%85%D8%B3_%D8%A8%D9%84%D8%A7%D9%86%D9%81%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/WTBlanford.jpg","page_title":"ویلیام تامس بلانفورد","context_page_description":"ویلیام تامس بلانفورد زمین‌شناس و طبیعی‌دان انگلیسی بود. برجسته‌ترین اثر او جانوران هند بریتانیا، سیلان و برمه بود."},{"page_url":"https://de.wikipedia.org/wiki/Bartholom%C3%A4uskirche_(Markgr%C3%B6ningen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Gr%C3%B6ninger_Di%C3%B6zese_nach_1736.png","page_title":"Bartholomäuskirche (Markgröningen)","context_page_description":"Die Bartholomäuskirche in Markgröningen, der ehemaligen Reichs- und württembergischen Amtsstadt Grüningen, ist ein in mehreren Bauphasen entstandener gotischer Kirchenbau aus dem 13. bis 15. Jahrhundert. Die dem Apostel Bartholomäus geweihte und heute evangelische Kirche hat zwei Kirchtürme mit unterschiedlichen Turmhelmen. Sie ersetzte eine romanische Basilika auf einer aufgeschütteten Rampe über dem frühmittelalterlichen Dorfkern im Südosten und einem Herrenhof im Süden."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%D8%B1%D8%AA%D9%84%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Sortland_viewed_from_Strandheia.jpg","page_title":"سورتلند","context_page_description":"سورتلند یک شهرک در نروژ است که در نوردلاند واقع شده‌است. سورتلند ۷۲۱٫۹۲ کیلومتر مربع مساحت و ۱۰٬۳۷۸ نفر جمعیت دارد."},{"page_url":"https://no.wikipedia.org/wiki/George_Nathaniel_Curzon","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Curzon-after-oxford.jpg","page_title":"George Nathaniel Curzon","context_page_description":"George Nathaniel Curzon, 1. marki Curzon av Kedleston, kjent som lord Curzon av Kedleston mellom 1898 og 1911 og som jarl Curzon av Kedleston mellom 1911 and 1921, var en britisk politiker fra Det konservative parti, visekonge av India, utenriksminister og leder av House of Lords fra 1924 og til sin død. Han var kandidat til å bli statsminister i 1923, men flertallet i det konservative partiet syntes det var uheldig at partiet skulle ledes av en lord, slik at valget falt på Stanley Baldwin i stedet. Han var sentral i delingen av Bengal i 1905 og han tegnet opp Curzonlinjen som demarkasjonslinje mellom polske og russiske styrker i Øst-Europa i 1919. Han var omstridt i sin samtid og det hersket ulike oppfatninger om ham, og «det ble sådd med like rause hender både takknemlighet og harme langs hans vei». Han kunne stå i endeløse krangler og hans arroganse og lite fleksible holdning ga ham flere fiender."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D5%B8%D5%B7%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Xiqiaoshan2.jpg","page_title":"Ֆոշան","context_page_description":"Ֆոշան, քաղաքային շրջան Չինաստանի Ժողովրդական Հանրապետության Գուանդուն նահանգի կենտրոնական մասում, Մարգարտագետի դելտայում, 16 կիլոմետր դեպի հարավ-արևմուտք Գուանչժոու քաղաքից, որի հետ կապված է երկաթուղով, 2010 թվականից՝ նաև մետրոյի առանձին ճյուղով: Մարգարտագետի դելտայի տնտեսական գոտու ձախակողմյան հատվածի բաղկացուցիչ մասն է: Քաղաքի տնտեսությունում ստեղծվող համախառն ներքին արդյունքի տարեկան ծավալը հասել է 940 միլիարդ յուանի կամ 139 միլիարդ ամերիկյան դոլարի: Ֆոշանն զբաղեցնում է 3.868 քառակուսի կիլոմետր տարածք: 2012 թվականի տվյալներով բնակչության թվաքանակը մոտեցել էր 7,2 միլիոնի: 2009 թվականի մարտի 19-ին Ֆոշանի և Գուանչժոուի համայնքապետարանները կնքել են այս երկու հարևան քաղաքների հետագա զարգացման համատեղ պլան մշակելու և իրագործելու պայմանագիր:\\nՖոշանը առևտրային հին քաղաք է, որտեղ հնուց զարգացել են նաև հախճապակու և մետաքսեղենի արտադրության ձեռնարկությունները: XVIII դարում մրցակցել է Հանչժոուի հետ Չինաստանի՝ մեծությամբ չորրորդ տնտեսական կենտրոնը համարվելու համար: Սակայն գետի ճյուղավորումների տիղմապատման հետևանքով զրկվել է մեծ բեռնատարողությամբ նավեր ընդունելու հնարավորությունից և և ի վերջո վերածվել է բուռն թափով աճած Գուանչժոուի արդյունաբերական հավելուկի:"},{"page_url":"https://cs.wikipedia.org/wiki/Kranas_americk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Yellowtail%2C_Brazil.JPG","page_title":"Kranas americký","context_page_description":"Kranas americký je ostnoploutvá ryba patřící do čeledi kranasovití a rodu kranas. Obývá subtropické vody Indo-Pacifiku, Tichého oceánu i Atlantiku. Měří asi 2,5 metru."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Hackney_Downs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Hackney_Downs_stn_entrance.JPG","page_title":"Station Hackney Downs","context_page_description":"Hackney Downs is een spoorwegstation van National Rail in Hackney in Engeland. Het station is eigendom van Network Rail en wordt beheerd door Greater Anglia."},{"page_url":"https://bs.wikipedia.org/wiki/Rezolucija_Vije%C4%87a_sigurnosti_broj_12","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/DSE_badge.svg","page_title":"Rezolucija Vijeća sigurnosti broj 12","context_page_description":"Rezolucija Vijeća sigurnosti broj 12 je donesena 10. decembra 1946. godine, u Vijeću sigurnosti Ujedinjenih nacija na 82. sjednici. Tema rezolucije je tzv. grčko pitanje, i međunarodne posljedice Grčkog građanskog rata. Predstavnicima Grčke i DF Jugoslavije je omogućeno učestvovanje na sjednici, dok su predstavnici Albanije i Bugarske predstavili zvaničnu izjavu, te su u određenim okolnostima mogli učestvovati u diskusiji. Nakon što je Sovjetski Savez u januaru 1946. godine, optužio britanske vojne trupe za mješanje u unutrašnje poslove Grčke, a eskalacijom građanskog rata u martu iste godine, između lijevo orijentiranog narodnog fronta Demokratske armije Grčke i konzervativne grčke Vlade, koju je u tom periodu podržavala Velika Britanija, došlo je so direktnog logističkog potpomaganja grčkih partizana od strane Albanije i DFJ, te organiziranja logora za obuku i oporavak grčkih revolucionara u Jugoslaviji."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_monumentelor_istorice_din_jude%C8%9Bul_Bra%C8%99ov_-_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/RO_BV_Bra%C8%99ov_Casa_Br%C3%A2ncoveanu-Manolache_Lambrino_4.JPG","page_title":"Lista monumentelor istorice din județul Brașov - B","context_page_description":"Lista monumentelor istorice din județul Brașov - B cuprinde monumentele istorice înscrise în Patrimoniul cultural național al României și aflate în localități ce încep cu litera B din județul Brașov.\\nLista completă este menținută și actualizată periodic de către Ministerul Culturii, Cultelor și Patrimoniului Național din România, prin intermediul Institutului Național al Patrimoniului, ultima versiune datând din 2015. Această listă cuprinde și actualizările ulterioare, realizate prin ordin al ministrului culturii."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D1%83%D1%81%D1%82%D0%B2%D0%B5%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Olustvere_P%C3%B5llunduskeskkool.jpg","page_title":"Олуствере","context_page_description":"О́луствере — посёлок в волости Пыхья-Сакала уезда Вильяндимаа, Эстония.\\nДо административной реформы местных самоуправлений Эстонии 2017 года входил в состав волости Сууре-Яани."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%86%D9%84%D9%87_%D8%AF%DB%8C_%D8%A8%D9%88%D9%84%DA%AF%D8%B1%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Celle_di_Bulgheria.jpg","page_title":"چله دی بولگریا","context_page_description":"چله دی بولگریا یک کومونه در ایتالیا است که در استان سالرنو واقع شده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Fran%C3%A7ois_Le_Gonidec_de_Kerdaniel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Lochrist_10_Monument_Le_Gonidec_vue_d%27ensemble.jpg","page_title":"Jean François Le Gonidec de Kerdaniel","context_page_description":"Jean-François-Marie-Maurice-Agathe Le Gonidec de Kerdaniel est un grammairien breton, linguiste de la langue bretonne, premier unificateur de l'orthographe de la langue bretonne. Il fut aussi un celtomane."},{"page_url":"https://en.wikipedia.org/wiki/Gra%C3%A7a_Machel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Obama_and_Machel.jpg","page_title":"Graça Machel","context_page_description":"Graça Machel DBE HonFBA is a Mozambican politician and humanitarian. She is the widow of both former presidents of Mozambique and South Africa; Mozambican president Samora Machel and South African president Nelson Mandela. Machel is an international advocate for women's and children's rights and was made an honorary British Dame by Queen Elizabeth II in 1997 for her humanitarian work. She is the only woman in modern history to have served as First Lady of two countries.\\nGraça Machel is a member of the Africa Progress Panel, a group of ten distinguished individuals who advocate at the highest levels for equitable and sustainable development in Africa. As a panel member she facilitates coalition building to leverage and broker knowledge, and convenes decision-makers to influence policy for lasting change in Africa.\\nShe was chancellor of the University of Cape Town between 1999 and 2019."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%81%D0%BE%D0%B1%D0%BD%D1%8F%D0%BA_%D0%90%D1%80%D1%88%D0%B0%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/DSC05270-%D0%9B%D1%8E%D1%82%D0%B5%D1%80%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0%2C23.JPG","page_title":"Особняк Аршавського","context_page_description":"Особняк Аршавського — пам'ятка архітектури в Києві на Липках на вулиці Лютеранській, 23. Побудований у 1907 році за проектом архітектора Едуарда Брадтмана в стилі раннього модерну. Має статус пам'ятки архітектури місцевого значення.\\nБудинок відомий під поетичною назвою «Дім невтішної вдови», ймовірно, через те, що його головний фасад вінчає жіноча маска і під час дощу кам'яними щоками сумної красуні невпинно течуть сльози. За легендою, будинок належав якійсь безутішній вдові, але насправді його замовив Сергій Аршавський. Ні він, ні його родина не бідували."},{"page_url":"https://de.wikipedia.org/wiki/Typ_96_24-cm-Haubitze","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Type_96_24-cm-howitzer.jpg","page_title":"Typ 96 24-cm-Haubitze","context_page_description":"Die Typ 96 24-cm-Haubitze war eine Haubitze, die vom Kaiserlich Japanischen Heer während des Pazifikkrieges von 1942 bis 1945 eingesetzt wurde. Die Bezeichnung Typ 96 deutet dabei auf das Jahr der Truppeneinführung, das Jahr Kōki 2596 bzw. 1936 nach gregorianischem Kalender, hin."},{"page_url":"https://ceb.wikipedia.org/wiki/Exilisciurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/SciurusWhiteheadiSmit.jpg","page_title":"Exilisciurus","context_page_description":"Henero sa mga mangungutkut ang Exilisciurus. Ang Exilisciurus sakop sa kabanay nga Sciuridae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://no.wikipedia.org/wiki/Marcus_Antonius","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/CdM%2C_marcantonio_raffigurato_come_alessandro%2C_sardonice%2C_40_ac._circa.JPG","page_title":"Marcus Antonius","context_page_description":"Marcus Antonius var en romersk politiker og general. Etter at Julius Cæsar ble myrdet, allierte Antonius seg med Cæsars grandnevø Octavian og Lepidus i sammenslutningen som kalles det annet romerske triumvirat. Alliansen opphørte i 33 f.Kr.. Uenigheten mellom Antonius og Octavian brøt ut i borgerkrig i 31 f.Kr., den siste krigen under den romerske republikk. Antonius ble beseiret i slaget ved Actium i 31 f.Kr. og i et kortvarig slag på land ved Alexandria. Både Antonius og hans elskerinne, den egyptiske dronning Kleopatra, begikk selvmord kort tid etter. Antonius' karriere og nederlag hadde betydning for Romas endring fra republikk til keiserdømme."},{"page_url":"https://vi.wikipedia.org/wiki/Ch%C3%B3_r%E1%BB%ABng_l%C3%B4ng_v%C3%A0ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Golden_jackal_%26_Chital_carcass_2.jpg","page_title":"Chó rừng lông vàng","context_page_description":"Chó rừng hay chó rừng lông vàng là một loài chó kích thước trung bình sống ở vùng Bắc và Đông Bắc châu Phi, Đông Nam và Trung Âu, Tiểu Á, Trung Đông và Đông Nam Á. Được phân loại bởi IUCN là loài ít quan tâm."},{"page_url":"https://en.wikipedia.org/wiki/Perception_(American_TV_series)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Perception_intertitle.png","page_title":"Perception (American TV series)","context_page_description":"Perception is an American crime drama television series created by Kenneth Biller and Mike Sussman. The series stars Eric McCormack as Dr. Daniel Pierce, a neuropsychiatrist with schizophrenia who assists the FBI on some of its most complex cases.\\nThe series aired in the United States on the cable channel TNT from July 9, 2012 to March 17, 2015 and was produced by ABC Studios. On November 13, 2014, TNT canceled the series of Perception after three seasons. The remaining episodes of season 3 began airing February 17, 2015."},{"page_url":"https://en.wikipedia.org/wiki/Nolan_Bushnell","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Atari-2600-Wood-4Sw-Set.jpg","page_title":"Nolan Bushnell","context_page_description":"Nolan Kay Bushnell is an American businessman and electrical engineer. He established Atari, Inc. and the Chuck E. Cheese's Pizza Time Theatre chain. Bushnell has been inducted into the Video Game Hall of Fame and the Consumer Electronics Association Hall of Fame, received the BAFTA Fellowship and the Nations Restaurant News \\"Innovator of the Year\\" award, and was named one of Newsweek's \\"50 Men Who Changed America.\\" Bushnell has started more than twenty companies and is one of the founding fathers of the video game industry. He is on the board of Anti-Aging Games. In 2012 he founded an educational software company called Brainrush, that is using video game technology in educational software.\\nNolan is credited with Bushnell's Law, an aphorism about games \\"easy to learn and difficult to master\\" being rewarding."},{"page_url":"https://no.wikipedia.org/wiki/Himmelbrev","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Himmelbrev_fr%C3%A5_Sunnm%C3%B8re.jpg","page_title":"Himmelbrev","context_page_description":"Himmelbrev er et brev som ifølge folketroen er skrevet av Jesus eller Gud og påstås å være falt ned fra himmelen eller sendt med en engel. Himmelbrev har eksistert siden tidlig kristen tid som en folkereligiøs tekstsjanger som ble spredt i kopier fram til inn på 1800-tallet. Originalbrevene er angivelig skrevet til konkrete personer, men inneholder gjerne en generell moralsk appell til menneskene og løfter om lykke dersom en følger Guds befaling."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%A4%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Cain_Henri_Vidal_Tuileries.jpg","page_title":"カイン","context_page_description":"カインは、アブラハムの宗教における聖書の創世記に登場する人物。彼はアベルの兄であり、聖書の物語における最初の夫婦であるアダムとイヴの息子。彼は農業に従事していたが、彼の捧げた作物を神は喜ばず、神はカインよりもアベルを寵愛した。嫉妬によりカインは弟を殺したが、それがカインが受けた呪いの原因となった。彼の子孫にはエノクやレメクなどがいる。\\n創世記によると、彼は人類最初の殺人者である。"},{"page_url":"https://id.wikipedia.org/wiki/Kabinet_Abe_Ketiga","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Abe_Government_20141224_1.jpg","page_title":"Kabinet Abe Ketiga","context_page_description":"Kabinet Abe Ketiga dibentuk pada Desember 2014 oleh Perdana Menteri Shinzō Abe dan merupakan pemerintahan Jepang saat ini. Pemerintahan tersebut merupakan sebuah koalisi antara Partai Demokratik Liberal dan Komeito dan mengkontrol dewan tinggi dan dewan rendah Parlemen Jepang. Setelah pemberlakuan \\"Disolusi Abenomik\\" dan pemilihan umum 2014, Abe dipilih kembali oleh Parlemen dan memilih seluruh menteri dari kabinet sebelumnya kecuali Menteri Pertahanan Akinori Eto, yang terlibat dalam sebuah skandal keuangan. Abe menjelaskan bahwa ia mengindari pergolakan perubahan personil utama lainnya pada tiga hari setelah reshuffle kabinet September.\\nAbe telah melakukan dua reshuffle pada pemerintahan ketiganya, yang pertama dilakukan pada Oktober 2015 setelah ia terpilih kembali untuk masa jabatan tiga tahun lainnya sebagai Presiden PDL dan melincurkan kebijakan-kebijakan \\"Abenomik 2.0\\"-nya. Reshuffle kedua terjadi pada Agustus 2016, setelah kemenangan koalisi pemerintahan dalam pemilihan dewan tinggi Juli 2016, pertama kalinya sejak 1989, PDL meraih suara mayoritas dalam Dewan Kanselir."},{"page_url":"https://de.wikipedia.org/wiki/Skisprungschanze","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Planica.jpg","page_title":"Skisprungschanze","context_page_description":"Eine Skisprungschanze ist eine Sportstätte und neben den Sprungskiern das maßgebliche Sportgerät für den Skisprung-Sport. Manchmal wird auch der norwegische Begriff Bakken verwendet.\\nSprungschanzen für Spitzensportler liegen an steilen Berghängen und erlauben – bei entsprechender Länge und Höhenunterschied – Sprünge von über 100 Metern. Ab einer Hillsize von 185 m und einem Konstruktionspunkt von min 145 m spricht man von „Skifliegen“."},{"page_url":"https://en.wikipedia.org/wiki/Teodor_Anghelini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Teodor_Anghelini.jpg","page_title":"Teodor Anghelini","context_page_description":"Teodor Anghelini is a retired Romanian footballer and current youth coach.\\nAnghelini, who is of Italian descent, played for hometown club FC Braşov between 1971 and 1974, before joining Steaua Bucureşti, where he won two league titles and two Romanian Cups. He played until 1983 at the Bucharest side, being ranked eight amongst the players with the most league appearances for the club. In 1983, he played for lower league side ASA Mizil, before retiring in 1985."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B3%D0%BE%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ostrogothic_Kingdom.png","page_title":"Остроготи","context_page_description":"Остроготи или Источни Готи су били варварско германско племе које са истока дошло на територије Западног и Источног римског царства и битно су утицали на политичке прилике касног Римског царства.\\nНајзначајнији краљ Острогота је био Теодорик Велики, који је свргнуо првог варварског краља Италије Одоакара.\\nГоти су били један народ све до 3. века, кад су се поделили на Остроготе и Визиготе.\\nОба племена имају много тога заједничког, посебно поштовање римског бога Марса. Та природна подела је наступила због пренасељености у подручју Црног мора, где су Остроготи основали краљевство. Гепиди су постали њихови вазали."},{"page_url":"https://nl.wikipedia.org/wiki/Roompot-Nederlandse_Loterij/2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Denain_-_Grand_Prix_de_Denain%2C_13_avril_2017_%28B037%29.JPG","page_title":"Roompot-Nederlandse Loterij/2017","context_page_description":"Deze pagina geeft een overzicht van de Roompot-Nederlandse Loterij-wielerploeg in 2017."},{"page_url":"https://pt.wikipedia.org/wiki/Sapo-de-wyoming","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Visiting_Saratoga_National_Fish_Hatchery_%2814077197574%29.jpg","page_title":"Sapo-de-wyoming","context_page_description":"O sapo-de-wyoming é uma espécie de anfíbio anuro da família Bufonidae. É marrom-escuro, cinza ou esverdeado, com cinco centímetros de comprimento. Os machos são ligeiramente menores que as fêmeas e possuem pequenas elevações nos dedos. Os girinos são escuros com pintas.\\nReproduz-se entre maio e julho, onde se reúnem em pequenos grupos para acasalarem. Sua desova contém entre 1 000 a 6 000 ovos, que são depositados em plantas específicas de lagoas e pântanos. Seu desenvolvimento larval dura um mês. Durante esse período, alimentam-se de detritos orgânicos e inorgânicos, como algas e sedimentos de rochas. Quando adultos, alimentam-se de insectos, de preferência, besouros e formigas. Possui inúmeros predadores em todas suas fases da vida, desde o ovo ao indivíduo adulto.\\nA espécie foi declarada extinta na natureza pela União Internacional para a Conservação da Natureza. As causas para sua extinção são atividades antrópicas e naturais. A espécie ainda pode ser encontrada em alguns lugares em Laramie Basin e é reproduzida em cativeiro em zoológicos, na Universidade de Wyoming e em refúgios naturais, como Mortenson Lake National Wildlife Refuge."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%8A%AC%E5%B1%B1%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Little_world1.JPG","page_title":"犬山市","context_page_description":"犬山市是位於日本愛知縣尾張地方東北部的城市。人口約7萬人。\\n有名的觀光點有犬山城和博物館明治村等。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%B0%E5%88%B7%E5%AE%A4%E5%BA%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Bode_officina.jpg","page_title":"印刷室座","context_page_description":"印刷室座是位在天狼星東側的星座。它是約翰·波德在18世紀創造的，並收錄在他的星圖 Uranographia內。它至少還用在另一份星圖內，但很快就被淘汰了。"},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%AC%E0%A4%A1%E0%A4%BF%E0%A4%AE%E0%A4%BE%E0%A4%B2%E0%A4%BF%E0%A4%95%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%E0%A4%AC%E0%A4%A1%E0%A4%BF%E0%A4%AE%E0%A4%BE%E0%A4%B2%E0%A4%BF%E0%A4%95%E0%A4%BE_%E0%A4%AE%E0%A4%A8%E0%A5%8D%E0%A4%A6%E0%A4%BF%E0%A4%B0%E0%A4%95%E0%A5%8B_%E0%A4%AC%E0%A4%BE%E0%A4%9F%E0%A5%8B.JPG","page_title":"बडिमालिका","context_page_description":"बडिमालिका नेपालका प्रमुख मन्दिरहरूमा एक हो यो स्थान सेती अञ्चलको बाजुरा जिल्लामा पर्दछ । यहाँ प्रति वर्ष मालिका चतुर्दशीका दिन मुख्य पूजा हुन्छ । बडिमालिकामा २ वटा पूजारीहरूले पूजा गर्छन् । यि मध्य १ जना कालिकोटबाट आउँछन् भने अर्को १ जना बाजुराका पूजारी छन् ।"},{"page_url":"https://de.wikipedia.org/wiki/Kastell_Arbon","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Bodenheizung_Therme_Kastell_Arbon.jpg","page_title":"Kastell Arbon","context_page_description":"Kastell Arbon war Bestandteil der spätantiken Kastellkette des Donau-Iller-Rhein-Limes auf dem Gebiet der heutigen Schweiz, Kanton Thurgau, Bezirk Arbon, Gemeinde Arbon.\\nDas Kastell ist heute komplett vom mittelalterlichen Ortskern überbaut. Obwohl immer wieder in den antiken Hauptquellen erwähnt, konnte es erst 1957 archäologisch nachgewiesen werden. Es zählt bislang zu den jüngsten und bedeutendsten Entdeckungen spätrömischer Militäranlagen auf dem Staatsgebiet der Schweiz."},{"page_url":"https://ms.wikipedia.org/wiki/Anna_Kendrick","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/AnnaKendrick09TIFF-cropped.jpg","page_title":"Anna Kendrick","context_page_description":"Anna Cooke Kendrick ialah seorang pelakon dan penyanyi wanita Amerika Syarikat. Beliau memulakan kerjayanya sebagai pelakon kanak-kanak dalam muzikal Broadway High Society dimana beliau dicalonkan di Anugerah Tony untuk Pelakon Wanita Terbaik dalam Muzikal. Pada tahun 2009, beliau mula terkenal di peringkat antarabangsa selepas lakonan sebagai Natalie Keener dalam Up in the Air dimana beliau menerima pencalonan Anugerah BAFTA, Anugerah Golden Globe, SAG, dan Anugerah Akademi untuk Pelakon Pembantu Wanita Terbaik.\\nPeranan-peranan Kendrick yang lain termasuk Fritzi Wagner dalam Camp, Jessica Stanley dalam siri filem Twilight, Stacey Pilgrim dalam Scott Pilgrim vs. the World, Beca Mitchell dalam siri filem Pitch Perfect, Janet dalam End of Watch dan Cinderella dalam Into the Woods serta filem animasi Trolls. Pada 2016, Kendrick melancarkan memoirnya bertajuk Scrappy Little Nobody."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Volketswil","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kulturg%C3%BCter_2694.JPG","page_title":"Liste der Kulturgüter in Volketswil","context_page_description":"Die Liste der Kulturgüter in Volketswil enthält alle Objekte in der Gemeinde Volketswil im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorie A sind im Gemeindegebiet nicht ausgewiesen, Objekte der Kategorie B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://id.wikipedia.org/wiki/Anthony_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Anthony_Davis_%2838464014214%29.jpg","page_title":"Anthony Davis","context_page_description":"Anthony Marshon Davis Jr. adalah pemain basket profesional yang bermain untuk Los Angeles Lakers di NBA. Bermain sebagai power forward dan center, Davis merupakan pilihan pertama pada draft NBA tahun 2012 oleh New Orleans Pelicans.\\nSepanjang karier profesionalnya, Anthony Davis terpilih enam kali NBA All-Star dan meraih medali emas pada Olimpiade 2012.\\nDavis bermain di level college selama satu musim bersama University of Kentucky dan menjadi National Player of The Year."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%B0%D0%BD%D0%B1%D1%83%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Istiklal_busy_afternoon.JPG","page_title":"Истанбул","context_page_description":"Истанбул, ки онро Византия меномиданд, баъдан Константинопол — бузургтарин шаҳри Туркия, маркази асосии тиҷорат, саноат ва фарҳанг, бандари асосии кишвар. Истанбул дар соҳили гулӯгоҳи Босфор ҷойгир буда, онро ба қисматҳои аврупоӣ ва осиёӣ, ки бо пулҳо ва нақбҳо пайвастанд, тақсим мекунад. Аз рӯи аҳолӣ, шаҳри нахустини миллионер дар Аврупо. Пойтахти пешинаи империяҳои Рум, Византия, имперотуриҳои Лотин ва Усмонӣ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B1%D0%B1%D0%B0%D1%80%D0%B4,_%D0%93%D0%B0%D1%80%D0%B4%D0%B8%D0%BD%D0%B5%D1%80_%D0%93%D1%80%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Gardiner_Greene_Hubbard%2C_LCCN2010645713_%28cropped%29.jpg","page_title":"Хаббард, Гардинер Грин","context_page_description":"Гардинер Грин Хаббард — первый президент Национального географического общества, юрист, бизнесмен, друг и советник президентов, государственных деятелей и учёных.\\nВ его честь названа медаль Хаббарда, которую NGS присуждает за выдающиеся исследования и путешествия.\\nПосле избрания президентом, Хаббард заявил: «Мой интерес к географии такой, какой должен быть у любого образованного человека» и «Состав нашего Общества не будет ограничен профессиональными географами, но будет включать большое число тех, кто заинтересован в том, чтобы мы смогли больше узнать о том мире, в котором живем».\\nГардинер Хаббард стал первым спонсором Александра Грэма Белла."},{"page_url":"https://en.wikipedia.org/wiki/Solar_eclipse_of_March_25,_1857","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/SE1929May09T.png","page_title":"Solar eclipse of March 25, 1857","context_page_description":"A total solar eclipse occurred on March 25, 1857. A solar eclipse occurs when the Moon passes between Earth and the Sun, thereby totally or partly obscuring the image of the Sun for a viewer on Earth. A total solar eclipse occurs when the Moon's apparent diameter is larger than the Sun's, blocking all direct sunlight, turning day into darkness. Totality occurs in a narrow path across Earth's surface, with the partial solar eclipse visible over a surrounding region thousands of kilometres wide.\\nTotality began at sunrise over southeastern Australia on March 26, crossing the Pacific ocean, and ended near sunset across Mexico on March 25."},{"page_url":"https://es.wikipedia.org/wiki/Oribe_Peralta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Oribe.jpg","page_title":"Oribe Peralta","context_page_description":"Oribe Peralta Morones, es un futbolista mexicano. Juega como delantero en el Club Deportivo Guadalajara de la Primera División de México.\\nDurante la campaña 2011-12 aumentó su valor de 1 millón 900 euros a 3 millones de euros, ​ esto gracias a sus actuaciones durante la temporada en donde consiguió 43 goles, ​ siendo ésta su mejor marca. Se colocó en el duodécimo lugar en la lista de los 83 mejores goleadores de Primera División del año 2012.​\\nSe convirtió en el primer futbolista en ganar la edición del Futbolista del Año de la Concacaf el 13 de diciembre de 2013.​ Terminó en el puesto 18° de los mejores goleadores del 2013 empatado con Luis Suárez y Edinson Cavani.​​"},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D1%8D%D0%BD%D1%96%D1%81_%D0%93%D0%B0%D0%B1%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Dennis_Gabor_1971.jpg","page_title":"Дэніс Габар","context_page_description":"Дэніс Габар, таксама Дэнеш Габар — венгерскі фізік, лаўрэат Нобелеўскай прэміі па фізіцы «за вынаходніцтва і развіццё галаграфічнага метаду»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_(2006)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/2006._%D0%9C%D0%B0%D1%80%D0%BA%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_stamp_hi12740104754befdb6b51ece.jpg","page_title":"Почтовые марки России (2006)","context_page_description":"Почтовые марки России (2006) — каталог знаков почтовой оплаты, введённых в обращение «Почтой России» в 2006 году.\\nВсего в этом году было выпущено 96 почтовых марок, 12 почтовых блоков и 18 малых листов."},{"page_url":"https://en.wikipedia.org/wiki/Locomotives_of_New_Zealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Steam_locomotive_%22Wb%22_class_298_%282-6-2T_type%29_ATLIB_292932.png","page_title":"Locomotives of New Zealand","context_page_description":"Locomotives of New Zealand is a complete list of all locomotive classes that operate or have operated in New Zealand's railway network. It does not include locomotives used on bush tramways.\\nAll New Zealand's main-line locomotives narrow gauge of 3ft 6in."},{"page_url":"https://de.wikipedia.org/wiki/Seengen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Seengen_3211.jpg","page_title":"Seengen","context_page_description":"Seengen ist eine Einwohnergemeinde im Schweizer Kanton Aargau. Sie gehört zum Bezirk Lenzburg und liegt im Seetal am Nordende des Hallwilersees."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%8E%A5%E7%B6%9A%E8%A1%8C%E5%88%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Labeled_undirected_graph.svg","page_title":"接続行列","context_page_description":"数学において、接続行列は、2つのオブジェクトクラス間の関係を示す行列である。1つ目のクラスをX、2つ目をYとすると、接続行列は、Xのそれぞれの要素について1つの行を、Yのそれぞれの要素について1つの列を持つ。行xおよび列y中の成分はxおよびyが関連しているならば1であり、関連していないならば0である。以下に示すように変種が存在する。"},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_Tours","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Hotel_Gouin.JPG","page_title":"Histoire de Tours","context_page_description":"L'histoire de Tours inventorie l'ensemble des évènements, anciens ou plus récents, liés à cette ville française"},{"page_url":"https://es.wikipedia.org/wiki/Constanza_de_Portugal_(nacida_hacia_1294)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/PortugueseFlag1248.svg","page_title":"Constanza de Portugal (nacida hacia 1294)","context_page_description":"Constanza de Portugal y Manuel. Dama portuguesa, hija del infante Alfonso de Portugal y de Violante Manuel, hija del infante Manuel de Castilla."},{"page_url":"https://de.wikipedia.org/wiki/Gelbstreifiger_Zahnfl%C3%BCgel-Prachtk%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Dicerca_aenea_apex.jpg","page_title":"Gelbstreifiger Zahnflügel-Prachtkäfer","context_page_description":"Der Gelbstreifige Zahnflügel-Prachtkäfer ist ein Käfer aus der Familie der Prachtkäfer und der Unterfamilie der Chrysochroinae. Die Gattung Dicerca ist in Europa mit zwei Untergattungen und acht Arten vertreten. Die Art Dicerca aenea gehört zur Untergattung Dicerca und kommt in Europa nur in der Unterart Dicerca aenea aenea vor.\\nNach der Bundesartenschutzverordnung ist die Art besonders geschützt und streng geschützt. Die Nachweise aus Deutschland liegen vor 1900."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AC%D8%AF%DB%8C%D8%AF_%D8%A7%D8%B3%D8%B1%D8%A7%D8%A6%DB%8C%D9%84%DB%8C_%D8%B4%DB%8C%D9%82%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Money_IL_WV.JPG","page_title":"جدید اسرائیلی شیقل","context_page_description":"جدید اسرائیلی شیقل\\nجسے صرف اسرائیلی شیقل بھی کہا جاتا ہے اسرائیل کی کرنسی ہے جو فلسطینی علاقہ جات یعنی مغربی کنارہ اور غزہ پٹی میں بھی استعمال ہوتی ہے۔"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%BE%D0%BD%D1%96%D0%B5%D0%BB%D0%BB_%D0%9C%D0%B0%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Austria_U-18_vs._Netherlands_U-18_2017-03-23_%28083%29.jpg","page_title":"Доніелл Мален","context_page_description":"Доніелл Мален — нідерландський футболіст, нападник клубу ПСВ і національної збірної Нідерландів."},{"page_url":"https://de.wikipedia.org/wiki/Scharfes_Berufkraut","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Erigeron_acris_270805.jpg","page_title":"Scharfes Berufkraut","context_page_description":"Das Scharfe Berufkraut oder Echte Berufkraut ist eine Pflanzenart innerhalb der Familie der Korbblütler. Sie kommt in Nordamerika, Eurasien und Nordafrika vor."},{"page_url":"https://da.wikipedia.org/wiki/Marjun_den_st%C3%A6rke","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Sumba%2C_Faroe_Islands.JPG","page_title":"Marjun den stærke","context_page_description":"Marjun den stærke, er en historisk person fra Færøerne, der bl.a. var kendt for sin styrke. Historien om hende og hendes sønner, Hargabrødrene, kendes fra bogen ”Færøske folkesagn og æventyr”, 1898 – 1901 efter Jakob Jakobsen. Historierne er således overleveret ved mundtlig overlevering, indtil de blev skrevet ned af filologer. Nogle historiske fakta kan man stadfæste ud fra historiske dokumenter, bl.a. at Marjuns bror, Símun Jenisson, fæstede gården efter sin far i 1592."},{"page_url":"https://de.wikipedia.org/wiki/Jacek_Kazimierski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Jacek_Kazimierski.jpg","page_title":"Jacek Kazimierski","context_page_description":"Jacek Kazimierski ist ein ehemaliger polnischer Fußballtorhüter."},{"page_url":"https://es.wikipedia.org/wiki/Pascal_Greggory","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Pascal_Greggory_Caboug_2012.jpg","page_title":"Pascal Greggory","context_page_description":"Pascal Greggory es un actor francés."},{"page_url":"https://da.wikipedia.org/wiki/Polygon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Simple_polygon.svg","page_title":"Polygon","context_page_description":"Polygon er det græske navn for en mangekant, og ordet betyder egentlig \\"mangehjørne\\". Det er en betegnelse for todimensionale figurer eller rettere flader, hvis arealer afgrænses af linjestykker.\\nEn polygon kaldes regulær, dersom alle dens sider og vinklerne mellem disse er ens. I modsat fald er den irregulær. Hver polygon har sit eget navn. Her ses nogle af dem:\\nVinkelsummen i en polygon er.\\nEt volumen i 3 dimensioner afgrænset af polygoner kaldes et polyeder."},{"page_url":"https://nl.wikipedia.org/wiki/Mourioux-Vieilleville","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Map_commune_FR_insee_code_23137.png","page_title":"Mourioux-Vieilleville","context_page_description":"Mourioux-Vieilleville is een gemeente in het Franse departement Creuse en telt 569 inwoners. De plaats maakt deel uit van het arrondissement Guéret."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%82%D8%A7%D8%B9%D8%A9_%D9%85%D8%B4%D8%A7%D9%87%D9%8A%D8%B1_%D8%A7%D9%84%D8%B1%D9%88%D9%83_%D8%A7%D9%86%D8%AF_%D8%B1%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Chuck_Berry51.JPG","page_title":"قاعة مشاهير الروك اند رول","context_page_description":"قاعة مشاهير الروك آند رول، أنشئت في سنة 1983، وتقع في كليفلاند، أوهايو، الولايات المتحده الامريكيه، مكرسة لتسجيل تاريخ الأكثر شهره والأكثر تأثير من الموسيقيين والفرق الموسيقيه والمنتجين، وغيرهم اللي اثروا وتركوا تأثيرا ضخما فى صناعة الموسيقى، وخاصة في مجال الروك أند رول."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A1%D7%98%D7%99%D7%9F_(%D7%90%D7%99,_%D7%90%D7%A0%D7%98%D7%90%D7%A8%D7%A7%D7%98%D7%99%D7%A7%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Thurston_Island_-_en.svg","page_title":"דסטין (אי, אנטארקטיקה)","context_page_description":"האי דסטין הוא אי הממוקם מדרום מזרח לאי ת'רסטון בארץ אלזוורת', שבאנטארקטיקה.\\nהאי ממוקם 28 קילומטרים דרומית-מזרחית לכף אנאוואן שבאי ת'רסטון.\\nהאי גובל מדרום מזרח במפרץ שרף.\\nאורכו של האי 28.9 קילומטרים."},{"page_url":"https://br.wikipedia.org/wiki/Zdice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Zdice_CoA_CZ.jpg","page_title":"Zdice","context_page_description":"Zdice a zo ur gêr er Republik Tchek, e Rannvro Kreiz Bohemia e Distrig Beroun. E 2006 e oa 3 934 annezad enni."},{"page_url":"https://tr.wikipedia.org/wiki/Anthony_Bennett","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Anthony_Bennett_%2810355636284%29.jpg","page_title":"Anthony Bennett","context_page_description":"Anthony Harris Bennett, Kanadalı profesyonel basketbolcu. UNLV'de kolej basketbolu oynamıştır. 2013 NBA Seçmeleri'nde Cleveland Cavaliers tarafından birinci sırada seçilmiştir.\\n2014–15 sezonu başında Cleveland Cavaliers ve Minnesota Timberwolves arasında gerçekleşen takasta Kevin Love karşılığında 2014 birinci sıra seçimi takım arkadaşı Andrew Wiggins ile birlikte Timberwolves'a transfer olmuştur. En son Türk takımı Fenerbahçe'de oynamıştır. Bennet 3 ve 4 numaralı pozisyonlarda oynuyor."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%9D%E1%83%95%E1%83%90%E1%83%9C%E1%83%94%E1%83%A1_%E1%83%97%E1%83%A3%E1%83%9B%E1%83%90%E1%83%9C%E1%83%98%E1%83%90%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Tumanyan_%282%29.jpg","page_title":"ჰოვანეს თუმანიანი","context_page_description":"ჰოვანეს თათევოსის ძე თუმანიანი — სომეხი მწერალი და საზოგადო მოღვაწე.\\nპირველდაწყებითი განათლება სოფელში მიიღო. შემდეგ ჯალალოღლის ოთხკლასიან სასწავლებელში და თბილისის ნერსესის სემინარიაში სწავლობდა. სწავლას მოწყურებულმა თვითგანვითარებას მიჰყო ხელი. 1886 წელს გამოვიდა სამწერლო ასპარეზზე. მისი ადრინდელი ნაწარმოებებია „ძაღლი და კატა“, „უიღბლო ვაჭრები“. თუმანიანი მრავალმხრივი შემოქმედი იყო. წერდა ლექსებს, პოემებს, მოთხრობებს, ზღაპრებს, იგავებს, ბალადებს. მის ნაწარმოებებში ასახულია სომხეთის სინამდვილისთვის დამახასიათებელი სოციალური-ფსიქოლოგიური კონფლიქტები, ხალხის ზნე-ჩვეულებანი, სომეხი ხალხის წარსული და აწმყო. მისი საუკეთესო პოემებია „ანუში“, „მარო“, „თმოგვის ციხის აღება“, სომხების საგმირო თქმულებების საფუძველზე შექმნა პოემა „დავით სასუნცი“. ფართოდაა ცნობილი თუმანიანის მიერ სომხური და აღმოსავლური ლეგენდების სიუჟეტებზე შექმნილი მრავალი ბალადა და ზღაპარი. თუმანიანის მოთხრობები სომხური პოეზიის საუკეთესო ნიმუშებია. მათში მართლადაა გადმოცემული გლეხკაცის ფსიქოლოგია. თუმანიანი ოპტიმისტი მწერალი იყო. სწამდა თავისი სამშობლოსა და მშრომელი ხალხის ნათელი მომავალი. იგი ქართველი და სომეხი ხალხების ძმობა-მეგობრობის თავდადებულ და მგზნებარე დამცველად გამოდიოდა."},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99%C3%AD%C5%BEov%C3%A1_cesta_(Kocl%C3%AD%C5%99ov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kocl%C3%AD%C5%99ov%2C_Stations_of_the_Cross%2C_north_part.jpg","page_title":"Křížová cesta (Koclířov)","context_page_description":"Křížová cesta v Koclířově na Svitavsku se nachází v centru obce u kostela.\\nSpolu s kostelem je chráněna jako nemovitá Kulturní památka České republiky."},{"page_url":"https://fr.wikipedia.org/wiki/Photo-guide_naturaliste_sous-marin_de_la_grande_barri%C3%A8re_de_corail_(Australie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Reef_Stonefish.jpg","page_title":"Photo-guide naturaliste sous-marin de la grande barrière de corail (Australie)","context_page_description":"La Grande Barrière de corail est le plus grand récif corallien du monde comptant plus de 2 900 récifs et 900 îles s'étirant de Bundaberg à la pointe du Cap York soit plus de 2 600 kilomètres sur une superficie de 344 400 km². Le récif se situe en Mer de Corail au large du Queensland, en Australie.\\nUne large partie du récif est protégée par le Great Barrier Reef Marine Park, qui aide à limiter l'impact de l'activité humaine tels que la pêche et le tourisme. D'autres pressions environnementales sur le récif et son écosystème incluent le ruissellement, le changement climatique qui accompagne le blanchissement des coraux et le débordement de la population cyclique de l'Acanthaster planci. Selon une étude publiée en octobre 2012 par la revue scientifique américaine Proceedings of the National Academy of Sciences, le récif a perdu plus de la moitié de sa surface corallienne depuis 1985.\\nCet article, loin d'être exhaustif, se propose d'illustrer quelques-unes des espèces susceptibles d’être rencontrées dans les lagons pour chacun des principaux groupes d'animaux marins macroscopiques."},{"page_url":"https://fi.wikipedia.org/wiki/Morne_Trois_Pitonsin_kansallispuisto","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Morne_Trois_Pitons_National_Park%2C_Dominica_-_jungle.jpg","page_title":"Morne Trois Pitonsin kansallispuisto","context_page_description":"Morne Trois Pitonsin kansallispuisto on Dominicassa sijaitseva maailmanperintökohde. Siitä tuli Dominican saarivaltion ensimmäinen kansallispuisto vuonna 1975. Alueen nähtävyyksiin kuuluvat laakso, josta löytyy useita kiehuvia mutalampia ja geysireitä, Boiling Lake -fumarolijärvi, Titou Gorge ja Emerald Pool.\\nMorne Trois Pitons pääsi maailmanperintöluetteloon tunnusmerkillisen geologiansa ja trooppisten sademetsiensä monimuotoisuuden ansiosta."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B5%A4%E6%9D%A8%E9%95%B0%E9%92%A9%E8%9B%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Drepana_curvatula.jpg","page_title":"赤杨镰钩蛾","context_page_description":"赤楊鐮鉤蛾是鱗翅目鉤蛾科的一種，體長8～10毫米，頭黃褐色，觸角棕黃色，身體焦枯至暗黃褐色。翅長14～19毫米，前翅頂角下方靠近外緣處有一條棕黑色弧形線，前後翅各有5條波浪狀斜線，其中由內向外數第4條最為清晰。前翅橫脈處有2個小黑點。\\n一年生2代，7～9月出現，以蛹過冬。以赤楊，青楊和棘皮樺為寄主。分布於德國，俄羅斯，中國，朝鮮及日本等地。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%8B%E7%BD%97%E5%9C%B0%E4%BA%9A%E6%A3%8B%E7%9B%98%E5%9B%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Brazil_and_Croatia_match_at_the_FIFA_World_Cup_2014-06-12_%2850%29.jpg","page_title":"克罗地亚棋盘图","context_page_description":"克罗地亚棋盘图是红白相间的棋盘图，是克罗地亚的国家象征，也是欧洲历史悠久的国家象征之一。克罗地亚国徽中最大的盾章图样就是克罗地亚棋盘图。\\n克罗地亚国家运动队员身着的运动衣长期采用克国棋盘图作为主图案，该图案也因此在体育界较为闻名。"},{"page_url":"https://en.wikipedia.org/wiki/Electronic_Document_System","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Electronic_Document_System_%28EDS%29_-_Electronic_Maintenance_Manual_Concept_Circa_1980.jpg","page_title":"Electronic Document System","context_page_description":"The Electronic Document System was an early hypertext system – also known as the Interactive Graphical Documents hypermedia system – focused on creation of interactive documents such as equipment repair manuals or computer-aided instruction texts with embedded links and graphics. EDS was a 1978–1981 research project at Brown University by Steven Feiner, Sandor Nagy and Andries van Dam.\\nEDS used a dedicated Ramtech raster display and VAX-11/780 computer to create and navigate a network of graphic pages containing interactive graphic buttons. Graphic buttons had programmed behaviors such as invoking an animation, linking to another page, or exposing an additional level of detail.\\nThe system had three automatically created navigation aids:\\na timeline showing thumbnail images of pages traversed;\\na 'neighbors' display showing thumbnails of all pages linking to the current page on the left, and all pages reachable from the current page on the right;\\na visual display of thumbnail page images arranged by page keyword, color coded by chapter.\\nUnlike most hypertext systems, EDS incorporated state variables associated with each page."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_du_Sendat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/01-Ch%C3%A2teau_du_Sendat.JPG","page_title":"Château du Sendat","context_page_description":"Le château du Sendat est un château situé sur la commune de La Réunion, dans le département de Lot-et-Garonne."},{"page_url":"https://simple.wikipedia.org/wiki/Paul_Farnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Paul_Farnes_Portrait.jpg","page_title":"Paul Farnes","context_page_description":"Paul Caswell Powe Farnes, DFM, AE was a Royal Air Force fighter pilot. He was born in Hampshire, England. He was a Second World War flying ace who flew during the Battle of Britain as one of \\"The Few\\", during which he scored 8 kills.\\nFarnes died on 28 January 2020 in Hampshire at the age of 101."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_and_towns_in_Bulgaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/BUL_%D0%9B%D1%8F%D1%81%D0%BA%D0%BE%D0%B2%D0%B5%D1%86_COA.png","page_title":"List of cities and towns in Bulgaria","context_page_description":"This is a complete list of all cities and towns in Bulgaria sorted by population. Province capitals are shown in bold. Primary sources are the National Statistical Institute and the Bulgarian Academy of Sciences.\\nThe largest city is Sofia with about 1.3 million inhabitants and the smallest is Melnik with about 300. Smallest towns are not necessarily larger than all villages as many villages are more populous than many towns, compare Lozen, a large village with more than 5,000 inhabitants."},{"page_url":"https://es.wikipedia.org/wiki/Suzay","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Suzay_%C3%A9glise.JPG","page_title":"Suzay","context_page_description":"Suzay es una localidad y comuna francesa situada en la región de Alta Normandía, departamento de Eure, en el distrito de Les Andelys y canton de Les Andelys."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Menhire_in_Rheinland-Pfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Schoenberg-menhir-trafostation-H1.jpg","page_title":"Liste der Menhire in Rheinland-Pfalz","context_page_description":"Die Liste der Menhire in Rheinland-Pfalz umfasst alle bekannten Menhire auf dem Gebiet des heutigen Bundeslandes Rheinland-Pfalz."},{"page_url":"https://es.wikipedia.org/wiki/Matt_Hardy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/WWE_cockpit.jpg","page_title":"Matt Hardy","context_page_description":"Matthew \\"Matt\\" Moore Hardy​ ​ es un luchador profesional estadounidense más conocido bajo el nombre de Matt Hardy, quien actualmente trabaja en All Elite Wrestling. Es más conocido por su permanencia en la WWE, actuando junto a su hermano Jeff de la vida real como The Hardy Boyz. Hardy también ha trabajado para Total Nonstop Action Wrestling y Ring of Honor.\\nMatt ha sido tres veces Campeón Mundial, dos veces Campeón Mundial Peso Pesado de la TNA y una vez Campeón de la ECW. Además, dentro de sus logros individuales, destacan sus reinados como Campeón Hardcore, Campeón Europeo, Campeón de Peso Crucero de WWE y Campeón de los Estados Unidos de WWE.\\nEs 14 veces Campeón Mundial en Parejas tras haber sido dos veces Campeón Mundial en Parejas de la TNA, una vez Campeón Mundial en Parejas de la ROH, una vez Campeón Mundial en Parejas de la WCW, seis veces Campeón Mundial en Parejas de la WWE, una vez Campeón en parejas de SmackDown y tres veces Campeón en Parejas de WWE/Raw con MVP, su hermano Jeff y con Bray Wyatt.​​\\nAdemás fue Quinto Ganador del André the Giant Memorial Battle Royal en WrestleMania 34."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cita","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Tschita0132.JPG","page_title":"Čita","context_page_description":"Čita je město v Rusku na dálném východě. Bylo centrem stejnojmenné oblasti, nyní je součástí Zabajkalského kraje. Leží na soutoku řeky Čita a Ingoda asi 700 km východně od Irkutsku. Žije zde přibližně 347 tisíc obyvatel."},{"page_url":"https://en.wikipedia.org/wiki/Fort_Gratiot","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Fort_Gratiot_%28Michigan%29.jpg","page_title":"Fort Gratiot","context_page_description":"Fort Gratiot was an American stockade fort in Fort Gratiot, Michigan, in Saint Clair County, Michigan. The former location of the fort was listed on the National Register of Historic Places in 1980."},{"page_url":"https://es.wikipedia.org/wiki/Premier_League_2011-12","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/David_Silva.jpg","page_title":"Premier League 2011-12","context_page_description":"La Premier League 2011/12 fue la vigésima temporada de la máxima división inglesa, desde su creación en 1992.\\nUn total de 20 equipos participaron en la competición, incluyendo 17 equipos de la temporada anterior y 3 provenientes de la Football League Championship 2010/11. Manchester United es el campeón defensor, habiendo ganado su decimonoveno título de liga.\\nEsta temporada se jugó en dos países: Inglaterra y Gales.\\nEl campeón terminaría siendo el Manchester City, tras vencer 3-2 al Queens Park Rangers en el último partido, con goles de Pablo Zabaleta, Edin Džeko y Sergio Agüero, los dos últimos sobre el tiempo de descuento. Fue el primer título de Premier League para el Manchester City, convirtiéndose en el quinto equipo en ganarla desde su creación. Fue la primera vez en la Premier League que el título se definió por diferencia de gol y que el campeón anteriormente había descendido. Se trató además del segundo equipo fuera del «Big Four» en obtener el título, luego del que el Blackburn Rovers lo lograra en la temporada 1994-95."},{"page_url":"https://en.wikipedia.org/wiki/Gulam_Bodi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/GulamBodi.jpg","page_title":"Gulam Bodi","context_page_description":"Gulam Hussain Bodi is an Indian-born South African former cricketer who represented his country at Under-19, Twenty20 and ODI level."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1891","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/De_wereldkampioen_in_het_dammen_Herman_Hoogland_Jr_bij_het_simultaanspel_1912.jpg","page_title":"Lijst van personen geboren in 1891","context_page_description":"Dit is een lijst van personen die geboren zijn in 1891.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Studentenverbindungen_in_T%C3%BCbingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Corpshaus_Rhenania_T%C3%BCbingen_2007.jpg","page_title":"Liste der Studentenverbindungen in Tübingen","context_page_description":"Diese Liste der Studentenverbindungen in Tübingen verzeichnet die Korporationen an der Eberhard Karls Universität Tübingen."},{"page_url":"https://es.wikipedia.org/wiki/Administraci%C3%B3n_de_Ferrocarriles_del_Estado","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/V%C3%ADa_sobre_durmientes_de_acero_01.jpg","page_title":"Administración de Ferrocarriles del Estado","context_page_description":"La Administración de Ferrocarriles del Estado es el ente autónomo de la República Oriental del Uruguay encargado del transporte ferroviario de pasajeros, materiales y del mantenimiento de la red ferroviaria uruguaya."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%99%BD%E5%B7%9D%E8%8B%B1%E6%A0%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Hideki_Shirakawa_20011212.jpg","page_title":"白川英树","context_page_description":"白川英树，日本化学家，筑波大学名誉教授。日本学士院会员。文化勋章表彰。文化功劳者。\\n白川教授因有关导电聚合物的开创性贡献，2000年与艾伦·黑格、艾伦·麦克德尔米德共同获得诺贝尔化学奖。"},{"page_url":"https://en.wikipedia.org/wiki/Thirteenth_Dynasty_of_Egypt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Neferhotep_KS_1799_01c.JPG","page_title":"Thirteenth Dynasty of Egypt","context_page_description":"The Thirteenth Dynasty of ancient Egypt is often combined with Dynasties XI, XII and XIV under the group title Middle Kingdom. Some writers separate it from these dynasties and join it to Dynasties XIV through XVII as part of the Second Intermediate Period. Dynasty XIII lasted from approximately 1803 BC until approximately 1649 BC, i.e. for 154 years.\\nThe 13th dynasty was a direct continuation of the preceding 12th dynasty, with its first ruler believed to be a son of Amenemhat IV. Kim Ryholt proposes that the demarcation between the two dynasties reflects the rise of the independent 14th dynasty in the eastern Delta, an event which, he proposes, occurred during Sobekneferu's reign. As direct heirs to the kings of the 12th dynasty, pharaohs of the 13th dynasty reigned from Memphis over Middle and Upper Egypt, all the way to the second cataract to the south. The power of the 13th dynasty waned progressively over its 150 years of existence and it finally came to an end with the conquest of Memphis by the Hyksos rulers of the 15th dynasty, c. 1650 BC."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%B3mai_cs%C3%A1sz%C3%A1rkor","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Costantino.jpg","page_title":"Római császárkor","context_page_description":"A római császárkor vagy a Római Császárság, avagy bizonyos értelemben a Római Birodalom, mint császári birodalom az ókori Róma harmadik korszaka, ami a királyságot és a köztársaságot váltotta i. e. 29-ben és i. sz. 476-ig tartott. A birodalom ekkor érte el legnagyobb méretét és vált az ókori Európa legnagyobb hatalmává. A császárkor két nagyobb szakaszra tagolódik: a principatus és a dominatus korára. A principatus korában a köztársasági intézmények, noha sokáig még léteztek, teljesen kiüresedtek és jóformán minden jelentőségüket elvesztették. Diocletianus átszervezte a birodalom közigazgatását, a polgárokból alattvalók lettek, s a birodalom dominatusszá, abszolút monarchiává vált."},{"page_url":"https://lt.wikipedia.org/wiki/Gleiviabud%C4%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Gruenspan.jpg","page_title":"Gleiviabudė","context_page_description":"Gleiviabudė – gleiviabudinių šeimos grybų gentis.\\nGentis dabar priskiriama prie Psilocybe glotniagalvė.\\nVaisiakūniai vidutinio dydžio, smulkūs, kartais stambūs. Kepurėlė lipni, gleivėta. Kotas su žiedu. Auga vasarą, rudenį ant žemės, ekskrementų, medienos.\\nLietuvoje auga 10 rūšių:\\nMelsvažalė gleiviabudė\\nKarpiniuotoji gleiviabudė\\nHornemano gleiviabudė. Silpnai nuodingas.\\nPusgaubtė gleiviabudė\\nir kt."},{"page_url":"https://ca.wikipedia.org/wiki/El_Miracle_(Riner)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Santuari_del_Miracle_02.jpg","page_title":"El Miracle (Riner)","context_page_description":"El Miracle és una de les cinc entitats de població del municipi de Riner a la comarca del Solsonès sorgit a l'entorn del santuari del Miracle. El seu poblament és dispers pràcticament tot. És on hi ha la seu de l'ajuntament tot i que Riner continua sent considerada oficialment la capital del municipi."},{"page_url":"https://es.wikipedia.org/wiki/June_Paul","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/June_Foulds_1952.jpg","page_title":"June Paul","context_page_description":"June Paul fue una atleta británica, especializada en la prueba de 4 x 100 m en la que llegó a ser subcampeona olímpica en 1956.​"},{"page_url":"https://es.wikipedia.org/wiki/St%C3%A9fanos_Tsitsip%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Sydney_International_Tennis_ATP_250_%2833040175248%29_%28cropped%29.jpg","page_title":"Stéfanos Tsitsipás","context_page_description":"Stefanos Tsitsipas es un tenista profesional griego que compite como profesional desde 2016. Tiene como mejor ranking individual en la ATP el número 5°, que alcanzó el 5 de agosto de 2019. En la modalidad de dobles alcanzó el puesto número 70 del mundo el 5 de agosto de 2019. Ha ganado un total de cinco títulos ITF Futures en individual, así como seis títulos de dobles.\\nSu logro más importante en el circuito ha sido ganar la Copa de Maestros en el 2019. Ha ganado también 3 títulos ATP 250, la NextGen Finals y ha llegado a finales de Masters 1000 y ATP 500. En los Grand Slam superó en todos la primera ronda, y en 3 de los 4 llegó hasta la cuarta ronda. Su mejor participación fueron las semifinales del Abierto de Australia en 2019, donde perdió ante Rafael Nadal después de haber eliminado a Roger Federer en octavos de final."},{"page_url":"https://es.wikipedia.org/wiki/Chudenice","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Chudenice_CZ_flag.png","page_title":"Chudenice","context_page_description":"Chudenice es una localidad del distrito de Klatovy en la región de Pilsen, República Checa, con una población estimada a principio del año 2018 de 771 habitantes.\\nSe encuentra ubicada al sur de la región, cerca del río Otava —un afluente izquierdo del río Moldava que, a su vez, lo es del Elba— y de la frontera con la región de Bohemia Meridional y el estado alemán de Baviera.​"},{"page_url":"https://fr.wikipedia.org/wiki/Aqueduc_et_moulins_de_Barbegal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Barbegal_mill_06.jpg","page_title":"Aqueduc et moulins de Barbegal","context_page_description":"L'aqueduc et les moulins de Barbegal constituent un complexe romain de meunerie hydraulique situé à Fontvieille, à proximité de la ville d'Arles. Cet ensemble a été qualifié comme « La plus grande concentration connue de puissance mécanique du monde antique ».\\nL'aqueduc est partiellement classé au titre des monuments historiques depuis le 12 juillet 1886, certaines de ses parties faisant l'objet d'une inscription depuis le 5 février 1937."},{"page_url":"https://de.wikipedia.org/wiki/Marlik","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Marlik_cup_iran.jpg","page_title":"Marlik","context_page_description":"Marlik ist der Name eines archäologischen Fundorts im Norden des Iran. Er liegt im Tal des Gohar Ruds, einem Nebenfluss des Sefid Ruds in der Provinz Gilan.\\nIm Zuge der Ausgrabungen, die 1961 bis 1962 erfolgten, wurde ein königlicher Friedhof freigelegt, der 3000 Jahre unberührt geblieben war. Mehrere tausend kunstvolle Objekte, darunter einige hundert aus Gold wurden sichergestellt. Teilweise ließen sich Ähnlichkeiten mit Funden aus Tappe Sialk in der Nähe von Kaschan nachweisen.\\nEs wird vermutet, dass der Name Marlik auf Marda-lik zurückgeht, was dem griechischen Historiker Strabon zufolge die Urbevölkerung dieser Gegend war.\\nZu den berühmtesten Funden zählt die Gold-Schale von Marlik, die auf einer 500 Rial Banknote abgebildet war. Weitere Funde lassen Verbindungen zu den Fabeln aus Kalīla wa Dimna herstellen. Es wurden ferner Kunstwerke aus Glas und zahlreiches Metallwerkzeug gefunden.\\nPlünderungen und Schmuggel führten zu einem Ende der Untersuchungen."},{"page_url":"https://it.wikipedia.org/wiki/Binda_(attrezzo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Dommekracht_ijzer.jpg","page_title":"Binda (attrezzo)","context_page_description":"La binda è una macchina azionata a mano, che serve per il sollevamento a modesta altezza di carichi anche rilevanti, dell'ordine delle tonnellate.\\nNella sua configurazione di base è formata da:\\nuna cassa, solitamente in robusta lamiera, che funge da struttura portante ed è provvista di un piede per l'appoggio a terra;\\nuna robusta asta dotata di cremagliera, che scorre all'interno della cassa, con all'estremità superiore l'appoggio che solleverà il carico;\\nuna manovella, imperniata sulla cassa, che aziona la cremagliera attraverso una serie di ruotismi di riduzione. Alla manovella è collegato anche un rocchetto con arpionismo per impedire che l'asta si abbassi quando è sotto carico.\\nVisto lo spessore delle parti componenti, la binda è un attrezzo molto pesante da maneggiare, e l'escursione dell'asta è bassa, attorno al mezzo metro.\\nIn un'altra conformazione, adatta a sollevare carichi minori ma ad un'altezza maggiore, è l'asta a rimanere ferma e ad essere dotata del piede di appoggio, e su questa scorre un carrello che porta il supporto per l'appoggio del carico. Il carrello viene elevato sulla cremagliera tramite l'azione di una leva."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D9%83_%D9%85%D8%A7%D8%B1%D8%B4%D8%A7%D9%84_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%87%D9%88%D9%83%D9%89_%D8%A7%D9%84%D8%AC%D9%84%D9%8A%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Jack_Marshall.jpg","page_title":"جاك مارشال (لاعب هوكى الجليد)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجاك مارشال كان لاعب هوكى الجليد من كندا."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D8%A7%D9%86_%D8%AF%D8%A7%D9%88%D8%A7_%D8%AF%D9%88%D9%84%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Alan_%40_Tokyo_Game_Show_2008.jpg","page_title":"الان داوا دولما","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nالان داوا دولما مغنيه من الصين."},{"page_url":"https://de.wikipedia.org/wiki/Friedensmuseum_Hiroshima","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Hiroshima_Peace_Memorial_Museum_2013-08-06B.JPG","page_title":"Friedensmuseum Hiroshima","context_page_description":"Das Friedensmuseum Hiroshima ist ein 1955 eröffnetes Museum zum Gedenken und zur Dokumentation des Atombombenabwurfs auf Hiroshima. Es befindet sich im Friedenspark von Hiroshima."},{"page_url":"https://hr.wikipedia.org/wiki/Pepeljuga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Cinderella_-_Project_Gutenberg_etext_19993.jpg","page_title":"Pepeljuga","context_page_description":"Pepeljuga je bajka o lijepoj djevojci koja je ostala bez roditelja, a živjela je s maćehom i ružnim polusestrama. Pepeljuga je bila tlačena s njihove strane. Radila je sve kućanske poslove, a nije joj bilo dopušteno ni spavati u krevetu, već je spavala pored ognjišta.\\nJednog je dana u njihovu carstvu izašao proglas da kraljevska obitelj održava bal u sinovu čast, kako bi ondje mogao izabrati svoju buduću suprugu. Pozvane su sve djevojke iz carstva. Pepeljuga se silno radovala balu, ali je maćeha nije pustila, već joj je zapovjedila da radi kućanske poslove. Utučena Pepeljuga plakala je dok su joj maćeha i polusestre odlazile na dvor. Nedugo potom u njihovoj se kući stvorila dobra vila i načinila joj haljinu i staklene cipelice u kojoj će otići na bal. Još k tomu je stvorila i prekrasnu kočiju s konjima bijelcima. Upozorila je Pepeljuga da će čarolija trajati sve dok bat ne otkuca ponoć posljednji put. Pepeljuga se zaputila na dvor i odmah je ljepotom zasjenila sve prisutne, tako da je princ plesao samo s njom čitavu večer. Sati su prolazili, i ponoć je došla. Sjetivši se vilinih riječi, Pepeljuga je brže-bolje pobjegla s dvora."},{"page_url":"https://sv.wikipedia.org/wiki/Degeberga_f%C3%B6rsamling","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Degeberga_kyrka%2C_april_2015.jpg","page_title":"Degeberga församling","context_page_description":"Degeberga församling var en församling i Villands och Gärds kontrakt i Lunds stift. Församlingen låg i Kristianstads kommun i Skåne län och utgjorde ett eget pastorat. Församlingen uppgick 2014 i Degeberga-Everöds församling."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_Dinant_(1914)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Statue_du_lieutenant_de_Gaulle_%C3%A0_Dinant.jpg","page_title":"Bataille de Dinant (1914)","context_page_description":"La bataille de Dinant est une bataille de la Première Guerre mondiale qui opposa les troupes françaises à l'armée allemande, du 15 au 23 août 1914, pour le contrôle de la ville de Dinant, dans la province de Namur, en Belgique.\\nElle est devenue tristement célèbre le 23 août 1914 par le massacre de 674 civils par les forces allemandes, notamment dans le quartier des Rivages et dans le village de Neffe."},{"page_url":"https://fr.wikipedia.org/wiki/Georges_Annenkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/El._Boris._Annenkova-Galperina_by_Y._Annenkov_%281917%2C_GRM%29.jpg","page_title":"Georges Annenkov","context_page_description":"Georges Annenkov est un peintre russe, décorateur de cinéma et costumier, né le 18 juillet 1889 à Petropavlovsk, dans l'Empire russe, et mort le 12 juillet 1974 à Paris.\\nDe Friedrich Wilhelm Murnau à Jacques Becker et Alex Joffé, en passant par Max Ophüls, de 1926 à 1966, Georges Annenkov, créateur de costumes, a traversé quarante ans de cinéma européen."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D5%AC%D5%A3%D5%AB%D5%A1%D5%B5%D5%AB_%D5%B6%D5%A5%D6%80%D5%AF%D5%A1%D5%B5%D5%A1%D6%81%D5%B8%D6%82%D6%81%D5%AB%D5%B9%D5%B6%D5%A5%D6%80%D5%AB_%D5%BA%D5%A1%D5%AC%D5%A1%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Chambre_Belgique_interieur.jpg","page_title":"Բելգիայի ներկայացուցիչների պալատ","context_page_description":"Բելգիայի ներկայացուցիչների պալատ, Բելգիայի դաշնային խորհրդարանի ստորին պալատ: 2014 թվականի հոկտեմերի 14-ից պալատնի նախագահ է Զիգֆրիդ Բրակկեն՝ Նոր ֆլամանդական ալյանսի անդամը:"},{"page_url":"https://en.wikipedia.org/wiki/Cape_Government_Railways","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Cape_Government_Railways_map_-_1882_-_Cape_Archives.jpg","page_title":"Cape Government Railways","context_page_description":"The Cape Government Railways was the government-owned railway operator in the Cape Colony from 1874 until the creation of the South African Railways in 1910."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B8%D6%82%D6%80%D5%A2_%D5%84%D5%A1%D6%80%D5%AB%D5%A1%D5%B4_%D5%A5%D5%AF%D5%A5%D5%B2%D5%A5%D6%81%D5%AB_(%D5%8D%D5%A1%D5%B6%D5%AF%D5%BF_%D5%8A%D5%A5%D5%BF%D5%A5%D6%80%D5%A2%D5%B8%D6%82%D6%80%D5%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Saint_Mary%27s_Church_in_SPB.jpg","page_title":"Սուրբ Մարիամ եկեղեցի (Սանկտ Պետերբուրգ)","context_page_description":"Սուրբ Մարիամ եկեղեցի, ավետարանչական-լյութերական ուղղության գործող ֆիննական մայր տաճար Սանկտ Պետերբուրգում: Պատկանում է Ինգրիայի ավետարանչական-լյութերական եկեղեցուն, քաղաքի գլխավոր ֆիննական լյութերական տաճարն է։"},{"page_url":"https://fr.wikipedia.org/wiki/Miehikk%C3%A4l%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Tank_obstacles_in_Miehikkala.jpg","page_title":"Miehikkälä","context_page_description":"Miehikkälä est une municipalité du sud-est de la Finlande. La commune se trouve dans la province de Finlande méridionale et la région de la Vallée de la Kymi."},{"page_url":"https://pt.wikipedia.org/wiki/Barrancos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Taureau_de_Barrancos.JPG","page_title":"Barrancos","context_page_description":"Barrancos é uma vila portuguesa raiana no distrito de Beja, região Alentejo e sub-região do Baixo Alentejo, com cerca de 1 800 habitantes.\\nCom 1 792 habitantes, o município de que é sede é o de menor população do Continente e o terceiro menos povoado de Portugal, tendo uma área de 168,42 km². O município é limitado a norte e a leste pelos municípios espanhóis de Oliva de la Frontera e Valencia del Mombuey e de Encinasola, a sul e oeste pelo município de Moura e a noroeste pelo município de Mourão.\\nBarrancos é um dos seis municípios de Portugal constituídos por uma única freguesia. Dista 110 km da capital do distrito de Beja e o mesmo da cidade de Évora."},{"page_url":"https://az.wikipedia.org/wiki/Dizayner_narkotiki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Wakeup_Badesalz_mit_Inhalt.jpeg","page_title":"Dizayner narkotiki","context_page_description":"Dizayner narkotiki — hər hansı bir təbii narkotik üçün sintetik əvəzedicilər, lakin strukturda eyni olmayan, oxşar farmakoloji fəaliyyəti fərqlənən və mövcud qanunvericiliyi aldatamaq üçün hazırlanmış psixoaktiv narkotik."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D0%B7%D0%B5%D0%BD%D0%B3%D0%B0%D1%83%D0%B7%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Busenhausen_dorfplatz_01.jpg","page_title":"Бузенгаузен","context_page_description":"Бузенгаузен — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Альтенкірхен. Складова частина об'єднання громад Альтенкірхен.\\nПлоща — 3,02 км². Населення становить 339 ос."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Doubs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/FontaineDeLoray2006.JPG","page_title":"Liste des monuments historiques du Doubs","context_page_description":"Cet article recense les monuments historiques du Doubs, à l'exclusion de ceux de Besançon et Montbéliard qui font l'objet de deux articles séparés."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_th%E1%BA%BF_gi%E1%BB%9Bi_t%E1%BA%A1i_Cuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Costa_t%C3%ADpica_del_Parque_Nacional_Desembarco_del_Granma.jpg","page_title":"Danh sách di sản thế giới tại Cuba","context_page_description":"Di sản thế giới của Tổ chức Giáo dục, Khoa học và Văn hóa Liên Hiệp Quốc là những nơi có tầm quan trọng về văn hóa hoặc tự nhiên được mô tả theo Công ước Di sản Thế giới của UNESCO, thành lập vào năm 1972. Quốc đảo Cuba của Caribe đã chấp nhận công ước vào ngày 24 tháng 3 năm 1981, nhờ đó các di tích lịch sử của Cuba đủ điều kiện để đưa vào danh sách. Tính đến năm 2011, chín địa điểm ở Cuba đã trở thành di sản thế giới.\\nCuba có địa điểm đầu tiên được đưa vào danh sách di sản tại Phiên họp thứ sáu của Ủy ban Di sản Thế giới, tổ chức tại trụ sở của UNESCO ở Paris, Pháp, vào tháng 12 năm 1982. Tại phiên họp này, La Habana Cổ một địa điểm bao gồm một phần trung tâm và cũng là một phần lịch sử Havana-thủ đô của Cuba, cùng với các pháo đài từ thời thuộc địa của Tây Ban Nha đã được ghi vào danh sách.\\nDanh sách di sản thế giới ở Cuba gồm nhiều địa điểm. Hai địa điểm được chọn vì ý nghĩa tự nhiên là Vườn quốc gia Alejandro de Humboldt ở tỉnh Holguín và tỉnh Guantánamo nằm ở phía đông, Vườn quốc gia Desembarco del Granma, được đặt tên theo chiếc thuyền đã chở các thành viên của Phong trào 26 tháng 7, phong trào đã bắt đầu cho sự bùng nổ Cách mạng Cuba."},{"page_url":"https://en.wikipedia.org/wiki/Rail_transport_in_Malaysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Ampang_LRT_train_for_Ampang_Line_%26_Sri_Petaling_Line.png","page_title":"Rail transport in Malaysia","context_page_description":"Rail transport in Malaysia consists of heavy rail, light rapid transit, mass rapid transit\\n, monorails, airport rail links and a funicular railway line. Heavy rail is mostly used for intercity passenger and freight transport as well as some urban public transport, while rapid transit is used for intra-city urban public transport in Kuala Lumpur, the national capital, and the surrounding Klang Valley region. There are two airport rail link systems linking Kuala Lumpur with the Kuala Lumpur International Airport and Sultan Abdul Aziz Shah Airport. The longest monorail line in the country is also used for public transport in Kuala Lumpur, while the only funicular railway line is in Penang.\\nThe railway network covers most of the 11 states in Peninsular Malaysia. In East Malaysia, only the state of Sabah has railways. The network is also connected to the Thai railway 1,000 mm network in the north. If the Burma Railway is rebuilt, services to Myanmar, India, and China could be initiated."},{"page_url":"https://ms.wikipedia.org/wiki/Bas_Routemaster","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/London_Transport_Routemaster_Bus.JPG","page_title":"Bas Routemaster","context_page_description":"AEC Routemaster adalah sebuah model bas dua-tingkat yang diperkenalkan oleh Associated Equipment Company pada 1954 dan dikeluarkan hingga 1968. Secara asas enjin hadapan, bontot platform terbuka bas, sebilangan kecil variants dikeluarkan dengan pintu-pintu dan/atau tempat masuk hadapan. Dihasilkan pada 1956, Routemaster melihat perkhidmatan berterusan di London hingga 2005, dan kini ditetapkan pada dua jalan warisan di pusat London.\\nDengan mengembangkan pengongsian dengan Angkutan London, pelanggan pada hampir semua Routemaster baru adalah untuk menjadi pertubuhan itu, dalam warna \\"negara\\" tradisional merah dan hijau, walaupun bilangan kecil juga dikrimkan baru ke British European Airways dan Syarikat Angkutan Am Utara. Dalam keseluruhannya, 2,876 Routemaster telah dibina, dengan lebih kurang 1,000 masih hadir.\\nSuatu reka bentuk perintisan, Routemaster tahan lebih lama daripada beberapa jenis penggantiannya di London, kekal keswastaan bekas pengelola bas Angkutan London, dan melihatkan pembiakan pada para pengelola lain di keliling UK. Kemudiannya pada pengendalian bas angkutan awam moden UK, ciri-ciri unik pada Routemaster piawai menarik kepujian dan pengkritikan secara seiras."},{"page_url":"https://de.wikipedia.org/wiki/Belrain","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Belrain_chapelle_Sainte-Genevi%C3%A8ve.JPG","page_title":"Belrain","context_page_description":"Belrain ist eine französische Gemeinde mit 37 Einwohnern im Département Meuse in der Region Grand Est. Sie gehört zum Arrondissement Commercy und zum Kanton Dieue-sur-Meuse."},{"page_url":"https://cs.wikipedia.org/wiki/Ethyn","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Reppe-chemistry-carbonmonoxide-01.png","page_title":"Ethyn","context_page_description":"Ethyn je nejjednodušší alkyn. Za normálního tlaku a teploty se jedná o bezbarvý plyn vonící po česneku. Jeho teplota varu je −80,8 °C.\\nEthyn byl objeven v roce 1836 Edmundem Davym, který ho identifikoval jako „novou uhlíkatou sloučeninu vodíku“. Znovuobjeven byl v roce 1860 francouzským chemikem Marcellinem Berthelotem, který vymyslel název „acetylen“. Laureát Nobelovy ceny Nils Gustaf Dalén přišel o zrak v důsledku výbuchu acetylenu."},{"page_url":"https://it.wikipedia.org/wiki/Monselice","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Monselice_duomoVecchio.jpg","page_title":"Monselice","context_page_description":"Monsélice è un comune italiano di 17 407 abitanti della provincia di Padova in Veneto. Ha ottenuto il titolo di città il 7 giugno 1960."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B3%E5%AE%B6%E5%9E%B4%E6%88%98%E6%96%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/1940pengdehuai.jpg","page_title":"关家垴战斗","context_page_description":"关家垴战斗，是中国抗日战争中八路军损失最大的一次进攻战役，属于百团大战的第三阶段。在八路军在华北地区发动破袭战的后期，被执行扫荡的侵华日军反扑至几近八路军总部。1940年10月30日战至10月31日，八路军集结近两万人，对占领关家垴的约500名日军进行围攻。然而历时两昼夜，未能全歼日军。11月1日增援日军赶到，八路军被迫撤退。关家垴战斗是百团大战中极具争议的一战，被彭德怀视为自己戎马一生的四大败仗之一。"},{"page_url":"https://eu.wikipedia.org/wiki/Santar%C3%A9m_(Par%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bras%C3%A3o_Santar%C3%A9m.jpg","page_title":"Santarém (Pará)","context_page_description":"Santarém Brasilgo udalerri bat da, Pará estatuan kokatua. 292.520 biztanle ditu 17.898,389 km²ko eremuan."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Ondras","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Saint-Ondras_le_coeur_du_village.jpg","page_title":"Saint-Ondras","context_page_description":"Saint-Ondras is a commune in the Isère department in southeastern France."},{"page_url":"https://es.wikipedia.org/wiki/Selinsgrove","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Selinsgrove%2C_Pennsylvania.jpg","page_title":"Selinsgrove","context_page_description":"Selinsgrove es un borough ubicado en el condado de Snyder en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 5.383 habitantes y una densidad poblacional de 1,076.9 personas por km².​"},{"page_url":"https://sk.wikipedia.org/wiki/L%C3%BCbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Heinrich_der_L%C3%B6we_und_Mathilde_von_England.jpg","page_title":"Lübeck","context_page_description":"Lübeck je bývalé hanzové mesto a mestský okres na severe Nemecka, konkrétne na juhovýchode spolkovej krajiny Šlezvicko-Holštajnsko ležiace pri Baltskom mori. Po hlavnom meste Kiele má v spolkovej krajine najväčší počet obyvateľov a rozlohou ide o najväčšie mesto Šlezvicka-Holštajnska. Stredoveké centrum mesta je zapísané na zozname svetového kultúrneho dedičstva UNESCO."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Ouvrages_der_Maginot-Linie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Fort_Hackenberg.jpg","page_title":"Liste der Ouvrages der Maginot-Linie","context_page_description":"Hier ist die komplette Liste der Ouvrages der Maginot-Linie, organisiert nach Sektor und Typ der Festungen.\\nDas französische Wort „ouvrage“ heißt übersetzt „Werk“. Eine Ouvrage besteht üblicherweise aus einer Folge von mit Beton umgebenen Kampfblöcken, die unterirdisch miteinander verbunden sind."},{"page_url":"https://hu.wikipedia.org/wiki/Radoslav_Kov%C3%A1%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Radoslav_Kovac_1.jpg","page_title":"Radoslav Kováč","context_page_description":"Radoslav Kováč cseh labdarúgó, jelenleg a Slovan Liberec játékosa. 2004 és 2009 között a cseh válogatott tagja. Általában hátvédet játszik, de bevethető védekező középpályásként is."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BA-%D0%BD-%D1%80%D0%BE%D0%BB%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Birthplace_of_Rock_%27N%27_Roll.jpg","page_title":"Рок-н-ролл","context_page_description":"Рок-н-ролл — 1950 жылдардың ортасында кең тарала бастаған, танымал музыка жанры. Ритм-н-блюз және кантри секілді афроамериканды және \\"ақ\\" жанрлардың қосындысынан пайда болды.\\nОған қоса ақ орындаушылар стилі \\"рокабилли\\" деген атауға ие болды.\\nЕрекшеленетін белгілері:\\nАнық ырғақ\\nЖылдам қарқын\\nӘн орындалуының емін-еркіндігі.\\nЭлектрогитара, контрабас, соқпалы музыкалық аспаптар, фортепиано және саксофон - осы жанрда ойналатын дәстүрлі аспаптар. Рок-н-ролл үшін 4/4 өлшем бірлігі сай келеді. 1960 жылдары рок-н-ролл кең таралып кеткені соншалық, жаңа, жеке \\"рок-музыка\\" деп аталатын жанр пайда болды."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%A6%AC%E7%B1%A0%E5%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Magome-juku%28post_town%29_%2C_%E9%A6%AC%E7%B1%A0%E5%AE%BF_-_panoramio_%2820%29.jpg","page_title":"馬籠宿","context_page_description":"马笼宿是一位于日本岐阜县中津川市的日本古驿道宿场遗迹，其与隔邻的妻笼宿一同都是该县著名的观光景点。马笼宿是中山道六十九次之一，名列第43次，也是信浓国境内木曾十一宿中位置最南的一个。\\n由于曾经在1895年与1915年时发生过大火，整条老街除了中央的石造阶梯与被称为“枡形”的隘口之外，皆为事后复原重建。但由于石板坡道旁的老街建筑大抵维持了江户时代的原样，颇受观光客欢迎，其中以宿场本阵所改成的藤村纪念馆是用于纪念生长在此屋、明治时代著名的小说家与诗人岛崎藤村，他的长篇历史小说《拂晓前》就是以故乡马笼作为舞台所撰著的。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%80%E0%A6%A4%E0%A6%BE%E0%A6%95%E0%A7%81%E0%A6%A3%E0%A7%8D%E0%A6%A1_%E0%A6%89%E0%A6%AA%E0%A6%9C%E0%A7%87%E0%A6%B2%E0%A6%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Sitakunda18.jpg","page_title":"সীতাকুণ্ড উপজেলা","context_page_description":"সীতাকুণ্ড উপজেলা বাংলাদেশের চট্টগ্রাম জেলার অন্তর্গত একটি উপজেলা যা ৯টি ইউনিয়ন ও ১টি পৌরসভা নিয়ে গঠিত। এটি চট্টগ্রাম জেলার ১৫টি উপজেলার, বাংলাদেশের প্রশাসনিক ব্যবস্থার দ্বিতীয় স্তর, একটি। এটি চট্টগ্রাম বিভাগের অধীন চট্টগ্রাম জেলার মধ্যে একটি এবং চট্টগ্রাম জেলার উত্তরে অবস্থিত। চট্টগ্রাম নগরীর ৯ কি.মি. উত্তরে রাজধানী ঢাকা থেকে ২১৯ কি.মি.দক্ষিণে - ৩৫ কি.মি. দৈর্ঘ্য বিশিষ্ট গিরিসৈকতের মিলন কেন্দ্র বার আউলিয়ার পূণ্যভূমিতে সীতাকুন্ড থানার অবস্থান। এই উপজেলর উত্তরে মিরসরাই ও ফটিকছড়ি উপজেলা, দক্ষিণে পাহাড়তলী থানা, পূর্বে ফটিকছড়ি ও হাটহাজারী উপজেলা এবং পাঁচলাইশ থানা, পশ্চিমে সন্দ্বীপ চ্যানেল ও সন্দ্বীপ উপজেলা অবস্থিত। সীতাকুন্ড উপজেলায় দেশের প্রথম ইকোপার্ক অবস্থিত, পাশাপাশি বিকল্প শক্তি প্রকল্প, বিশেষ করে বায়ু শক্তি এবং ভূ-তাপীয় শক্তি প্রকল্প অবস্থিত।\\nসীতাকুন্ড বাংলাদেশে মানব বসতির প্রাচীনতম একটি স্থান। এর ইতিহাসের বেশিরভাগ সময়, সীতাকুন্ডের পূর্বদিক মিয়ানমারের বিভিন্ন বৌদ্ধ শাসক এবং পশ্চিমে বাংলার মুসলিম শাসকরা পর্যায়ক্রমে শাসন করেছিলেন। অষ্টম শতাব্দীর একটি সংক্ষিপ্ত সময়ের জন্য ভারতের পাল বংশের শাসকরা সীতাকুন্ড শাসন করেছিল। সীতাকুন্ডের পূর্বাঞ্চলে শাসকরা আরাকান রাজ্য, ম্রাক ইউ রাজবংশ, আরাকানীয় জলদস্যু এবং পৌত্তলিক রাজ্য থেকে এসেছিলেন।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BD%D0%BD%D0%B5%D0%B3%D1%83%D1%82,_%D0%9A%D1%83%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/SlaughterHouse5_Dresden.jpg","page_title":"Воннегут, Курт","context_page_description":"Курт Во́ннегут-младший — американский писатель-сатирик. Считается одним из наиболее значительных американских писателей XX века. Автор таких произведений, как «Сирены Титана», «Мать Тьма», «Колыбель для кошки», «Бойня номер пять, или Крестовый поход детей» и «Завтрак для чемпионов», сочетающих в себе элементы сатиры, чёрного юмора и научной фантастики. Был удостоен чести называться «Писателем штата Нью-Йорк» в 2001—2003 годах."},{"page_url":"https://it.wikipedia.org/wiki/Muscolo_succlavio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Subclavius_muscle_frontal2.png","page_title":"Muscolo succlavio","context_page_description":"Il muscolo succlavio è un piccolo muscolo triangolare che si estende fra la clavicola e la prima costa. Contribuisce a formare la parete anteriore dell'ascella assieme ai muscoli grande e piccolo pettorale."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D1%8C%D1%8F%D0%BD%D0%B2%D0%B5%D0%B2%D0%B0_(%D2%BA%D0%BE%D0%BD%D0%B4%D1%83%D1%80%D0%B0%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/EscudoMuniVillanueva.png","page_title":"Вильянвева (Һондурас)","context_page_description":"Вильянвева — Һондурасның Кортес департаментында урнашкан шәһәр."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%98%84%EB%AF%B8%EA%B2%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Asztal.jpg","page_title":"현미경","context_page_description":"현미경은 눈으로는 볼 수 없을 만큼 작은 물체나 물질을 확대하여 관찰하는 장치이다. 일반적으로 '현미경'이라 하면 광학 현미경을 가리키는 경우가 많다. 대물렌즈, 접안렌즈, 조명 장치 따위로 된 광학 현미경 외에 금속 현미경, 위상차 현미경, 편광 현미경, 적외선 현미경, 자외선 현미경, 전자 현미경 등이 있다. 제1세대 광학 현미경, 제2세대 전자 현미경, 제3세대 원자 현미경으로 발전했다."},{"page_url":"https://it.wikipedia.org/wiki/Localit%C3%A0_italiane_Bandiera_Blu_(2014)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/San_Terenzo_%28Lerici%29-panorama_2011.jpg","page_title":"Località italiane Bandiera Blu (2014)","context_page_description":"Elenco delle 140 località italiane insignite della Bandiera Blu dalla FEE per l'anno 2014."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Haiger","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Dicke_Eiche_Oberro%C3%9Fbach.jpg","page_title":"Liste der Naturdenkmale in Haiger","context_page_description":"Die Liste der Naturdenkmale in Haiger nennt die auf dem Gebiet der Stadt Haiger gelegenen Naturdenkmale. Sie sind bei der unteren Naturschutzbehörde des Lahn-Dill-Kreises eingetragen."},{"page_url":"https://nv.wikipedia.org/wiki/Diy%C3%B3%C3%B3sh","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Pituophis_catenifer_sayi_007.jpg","page_title":"Diyóósh","context_page_description":"Diyóósh éí tłʼiish dayikahjįʼ atah yisdzoh, áádóó éí Náhookǫsjí kéyah dah siʼánígíí tʼéiyá hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Pituophis catenifer sayi\\" deiłníigo dayózhí."},{"page_url":"https://sh.wikipedia.org/wiki/Zoran_Kru%C5%A1var","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Zoran_Kru%C5%A1var_260408.jpg","page_title":"Zoran Krušvar","context_page_description":"Zoran Krušvar, hrvatski književnik i novinar."},{"page_url":"https://lt.wikipedia.org/wiki/Mirski%C5%A1k%C4%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Mirskiskemalunas1.jpg","page_title":"Mirskiškė","context_page_description":"Mirskiškė – buvęs Bubių dvaro palivarkas Šiaulių rajone, Kurtuvėnų reg. parko rytiniame pakraštyje.\\nIšlikusi dvaro sodyba, technikos paminklas – XIX a. statytas vandens malūnas su veikiančia technologine įranga. Šalia dvaro yra Pirmojo pasaulinio karo karių kapinės. Vakaruose plyti Paraudžių miškas."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8F%D0%B5%D1%98%D0%BC%D1%81_%D0%A1%D0%B8%D1%82%D0%B8_(%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%BE%D0%BB%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/NCMap-doton-JamesCity.PNG","page_title":"Џејмс Сити (Северна Каролина)","context_page_description":"Џејмс Сити насељено је место без административног статуса у америчкој савезној држави Северна Каролина."},{"page_url":"https://nv.wikipedia.org/wiki/N%C3%ADyol_yii%CA%BC_t%CA%BC%C3%A1yi%C5%82ta%CA%BC%C3%AD_yizh%C3%B3l%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Soft-plumaged_Petrel.jpg","page_title":"Níyol yiiʼ tʼáyiłtaʼí yizhólígíí","context_page_description":"Níyol yiiʼ tʼáyiłtaʼí yizhólígíí éí tónteel tsídii bínííʼtsohígíí dah yikahjí atah yisdzoh, áádóó éí Shádiʼááhjí Tónteel bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Pterodroma mollis\\" deiłníigo dayózhí."},{"page_url":"https://zh.wikipedia.org/zh-my/PP-2000%E5%86%B2%E9%94%8B%E6%9E%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/PP-2000_%28350-12%29.jpg","page_title":"PP-2000冲锋枪","context_page_description":"PP-2000是一款由俄罗斯图拉俄联邦仪器设计局所研制和生产的冲锋枪，同时兼具冲锋手枪和單兵防卫武器的特征，发射多种9×19毫米帕拉贝鲁姆弹，包括俄罗斯所研制的7N21和7N31两种高压子弹。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1924","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Wim_Spit_%281974%29.jpg","page_title":"Lijst van personen geboren in 1924","context_page_description":"Dit is een lijst van personen die geboren zijn in 1924.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Lyndon,_Kentucky","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/LYNDONCLOCKTOO.JPG","page_title":"Lyndon, Kentucky","context_page_description":"Lyndon is a home rule-class city in Jefferson County, Kentucky, United States. The population was 11,002 at the 2010 census, up from 9,369 at the 2000 census.\\nIncorporated on May 10, 1965, Lyndon became part of the new Louisville Metro government in 2003. It remains an independent city with its own mayor and emergency services and is not counted in Louisville's population although its citizens can vote for the mayor of Louisville and Metro Council members."},{"page_url":"https://zh.wikipedia.org/zh-sg/GAZ%E7%8C%9B%E8%99%8E%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/R-145BMA_command_vehicle-driver_place.jpg","page_title":"GAZ猛虎車","context_page_description":"GAZ猛虎车为俄罗斯2006年起装备的基层轻装甲四轮车，类似美军悍马车的角色。\\n其中，供应给中国武警使用的车辆是授权给中国燕京公司组装。\\n此型车属于全地形车辆。也有众多民间版本和警消改型。"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E4%BA%9E%E6%AD%B7%E5%B1%B1%E5%A4%A7%E4%B8%B9%E5%B0%BC%E5%A3%ABEnviro_400","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Au_Morandarte_Flickr_Reading_Buses_751_%28YX64_VRL%29_on_Route_21%2C_Reading_Station_%2815390405558%29.jpg","page_title":"亞歷山大丹尼士Enviro 400","context_page_description":"亞歷山大丹尼士Enviro 400（Alexander Dennis Enviro 400）係一款由英國亞歷山大丹尼士出嘅兩軸低地台雙層巴士。\\n第一款Enviro 400喺2005年底亮相，而第二款就喺2014年推出。"},{"page_url":"https://ceb.wikipedia.org/wiki/Cidaris_blakei","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Cidaris_blakei.jpg","page_title":"Cidaris blakei","context_page_description":"Espesye sa tuyom ang Cidaris blakei. Ang Cidaris blakei sakop sa kahenera nga Cidaris sa kabanay nga Cidaridae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Central_L%C3%BC%C3%9F_Plateau_Heathland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/HeideblueteTiefental.JPG","page_title":"Central Lüß Plateau Heathland","context_page_description":"The Central Lüß Plateau Heathland are a nature reserve within the Südheide Nature Park with a total area of about 293 hectares. They were placed under protection in 1995 and consist of three physically separate areas of land: the Misselhorn Heath, the Schillohsberg Heath and the Weesener Weg Heathland. The region referred to as Heathland and Rough Pasture in the Südheide with an area of 278.3 hectares was also declared as Special Area of Conservation No. 277. The conservation agency responsible is the district of Celle.\\nThe Misselhorn Heath, with a section that is known as the Tiefental, has an area of about 209 hectares. It begins 2 km east of Hermannsburg and consists predominantly of heath. These are almost exclusively covered by the common heather. Only occasionally, in the wetter locations, is the cross-leaved heath also found. bladderworts, an endangered genus of carnivorous plants that occur in fresh water and wet soil, are found in several, smaller, boggy or wet locations, as is the spoonleaf sundew, another protected carnivorous plant."},{"page_url":"https://en.wikipedia.org/wiki/Heather_Mac_Donald","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Heather_Mac_Donald_%28cropped%29.jpg","page_title":"Heather Mac Donald","context_page_description":"Heather Lynn Mac Donald is an American conservative political commentator, essayist and attorney. She is a Thomas W. Smith Fellow of the Manhattan Institute and a contributing editor of the institute's City Journal. She has written numerous editorials and is the author of several books.\\nShe is known for her pro-police views and her opposition to criminal justice reform, as expressed in her book The War on Cops and columns such as \\"The Myth of the Racist Cop\\" and \\"The Myth of Systemic Police Racism.\\""},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%A6%D7%AA_%D7%A4%D7%91%D7%A8%D7%96%27%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Moscow_Kremlin_Egg.jpg","page_title":"ביצת פברז'ה","context_page_description":"ביצי פברז'ה הן 69 תכשיטים בצורת ביצה שנוצרו על ידי \\"בית פברז'ה\\" - בית המלאכה של התכשיטן פטר קארל פברז'ה, בסנקט פטרבורג, בשנים 1885–1917.\\n50 ביצים נוצרו על ידי פברז'ה עבור הצארים של רוסיה אלכסנדר השלישי וניקולאי השני. שתי ביצים נוספות אשר הוכנו עבור הצאר בשנת 1917 לא הועברו לו בשל מהפכת פברואר. שבע נוספות הוכנו עבור משפחת קלץ' ממוסקבה.\\nאת הביצים יצרו ממתכות יקרות והן עוטרו באבנים יקרות ובאמייל. כיום \\"ביצת פברז'ה\\" הפך לשם נרדף לתכשיטי זהב איכותיים וגם למותרות."},{"page_url":"https://et.wikipedia.org/wiki/Eduard_Tubin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Roots-Tubin-Juht-1947.jpg","page_title":"Eduard Tubin","context_page_description":"Eduard Tubin oli eesti helilooja."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%AA%E6%80%A55300%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%E9%98%AA%E6%80%A5%E9%9B%BB%E9%89%845300%E7%B3%BB.jpg","page_title":"阪急5300系電車","context_page_description":"阪急5300系電車は、1972年に登場した阪急電鉄の通勤形電車である。"},{"page_url":"https://en.wikipedia.org/wiki/Laura_Ainsworth","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Suffragette_Laura_Ainsworth_1911._Blathwayt%2C_Col_Linley.jpg","page_title":"Laura Ainsworth","context_page_description":"Laura Ainsworth was a British teacher and suffragette. She was employed by the Women's Social and Political Union and was one of the first suffragettes to be force-fed. She left the WSPU in 1912 in protest at the ejection of the Pethick-Lawrences, but continued to work for women's suffrage."},{"page_url":"https://sv.wikipedia.org/wiki/Maria_Cantemir","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Maria_kantemir_%28%3F%29_by_i.nikitin.jpeg","page_title":"Maria Cantemir","context_page_description":"Maria Cantemir, född 29 april 1700 i Iași, död 9 september 1754 i Moskva, var en rumänsk adelsdam, rysk hovdam och salongsvärd, mätress till tsar Peter den store.\\nDotter till furst Dimitrie Cantemir och syster till poeten Antioch Kantemir. Maria var mycket välutbildad. Hennes familj emigrerade till Ryssland 1711 efter att ha stött en rysk invasion i det turkiska Moldavien. Maria blev Peters mätress 1720. 1722 följde hon med Peter till Astrachan, där hon födde en son. Hon uppfattades då som ett hot mot kejsarinna Katarina, som var rädd att bli ersatt av henne. Sonen dog 1723, möjligen förgiftad av Katarinas läkare. Peters och Marias relation fortsatte mot bakgrunden av Katarinas förbindelse med Mons. Maria lämnade hovet vid Peters död 1725, men var hovdam åt tsar Peter II av Ryssland: syster Natalia 1727-28 och Anna Ivanovna 1730-31. Från 1732 höll hon salong i Sankt Petersburg. 1744 bad hon om broderns tillstånd att grunda ett kloster och bli nunna, men nekades detta. Vid sin död 1754 testamenterade hon sin mark åt grundandet av ett kloster."},{"page_url":"https://en.wikipedia.org/wiki/Firminy_Vert","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Maison_de_la_culture_%C3%A0_Firminy-Vert.jpg","page_title":"Firminy Vert","context_page_description":"Firminy Vert is group of modern buildings designed by architect Le Corbusier located in Firminy, France in 1964–1969. It includes the Saint-Pierre Church, a stadium, a cultural center, and an Unité d'Habitation. It was designed based on Modernism principles of architecture. It is praised as one of Europe's most accomplished postwar planning exercises."},{"page_url":"https://jv.wikipedia.org/wiki/Bungli","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Oroxylum_indicum_W2_IMG_3170.jpg","page_title":"Bungli","context_page_description":"Bungli ya iku wit taunan saka kulawarga Bignoniaceae. Wit iki uga ditepangi kanthi jeneng Kayu pedhang, Kapung-kapung, Dhang-pedhangan, Wungli lan Pangporang. Wit iki dhuwuré bisa nganti 27 mèter lan dhiamèter galihé 40 séntimèter. Galihé bengkok lan wernané klawu soklat. Godhong majemuk lan nyirip. Kembangé kasusun ing tandhan. Wijiné polong wujudé pipih."},{"page_url":"https://de.wikipedia.org/wiki/Arrows_A18","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Damon_Hill_1997_Arrows.jpg","page_title":"Arrows A18","context_page_description":"Der Arrows A18 war der 24. Formel-1-Rennwagen von Arrows und der Erste unter dem neuen Eigentümer Tom Walkinshaw. Der A18 wurde in der Saison 1997 eingesetzt und von Frank Dernie konstruiert und später von John Barnard weiter verbessert. Der Wagen wurde von einem Yamaha-0X11C/D-V10-Motor mit 3 Liter Hubraum angetrieben. Die Bereifung kam vom japanischen Reifenkonzern Bridgestone, der Treibstoff von Petroscience."},{"page_url":"https://en.wikipedia.org/wiki/2011_Indianapolis_500","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Schmidt_%26_Tagliani_20110521.jpg","page_title":"2011 Indianapolis 500","context_page_description":"The 95th Indianapolis 500 was held at the Indianapolis Motor Speedway in Speedway, Indiana on Sunday May 29, 2011. The race was part of the 2011 IZOD IndyCar Series season. The track opened for practice on May 14 and time trials were held from May 21 to 22. Alex Tagliani won the pole position, and the race was won by Dan Wheldon. It was his second Indy 500 win after the 2005 race, and the last win of his racing career. It was the first of two Indy victories for car owner Bryan Herta.\\nAmerican rookie J. R. Hildebrand of Panther Racing took the lead with two laps to go. As the leaders were cycling through pit stops, Hildebrand was nursing a car very low on fuel. He was attempting to stretch his tank to the finish line and hold on for an unexpected victory. It would have been the first Indy 500 win for Panther Racing, after three consecutive runner-up finishes, and two series championships. On the final turn of the final lap, Hildebrand went high to pass the slow car of Charlie Kimball. He drifted wide and crashed into the outside wall. As his wrecked car coasted down the front straight, Wheldon slipped by in the final 1,000 feet to take the victory."},{"page_url":"https://it.wikipedia.org/wiki/Kontinental_Hockey_League_2008-2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/RIAN_archive_386859_KHL_finals_-_Ak_Bars_vs._Lokomotiv_Yaroslavl_1-0.jpg","page_title":"Kontinental Hockey League 2008-2009","context_page_description":"La stagione 2008-2009 è stata la prima edizione della Kontinental Hockey League. La stagione regolare iniziò il 2 settembre 2008, con ventiquattro squadre iscritte provenienti da quattro nazioni, Russia, Bielorussia, Kazakistan e Lettonia. Alle venti formazioni provenienti dalla vecchia Superliga si aggiunsero per le formazioni dell'Atlant Mytišči, il Barys Astana, la Dinamo Minsk e la Dinamo Riga. La prima edizione del KHL All-Star Game si svolse sulla Piazza Rossa di Mosca il 10 gennaio 2010. L'Ak Bars Kazan' sconfisse la Lokomotiv Jaroslavl' nella finale della Kubok Gagarina per 4-3, conquistando il primo titolo assoluto nella storia della competizione ed il secondo titolo russo consecutivo dopo l'ultima edizione della Superliga.\\nLe formazioni furono suddivise di quattro raggruppamenti, ciascuno intitolato ad una bandiera dell'hockey su ghiaccio sovietico, tuttavia non furono inquadrati in alcuna Conference. In occasione dei playoff si qualificarono le sedici formazioni con il maggior numero di punti di tutta la lega; alle squadre vincitrici delle division furono garantite le prime quattro posizioni assolute. Ciascuna delle 24 squadre giocò un totale di 56 partite."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%82%A4%E3%83%84%E3%82%AD%E3%83%AA%E3%82%B9%E3%83%88%E6%95%99%E6%B0%91%E4%B8%BB%E5%90%8C%E7%9B%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Althusmann.jpg","page_title":"ドイツキリスト教民主同盟","context_page_description":"ドイツキリスト教民主同盟は、1945年に結成されたドイツの中道右派政党である。キリスト教民主主義・自由主義・社会保守主義を綱領とする包括政党・保守政党である。歴代党首のうちコンラート・アデナウアー、ルートヴィヒ・エアハルト、クルト・ゲオルク・キージンガー、ヘルムート・コールが連邦首相となって政権を担当。2005年11月からはアンゲラ・メルケル党首が連邦首相となって以来、政権与党となっている。このキリスト教民主同盟と社会民主党がドイツにおける二大政党である。国際民主同盟加盟。色分け勢力図などでは黒で示されることが多いが、公式のシンボルカラーはオレンジ色。\\n連邦議会では、バイエルン州のみを地盤とするキリスト教社会同盟とともに統一会派を組み、ドイツ社会民主党とともに、議会内で二大勢力をなしている。なお、CDUはバイエルン州では活動していないため、CSUとCDUが競合することもなく、実質的にはCSUはCDUのバイエルン支部となっている。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BA%BD%E7%BA%A6%E5%B8%82%E6%91%A9%E5%A4%A9%E5%A4%A7%E6%A5%BC%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Citicorp_giant_Whale_Creek_jeh.jpg","page_title":"纽约市摩天大楼列表","context_page_description":"紐約市是美國最大的城市，坐落著6,486棟竣工高層建築物，其中有113座高度超過600英尺。這些高樓集中在曼哈頓中城和下城區域，曼哈頓的其他區域以及布魯克林、皇后區、布朗克斯的行政區也有一定數量的高層建築。截至2016年5月，包含在建工程，整個城市中共有241棟高度超過500英尺的建築，這遠超過美國其他城市。\\n紐約市最高的建築是世界貿易中心一號大樓，高度1,776英尺，於2013年5月10日封頂，2014年11月3日正式對外開放。這棟104層高的摩天大樓同時也是美國最高、西半球最高、世界第7高的建築。坐落於曼哈頓中城的帝國大廈，建於1931年，共103層，高1,250英尺，含天線高1,454英尺，是美國第四高、世界第23高的摩天大樓。在其建成之後直到1972年原世界貿易中心110層高的北樓完工，曾一直保有世界上最高建築的桂冠。世界貿易中心世界第一高的稱號並沒有保留很久，1974年位於芝加哥108層高的西爾斯大樓完工後趕超了它。世界貿易中心雙塔在九一一襲擊事件中被毀，帝國大廈也因此重新成為紐約市最高建築，並一直持續到2012年4月在建中的世貿中心一號大樓超過它。紐約市第4高的建築是美國銀行大廈，含塔尖高1,200英尺。並列第5高的是1,046英尺高、曾在1930年到1931年短暫成為世界第一高樓的克萊斯勒大廈，以及完工於2007年的紐約時報大廈。\\n從2003年至今，紐約市共有24座高度超過600英尺的建築完工。包括全美最高建築的世貿中心一號樓，另有12棟在建大樓。世貿中心一號樓是重建世界貿易中心計劃的一部分，此外還有1,079英尺高的三號樓、975英尺高的四號樓、743英尺高的七號樓以及仍在興建的建築：1,350英尺高的二號樓。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Benediktbeuern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Kocheler_Str_14_Benediktbeuern_3.jpg","page_title":"Liste der Baudenkmäler in Benediktbeuern","context_page_description":"In der Liste der Baudenkmäler in Benediktbeuern sind die Baudenkmäler der oberbayerischen Gemeinde Benediktbeuern und von deren Ortsteilen aufgelistet. Grundlage ist die Veröffentlichung der Bayerischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt und seither laufend ergänzt wird."},{"page_url":"https://de.wikipedia.org/wiki/TDR-Baureihe_460","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/TR460517_KBM.jpg","page_title":"TDR-Baureihe 460","context_page_description":"Die Baureihe 460 ist ein elektrischer Triebzug des Typs Desiro Mainline aus dem von Siemens Rail Systems entwickelten Fahrzeugkonzept Desiro. Angel Trains ist Eigentümer von 17 dreiteiligen Einheiten, die von Trans Regio für ihr Verkehrsangebot MittelrheinBahn auf der linken Rheinstrecke eingesetzt werden."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%97%E0%A5%81%E0%A4%B8%E0%A5%8D%E0%A4%A4%E0%A4%BE%E0%A4%B5_%E0%A4%B9%E0%A5%81%E0%A4%B8%E0%A4%BE%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Gust%C3%A1v_Hus%C3%A1k_-_o%C5%99%C3%ADznuto.JPG","page_title":"गुस्ताव हुसाक","context_page_description":"गुस्ताव हुसाक हे चेकोस्लोव्हेकियाचे राष्ट्राध्यक्ष होते."},{"page_url":"https://de.wikipedia.org/wiki/Thomas_Lyttelton,_3._Viscount_Chandos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Official_portrait_of_Viscount_Chandos_crop_2.jpg","page_title":"Thomas Lyttelton, 3. Viscount Chandos","context_page_description":"Thomas Orlando Lyttelton, 3. Viscount Chandos ist ein britischer Politiker der Labour Party und Peer."},{"page_url":"https://en.wikipedia.org/wiki/1996_United_States_Senate_election_in_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Virginia_Senate_Election_Results_by_County%2C_1996.svg","page_title":"1996 United States Senate election in Virginia","context_page_description":"The 1996 United States Senate election in Virginia was held on November 5, 1996. Incumbent Republican U.S. Senator John Warner won re-election to a fourth term over Democratic challenger Mark Warner, who is of no relation."},{"page_url":"https://sk.wikipedia.org/wiki/SEPECAT_Jaguar","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/SEPECAT_Jaguar_2005.jpg","page_title":"SEPECAT Jaguar","context_page_description":"SEPECAT Jaguar je britsko-francúzske prúdové bojové lietadlo určené k útokom na pozemné ciele, pôvodne používané britskou Royal Air Force a francúzskou Armée de l’Air k vykonávaniu priamej leteckej podpory a k jadrovým útokom. Lietadlo je aj naďalej používané v niekoľkých ďalších krajinách, kde bolo vyvážané.\\nLietadlo bolo pôvodne koncipované v 60-tych rokoch ako cvičné prúdové a ľahké bojové lietadlo. Požiadavky na lietadlo sa skoro zmenili na nadzvukové lietadlo schopné vykonávať prieskum a údery taktickou jadrovou zbraňou. Pre Francúzsko bol plánovaný aj variant pre službu na lietadlových lodiach. Lenže ten bol zrušený v prospech lacnejšieho lietadla Dassault-Breguet Super Étendard. Draky lietadiel boli vyrábané spoločnosťou SEPECAT, čo bol spoločný podnik firiem Breguet Aviation a British Aircraft Corporation. Toto spojenie bolo jedným z prvých veľkých spoločných britsko-francúzskych programov výroby vojenských lietadiel.\\nLietadlá Jaguar boli úspešne vyvážané do Indie, Ománu, Ekvádoru a Nigérie. V rámci rôznych leteckých síl boli Jaguary použité v niekoľkých konfliktoch a vojenských operáciách v Mauritánii, Čade, Iraku, Bosne a Pakistane."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%82%D0%BE%D1%80%D0%BE%D0%B2_%D0%AE%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Samuel_Beach_Axtell.jpg","page_title":"Список губернаторов Юты","context_page_description":"Губернатор Юты является главой исполнительной власти данного штата, главнокомандующим вооружёнными силами штата. Губернатор обеспечивает соблюдение законов штата, имеет право утверждать или налагать вето на законопроекты, принятые законодательным собранием Юты.\\nУ самопровозглашённого штата Дезерет, предшественника Территории Юта, был только один губернатор, Бригам Янг. За время существования территорию Юта возглавляло 15 губернаторов, с формированием в 1896 году одноимённого штата его назначает президент США. Самым коротким пребыванием в кресле руководителя штата было у Джона Доусона, а самым продолжительным у Калвина Ремптона.\\nДействующим губернатором является Гэри Герберт, вступивший в должность 11 августа 2009 года после отставки Джона Хантсмана."},{"page_url":"https://tr.wikipedia.org/wiki/Adalar_M%C3%BCzesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/From_the_shores_of_the_islands.jpg","page_title":"Adalar Müzesi","context_page_description":"Adalar Müzesi, Türkiye'nin İstanbul ilinin Adalar ilçesine bağlı Büyükada'da yer alan müze. 10 Eylül 2010 tarihinde İstanbul 2010 Avrupa Kültür Başkenti Ajansının desteği ile açıldı. İstanbul'un ilk çağdaş kent müzesi olarak bilinmektedir. Adalar Vakfı ve Adalar Belediyesi iş birliği ile Büyükada ’nın güneyinde adanın en eski tarihsel yerleşim yeri olan Aya Nikola bölgesinde kurulmuş olan müzenin kalıcı sergilerinin yer aldığı ana binasına yenilenerek kullanıma sokulan eski bir helikopter hangarı ev sahipliği yapmaktadır.\\nMüze, Prens Adaları'nın jeolojik oluşumundan bugününe uzanan hikâyesini binlerce Osmanlı arşiv belgesi, fotoğraf, yüzlerce belgesel film, bugünün Adalar'ını belgeleyen video klipler, Adalar'da hizmet veren kamu kurumlarının arşivlerinden elde edilen dokümanlar, sözlü tarih kayıtları, Adalılar'ın bağışlarından oluşan bir koleksiyon ile sunmaktadır."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%90%D1%84%D0%B8%D0%BD%D1%8B_%D0%BE%D0%BB%D0%B8%D0%BC%D0%BF_(1896_%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/1896_Olympic_opening_ceremony.jpg","page_title":"Афины олимп (1896 он)","context_page_description":"1896 оны Афины олимп — 1896 онд Грекийн Афин хотод явагдсан Зуны олимпын анхдугаар наадам байв."},{"page_url":"https://vi.wikipedia.org/wiki/Boornsterhem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Warten_Wartena.jpg","page_title":"Boornsterhem","context_page_description":"Boarnsterhim là một đô thị ở phía bắc Hà Lan. Tên gọi trong tiếng Hà Lan là Boornsterhem."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BB%D1%8C-%D0%9E%D0%B1%D1%96%D0%BD%D1%8C%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Isle_Aubigny_%C3%89glise_St_Martin_%286%29.JPG","page_title":"Іль-Обіньї","context_page_description":"Іль-Обіньї́ — муніципалітет у Франції, у регіоні Шампань-Арденни, департамент Об. Населення — 162 осіб.\\nМуніципалітет розташований на відстані близько 150 км на схід від Парижа, 50 км на південь від Шалон-ан-Шампань, 30 км на північний схід від Труа."},{"page_url":"https://en.wikipedia.org/wiki/Elwood_(sternwheeler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Altona_and_Elwood_at_Salem_1893_detail.png","page_title":"Elwood (sternwheeler)","context_page_description":"Elwood was a sternwheel steamboat which was built to operate on the Willamette River, in Oregon, but which later operated on the Lewis River in Washington, the Stikine River in Canada, and on Puget Sound. The name of this vessel is sometimes seen spelled \\"Ellwood\\". Elwood is probably best known for an incident in 1893, when it was approaching the Madison Street Bridge over the Willamette River in Portland, Oregon. The bridge swung open to allow the steamer to pass. However, a streetcar coming in from the east end of the bridge failed to notice the bridge was open, and ran off into the river in the Madison Street Bridge disaster."},{"page_url":"https://vi.wikipedia.org/wiki/Roknia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/GM_Guelma_Roknia01.jpg","page_title":"Roknia","context_page_description":"Roknia là một đô thị thuộc tỉnh Guelma, Algérie. Dân số thời điểm năm 2002 là 10.114 người."},{"page_url":"https://fr.wikipedia.org/wiki/Avenue_Mac-Mahon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Rue_d%27Armaill%C3%A9_Goujon_1866.jpg","page_title":"Avenue Mac-Mahon","context_page_description":"L’avenue Mac-Mahon est une rue du 17ᵉ arrondissement de Paris."},{"page_url":"https://tl.wikipedia.org/wiki/Kabasalan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Students_during_the_celebration_of_%22Buwan_ng_Wika%22.JPG","page_title":"Kabasalan","context_page_description":"Ang Bayan ng Kabasalan ay isang ika-4 na klaseng bayan sa lalawigan ng Zamboanga Sibugay, Pilipinas. Ayon sa 2015 senso, ito ay may populasyon na 44,336 sa may 9,473 na kabahayan."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D9%88%DB%8C%D9%86_%D8%B4%DB%8C%D9%84%D8%AF%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Kevinshields_public.jpg","page_title":"کوین شیلدز","context_page_description":"کوین شیلدز آمریکالی آلبوم یاپیمجیسی، بسته‌چی، شارکی یازیچی، شارکیچی و موسیقیچی - پاپ موسیقی ژانرلاریندا اثرلر یارادیب. کوین شیلدز ۲۱ مئی ۱۹۶۳ ‏ تاریخینده حیاتا گؤز آچیب."},{"page_url":"https://da.wikipedia.org/wiki/Stormen_Freja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Frejastorm.PNG","page_title":"Stormen Freja","context_page_description":"Stormen Freja var en storm der ramte Danmark den 7. november 2015. Den blev forudsagt af DMI og navngivet samme dag.\\nUnder den kortvarige lavtrykspassage måtte Limfjordsbroen og Øresundsbroen lukke. Beværtningen Peter Lieps Hus i Dyrehaven nord for København blev stærkt beskadiget af et væltende træ."},{"page_url":"https://fr.wikipedia.org/wiki/Fairey_Fox","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Fairey_Fox.jpg","page_title":"Fairey Fox","context_page_description":"Le Fairey Fox est un avion militaire de l'entre-deux-guerres, bombardier léger biplace. Il a été conçu pour la Royal Air Force, mais fut exporté vers des armées de l'air étrangères : l'Aéronautique militaire belge, la Marina de Guerra del Perú et la Fuerza Aérea del Perú. La Suisse réceptionna 2 exemplaires pour évaluation."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%85%E0%B4%82%E0%B4%B2%E0%B5%8B%E0%B4%A1%E0%B4%BF%E0%B4%AA%E0%B4%BF%E0%B5%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Amlodipine_3d_structure.png","page_title":"അംലോഡിപിൻ","context_page_description":"അംലോഡിപിൻ ദീർഘനേരം പ്രവർത്തിക്കുന്നതും ഡൈഹൈഡ്രോപൈറിഡിൻ വിഭാഗത്തിൽ പെട്ടതുമായ ഒരു കാൽസ്യം ചാനൽ ബ്ലോക്കർ മരുന്നാണ്. ഇത് രക്തസമ്മർദ്ദം കുറയ്ക്കാനും ആഞ്ചൈന എന്ന വിഭാഗത്തിൽ പെട്ട നെഞ്ചുവേദന ചികിത്സിക്കാനും ഉപയോഗിക്കുന്നു. ധമനികളിലെ സ്മൂത്ത് പേശികളെ അയയ്ക്കുന്നതിലൂടെയാണ് അംലോഡിപിൻ രക്തസമ്മർദ്ദം കുറയ്ക്കുന്നത്. ആഞ്ചൈനയുള്ളവരിൽ അംലോഡിപിൻ ഹൃദയപേശികളിലേയ്ക്കുള്ള രക്തയോട്ടം വർദ്ധിപ്പിക്കുന്നു."},{"page_url":"https://az.wikipedia.org/wiki/Monete-syur-Alye","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Mairie_de_Mon%C3%A9tay-sur-Allier_2018-05-07.JPG","page_title":"Monete-syur-Alye","context_page_description":"Monete-syur-Alye — Fransada kommuna, Overn regionunda yerləşir. Departament — Alye. Sen-Pursen-syur-Siul kantonuna daxildir. Kommunanın dairəsi — Mulen.\\nINSEE kodu — 03176."},{"page_url":"https://pl.wikipedia.org/wiki/Pedro_Lascur%C3%A1in_Paredes","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Pedro_Lascurain.jpg","page_title":"Pedro Lascuráin Paredes","context_page_description":"Pedro José Domingo de la Calzada Manuel María Lascuráin Paredes – meksykański polityk, prezydent kraju i najkrócej urzędujący prezydent w historii świata.\\n19 lutego 1913 prezydent Francisco I Madero został obalony przez generała Victoriano Huertę. Aby nadać puczowi pozory legalności Huerta usunął ze stanowisk wiceprezydenta José María Pino Suáreza i prokuratora generalnego. W tej sytuacji prezydentura przeszła na ministra spraw zagranicznych, którym był Lascuráin. Lascuráin mianował Huertę ministrem spraw wewnętrznych, pierwszym w jego linii sukcesji, a następnie zrezygnował. Według źródeł jego prezydentura trwała od 15 do 55 minut. Huerta, już jako prezydent, zaproponował Lascuráinowi stanowisko w rządzie, ale ten odmówił, powracając do praktyki prawniczej."},{"page_url":"https://en.wikipedia.org/wiki/Johnny_Ringo_(TV_series)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mark_Goddard_Don_Durant_Karen_Sharpe_Johnny_Ringo_1959.JPG","page_title":"Johnny Ringo (TV series)","context_page_description":"Johnny Ringo is an American Western television series starring Don Durant that aired on CBS from October 1, 1959, until June 30, 1960. It is loosely based on the life of the notorious gunfighter and outlaw Johnny Ringo, also known as John Peters Ringo or John B. Ringgold, who tangled with Wyatt Earp, Doc Holliday, and Buckskin Franklin Leslie."},{"page_url":"https://eu.wikipedia.org/wiki/Blue_Hill_(Maine)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Sunset_Cliff.jpg","page_title":"Blue Hill (Maine)","context_page_description":"Blue Hill Ameriketako Estatu Batuetako inkorporatutako herri bat da. Hancock konderrian kokatuta dago, Maine estatuan. 2.686 biztanle ditu, 86,57 kilometro koadroko azaleran banatuta."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AD%94%E8%A1%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Herodotos_Met_91.8.jpg","page_title":"魔術","context_page_description":"魔術とは、仮定上の神秘的な作用を介して不思議のわざを為す営みを概括する用語である。魔法とも。\\n人類学や宗教学の用語では呪術という。魔術の語は手品を指すこともある。"},{"page_url":"https://pt.wikipedia.org/wiki/Centro_Financeiro_Internacional_de_Cant%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/GZIFC.jpg","page_title":"Centro Financeiro Internacional de Cantão","context_page_description":"O Guangzhou Twin Towers West Tower é um arranha-céus de 103 andares, em Zhujiang Avenue West, Tianhe District na cidade de Guangzhou, China.\\nA construção do Guangzhou Twin Towers West Tower, desenhado por Wilkinson Eyre, começou em 2005, e foi concluída em 2010. As torres gêmeas se tornaram um dos maiores edifícios em Guangzhou e na China, e servem de centro de conferências, hotel e abriga escritórios. Os primeiros 69 andares do Guangzhou Twin Towers West Tower foram planejados para serem usados como escritórios, os andares 70 a 98 serão hotéis e os andares 99 e 100 serão postos de observação."},{"page_url":"https://sk.wikipedia.org/wiki/Saint-Servant","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Blason_Saint_Servant_sur_Oust.jpg","page_title":"Saint-Servant","context_page_description":"Saint-Servant je francúzska obec, ktorá sa nachádza v departemente Morbihan, v regióne Bretónsko."},{"page_url":"https://fr.wikipedia.org/wiki/Haskovo","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Haskovo_37.JPG","page_title":"Haskovo","context_page_description":"Haskovo avec 77 572 habitants est une ville de Bulgarie, située dans les monts Rhodopes, et la capitale administrative de l'oblast de Haskovo.\\nla ville possède la plus haute statue du monde de la Vierge Marie inaugurée en 2003.\\nHaskovo a un autre record à son actif : un pylône métallique avec drapeau national, qui est le plus haut de Bulgarie."},{"page_url":"https://da.wikipedia.org/wiki/Laubert","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/FR-48-Laubert.JPG","page_title":"Laubert","context_page_description":"Laubert er en by i Lozère, i det sydlige Frankrig.\\nBeboere i Laubert bliver kaldt \\"Laubertois\\"."},{"page_url":"https://en.wikipedia.org/wiki/MV_Miranda_Guinness","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Ships_on_the_Liffey%2C_Dublin_-_geograph.org.uk_-_565850.jpg","page_title":"MV Miranda Guinness","context_page_description":"MV Miranda Guinness was a vessel in the Guinness shipping fleet.\\nShe was built at Charles Hill & Sons of Bristol in 1976 and named after Miranda Guinness, Countess of Iveagh. She went into service in January 1977, first sailing from Dublin Port to Runcorn and regularly plied the Dublin to Liverpool route.\\nIn 1985 the ship collided with the East Link Bridge.\\nShe was sold in 1993 at the Manchester Ship Canal. In April 1993 she was scrapped."},{"page_url":"https://nl.wikipedia.org/wiki/Lyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Palais_de_la_Bourse_%C3%A0_Lyon.jpg","page_title":"Lyon","context_page_description":"Lyon is een stad in het zuidoosten van Frankrijk, gelegen op de plaats waar de rivieren de Rhône en de Saône samenvloeien. De inwoners heten Lyonnais en Lyonnaises.\\nDe leuze van de stad luidt: \\"Avant, avant, Lion le melhor!\\"\\nLyon is het bestuurscentrum van de regio Auvergne-Rhône-Alpes en van de Métropole de Lyon. Het is ook de zetel van de internationale politieorganisatie Interpol. De historische binnenstad staat sinds 1998 op de lijst van Werelderfgoederen van de UNESCO.\\nWat inwonertal betreft is Lyon na Parijs en Marseille de derde stad van Frankrijk indien alleen de bevolking geteld wordt die zich intra-muros bevindt, ofwel in de stad zelf woont. Wanneer men de gehele metropoolregio in de berekening meeneemt, is het zelfs de tweede agglomeratie van Frankrijk. Als hoofdstad van de regio Auvergne-Rhône-Alpes, trekt Lyon veel nationale en Europese aandacht en kent de stad een relatief sterke bevolkingsgroei."},{"page_url":"https://en.wikipedia.org/wiki/The_Ape_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/LugosiApeMan.png","page_title":"The Ape Man","context_page_description":"The Ape Man is a 1943 horror–science fiction film directed by William Beaudine and starring Bela Lugosi. The film follows the tale of a part human part ape.\\nAn in-title-only sequel Return of the Ape Man followed in 1944 and starred Lugosi, John Carradine and George Zucco."},{"page_url":"https://lt.wikipedia.org/wiki/Trak%C5%B3_salos_pilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Trakai_Island_Castle%2C_Lithuania_-_Diliff.jpg","page_title":"Trakų salos pilis","context_page_description":"Trakų salos pilis – gotikinė pilis Trakų mieste, Galvės ežero Pilies saloje, į kurią nutiestas pėsčiųjų tiltas. Pastatyta kunigaikščių Kęstučio ir Vytauto iniciatyva XIV a. II pusėje – XV a. 1-ajame dešimtmetyje. XV a. ši pilis buvo viena iš LDK valdovų rezidencijų. Dabar pilis atstatyta ir yra vienas populiariausių Lietuvoje turistų lankomų objektų; pilyje vyksta įvairios šventės, veikia archeologinė ir istorinė ekspozicijos, medžioklės muziejus. Prie pilies saloje įkurtas parkas."},{"page_url":"https://en.wikipedia.org/wiki/Daniel_Webster_Senate_Page_Residence","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Webster_Hall_%28Daniel_Webster_Senate_Page_Residence%29.JPG","page_title":"Daniel Webster Senate Page Residence","context_page_description":"The Daniel Webster Senate Page Residence, also known as Webster Hall, is the residence for United States Senate Pages. The building is a former funeral home and underwent an $8 million refurbishment in 1995, converting it to its current state. It is located near the Hart Senate Office Building, giving pages the ability to walk to and from work. Pages are required to live in the building during the school year. The building has 24/7 protection by the United States Capitol Police both indoors and on foot around the building. The United States Senate Page School is located in the basement of the building. The residential portion of Webster Hall is staffed by adult employees of the United States Senate Page Program, while the school is staffed by employees of the United States Senate Page School. Pages are supervised by proctors, generally graduate students, who are employed by the United States Senate Page Program. $780 per month is deducted from a page's paycheck to fund room and board."},{"page_url":"https://es.wikipedia.org/wiki/Honda_Civic_Si","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Ef9.jpg","page_title":"Honda Civic Si","context_page_description":"El Honda Civic Si es un modelo con unas especificaciones más deportivas del Civic de Honda. El acabado deportivo Si se introdujo en la tercera generación del Honda Civic, tanto en Japón como en América del Norte. En Canadá, este acabado se conoce como el SiR en la sexta y séptima generación y es equivalente al acabado Si de modelo EX del mercado estadounidense.​​\\nPara los mercados de Japón y Europa, se creó el acabado Type R como la opción más deportiva y de mayor rendimiento del Civic, empezando por el modelo EK9 Hatchback para Japón en 1996 y luego con el modelo EP3 Hatchback para Europa en 2001.\\nEl Civic Si se distingue del Type R por no ser un modelo tan espartano y tratarse de un modelo menos orientado para competir, tiene una amortiguación más cómoda, esta mejor insonorizado y ofrece comodidades a cambio de un rendimiento inferior. En definitiva, el Si se ha posicionado más como un modelo de apariencia deportiva con la comodidad de un vehículo para diario, que ofrece opciones de lujo como un techo corredizo y un sistema de audio de siete altavoces."},{"page_url":"https://ro.wikipedia.org/wiki/Balakovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/BalakovoNPP3.jpg","page_title":"Balakovo","context_page_description":"Balakovo este un oraș din Regiunea Saratov, Federația Rusă și are o populație de 200.470 locuitori."},{"page_url":"https://fr.wikipedia.org/wiki/Louviers","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/27-Louviers-vieux-quartier.jpg","page_title":"Louviers","context_page_description":"Louviers est une commune française, située dans le département de l'Eure, en région Normandie.\\nLa devise de la ville, concédée par le roi Charles VII en 1441, est « Loviers le Franc ».\\nLouviers désignait une espèce de drap tissé serré qui était fabriqué à Louviers et qui était recherché pour l'habillement des personnes de qualité, tandis que le drap d'Elbeuf était plus ordinaire."},{"page_url":"https://en.wikipedia.org/wiki/Assuta_Medical_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Asuta_Hospital.jpg","page_title":"Assuta Medical Center","context_page_description":"Assuta Medical Center is a private medical center in the Ramat HaHayal neighborhood in north Tel Aviv, Israel established in 1936. The hospital performs surgery and diagnostic procedures in all fields of medicine, including cardiology, oncology, gynecology and urology."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%96%D0%BA%D0%B0_%D0%A0%D0%B5%D0%B9%D0%BC%D1%83%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Monica_Raymund.jpg","page_title":"Моніка Реймунд","context_page_description":"Мо́ніка Ре́ймунд — американська акторка. Найбільш відома своєю роллю Рії Торрес в серіалі «Збреши мені»."},{"page_url":"https://en.wikipedia.org/wiki/Driving_licence_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Projekt_nowego_prawa_jazdy.png","page_title":"Driving licence in Poland","context_page_description":"A driving licence in Poland is a document issued by the relevant government agency, regional or local government, confirming the rights of the holder to drive motor vehicles."},{"page_url":"https://ht.wikipedia.org/wiki/Peetz,_Kolorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Peetz%2C_CO.jpg","page_title":"Peetz, Kolorado","context_page_description":"Peetz, Kolorado se yon vil Etazini. Li sitye nan leta Kolorado.\\nChèf-lye li se?."},{"page_url":"https://de.wikipedia.org/wiki/Amplitudenregelung","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Amplitude_-_2.png","page_title":"Amplitudenregelung","context_page_description":"Die Amplitudenregelung dient zur Leistungsregelung elektrischer Verbraucher, die mit Wechselspannungen betrieben werden. Typische Anwendungen sind die Heizungsregelungen industrieller Hochtemperaturöfen."},{"page_url":"https://ro.wikipedia.org/wiki/Milagres","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Milagres.JPG","page_title":"Milagres","context_page_description":"Milagres este un oraș în statul Bahia din Brazilia."},{"page_url":"https://et.wikipedia.org/wiki/Johannes_Aro","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Kalevlaste_Maleva_juhtkond_Vabaduss%C3%B5jas.jpg","page_title":"Johannes Aro","context_page_description":"Johannes Richard Aro oli Eesti sõjaväelane.\\nKalevlaste Maleva adjutant Vabadussõjas."},{"page_url":"https://de.wikipedia.org/wiki/Jakob_Aders","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Elberfelder_Kornverein_Rv.JPG","page_title":"Jakob Aders","context_page_description":"Johann Jakob Aders war Elberfelder Bürgermeister, Bankier und Sozialreformer.\\nNach dem Besuch der Elberfelder Lateinschule absolvierte er eine kaufmännische Ausbildung in einem Bremer Handelshaus. Nach Elberfeld zurückgekehrt, war er zunächst in der Firma seines Vaters tätig, trat dann aber 1793 in das Bankhaus „Johann Heinrich Brink und Comp.“ ein. Im gleichen Jahr heiratete er Anna Helena Brinck, die Tochter seines Arbeitgebers. Bald darauf wurde er Teilhaber der Bank. Gemeinsam wohnten sie im überregional bekannten Wunderbau. 1799 wurde Aders zum Bürgermeister gewählt.\\nAders konzipierte in wirtschaftlich und sozial schwierigen Zeiten ergänzend zu den kirchlichen Aktivitäten ein System der Armenpflege und war damit Wegbereiter des Elberfelder Systems. 1800 gründete er die „Allgemeine Armenanstalt“, 1802 das „Allgemeine Armenhaus“. Mit dem Armenhaus war auch eine Armenschule verbunden, an der der Philanthrop Johann Friedrich Wilberg unterrichtete. Die Armenanstalt gehörte damals zu den ersten Einrichtungen bürgerlicher Armenpflege, einer bis dato nahezu ausschließlich von der Kirche wahrgenommenen Aufgabe."},{"page_url":"https://de.wikipedia.org/wiki/Richard_Gynge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Gynge_Richard_AIK_2011_1.jpg","page_title":"Richard Gynge","context_page_description":"Richard Gynge ist ein schwedischer Eishockeyspieler, der seit Juli 2019 erneut bei Växjö Lakers Hockey in der Svenska Hockeyligan unter Vertrag steht."},{"page_url":"https://sv.wikipedia.org/wiki/Carex_lupuliformis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/False_hop_sedge_%28Carex_lupuliformis%29_%283812893535%29.jpg","page_title":"Carex lupuliformis","context_page_description":"Carex lupuliformis är en halvgräsart som beskrevs av Sartwell och Chester Dewey. Carex lupuliformis ingår i släktet starrar, och familjen halvgräs. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Daewoo_Nexia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Daewoo_Nexia_2008.JPG","page_title":"Daewoo Nexia","context_page_description":"Daewoo Nexia C samochód osobowy klasy kompaktowej produkowany przez koncern Daewoo, później GM Daewoo w latach 1994–2016 jako zmodyfikowana wersja Opla Kadetta E. Od roku 2006 wyłącznym producentem Nexii były zakłady GM Uzbekistan, gdzie produkcję kontynuowano do sierpnia 2016 roku."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Centallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Centallo_panorama.jpg","page_title":"Centallo","context_page_description":"Centallo sī Italia Piemonte toā-khu Cuneo Séng ê chi̍t ê comune."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%B3%E3%83%9D%E3%83%BB%E3%83%AA%E3%83%BC%E3%82%B0%E3%83%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Map_of_comune_of_Campo_Ligure_%28province_of_Genoa%2C_region_Liguria%2C_Italy%29.svg","page_title":"カンポ・リーグレ","context_page_description":"カンポ・リーグレは、イタリア共和国リグーリア州ジェノヴァ県にある、人口約3100人の基礎自治体。\\nフィリグラーナ制作で知られる。旧市街には、ヴィットーリオ・エマヌエーレ2世広場がある。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B2%99%E5%B8%8C%E5%BE%B7%C2%B7%E5%93%88%E5%9D%8E%C2%B7%E9%98%BF%E5%B7%B4%E8%A5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Shahid_Khaqan_Abbasi_signature.png","page_title":"沙希德·哈坎·阿巴西","context_page_description":"沙希德·哈坎·阿巴西，是巴基斯坦穆斯林聯盟的政治人物，他獲得因為巴拿馬文件被調查而辭任巴基斯坦總理的納瓦茲·謝里夫提名出任總理，於2017年8月1日就職，任期10個月。"},{"page_url":"https://tr.wikipedia.org/wiki/John_Gielgud","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/John_Gielgud_%281936%29.jpg","page_title":"John Gielgud","context_page_description":"Sir Arthur John Gielgud, Liyakat Nişanı ve Onur Madalyası sahibi, Emmy, Grammy, Tony ve Oscar ödüllü tiyatro ve sinema oyuncusu. Tarihteki en iyi İngiliz oyunculerden biri olarak kabul edilir."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D1%96_%D1%97%D0%B6%D0%B0%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Zeeegel2.jpg","page_title":"Морські їжаки","context_page_description":"Морські їжаки — клас безхребетних типу голкошкірих. Тепер нараховують близько 800 видів. Клас поділяється на 2 підкласи Правильні та Неправильні морські їжаки залежно від симетрії тіла."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2014/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Chet_Jastremski_1963.jpg","page_title":"Lijst van personen overleden in 2014/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2014.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8-%D0%9C%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Minime1.jpg","page_title":"Мини-Мы","context_page_description":"Мини-Мы — один из персонажей серии фильмов «Остин Пауэрс» в исполнении Верна Тройера, клон доктора Зло. Мини-Мы впервые появился во втором фильме, «Остин Пауэрс: Шпион, который меня соблазнил».\\nКогда доктор Зло был заморожен, его соратники создали клон на случай, если разморозку осуществить не удастся. Мини-Мы — точная копия доктора Зло, только в восемь раз меньше. У него, как и у доктора Зло, есть кот, которого зовут мини-мистер Бигглсуорт. Мини-Мы любит сладости, особенно бельгийский шоколад, а также любит терроризировать Скотта Зло, с которым у него вообще постоянно возникают конфликты. Мини-Мы не может говорить и его общение с окружающими сводится к копированию жестов доктора Зло и звуку «и-и-и-и-и!».\\nПозже перешёл на сторону Остина Пауэрса и стал копировать его."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%B1%D1%96%D0%B0%D1%81_%D0%92%D0%B5%D1%80%D0%B3%D0%B0%D1%85%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Tobias_Verhaecht_-_het_gulden_cabinet.png","page_title":"Тобіас Вергахт","context_page_description":"Тобіас Вергахт — південнонідерландський художник і графік доби маньєризму і раннього фламандського бароко."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_d%27Alleray","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/P1050158_Paris_XV_rue_d%27Alleray_rwk.jpg","page_title":"Rue d'Alleray","context_page_description":"La rue d’Alleray est une rue du 15ᵉ arrondissement de Paris, en France."},{"page_url":"https://en.wikipedia.org/wiki/Brewerton,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Housing_development_in_Brewerton_New_York.jpg","page_title":"Brewerton, New York","context_page_description":"Brewerton is a census-designated place in the town of Cicero in Onondaga County and the town of Hastings in Oswego County in the U.S. state of New York. It lies at the west end of Oneida Lake at its outlet into the Oneida River. The population was 4,029 at the 2010 census. 19th century maps indicate that this area was once known as Fort Brewerton, while Brewerton meant the Cicero portion."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%95%E0%B0%BE%E0%B0%AC%E0%B0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Kaba.jpg","page_title":"కాబా","context_page_description":"కాబా\\nసాహిత్యపరంగా కాబా అనగా ఘనాకారపు గృహం. అరబ్బీ భాషలో \\"కాబ్\\" లేదా \\"మకాబ్\\" అనగా ఘనాకారం.\\nకాబా ను ప్రథమంగా ఆదమ్ ప్రవక్త నిర్మించారు. తరువాత అది కాలగర్భంలో కలసిపోయింది. అల్లాహ్ ఆజ్ఞతో ఇబ్రాహీం ప్రవక్త తనకుమారుడు ఇస్మాయీల్తో కలసి దీనిని పునర్నిర్మించారు. కాని 'ఇబ్రాహీం' తొలిసారిగా 'కాబా' గృహాన్ని నిర్మించారని ప్రచారంలోవున్నది.\\n'కాబా' కు ఉన్న ఇతర పేర్లు:\\nబైతుల్ అతీఖ్ = అత్యంత ప్రాచీన, స్వతంత్రమైనది.\\n'బైతుల్ హరామ్ = అత్యంత గౌరవప్రథమయిన గృహం.\\nబూడిదనీలం రంగుగల రాళ్ళతో చతురస్రాకారంలో, మక్కా పర్వతాల మధ్య నిర్మితమైన కట్టడమే ఈ కాబా. నలువైపులా నాలుగు విశేషవస్తువులు గల గృహం. తూర్పువైపున హజ్ర్-ఎ-అస్వద్ ఉత్తరం వైపున రుక్న్-అల్-ఇరాఖీ, పశ్చిమాన రుక్న్-అల్-షామి, దక్షిణాన రుక్న్-అల్-యెమని గలవు. నాలుగు గోడలూ 'కిస్వాహ్ ' చే కప్పబడిఉన్నవి. కిస్వాహ్ సాధారణంగా నల్లని తెర, దీనిపై 'షహాద ' వ్రాయబడివుంటుంది. బంగారపు ఎంబ్రాయిడరీచే ఖురాన్ ఆయత్ లు వ్రాయబడివుంటాయి.\\nహజ్ యాత్రికులు10-12 తేదీలలో కాబా చుట్టూ ఏడు సార్లు ప్రదక్షిణాలు చేస్తారు.\\nహతీం = ఖాళీగా వదిలిన కాబా స్థలాన్ని కాబాలో కలిపేయాలని ముహమ్మద్ ప్రవక్త అనుకున్నారు. అబ్దుల్లా బిన్ జుబైర్ కాలంలో ఆ ఖాళీ స్థలం కలిపి కాబాను నిర్మించారు. కానీ ఆయన చనిపోయాక మళ్ళీ ఖాళీ స్థలం ఏర్పాటు చేశారు.ముహమ్మద్ ప్రవక్త కోరుకున్నట్లుగా ఈ స్థలాన్ని సౌదీ ప్రభుత్వం కాబాలో కలిపేయాలి."},{"page_url":"https://en.wikipedia.org/wiki/Greene_King","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Brewery_Museum_-_geograph.org.uk_-_289403.jpg","page_title":"Greene King","context_page_description":"Greene King is the UK's largest pub retailer and brewer. It is based in Bury St Edmunds, Suffolk, England. The company owns pubs, restaurants and hotels. It was listed on the London Stock Exchange until it was acquired by CK Assets in October 2019."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%97%BA%E8%A7%92%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Argyle_Centre_Phase1_shops1.jpg","page_title":"旺角中心","context_page_description":"旺角中心为香港集商场和写字楼的大厦，由香港铁路有限公司、恒隆集团及长江实业合作于1982年至1983年发展的项目，位于旺角亚皆老街65号及弥敦道688号，邻近港铁旺角站，楼高20层，建筑师为郭志舜建筑师有限公司，而该公司的总部亦设于旺角中心第二期19楼。\\n旺角中心原址前身为“邵氏大厦”，因配合兴建地铁之工程而被拆卸。1979年，恒隆与长实，投得地铁旺角站上盖物业发展权，兴建2幢22层高的商业大厦，并命名为旺角中心"},{"page_url":"https://en.wikipedia.org/wiki/Igor_Guberman","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Igor_Guberman.jpg","page_title":"Igor Guberman","context_page_description":"Igor Mironovich Guberman is a Russian writer and poet of Jewish ancestry; since 1988 lives in Israel. His poetry has received a great deal of acclaim primarily because of his signature aphoristic and satiric quatrains that he called \\"gariki\\" in Russian. These short poems always feature an a-b-a-b rhyme scheme, employ various poetic meters, and cover a wide range of subjects including antisemitism, immigrant life, anti-religious sentiment, and the author's love-hate relationship with Russia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86%D1%86%D0%BE_%D0%A1%D0%BA%D0%B8%D1%84%D0%B0%D0%BD%D0%BE%D0%B9%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Marzo%2C_francesco_del_cossa%2C_11.jpg","page_title":"Палаццо Скифанойя","context_page_description":"Палаццо Скифано́йя — художественный музей в Ферраре, в здании бывшего дворца семьи д’Эсте. Известен фресками зодиакального цикла, выполненными феррарскими мастерами XV века."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bremen-%C3%96stliche_Vorstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Wohnhaus_in_Bremen%2C_Mathildenstra%C3%9Fe_97.JPG","page_title":"Liste der Kulturdenkmäler in Bremen-Östliche Vorstadt","context_page_description":"In der Liste der Kulturdenkmäler in Östliche Vorstadt sind alle Kulturdenkmäler des Bremer Stadtteils Östliche Vorstadt aufgelistet.\\nGrundlage ist die vom Landesamt für Denkmalpflege Bremen veröffentlichte Landesdenkmalliste\\nmit dem Stand von 26. Juni 2020."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%BE%D0%B9_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%B0_%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BD%D0%B0.jpg","page_title":"Правительство Донецкой Народной Республики","context_page_description":"Сове́т мини́стров Доне́цкой Наро́дной Респу́блики — орган исполнительной власти непризнанной Донецкой Народной Республики."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Brielle_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Brielle%2C_brasserie-hotel_de_Nymph_in_een_monumentaal_pand_aan_de_Voorstraat_45_foto1_2011-06-26_13.54.JPG","page_title":"Lijst van rijksmonumenten in Brielle (plaats)","context_page_description":"De stad Brielle telt 366 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht."},{"page_url":"https://de.wikipedia.org/wiki/The_Imagined_Savior_Is_Far_Easier_to_Paint","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ambrose_Akinmusire_performing_with_his_quintet.jpg","page_title":"The Imagined Savior Is Far Easier to Paint","context_page_description":"The Imagined Savior Is Far Easier to Paint ist das dritte Studioalbum des Trompeters Ambrose Akinmusire. Die Aufnahmen entstanden 2013/14 in Brooklyn und Toronto. Das Album erschien am 10. März 2014 bei Blue Note Records. Akinmusire wurde für das Album 2015 mit dem ECHO Jazz als Instrumentalist/in des Jahres international ausgezeichnet. Zeitungen und Musikmagazine wie die Los Angeles Times, Allmusic Stereophile oder Pop Matters zählen es zu den besten Jazzalben des Jahres 2014.\\nIn der 2014 NPR Music Jazz Critics Poll, wo 140 Jazzkritiker ihre Jahresalben kürten, kam The Imagined Savior Is Far Easier To Paint auf Platz 3 von 700 Alben."},{"page_url":"https://hu.wikipedia.org/wiki/Cs%C3%BCr%C3%BClye","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Josephinische_Landaufnahme_pg095.jpg","page_title":"Csürülye","context_page_description":"Csürülye település Romániában, Kolozs megyében, az azonos nevű község központja.Kolozsvártól délre, a Hesdát-patak mellett található."},{"page_url":"https://la.wikipedia.org/wiki/Arthurus_Rackham","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Giants_and_Freia.jpg","page_title":"Arthurus Rackham","context_page_description":"Arthurus Rackham, alumnus scholae artium Lambethiensis fuit artifex qui libros picturis ornavit."},{"page_url":"https://eu.wikipedia.org/wiki/Anolis_carolinensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Male_Anolis_carolinensis.jpg","page_title":"Anolis carolinensis","context_page_description":"Anolis carolinensis Anolis generoko animalia da. Narrastien barruko Dactyloidae familian sailkatuta dago."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%83%D0%B1%D0%BE%D0%B2%D0%B5_(%D0%A2%D1%8F%D1%87%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Dubove_zkr_prapor.png","page_title":"Дубове (Тячівський район)","context_page_description":"Дубове́ — селище міського типу Тячівського району Закарпатська область. У 1995 році смт. Дубове отримало статус гірського населеного пункту."},{"page_url":"https://hu.wikipedia.org/wiki/Saint-Thib%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/St-Thibery_Mairie.JPG","page_title":"Saint-Thibéry","context_page_description":"Saint-Thibéry település Franciaországban, Hérault megyében. Saint-Thibéry Bessan, Florensac, Montblanc, Nézignan-l'Évêque, Pézenas és Valros községekkel határos."},{"page_url":"https://oc.wikipedia.org/wiki/Neon_(Cruesa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/041_N%C3%A9oux_%28_23200_%29.JPG","page_title":"Neon (Cruesa)","context_page_description":"Neon es una comuna occitana de Marcha, en Lemosin, situada dins lo departament de Cruesa e la region de Novela Aquitània, ancianament de Lemosin."},{"page_url":"https://es.wikipedia.org/wiki/Tequixquiac","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Cocina_tequixquense_%28M%C3%A9xico%29.JPG","page_title":"Tequixquiac","context_page_description":"Tequixquiac es uno de los 125 municipios del Estado de México y uno de los 7 municipios que integran la Región Zumpango, se ubica al noreste de la ciudad de Toluca de Lerdo, capital del estado y al norte de la Ciudad de México, capital del país, en dirección hacia el norte del estado de México, siendo un lugar de transición entre el Valle de México y el Valle del Mezquital, su cabecera municipal es el pueblo de Tequixquiac o Santiago Tequixquiac. El municipio de Tequixquiac limita al norte con el municipio de Apaxco, al sur con el municipio de Zumpango, al suroeste con el municipio de Huehuetoca, al este con el municipio de Hueypoxtla y al oeste con el municipio de Atotonilco de Tula, esté último dentro del estado de Hidalgo."},{"page_url":"https://eo.wikipedia.org/wiki/Albert_Goodheir","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/1978-07-24_Albert_Goodheir.jpeg","page_title":"Albert Goodheir","context_page_description":"Albert GOODHEIR estis Nederlandano, loĝinta en Britio, doktoro pri filozofio, medicinisto, Esperanta poeto, tradukisto, redaktoro, eldonisto, instruanto, preleganto, membro kaj sekretario de la Akademio de Esperanto, verkinto de poeziaj kaj filozofiaj libroj.\\nLaŭ liaj propraj vortoj, lia vivo \\"estis iom nekonvencia kaj ne mankis en ĝi varieco.\\" Li estis \\"interalie instruisto de historio kaj lingvoj, pastro de la Skota Eklezio, farmlaboristo en Skotlando kaj Kostariko, fiŝlaboristo sur la Ŝetlandoj kaj helpflegisto en mensmalsanejo\\".\\nLi doktoriĝis en Utrecht en 1938, poste studis teologion en Glasgovo kaj filozofion en Londono. Dum multaj jaroj li servis kiel pastro en la gaela parto de Skotlando; poste li fariĝis kvakero.\\nEsperantisto ekde 1967, li verkis siajn unuajn poemojn en 1970. Li estis baldaŭ kronita de laŭroj, i.a. en la Belartaj Konkursoj de UEA, kaj fariĝis \\"aŭtoro de la jaro 1975\\" ĉe La Patrolo. Sekvis tamen nur tri poemaroj: Merlo sur Menhiro, Enlumiĝo kaj Nordmara duopo, sed kun dense riĉa enhavo.\\nLi verkis monografieton pri la filozofio de Spinozo, Fondita sur Roko, kaj plurajn broŝurojn pri kulturaj, religiaj kaj lingvaj temoj. Li tradukis fekunde kaj bone,"},{"page_url":"https://ca.wikipedia.org/wiki/Il%C2%B7lusi%C3%B3_de_Jastrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Jastrow-illusion-track.jpg","page_title":"Il·lusió de Jastrow","context_page_description":"La Il·lusió de Jastrow és una il·lusió òptica descrita pel psicòleg estatunidenc Joseph Jastrow el 1892.\\nA la imatge de sota, les dues figures són idèntiques, a despit que la inferior sembla més llarga. Això passa perquè la banda curta de la figura superior és comparada amb la banda llarga de la figura inferior.\\nAquesta il·lusió sovint es fa servir en trucs de màgia, i n'hi ha diferents versions que es venen en botigues de màgia."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E5%86%85%E6%98%82%E9%B2%81%E8%A5%BF%E6%B0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Canet_1.jpg","page_title":"卡内昂鲁西永","context_page_description":"卡内昂鲁西永，或意译作鲁西永地区卡内，是法国东比利尼斯省的一个市镇，位于该省东部略偏北，靠近地中海，属于佩皮尼昂区。该市镇总面积22.39平方公里，2009年时的人口为13052人。历史上曾为加泰罗尼亚一部分。"},{"page_url":"https://ru.wikipedia.org/wiki/Scritti_Politti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Scritti_Politti.jpg","page_title":"Scritti Politti","context_page_description":"Scritti Politti — группа из Великобритании, образованная в 1977 году в Лидсе уроженцем Кардиффа певцом-композитором Грином Гартсайдом, который является единственным постоянным участником группы."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D8%AC%D8%AF_%D8%B9%D9%83%D8%A7%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Akkash_Mosque%2C_Old_Jeddah_2.jpg","page_title":"مسجد عكاش","context_page_description":"مسجد عكاش أحد مساجد جدة التاريخية في المملكة العربية السعودية، يقع المسجد داخل شارع قابل غربا، أقيم المسجد قبل عام 1200 هـ، وقام بتحديد بنائه عكاش أباظة، وتم رفع أرضية المسجد عن مستوى الشارع بحيث يصعد إليه بعد درجات وهو في حالة جيدة وتقام به صلوات حتى اليوم."},{"page_url":"https://zh.wikipedia.org/zh-tw/NGC_4605","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/The_scale_of_the_Universe.jpg","page_title":"NGC 4605","context_page_description":"NGC 4605是位於星座大熊座方向上的一個螺旋星系。"},{"page_url":"https://eo.wikipedia.org/wiki/Groscavallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Groscavallo_municipio.jpg","page_title":"Groscavallo","context_page_description":"Groscavallo estas komunumo de Italio, ĉe la limo al Francio. Ĝi apartenas al la regiono Piemonto kaj al la provinco Torino, kiu ekde la 1-a de januaro 2015 havas la nomon metropola urbo Torino. Fine de 2019 en la komunumo vivis 199 loĝantoj. Najbaraj komunumoj estas Ala di Stura, Balme, Bonneval-sur-Arc, Ceres, Ceresole Reale, Chialamberto kaj Noasca."},{"page_url":"https://en.wikipedia.org/wiki/Henri_Le_Sidaner","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Rue_Henri_Le_Sidaner_-_Gerberoy_4.JPG","page_title":"Henri Le Sidaner","context_page_description":"Henri Eugène Augustin Le Sidaner who was a contemporary of the Post-impressionists, was an intimist painter known for his paintings of domestic interiors and quiet street scenes. His style contained elements of impressionism with the influences of Édouard Manet, Monet and of the Pointillists discernible in his work. Le Sidaner favoured a subdued use of colour, preferring nuanced greys and opals applied with uneven, dappled brushstrokes to create atmosphere and mysticism. A skilled nocturne painter he travelled widely throughout France and Europe before settling at Gerberoy in the Picardy countryside from where he painted for over thirty years.\\nLe Sidaner's paintings and pastels were widely collected throughout his career. His seductive views of the gardens he created in the ruins of the medieval fortress at Gerberoy, with their recently vacated tables dappled in sunlight and overhung by roses, have cemented his reputation as a unique artist who does not fit easily into an art movement."},{"page_url":"https://sv.wikipedia.org/wiki/Jacob_Coxey","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Jacob_S._Coxey%2C_Sr._%28The_Coxey_Plan%29.png","page_title":"Jacob Coxey","context_page_description":"Jacob Coxey, född 16 april 1854 i Selinsgrove i Pennsylvania, död 18 maj 1951, var en vänsterinriktad amerikansk politiker från Massillon, Ohio. Coxey var djupt engagerad i penningreformrörelsen och döpte sin son till Legal Tender. 1894 och 1914 tågade han med besvikna arbetslösa i protestmarcher, från hemstaden Massilon till Washington D.C. Coxey menade att regeringen borde trycka pengar, så kallade greenbacks, och med dessa finansiera offentliga projekt. Coxey gjordes till åtlöje i pressen och av Kongressen, men idéerna inspirerade Franklin D. Roosevelts New Deal."},{"page_url":"https://nl.wikipedia.org/wiki/1987","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Amsterdam_Zuidoost_Ton_Alberts_02_PM07.jpg","page_title":"1987","context_page_description":"Het jaar 1987 is een jaartal volgens de christelijke jaartelling."},{"page_url":"https://en.wikipedia.org/wiki/USS_Newport_News_(CA-148)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/USS_Newport_News_%28CA_148%29%2C_USS_Springfield_%28CLG_7%29_and_USS_Northampton_%28CC_1%29_await_disposal.jpg","page_title":"USS Newport News (CA-148)","context_page_description":"The second USS Newport News was a Des Moines-class heavy cruiser in the United States Navy. Newport News was laid down 1 November 1945; launched on 6 March 1948 by Newport News Shipbuilding and Dry Dock Company, Newport News, Virginia. The vessel was sponsored by Mrs. Homer L. Ferguson upon commissioning on 29 January 1949, Captain Floyd Smoot commanding.\\nShe was the first fully air-conditioned surface ship in the United States Navy, and the last of her age, as well as the last all-gun heavy cruiser in commission in US naval history."},{"page_url":"https://en.wikipedia.org/wiki/Kilmacolm","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Birkmyre_Park.JPG","page_title":"Kilmacolm","context_page_description":"Kilmacolm is a village and civil parish in the Inverclyde council area, and the historic county of Renfrewshire in the west central Lowlands of Scotland. It lies on the northern slope of the Gryffe Valley, 7 ¹⁄₂ miles south-east of Greenock and around 15 miles west of the city of Glasgow. The village has a population of around 4,000 and is part of a wider civil parish which covers a large rural hinterland of 15,000 hectares containing within it the smaller settlement of Quarrier's Village, originally established as a 19th-century residential orphans' home.\\nThe area surrounding the village was settled in prehistoric times and emerged as part of a feudal society with the parish divided between separate estates for much of its history. The village itself remained small, providing services to nearby farm communities and acting as a religious hub for the parish. The name of the village derives from the Scottish Gaelic Cill MoCholuim, indicating the dedication of its church to St Columba. The parish church was mentioned in a papal bull of 1225 showing its subservience to Paisley Abbey, and it sits on the site of an ancient religious community dating to the 5th or 6th centuries."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BE_%E0%AE%B0%E0%AE%BE%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Lahore_Museum%2C_Lahore.jpg","page_title":"கங்கா ராம்","context_page_description":"ராவ் பகதூர் சர் கங்கா ராம் இவர் ஓர் இந்திய குடிசார் பொறியியலாளரும், கட்டிடக் கலைஞரும் ஆவார். நவீன பாக்கித்தானில் இலாகூரின் நகர்ப்புற வளர்சிக்கு இவர் செய்த விரிவான பங்களிப்புகள், கலீத் அகமது இவரை \\"நவீன இலாகூரின் தந்தை\\" என்று வர்ணிக்க காரணமாக அமைந்தது."},{"page_url":"https://fr.wikipedia.org/wiki/Bernardino_Grimaldi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/FedericoII.jpg","page_title":"Bernardino Grimaldi","context_page_description":"Bernardino Grimaldi ou Bernardino Francesco Faustino Giovita Grimaldi, né le 15 février 1839 à Catanzaro et mort le 16 mars 1897 à Rome, est un homme politique italien. Il a été élu 7 fois député au Parlement italien, et a également été Ministre de l'Agriculture, de l'Industrie et du Commerce, ainsi que Ministre du Trésor et Ministre des Finances du Royaume d'Italie."},{"page_url":"https://en.wikipedia.org/wiki/Women_in_labor_unions","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Clara_Lemlich_1910.jpg","page_title":"Women in labor unions","context_page_description":"Women in labor unions have participated in labor organizing and activity throughout United States history. These workers have organized to address issues within the workplace, such as promoting gender equality, better working conditions, and higher wages. Women have participated in unions including the Collar Laundry Union, the WTUL, the IWW, the ILGWU, and the UAW."},{"page_url":"https://no.wikipedia.org/wiki/Erding","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/109_0994.JPG","page_title":"Erding","context_page_description":"Erding er en gammel hertug-by i Regierungsbezirk Oberbayern i den tyske delstaten Bayern, og forvaltningssentrum for landkretsen av samme navn."},{"page_url":"https://pl.wikipedia.org/wiki/Maisons_(Eure-et-Loir)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Maisons-FR-28-mairie-22.jpg","page_title":"Maisons (Eure-et-Loir)","context_page_description":"Maisons – miejscowość i gmina we Francji, w Regionie Centralnym, w departamencie Eure-et-Loir.\\nWedług danych na rok 1990 gminę zamieszkiwało 227 osób, a gęstość zaludnienia wynosiła 24 osoby/km²."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%B5%D1%82%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/ISH_WC_GoettingenUni1.jpg","page_title":"Гетинген","context_page_description":"Гетинген — универзитетски град во сојузната покраина Долна Саксонија, Германија. Претставува административено седиште на округот Гетинген. Реката Лајне тече низ градот.\\nСо учество од околу 20%, студентите од Гетингенскиот универзитет силно влијаат на градскиот живот. Универзитетот е најстар и најголем во Долна Саксонија, но постојат и уште две високи школи.\\nВо 953 година бил првпат споменат како Гутинги, како село на реката Лајне, кое во 1230 година ги добило градските права. Во 1964 година, Гетинген станал голем град и денес е еден од деветте големи центри на Долна Саксонија. Денес, градот е окружен и најголем град на округот Гетинген, но до 1964 година претставувал слободен град, но со посебен закон бил припоен кон истоимениот округ.\\nГетинген се наоѓа во јужниот дел на европската метрополитенска област Хановер-Брауншвајг-Гетинген-Волфсбург."},{"page_url":"https://sv.wikipedia.org/wiki/Lavskrika","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Perisoreus_infaustus1.jpg","page_title":"Lavskrika","context_page_description":"Lavskrika är en kråkfågel som förekommer i lavklädd barrskog från Norge till östra Sibirien, och är en utpräglad stannfågel inom sitt utbredningsområde. Den är en liten kråkfågel, den minsta i västra palearktis, som känns igen på sin gråbruna yviga fjäderdräkt och på sin klart roströda färg på vingteckningarna, stjärten, och övergumpen. Lavskrikan är känd för att vara mycket orädd och söker sig ofta till människor i skogen för födosök. Den har också spelat en viktig roll i folklore. Lavskrikan är Norrbottens landskapsdjur."},{"page_url":"https://en.wikipedia.org/wiki/Alfred_Parsons_(artist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Picture_of_Alfred_Parsons.jpg","page_title":"Alfred Parsons (artist)","context_page_description":"Alfred William Parsons RA was an English artist: illustrator, landscape painter and garden designer.\\nAlfred Parsons was well known for his English landscape paintings and fine botanical illustrations which brought him into contact with William Robinson, for whom he provided illustrations. He regularly exhibited his art work from 1868 to 1919. He also artistically designed significant gardens mostly in England and some in Scotland and the United States. Parsons and his contemporaries believed that an artist could design better gardens. He won the Chantrey Bequest in 1887 and the published his book Notes From Japan in 1896. Parsons became President of the Society of Painters in Watercolours in 1905, and among many other works, he illustrated Ellen Willmott's The Genus Rosa. He was a keen gardener and for the last six years of his life took care of his roses at Luggershill, Broadway, Worcestershire, England."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A1rizsi_iskola","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Stamp_of_Moldova_224.gif","page_title":"Párizsi iskola","context_page_description":"A párizsi iskola a 20. században Párizsban alkotó, de nem francia származású képzőművészek elnevezése, akik közül sokan kifejezetten nem csatlakoztak egyik avantgárd képzőművészeti irányzathoz sem, bár művészetüket sokban befolyásolta."},{"page_url":"https://en.wikipedia.org/wiki/Pote%C4%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Flag_of_Pote%C4%8D.png","page_title":"Poteč","context_page_description":"Poteč is a village and municipality in Zlín District in the Zlín Region of the Czech Republic.\\nThe municipality covers an area of 10.55 square kilometres, and has a population of 756.\\nPoteč lies approximately 29 kilometres east of Zlín and 282 km east of Prague."},{"page_url":"https://en.wikipedia.org/wiki/Eagle_ray","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Manta_ray_parking_bay_%40_Ocean%C3%A1rio_de_Lisboa.jpg","page_title":"Eagle ray","context_page_description":"The eagle rays are a group of cartilaginous fishes in the family Myliobatidae, consisting mostly of large species living in the open ocean rather than on the sea bottom.\\nEagle rays feed on mollusks and crustaceans, crushing their shells with their flattened teeth.They are excellent swimmers and are able to breach the water up to several metres above the surface. Compared with other rays, they have long tails, and well-defined, rhomboidal bodies. They are ovoviviparous, giving birth to up to six young at a time. They range from 0.48 to 5.1 m in length and 7 m in wingspan."},{"page_url":"https://fr.wikipedia.org/wiki/Percoidei","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Trevally_Nick_Hobgood.jpg","page_title":"Percoidei","context_page_description":"Le sous-ordre des Percoidei regroupe 80 familles de poissons de l'ordre des Perciformes. On y trouve des espèces tant marines que d'eau douce.\\nCe vaste sous-ordre est peut-être paraphylétique, mais demeure cependant utilisé par les ichtyologues car il propose une sous-catégorisation utile à l'ordre désespérément vaste des Perciformes."},{"page_url":"https://tr.wikipedia.org/wiki/Houston_Chronicle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Houston_Chronicle_frontpage.jpg","page_title":"Houston Chronicle","context_page_description":"The Houston Chronicle, Houston, Teksas merkezli, ABD'de yayımlanan broadsheet formatında günlük gazete.\\nThe Houston Chronicle, 1901 yılında Houston Post'un eski muhabiri Marcellus E. Foster tarafından kuruldu. 14 Ekim 1901 tarihinde ilk sayısı yayınlandı. İlk ayında 4.378 tiraja ulaştı. 1908'de Houston Endowment Inc. fonunun sahibi yerel iş adamı ve politikacı Jesse H. Jones, Foster'a yeni bir gazete binası yapma vaadine karşılık ortaklık teklif etti. Foster'ın bunu kabul etmesiyle Chronicle Binası yapıldı. Foster yönetiminde gazetenin tirajı 1901'deki 7,000'den, 1926'da 75,000 ve 85,000'e yükseldi. Foster, 1920'lerde Ku Klux Klan örgütü aleyhine yazılarla dikkat çekti ve 26 Haziran 1926 tarihinde gazetenin geri kalan payını da Jesse H. Jones'a satarak emekli oldu. Jesse H. Jones öldüğü 1956 yılına kadar gazeteyi yönettti. 1956'dan 1965'e kadar Jesse H. Jones'un yeğeni John T. Jones yönetimi aldı. 1961'de Jones yönetimi gazeteci William P. Steven ile paylaştı. 1965'te ise her ikisi de Chronicle'dan ayrıldı. 1965'ten 1987'ye kadar Houston Endowment Inc. Başkanı J. Howard Creekmore gazeteyi yönetti."},{"page_url":"https://de.wikipedia.org/wiki/Kollegiatkirche_(Zamo%C5%9B%C4%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Katededra_w_Zamo%C5%9Bciu_-_widok_od_po%C5%82udniowego_wschodu.jpg","page_title":"Kollegiatkirche (Zamość)","context_page_description":"Die Kollegiatkirche Zamość ist ein denkmalgeschütztes Kirchengebäude im Ortszentrum von Zamość, einer etwa 65.000 Einwohner zählenden Stadt in der Woiwodschaft Lublin im südöstlichen Teil Polens. Das Bauwerk, das nach Entwürfen Bernardo Morandos von 1587 bis 1630 erbaut wurde, gehört zu Polens schönsten Kirchen aus der Zeit des Manierismus. Sie ist die Kathedralkirche des seit 1992 bestehenden Bistums Zamość-Lubaczów."},{"page_url":"https://sl.wikipedia.org/wiki/Partsko_cesarstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Rome-Seleucia-Parthia_200bc.jpg","page_title":"Partsko cesarstvo","context_page_description":"Partsko cesarstvo, znano tudi kot Arsakidsko cesarstvo, je bilo antična iranska država, katere vladarji so se imeli za naslednike starega ahemenidskega Perzijskega cesarstva.\\nCesarstvo je leta 247 pr. n. št. ustanovil Arsak I. Partski, poglavar iranskega plemena Parni, po osvojitvi takratne selevkidske satrapije Partije na območju sedanjega severovzhodnega Irana. Cesarstvo je zelo razširil Mitridat I. Partski, ki je osvojil Medijo in Mezopotamijo, v katerih so vladali Selevkidi. Partsko cesarstvo je na višku svoje moči obsegalo ozemlje od Evfrata na zahodu do vzhodnega Irana. Ležalo je ob svilni cesti med rimskim cesarstvom in Sredozemljem na zahodu in kitajskim cesarstvom Han na vzhodu in je hitro postalo pomembno trgovsko središče.\\nParti so v veliki meri sprejeli umetnost, arhitekturo, versko prepričanje in vladarske insignije svojega kulturno raznolikega cesarstva, v katerem so se regionalne kulture prepletale s perzijsko in grško kulturo. Arsakidi so v prvi polovici svoje vladavine privzeli elemente grške kulture, potem pa so začeli postopoma oživljati staro iransko izročilo."},{"page_url":"https://de.wikipedia.org/wiki/Listspinne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pisaura_mirabilis_fem_Hahn_1834.jpg","page_title":"Listspinne","context_page_description":"Die Listspinne, auch Raubspinne oder Brautgeschenkspinne genannt, gehört zur Familie der Jagdspinnen und zur Überfamilie der Lycosoidea. Die Listspinne ist in ganz Europa verbreitet. Sie wurde 2002 von der Arachnologischen Gesellschaft e.V. zur Spinne des Jahres gewählt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D1%83%D0%BD%D1%88%D0%B2%D0%B5%D0%B9%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Braunschweig_Brunswick_Ebstorfer_Karte_%281300%29.jpg","page_title":"Брауншвейгский лев","context_page_description":"Брауншвейгский лев — историко-художественный памятник Германии, относящийся к XII столетию, и исторический символ города Брауншвейг."},{"page_url":"https://de.wikipedia.org/wiki/Biccari_(Apulien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Biccari-Borgo.jpg","page_title":"Biccari (Apulien)","context_page_description":"Biccari ist eine süditalienische Gemeinde mit 2720 Einwohnern in der Provinz Foggia in der Region Apulien. Schutzpatron der Gemeinde ist Donatus von Arezzo."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AE%D9%84%DB%8C%D8%AC_%D8%B3%DB%8C%D9%86%D9%B9_%D9%88%D9%86%D8%B3%DB%8C%D9%86%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Australia.A2010283.0435.250m.jpg","page_title":"خلیج سینٹ ونسینٹ","context_page_description":"خلیج سینٹ ونسینٹ آسٹریلیا کے جنوبی کنارے پر ایک بڑا جسم آب ہے۔"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9D%9E%E6%B4%B2%E5%BE%A9%E8%88%88%E7%B4%80%E5%BF%B5%E7%A2%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Dakar-Logements_nord-cor%C3%A9ens.jpg","page_title":"非洲復興紀念碑","context_page_description":"非洲復興紀念碑是一尊位於非洲國家塞內加爾的首都達喀爾的49米高之青銅雕像。置身其中能俯瞰大西洋。\\n該紀念碑最先由塞內加爾總統阿卜杜拉耶·瓦德提出構想，塞內加爾建築師皮埃爾·古迪亞比設計，朝鮮萬壽臺海外開發會社負責建造。在2006年開始100米高山的平整工程，2008年4月3日開始建造雕像。原定在2009年12月竣工，拖延至2010年初，終於在2010年4月4日，塞內加爾國慶日當天落成，以紀念脫離法國獨立50週年。"},{"page_url":"https://es.wikipedia.org/wiki/Winnipeg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Coat_of_arms_of_Winnipeg.svg","page_title":"Winnipeg","context_page_description":"Winnipeg [ˈwɪnɪpɛɡ] es la capital y la ciudad más poblada de la provincia canadiense de Manitoba, localizada en las praderas del Oeste de Canadá.​​ Es, además, la séptima ciudad más grande de Canadá, la más importante del centro del país y la ciudad principal de su área metropolitana, la Región de Winnipeg Capital.\\nAlrededor de la mitad de la población total de Manitoba reside en la Región de Winnipeg Capital, cuya población es de 730 305 habitantes. La ciudad de Winnipeg cuenta con una población total de 663 617 habitantes.​ La ciudad se encuentra en la confluencia de los ríos Rojo y Assiniboine. Caracterizada por un clima riguroso es considerada como una de las grandes ciudades más frías del mundo.\\nWinnipeg posee edificaciones históricas y numerosos parques, como el Assiniboine Park o el Birds Hill Provincial Park. Por su situación, está también muy próxima a los ríos del Escudo Canadiense y numerosos lagos, entre los que se encuentran el lago de los Bosques, el lago Winnipeg y el lago Manitoba.​"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1840","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/%C3%89glise_d%27Isomes01.jpg","page_title":"Liste des monuments historiques protégés en 1840","context_page_description":"Cet article recense les monuments historiques de France classés en 1840, la première protection de ce type dans le pays."},{"page_url":"https://pt.wikipedia.org/wiki/Bad_Kleinen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Wappen_Bad_Kleinen.png","page_title":"Bad Kleinen","context_page_description":"Bad Kleinen é um município da Alemanha localizado no distrito de Nordwestmecklenburg, estado de Mecklemburgo-Pomerânia Ocidental. Pertence ao Amt de Dorf Mecklenburg-Bad Kleinen.\\nSituada no lado norte do Lago Schwerin, o quarto maior da Alemanha, e a meio caminho entre as cidades de Schwerin e Wismar, é uma pequena cidade com uma população de 3 662 habitantes numa área de 23,43 km²."},{"page_url":"https://pt.wikipedia.org/wiki/Damon_Albarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Roskilde_Festival_Gorillaz-4_%28cropped%29.jpg","page_title":"Damon Albarn","context_page_description":"Damon Albarn é um cantor, instrumentista e compositor britânico, mais conhecido por ser vocalista das bandas Blur e Gorillaz.\\nNa juventude participou das bandas Circus, Real Lives e The Aftermath. Nos anos 90 ganhou notoriedade como líder e vocalista do Blur, uma das mais importantes e emblemáticas bandas inglesas do chamado Britpop. Formado por Graham Coxon, Alex James, Dave Rowntree e Damon Albarn, o Blur lançou oito álbuns, além de inúmeros hits no topo das paradas de sucesso, entre eles \\"There's No Other Way\\", \\"Girls And Boys\\", \\"Song 2\\" e \\"Coffee And TV\\".\\nDamon esteve se dedicando desde 2003 a outros projetos de sucesso comercial e/ou de crítica. O primeiro deles foi o Gorillaz, banda virtual criada em parceria com o cartunista Jamie Hewlett onde os músicos são desenhos animados. O Gorillaz já lançou, desde 2001, seis álbuns de estúdio e contou com a participação de diversos artistas como Miho Hatori, De La Soul, Neneh Cherry, Shaun Ryder, Lou Reed e Snoop Dogg, entre outros.\\nEm 2002, Damon lançou Mali Music, álbum gravado durante uma viagem que fez em apoio a ONG Oxfam, em 2000."},{"page_url":"https://en.wikipedia.org/wiki/Pelham_(village),_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Westchester_County_New_York_incorporated_and_unincorporated_areas_Pelham_%28village%29_highlighted.svg","page_title":"Pelham (village), New York","context_page_description":"The village of Pelham is a village in Westchester County, New York, United States. The population was 6,910 at the 2010 census. It is located in the town of Pelham, which is colloquially referred to as Pelham."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D9%86%D8%AF%D8%A7%DA%A9%DB%8C%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Mandakini01.jpg","page_title":"مانداکینی","context_page_description":"مانداکینی یک هنرپیشه اهل هند است. وی بین سال‌های ۱۹۸۵ تا ۱۹۹۹ میلادی فعالیت می‌کرد.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته است می‌توان به اسید اشاره کرد."},{"page_url":"https://es.wikipedia.org/wiki/Flora_Franciscana","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/GreeneEL10.jpg","page_title":"Flora Franciscana","context_page_description":"Flora Franciscana, ​ es un libro con ilustraciones y descripciones botánicas que fue editado por el botánico, micólogo y pteridólogo estadounidense, Edward Lee Greene. Fue publicado en 4 partes en los años 1891-1897, con el nombre de Flora Franciscana: an attempt to classify and describe the vascular plants of middle California. San Francisco."},{"page_url":"https://pt.wikipedia.org/wiki/Copacabana_(filme_de_1947)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Andy_Russell_and_Carmen_Miranda_in_%22Copacabana%2C%22_1947.jpg","page_title":"Copacabana (filme de 1947)","context_page_description":"Copacabana é um filme de comédia musical dirigido por Alfred E. Green e estrelado por Groucho Marx e Carmen Miranda. A cantora teria refilmado cenas em que estava de cabelos loiros e outras cenas, escuros, para distribuição na América do Sul."},{"page_url":"https://nl.wikipedia.org/wiki/Bevrijdingsdag","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Johannes_Blaskowitz_surrenders_in_Holland.jpg","page_title":"Bevrijdingsdag","context_page_description":"Bevrijdingsdag is de Nederlandse nationale feestdag op 5 mei waarop jaarlijks de bevrijding van de Duitse bezetting in Nederland in 1945 wordt gevierd. Nederland staat op 5 mei ook stil bij de grote waarde van vrijheid, democratie en mensenrechten. In 2020 zou de viering in het teken van ’75 jaar Vrijheid’ staan, maar deze werd afgelast vanwege de coronapandemie."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%BC%E7%A7%91%E6%8B%89%E8%80%B6%E5%A4%AB%E6%96%AF%E5%9F%BA%E5%8D%80_(%E7%83%8F%E9%87%8C%E6%8F%9A%E8%AB%BE%E5%A4%AB%E6%96%AF%E5%85%8B%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Nikolaevka_ulianovskaya_oblast.jpg","page_title":"尼科拉耶夫斯基區 (烏里揚諾夫斯克州)","context_page_description":"尼科拉耶夫斯基区，是俄罗斯的一个区，位于该国西南部，由乌里扬诺夫斯克州负责管辖，面积2,084.27平方公里，2010年人口27,211，人口密度每平方公里13.06人。"},{"page_url":"https://de.wikipedia.org/wiki/Natalie_Cook","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Womens_beach_volleyball.jpg","page_title":"Natalie Cook","context_page_description":"Natalie Louise Cook ist eine professionelle Beachvolleyball-Spielerin. Sie wurde 2000 mit Partnerin Kerri Pottharst Olympiasiegerin und ist Mitglied des Order of Australia."},{"page_url":"https://de.wikipedia.org/wiki/Gruppe_GT1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Davidoff_McLaren_F1_GTR.jpg","page_title":"Gruppe GT1","context_page_description":"Als Gruppe GT1 wurden unterschiedliche Gran Turismo-Klassen im Motorsport in der Vergangenheit bezeichnet. Zwischen 1994 und 1998 wurde die Bezeichnung GT1 erstmals für die damals höchste GT Kategorie gewählt. Zeitgleich wurde zudem die GT2 Klasse erstmals ausgeschrieben, die zwischen 2005 und 2011 bei FIA und ACO ebenfalls die Bezeichnung GT1 trug."},{"page_url":"https://es.wikipedia.org/wiki/Galicia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Galicia_Crecimiento-98-08.png","page_title":"Galicia","context_page_description":"Galicia es una comunidad autónoma española, considerada nacionalidad histórica según su Estatuto de Autonomía, ​ situada en el noroeste de la península ibérica. Está formada por las provincias de La Coruña, Lugo, Orense y Pontevedra, que se componen de trescientos trece municipios​ agrupados en cincuenta y tres comarcas. La capital es la ciudad de Santiago de Compostela, mientras que Vigo es el municipio más poblado.\\nGeográficamente, está bañada al oeste por el océano Atlántico y al norte por el mar Cantábrico. Limita al sur con Portugal y al este con Asturias y Castilla y León. Además del territorio continental, incluye los archipiélagos de las islas Cíes, el de Ons y el de Sálvora, las islas de Cortegada, Arosa, las Sisargas, las Malveiras y otras más pequeñas.\\nGalicia posee 2 701 743 habitantes ​, con una distribución demográfica que aglomera la mayor parte de la población en las franjas costeras comprendidas entre Ferrol y La Coruña en el noroeste y entre Villagarcía de Arosa, Pontevedra y Vigo en el suroeste."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%B2%E0%AF%81%E0%AE%B5%E0%AE%B3%E0%AE%B5%E0%AF%81_%E0%AE%93%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AF%81_%E0%AE%87%E0%AE%B2%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%B0%E0%AE%A9%E0%AF%8D_%E0%AE%9A%E0%AF%8B%E0%AE%9F%E0%AE%BF%E0%AE%95%E0%AE%B3%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%A4%E0%AE%B3%E0%AF%8D%E0%AE%B3%E0%AF%81%E0%AE%95%E0%AF%88%E0%AE%95%E0%AF%8D_%E0%AE%95%E0%AF%8A%E0%AE%B3%E0%AF%8D%E0%AE%95%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Pentagonal-planar-3D-balls.png","page_title":"வலுவளவு ஓட்டு இலத்திரன் சோடிகளின் தள்ளுகைக் கொள்கை","context_page_description":"வலுவளவு ஓட்டு இலத்திரன் சோடிகளின் தள்ளுகைக் கொள்கை என்பது இரசாயனவியலில் மூலக்கூறுகளின் வடிவத்தை- மூலக்கூறுகளில் அணுக்கள் இருக்கும் இடங்களை விபரிக்கப் பயன்படுத்தப்படும் ஒரு கொள்கை ஆகும். மூலக்கூறின் மத்திய அணுவைச் சூழவுள்ள இலத்திரன் சோடிகளின் எண்ணிக்கையைக் கொண்டு அம்மூலக்கூற்றின் வடிவம் இக்கொள்கையைப் பயன்படுத்தித் துணியப்படுகின்றது. இலத்திரன்கள் மறையேற்றமுள்ள துணிக்கைகளாகும். ஒரு இலத்திரன் ஒழுக்கில் ஆகக்கூடியதாக இரு இலத்திரன்கள் காணப்படலாம். இவ்விலத்திரன் ஒழுக்குகள் நிலைமின்னியல் தள்ளுகை விசை காரணமாக ஒன்றிலொன்று விலகிச் செல்லப் பார்க்கும். இவ்வாறு இவ்வொழுக்குகள் இயன்றளவுக்கு ஒன்றிலிருந்தொன்று அதிக தூரத்தில் இருக்கும் என இக்கொள்கை விபரிக்கின்றது. இவ்வாறு இடத்தை மாற்றிக்கொள்வதன் மூலம் மைய அணுவைச் சூழவுள்ள இலத்திரன் ஒழுக்குகள் நிலைமின்னியல் தள்ளுகை விசையைக் குறைத்து மூலக்கூற்றின் உறுதித்தன்மையை அதிகரிக்கின்றன.\\nஅனேகமான மூலக்கூறுகளின் கட்டமைப்பை விளக்குவதில் VSEPR கொள்கையைப் பயன்படுத்த முடிவதுடன், மிகத்துல்லியமான விடையும் கிடைக்கப்பெறும். எனினும் சில மூலக்கூறுகள் VSEPR கொள்கை மூலம் ஊகிக்கப்படும் வடிவத்திலிருந்து முற்றிலும் வேறுபடுகின்றன. எனவே இது கொள்கையாகவே இருப்பதுடன் விதியாக அங்கீகரிக்கப்படவில்லை."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Indian_Premier_League_records_and_statistics","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Lasinga_Malinga_MI.jpg","page_title":"List of Indian Premier League records and statistics","context_page_description":"The Indian Premier League is a Twenty20 competition in men's cricket. Organised by the Board of Control for Cricket in India, the tournament has taken place every year since it was first held in 2008. Several teams went in and out of the tournament at different years, while the names of some teams were changed. The tournament format has always been a round-robin format, where each team plays with each other team twice, each match in either of the team's homeground.\\nIndian batsman Virat Kohli holds the record for the most runs made in the IPL, since its beginning in 2008. Chris Gayle dominates the spot for scoring the highest-individual score in a match with 175 runs off 66 balls and 128 off 62 balls, the highest amount of overall 6's in the league and also the highest number of 6's in a match, fastest century, fastest fifty, highest amount of runs in a series as well as the most 100's and the highest Man of the Match awards. Lasith Malinga took the highest number of wickets, and the highest number of 4-wicket hauls while also holding the records for being one among the players with the most dot balls bowled and the most maiden overs."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B4%D0%BE%D1%81%D1%82%D0%BD%D0%BE%D0%B5_(%D0%9A%D1%80%D1%8B%D0%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/000_Radostnoe.JPG","page_title":"Радостное (Крым)","context_page_description":"Ра́достное — село в Белогорском районе Республики Крым, входит в состав Земляничненского сельского поселения."},{"page_url":"https://en.wikipedia.org/wiki/E-book","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Michael_Hart_and_Gregory_Newby_at_HOPE_Conference.jpg","page_title":"E-book","context_page_description":"An electronic book, also known as an e-book or eBook, is a book publication made available in digital form, consisting of text, images, or both, readable on the flat-panel display of computers or other electronic devices. Although sometimes defined as \\"an electronic version of a printed book\\", some e-books exist without a printed equivalent. E-books can be read on dedicated e-reader devices, but also on any computer device that features a controllable viewing screen, including desktop computers, laptops, tablets and smartphones.\\nIn the 2000s, there was a trend of print and e-book sales moving to the Internet, where readers buy traditional paper books and e-books on websites using e-commerce systems. With print books, readers are increasingly browsing through images of the covers of books on publisher or bookstore websites and selecting and ordering titles online; the paper books are then delivered to the reader by mail or another delivery service. With e-books, users can browse through titles online, and then when they select and order titles, the e-book can be sent to them online or the user can download the e-book."},{"page_url":"https://it.wikipedia.org/wiki/Marsica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Fuciner-lake_nasa.jpg","page_title":"Marsica","context_page_description":"La Màrsica è una regione storico-geografica dell'entroterra abruzzese, in provincia dell'Aquila, storicamente da considerarsi come la zona abitata in epoca antica dai Marsi, popolo italico stanziato dal I millennio a.C. nel territorio circostante il lago Fucino e nelle aree limitrofe. Il toponimo deriva dall'aggettivo latino Marsicus.\\nGeograficamente posizionata al confine occidentale dell'Abruzzo con il Lazio, intorno alla piana del Fucino, tra piana di Carsoli, valle Roveto e parco nazionale d'Abruzzo, Lazio e Molise, confina a nord con la conca aquilana, a nordest con la valle Subequana, ad est con la valle Peligna, a sud con l'Alto Sangro e la catena montuosa degli Ernici, infine ad ovest con le catene montuose dei Càntari, dei Simbruini e con l'alta valle dell'Aniene. Comprende 37 comuni, tra cui il più popoloso è Avezzano, per un totale di oltre 130 000 abitanti."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%90%8C%E9%9B%BB%E5%8A%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/MATSUNAGA_Yasuzaemon.jpg","page_title":"大同電力","context_page_description":"大同電力株式会社は、大正から昭和戦前期にかけて存在した日本の電力会社である。当時の大手電力会社、通称「五大電力」の一つ。\\n大阪送電株式会社の社名で1919年に設立され、1921年に木曽電気興業・日本水力の2社を合併して大同電力となった。木曽川などの河川において電源開発を手がけ、同時に関西・中部・関東にまたがる送電網を構築。これらの地域で営業する電気事業者への電力供給を事業の中心とする、卸売り電力会社として発展した。\\n1939年に解散。保有していた発電所はその後の再編を経て関西電力・中部電力・北陸電力の3社に継承された。また傍系会社の系譜を引く特殊鋼メーカーの大同特殊鋼に「大同」の社名を残している。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_regions_of_Peru_by_population","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/PedestrianStreet2.jpg","page_title":"List of regions of Peru by population","context_page_description":"The following is a list of the regions of Peru ordered by population from Census 2007 and estimated population of INEI."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Friedh%C3%B6fe_in_M%C3%BCnchen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Friedhof_Solln_View_to_East.jpg","page_title":"Liste der Friedhöfe in München","context_page_description":"Diese Seite listet Friedhöfe auf, die in dem Gebiet der bayerischen Landeshauptstadt München liegen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%BC%E3%83%88%E3%83%9E%E3%82%B9_(%E3%83%93%E3%82%AF%E3%83%88%E3%83%AA%E3%82%A2%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Dartmouth_aerial.jpg","page_title":"ダートマス (ビクトリア州)","context_page_description":"ダートマス は、オーストラリアのビクトリア州にある町。"},{"page_url":"https://cs.wikipedia.org/wiki/Oxid_holmit%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Holmium%28III%29_oxide.jpg","page_title":"Oxid holmitý","context_page_description":"Oxid holmitý je oxidem holmia, které je v něm přítomno v oxidačním čísle III."},{"page_url":"https://sv.wikipedia.org/wiki/K%C3%A4geludden","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Keilaniemi_metro_station_%28Nov_2017%2C_2%29.jpg","page_title":"Kägeludden","context_page_description":"Kägeludden är ett kontorsområde i Esbo, Finland.\\nOmrådet ligger på en udde med samma namn i sydöstra Esbo. Kägeludden gränsar i norr till Otnäs och i väster till Hagalund. Öster om Kägeludden ligger Kägelviken som skiljer Esbo från Helsingfors, och i söder ligger Finska viken.\\nKägeludden är känt som hemvist för flera stora företag. Bland annat Tieto, Kone, Fortum, Rovio och Neste har sina huvudkontor där. Accountor Tower, var den första byggnaden på området. Byggnaden blev färdig 1976, och är fortfarande Finlands högsta kontorsbyggnad.\\nKägeludden har sin egen metrostation. Den blev färdig år 2017, som en del av Västmetron."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%BE%D0%B2_%D0%B2%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Baku_Maiden_Tower_2010.jpg","page_title":"Список объектов всемирного наследия ЮНЕСКО в Азербайджане","context_page_description":"В списке Всеми́рного насле́дия ЮНЕ́СКО в Азербайджа́нской Респу́блике значатся 3 наименования. Азербайджанская Республика ратифицировала Конвенцию об охране всемирного культурного и природного наследия 16 декабря 1993 года. Первый объект, находящийся на территории Азербайджана был занесен в список в 2000 году на 24-й сессии Комитета всемирного наследия ЮНЕСКО."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A3%D8%B3_%D8%A2%D8%B3%D9%8A%D8%A7_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/IRN-IRQ_20190116_Asian_Cup_6.jpg","page_title":"كأس آسيا 2019","context_page_description":"بطولة كأس آسيا لكرة القدم لعام 2019 كانت النسخة السابعة عشر من كأس آسيا، وهي بطولة كرة القدم الدولية للرجال التي ينظمها الاتحاد الآسيوي لكرة القدم كل أربع سنوات. عقدت في الإمارات العربية المتحدة من 5 يناير إلى 1 فبراير 2019. فازت قطر بالبطولة بعد فوزها على اليابان 3–1 في المباراة النهائية. وحصلت قطر على حق المشاركة في كأس القارات 2021، الذي ستستضيفه جمعية الاتحاد الآسيوي لكرة القدم التي لم يتم تحديدها بعد أن خسرت قطر، الدولة المضيفة لكأس العالم 2022، حقوقه.\\nأُعلنت الإمارات العربية المتحدة بصفتها الدولة المضيفة للبطولة في 9 مارس 2015، في حين كانت إيران هي العارض الوحيد المتبقي للحصول على حق استضافة نهائيات 2019. وهذه هي المرة الثانية التي تستضيف فيها الإمارات العربية المتحدة البطولة بعد نهائيات 1996.\\nلأول مرة، لعب في البطولة النهائية لكأس آسيا 24 فريقاً، بعد أن تم توسيعها من شكل الـ16 فريقاً الذي تم استخدامه من عام 2004 إلى عام 2015. في إطار هذا الشكل الجديد، سيلعب المتسابقون النهائيون مرحلة جماعية تتكون من ست مجموعات من أربعة فرق، تليها مرحلة خروج المغلوب من 16 فريقًا."},{"page_url":"https://nn.wikipedia.org/wiki/Flens_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Flen_Municipality_in_S%C3%B6dermanland_County.png","page_title":"Flens kommun","context_page_description":"Flen er ein kommune i Södermanlands län i Sverige. Folketalet er 16 082. Administrasjonssenteret i kommunen er Flen."},{"page_url":"https://en.wikipedia.org/wiki/Carex_kobomugi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Carex_kobomugi.jpg","page_title":"Carex kobomugi","context_page_description":"Carex kobomugi is a species of sedge, known as the Japanese sedge or Asiatic sand sedge, that lives in sandy coastal areas of eastern Asia, and has become an invasive species in the north-eastern United States."},{"page_url":"https://es.wikipedia.org/wiki/Explotaci%C3%B3n_econ%C3%B3mica","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Derelict_fishing_gear_with_animal_carcasses.jpg","page_title":"Explotación económica","context_page_description":"Explotación económica o explotación de los recursos naturales son expresiones con las que se designa a la utilización por el sistema económico de los recursos naturales, particularmente cuando está encaminada al crecimiento económico.​ Dependiendo del contexto, puede tener una connotación negativa; por ejemplo para destacar su contribución a la degradación medioambiental.\\nLa explotación de los recursos naturales es consustancial a la actividad humana sobre el medio, que siempre ha generado paisajes humanizados, ​ con distinto grado de alteración, menor en la sociedad preindustrial que en la sociedad industrial.\\nA partir de la Revolución Industrial se intensifica la extracción y procesamiento de materias primas. El siglo XX protagonizó un rápido incremento en la demanda energética, que sigue dependiendo en su mayor parte de los combustibles fósiles.​ la suelo y la conjunto de los ecosistemas terrestres​ y acuáticos​ son también recursos no renovables que se degeneran aún más rápidamente por la intensificación de agricultura y ganadería.\\nA medida que aumenta la presión humana sobre los recursos naturales lo hace su huella ecológica, llegando a un punto en que se hace insostenible.​"},{"page_url":"https://lt.wikipedia.org/wiki/Litlportas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/The_Crown_PH%2C_Littleport_-_geograph.org.uk_-_548850.jpg","page_title":"Litlportas","context_page_description":"Litlportas – kaimas Anglijoje, Jungtinėje Karalystėje. Seniūnijos administracinis centras."},{"page_url":"https://it.wikipedia.org/wiki/Banca_Ottomana","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Ottoman_Bank.jpg","page_title":"Banca Ottomana","context_page_description":"La Banca Ottomana è stata una banca turca, che ha svolto le funzioni di banca centrale dal 1875 al 1931."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Reynolds_(cleric)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Label_identifying_Reynolds_Grave_Slab.png","page_title":"Charles Reynolds (cleric)","context_page_description":"Charles Reynolds was an Irish Catholic cleric, canonist, and diocesan administrator. Born in County Leitrim, Reynolds entered a religious order and was appointed to influential posts as archdeacon and chaplain to the Earl of Kildare. His name in native Irish is Cathal Mac Raghnaill, but he anglicized his name to Charles Reynolds in order secure ecclesiastical benefices under English laws. He was educated at the University of Oxford and fluent in English, Irish, and Latin. Reynolds opposed Henry VIII of England's separation from the Catholic Church, declining to acknowledge him as Supreme Head of the Church of England and refusing to acknowledge the annulment of his marriage to Catherine of Aragon.\\nDuring the Kildare Rebellion of 1534–5 against King Henry, Reynolds was dispatched as envoy to Rome to seek support from the pope. In May 1535 he secured a papal promise to excommunicate King Henry of England.\\nReynolds died of an \\"incurable fever\\" and was buried in Archbasilica of St. John Lateran on 15 July 1535."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%85%D9%84_%D9%85%D8%A7%D9%83%D9%84%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Jamel_Mclean.JPG","page_title":"جامل ماكلين","context_page_description":"جامل ماكلين ‏ مواليد 18 أبريل 1988، هو لاعب كرة سلة أمريكي بدأ مسيرته الاحترافية في سنة 2011 يلعب مع فريق ألبا برلين في الدوري الألماني لكرة السلة ويحمل الرقم 33. يبلغ طوله 6 قدم 8 بوصة."},{"page_url":"https://en.wikipedia.org/wiki/Iberia,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Iberia_PCUSA.jpg","page_title":"Iberia, Ohio","context_page_description":"Iberia is a census-designated place in western Washington Township, Morrow County, Ohio, United States. The community is served by the Northmor Local School District which formerly operated Iberia Elementary School in the community. Iberia is near to Galion, and Martel. The ZIP code assigned to Iberia by the United States Postal Service is 43325. The current population of Iberia is less than 200 as of the 2000 census. Iberia is northwest of Mount Gilead, the county seat."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B5%D8%A7%D8%B1_%D8%A7%D9%84%D8%AE%D8%B1%D8%B7%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/General_Gordon%27s_Last_Stand.jpg","page_title":"حصار الخرطوم","context_page_description":"حصار الخرطوم ‏، حدثت حصار الخرطوم من عام 1884 إلى عام 1885، والتي أنتهت بانتصار الثوار التابعين لمحمد أحمد المهدي، ومقتل تشارلز جورج غوردون على أيدي الثوار داخل ساحة القصر في مدينة الخرطوم."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%A1%D5%BB%D5%AB%D5%AF%D5%BD%D5%BF%D5%A1%D5%B6%D5%AB_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D5%A4%D6%80%D5%A1%D5%B4%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/2014_TJ_Ag_500_Somoni_20Const_Rev.png","page_title":"Տաջիկստանի հուշադրամներ","context_page_description":"Հիշատակային և հոբելյանական մետաղադրամները թողարկվում են Տաջիկստանի Ազգային բանկի կողմից՝ սկսած 2004 թվականից։ Ի տարբերություն հիմնական շրջանառու մետաղադրամների՝ դրանք կարող են ունենալ զուտ հավաքորդական և դրամագիտական նշանակություն:\\nՆշված մետաղադրամները պատրաստված են թանկարժեք և ոչ թանկարժեք մետաղներից։ Ոսկե մետաղադրամները թողարկվել են 50, 100 և 200 տաջիկական սոմոնի անվանական արժեքով, արծաթե դրամները՝ 1, 3, 5, 50, 100 և 500 սոմոնի, մելքիորից՝ 1 սոմոնի, նոյզիլբերից՝ 1 սոմոնի, իսկ երկմետաղ դրամները՝ 3 և 5 սոմոնի։ Մետաղադրամները հատվել են UNC, BU և proof որակներով:\\nՏաջիկստանի Ազգային բանկի կողմից թողարկված առաջին հուշադրամներն են «Սահմանադրության ընդունման 10-ամյակ» և «Դուշանբեն մայրաքաղաք հռչակելու 80-ամյակ» երկմետաղ ու արծաթե մետաղադրամները։ Ամենափոքր հուշադրամը «Դուշանբեն մայրաքաղաք հռչակելու 80-ամյակ» երկմետաղ մետաղադրամն է՝ ընդամենը 6.35 գ քաշով, իսկ ամենամեծ հուշադրամներն ունեն 31.10 գ քաշ։\\nՏաջիկստանում պետական դրամահատարանի բացակայության պայմաններում Տաջիկստանի Ազգային բանկի կողմից թողարկված հուշադրամները հատվում են արտերկրում։ Տաջիկստանի Ազգային բանկը համագործակցել է հետևյալ դրամահատարանների և ընկերությունների հետ՝\\n«Մայեր» դրամահատարան,\\nՂազախստանի դրամահատարան,"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B5%B7%E5%8D%97%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kainan_shrine.jpg","page_title":"海南神社","context_page_description":"海南神社は、神奈川県三浦市にある神社。\\n三崎港から市街地を少し山手に入った地点に鎮座する。\\n相模国三浦総鎮守。\\n藤原資盈、資盈の后である盈渡姫、筌龍弁財天、及び地主大神を祀る。\\n源頼朝がお植えになられた御神木や、龍神様の形をした御神木等がある。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%96%D0%B8%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%9A%D0%BE%D1%87%D0%B0%D0%BD_%D0%BF%D1%87%D0%B5%D0%BD%D0%BA%D0%B0_%D0%BD%D0%B0_%D0%BD%D0%B8%D0%B2%D0%B0.jpg","page_title":"Жито","context_page_description":"Житата — едногодишни растенија од семејството треви. Нивните зрнести плодови се користат во човековата исхрана, прехранбената индустрија, а сеното за добиточна исхрана и постилка."},{"page_url":"https://cs.wikipedia.org/wiki/Clive_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Clive_Davis.jpg","page_title":"Clive Davis","context_page_description":"Clive Davis je americký hudební producent a A&R osoba. Narodil se v Brooklynu do židovské rodiny. V roce 1967 se stal prezidentem hudebního vydavatelství Columbia Records. Pozici opustil roku 1973. Roku 1974 založil vlastní vydavatelství Arista Records. Z pozice odešel roku 2000, kdy založil jiné vydavatelství – J Records. Rovněž působil ve společnostech RCA Music Group a Sony Music Entertainment. To zaniklo roku 2011. Clive Davis byl roku 2000 uveden do Rock and Roll Hall of Fame."},{"page_url":"https://sv.wikipedia.org/wiki/Cla%C3%ABs_Bonde","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Bonde%2C_Cla%C3%ABs_i_VJs_julnummer_1942.jpg","page_title":"Claës Bonde","context_page_description":"Claës Bonde, född den 4 mars 1878, död den 6 april 1965, var en svensk greve, jurist och diplomat.\\nClaës Bonde var son till Carl Trolle-Bonde och dennes hustru, friherrinnan Eva Fredrika Emerentia Leijonhufvud.\\nEfter avlagd juris utriusque kandidatexamen blev Bonde förste sekreterare i Utrikesdepartementet 1908, och var därefter legationssekreterare vid en rad olika beskickningar 1912-1921. Han erhöll legationsråds titel 1916, och blev legationsråd i Tokyo och Peking 1921 samt i London 1924. 1927 ställdes han i disponibilitet med ministerresidents titel. 1938-1950 var han Gustaf V:s handsekreterare. Han var även härold vid Kunglig Majestäts Orden."},{"page_url":"https://it.wikipedia.org/wiki/Guerre_ottomano-ungheresi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Louis2.jpg","page_title":"Guerre ottomano-ungheresi","context_page_description":"Le guerre ottomano-ungheresi comprendono un insieme di numerosi conflitti tra il Regno d'Ungheria e l'Impero ottomano che si conclusero con la distruzione del Regno d'Ungheria e la sua spartizione tra i turchi e gli Asburgo d'Austria.\\nIl conflitto ottomano-ungherese si sviluppò in concomitanza con l'inasprirsi sul suolo europeo delle guerre bizantino-ottomane. Mentre l'Impero bizantino perdeva sistematicamente territori in favore dei sultani turchi, il potente regno ungherese si ritrovò a guidare in prima persona lo schieramento cristiano nella lotta contro l'avanzata ottomana.\\nIl primo scontro formale tra la potenza turca e quella ungherese si verificò durante la crociata di Nicopoli e si concluse con una schiacciante vittoria per il sultano Bayezid I. Nel cinquantennio successivo al disastro di Nicopoli, la lotta contro i turchi venne efficacemente guidata dal capitano ungherese Giovanni Hunyadi che, nonostante la sconfitta subita nella Crociata di Varna, seppe infliggere una pesante sconfitta al sultano Maometto II nell'Assedio di Belgrado."},{"page_url":"https://sv.wikipedia.org/wiki/Oddset_Hockey_Games_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Ishockey_Sweden-Russia_%282-0%29_May_4th%2C_2014.jpg","page_title":"Oddset Hockey Games 2014","context_page_description":"Oddset Hockey Games 2014 spelades under perioden 1 – 4 maj 2014 i Globen, Stockholm, Sverige. En match spelades i Hartwall Arena, Helsingfors, Finland. Oddset Hockey Games ingår i Euro Hockey Tour som brukar erkännas som ett inofficiellt Europamästerskap i ishockey. I turneringen deltar landslagen från Finland, Ryssland, Sverige och Tjeckien.\\nFinland vann turneringen före Tjeckien, med Sverige på tredjeplats."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Berlin_Eberswalder_Stra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/19880608_Gbf_Eberswalder_Stra%C3%9Fe.jpg","page_title":"Bahnhof Berlin Eberswalder Straße","context_page_description":"Der Bahnhof Berlin Eberswalder Straße an der Bernauer Straße war der Anfangspunkt der Berliner Nordbahn. Bis auf wenige Jahre Ende des 19. Jahrhunderts diente er ausschließlich dem Güterverkehr. Durch seine Lage zwischen Ost- und West-Berlin verlor er infolge der Teilung Berlins ab 1948 an Bedeutung, war aber lange Zeit noch für einzelne Anlieger in Betrieb. Die Deutsche Reichsbahn legte 1985 die verbliebenen Anlagen des Bahnhofs still. Der ab 1992 entstandene Mauerpark umfasst den größten Teil der Flächen des ehemaligen Bahnhofs. Von dessen Bauten ist nur wenig erhalten geblieben, bekanntestes Relikt ist der früher unter den Gleisen verlaufende denkmalgeschützte Gleimtunnel."},{"page_url":"https://fr.wikipedia.org/wiki/Duo_Campion/Vachon","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/DuoCampionVachon.jpg","page_title":"Duo Campion/Vachon","context_page_description":"Le Duo Campion/Vachon est composé des pianistes québécois Guy Campion et Mario Vachon. Il a été formé dans les années 1980, son répertoire comprend les compositeurs classiques et la musique de film."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%BC%E3%83%A9%E3%83%B3%E9%83%A1_(%E3%83%8D%E3%83%96%E3%83%A9%E3%82%B9%E3%82%AB%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Orleans%2C_Nebraska_-_Village_Office.JPG","page_title":"ハーラン郡 (ネブラスカ州)","context_page_description":"ハーラン郡は、アメリカ合衆国のネブラスカ州にある郡。2000年時点での人口は3,786人で、郡庁所在地はアルマ 。郡内にはハーラン郡貯水池がある。\\nネブラスカ州のナンバープレートで、ハーラン郡の車両は最初の数字が51になっている。これは1922年にナンバープレートの制度を確立した際、ハーラン郡の車両登録台数が州内の郡のなかで51番目に多かったからである。"},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%8D_%E1%BB%90c_nh%E1%BA%A3y","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Strombus_lentiginosus_R%C3%A9union.jpg","page_title":"Họ Ốc nhảy","context_page_description":"Họ Ốc nhảy thường được gọi là ốc nhảy thật sự là một họ ốc biển cỡ lớn và vừa trong siêu họ Stromboidea. Thuật ngữ ốc nhảy đôi khi còn được hiểu theo nhiều nghĩa. Ở Việt Nam, tên của chúng được gọi do người ta nhận thấy chúng có khả năng biết nhảy, loài ốc này có chân rất dài, thay vì bò như các loại ốc khác chúng có thể nhảy lên trên mặt đất nên nhiều ngư dân gọi là ốc nhảy."},{"page_url":"https://war.wikipedia.org/wiki/Phellinus_populicola","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Haava-tuletaelik_%28Phellinus_populicola%29_J%C3%A4rvselja_Tartumaa_2015.jpg","page_title":"Phellinus populicola","context_page_description":"An Phellinus populicola in uska species han Fungi in nahilalakip ha divisio nga Basidiomycota, ngan nga ginhulagway ni Tuomo Niemelä hadton 1975. An Phellinus populicola in nahilalakip ha genus nga Phellinus, ngan familia nga Hymenochaetaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://pt.wikipedia.org/wiki/NGC_2562","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/NGC2562_-_SDSS_DR14.jpg","page_title":"NGC 2562","context_page_description":"NGC 2562 é uma galáxia espiral localizada na direcção da constelação de Cancer. Possui uma declinação de +21° 07' 54\\" e uma ascensão recta de 8 horas, 20 minutos e 23,5 segundos.\\nA galáxia NGC 2562 foi descoberta em 13 de Fevereiro de 1787 por William Herschel."},{"page_url":"https://da.wikipedia.org/wiki/Tinglev_Mose","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Tinglev_Mose_plankesti.jpg","page_title":"Tinglev Mose","context_page_description":"Tinglev Mose var oprindeligt en lavvandet sø, Tinglev Sø, der ligger sydøst for Tinglev i Aabenraa Kommune. Mosen der er ca. 180 hektar stor og kan naturligt opdeles i tre områder: Nørresø, og Søndersø, der er adskilt af den østgående jernbane og ligger øst for Almstrup Kanal og omliggende højmoser. Vandstanden i mosen er sænket ved en række afvandinger, fra første verdenskrig og frem til den seneste og største afvanding i 1966-67, hvor der blev gravet store afvandingskanaler i og omkring mosen. Afvandingerne skete for, at der kunne graves tørv og søkalk i mosen, hvilket er sket indtil 1950'erne. Mosen afvandes mod syd via Almstrup Kanal til Sønderå, der er en del af Vidå-systemet.\\nVed undersøgelsen i 2009 blev der registreret i alt 64 arter af ynglefugle, bl.a. de rødlistede atlingand, krikand og turteldue."},{"page_url":"https://id.wikipedia.org/wiki/Komisi_Juncker","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Federica_Mogherini_daticamera.jpg","page_title":"Komisi Juncker","context_page_description":"Komisi Juncker adalah Komisi Eropa yang bertugas sejak 1 November 2014 sampai 2019. Presidennya adalah Jean-Claude Juncker. Ia menjabat bersama 27 komisaris lain. Pada Juli 2014, Juncker secara resmi terpilih sebagai pengganti José Manuel Barroso. Barroso sebelumnya dipilih kembali oleh Parlemen Eropa untuk masa jabatan kedua."},{"page_url":"https://pl.wikipedia.org/wiki/Kamaishi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Kamaishi_city_hall.JPG","page_title":"Kamaishi","context_page_description":"Kamaishi – miasto portowe w Japonii, na wyspie Honsiu, w prefekturze Iwate."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AC%A7%E5%A1%9E%E5%B0%94%E5%9C%A3%E7%83%AD%E5%B0%94%E9%9F%A6%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Batiment_gare_auxerre.JPG","page_title":"欧塞尔圣热尔韦站","context_page_description":"欧塞尔圣热尔韦站，简称\\"欧塞尔站\\"，是法国的一个铁路车站，位于法国中北部城市，约讷省省会欧塞尔。"},{"page_url":"https://vi.wikipedia.org/wiki/Chu_tr%C3%ACnh_PDCA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/PDCA_Cycle.svg","page_title":"Chu trình PDCA","context_page_description":"PDCA hay Chu trình PDCA là chu trình cải tiến liên tục được Tiến sĩ Deming giới thiệu cho người Nhật trong những năm 1950. Mặc dù lúc đầu ông gọi là Chu trình Shewart để tưởng nhớ Tiến sĩ Walter A. Shewart - người tiên phong trong việc kiểm tra chất lượng bằng thống kê ở Mỹ từ những năm cuối của thập niên 30. Tuy nhiên Người Nhật lại quen gọi nó là chu trình Deming hay vòng tròn Deming.\\nNội dung của các giai đoạn của chu trình này có thể tóm tắt như sau:\\nPlan: Lập kế hoạch, xác định mục tiêu, phạm vi, nguồn lực để thực hiện, thời gian và phương pháp đạt mục tiêu.\\nDo: Đưa kế hoạch vào thực hiện.\\nCheck: Kiểm tra lại kế hoạch và kiểm tra kết quả thực hiện kế hoạch.\\nAct: Dựa trên kết quả kiểm tra, tiến hành cải tiến chương trình.\\nVới hình ảnh một đường tròn lăn trên một mặt phẳng nghiêng, chu trình PDCA cho thấy thực chất của quá trình quản lý chất lượng là sự cải tiến liên tục và không bao giờ ngừng. Trên thực tế việc thực hiện chu trình PCDA phức tạp hơn nhiều so với tên của nó. Tuy nhiên, chu trình PDCA là nền tảng cho các chu trình cải tiến trong ISO 9001. Khi một tổ chức thực hiện được chu trình PDCA cũng sẽ làm chủ được hệ thống quản lý chất lượng theo tiêu chuẩn ISO 9001."},{"page_url":"https://mn.wikipedia.org/wiki/%D2%AE%D1%81%D1%8D%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Cyrillic_JA.png","page_title":"Үсэг","context_page_description":"Үсэг гэдэг нь аливаа нэг бичиг үсгийн үндсэн махбод болох цагаан толгойн тэмдэг юм. Заавал гэх албагүй боловч ихэвчлэн ярианы хэлний нэгж авиаг тэмдэглэдэг."},{"page_url":"https://ro.wikipedia.org/wiki/Thoriu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Thorium.svg","page_title":"Thoriu","context_page_description":"Thoriul este un element chimic natural radioactiv cu numărul atomic 90 și simbol chimic Th, ce se găsește în natură. A fost descoperit de minerologul norvegian Morten Thrane Esmark în 1828, în Norvegia, lângă Brevig și identificat de chimistul suedez Jöns Jacob Berzelius. Numele de thoriu este o referință la Thor, zeul războiului în mitologia scandinavă. Thoriul este considerat a fi combustibilul nuclear al viitorului. Canada, China, Germania, India, Olanda, Regatul Unit și S.U.A au făcut numeroase experimente utilizând thoriul combustibil nuclear substituent. Mai puțin radioactiv decât uraniul, thoriul poate fi exploatat în cariere de suprafață, iar acest lucru are un impact minim asupra mediului și costuri relativ reduse de valorificare. Cantitatea estimată de thoriu din scoarța terestră este de trei până la patru ori mai mare decât cea a uraniului. Principalul minereu din care se extrage thoriul este monazitul."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_%D0%9A%D1%83%D0%BC%D0%B5%D1%80%D1%82%D0%B0%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Coat_of_Arms_of_Kumertau_%28Bashkortostan%29.png","page_title":"Городской округ город Кумертау","context_page_description":"Город Кумертау башк. Күмертау — муниципальное образование в Башкортостане России. Образовано на территории города республиканского значения Кумертау.\\nАдминистративный центр — город Кумертау."},{"page_url":"https://it.wikipedia.org/wiki/Issanlas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Issanlas_-_rue.JPG","page_title":"Issanlas","context_page_description":"Issanlas è un comune francese di 119 abitanti situato nel dipartimento dell'Ardèche della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://de.wikipedia.org/wiki/Materialseilbahn_Chilecito-La_Mejicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Sierras_de_Famatina_Chilecito.jpg","page_title":"Materialseilbahn Chilecito-La Mejicana","context_page_description":"Die Materialseilbahn Chilecito-La Mejicana in Argentinien war zu ihrer Zeit die längste Seilbahn der Welt und bis zum Bau der Materialseilbahnen am Aucanquilcha und am Ollagüe auch die Seilbahn mit der höchstgelegenen Bergstation.\\nDie Materialseilbahn wurde in den Jahren 1903 und 1904 gebaut, um Chilecito, einen in 1076 m Höhe gelegenen Ort in der argentinischen Provinz La Rioja mit dem am Osthang der Sierra de Famatina in über 4600 m Höhe gelegenen Bergwerk Mina la Mejicana zu verbinden.\\nDie 35 km lange Seilbahn führte mit Steigungen von bis zu 45° über unwegsames, bergiges Gelände und überwand dabei einen Höhenunterschied von 3528 m, der bis heute nicht übertroffen wurde."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8E%E3%83%BC%E3%83%99%E3%83%AB%E7%94%9F%E7%90%86%E5%AD%A6%E3%83%BB%E5%8C%BB%E5%AD%A6%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Niels_ryberg.jpg","page_title":"ノーベル生理学・医学賞","context_page_description":"ノーベル生理学・医学賞はノーベル賞6部門のうちの一つ。「生理学および医学の分野で最も重要な発見を行った」人物に与えられる。選考はカロリンスカ研究所のノーベル委員会が行う。\\nノーベル生理学・医学賞のメダルは、表面にはアルフレッド・ノーベルの横顔（各賞共通）、裏面には膝の上に本を広げつつ、病気の少女のために岩から流れる水を汲んでいる医者の姿がデザインされている。"},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_Adventista_del_S%C3%A9ptimo_D%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/James_White_%281864%29.jpg","page_title":"Iglesia Adventista del Séptimo Día","context_page_description":"La Iglesia Adventista del Séptimo Día es una denominación cristiana protestante, ​​ distinguida por su observancia del sábado​ como día de reposo y por su convicción de que la segunda venida de Jesucristo es inminente.​​ La iglesia surgió del movimiento millerita en Estados Unidos a mediados del siglo XIX d. C., y fue establecida formalmente en 1863.​ Está presente en 213 países y territorios, ​ y cuenta con más de 21 millones de miembros.​\\nGran parte de la teología adventista corresponde a enseñanzas protestantes comunes, como la autoridad suprema de la Biblia, la Trinidad, y la salvación por medio de la fe en Jesucristo. Sin embargo, presentan importantes creencias distintivas, como la observancia del sábado como día de reposo, la doctrina del juicio investigador, y la manifestación del don de profecía en el ministerio de Ellen G. White.​ El trabajo misionero es muy importante para la iglesia, y sus miembros consideran que tienen el deber de compartir sus creencias con los demás.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%BF%E5%B7%9E%E5%85%B0%E5%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Canton_Orchid_Garden_Large_Pavilion_2017.JPG","page_title":"广州兰圃","context_page_description":"广州兰圃位于中国广州市解放北路与环市西路交汇处，与越秀公园遥望相对，占地面积3.9万平方米，是中国首个以栽培兰花为主的主题公园，共栽种了200多个品种的兰花。其前身是广州植物标本园。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%84%D0%BD%D1%96%D1%81%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Lesosplav_na_enisee.jpg","page_title":"Єнісей","context_page_description":"Єнісе́й — річка в Сибіру, назва від древньокиргизького Ене-Сай — «мати-річка», впадає до Карського моря басейну Північного Льодовитого океану."},{"page_url":"https://fr.wikipedia.org/wiki/Fontaines_des_Landes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Dumes_fontaine_Mondiron.JPG","page_title":"Fontaines des Landes","context_page_description":"Le département français des Landes compte 256 fontaines ou sources dites « guérisseuses », soit plus de 10 % des 2000 fontaines christianisées recensées en France. Près de cent trente sont recensées uniquement dans la partie forestière du département, qui compte parmi les régions françaises possédant la plus forte densité de fontaines de dévotion, après le Limousin, l’Auvergne et le Périgord. Elles constituent des éléments remarquables du petit patrimoine rural du département."},{"page_url":"https://es.wikipedia.org/wiki/Torres_La_Caixa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Torres_de_la_Caixa.jpg","page_title":"Torres La Caixa","context_page_description":"Torres La Caixa es un complejo de tres edificios, dos de ellos rascacielos en Barcelona, España. Fueron proyectadas en 1974 y construidas entre 1979 y 1983 por los arquitectos Francisco Mitjans Miró y José Antonio Coderch.​ La Caixa 1 tiene 26 pisos y se eleva 85 metros, ​ mientras que La Caixa 2 tiene 14 plantas y 48 metros.​ La Caixa 3 no es un edificio alto, y tiene forma de cubo. Los edificios forman parte de la sede central de CaixaBank y su fundación bancaria La Caixa. Las dos torres tienen un diseño similar y su fachada está recubierta de cristal tintado negro\\nEl logo de la mayor entidad bancaria catalana, destaca en la penúltima planta de cada una de las dos torres, donde se ubican dos rótulos giratorios, que recorren 8.500 kilómetros al año.​\\nEl 1 de enero de 2008 La Caixa compró a Inmobiliaria Colonial la Torre II —la de menor altura— por un importe de 107 millones de euros.​ La operación incluía varios locales en el perímetro de la torre y la zona de aparcamiento.​ La Torre I es propiedad de la entidad desde su construcción.​"},{"page_url":"https://sv.wikipedia.org/wiki/Monterosso_al_Mare","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Street_in_Moterosso_village.jpg","page_title":"Monterosso al Mare","context_page_description":"Monterosso al Mare är en kommun och en stad i provinsen La Spezia, som är en del av regionen Ligurien i norra Italien. Monterosso al Mare är en av de fem städerna i Cinque Terre. Kommunen hade 1 409 invånare."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A9%94%EA%B7%B8%EB%82%98_%EB%82%98%EC%9D%B4%EB%91%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Meghna_Naidu_at_Press_conference_of_Rivaaz_%285%29.jpg","page_title":"메그나 나이두","context_page_description":"메그나 나이두는 인도의 배우, 댄서이다."},{"page_url":"https://ca.wikipedia.org/wiki/Refer%C3%A8ndum_sobre_la_perman%C3%A8ncia_del_Regne_Unit_dins_la_Uni%C3%B3_Europea_de_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/United_Kingdom_EU_referendum_2016_area_results_%28Wales%29.svg","page_title":"Referèndum sobre la permanència del Regne Unit dins la Unió Europea de 2016","context_page_description":"Un referèndum va tenir lloc el 23 de juny de 2016 al Regne Unit de la Gran Bretanya i Irlanda del Nord i a Gibraltar, sobre la qüestió de si el Regne Unit ha de romandre dins del sí de la Unió Europea o no. La pertinença britànica a la Unió Europea ha estat un tema controvertit des del 1973, any en què el país es va integrar dins de la Comunitat Econòmica Europea, amb debats recurrents des de l'inici, sobre la possibilitat d'una sortida del Regne Unit de la Unió Europea, que ha donat origen al terme \\"brexit\\",\\nEl 2015 el Parlament britànic va aprovar l'acta \\"European Union Referendum Act 2015\\" que autoritza la celebració del referèndum. La llei de referèndum és fruit d'una iniciativa del govern del Partit Conservador, per tal de concloure el debat. Va ser la segona ocasió en què se celebri un referèndum d'aquest tipus després del \\"referèndum sobre la permanència del Regne Unit en la Comunitat Econòmica Europea\\" que es va celebrar el 1975 i en el qual el 67% dels electors es va mostrar partidari de romandre a la UE."},{"page_url":"https://fr.wikipedia.org/wiki/Gila_purpurea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Gila_purpurea.jpg","page_title":"Gila purpurea","context_page_description":"Gila purpurea est une espèce de poisson de la famille des cyprinidés. On le trouve au nord du Mexique et aux États-Unis."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%A7%D9%86%D8%AF%D8%A7%D9%86_%D8%A7%D8%B3%D9%81%D9%86%D8%AF%DB%8C%D8%A7%D8%B1%DB%8C_(%D9%86%D9%88%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Yamin_ol_Mamalek.png","page_title":"خاندان اسفندیاری (نور)","context_page_description":"خاندان اسفندیاری نور از خاندان‌های معروف ایران در دوره قاجار و پهلوی است که به شاهان پادوسبانی نسب می‌رساند و در روستای یوش از منطقه نور واقع در مازندران ریشه دارد. علی اسفندیاری و محتشم السلطنه از مشهورترین اعضای این خاندان هستند. در عصر قاجار و پهلوی و وزرا، نمایندگان مجلس و چهره‌های سیاسی و علمی و هنرمندان متعددی از میان افراد این خانواده برخاستند."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%87%D8%A7%D8%B1_%D9%82%DB%8C%D8%B2%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/AV0A9103_Bahar_Kizil_%28S%C3%A4ngerin_%26_ehem._Mitglied_der_Popstars-Castingband_Monrose%29.jpg","page_title":"بهار قیزیل","context_page_description":"بهار قیزیل آلمانلی شارکی یازیچی، شارکیچی و موسیقیچی - پاپ، چاغداش آراندبی و دنس پاپ موسیقی ژانرلاریندا اثرلر یارادیب. بهار قیزیل ۵ اوْکتوبر ۱۹۸۸ ‏ تاریخینده حیاتا گؤز آچیب."},{"page_url":"https://en.wikipedia.org/wiki/Georgios_Koumanakos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Georgios_Koumanakos_%281981%29.jpg","page_title":"Georgios Koumanakos","context_page_description":"Georgios Koumanakos was a Greek Army officer and peace activist.\\nBorn in Gytheio, Mani in 1913, he fought in World War II, in the Greek Civil War against the Communists and commanded the Greek Expeditionary Force in Korea with distinction. By 1967, he had reached the rank of Lieutenant General. As an opponent of the Greek military junta of 1967-1974, he was retired from the army and sent for three years into internal exile by the military regime.\\nAfter the junta's fall in 1974, he became chairman of the state-run Hellenic Telecommunications Organization and PYRKAL weapons industry.\\nIn the 1980s, he was a well-known activist for nuclear disarmament and the withdrawal of US bases from Greece; along with 7 other high-ranking generals from NATO countries he co-signed the Generals for Peace and Disarmament initiative in 1981, and became a member of the Soviet-sponsored World Peace Council."},{"page_url":"https://fr.wikipedia.org/wiki/Marzan_Sharav","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Sharav_bogd_khan.jpg","page_title":"Marzan Sharav","context_page_description":"Baldugiin 'Marzan' Sharav était un moine et un peintre mongol.\\nB. Sharav, qui a été instruit comme moine bouddhiste, était un peintre qui a changé de style reliant l'ancien avec le nouveau dans l'art avec les changements du monde.\\nA une époque où la Mongolie extérieure prend son indépendance de la Chine, à la suite de la chute de la dynastie Qing en 1911, des sujets nationaux mongols font leur apparition sous le nom de Mongol zurag dont Marzan Sharav est un maître.\\nIl est souvent crédité pour l'introduction d'un style moderne dans la peinture en Mongolie, mais son œuvre la plus célèbre, Mongolyn neg ödör ou Un jour en Mongolie, aujourd'hui conservée au musée des beaux-arts Zanabazar, à Oulan-Bator, capitale de la Mongolie, est réalisé dans un style plus traditionnel.\\nLe mode de vie mongol y est peint par une alliance de l'esthétique de l'art bouddhiste traditionnel avec le sujet séculier. Ses autres tableaux connus sont les portraits du Bogdo Khan et son épouse, la reine Dondogdulam."},{"page_url":"https://en.wikipedia.org/wiki/George_N._Conrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/George_N_Conrad_1916_square.jpg","page_title":"George N. Conrad","context_page_description":"George Newton Conrad was an American Democratic politician who served as a member of the Virginia Senate, representing the state's 8th district."},{"page_url":"https://fr.wikipedia.org/wiki/Funambulus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Indian_Palm_Squirrel_2013.jpg","page_title":"Funambulus","context_page_description":"Le genre Funambulus, regroupe des écureuils terrestres appelés écureuils palmistes."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B3%B0%E5%BC%8F%E8%BE%A3%E9%86%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Nam_phrik_kapi.JPG","page_title":"泰式辣醬","context_page_description":"泰式辣醬是泰國式辣醬，口味酸酸甜甜、辣度可以依據使用者的喜好自由調整，無固定做法 、甚至連泰國本土的各種辣椒醬的做法也不一樣；但通常成半透明的鮮紅色狀態、有著像凍膠水一樣的黏稠質地，並且在辣醬之中還放有切好的辣椒片、蒜頭末、紅蔥頭、青檸皮的切絲、四歲的九層塔，也會和魚露同蝦醬等混合。"},{"page_url":"https://pt.wikipedia.org/wiki/Leite_de_coco","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Cononut_milk.JPG","page_title":"Leite de coco","context_page_description":"O leite de coco é um produto obtido a partir da trituração e prensagem das amêndoas ou polpa albuminosa do coco maduro, não devendo ser confundido com água de coco. É largamente usado para fins culinários, como nas indústrias de laticínios, sorvetes, doces, iogurtes e biscoitos, destacando-se como sendo, em termos de composição de ácidos graxos, o mais semelhante ao leite materno das fêmeas dos mamíferos humanas.\\nO leite de coco é um ingrediente alimentar muito popular usado no sudeste da Ásia, Sul da Ásia, China meridional, Caribe e Brasil. A cor e o sabor do leite de coco podem ser atribuídas ao elevado teor de óleo. Além disso, é um produto rico em gordura saturada, além de conter vitamina C, B1, B3, B5 e B6, cálcio, selênio, magnésio, fósforo, ferro, potássio, cobre, zinco e manganês e ainda proteína, arginina e ácido láurico."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_nimf%C3%A0lids_de_la_pen%C3%ADnsula_Ib%C3%A8rica_i_Balears","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Melitaea_phoebe_eruga_2.jpg","page_title":"Llista de nimfàlids de la península Ibèrica i Balears","context_page_description":"En la llista a continuació hi figura la totalitat de les espècies de nimfàlids que es poden trobar a la península Ibèrica i les Illes Balears, així com la seva distribució al món, la seva localització al territori peninsular i balear, el seu hàbitat i el seu estat de conservació. N'hi ha unes 6.000 espècies distribuïdes per tot el món, 96 de les quals es poden trobar a la península Ibèrica.\\nAquesta família es caracteritza per tenir només quatre potes funcionals, mentre que l'altre parell, atrofiat, no té cap ús locomotor. Les erugues acostumen a estar recobertes d'espines, llevat dels satirins, que presenten una forma oblonga. Pupen cap per avall fixades pel cremàster o semienterrades al sòl."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B2%D0%BE%D0%BA%D1%80%D0%B8%D0%BB%D0%B8%D1%85_%D0%9F%D0%BE%D0%BB%D1%8C%D1%89%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Schnepfenfliege_Rhagio_scolopaceus2.jpg","page_title":"Список двокрилих Польщі","context_page_description":"Цей список є списком видів двокрилих комах, спостережених на території Польщі. В Польщі зареєстровано 6873 видів двокрилих."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%92%8B%E5%AF%BF%E5%B1%B1%E6%95%85%E5%B1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Former_Residence_of_Jiang_Shoushan_09_2012-10.JPG","page_title":"蒋寿山故居","context_page_description":"蔣壽山故居又稱三條營古建築、蔣百萬宅，位於中國江蘇省南京市秦淮區門東三條營18、20號，為晚清南京富商蔣壽山的故居之一，蔣壽山原在白下區太平巷50號和剪子巷49號另有兩處故居，其中前者已拆除，後者現存中、西兩路廳堂共6座。建築東西分別至雙塘園、陶家巷，南北分別至三條營、陽傘廠，現存東西兩路共七進，東路依次為門廳、轎廳、大廳、正堂和後樓等，西路設有花園，外以封火牆相圍，有觀點認為故居中含有清初李漁所建芥子園故址。建築在修繕前為101戶人家共住的大雜院，南京市秦淮區政府自2010年10月起開始遷出住戶修繕，現仍未完成，修繕後的用途原規劃為高檔商務會所，新規劃則為集博物館、故居園林、街區公園為一體的旅遊景點。"},{"page_url":"https://es.wikipedia.org/wiki/Lefkandi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Protogeometric_building.jpg","page_title":"Lefkandi","context_page_description":"Lefkandi es un sitio arqueológico situado en la desembocadura del río Lelas, en la isla de Eubea, en Grecia. Fue poblado desde la Edad de Bronce y, junto con otras localidades de Eubea, mantuvo intercambios comerciales con diversos lugares del Egeo, del Mediterráneo Central y de Oriente Próximo. Fue destruido en fecha difícil de determinar, probablemente durante una guerra entre las ciudades de Calcis y Eretria denominada Guerra Lelantina."},{"page_url":"https://en.wikipedia.org/wiki/Mahatma_Gandhi_Road_(Kolkata)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Mahatma_Gandhi_Road_-_Strand_Road_View_-_Kolkata_2016-10-11_0591.JPG","page_title":"Mahatma Gandhi Road (Kolkata)","context_page_description":"Mahatma Gandhi Road or M.G. Road, formerly known as Harrison Road, is a principal East-West thoroughfare in Kolkata, the capital of the Indian state of West Bengal. M.G. Road makes the boundary of North and Central Kolkata. In 1889 this was the first street of the city to be lit by electricity."},{"page_url":"https://en.wikipedia.org/wiki/Robert_Latham_Owen","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Robert_Latham_Owen_Park_-_Eccles_Building.JPG","page_title":"Robert Latham Owen","context_page_description":"Robert Latham Owen Jr. was one of the first two U.S. senators from Oklahoma. He served in the Senate between 1907 and 1925.\\nBorn into affluent circumstances in antebellum Lynchburg, Virginia, the son of a railroad company president, Owen suffered an almost Dickensian reversal of fortune when his family was ruined financially by the Panic of 1873 and his father died while he was still in his teens.\\nOwen, who was part-Cherokee on his mother's side, responded by heading west to Indian Territory, where he built a new life as, in turn, a schoolteacher working with Cherokee orphans; a lawyer, administrator and journalist; a federal Indian agent; and the founder and first president of a community bank. Among the achievements that brought him to wider public notice, and helped pave the way for his election to the U.S. Senate in 1907 when Oklahoma achieved statehood, was his success as a lawyer in 1906 in winning a major court case on behalf of the Eastern Cherokees seeking compensation from the U.S. Government for eastern lands the Cherokees had lost at the time of the Indian removals."},{"page_url":"https://ca.wikipedia.org/wiki/Arc_adrianenc","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/SantAdria_01.jpg","page_title":"Arc adrianenc","context_page_description":"La portada gòtica del convent del Carme, molt conegut actualment com a arc adrianenc és una portalada gòtica originària del convent del Carme de Barcelona. Enderrocat el 1874, de les restes del convent, la portada va acabar a la finca de cal Tano a Sant Adrià de Besòs. Actualment és considerat un símbol del municipi."},{"page_url":"https://vi.wikipedia.org/wiki/Andr%C3%A9_the_Giant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Andre_and_Bobby_Heenan.jpg","page_title":"André the Giant","context_page_description":"André René Roussimoff được biết đến nhiều hơn với cái tên André the Giant là một đô vật và diễn viên chuyên nghiệp người Pháp.\\nMối thù nổi tiếng nhất của anh là với Hulk Hogan, đỉnh điểm là tại WrestleMania III vào năm 1987. Vai diễn nổi bật nhất của anh là Fezzik, một quái vật trong phim Nàng dâu công chúa. Kích thước khổng lồ của anh là kết quả của bệnh to cực gây ra bởi hooc-môn tăng trưởng dư thừa, điều này khiến anh được gọi là \\"Kỳ quan thứ 8 của Thế giới\\".\\nTại World Wrestling Federation, Roussimoff một lần vô địch WWF World Heavyweight Championship và một lần WWF Tag Team Championship. Vào năm 1993, anh là người đầu tiên được giới thiệu vào WWE Hall of Fame và sau đó là Professional Wrestling Hall of Fame và ''Wrestling Observer Newsletter'' Hall of Fame."},{"page_url":"https://sv.wikipedia.org/wiki/Tryggve_Holm","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Tryggve_Holm_VD_Saab_med_ok%C3%A4nd_pilot.jpg","page_title":"Tryggve Holm","context_page_description":"Tryggve Holm, född 1905 i Kristinehamn, död 1993, var en svensk industriman, framförallt känd som VD för Saab, Svenska Aeroplan Aktiebolaget, 1950–1967.\\nHolm växte upp på Bofors bruk. Han tog examen som bergsingenjör vid Kungliga tekniska högskolan 1929. Kort därefter utsågs han av Jernkontoret till stipendiat för studier vid Carnegie Institute of Technology och SKF Research Laboratory i USA.\\n1936–1939 var Holm chef för stålverket vid Bofors AB, 1940–1950 VD för AB Svenska Järnvägsverkstäderna, i Linköping. 1950 ersatte Holm Ragnar Wahrgren som VD för Saab. Under Holms tid som VD tillverkade Saab svenska flygvapnets Saab 29 Tunnan och System 37 Viggen. 1953 inleddes Saabs elektronikproduktion, vilket blev början till stordatorproducenten Datasaab. 1967 ersatte Curt Mileikowsky Holm som VD för Saab.\\nHolm var ordförande i Sveriges verkstadsförening 1955–1967 och i SAF, Svenska arbetsgivareföreningen, 1967–1976. År 1986 utnämndes han till teknologie hedersdoktor vid Linköpings universitet."},{"page_url":"https://de.wikipedia.org/wiki/Beutelsbach_(Weinstadt)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Weinstadt-beutelsbach-wappen.png","page_title":"Beutelsbach (Weinstadt)","context_page_description":"Beutelsbach ist ein Stadtteil der Großen Kreisstadt Weinstadt im Rems-Murr-Kreis. Der Stadtteil hat 8821 Einwohner und liegt 236 m ü. NN."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%88%D9%81%D9%8A%D8%AF%D9%8A%D9%88_%D9%87%D9%88%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ovidiu_Hoban.JPG","page_title":"أوفيديو هوبان","context_page_description":"أوفيديو هوبان ‏ هو لاعب كرة قدم. يلعب مع منتخب رومانيا لكرة القدم. سبق له أن لعب في بطولة أمم أوروبا لكرة القدم 2016 مع منتخب بلاده."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%A4%EC%B9%B4%EC%82%AC%EC%B9%B4_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Takasaka_Station_West_Entrance_20120326.JPG","page_title":"다카사카 역","context_page_description":"다카사카 역은 일본 사이타마현 히가시마쓰야마시에 있는 도부 철도 도조 본선 역이다. 역 번호는 TJ 28이다. 부역명은 \\"다이토 문화대학 히가시마쓰야마 캠퍼스 앞\\"이다."},{"page_url":"https://da.wikipedia.org/wiki/Sortsvane","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Cygnus_atratus%2C_pluie.JPG","page_title":"Sortsvane","context_page_description":"Sortsvane er en svaneart, som hovedsageligt yngler i det sydøstlige og sydvestlige Australien. Arten er blevet jaget til udryddelse i New Zealand, men er senere genindført. I Australien er den nomadisk med uregelmæssig træk afhængigt af vejrforholdene. Sortsvanen er en stor fugl med sort fjerdragt og rødt næb. Den er monogam og begge forældre deltager i udrugning af æggene og efterfølgende pleje af ungerne.\\nSortsvaner er siden 1800-tallet indført til mange lande som prydfugle i parker, men er undsluppet og har dannet stabile bestande. Små bestande af sortsvaner findes f.eks. i Storbritannien på Themsen i Buckinghamshire og nær floden Itchen i Hampshire.\\nSortsvanen blev videnskabeligt beskrevet af den engelske naturhistoriker John Latham i 1790. Den blev tidligere placeret i sin egen slægt, Chenopis. Sortsvaner kan optræde alene eller i flokke med hundreder eller endda tusinder af fugle. Sortsvaner er populære fugle i zoologiske haver og fuglesamlinger. Undslupne fugle ses af og til uden for deres naturlige udbredelsesområde."},{"page_url":"https://nl.wikipedia.org/wiki/Gillaum%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Gillaum%C3%A9-Mairie.JPG","page_title":"Gillaumé","context_page_description":"Gillaumé is een gemeente in het Franse departement Haute-Marne en telt 33 inwoners. De plaats maakt deel uit van het arrondissement Saint-Dizier."},{"page_url":"https://la.wikipedia.org/wiki/Alaudidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Melanocorypha_calandra.jpg","page_title":"Alaudidae","context_page_description":"Alaudidae sunt familia avium ordinis Passeriformium. Quibus sunt distributio cosmopolita, maximo specierum numero in Africa invento. Una species, Eremophila alpestris, in America Septentrionali, una quoque, Mirafra javanica, in Australia fit. Habitationes naturales late variant, sed multae species regionibus siccis utuntur."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A6%E0%A4%BF%E0%A4%97%E0%A4%82%E0%A4%AC%E0%A4%B0_%E0%A4%A4%E0%A5%87%E0%A4%B0%E0%A4%BE%E0%A4%AA%E0%A4%82%E0%A4%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Shravanbelgola_Gomateshvara_head_white.jpg","page_title":"दिगंबर तेरापंथ","context_page_description":"Digambara Terapanth एक संप्रदायों के दिगम्बर जैन, दूसरे जा रहा है Bispanthi संप्रदाय है। इसे से बाहर का गठन मजबूत विपक्ष के लिए धार्मिक वर्चस्व के पारंपरिक धार्मिक नेताओं को बुलाया भट्टारक के दौरान 12-16 वीं सदी ए. डी, के लिए bhattarakas शुरू से हटने मूल/Mula जैन, सीमा शुल्क. वे विरोध की पूजा विभिन्न मामूली देवी देवताओं. कुछ Terapanthi प्रथाओं की तरह, का उपयोग नहीं फूल पूजा में धीरे-धीरे फैल के सबसे भर में भारतीय जैन धर्म के रूप में अच्छी तरह से."},{"page_url":"https://no.wikipedia.org/wiki/Jack_Torrance","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Stanley_Kubrick_LACMA_exhibit_-_All_Work_And_No_Play_Makes_Jack_A_Dull_Boy.jpg","page_title":"Jack Torrance","context_page_description":"John Daniel Edward «Jack» Torrance er en fiktiv figur og hovedskurken i Stephen Kings skrekkroman Ondskapens hotell.\\nJack drar sammen med familien sin til et øde hotell for å skrive en roman. Han blir fortalt at det er vanlig at hotellet snør inne i løpet av vinteren, så han og familien må regne med å være totalt isolert i flere måneder. Dette er akkurat hva Jack tror han trenger for å finne inspirasjon og ro til å skrive en ny bok. Sammen med sin kone og sitt barn drar han opp til hotellet like før vinterstengingen for å inntre i jobben. Men etterhvert som tiden går blir han hjemsøkt av fortidens spøkelser og drives etterhvert fullstendig fra vettet.\\nJack Torrance ble spilt av Jack Nicholson i filmen Ondskapens hotell og av Steven Weber i miniserien The Shining. Det amerikanske filminstituttet har kåret filmfiguren i Nicholsons skikkelse til filmhistoriens 25. beste skurkeskikkelse. Hans replikk «Here's Johnny!» ble i 2005 rangert blant de 100 beste replikkene i amerikansk filmhistorie, i kåringen AFI's 100 Years…100 Movie Quotes."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_P%C4%83dureni","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/PadureniCJ2011_%2836%29.JPG","page_title":"Biserica de lemn din Pădureni","context_page_description":"Biserica de lemn din Pădureni, comuna Ciurila, județul Cluj, datează din anul 1730. Are hramul „Sfinții Arhangheli Mihail și Gavriil”. Biserica se află pe noua listă a monumentelor istorice sub codul LMI: cod LMI CJ-II-m-B-07732."},{"page_url":"https://hu.wikipedia.org/wiki/Budapesti_metr%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/MetroBudapest-V%C3%B6r%C3%B6smarty_utca.jpg","page_title":"Budapesti metró","context_page_description":"Budapest metróhálózata Budapest közösségi közlekedési hálózatának legnagyobb kapacitású vonalaiból áll. Az első, a köznyelvben kisföldalattinak nevezett vonala a kontinentális Európa első földalatti vasútja volt. A másik kettő, szovjet technológián alapuló viszonylata az 1970-es és az 1980-as években épült ki. A negyedik vonal átadására 8 éves építést követően 2014-ben került sor. Az ötödik vonal tervezése előkészítés alatt áll. A hálózat összhossza 2014-ben az M4-es metróvonal átadása után 38,6 km-re, az állomások száma pedig 52-re nőtt."},{"page_url":"https://de.wikipedia.org/wiki/6._Juni","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Thomas_Mann_1937.jpg","page_title":"6. Juni","context_page_description":"Der 6. Juni ist der 157. Tag des gregorianischen Kalenders, somit verbleiben 208 Tage bis zum Jahresende."},{"page_url":"https://en.wikipedia.org/wiki/Kaidu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Kaidu_river_yanqi_xinjiang.jpg","page_title":"Kaidu","context_page_description":"Kaidu was the grandson of Mongol Khagan Ogedei Khan and thus leader of the House of Ögedei and the de facto khan of the Chagatai Khanate, a division of the Mongol Empire. He ruled part of modern-day Xinjiang and Central Asia during the 13th century, and actively opposed his cousin, Kublai Khan, who established the Yuan dynasty in China, until Kaidu's death in 1301. Medieval chroniclers often mistranslated Kadan as Kaidu, mistakenly placing Kaidu at the Battle of Legnica. Kadan was the brother of Güyük, and Kaidu's uncle."},{"page_url":"https://de.wikipedia.org/wiki/Flachk%C3%BCste","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Noel2007_erosion.jpg","page_title":"Flachküste","context_page_description":"An einer Flachküste geht das Land allmählich in das Meer über. Flachküsten können entweder durch das Vordringen des Meeres auf flach ansteigendem Land oder durch Abrasion in Lockergesteinen entstehen. Sie lassen sich grundsätzlich in zwei küstenparallele Abschnitte gliedern: die Schorre und den Strand.\\nFlachküsten bestehen aus lockerem Material wie Sand und Kies, der Wind transportiert feine Sandkörner über die Dünen ins Land. Das Meer spült Geröll und Sand von der Küste ab und lagert es an anderen Stellen an."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D9%85%D8%B3%D8%B9%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Djebel_messaad.JPG","page_title":"جبل مسعد","context_page_description":"جبل مسعد الجزاییر اؤلکه‌سینین شهرلریندن بیریدیر. سوْن نۆفوس ساییمینا گؤره شهرین توْپلام جمعیتی ۱۳۹۴۸ نفردیر."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D8%AA%D8%B3%D9%84%D8%A7%D9%88_%DB%8C%DA%A9%D9%85_(%D8%AF%D9%88%DA%A9_%D8%A8%D9%88%D9%87%D9%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ermordung_Wenzels.jpg","page_title":"واتسلاو یکم (دوک بوهم)","context_page_description":"واتسلاو یکم یا واتسلاو خوب از ۹۲۱ تا ۹۳۵ که با نقشهٔ برادرش کشته شد، دوک بوهم بود.\\nشهید شدن او و محبوب بودن چند زندگی‌نامه، باعث افزایش سریع شهرت او شد که در نتیجهٔ آن، به مقام قدیس ارتقا داده‌شد، پس از مرگ شاه خوانده شد و در دولت چک به عنوان قدیس حامی شناخته شد."},{"page_url":"https://uk.wikipedia.org/wiki/%C2%ABThe_%D0%92%D0%B7%D0%B3%D0%BB%D1%8F%D0%B4%C2%BB_%E2%80%94_%D0%B1%D1%96%D1%82%D0%BB%D0%B8_%D0%BF%D0%B5%D1%80%D0%B5%D0%B1%D1%83%D0%B4%D0%BE%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/2011-02-03_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%9F%D1%83%D1%82%D0%B8%D0%BD_%D1%81_%D0%BA%D0%BE%D0%BB%D0%BB%D0%B5%D0%BA%D1%82%D0%B8%D0%B2%D0%BE%D0%BC_%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B3%D0%BE_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB%D0%B0_%287%29.jpeg","page_title":"«The Взгляд» — бітли перебудови","context_page_description":"«„The Взгляд“ — бітли перебудови» — книга Євгена Додолєва про програму «Взгляд», «в якій детально аналізується феномен найуспішнішого російського телепроекту». Слоган «Вони грали на кремлівських нервах». Це оповіді «про ведучих „Взгляду“, які нашпиговані телебайками і розвінчують деякі міфи про телепрограму»."},{"page_url":"https://es.wikipedia.org/wiki/Albissola_Marina","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Map_of_comune_of_Albissola_Marina_%28province_of_Savona%2C_region_Liguria%2C_Italy%29.svg","page_title":"Albissola Marina","context_page_description":"Albissola Marina es un municipio situado en el territorio de la Provincia de Savona, en Liguria."},{"page_url":"https://id.wikipedia.org/wiki/Stasiun_Sudirman","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Under_maintenance_elevator%2C_Sudirman_station.jpg","page_title":"Stasiun Sudirman","context_page_description":"Stasiun Sudirman merupakan stasiun kereta api kelas I yang terletak di Menteng, Jakarta Pusat. Stasiun yang terletak di Jalan Kendal No. 1 dan dahulu terletak pada ketinggian +5,65 m ini termasuk dalam Daerah Operasi I Jakarta dan hanya melayani rute KRL Commuter Line. Nama stasiun ini diambil dari Jalan Sudirman. Stasiun ini memang terletak di sayap timur jalan ini.\\nDalam rencana pembangunan jalur transportasi massal di Jakarta, Stasiun Sudirman direncanakan menjadi stasiun pusat dan awal menuju Terminal Lebak Bulus. Stasiun ini juga akan terhubung dengan stasiun MRT dan antarmoda bagi seluruh jenis angkutan di DKI Jakarta. Stasiun Sudirman juga menjadi stasiun yang dekat dengan akses Transjakarta Busway koridor 1, koridor 4 dan koridor 6. Ke arah barat stasiun ini, sebelum Stasiun Karet, terdapat stasiun yang khusus diperuntukkan bagi kereta api bandara, yaitu BNI City; letaknya di sayap barat Jalan Jenderal Sudirman.\\nStasiun ini umumnya sangat ramai pada hari Senin hingga Jumat menjelang jam masuk kerja, pukul 09.00, dan pada jam pulang kerja yaitu pukul 17.00."},{"page_url":"https://gl.wikipedia.org/wiki/As_cincuenta_e_tres_estaci%C3%B3ns_de_T%C5%8Dkaid%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Hiroshige24_shimada.jpg","page_title":"As cincuenta e tres estacións de Tōkaidō","context_page_description":"As cincuenta e tres estacións de Tōkaidō son unha serie de gravados ukiyo-e creados por Utagawa Hiroshige despois da súa primeira viaxe ó longo de Tōkaidō en 1832. Esta estrada, que conectaba a capital do shōgun coa capital imperial constituía unha das principais arterias do antigo Xapón. Tamén era a máis importante das Cinco Rutas de Edo, as cinco máis importantes estradas do Xapón, creadas e desenvolvidas durante o Período Edo co obxectivo de conceder á administración central do Shogunato un maior control sobre todo o país. Malia que a edición Hōeidō era a máis coñecida, As cincuenta e tres estacións de Tokaido constituía un tema tan popular que iso permitiu a Hiroshige poder crear unha serie de 30 gravados en madeira distinta da orixinal polo seu tamaño, os seus deseños ou mesmo o número de gravados feitos.\\nA Edición Hōeidō da Tōkaidō é a obra mellor coñecida de Hiroshige, e á vez as estampas xaponesas ukiyo-e mellor vendidas. Vén xusto despois da serie Trinta e seis vistas do monte Fuji de Katsushika Hokusai, obra que estabeleceu esta nova temática principal do ukiyo-e, os gravados paisaxísticos, ou fūkei-ga, cun enfoque especial nas \\"vistas famosas\\"."},{"page_url":"https://en.wikipedia.org/wiki/Maraba_coffee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/MarabaBeanSorting1.jpg","page_title":"Maraba coffee","context_page_description":"Maraba coffee is grown in the Maraba area of southern Rwanda. Maraba's coffee plants are the Bourbon variety of the Coffea arabica species and are grown on fertile volcanic soils on high-altitude hills. The fruit is handpicked, mostly during the rainy season between March and May, and brought to a washing station in Maraba, where the coffee beans are extracted and dried. At several stages, the beans are sorted according to quality. The farmers receive credits based on the amount and quality of the beans they provide.\\nThe beans are sold to various roasting companies, with the best beans going to Union Coffee Roasters of the United Kingdom, who produce a Fairtrade-certified brand and Community Coffee of the United States. Rwanda Smallholder Specialty Coffee Company buys from Maraba and sells to the domestic market. Maraba coffee is also brewed into a beer.\\nAbout 2,000 smallholder farmers grow the coffee plants under the Abahuzamugambi cooperative, founded in 1999. Since 2000, the cooperative has been supported by the National University of Rwanda and the PEARL. The cooperative has improved coffee quality and penetrated the speciality market."},{"page_url":"https://fr.wikipedia.org/wiki/Dioc%C3%A8se_de_Vitebsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Church_of_the_Merciful_Jesus_in_Viciebsk_-_panoramio.jpg","page_title":"Diocèse de Vitebsk","context_page_description":"Le diocèse de Vitebsk est un diocèse catholique de Biélorussie de rite latin de la province ecclésiastique de Minsk-Moguilev dont le siège est situé à Vitebsk, dans le voblast de Vitebsk. L'évêque actuel est Aleh Butkevich, depuis 2013."},{"page_url":"https://no.wikipedia.org/wiki/Alessandro_Ballan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Alessandro_Ballan_%28Tour_de_France_2009_-_Stage_17%29.jpg","page_title":"Alessandro Ballan","context_page_description":"Alessandro Ballan er en italiensk syklist. Han har vært profesjonell siden 2004. Selv om han hadde en kroppsbyggning som en klatrer, etablerte Ballan seg som en av de beste rytterne i vårklassikerne i årene mellom 2005 og 2012, med seier i Flandern rundt 2007 som sin største seier i denne rittkategorien.\\nTil tross for en fin amatørkarriere var ikke Ballan særlig ettertraktet hos profflagene. I hans første sesong fungerte han som domestique for Romans Vainsteins og Gianluca Bortolami, og det var ikke før i 2005 sesongen at Ballan fikk muligheten til å satse på topp-plasseringer i vårklassikerne og på etapper i større ritt. Sent i 2005 sesongen tok han sin første ProTour seier etter å ha vunnet den 4. etappen av Eneco Tour of Benelux.\\nI 2007 knakk Ballan kragebeinet under Tirreno-Adriatico. Til tross for skaden gjorde han en god innsats under Milano-Sanremo selv om lagets kaptein Daniele Bennati ikke vant rittet. Den 8. april vant Ballan Flandern rundt etter å ha spurtbeslått belgiske Leif Hoste som tok sin andre strake andreplass i rittet.\\nI 2008 vant han den 7. etappen i Vuelta a España, og overtok den gyldne ledertrøya for en dag."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BF%A1%E6%BF%83%E5%90%89%E7%94%B0%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Nagano_Tokyu_LIFE.jpg","page_title":"信濃吉田駅","context_page_description":"信濃吉田駅は、長野県長野市吉田三丁目にある長野電鉄長野線の駅。駅番号はN7。一部の特急列車と普通列車が停車する。"},{"page_url":"https://tr.wikipedia.org/wiki/Transdinyester_rublesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/50_Kupon_Ruble_Reverse.jpg","page_title":"Transdinyester rublesi","context_page_description":"Transdinyester'de geçerli olan ve 100 kopek biçiminde olan ruble. Transdinyester sınırlı şekilde tanınan devlet olduğundan, paranın ISO 4217 kodu yok. Ancak, Agroprombank ve Gazprombank gibi bazı resmi olmayan Transdinyester organizasyonları PRB kodunu kullandı. Trans-Dinyester Cumhuriyet Bankası bazen RUP kodunu kullanır."},{"page_url":"https://pt.wikipedia.org/wiki/Tapar%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Porto_de_Moz_-_State_of_Par%C3%A1%2C_Brazil_-_panoramio.jpg","page_title":"Tapará","context_page_description":"1°36'54\\"S, 52°3'29\\"W\\nTapará, ou Vila Tapará, é uma comunidade do município de Porto de Moz, estado do Pará, no Brasil. Dista da sede do município cerca de 15 quilômetros.\\nEm 1904, Tapará era uma das circunscrições do primeiro distrito da recém criada comarca do Xingu, com sede em Porto de Moz. No mesmo ano, pela lei municipal nº 12, de 31 de dezembro de 1904, é criado o distrito de Tapará, e anexado ao município de Porto de Moz. Em divisão administrativa datada de 1911, Tapará é um dos cinco distritos de Porto de Moz, juntamente com Porto de Moz, Vilarinho do Monte, Veiros e Pombal. Em 1937, em divisão territorial datada de 31 de dezembro desse ano, Tapará ainda surge como distrito de Porto de Moz, mas o decreto lei estadual nº 2972, de 31 de março de 1938, viria a extinguir aquele distrito, anexando o seu território ao distrito sede de Porto de Moz. O território seria posteriormente desanexado do distrito sede, e integrado no de Vilarinho do Monte."},{"page_url":"https://fr.wikipedia.org/wiki/Tour-en-Bessin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Nef_de_l%27%C3%A9glise_Saint-Pierre_de_Tour-en-Bessin.jpg","page_title":"Tour-en-Bessin","context_page_description":"Tour-en-Bessin est une commune française, située dans le département du Calvados en région Normandie, peuplée de 658 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Asad_Ali_Khan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Asad_Ali_Khan.jpg","page_title":"Asad Ali Khan","context_page_description":"Asad Ali Khan was an Indian musician who played the plucked string instrument rudra veena. Khan performed in the style dhrupad and was described as the best living rudra veena player in India by The Hindu. He was awarded the Indian civilian honor Padma Bhushan in 2008."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%BE%D0%B4_%D0%94%D0%B0%D0%BD%D1%81%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kinggeorgev1928.jpg","page_title":"Александра од Данске","context_page_description":"Краљица Александра од Данске била је супруга краља Едварда VII од Уједињеног Краљевства и царица Индије. Њихов син је био краљ Џорџ V.\\nЊена породица је била сразмерно непозната све док њен отац, принц Кристијан од Шлезвиг-Холштајн-Сондербург-Гликсбурга, није био изабран, уз сагласност великих сила, за наследника свог далеког рођака, Фредерика VII, на данском престолу. Са шеснаест година била је изабрана за будућу супругу Алберта Едварда, принца од Велса, наследника краљице Викторије. Брак је крунисан осамнаест месеци касније, крајем 1863. године, исте године када је њен отац Кристијан постао краљ Данске, а брат Џорџ крунисан за краља Грчке. Александра је од 1863. до 1901. године носила титулу принцезе од Велса, што је најдужи перион ношења ове титуле. Постала је популарна у друштву, а њен стил одевања био је узор многобројним дамама."},{"page_url":"https://pl.wikipedia.org/wiki/Psitakozaur","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Psittacosaurus_Scale.svg","page_title":"Psitakozaur","context_page_description":"Psitakozaur – rodzaj prymitywnego ceratopsa z rodziny psitakozaurów. Jego nazwa oznacza „papuzi jaszczur” – odnosi się do kształtu jego dzioba, przypominającego dziób papugi. Psittacosaurus występował na terenach współczesnej Azji ok. 130-100 mln lat temu. Obecnie znamy ponad dziesięć gatunków należących do tego rodzaju. Zwierzęta te charakteryzowały się mocnym dziobem. Były roślinożercami wielkości gazeli. Psittacosaurus był jednym z najprymitywniejszych ceratopsów. Psitakozaur żył w Chinach, Mongolii, Rosji i być może Tajlandii. Obecnie znaleziono 400 skamielin psitakozaura, w tym wiele kompletnych szkieletów. Dzięki temu psitakozaur jest obecnie jednym z najlepiej poznanych marginocefali. Znaleziono ponadto szkielety osobników w różnym wieku – od świeżo wyklutego pisklęcia po osobnika w pełni dorosłego, co umożliwiło dokładne zbadanie przebiegu życia psitakozaura i jego obyczajów rozrodczych."},{"page_url":"https://it.wikipedia.org/wiki/Cretacico","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Pteranodon_longiceps_mmartyniuk_wiki.png","page_title":"Cretacico","context_page_description":"Nella scala dei tempi geologici, il Cretacico o Cretaceo, corrisponde al terzo e ultimo periodo dell'era Mesozoica. È compreso tra 145,5 ± 4,0 e 65,5 ± 0,3 milioni di anni fa, preceduto dal Giurassico e seguito dal Paleogene, il primo periodo della successiva era Cenozoica o Terziaria.\\nPer la sua durata, di circa 80 milioni di anni, è il più lungo periodo dell'eone Fanerozoico ed è anche più lungo dell'intera era successiva del Cenozoico, il quale include il periodo attuale. Viene comunemente suddiviso in due epoche, il Cretacico inferiore e il Cretacico superiore. Questo periodo inizia dalla comparsa dell'ammonite Berriasella jacobi e termina in corrispondenza dell'anomalia dell'iridio associata all'estinzione di massa di numerosi organismi marini e terrestri."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%93%D7%95%D7%90%D7%99%D7%9D_%D7%91%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Rahat_Bus_Galim.jpg","page_title":"בדואים בישראל","context_page_description":"הבדואים בישראל הם אחת מהקבוצות האתניות הערביות בחברה הישראלית שמאמינות בדת האסלאם.\\nהבדואים מהווים כ-3.5% מאוכלוסיית ישראל."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%AF%D9%88%D8%A7%D8%B1%D8%AF_%D9%87%D8%A7%D9%83%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Eduard_Hackel2.jpg","page_title":"إدوارد هاكل","context_page_description":"إدوارد هاكل ‏ هو عالم نبات نمساوي."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_Niemiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Mauer-sandgrube.jpg","page_title":"Historia Niemiec","context_page_description":"Historia Niemiec – obejmuje dzieje państwa i narodu niemieckiego.\\nPlemiona germańskie wywodziły się prawdopodobnie z południowej Skandynawii i północnych Niemiec. Od I wieku p.n.e. osiedlały się na terenie współczesnych Niemiec, w następnym stuleciu skutecznie opierając się ekspansji Imperium Rzymskiego. W III w. n.e. na teren Niemiec przybyły kolejne plemiona germańskie, które zaczęły od tego czasu próby ekspansji na tereny rzymskie. Na skutek konsolidacji plemion i osłabienia państwa rzymskiego większość ziem zachodniego cesarstwa znalazła się pod ich panowaniem.\\nW roku 800 król Franków Karol Wielki został koronowany na cesarza zachodniorzymskiego, jednak jego imperium zostało podzielone już w 843 roku na podstawie traktatu w Verdun. Od tamtego czasu tytuł cesarski zanikał i pojawiał się, ostatecznie pozostając przy władcach wschodniej części podzielonego kraju, którzy przyjęli z czasem tytuł królów Niemiec. Ostateczne odnowienie tytułu cesarskiego królów Niemiec nastąpiło w 962 r., a cesarstwo rozpoczęło ekspansję na północną Italię i Burgundię, a także na ziemie zachodniosłowiańskie."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B1%9F%E8%8B%8F%E7%9C%81%E6%B3%B0%E5%B7%9E%E4%B8%AD%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Taizhou_High_School_of_Jiangsu_Province_02_2012-10.JPG","page_title":"江苏省泰州中学","context_page_description":"江蘇省泰州中學創辦於1902年，前身是在宋代胡瑗講學舊址上創立的泰州學堂。原本部、現老校區內，存有古蹟安定書院。學校先後被評為江蘇省屬重點中學、國家級示範高中、江蘇省四星級高中。\\n建校以來三易其址、兩度搬遷，現有迎春西路老校區和海軍東路新校區兩個校區。迎春西路老校區是學校辦學的源頭，也是泰州千年文脈的根基，占地面積60畝，建築面積2.4萬平方米。1996年地級泰州市成立後投資建設迎春東路校區並於1999年搬遷啟用。隨著辦學規模的不斷擴大，2016年秋學期，學校整體搬遷至位於泰州南部新城的海軍東路新校區。新校區按三個年級20軌60個班級的全寄宿制現代化高中規劃建設，占地面積303畝，總建築面積15.1萬平方米，總投資近11億元，辦學條件達到全國一流水準。學校現有53個班級，學生2700餘人，教職工266人，其中正高級教師14人，特級教師11人，市直級以上骨幹教師69人，具有研究生學歷教師100多人。以「明體達用」為校訓，以「體用兼備、平實有為」為辦學主張，以「體貌明亮、知能達用」為育人目標，不斷提升教育教學質量。近三年共有800多名學生獲國家、省、市級各類獎項。每年都有一大批學生錄取清華大學、北京大學、復旦大學、上海交通大學、香港大學、多倫多大學、倫敦大學學院等海內外知名高校。"},{"page_url":"https://ro.wikipedia.org/wiki/Boumagueur","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Boumagueur.jpg","page_title":"Boumagueur","context_page_description":"Boumagueur este o comună din provincia Batna, Algeria.\\nPopulația comunei este de 8.474 de locuitori."},{"page_url":"https://es.wikipedia.org/wiki/Bernardo_Ansprando","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/BERNARDO_DE_PLATONI.jpg","page_title":"Bernardo Ansprando","context_page_description":"Bernardo Ansprando es mencionado como el segundo hijo del rey Desiderio de los lombardos, en fuentes bibliográfícas hasta el siglo XIX.​​​​ También es mencionado como Everardo, Berardo o Bernardo, ​ al que se distingue de otro tercer hijo de Desiderio llamado Ansprando, abad de San Vicente de Milán.​​​\\nEstas fuentes indican que cuando Carlomagno venció a Desiderio, hizo encarcelar a Bernardo en Francia, y que fue en época Ludovico Pío cuando fue liberado y se le permitió volver a Italia, ​ a los antiguos dominios familiares en Angiera, en título de conde, así como su nombramiento como marqués de Ivrea.​\\nSe le asigna a Bernardo Ansprando los siguientes hijos:​\\nOtón\\nBerengario\\nHugo\\nFalco\\nFacio\\nGuido\\nNo obstante lo anterior, el rey Desiderio no tuvo un hijo llamado Bernardo.​ Además, la marca de Ivrea fue establecida con ocasión de las luchas entre Berengario de Friuli y Guido de Spoleto posteriormente al año 887.​ Y los orígenes lombardos del condado de Angera es algo rechazado desde el siglo XIX, ​​ y el feudo fue no elevado a condado hasta 1397 por Gian Galeazzo Visconti.​​​"},{"page_url":"https://en.wikipedia.org/wiki/Mweelrea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Mweelrea_%26_Ben_Lugmore_from_massif_of_Leenane_Hill.jpg","page_title":"Mweelrea","context_page_description":"Mweelrea at 814 metres, is the 26th-highest peak in Ireland on the Arderin scale, and the 34th-highest peak on the Vandeleur-Lynam scale. Mweelrea is situated near the apex of a \\"horseshoe-shaped\\" massif that includes the peaks of Ben Lugmore and Ben Bury, and which is located between Killary Harbour and Doo Lough, in Mayo, Ireland. Mweelrea is the provincial top for Connacht, and is noted for its southeastern cliff lined corries, and its views. The massif is called the Mweelrea Mountains or the Mweelrea Range."},{"page_url":"https://pl.wikipedia.org/wiki/Saska_K%C4%99pa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Warsaw_Wa%C5%82_Miedzeszy%C5%84ski_estakady.jpg","page_title":"Saska Kępa","context_page_description":"Saska Kępa – osiedle i obszar MSI w dzielnicy Praga-Południe w Warszawie.\\nSaska Kępa ma status osiedla z własnym samorządem i pod względem administracyjnym stanowi część dzielnicy Praga-Południe, w ramach której sąsiaduje z Kamionkiem, Grochowem i Gocławiem. Przez część osób Saska Kępa jest potocznie określana jako dzielnica. Część Saskiej Kępy jest wpisana do wojewódzkiego rejestru zabytków jako strefa ochrony konserwatorskiej."},{"page_url":"https://es.wikipedia.org/wiki/Metopium_toxiferum","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Metopium_toxiferum.jpg","page_title":"Metopium toxiferum","context_page_description":"Metopium toxiferum es una especie de árbol de zumaque perteneciente a la familia Anacardiaceae, que es originario de los neotrópicos."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D8%B9%D8%B1%D9%8A%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/ElArish.jpg","page_title":"العريش","context_page_description":"العريش مدينة تقع على شط البحر المتوسط، شمال شرق سينا فى مصر، وهي عاصمة محافظة شمال سيناء."},{"page_url":"https://en.wikipedia.org/wiki/Black_Lake_(Louisiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Abandoned_stone_structure_at_Black_Lake_%28LA%29_IMG_7295.JPG","page_title":"Black Lake (Louisiana)","context_page_description":"Black Lake is a reservoir located between Creston and Campti in North Louisiana. Water feeds into Black Lake from Black Lake Bayou, a watershed that extends from north of Gibsland in Bienville Parish and south to Clarence in Natchitoches Parish through the parishes of Claiborne, Webster, Bienville, Red River and Natchitoches. The elevation of the lake is 102 feet. Louisiana Highway 9 runs across Black Lake. On the west side of Highway 9 the body of water is called Black Lake — the east is called Clear Lake or Clear Lake Bayou. The Clear Lake side is near another body of water: Saline Lake. Between Clear Lake and Saline Lake is the Alan Chiverly Dam, constructed in 1934. Road 1226 also extends between the lakes. The full area of the lake is 13,500 acres. Black Lake itself is shallow so in cold temperatures the fish head to Clear Lake and continue on towards Black Bayou as the weather gets colder so that in colder months the fish can be found only in deeper waters. Most of the crappie found at Black Lake are black crappie.\\nResidents about Black Lake use the Campti and Clarence ZIP Codes, 71411 and 71414, respectively. They are zoned to Lakeview Junior/Senior High School."},{"page_url":"https://id.wikipedia.org/wiki/Moirai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/The_Three_Fates.jpg","page_title":"Moirai","context_page_description":"Moirai dalam mitologi Yunani adalah tiga orang dewi takdir. Mereka mengendalikan nasib setiap manusia sejak lahir hingga mati. Dalam mitologi Romawi dikenal sebagai Parkae atau Fata."},{"page_url":"https://ca.wikipedia.org/wiki/Oficial_de_Vol","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Flying_Officer_of_IAF.png","page_title":"Oficial de Vol","context_page_description":"Oficial de Vol és un rang d'oficial inferior que es creà al Reial Servei Aeri Naval i continua emprant-se a la Royal Air Force. El rang també és emprat per les forces aèries de diversos països que tenen una influència històrica britànica, incloent diversos països de la Commonwealth. Se situa entre els rangs d'Oficial de Vol i el de Cap d'Esquadró.\\nTé codi OTAN OF-1, i és equivalent a sotstinent a la Royal Navy i de tinent a l'Exèrcit i als Royal Marines.\\nEl rang equivalent al Women's Auxiliary Air Force, al Women's Royal Air Force i al Princess Mary's Royal Air Force Nursing Service és el de section officer."},{"page_url":"https://ast.wikipedia.org/wiki/Asimina_triloba","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Asimina_triloba3.jpg","page_title":"Asimina triloba","context_page_description":"Asimina triloba Dun., asimina, pawpaw o banano de monte ye la única especie perteneciente a la familia de les anonácees que vive fuera de los climes tropicales. La so distribución xeográfica engloba partir esti d'Estaos Xuníos."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%95%BF%E8%80%81%E4%BC%9A%E4%B8%89%E4%B8%80%E5%A0%82_(%E6%97%A7%E9%87%91%E5%B1%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Trinity_Presbyterian_Church_%28San_Francisco%2C_CA%29.JPG","page_title":"长老会三一堂 (旧金山)","context_page_description":"长老会三一堂是一座历史建筑，长老会教堂，位于美国加州旧金山23街 3261号。\\n该堂建于1891年，罗曼式风格。1982年列入国家史迹名录。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schulen_mit_Matura_in_%C3%96sterreich","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Stift_Lambach_Erweiterung.jpg","page_title":"Liste der Schulen mit Matura in Österreich","context_page_description":"Die Liste der Schulen mit Matura in Österreich listet Schulen in Österreich, welche zur Matura führen."},{"page_url":"https://en.wikipedia.org/wiki/History_of_War_in_Afghanistan_(2001%E2%80%93present)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/DeltaSBSTora.jpg","page_title":"History of War in Afghanistan (2001–present)","context_page_description":"It currently runs through 2017."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF_IV_%D0%BE%D0%B4_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D1%81%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bust_of_Philippe_le_Bel_SaintDenis.jpg","page_title":"Филип IV од Француске","context_page_description":"Филип IV Лепи је био краљ Француске из династије Капета.\\nУништио је темпларе и протерао је Јевреје да би се домогао њиховог блага. Седиште папа је преселио из Рима у Авињон и успева да постави Француза Клемента V за папу. Брзо после његове смрти династија Капет остаје без мушких наследника."},{"page_url":"https://hr.wikipedia.org/wiki/Industrijska_revolucija","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Franklin-Benjamin-LOC.jpg","page_title":"Industrijska revolucija","context_page_description":"U drugoj polovici XVIII. stoljeća ručna se proizvodnja počela zamjenjivati parnim strojevima. Time je počeo razvoj koji je od kraja 18. do sredine 19. stoljeća temeljito izmijenio ranije političke, gospodarske i društvene sustave u većem dijelu svijeta. Počela je Prva industrijska revolucija."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B9%85%E7%B1%B3%E5%B7%9D%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Kumegawa_Station_20160322.jpg","page_title":"久米川站","context_page_description":"久米川站是位于日本东京都东村山市荣町，属于西武铁道新宿线的铁路车站。车站编号是SS20。\\n虽然以东村山市的“久米川町”为地名，但是此站不是最近的车站，相邻的东村山站才是最近的。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-l%27Assomption_des_Tourreilles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%C3%89glise_Notre-Dame-de-l%27Assomption_des_Tourreilles_08.jpg","page_title":"Église Notre-Dame-de-l'Assomption des Tourreilles","context_page_description":"L'église Notre-Dame-de-l'Assomption des Tourreilles est une église catholique située aux Tourreilles, dans le département français de la Haute-Garonne en France."},{"page_url":"https://sv.wikipedia.org/wiki/Coast_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Coast_Air_ATR-42_LN-FAP.JPG","page_title":"Coast Air","context_page_description":"Coast Air var ett norskt flygbolag med Haugesund Lufthavn Karmøy som huvudbas. Flygbolaget startade 1975 och var Norges tredje största flygbolag efter Braathens och Norwegian Air Shuttle tills det lades ner 23 januari 2008. Coast Air hade dagliga turer mellan nio destinationer. De var Stord, Sandefjord, Røros, Oslo, Fagernes, Bergen, Köbenhamn och Gdansk. Dessutom flögs även en del charter och frakt. Flygplanen som Coast Air använde var British Aerospace Jetstream 31 och 32EP som tar 19 passagerare, plus en Jetstream 32 i VIP-version med plats för 10 passagerare samt tre st ATR 42-320 som har plats för 48 passagerare.\\nVD var Kjell Fredheim, Kommersiell chef Vigleik Dueland.\\nCoast Air fick ny design 2005."},{"page_url":"https://es.wikipedia.org/wiki/Suiza","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/ILO_Geneva.JPG","page_title":"Suiza","context_page_description":"Suiza, oficialmente la Confederación Suiza, es un país sin salida al mar ubicado en Europa central y que cuenta con una población de 8 500 000 habitantes.​ Suiza es una república federada de 26 estados, llamados cantones y cuenta con cuatro idiomas oficiales: alemán, francés, italiano y romanche. Berna es la sede de las autoridades federales, mientras que el sector privado del país está más desarrollado en las ciudades de Zúrich, Basilea y Ginebra.​ Suiza es el cuarto país más rico del mundo, según su PIB per cápita, con 83 718 dólares estadounidenses.​\\nLimita al norte con Alemania, al oeste con Francia, al sur con Italia y al este con Austria y Liechtenstein. Se caracteriza diplomáticamente por su política de relaciones exteriores neutral, sin haber participado activamente en ningún conflicto internacional desde 1815."},{"page_url":"https://lv.wikipedia.org/wiki/Erki_Pitseps","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Erki_P%C3%BCtsep.JPG","page_title":"Erki Pitseps","context_page_description":"Erki Pitseps ir Igaunijas riteņbraucējs. Pitseps ir trīskārtējs Igaunijas čempions šosejas grupas braucienā, 2007. gadā uzvarējis arī E.O.S. Tallinn GP sacensībās, bet 2011. gadā Baltijas ceļa velobrauciena kopvērtējumā.\\nČetras sezonas aizvadījis profesionālajā AG2R Prévoyance komandā, kuras sastāvā startējis arī 2007. gada Vuelta a España, izstājoties 17. posmā. Pēc tam divas sezonas aizvadītas Bouygues Télécom, kuras sastāvā finišējis arī 2007. gada Vuelta a España. Igaunijas komandas sastāvā startējis 2000 un 2004. gada olimpiskajās spēlēs.\\nKarjeru noslēdzis Latvijas komandā Alpha Baltic-Maratoni.lv."},{"page_url":"https://it.wikipedia.org/wiki/Classe_Asashio_(cacciatorpediniere)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/014104_25_mm_type_96_at_Buna.jpg","page_title":"Classe Asashio (cacciatorpediniere)","context_page_description":"La classe Asashio di dieci cacciatorpediniere di squadra appartenne alla Marina imperiale giapponese e cominciò a entrare in servizio nel 1937. Si trattava di navi costruite senza tenere conto dei limiti imposti dal trattato navale di Londra dell'aprile 1930, che riproponevano il modello di cacciatorpediniere \\"Tipo speciale\\" armato con sei cannoni da 127 mm, numerosi tubi lanciasiluri per ordigni da 610 mm e un potente impianto propulsivo. Gli esemplari traevano inoltre beneficio dalle lezioni apprese con le classi precedenti circa solidità, robustezza e stabilità dello scafo; problemi riguardanti il raggio di virata e malfunzionamenti tecnici delle nuove turbine furono risolti con successo entro il 1941, mentre la modestia dell'autonomia, in caso di battaglie e manovre di combattimento, rimase sempre insoddisfacente."},{"page_url":"https://es.wikipedia.org/wiki/Baraigne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Blason_ville_fr_Baraigne_%28Aude%29.svg","page_title":"Baraigne","context_page_description":"Baraigne es una población y comuna francesa, en la región de Languedoc-Rosellón, departamento de Aude, en el distrito de Carcasona y cantón de Salles-sur-l'Hers."},{"page_url":"https://hu.wikipedia.org/wiki/Radiofarmakon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/First_technetium-99m_generator_-_1958.jpg","page_title":"Radiofarmakon","context_page_description":"Radiofarmakonnak nevezünk minden olyan radionukliddal jelölt szerv-, szövet- vagy funkcióspecifikus vegyületet, melyet élő szervezetbe juttatva diagnosztikus, terápiás, illetve kutatási célokra használunk fel. A radiofarmakonokat gyógyászatban az orvostudomány egy külön ágazata, a nukleáris medicina alkalmazza.\\nCsoportosíthatjuk őket az általuk tartalmazott radioaktív izotóp szerint, ezek között megkülönböztethetünk gammasugárzókat, röntgensugárzókat, pozitron- és negatív bétasugárzókat, valamint alfasugárzókat."},{"page_url":"https://fr.wikipedia.org/wiki/Monuments_nationaux_de_Mostar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Kriva_%C4%86uprija.jpg","page_title":"Monuments nationaux de Mostar","context_page_description":"Cet article recense les monuments nationaux situés sur le territoire de la Ville de Mostar en Bosnie-Herzégovine et dans la Fédération de Bosnie-et-Herzégovine. La liste établie par la Commission pour la protection des monuments nationaux compte 42 monuments nationaux inscrits sur la liste principale et 24 monuments inscrits sur une liste provisoire."},{"page_url":"https://no.wikipedia.org/wiki/Lyngsalpan","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Lyngsalpan-4.jpg","page_title":"Lyngsalpan","context_page_description":"Lyngsalpan er et fjellområde i kommunene Balsfjord, Lyngen, Storfjord og Tromsø, alle i Troms og Finnmark fylke. Området er vernet som Lyngsalpan landskapsvernområde, som utgjør størstedelen av Lyngenhalvøya. I den sørlige delen ligger Jiehkkevárri, som også er det høyeste fjellet i Troms."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%BE%D8%B3_%D9%87%DB%8C%DA%86%E2%80%8C%DA%A9%D8%AF%D8%A7%D9%85_%D8%A8%D8%A7%D9%82%DB%8C_%D9%86%D9%85%D8%A7%D9%86%D8%AF%D9%86%D8%AF_(%D9%85%D8%AC%D9%85%D9%88%D8%B9%D9%87_%D8%AA%D9%84%D9%88%DB%8C%D8%B2%DB%8C%D9%88%D9%86%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Miranda_Richardson_Met_Opera_2010_Shankbone.jpg","page_title":"سپس هیچ‌کدام باقی نماندند (مجموعه تلویزیونی)","context_page_description":"سپس هیچ‌کدام باقی نماندند نام مینی سریال سه قسمتی پخش شده از بی‌بی‌سی وان است که داستان سپس هیچ‌کدام باقی نماندند از آگاتا کریستی را روایت می‌کند. این مینی سریال در سه قسمت در روزهای ۲۶، ۲۷، و ۲۸ دسامبر ۲۰۱۵ پخش شد.داستان این مینی سریال از رمان سپس هیچ‌کدام باقی نماندند آگاتا کریستی می‌باشد که خود شاهکاری در سبک رمان‌های معمایی و جناییست و این فیلم را در دستهٔ بهترین فیلم‌های معمایی_جنایی قرار میدهد."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_d%27Ille-et-Vilaine","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Forges_de_Paimpont04.JPG","page_title":"Liste des monuments historiques d'Ille-et-Vilaine","context_page_description":"Cet article recense les bâtiments protégés au titre des monuments historiques d’Ille-et-Vilaine, en France.\\nPour les monuments historiques de la commune de Fougères, voir la liste des monuments historiques de Fougères\\nPour les monuments historiques de la commune de Rennes, voir la liste des monuments historiques de Rennes\\nPour les monuments historiques de la commune de Saint-Malo, voir la liste des monuments historiques de Saint-Malo\\nPour les monuments historiques de la commune de Vitré, voir la liste des monuments historiques de Vitré"},{"page_url":"https://fi.wikipedia.org/wiki/Ford_Fiesta_(1983)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Ford_Fiesta_front_20070920.jpg","page_title":"Ford Fiesta (1983)","context_page_description":"Ford Fiesta II on Ford Fiestan toinen sukupolvi, jota valmistettiin vuosina 1983–1989."},{"page_url":"https://id.wikipedia.org/wiki/Polyplacophora","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Tonicella_lineata_1.jpg","page_title":"Polyplacophora","context_page_description":"Polyplacophora adalah kelas dari anggota hewan tak bertulang belakang yang termasuk dalam filum Mollusca. Contoh yang terkenal dari kelas ini adalah Chiton sp.."},{"page_url":"https://pl.wikipedia.org/wiki/Wojskowa_Akademia_Medyczna","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Wojskowa_Szko%C5%82a_Sanitarna-odznaka_1922-39.jpg","page_title":"Wojskowa Akademia Medyczna","context_page_description":"Wojskowa Akademia Medyczna im. gen. dyw. Bolesława Szareckiego – nieistniejąca obecnie akademia wojskowa, działająca w latach 1957–2003 w Łodzi, która kształciła żołnierzy – oficerów wojskowej służby zdrowia dla potrzeb SZ PRL i SZ RP, ale także dla sił zbrojnych innych państw. W 1975 uczelni nadano imię gen. dyw. Bolesława Szareckiego."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_singles_n%C3%BAmero_um_na_Billboard_Hot_100_em_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Drake_and_Future_2016_Summer_Sixteen_Tour.jpg","page_title":"Lista de singles número um na Billboard Hot 100 em 2016","context_page_description":"A lista dos singles que alcançaram a primeira posição da Billboard Hot 100 em 2016 foi publicada pela revista norte-americana Billboard, sendo que os dados são recolhidos pela Nielsen SoundScan e baseados em cada venda semanal física e digital, além da popularidade da canção nas rádios, do fluxo de média na Internet e do número de transmissões do respetivo vídeo musical pelo portal YouTube. Durante o decorrer do ano, onze temas atingiram o topo da tabela nas 52 edições da revista.\\n\\"Hello\\", pertencente a Adele, foi o primeiro número um do ano e prolongou a sua liderança de sete semanas antecedentes ao início de 2016, totalizando dez períodos consecutivos no topo da lista. \\"Black Beatles\\", de Rae Sremmurd com Gucci Mane, foi o trabalho que fechou o ciclo. Ao todo, nove artistas conquistaram seu primeiro single número um nos Estados Unidos no decorrer dos doze meses, nomeadamente Zayn, Desiigner, Wizkid, Kyla, Sia, The Chainsmokers, Halsey, o duo Rae Sremmurd e Gucci Mane. A canção que mais edições permaneceu na liderança da tabela musical foi \\"Closer\\", da dupla de DJ The Chainsmokers com a participação de Halsey, registando doze semanas consecutivas no topo."},{"page_url":"https://fr.wikipedia.org/wiki/District_du_Bas-Dir","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Goor_02.JPG","page_title":"District du Bas-Dir","context_page_description":"Le district du Bas-Dir est une subdivision administrative de la province Khyber Pakhtunkhwa au Pakistan. Constitué autour de sa capitale Timergara, le district est entouré par le district du Haut-Dir au nord, le district de Swat à l'est, le district de Malakand au sud et enfin l'agence de Bajaur ainsi que l'Afghanistan à l'ouest.\\nCréé en 1996 en le séparant de sa partie haute, le district compte près de 1,4 million d'habitants en 2017. Il est situé dans une zone montagneuse, et possède une frontière commune avec l'Afghanistan et les régions tribales du Pakistan, et est ainsi régulièrement victime des violences dues à l'insurrection talibane qui s'est étendue dans la région depuis les années 2000."},{"page_url":"https://en.wikipedia.org/wiki/George_Washington_Doane","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/The_Rt._Rev._George_Washington_Doane.jpg","page_title":"George Washington Doane","context_page_description":"George Washington Doane was an American churchman, educator, and the second bishop in the Episcopal Church for the Diocese of New Jersey."},{"page_url":"https://en.wikipedia.org/wiki/Frederik_Meijer_Gardens_%26_Sculpture_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Meijer_Gardens_October_2014_09_%28Children%27s_Garden%29.jpg","page_title":"Frederik Meijer Gardens & Sculpture Park","context_page_description":"Frederik Meijer Gardens & Sculpture Park is a 158-acre botanical garden, art museum, and outdoor sculpture park located in Grand Rapids Township, Michigan, United States. Opened in 1995, Meijer Gardens quickly established itself in the Midwest as a major cultural attraction jointly focused on horticulture and sculpture.\\nMeijer Gardens and Sculpture Park includes a large tropical conservatory, an 8-acre Japanese garden, major works of modern and contemporary sculpture on the grounds and indoors, along with a series of outdoor gardens and nature trails.\\nIt is a well attended cultural site in Michigan, having attracted 750,000 visitors annually between 2015 - 2017. Meijer Gardens has continued to grow their permanent collection of sculpture from major figures in Modern and Contemporary art while building additional structures for indoor and outdoor gardens. In 2018, the Frederik Meijer Gardens and Sculpture Park was included as one of \\"Eleven of the World's Greatest Sculpture Parks\\" by Artsy."},{"page_url":"https://es.wikipedia.org/wiki/Autov%C3%ADa_Cantabria-Meseta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/IndicadorCACastillaLe%C3%B3n_Palencia.png","page_title":"Autovía Cantabria-Meseta","context_page_description":"La A-67 o Autovía Cantabria-Meseta, también conocida como Autovía de la Meseta, es una vía terrestre de doble calzada y sentido que comunica la comunidad autónoma española de Cantabria con la meseta norte, es decir con Castilla y León, en concreto con la provincia de Palencia.\\nSu recorrido atraviesa la cordillera Cantábrica, siendo esta vía de vital importancia para la comunidad autónoma cántabra debido a que es el principal y único acceso de gran capacidad que tiene a la meseta castellanoleonesa y por extensión, al centro de la península ibérica.\\nAsimismo, es fundamental para el comercio en el puerto de Santander y para los frecuentes desplazamientos que se efectúan desde Cantabria hacia cualquier parte de España que tengan que pasar por Valladolid, o por Madrid, centro del sistema radial de autopistas y autovías.\\nAdemás, incorpora un tramo considerado de autopista libre de peajes, el Torrelavega - Santander, debido al desdoblamiento de un tercer carril en el tramo que discurre entre Santa Cruz de Bezana y su final en el Puerto de Santander."},{"page_url":"https://pl.wikipedia.org/wiki/Borowik_korzeniasty","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Wurzelnder_Bitterr%C3%B6hrling.jpg","page_title":"Borowik korzeniasty","context_page_description":"Borowik korzeniasty – gatunek grzybów z rodziny borowikowatych."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9A%AE%E5%A1%94%E9%A5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Pita_felafel.jpg","page_title":"皮塔饼","context_page_description":"皮塔餅，又稱阿拉伯薄麵包或口袋餅，是一種圓形口袋狀麵食，廣泛流行於希臘、土耳其、巴爾幹半島、地中海東部地區和阿拉伯半島。皮塔餅中的「口袋」是由蒸汽膨脹形成，麵餅冷卻後變得平坦，中間留下一個口袋。"},{"page_url":"https://ht.wikipedia.org/wiki/Cabaigu%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Cabaigu%C3%A1n_1.jpg","page_title":"Cabaiguán","context_page_description":"Cabaiguán se yon vil nan pwovens Sancti Spíritus, nan peyi Kiba. Nan lane 2004 li te genyen 67224 moun. Sipèfisi li se 597 Km².\\nPwovens yo nan peyi Kiba divize pa 169 minisipalite oubyen municipios, mannyè yo rele l Kiba. Minisipalite sa yo te defini nan Lwa kiben Nimewo 1304, ki parèt nan dat 3 Jiyè 1976."},{"page_url":"https://pl.wikipedia.org/wiki/Miasta_partnerskie_Wellington","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sakai_City_Office.jpg","page_title":"Miasta partnerskie Wellington","context_page_description":"Wellington współpracuje z ośmioma miastami partnerskimi i jednym miastem formalnie uznawanym za zaprzyjaźnione. Spośród miast partnerskich sześć sformalizowało partnerstwo na piśmie, dwa pozostałe utrzymują nieformalne związki z Wellington, jednak są to związki uznawane przez obie strony za partnerskie.\\nW partnerstwie z Wellington pozostają następujące miasta:\\nHarrogate, Wielka Brytania;\\nChania, Grecja;\\nXiamen, Chiny;\\nSakai, Japonia;\\nTajpej, Tajwan;\\nTiencin, Chiny;\\nQingdao, Chiny;\\nPekin, Chiny.\\nMiasto zaprzyjaźnione\\nSydney, Australia"},{"page_url":"https://en.wikipedia.org/wiki/Monocle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Monocle_%28PSF%29.png","page_title":"Monocle","context_page_description":"A monocle is a type of corrective lens used to correct or enhance the visual perception in only one eye. It consists of a circular lens, generally with a wire ring around the circumference that can be attached to a string or wire. The other end of the string is then connected to the wearer's clothing to avoid losing the monocle. The antiquarian Philipp von Stosch wore a monocle in Rome in the 1720s, in order to closely examine engravings and antique engraved gems, but the monocle did not become an article of gentlemen's apparel until the 19th century. It was introduced by the dandy's quizzing glass of the 1790s, as an article of high fashion."},{"page_url":"https://eu.wikipedia.org/wiki/Euskal_Herriko_garraioa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/1858208646_13ef7274ca_b_Petit_train_de_la_Rhune_France.jpg","page_title":"Euskal Herriko garraioa","context_page_description":"Euskal Herriko garraio sarea Euskal Herrian zehar pertsonak nahiz materiala garraiatzeko azpiegitura sarea da. Tradizionalki, errepide eta trenbide sareak eta aireportu eta itsasportuek osatzen dute garraio sarea.\\nEuskal herriko garraio sarearen garapena eta egoera ulertzeko, hainbat faktore hartu behar dira kontuan:\\nBizkaiko golkoaren kostaldean egonik, lurraldearen barneko errepide sarea lehenik, eta trenbide sarea geroago, portu-trafikoari begira garatu dira.\\nEuskal Herria Iberiar penintsula eta gainontzeko kontinentearen arteko pasabide nagusietako bat da.\\nOrografiaren aldetik, ingurune menditsuek zeharo baldintzatu dute.\\nAdministrazio ezberdinetan banatua egonik, azpiegituraren garapena interes eta helburu ezberdinekin burutu da, askotan lurralde guztien arteko harremanak bultzatzetik urrun eta koordinazio handirik gabe."},{"page_url":"https://en.wikipedia.org/wiki/Koray_Erdo%C4%9Fan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Korayerdogan.jpg","page_title":"Koray Erdoğan","context_page_description":"Koray Erdogan is a Turkish hair transplant surgeon and Vice-President of the World FUE Institute. He has done work in the field of FUE in Europe."},{"page_url":"https://fr.wikipedia.org/wiki/Adrien_Devyver","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Adrien_Devyver_RTBF.jpg","page_title":"Adrien Devyver","context_page_description":"Adrien Devyver, né le 14 septembre 1980, est un journaliste belge ayant principalement travaillé pour la RTBF comme animateur de télévision."},{"page_url":"https://en.wikipedia.org/wiki/Fortifications_of_Valletta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Malta_-_Valletta_-_Triq_Sant_Andrija_-_St._Andrew%27s_Bastion_03_ies.jpg","page_title":"Fortifications of Valletta","context_page_description":"The fortifications of Valletta are a series of defensive walls and other fortifications which surround the capital city of Valletta, Malta. The first fortification to be built was Fort Saint Elmo in 1552, but the fortifications of the city proper began to be built in 1566 when it was founded by Grand Master Jean de Valette. Modifications were made throughout the following centuries, with the last major addition being Fort Lascaris which was completed in 1856. Most of the fortifications remain largely intact today.\\nThe city of Valletta, along with Nicosia in Cyprus, was considered to be a practical example of an ideal city of the Renaissance, and this was due to its fortifications as well as the urban life within the city. The fortifications were well known throughout Europe by the 17th century, and might have influenced the designs of part of the Fortress of Luxembourg. In an 1878 book, Valletta was described as \\"one of the best fortified [cities] in the world.\\" Valletta's fortifications are the most important of the fortifications of Malta, and today they form part of a UNESCO World Heritage Site."},{"page_url":"https://ca.wikipedia.org/wiki/Esgl%C3%A9sia_dels_Sants_Just_i_Pastor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Barcino-Sant_Just_048.JPG","page_title":"Església dels Sants Just i Pastor","context_page_description":"L'església dels sants Just i Pastor és una església gòtica situada a la plaça del mateix nom del Barri Gòtic de Barcelona, i dedicada als sants Just i Pastor. Va ser construïda sobre els fonaments de l'anterior temple romànic. És un dels exemples singulars de l'arquitectura religiosa del gòtic català del segle xiv, tant per la tipologia de la planta i solucions estructurals, com per la seva evolució constructiva, cronològica i funcional, i pels seus valors històrics singulars i excepcionals. Va ser declarada Bé Cultural d'Interès Nacional en la categoria de monument històric, el juny de 2012."},{"page_url":"https://de.wikipedia.org/wiki/Landtagswahlkreis_Sangerhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/2012-12-13_-_Andr%C3%A9_Schr%C3%B6der_MdL_DE-ST_-_1346.jpg","page_title":"Landtagswahlkreis Sangerhausen","context_page_description":"Der Wahlkreis Sangerhausen ist ein Landtagswahlkreis in Sachsen-Anhalt. Der Wahlkreis umfasst derzeit vom Landkreis Mansfeld-Südharz die Gemeinden Berga, Brücken-Hackpfüffel, Edersleben, Stadt Kelbra, Stadt Sangerhausen, Südharz und Wallhausen."},{"page_url":"https://pt.wikipedia.org/wiki/Ermilo_Abreu_G%C3%B3mez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Busto_de_Ermilo_Abreu_G%C3%B3mez%2C_M%C3%A9rida%2C_Yucat%C3%A1n_%2802%29.JPG","page_title":"Ermilo Abreu Gómez","context_page_description":"Ermilo Abreu Gómez foi um escritor mexicano. Destacou-se na poesia, na novela, no teatro, na crítica literária e no ensaio. Desde 1962 que pertencia à Academia da Língua."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8F%E0%A4%A8%E0%A5%8D%E0%A4%AF%E0%A4%BE%E0%A4%82%E0%A4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Yinxu.jpg","page_title":"एन्यांग","context_page_description":"एन्यांग चाइना में एक शहर है | हेनान का उत्तरीतम शहर, एयांग पूर्व में पुयांग, दक्षिण में हेबी और झिंक्सियांग और क्रमशः शांक्सी और हेबेई प्रांतों के पश्चिम और उत्तर में प्रांतों की सीमा है। 2010 की जनगणना के अनुसार इसकी कुल जनसंख्या 5,172,834 है, 2,025,811 जिनमें से 4 शहरी जिलों से बने मेट्रोपॉलिटन क्षेत्र में रहते हैं और एनांग काउंटी बड़े पैमाने पर शहर के साथ जुड़ा हुआ है।"},{"page_url":"https://uk.wikipedia.org/wiki/AREX","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Arex-train-inside-2007-6-7.jpg","page_title":"AREX","context_page_description":"AREX від — повністю інтегрована з системою Сеульського метро швидкісна приміська залізнична лінія що поєднує Сеул з міжнародним аеропортом Інчхон."},{"page_url":"https://es.wikipedia.org/wiki/Faro_de_Punta_Sur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/South_point_Lighthouse.jpg","page_title":"Faro de Punta Sur","context_page_description":"El Faro de Punta Sur está ubicado sobre la costa del Océano Atlántico, al sur de Barbados. Fue construido e iluminado 1852.\\nEs el faro más antiguo de los cuatro faros que posee Barbados, y ha sido grabado en el reverso de la moneda de 5 céntimos de ese país desde 1973.​​"},{"page_url":"https://ia.wikipedia.org/wiki/La_Hoya_(Salamanca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Panor%C3%A1mica_Covatilla.jpg","page_title":"La Hoya (Salamanca)","context_page_description":"La Hoya es un municipalitate que se trova in le provincia de Salamanca, in le communitate autonome de Castilia e Leon, Espania."},{"page_url":"https://de.wikipedia.org/wiki/Bongabon","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Ph_locator_nueva_ecija_bongabon.png","page_title":"Bongabon","context_page_description":"Bongabon ist eine philippinische Stadtgemeinde in der Provinz Nueva Ecija.\\nBongabon ist führender Zwiebelproduzent in den Philippinen und in Südostasien.\\nJedes Baranggay in Bongabon hat eine eigene Fiesta. Das in ganz Bongabon gefeierte Sibuyasan Onion Festival findet jährlich in der ersten und zweiten Woche im April statt."},{"page_url":"https://de.wikipedia.org/wiki/Felsritzungen_von_Litsleby","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Rock_carvings_density-km2-Sweden.svg","page_title":"Felsritzungen von Litsleby","context_page_description":"Die Felsritzungen von Litsleby liegen etwa drei Kilometer südlich der Kirche von Tanum in Schweden. Sie stammen aus der nordischen Bronzezeit. Die ältesten Fußspuren, Swastiken, Tiere und Schiffe auf der nach Westen abfallenden Felsplatte mögen um 1500 v. Chr. oder sogar früher entstandenen sein. Als Teil der Felsritzungen bei Tanum zählt Litsleby zum Weltkulturerbe der UNESCO.\\nEine Besonderheit der Felsritzungen von Litsleby bilden zwei große Schiffsbilder, die Boote des Hjortspringboot-Typs zeigen und auf 800 bis 900 v. Chr. datiert werden. Wichtig sind ein großes und zwei kleine Darstellungen, die für Plankenboote gehalten werden und auf 1000 bis 1200 v. Chr. datiert werden. Dies wären die ältesten Darstellungen dieser Bauart. Bei nahezu allen Litsleby-Schiffen biegt sich das Dollbord mittschiffs nach unten, während es zu den Steven hin ansteigt – bei vielen anderen Felsritzungen ist dies nicht der Fall oder allenfalls angedeutet. Für ein seegängiges Fahrzeug im Skagerrak, das vor Litsleby liegt, wäre dies aber unabdingbar."},{"page_url":"https://eo.wikipedia.org/wiki/Follo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bastremoli_%28Follo%29-panorama_da_Valeriano_di_Vezzano_Ligure.jpg","page_title":"Follo","context_page_description":"Follo estas komunumo de Italio. Ĝi situas en la regiono Ligurio kaj la provinco La Spezia. Fine de 2018 en la komunumo vivis 6 296 loĝantoj. Najbaras la komunumoj Beverino, Bolano, Calice al Cornoviglio, La Spezia, Podenzana, Riccò del Golfo di Spezia kaj Vezzano Ligure. Kristanisma patrono de la komunumo estas la sanktulo Marteno de Tours, kies religia memortago sekve estas la komunuma festotago."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8F%9C%E7%B2%89%E8%9D%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/WHITE%2C_CABBAGE_%28Pieris_rapae%29_%2810-2-11%29_patagonia_butterfly_garden%2C_scc%2C_az_%289423595844%29.jpg","page_title":"菜粉蝶","context_page_description":"白粉蝶在台灣以外漢語使用地區又名菜粉蝶，是屬於粉蝶科的一種蝴蝶，是粉蝶屬的一種。廣泛分布於歐亞大陸大部分地區，並已入侵並立足於北美、北非、澳洲、紐西蘭等地低至高海拔地區。模式產地為瑞典。\\n一年多代。成蝶飛行緩慢，好訪花。冬季溫度低的地區以蛹態過冬。幼蟲的寄主主要為十字花科植物，大多都是農作產物，所以白粉蝶是族群密度非常高的農業害蟲。雌蝶將卵單產在十字花科蔬菜上，因此飯盒裡常能找到煮熟的幼蟲，爲了避免各類昆蟲哨食，農夫大多會施以農藥防治以達立竿見影之效。"},{"page_url":"https://id.wikipedia.org/wiki/Daftar_film_yang_hilang","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lon_Chaney%2C_Sr._The_Miracle_Man.jpg","page_title":"Daftar film yang hilang","context_page_description":"Untuk daftar film yang hilang, yang dimaksud dengan film yang hilang adalah salah satu film yang tidak memiliki sebagian rekaman adegan yang diketahui masih bertahan. Untuk film-film yang beberapa porsi rekamannya masih tersisa, lihat artikel Daftar film yang tidak lengkap.\\nFilm-film mungkin menghilang karena beberapa alasan. Faktor terbesar yang umumnya menyebabkan film hilang adalah penggunaan film nitrat sampai dengan awas Dasawarsa 1950-an. Jenis film ini sangat mudah terbakar, seperti film kebakaran film Fox tahun 1937, kebakaran film-film MGM tahun 1967, dan Universal Pictures yang kebakaran pada tahun 1924. Film hitam-putih dituduh sebagai film tidak berguna. Film menghilang juga dapat disebabkan oleh bangkrutnya sebuah perusahaan film. Kadang kala, sebuah studio akan mendaur ulang sebuah film dan menghancurkan film sebelumnya. Film-film bisu yang dianggap sudah tidak memiliki nilai ekonomi juga akan dijadikan sampah manakala sudah memenuhi tempat pernyimpanan.\\nYayasan Film Martin Scorsese' mengklaim bahwa \\"setengah dari film Amerika Serikat yang diproduksi sebelum tahun 1950 dan lebih dari 90% film buatan sebelum tahun 1929 telah hilang selamanya.\\""},{"page_url":"https://hu.wikipedia.org/wiki/Tr%C3%A9mery","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Eglise_Tremery.jpg","page_title":"Trémery","context_page_description":"Trémery település Franciaországban, Moselle megyében. Lakosainak száma 1063 fő. +/- Trémery Ay-sur-Moselle, Ennery, Flévy, Luttange és Rurange-lès-Thionville községekkel határos."},{"page_url":"https://bs.wikipedia.org/wiki/Uza%C5%A1a%C5%A1%C4%87e","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Benvenuto_Tisi_da_Garofalo_-_Ascension_of_Christ_-_WGA08474.jpg","page_title":"Uzašašće","context_page_description":"Uzašašće ili Spasovdan je kršćanski blagdan. Slavi se 40 dana poslije Uskrsa.\\nPrema Bibliji, Isus je 40 dana poslije uskrsnuća ostao na zemlji. Na 40. dan javio se svojim učenicima u Jeruzalemu. Rekao im je, da ostanu u gradu i čekaju dolazak Duha Svetoga. Zatim ih je poveo na Maslinsku goru. Tamo je podigao ruke i blagoslovio ih. I poče uzlaziti na nebo, a oblak ga je zaklonio i više ga nisu vidjeli. Dok su apostoli gledali na nebo, pokazali su im se dva anđela u bijelim haljinama i rekli: „Ovaj Isus, koji je uzašao na nebo, tako će opet doći kao što ste vidjeli, da je otišao na nebo.”\\nNedovršeni članak Uzašašće koji govori o religiji treba dopuniti. Dopunite ga prema pravilima Wikipedije."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D8%A7%D8%B1%D9%82%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Dargun_Wappen.png","page_title":"دارقون","context_page_description":"دارقون آلمانین مکلنبورق-فورپومرن ایالتینده یئر آلان بیر شهردیر و ۱۰ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۴۹۹۵ نفر دیر. بۇ شهرین ۱۱۷٫۱۵ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%83_%D9%88%D8%A7%D9%8A%D8%AA_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D9%8A%D9%83%D8%AA_%D8%A8%D8%B1%D9%8A%D8%B7%D8%A7%D9%86%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/John_Cornish_White_card_c1920.jpg","page_title":"جاك وايت (لاعب كريكت بريطاني)","context_page_description":"جاك وايت ‏ هو لاعب كريكت بريطاني. شارك مع منتخب إنجلترا للكريكت. أما مع النوادي، فقد لعب مع نادي مقاطعة سومرست للكريكت."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%8B%E9%84%89%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Ha_Heung_Road.JPG","page_title":"下鄉道","context_page_description":"下乡道是香港九龙土瓜湾的一条街道，单线单程行车，左右两旁设有两小时泊车收费咪表，全长约450米。北至土瓜湾九龙城道，南至土瓜湾浙江街。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%B4%8E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Osaki_City_Matsuyama_Furusato_History_Museum_exterior%2C_in_Osaki%2C_Miyagi.jpg","page_title":"大崎市","context_page_description":"大崎市は、宮城県北西部の大崎地方に位置する市。"},{"page_url":"https://de.wikipedia.org/wiki/Viana_do_Castelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Viana_do_Castelo_4.JPG","page_title":"Viana do Castelo","context_page_description":"Viana do Castelo ist eine Stadt in Portugal und die Hauptstadt des gleichnamigen Distrikts und des Kreises in der Region Nord von Portugal. Sie liegt nördlich der schlauchartigen Mündung des Flusses Rio Lima in den Atlantik."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%A6%E3%82%B0%E3%82%B9%E3%83%88%E3%83%BB%E3%83%81%E3%83%A3%E3%83%AB%E3%83%88%E3%83%AA%E3%82%B9%E3%82%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/August_Franciszek_Maria_Anna_J%C3%B3zef_Kajetan_Czartoryski_Mu%C3%B1oz%2C_duque_de_Vista_Alegre.jpg","page_title":"アウグスト・チャルトリスキ","context_page_description":"福者アウグスト・フランチシェク・マリア・ユゼフ・カイェタン・チャルトリスキ・ムニョスは、ポーランド人のサレジオ会修道司祭。ポーランドの大貴族チャルトリスキ家の公で、スペインのビスタ・アレグレ公爵でもあった。2004年、列福された。"},{"page_url":"https://nl.wikipedia.org/wiki/Penzjina","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Penzhina.png","page_title":"Penzjina","context_page_description":"De Penzjina is een rivier in het noordoosten van het Russische Verre Oosten, gelegen in het noorden van de kraj Kamtsjatka. De rivier ontspringt in het Kolymahoogland en stroomt in zuidwestelijke richting; eerst door een diepe vallei en dan door een intermontaan bekken, om vervolgens uit te stromen in de Penzjinabaai van de Sjelichovbaai in de Zee van Ochotsk. De rivier wordt gevoed door sneeuw en regen en is gewoonlijk bevroren van november tot mei, begin juni. De rivier is bevaarbaar in de midden- en benedenloop."},{"page_url":"https://id.wikipedia.org/wiki/Teresa_Cristina_dari_Dua_Sisilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Teresa_Cristina_of_the_Two_Sicilies_1888.jpg","page_title":"Teresa Cristina dari Dua Sisilia","context_page_description":"Dona Teresa Cristina, dijuluki sebagai \\"Ibu orang-orang Brasil\\", adalah Permaisuri Brasil dan istri dari Kaisar Dom Pedro II dari Brasil, yang memerintah dari tahun 1831 hingga tahun 1889. Terlahir sebagai putri dari Kerajaan Dua Sisilia yang pada saat ini berada di Italia bagian selatan, ia adalah putri dari Don Francesco I dari Dinasti Bourbon, cabang Italia dan istrinya Maria Isabel. Ini sudah lama diyakini oleh para sejarawan bahwa Putri dibesarkan dalam suasana ultra-konservatif, tidak toleran yang mengakibatkan karakter pemalu dan tidak tegas di depan umum dan kemampuan untuk menjadi puas dengan sangat sedikit materi atau emosional. Penelitian terbaru mengungkapkan karakter yang lebih kompleks, yang meski telah menghormati norma-norma sosial pada zaman tersebut, mampu menegaskan kemerdekaan terbatas karena kepribadiannya yang kuat berpendirian serta minatnya terhadap kegiatan belajar, ilmu dan budaya.\\nPutri menikah berdasarkan wakil dari Pedro II pada tahun 1843."},{"page_url":"https://fr.wikipedia.org/wiki/Aglientu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Aglientu%2C_panorama_%2803%29.jpg","page_title":"Aglientu","context_page_description":"Aglientu est une commune de la province de Sassari dans la région Sardaigne en Italie."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Chambon_(Gard)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Le_Chambon_%28%C3%A9glise%29.JPG","page_title":"Chambon (Gard)","context_page_description":"Chambon sī ūi-tī Hoat-kok Languedoc-Roussillon tōa-khu Gard séng ê chi̍t ê commune."},{"page_url":"https://ca.wikipedia.org/wiki/Netball","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Netball_court_medium.png","page_title":"Netball","context_page_description":"El netball és un esport femení, similar al corfbol neerlandès i emparentat amb el bàsquet.\\nEs juga en un camp de 30 metres de llarg per 15 metres d'ample, dividit en tres parts iguals, amb dues cistelles en els extrems penjades d'un pal. Hi ha set jugadores que només es poden moure en zones determinades i no poden moure's amb la pilota a les mans; per progressar cap a la cistella contrària s'han de realitzar una sèrie de passis fins que la pilota li sigui lliurada a la tiradora, que serà la que haurà d'encistellar.\\nEls equips s'organitzen amb set jugadores que tenen les següents posicions:\\nportera\\ndefensa de meta\\naler defensa\\nbase\\natacant\\naler atacant\\ntiradora.\\nEl partit es divideix en 5 parts de 15 minuts cada una. No es pot mantenir la pilota a les mans més de 3 segons ni moure's del lloc; només s'han de realitzar passis, excepte l'atacant i la tiradora, que són les úniques jugadores que poden encistellar.\\nÉs un esport conegut i practicat principalment a Europa. Un dels personatges populars que practiquen el netball és l'actriu britànica Emma Watson."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%A7%E5%9D%A1%E5%9C%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Dapo_Waterway05.jpg","page_title":"大坡圳","context_page_description":"大坡圳为一座位于台湾台东县池上乡的小型灌溉水圳系统，该水圳引水自池上乡大坡溪，为台东县境内少数引水自秀姑峦溪水系的灌溉圳道。大坡圳目前由台东农田水利会池上工作站进行管理与维护。"},{"page_url":"https://et.wikipedia.org/wiki/Ferrara","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Ferrara_02.jpg","page_title":"Ferrara","context_page_description":"Ferrara on linn Itaalias Emilia Romagna maakonnas, Ferrara provintsi halduskeskus."},{"page_url":"https://es.wikipedia.org/wiki/Ataque_a_Pearl_Harbor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Akagi_flight_deck_Hitokappu_Bay.jpg","page_title":"Ataque a Pearl Harbor","context_page_description":"El ataque a Pearl Harbor fue una ofensiva militar sorpresiva efectuada por la Armada Imperial Japonesa contra la base naval de los Estados Unidos en Pearl Harbor en la mañana del domingo 7 de diciembre de 1941. El ataque pretendía ser una acción preventiva destinada a evitar la intervención de la Flota del Pacífico de los Estados Unidos en las acciones militares que el Imperio del Japón estaba planeando realizar en el Sureste Asiático contra las posesiones ultramarinas del Reino Unido, Francia, Países Bajos y Estados Unidos. Los japoneses hicieron coincidir esta ofensiva con el ataque a las posesiones del Imperio Británico en Hong Kong, Malasia y Singapur, las cuales estaban ya en su poder a mediados de febrero de 1942.\\nEl ataque comenzó a las 7:48 a. m., hora local, y fue llevado a cabo por 353 aeronaves japonesas​ que incluían cazas de combate, bombarderos y torpederos que despegaron de seis portaaviones.​ Resultaron dañados los ocho acorazados estadounidenses atracados en el puerto, y cuatro de ellos se hundieron. De estos ocho, dos fueron reflotados y cuatro reparados, por lo que seis pudieron volver a entrar en servicio más tarde, durante la guerra."},{"page_url":"https://de.wikipedia.org/wiki/Oberstrass_(Stadt_Z%C3%BCrich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Z%C3%BCrich_-_Oerlikon_-_Gygerkarte_1667.jpg","page_title":"Oberstrass (Stadt Zürich)","context_page_description":"Oberstrass ist ein Quartier der Stadt Zürich. Die ehemals selbständige Gemeinde Oberstrass wurde 1893 eingemeindet und bildet heute zusammen mit Unterstrass den Kreis 6."},{"page_url":"https://sv.wikipedia.org/wiki/Encephalartos_ferox","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/E.ferox_kg_018.jpg","page_title":"Encephalartos ferox","context_page_description":"Encephalartos ferox är en kärlväxtart som beskrevs av Bertol. f. Encephalartos ferox ingår i släktet Encephalartos och familjen Zamiaceae. IUCN kategoriserar arten globalt som nära hotad. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Maria_Anna_Josepha_Althann","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Ana_Maria_Pignatelli_Althann.JPG","page_title":"Maria Anna Josepha Althann","context_page_description":"Maria Anna Josepha Gräfin von Althann war die Ehefrau von Johann Michael von Althann, Mäzenatin und Vertraute Karl VI."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_im_4._Arrondissement_(Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/P4-Enfilade16%2C14%2C12%2C10%2C8%2C6Lombard-001.jpg","page_title":"Liste der Monuments historiques im 4. Arrondissement (Paris)","context_page_description":"Die Liste der Monuments historiques im 4. Arrondissement (Paris) führt die Monuments historiques im 4. Arrondissement der französischen Hauptstadt Paris auf."},{"page_url":"https://en.wikipedia.org/wiki/Manistee_Ranch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/G-_Manistee_Ranch_Palm_Trees.jpg","page_title":"Manistee Ranch","context_page_description":"Manistee Ranch was founded in 1897 by Herbert W. Hamilton, a native of Wisconsin. The ranch, located in the town of Glendale, Arizona, was rich in citrus fruits and dates. The ranch has all of its historical structures restored. It is administered by the Parks and Recreation Department of Glendale.\\nOn April 9, 1998, Manistee Ranch was listed in the National Register of Historical Places."},{"page_url":"https://fr.wikipedia.org/wiki/Bassin_de_Taoudeni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/West_African_Basins.svg","page_title":"Bassin de Taoudeni","context_page_description":"Le bassin de Taoudeni est une importante formation géologique d'Afrique de l'Ouest, qui doit son nom au village de Taoudeni, dans le Nord du Mali. Il recouvre une bonne part du Craton d'Afrique de l'Ouest, de la Mauritanie au Mali. Son intérêt vient des perspectives d'exploitation de l'or noir.\\nIl s'agit du plus grand bassin sédimentaire du Nord-Ouest de l'Afrique. Il s'est formé dans la seconde moitié du Protérozoïque, a observé un mouvement de subsidence jusqu'au Paléozoïque moyen, avant d'être affecté par le plissement hercynien et de se soulever. C'est un dépôt de plus de 6 000 m de sédiments de la fin du Précambrien et du Paléozoïque. Les forages de prospection entrepris dans les années 1980 ont révélé la présence de pétrole dans les couches de la fin du Précambrien, du Silurien et de la fin du Dévonien. Les couches de sédiments sont plus épaisses dans la moitié occidentale de la dépression.\\nLe gouvernement du Mali, un des pays les plus pauvres du monde, rêve de se doter d'une industrie pétrolière."},{"page_url":"https://nn.wikipedia.org/wiki/Vlaardingen","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Wapenvlaardingen1a.jpg","page_title":"Vlaardingen","context_page_description":"Vlaardingen er ein kommune og by i Nederland i provinsen Zuid-Holland med om lag 70 000 innbyggjarar. Han ligg på nordsida av der Nieuwe Maas/Nieuwe Waterweg renn i saman med Oude Maas. Andre stader i nærleiken er Maassluis i vest og Schipluiden og Delft i nord.\\nBysentrumet ligg vest for den gamle hamna, som er ein utvida del av kanalen Vlaardingse vaart som går frå Vlaardingen og nordvestover."},{"page_url":"https://en.wikipedia.org/wiki/List_of_active_United_States_Air_Force_aircraft_squadrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/41_Airlift_Sq.jpg","page_title":"List of active United States Air Force aircraft squadrons","context_page_description":"This is an organized incomplete list of all of the active aircraft squadrons that currently exist in the United States Air Force, sorted by type. Most squadrons have changed names and designations many times over the years, so they are listed by their current designation.\\nTo see all USAF squadrons, regardless of active or not, go to the List of United States Air Force squadrons."},{"page_url":"https://no.wikipedia.org/wiki/Poros","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Poros_Greece.JPG","page_title":"Poros","context_page_description":"Poros er et lite gresk øypar i den sørlige delen av Saroniabukta, rundt 58 km sør for Pireus og adskilt fra Peloponnes med et sund på rundt 200 meter, og med byen Galatas på fastlandet på andre siden av stredet. Øyas overflate og areal er på rundt 31 km² og den har 3 780 innbyggere. Byen Poros har 3 651 av disse innbyggerne. Den eneste andre bosetningen er Ágios Nektários med 101 innbyggere. Det gamle navnet i antikken var Pogon. Som andre havner i Saroniabukta er stedet et populært mål i helgene for folk bosatt i Athen.\\nPoros består av to øyer: Sphairia, den sørlige delen, som er av vulkansk opprinnelse og hvor dagens by er lokalisert, og Kalaureia, den nordligste og største delen. En bro forbinder de to øyene over en smal eide. Kommunen Poros omfatter også en del på fastlandet, Kyaní Aktí, på den østligste delen av halvøya Peloponnes, og ligger mellom øya Poros og øya Hydra og ligger ved siden av kommunene Troizinia og Ermionida. Det totale landarealet for kommunen er 49,582 km² og det totale antallet mennesker i kommunen er 3 993 mennesker.\\nPoros er en øy med en rik vegetasjon."},{"page_url":"https://es.wikipedia.org/wiki/Londres","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/St_James%27s_Park_Lake_%E2%80%93_East_from_the_Blue_Bridge_-_2012-10-06.jpg","page_title":"Londres","context_page_description":"Londres es la capital y mayor ciudad de Inglaterra y del Reino Unido.​​ Situada a orillas del río Támesis, Londres es un importante asentamiento humano desde que fue fundada por los romanos con el nombre de Londinium hace casi dos milenios.​ El núcleo antiguo de la urbe, la City de Londres, conserva básicamente su perímetro medieval de una milla cuadrada. Desde el siglo XIX el nombre «Londres» también hace referencia a toda la metrópolis desarrollada alrededor de este núcleo.​ El grueso de esta conurbación forma la región de Londres y el área administrativa del Gran Londres, ​ gobernado por el alcalde y la asamblea de Londres.​\\nLondres es una ciudad global, uno de los centros neurálgicos en el ámbito de las artes, el comercio, la educación, el entretenimiento, la moda, las finanzas, los medios de comunicación, la investigación, el turismo o el transporte.​ Es el principal centro financiero del mundo​​​ y una de las áreas metropolitanas con mayor PIB.​​ Londres es también una capital cultural mundial, ​​​​ la ciudad más visitada considerando el número de visitas internacionales​ y tiene el mayor sistema aeroportuario del mundo según el tráfico de pasajeros.​"},{"page_url":"https://de.wikipedia.org/wiki/Hohenleuben","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Burgruine_Reichenfels_Mauerreste.jpg","page_title":"Hohenleuben","context_page_description":"Hohenleuben ist eine der kleinsten Städte im Osten Thüringens. Zum Stadtgebiet gehört auch das Dorf Brückla. Erfüllende Gemeinde für Hohenleuben ist Langenwetzendorf. Infolge seiner kleinen Einwohnerzahl ist Hohenleuben eine Landstadt."},{"page_url":"https://fr.wikipedia.org/wiki/Galanthus_nivalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Galanthus_nivalis_1.jpg","page_title":"Galanthus nivalis","context_page_description":"Galanthus nivalis, communément appelée Perce-neige, est une espèce de plantes herbacées vivaces à bulbe. Elle appartient à la famille des Liliaceae selon la classification classique ou des Amaryllidaceae selon la classification phylogénétique."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_Pitti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Eleanora_of_Toledo.jpg","page_title":"Palais Pitti","context_page_description":"Le palais Pitti est un immense palais de style Renaissance situé à Florence, en Italie. Il a été érigé dans le quartier Oltrarno, non loin du Ponte Vecchio. Le cœur du palais actuel date de 1458 et était, à l’origine, la résidence de Luca Pitti, un ambitieux banquier florentin.\\nLe palais est racheté en 1549 par la famille Médicis et devient la résidence principale des familles régnantes du grand-duché de Toscane. Au fil du temps, il se transforme en véritable coffre aux trésors, les générations successives y amassant peintures, orfèvreries, bijoux et autres biens de luxe.\\nÀ la fin du XVIIIᵉ siècle, le palais Pitti est utilisé comme base politique par Napoléon Iᵉʳ, il sert ensuite également mais brièvement de palais royal à l’Italie nouvellement unifiée.\\nLe palais et son contenu sont cédés au peuple italien par le roi Victor-Emmanuel III d'Italie en 1919 et ses portes ouvertes au public, dévoilant l’une des plus grandes galeries d’art de Florence. Aujourd’hui, il offre au public plusieurs collections mineures en plus de celles de la famille Médicis."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%90%D7%95%D7%A1%D7%A0%D7%92%D7%98%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Mountain_pearls1.jpg","page_title":"אאוסנגטה","context_page_description":"אָאוּסַנְגָטֶה הוא הר ברכס וילקנוטה, חלק מהרי האנדים בפרו. גובהו 6,384 מטרים, 100 קילומטרים דרום מזרחית לעיר קוסקו. להר חשיבות רבה במיתולוגיית האינקה.\\nכל שנה, פסטיבל 'קויילור ריטי' מתקיים עשרים קילומטר צפון לאאוסנגטה בהר קולקיפונקו, והוא אבן שואבת לאלפי עולים לרגל. הוא מתקיים שבוע לפני חג הלחם והיין הקדושים.\\nבאזור למוֹת ואלפקות חיות בבר. שבילים בהרים הגבוהים משמשים את רועיהן לסחר עם קהילות חקלאיות בגבהים נמוכים יותר. אחד מנתיבים אלה הוא מהווה מסלול טיול רגלי ידוע ומפורסם.\\nלאזור יש ארבעה מאפיינים גאולוגיים עיקריים: ההרמה האנדית של גרניט, הקרחונים התלויים, עמקי בליית קרחונים, ותצורה פרמינאנית בצבעיה הייחודיים: אדום, אוכרה, טורקיז. האזור מתאפיין גם בגיר וביערות."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%B2%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0_(%D0%A0%D1%8B%D0%B1%D0%B8%D0%BD%D1%81%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/%D0%94%D0%BE%D0%BC-%D0%BF%D0%BE%D0%BF%D0%BE%D0%B2%D0%B0-12.JPG","page_title":"Крестовая улица (Рыбинск)","context_page_description":"Крестовая улица — главная историческая и торговая магистраль города Рыбинска Ярославской области."},{"page_url":"https://en.wikipedia.org/wiki/TVyNovelas_Award_for_Best_Musical_Theme","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Paulina_Goto.jpg","page_title":"TVyNovelas Award for Best Musical Theme","context_page_description":"Most awarded singers: Manuel Mijares, Alejandro Sanz and Pablo Alborán, 2 times.\\nSinger that won all nominations: Alejandro Sanz and Pablo Alborán, 2 times.\\nMost nominated singer: Marco Antonio Solís with 4 nominations.\\nMost nominated singers without a win: Laura Pausini and María José with 2 nominations.\\nSinger winning after short time: Pablo Alborán by and, 2 consecutive years.\\nSinger winning after long time: Manuel Mijares by and, 5 years difference.\\nForeign winning singers:\\nRicardo Montaner from Argentina\\nEnrique Iglesias from Spain\\nJuan Luis Guerra from Dominican Republic\\nAlejandro Sanz from Spain\\nAxel from Argentina\\nPablo Alborán from Spain"},{"page_url":"https://de.wikipedia.org/wiki/N%C3%A9ris-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Neris_eglise.jpg","page_title":"Néris-les-Bains","context_page_description":"Néris-les-Bains ist ein zentralfranzösischer Ort und eine Gemeinde im Département Allier in der Region Auvergne-Rhône-Alpes. Der Kurort mit 2.553 Einwohnern wird vor allem von den drei Kurhäusern und einem zehn Hektar großen Park geprägt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%A8%E3%83%BC%E3%82%AF%E5%B8%82%E5%9C%B0%E4%B8%8B%E9%89%84%E3%81%AE%E8%BB%8A%E4%B8%A1%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/NYC_Subway_R33ML_9010_on_the_7.jpg","page_title":"ニューヨーク市地下鉄の車両一覧","context_page_description":"ニューヨーク市地下鉄の車両一覧では、ニューヨーク市地下鉄で使用される車両全般について解説する。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B5_%D0%9A%D1%80%D1%8B%D1%81%D1%82%D1%8D%D0%BD%D1%81%D0%B5%D0%BD_%D0%A0%D0%BE%D0%BC%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Ole_R%C3%B8mer.jpg","page_title":"Оле Крыстэнсен Ромер","context_page_description":"Оле Крыстэнсен Ромер — дацкі астраном, першым змерыў хуткасць святла."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Moutiers_(Meurthe-et-Moselle)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Map_commune_FR_insee_code_54391.png","page_title":"Moutiers (Meurthe-et-Moselle)","context_page_description":"Moutiers sī ūi-tī Hoat-kok Lorraine toā-khu Meurthe-et-Moselle koān ê chi̍t ê commune."},{"page_url":"https://nl.wikipedia.org/wiki/Batman_-_The_Dark_Knight","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Batmansixflags_ne14.jpg","page_title":"Batman - The Dark Knight","context_page_description":"Batman - The Dark Knight is een vloerloze achtbaan in het Amerikaanse attractiepark Six Flags New England te Springfield."},{"page_url":"https://sv.wikipedia.org/wiki/L%C3%B6kmal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Acrolepiopsis_assectella_%28ento-csiro-au%29.jpg","page_title":"Lökmal","context_page_description":"Lökmal är en fjärilsart som först beskrevs av Philipp Christoph Zeller 1839. Lökmal ingår i släktet Acrolepiopsis, och familjen Acrolepiidae. Arten är reproducerande i Sverige.\\nLökmalens framvingar har en spännvidd av 10-13 millimeter, är mörkt gråbruna, utåt ljusare, med en större vit, mörkprickig fläck på bakkanten. Larven, som är grågrön med brunaktigt huvud och en rödaktig ryggfläck, lever i bladen och stammen av lök, varvid förruttnelse lätt uppkommer.\\nI Sverige förekommer Lökmalen upp till Öster- och Västergötland."},{"page_url":"https://af.wikipedia.org/wiki/Gustav_Scholz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Bundesarchiv_Bild_183-23969-0002%2C_Al_Andrews%2C_Gustav_Scholz.jpg","page_title":"Gustav Scholz","context_page_description":"Gustav Scholz was 'n Duitse akteur. Hy was bekend vir sy rolle in die rolprente Marina en Schlagerparade 1961, en in die televisiereeks Klimbim."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Tuzie","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Tuzie_mairie.JPG","page_title":"Tuzie","context_page_description":"Tuzie sī ūi-tī Hoat-kok Poitou-Charentes tōa-khu Charente séng ê chi̍t-ê commune."},{"page_url":"https://vi.wikipedia.org/wiki/Copenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nyhavn-panorama.jpg","page_title":"Copenhagen","context_page_description":"Copenhagen là thủ đô và là thành phố lớn nhất của Đan Mạch, đồng thời là thành phố lớn thứ hai trong khu vực Bắc Âu. Copenhagen có 1.153.615 cư dân. Với công trình cầu Oresund nối liền hai quốc gia Đan Mạch-Thụy Điển, Copenhagen đã trở thành trung tâm của vùng đô thị Đan Mạch-Thụy Điển có tên là Oresund. Đây là vùng lớn nhất Scandinavia với dân số trên 3,5 triệu người. Với cương vị thủ đô, Copenhagen là nơi đặt trụ sở của các cơ quan lập pháp, hành pháp và tư pháp trung ương của Đan Mạch."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%BE%D0%B5_%D0%BE%D1%82%D0%B4%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9F%D1%80%D0%B8%D0%B2%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B9_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Volgograd_Station_2.jpg","page_title":"Волгоградское отделение Приволжской железной дороги","context_page_description":"Волгоградское отделение Приволжской железной дороги — одно из отделений Приволжской железной дороги. Существовало вплоть до реоранизации дороги, в ходе которой отделения были упразднены, ныне вместо отделения — Волгоградский регион Приволжской железной дороги."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%BE%D1%83%D1%80_(%D0%9E%D1%85%D0%B0%D1%98%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Canal_Tavern_of_Zoar.jpg","page_title":"Зоур (Охајо)","context_page_description":"Зоур град је у америчкој савезној држави Охајо."},{"page_url":"https://de.wikipedia.org/wiki/W%C3%A4rmeleitpaste","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/W%C3%A4rmeleitpaste_Thermal_Compound.jpg","page_title":"Wärmeleitpaste","context_page_description":"Wärmeleitpaste ist eine Paste, welche die Wärmeübertragung zwischen zwei Objekten, z. B. einem Mikrochip und einem Kühlkörper, verbessert."},{"page_url":"https://fr.wikipedia.org/wiki/Panneau_Histoire_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Panneau_Th%C3%A9%C3%A2tre_Ath%C3%A9n%C3%A9e-Louis-Jouvet.jpg","page_title":"Panneau Histoire de Paris","context_page_description":"Les panneaux « Histoire de Paris » sont des panneaux d'information installés dans les rues de Paris devant certains des monuments parisiens."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%8B%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Kobe_Steel%2C_Ltd-%E7%A5%9E%E6%88%B8%E8%A3%BD%E9%8B%BC%E6%89%80%E5%8A%A0%E5%8F%A4%E5%B7%9D%E8%A3%BD%E9%89%84%E6%89%80_1172657.jpg","page_title":"鋼","context_page_description":"鋼とは、炭素を0.04パーセントから2パーセント程度含む鉄の合金。鋼鉄とも呼ばれる。強靭で加工性に優れ、ニッケル・クロムなどを加えた特殊鋼や鋳鋼等とあわせて鉄鋼とも呼ばれ、産業上重要な位置を占める。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_octagon_houses","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/The_Albert_S._Potter_Octagon_House.jpg","page_title":"List of octagon houses","context_page_description":"This is a list of octagon houses. The style became popular in the United States and Canada following the publication of Orson Squire Fowler's 1848 book The Octagon House, A Home for All. In the United States, 68 surviving octagon houses are included on the U.S. National Register of Historic Places. The earliest and most notable octagon house in the Americas was Thomas Jefferson's 1806 Poplar Forest.\\nOrson Squire Fowler's 1848 book The Octagon House, A Home for All and his \\"monumental\\" four-story, 60-room house built during 1848–1853, Fowler's Folly in Fishkill, New York, provided inspiration for a nationwide fad. Fifty-nine of the sixty-six pre-Civil War houses on the NRHP were built between 1849 and 1861. It is reported that the owner of the first-built of these, the Rich-Twinn Octagon House in western New York, was impressed by seeing an octagon house in the Hudson River Valley, presumably Fowler's home under construction."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%BE,_%D0%91%D0%B5%D0%BD%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Ben_Cristovao_-_PA235423.jpg","page_title":"Кристо, Бенни","context_page_description":"Бенни Кристо — чешский певец и спортсмен, специализирующийся на бразильском джиу-джитсу. Должен был представлять Чехию на конкурсе песни Евровидение-2020 с песней «Kemama». Представитель Чехии на конкурсе песни Евровидение-2021."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/James_turrel_Jerusalem.jpg","page_title":"List of public art in Israel","context_page_description":"This is a list of public art in Israel.\\nThis list applies only to works of public art accessible in an outdoor public space. For example, this does not include artwork visible inside a museum."},{"page_url":"https://el.wikipedia.org/wiki/BMW_M3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Black_BMW_M3_E30_fr.jpg","page_title":"BMW M3","context_page_description":"Η BMW M3 είναι η σπορ έκδοση της BMW Σειράς 3, η οποία παράγεται από τη γερμανική αυτοκινητοβιομηχανία BMW. Η πρώτη Μ3 βασίστηκε στη Σειρά 3 E30, λανσαρίστηκε στην αγορά το 1986, και από τότε κάθε Σειρά 3 διαθέτει και μια έκδοση Μ. Το 2007 ξεκίνησε η διάθεση της M3 Ε92, με ισχύ 420 hp, διπλάσια από της αρχικής Μ3, και μάλιστα η M3 Ε92 φέρει τον ελαφρύτερο V8 κινητήρα στον κόσμο. Η νέα γένια M3 F80 παρουσιάστηκε μέσα στο 2014, αλλά είναι πλέον διαθέσιμη μόνο ως σεντάν. H κουπέ και η καμπριολέ έκδοση ονομάζονται M4 Coupe και M4 Convertbile αντίστοιχα. Η BMW σε ανακοίνωση που έβγαλε το φθινόπωρο του 2019, ανήγγειλε οτι η επόμενη γενιά της Μ3 θα βγει στην παραγωγή μετά το 2021."},{"page_url":"https://pl.wikipedia.org/wiki/Krystyna_du%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Christina_of_Lorraine_c_1575.jpg","page_title":"Krystyna duńska","context_page_description":"Krystyna Duńska – księżniczka Danii i Norwegii, najmłodsze dziecko Chrystiana II, króla Danii i Norwegii i Izabeli Habsburg. Poprzez małżeństwo z Franciszkiem II Sforzą została księżną Mediolanu, a po jego śmierci poprzez małżeństwo z Franciszkiem I została księżną Lotaryngii. Była regentką Lotaryngii w latach 1545-1552 podczas małoletności swojego syna. Była również pretendentką do tronów Danii, Norwegii i Szwecji w latach 1561-1590. W końcu była suwerenną panią Tortony w latach 1578-1584."},{"page_url":"https://ba.wikipedia.org/wiki/%D2%A0%D0%BE%D1%8F%D1%88_%D0%BF%D0%B8%D1%80%D0%B0%D0%BC%D0%B8%D0%B4%D0%B0%D2%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/%D0%9F%D0%B8%D1%80%D0%B0%D0%BC%D0%B8%D0%B4%D0%B0_%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B0_%D0%B8_%D0%94%D0%BE%D1%80%D0%BE%D0%B3%D0%B0_%D0%9C%D0%B5%D1%80%D1%82%D0%B2%D1%8B%D1%85.JPG","page_title":"Ҡояш пирамидаһы","context_page_description":"Ҡояш пирамидаһы — Мезоамерикала һәм Теотиуакан ҡалаһында иң ҙур төҙөлгән ҡоролма. Ул Серро-Гордо тауы күләгәһендә Ай пирамидаһы һәм Цитадель араһында Үлеләр Һуҡмағында урынлашҡан һәм ҙур храм комплексының өлөшө булып тора. Пирамида Мексиканың баш ҡалаһы Мехиконың төньяҡ-көнсығышында 40 км алыҫлыҡта урынлашҡан. Паримида бейеклеге 64,01 метр."},{"page_url":"https://hr.wikipedia.org/wiki/Jean_Giraud","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Moebius_Lodz_2008.jpg","page_title":"Jean Giraud","context_page_description":"Jean Giraud; pseudonimi: Gir, Mœbius, također Moebius, francuski autor stripa i dizajner."},{"page_url":"https://no.wikipedia.org/wiki/Richard_Dawkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Richard_Dawkins_Cooper_Union_Shankbone.jpg","page_title":"Richard Dawkins","context_page_description":"Clinton Richard Dawkins er en britisk atferdsbiolog, evolusjonsteoretiker og populærvitenskapelig forfatter som har innehatt Charles Simonyi-professoratet til offentlig forståelse av vitenskap ved University of Oxford.\\nDawkins er mest kjent for boken Det egoistiske genet, som populariserte det gensentriske synet på evolusjonen. Boken innførte også begrepet mem og var dermed med på å grunnlegge disiplinen memetikk. Dawkins er en uforbeholden humanist og skeptiker, og han er et framstående medlem av Brights-bevegelsen. På grunn av sitt forsvar av darwinistisk evolusjon blir han av og til kalt «Darwins rottweiler», et ordspill på Thomas Huxleys epitet «Darwins bulldog».\\nDawkins er også kjent for boken Gud – en vrangforestilling, der han kritiserer religion. Han argumenterer for at det å tro på overmenneskelige guder må betraktes som en vrangforestilling. Hans synspunkter er blitt kritisert av blant annet litteraturviteren Terry Eagleton.\\nI 2006 opprettet Dawkins Richard Dawkins Foundation for Reason and Science, en organisasjon som skal fremme kunnskapen om evolusjonsteorien og motarbeide kreasjonismen."},{"page_url":"https://en.wikipedia.org/wiki/Bucerius_Law_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Bucerius_Law_School_Hamburg_Campus.jpg","page_title":"Bucerius Law School","context_page_description":"Bucerius Law School is a small, private law school located in Hamburg, Germany. The school is the first private law school in Germany and is generally ranked as one of the best law schools in the country. It admits approximately 116 undergraduate students per year, who achieve very high results in the German Judicial Examination."},{"page_url":"https://en.wikipedia.org/wiki/Broken_Hill_Trades_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Broken_Hill_Trades_Hall.jpg","page_title":"Broken Hill Trades Hall","context_page_description":"The Broken Hill Trades Hall is a heritage-listed trades hall at 34 Sulphide Street, Broken Hill, City of Broken Hill, New South Wales, Australia. It was designed by Tom Jackson and built from 1898 to 1905. The property is owned by the Trades Hall Trust. It was added to the New South Wales State Heritage Register on 2 April 1999."},{"page_url":"https://nl.wikipedia.org/wiki/Fotis_Kouvelis","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Fotis_Kouvelis_%28cropped%29.jpg","page_title":"Fotis Kouvelis","context_page_description":"Fotis-Fanourios Kouvelis is een Griekse jurist en een politicus. Hij is de leider van Democratisch Links."},{"page_url":"https://nl.wikipedia.org/wiki/William_Rosecrans","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Braxton_Bragg.jpg","page_title":"William Rosecrans","context_page_description":"William Starke Rosecrans was een uitvinder, voorzitter van een oliemaatschappij, diplomaat, politicus en generaal tijdens de Amerikaanse Burgeroorlog. Hij had grote overwinningen behaald aan het westelijke front, maar zijn militaire loopbaan eindige abrupt na zijn desastreuze nederlaag bij Chickamauga in 1863.\\nNa het afronden van zijn studies aan in West Point, gaf hij les aan de academie en werkte hij mee verschillende ingenieursprojecten. Hij nam ontslag uit het leger om een loopbaan uit te bouwen als burgerlijk ingenieur. Bij het begin van de burgeroorlog voerde hij eenheden uit Ohio aan. Daarmee behaalde hij het eerste succes in westelijk Virginia. Toen hij in 1862 commando’s kreeg aan het westelijk front behaalde hij overwinningen bij Iuka en Corinth. Zijn bevelhebber was Ulysses S. Grant. Zijn bruuske, openhartige wijze en de vele publieke ruzies met zijn superieuren lag aan de basis van een professionele rivaliteit tussen hemzelf enerzijds en Grant en de minister van oorlog Edwin M. Stanton anderzijds. Dit zou zware gevolgen hebben voor zijn militaire loopbaan."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame_de_Chambly","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Chambly_%2860%29%2C_%C3%A9glise_Notre-Dame%2C_nef%2C_3e_trav%C3%A9e%2C_parties_hautes_c%C3%B4t%C3%A9_nord.JPG","page_title":"Église Notre-Dame de Chambly","context_page_description":"L'église Notre-Dame de Chambly est une église catholique paroissiale située au cœur de la ville de Chambly, en France. Selon la tradition, l'impulsion pour sa construction a été donnée par saint Louis, quand il a séjourné dans la ville en 1248. Le chantier n'est apparemment pas lancé tout de suite, mais vers 1260 seulement. Il commence par le chœur, et se termine par la nef vers 1280 environ. Le chœur et ses chapelles adoptent un parti conservateur pour l'époque et affichent un style gothique rayonnant à son apogée, comme au moment de la construction de la Sainte-Chapelle, mais les fenêtres du transept et de la nef indiquent le style rayonnant tardif. En même temps la belle homogénéité de l'ensemble de l'église, la cohérence du plan et l'absence de marques d'interruption des travaux indiquent une progression rapide du chantier, et permettent de conclure à un achèvement vers 1280 environ. Avec une longueur de 53 m et une largeur de 20 m, l'église de Chambly représente l'une des principales réalisations rayonnantes de la région. L'édifice séduit par la clarté de sa conception, sa régularité, son élégance sévère et ses justes proportions."},{"page_url":"https://de.wikipedia.org/wiki/San_Francisco_Cable_Cars","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Historic_cable_car_tokens_from_the_San_Francisco_Cable_car_museum.jpg","page_title":"San Francisco Cable Cars","context_page_description":"Die San Francisco Cable Cars bilden die Kabelstraßenbahn in San Francisco, Kalifornien. Das bei Touristen beliebte Verkehrsmittel ist eines der wenigen beweglichen National Historic Landmarks in den Vereinigten Staaten und ist die einzige verbliebene Kabelstraßenbahn der Welt mit entkoppelbaren Wagen."},{"page_url":"https://de.wikipedia.org/wiki/Kiel-Holtenau","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Schleusen.jpg","page_title":"Kiel-Holtenau","context_page_description":"Kiel-Holtenau ist ein Stadtteil von Kiel. Kiel-Holtenau befindet sich am Endpunkt des Nord-Ostsee-Kanals an der Kieler Förde und ist bekannt für seine großen Schleusen für Seeschiffe und als Standort des Kieler Flugplatzes. Nördlich von Kiel-Holtenau befindet sich der Olympiahafen in Kiel-Schilksee.\\nWahrzeichen Holtenaus sind neben Schleusen und Kanal der Leuchtturm Holtenau und der Tiessenkai. Ein weiteres beliebtes Gebäude ist das Kanal-Packhaus. Die Holtenauer Hochbrücken sind zwar unübersehbar, weisen aber nicht mehr die Besonderheiten der ersten Kanal-Hochbrücke von Friedrich Voß auf, von der nur noch kleinste Reste vorhanden sind."},{"page_url":"https://id.wikipedia.org/wiki/Callisto_(satelit)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/001221_Cassini_Jupiter_%26_Europa_%26_Callisto.jpg","page_title":"Callisto (satelit)","context_page_description":"Callisto adalah satelit planet Jupiter yang ditemukan pada tahun 1610 oleh Galileo Galilei. Callisto merupakan satelit terbesar ketiga di Tata Surya dan terbesar kedua di sistem Jupiter setelah Ganymede. Diameter Callisto kurang lebih sekitar 99% diameter planet Merkurius, tetapi massanya hanya sekitar sepertiganya. Berdasarkan jarak, ia adalah satelit Galileo keempat dari Jupiter, dengan jari-jari orbit sekitar 1.880.000 km. Satelit ini tidak ikut serta dalam resonansi orbit yang memengaruhi tiga satelit Galileo lainnya—Io, Europa, dan Ganymede—dan akibatnya tidak mengalami pemanasan pasang surut. Rotasi Callisto terkunci pasang surut terhadap Jupiter, sehingga belahan yang sama selalu menghadap ke arah Jupiter dan Jupiter tampak diam di langit Callisto. Callisto tidak terlalu terpengaruh oleh magnetosfer Jupiter dibanding satelit Galileo lainnya karena orbitnya yang jauh.\\nCallisto terdiri dari batu dan es, dengan rata-rata massa jenis sekitar 1,83 g/cm³. Senyawa di permukaan yang dideteksi dengan spektroskopi meliputi es air, karbon dioksida, silikat, dan senyawa organik."},{"page_url":"https://no.wikipedia.org/wiki/Giovanni_Francesco_Albani_(1720%E2%80%931803)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Coat_Albani.png","page_title":"Giovanni Francesco Albani (1720–1803)","context_page_description":"Giovanni Francesco Albani også kjent som Gian Francesco Albani var kardinal i Den katolske kirke. Han var med på fire pavevalg og innehadde en rekke ledende embeder i den romerske kurie. Under den første franske invasjon, i 1798, tok han tilflukt i Napoli. Han var tilknyttet Den romerske kurie og var også en tid prefekt for Kongregasjonen for seremoniene."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B9%D9%85%D9%84%D8%A7%D8%AA_%D9%85%D8%B5%D8%B1_%D8%A7%D9%84%D9%85%D8%B9%D8%AF%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/50_Egyptian_piastres_reverse.jpg","page_title":"قائمة عملات مصر المعدنية","context_page_description":null},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_Internacional_Pinto_Martins","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Aeroporto_de_Fortaleza_%283148761440%29.jpg","page_title":"Aeropuerto Internacional Pinto Martins","context_page_description":"El Aeropuerto Internacional Pinto Martins es un aeropuerto internacional situado en Fortaleza, en el estado de Ceará, Brasil. Ofrece conexiones aéreas nacionales e internacionales a la ciudad de Fortaleza.\\nEn 2018, por el aeropuerto pasaron 6.648.967 pasajeros y se registraron 57.465 movimientos de aeronaves, situando al aeropuerto como el décimo segundo aeropuerto con más tráfico de Brasil en términos de pasajeros.​"},{"page_url":"https://en.wikipedia.org/wiki/Governor_of_Negros_Occidental","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Governor_Bong_Lacson_Negros_2019.png","page_title":"Governor of Negros Occidental","context_page_description":"The Governor of Negros Occidental is the local chief executive and head of the Provincial Government of Negros Occidental. Along with the Governor of Negros Oriental and the Mayor of the highly-urbanized City of Bacolod, he serves as one of the chief executives of Negros Island."},{"page_url":"https://de.wikipedia.org/wiki/Oersdorf_(Ahlerstedt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Volksschule-Oersdorf.jpg","page_title":"Oersdorf (Ahlerstedt)","context_page_description":"Oersdorf ist ein Ortsteil der Gemeinde Ahlerstedt im Landkreis Stade. Zu Oersdorf gehört der Weiler Kohlenhausen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD-%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D0%B8%D1%81%D0%BA%D0%BE-%D0%B4%D0%B5-%D0%9C%D0%B0%D0%BA%D0%BE%D1%80%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ayuntamiento-sfm.png","page_title":"Сан-Франсиско-де-Макорис","context_page_description":"Сан-Франсиско-де-Макорис — третий по величине город в Доминиканской Республике. Находится в провинции Дуарте в долине El Cibao, в северо-восточной части острова.\\nНаселение города составляет около 175,5 тыс. человек.\\nИзвестен из-за туризма, производства и культурных мест и в особенности за счёт хорошего проведения отпуска или досуга. Также жители города сыграли значительную роль в формировании Доминиканской истории."},{"page_url":"https://en.wikipedia.org/wiki/Kythira","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Diakofti-port-200408.jpg","page_title":"Kythira","context_page_description":"Kythira is an island in Greece lying opposite the south-eastern tip of the Peloponnese peninsula. It is traditionally listed as one of the seven main Ionian Islands, although it is distant from the main group. Administratively, it belongs to the Islands regional unit, which is part of the Attica region, despite its distance from the Saronic Islands, around which the rest of Attica is centered.\\nThe island is strategically located between the Greek mainland and Crete, and from ancient times until the mid 19th century was a crossroads of merchants, sailors, and conquerors. As such, it has had a long and varied history and has been influenced by many civilisations and cultures. This is reflected in its architecture, as well as the traditions and customs, influenced by centuries of coexistence of the Greek, and Venetian cultures."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9A%E0%B0%BF%E0%B0%B0%E0%B1%81_%E0%B0%AE%E0%B0%82%E0%B0%9A%E0%B1%81%E0%B0%AF%E0%B1%81%E0%B0%97%E0%B0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Les_Tr%C3%A8s_Riches_Heures_du_duc_de_Berry_f%C3%A9vrier.jpg","page_title":"చిరు మంచుయుగం","context_page_description":"మధ్యయుగ వెచ్చని కాలం తరువాత ఏర్పడిన చల్లని కాలాన్ని చిరు మంచుయుగం అంటారు. అది అచ్చమైన మంచుయుగం కానప్పటికీ ఆ పదాన్ని 1939 లో ఫ్రాంకోయిస్ ఇ. మాథెస్ శాస్త్ర పరిభాషలోకి చేర్చాడు. 16 19 శతాబ్దాల మధ్య కాలాన్ని స్వల్పకాలిక మంచుయుగంగా నిర్వచిస్తున్నారు.. అయితే, ఇది 1300 నుండి 1850 వరకూ ఉంటుందని కొందరు భావిస్తున్నారు. ఈ చిరు మంచుయుగపు ఆది అంతాలు విభిన్న ప్రాంతాల్లో విభిన్నంగా ఉండడంతో ఈ విషయమై వాతావరణజ్ఞులు, చారిత్రికులు అంగీకరించే అవకాశం లేదు.\\nనాసా వారి ఎర్త్ అబ్సర్వేటరీ మూడు అతిశీతల కాలాలను నమోదు చేసింది: మొదటిది 1650 లో మొదలు కాగా, రెండవది 1770 లోను, చివరిది 1850 లోనూ మొదలయ్యాయి. ప్రతీ రెండింటి మధ్యా, కాస్త వెచ్చగా ఉండే కాలం ఉంది. వాతావరణ మార్పుల అధ్యయనం కోసం వివిధ దేశాల ప్రభుత్వాలు ఏర్పాటు చేసిన ప్యానెల్, చిరు మంచుయుగం ప్రభావం వలన ప్రాంతీయంగా వాతావరణ మార్పులు ఏర్పడ్డాయి తప్ప, ప్రపంచవ్యాప్తంగా ఏకోన్ముఖంగా గ్లేసియేషను ఏర్పడలేదని చెప్పింది. ఎక్కువలో ఎక్కువగా ఉత్తరార్థగోళం కొంతవరకు చల్లబడింది.\\n13 వ శతాబ్దంలో, ఉత్తర అట్లాంటిక్ సముద్రంలో ప్యాక్ ఐస్ దక్షిణంగా విస్తరించడం మొదలైంది. గ్రీన్‌ల్యాండ్ లోని గ్లేసియర్లు కూడా విస్తరించాయి. ప్రజలు చెప్పేదాన్ని బట్టి, గ్లేసియర్ల విస్తరణ ప్రపంచ వ్యాప్తంగా జరిగింది."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%A5%D5%B2%D5%B1%D5%B8%D6%82%D5%BF%D5%AB_%D5%BE%D5%A1%D5%B6%D6%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Deghdznut_Monastery_D-D_%288%29.jpg","page_title":"Դեղձուտի վանք","context_page_description":"Դեղձուտի վանք, Հայ առաքելական եկեղեցու վանք Հայաստանի Տավուշի մարզի Կիրանց գյուղից հարավ-արևմուտք, Աճարկուտ գյուղից 9 կմ հվ-ամ, անտառում, անտառի խորքում, Դեղձուտ սարալանջին։ Այստեղից բացվում է անտառածածկ լեռների համայնապատկերը, իսկ նրա դիմաց, անդնդախոր ժայռի ծերպերին վեր է խոյանում պատմական Բերդաքարը՝ Մահկանաբերդի իշխանների երբեմնի ամրոցը։ Հուշարձանախմբի կառուցման և անցյալի մասին պատմական և այլ տեղեկություններ մեզ չեն հասել, սակայն հուշարձանների ոճից ելնելով, կարելի է վերագրել 13-րդ դարին, այդ թվագրությունը հաստատում են նաև մի քանի նվիրատվական արձանագրությունները։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Historic_Landmarks_in_Alaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Ladd-aaf-1943.jpg","page_title":"List of National Historic Landmarks in Alaska","context_page_description":"The National Historic Landmarks in Alaska represent Alaska's history from its Russian heritage to its statehood. There are 50 National Historic Landmarks in the state. The United States National Historic Landmark program is operated under the auspices of the National Park Service, and recognizes structures, districts, objects, and similar resources according to a list of criteria of national significance. Major themes include Alaska's ancient cultures, Russian heritage, and role in World War II, but other stories are represented as well. In addition, two sites in Alaska were designated National Historic Landmarks, but the designation was later withdrawn. These sites appear in italics in another table further below.\\nThe National Historic Landmark Program is administered by the National Park Service, a branch of the Department of the Interior. The National Park Service determines which properties meet NHL criteria and makes nomination recommendations after an owner notification process. The Secretary of the Interior reviews nominations and, based on a set of predetermined criteria, makes a decision on NHL designation or a determination of eligibility for designation."},{"page_url":"https://ca.wikipedia.org/wiki/Y_Combinator","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Paul_Graham_talking_about_Prototype_Day_at_Y_Combinator_Summer_2009.jpg","page_title":"Y Combinator","context_page_description":"Y Combinator és una acceleradora que es va llançar el març del 2005. Y Combinator és constantment ranquejada com una de les millors acceleradores de dels EUA."},{"page_url":"https://ast.wikipedia.org/wiki/Andrius_Kubilius","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Balticfreedom_1c558_6368.Andrius_Kubilius.jpg","page_title":"Andrius Kubilius","context_page_description":"Andrius Kubilius físicu y políticu, foi primer ministru de Lituania dende'l 9 d'avientu de 2008 hasta'l 22 de payares de 2012. Tamién ocupó esti cargu ente 1999 y 2000."},{"page_url":"https://de.wikipedia.org/wiki/Portus_Adurni","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Portchester_castle_05.jpg","page_title":"Portus Adurni","context_page_description":"Portus Adurni war ein Limitaneikastell und Flottenstützpunkt der Classis Britannica am Limes der britischen „Sachsenküste“, County of Hampshire/England, Parish Fareham, Ortsteil Portchester in England.\\nEs wurde im 3. Jahrhundert erbaut und war eine der Hauptbasen der römischen Kanalflotte. Sie gilt mit Abstand als die am besten erhaltene römische Festung in Nordeuropa. Im Gegensatz zu vielen anderen Sachsenküstenkastellen blieb das Kastell auch von der Erosion der Küste verschont. Im Hochmittelalter wurde in einer der Kastellecken eine normannische Burg errichtet. Danach wurde es bis ins frühe 19. Jahrhundert für verschiedene militärische Zwecke verwendet. Im inneren ist es weitgehend von den mittelalterlichen Gebäuden geprägt, die St. Marys Kirche und die normannische Burg, dominiert von einem großen Turm der im 12. Jahrhundert errichtet wurde."},{"page_url":"https://sk.wikipedia.org/wiki/Theiophytalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/TheiophytaliaType.jpg","page_title":"Theiophytalia","context_page_description":"Theiophytalia je vyhynutý rod ornitopóda, ktorý žil v období spodnej kriedy na území dnešného Colorada v USA. Typovým a zároveň jediným doteraz známym druhom je Theiophytalia kerri."},{"page_url":"https://it.wikipedia.org/wiki/Marcus_Mariota","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Marcus_Mariota_2018_08-09.jpg","page_title":"Marcus Mariota","context_page_description":"Marcus Ardel Taulauniu Mariota è un giocatore di football americano statunitense che milita nel ruolo di quarterback per i Las Vegas Raiders della National Football League. Fu scelto come secondo assoluto nel Draft NFL 2015 dai Tennessee Titans. Al college giocò a football per i Ducks dell'Università dell'Oregon, vincendo l'Heisman Trophy, il massimo riconoscimento individuale nel football universitario."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Ni%C3%A1gara","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Niagara_River_1_db.jpg","page_title":"Río Niágara","context_page_description":"El río Niágara comunica en dirección norte el lago Erie con el lago Ontario. Sirve de frontera internacional entre la provincia de Ontario, en Canadá, y el estado de Nueva York, en los Estados Unidos.\\nTiene una longitud de 56 km e incluye las famosas cataratas del Niágara. Da nombre al condado de Niágara. Se cree que las cataratas se han desplazado once kilómetros desde su ubicación original en los últimos 12.000 años."},{"page_url":"https://pt.wikipedia.org/wiki/Francisco_Valle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Casa_Francisco_Valle.jpg","page_title":"Francisco Valle","context_page_description":"Francisco Magalhães do Valle foi um compositor e pianista brasileiro. É o patrono da cadeira de número 33 da Academia Brasileira de Música."},{"page_url":"https://sv.wikipedia.org/wiki/Fisera_eribola","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Fisera_eribola_1.jpg","page_title":"Fisera eribola","context_page_description":"Fisera eribola är en fjärilsart som beskrevs av Guest 1887. Fisera eribola ingår i släktet Fisera och familjen mätare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Paludine_commune","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Viviparus_contectus_circulatory_system.png","page_title":"Paludine commune","context_page_description":"La paludine commune est une espèce d'escargots d'eau douce de la famille des Viviparidae. Sa coquille, d'assez grande taille est épaisse et formée de 4 à 5 tours de spires chez l'adulte. La coquille est plus grande que celle de V. viviparus.\\nCe mollusque vit dans les eaux fraiches à tempérées de l'Europe, plutôt lentes. Il serait plus commun que la Paludine vivipare.\\nÀ la différence des limnées et comme certains escargots marins, les Paludines peuvent se protéger de la déshydratation derrière un opercule étanche.\\nL'hybridation interspécifique a pu être obtenue, au moins en laboratoire, et elle produit des hybrides féconds dans certaines configurations de croisements."},{"page_url":"https://en.wikipedia.org/wiki/Die_Dame","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/DieDame1912.jpg","page_title":"Die Dame","context_page_description":"Die Dame was the first illustrated magazine in Germany to cater to the interests of modern women. It was also considered the \\"best journal of its kind in the world market\\" after the First World War. The lifestyle magazine began in 1911 and ended in 1943. Die Dame consisted of essays, illustrations, and photography. The magazine was most active during the shift from the early 1920s, when the magazine celebrated the independent The New Woman, to the mid 1920s when women were portrayed as cold and masculine uniformity."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_Alpes-de-Haute-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Prieur%C3%A9_St_Jean_Taravon_Volonne_2.jpg","page_title":"Liste des monuments historiques des Alpes-de-Haute-Provence","context_page_description":"Cet article recense les monuments historiques des Alpes-de-Haute-Provence, en France."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9D%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Road_Akita.jpg","page_title":"坂","context_page_description":"坂は、一方は高く一方は低い傾斜のある道。また傾斜のある場所。またその傾斜。"},{"page_url":"https://ca.wikipedia.org/wiki/Jorge_Garc%C3%ADa_Casta%C3%B1o","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%28Jorge_Garc%C3%ADa_Casta%C3%B1o%29_Acto_IU_Las_Rozas_Elecciones_Europeas_%28cropped%29.jpg","page_title":"Jorge García Castaño","context_page_description":"Jorge García Castaño és un polític espanyol, diputat de la vi i vii legislatures de l'Assemblea de Madrid, regidor de l'Ajuntament de Madrid des de 2011. Va exercir de delegat de l'àrea de govern municipal d'Economia i Hisenda entre 2017 i 2019."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Bingenheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Schloss_Bingenheim03.jpg","page_title":"Schloss Bingenheim","context_page_description":"Schloss Bingenheim ist eine Schlossanlage des 15. bis 17. Jahrhunderts in Echzell-Bingenheim im Wetteraukreis in Hessen, die aus einer älteren Burganlage hervorgegangen ist. Die Burg befand sich im Mittelalter zunächst in fuldischem Besitz. Ihre größte Bedeutung erlangte sie im späten 17. Jahrhundert, als Wilhelm Christoph von Hessen-Homburg, der Landgraf zu Bingenheim, sie als Residenz schlossartig ausbauen ließ."},{"page_url":"https://en.wikipedia.org/wiki/Otto_Henry_Bacher","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Ponte_del_Pistor%2C_Venice_by_Otto_Henry_Bacher%2C_etching.jpg","page_title":"Otto Henry Bacher","context_page_description":"Otto Henry Bacher was an American artist; primarily known for his etchings and illustrations. He also painted oils in a variety of genres."},{"page_url":"https://id.wikipedia.org/wiki/Lviv","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/POL_Lw%C3%B3w_COA.svg","page_title":"Lviv","context_page_description":"L'viv adalah sebuah kota yang sekarang terletak di sebelah barat Ukraina. Kota ini memiliki penduduk sekitar 730.000 jiwa"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Director_Chaz_Singleton_and_rapper_BG_%28cropped%29.jpg","page_title":"Lijst van personen geboren in 1980","context_page_description":"Dit is een lijst van personen die geboren zijn in 1980.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fi.wikipedia.org/wiki/Dmitri_Sadovnikov","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Dmitrij_Nikolaevich_Sadovnikov_-_portrait.jpg","page_title":"Dmitri Sadovnikov","context_page_description":"Dmitri Nikolajevitš Sadovnikov oli venäläinen runoilija ja kansatieteilijä. Hän on sanoittanut muun muassa kansansävelmän Stenka Razinista."},{"page_url":"https://fi.wikipedia.org/wiki/Armas_Honkasalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Honkasalo.JPG","page_title":"Armas Honkasalo","context_page_description":"Kaarlo Armas Honkasalo oli sahatyömies ja ammattiyhdistysaktiivi, joka Suomen sisällissodan aikana oli yksi Porin punakaartin päälliköistä. Hänet teloitettiin toukokuussa 1918 Viipurin vankileirillä."},{"page_url":"https://en.wikipedia.org/wiki/Bromarv","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Bromarv._Kyl%C3%A4nraitti_2019.jpg","page_title":"Bromarv","context_page_description":"Bromarv is a village and former municipality of Finland comprising the former municipalities Tenala together with the town of Ekenäs. It was merged with Pohja and Karis to form the new municipality of Raseborg on January 1, 2009.\\nBromarv was located in the province of Southern Finland and was part of the Uusimaa region.\\nThe town was bilingual, with the majority being Swedish speakers.\\nIt is noted for its archipelago, part of which is the Raseborgs västra skärgård."},{"page_url":"https://da.wikipedia.org/wiki/Bjerg%C3%A6renpris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Veronica_montana.jpeg","page_title":"Bjergærenpris","context_page_description":"Bjergærenpris, ofte skrevet bjerg-ærenpris, er en flerårig, 10-30 centimeter høj plante i vejbred-familien. Den ligner tveskægget ærenpris, men bladene er tydeligt stilkede og stænglen er alsidigt håret. Desuden er blomsterne blegblå til lyst rosa.\\nI Danmark er arten temmelig almindelig i løvskove på muldbund, ofte på fugtige steder. Den blomstrer i maj til juli."},{"page_url":"https://ca.wikipedia.org/wiki/Arsenuranospatita","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Arsenuranospathite%2C_Menzenschwand.jpg","page_title":"Arsenuranospatita","context_page_description":"L'arsenuranospatita és un mineral de la classe dels arsenats. Rep el seu nom de la seva composició com anàleg amb arsenat de la uranospatita."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D6%84%D5%A1%D5%B5%D5%AC%D5%A1%D5%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Skylab4_crew.jpg","page_title":"Սքայլաբ","context_page_description":"«Սքայլաբ», երկնային լաբորատորիա, ամերիկյան առաջին բնակելի ուղեծրակայանի անվանումը, նրա մշակման ծրագիրը։ Ուղեծիր է դուրս բերվել 1973 թվականի մայիսի 14-ին։ Տիեզերագնացներն ուղեծրակայան են հասցվել և Երկիր վերադարձել «Ապոլլոն» տիեզերանավերով։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_from_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Charlesparham.png","page_title":"List of people from Iowa","context_page_description":"This is a list of notable people who were born in or closely associated with the American state of Iowa. People not born in Iowa are marked with §."},{"page_url":"https://es.wikipedia.org/wiki/Cryptoprocta_ferox","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Cryptoprocta_Ferox.JPG","page_title":"Cryptoprocta ferox","context_page_description":"El fosa es una especie de mamífero carnívoro de la familia Eupleridae.​ Es el carnívoro nativo más grande de Madagascar. A pesar de su gran parecido, tanto físico como en costumbres, con los félidos, el fosa es en realidad un representante de los eupléridos. Dada la ausencia de otros mamíferos carnívoros en Madagascar, el fosa es el depredador dominante de la isla y principal cazador de los lémures después del hombre. El gran tamaño de los animales actuales es un claro ejemplo de gigantismo insular.\\nEl nombre procede del malgache, aunque su fonética se vio alterada en el proceso, pues la palabra local para designar a este animal es algo parecido a Fusa.\\nNo se debe confundir este animal con otro euplérido, cuyo nombre científico puede llevar a equívocos.\\nEl fosa fue formalmente descrito en 1833 por Edward Turner Bennett. El nombre del género Cryptoprocta hace referencia a como la bolsa anal esconde el ano del animal, de las palabras en griego antiguo crypto- \\"esconder\\" y procta \\"ano\\".​ el nombre de la especie ferox proviene del latín \\"feroz\\" o \\"salvaje\\"​ Su nombre común en malgache, es fossa o fosa.\\".​"},{"page_url":"https://ru.wikipedia.org/wiki/300-%D0%BB%D0%B5%D1%82%D0%B8%D0%B5_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Ship_on_the_Neva.jpg","page_title":"300-летие Санкт-Петербурга","context_page_description":"300-летие Санкт-Петербурга — день города, масштабно праздновавшийся на городском, федеральном и мировом уровнях с 27 мая по 1 июня 2003 года."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%B2%D1%96%D0%B7_%D0%A4%D1%80%D1%8F%D0%B7%D1%96%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Hansaray_Iron_Gate_1.jpg","page_title":"Алевіз Фрязін","context_page_description":"Алевіз Фрязін — італійський архітектор.\\nВ 1503 році працював в Криму, де почав будівництво Бахчисарайського палацу. Тут зберігся так званий «Портал Демір-Капи» — кам'яний портал коринфського ордера, виконаний в стилі італійського Відродження.\\nУ 1503—1508 роках працював у Москві, де спорудив Троїцький міст."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D1%8C%D1%8F%D0%BD%D1%83%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Villan%C3%BAa%2C_une_fontaine.jpg","page_title":"Вильянуа","context_page_description":"Вильянуа — населённый пункт и муниципалитет в Испании, входит в провинцию Уэска, в составе автономного сообщества Арагон. Муниципалитет находится в составе района Хасетания. Занимает площадь 58,2 км². Население — 475 человек. Расстояние — 87 км до административного центра провинции."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D1%82%D0%B5%D1%80%D0%BC%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D0%BF%D0%BB%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BD%D0%B0%D1%81%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Pond_Loop_Close_Up.jpg","page_title":"Геотермальный тепловой насос","context_page_description":"Геотермальный тепловой насос — система центрального отопления и/или охлаждения, использующая тепло земли, тип теплового насоса. Земля в геотермальных системах является радиатором в летний период или источником тепла в зимний период. Разница температур грунта используется, чтобы повысить эффективность и снизить эксплуатационные расходы системы обогрева и охлаждения, и может дополняться солнечным отоплением. Геотермальные тепловые насосы используют явление тепловой инерции: температура земли ниже 6 метров примерно равна среднегодовой температуре воздуха в данной местности и слабо изменяется в течение года."},{"page_url":"https://es.wikipedia.org/wiki/Lotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Giovanni_Bellini_and_Titian_-_The_Feast_of_the_Gods_-_Detail-_figures_right_%26_tub_with_script.jpg","page_title":"Lotis","context_page_description":"En la mitología griega, Lotis es una náyade.\\nEs citada brevemente dos veces por Ovidio, que no especifica su ascendencia. En Las metamorfosis, refiere de pasada su historia: perseguida por Príapo, fue transformada en árbol de loto para escapar de él. Sin embargo, en los Fastos da Ovidio una versión más completa, según la cual el asno de Sileno se puso a rebuznar cuando Príapo se acercó a la adormilada náyade; asustada, ésta huyó dando grandes gritos, y despertó así a los demás dioses, que se burlaron de Príapo."},{"page_url":"https://en.wikipedia.org/wiki/Arizpe_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Acanthite_-_Arizpe%2C_Sonora%2C_Mexico.jpg","page_title":"Arizpe Municipality","context_page_description":"Arizpe is a municipality in Sonora in north-western Mexico."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%90%A8%E5%88%A9_(%E5%8D%97%E5%8D%A1%E7%BD%97%E6%9D%A5%E7%BA%B3%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/SCMap-doton-Salley.PNG","page_title":"萨利 (南卡罗来纳州)","context_page_description":"萨利，是美国南卡罗来纳州下属的一座城市。城市类型是“Town”。其面积大约为2.7平方英里。根据2010年美国人口普查，该市有人口398人，人口密度约为每平方 英里147.24人。"},{"page_url":"https://ceb.wikipedia.org/wiki/Siesikai","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Siesikai_paminklas.JPG","page_title":"Siesikai","context_page_description":"Lungsod ang Siesikai sa Lyetuwanya. Nahimutang ni sa sentro nga bahin sa nasod, 80 km sa amihanan-kasadpan sa Vilnius ang ulohan sa nasod. 76 metros ibabaw sa dagat kahaboga ang nahimutangan sa Siesikai, ug adunay 601 ka molupyo.\\nAng yuta palibot sa Siesikai kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 97 ka metro ug 1.9 km sa kasadpan sa Siesikai. Dunay mga 35 ka tawo kada kilometro kwadrado sa palibot sa Siesikai medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Ukmerge, 16.7 km sa sidlakan sa Siesikai. Hapit nalukop sa kaumahan ang palibot sa Siesikai.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Pebrero, sa -10 °C."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AD%A6%E6%BC%A2%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/%E6%B1%9F%E6%BC%A2%E6%A9%8B.jpg","page_title":"武漢市","context_page_description":"武漢市は、中華人民共和国の中部、湖北省の東部、長江とその最大の支流漢江の合流点に位置する都市である。中国中部地方及び長江中流域唯一のメガシティで、湖北省の省都および華中地方唯一の副省級市でもある。また、中国有数の工業都市、文教都市及び交通要衝でもある。市の総面積は8569.15平方キロメートルであり、人口は1089.29万人である。市政府の所在地は江岸区沿江大道188号である。"},{"page_url":"https://en.wikipedia.org/wiki/Garak_Market_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Seoul-metro-817-Garak-market-station-platform-20181124-162212.jpg","page_title":"Garak Market station","context_page_description":"Garak Market is a station on the Seoul Subway Line 8. It was connected Seoul Subway Line 3 on February 18, 2010. Garak Market Station is nearby Garak Market, which is one of the largest whole-sale centers in Seoul. It is also near GS Mart, which is a large supermarket."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AF%81_%E0%AE%9A%E0%AE%AE%E0%AE%B0%E0%AF%8D,_%E0%AE%AA%E0%AE%BF%E0%AE%B2%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%80%E0%AE%A9%E0%AF%8D%E0%AE%9A%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ph_locator_map_eastern_samar.png","page_title":"கிழக்கு சமர், பிலிப்பீன்சு","context_page_description":"கிழக்கு சமர் என்பது பிலிப்பீன்சின் விசயாசின், கிழக்கு விசயாசுப் பிராந்தியத்தில் அமைந்துள்ள ஆறு மாகாணங்களில் ஒன்றாகும். இதன் தலைநகரம் பொரொங்கன் ஆகும். இம்மாகாணம் 1965 ஆம் ஆண்டில் ஸ்தாபிக்கப்பட்டது. இதன் தற்போதைய மாகாண சபை ஆளுநர் கொன்ராடோ பி. நிகார்ட்ஜே, ஆர். ஆவார். இதன் மொத்த நிலப்பரப்பளவு 4,660.47 சதுர கிலோமீற்றர்கள் ஆகும். 2015 ஆம் ஆண்டின் சனத்தொகைக் கணக்கெடுப்புக்கு அமைவாக கிழக்கு சமர் மாகாணத்தின் சனத்தொகை 467,160 ஆகும்.\\nமேலும் பிலிப்பீன்சில் காணப்படும் 81 மாகாணங்களில், மொத்த நிலப்பரப்பளவின் அடிப்படையில் இம்மாகாணம் 24ஆம் மாகாணமாகவும் சனத்தொகையின் அடிப்படையில் 58ஆம் மாகாணமாகவும் காணப்படுகின்றது. இம்மாகாணத்தில் 132 கிராமங்களும், 22 மாநகராட்சிகளும் உள்ளன. அத்துடன் இம்மாகாணத்தில் தகலாகு, ஆங்கிலம் உள்ளடங்கலாக நான்கு பிரதான மொழிகள் பேசப்படுகின்றன. மார்ச் 12, 1521 அன்று மகலன் வந்து இறங்கிய பிலிப்பீன்சின் முதலாவது இடம் இது என வரலாற்று ஆய்வாளர்கள் குறிப்பிடுகின்றனர்."},{"page_url":"https://war.wikipedia.org/wiki/Hispidoberyx_ambagiosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Hispidoberyx_ambagiosus.jpg","page_title":"Hispidoberyx ambagiosus","context_page_description":"An Hispidoberyx ambagiosus in uska species han Actinopterygii nga ginhulagway ni Kotlyar hadton 1981. An Hispidoberyx ambagiosus in nahilalakip ha genus nga Hispidoberyx, ngan familia nga Hispidoberycidae. Waray hini subspecies nga nakalista."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%BB%A8%E6%B5%B7%E5%8E%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Binhai.jpg","page_title":"滨海县","context_page_description":"濱海縣位於中國江蘇省東北部，蘇北灌溉總渠橫貫，濱臨黃海，是鹽城市下轄的一個縣。南距鹽城80公里，北距歐亞大陸橋東橋頭堡連雲港不足100千米。海岸線44.6千米，人口116.15萬。"},{"page_url":"https://fr.wikipedia.org/wiki/Thannerhubel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Thann_vue_depuis_le_Rangen.jpg","page_title":"Thannerhubel","context_page_description":"Le Thannerhubel est un sommet du massif des Vosges culminant à 1 183 mètres d'altitude dans le département français du Haut-Rhin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D1%85%D1%80%D0%B8%D1%81%D0%B0%D0%B1%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Shahrisabz_Chorsu_01.jpg","page_title":"Шахрисабз","context_page_description":"Шахриса́бз — город, административный центр Шахриса́бзского района Кашкадарьинской области Узбекистана. Один из древнейших городов Центральной Азии.\\nШахриса́бз — город в Кашкадарьинской области Узбекистана, расположенный между притоками реки Кашкадарьяː Оксув на севере и Танхаздарья на юге.\\nЧисленность населения по состоянию на 1 января 2014 года составляет 100,3 тыс. жителей[1], на 1991 год — 53 тыс. жителей. Есть аэропорт и железнодорожная станция Китаб, которая в 1959 году перестала быть самостоятельной единицей Шахрисабзского района и вошла в состав города Шахрисабз."},{"page_url":"https://it.wikipedia.org/wiki/Hugh_Pigot_(capitano_Royal_Navy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Capture_of_Hermione.jpg","page_title":"Hugh Pigot (capitano Royal Navy)","context_page_description":"Hugh Pigot è stato un militare britannico.\\nAttraverso la sua rete di amicizie, fu in grado di salire al rango di capitano, nonostante le apparenti scarse capacità di leadership e una reputazione di brutalità. Mentre era capitano dell'HMS Hermione provocò l'ammutinamento dei suoi uomini. L'ammutinamento, che divenne uno dei più sanguinosi nella storia della Royal Navy, provocò la morte di Pigot e di altri nove ufficiali. La Marina poi condannò a morte alcuni ammutinati che aveva catturato e riconquistò la nave dagli spagnoli, alla quale gli ammutinati l'avevano consegnata."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%99%D7%A8%D7%A7%D7%95%D7%98%D7%A1%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Irkutsk_%28IKT_-_UIII%29_AN2335801.jpg","page_title":"אירקוטסק","context_page_description":"אירקוטסק היא בירת מחוז אירקוטסק\\nאירקוטסק מהווה ריכוז אוכלוסייה גדול, מרכז תעשייתי ומסחרי, מרכז צבאי, מקום מושבם של הארכיבישופים של הכנסייה הרוסית הפרבוסלבית ושל מספר מלומדים ואנשי רוח. היא נמצאת במרחק נסיעה של 5,185 קילומטר ממוסקבה ברכבת.\\nהעיר שוכנת על גדתו הימנית של הנהר אנגרה, יובל של היניסיי. פרבר גלסקובסק שוכן על הגדה הנגדית ומחבר ביניהם גשר באורך 1,900 מטר. אירקוט, על שמו קרויה העיר, נשפך אל האנגרה מול העיר בדיוק."},{"page_url":"https://az.wikipedia.org/wiki/Milli_kitabxanalar%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Biblioth%C3%A8que_nationale_du_Liban_1.jpg","page_title":"Milli kitabxanaların siyahısı","context_page_description":"Milli kitabxana bu ölkənin qabaqcıl məlumat bazası kimi xidmət etmək məqsədi ilə hökumət tərəfindən xüsusi yaradılır. İctimai kitabxanaların əksinə onlar vətəndaşlara nadir hallarda kitabları borc verirlər. Bir çox halda onların tərkibinə Qutenberq Bibliyası kimi nadir, qiymətli və əhəmiyyətli əsərlər daxil edilir. Milli kitabxanalar ölkədəki digər kitabxanalardan ölçüsünə görə müqayisədə xeyli fərqlənir.\\nMündəricat: Top · 0–9 A B C Ç D E Ə F G H X İ J K Q L M N O Ö P R S Ş T U Ü V Y Z"},{"page_url":"https://en.wikipedia.org/wiki/Azhikode_and_Azhikkal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%E0%B4%B5%E0%B4%BF%E0%B4%B7%E0%B5%8D%E0%B4%A3%E0%B5%81%E0%B4%AE%E0%B5%82%E0%B5%BC%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B4%BF_%E0%B4%87%E0%B4%B0%E0%B4%BF%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%A8%E0%B5%8D%E0%B4%A8%E0%B5%81.JPG","page_title":"Azhikode and Azhikkal","context_page_description":"Azhikode is a coastal village situated in Kannur district of Kerala, south India. The northern end of the village is called Azhikkal. The place is the birthplace of Sukumar Azhikode, an influential thinker and literary critic. It is about 5 km from Kannur."},{"page_url":"https://en.wikipedia.org/wiki/Interlaken","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/View_from_Hoheweg.JPG","page_title":"Interlaken","context_page_description":"Interlaken is a Swiss town and municipality in the Interlaken-Oberhasli administrative district in the canton of Bern. It is an important and well-known tourist destination in the Bernese Highlands region of the Swiss Alps, and the main transport gateway to the mountains and lakes of that region.\\nThe town is located on the flat alluvial land called Bödeli between two lakes, Brienz to the east and Thun to the west, and alongside the river Aare, which flows between them. Transport routes to the east and west alongside the lakes are complemented by a route southwards into the near mountain resorts and high mountains, e.g. the famous high Alpine peaks of Eiger, Mönch, and Jungfrau, following upwards the Lütschine.\\nInterlaken is the central town of a Small Agglomeration with the same name of 23,300 inhabitants.\\nThe official language of Interlaken is German, but the main spoken language is the local variant of the Alemannic Swiss German dialect."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%A3%E1%83%96%E1%83%90%E1%83%9C%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/A%C4%9Fdamda_%C3%A7ay_evinin_qar%C5%9F%C4%B1s%C4%B1.jpg","page_title":"ქუზანლი","context_page_description":"ქუზანლი — სოფელი აზერბაიჯანში, აღდამის რაიონში. მოსახლეობის რაოდენობა — 13 002 კაცი."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Germier_(Deux-S%C3%A8vres)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Map_commune_FR_insee_code_79256.png","page_title":"Saint-Germier (Deux-Sèvres)","context_page_description":"Saint-Germier es una población y comuna francesa, situada en la región de Poitou-Charentes, departamento de Deux-Sèvres, en el distrito de Parthenay y cantón de Ménigoute."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E4%B8%8B%E9%89%8481-760/761%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/81-760A_on_Juzhnaya_metro_station.jpg","page_title":"地下鉄81-760/761形電車","context_page_description":"81-760/761形は、ロシア連邦のメトロワゴンマッシュとトヴェリ車両工場が製造を手掛けた地下鉄用電車。オカ川にちなんだオカという愛称が付けられており、モスクワ地下鉄とバクー地下鉄に導入されている。\\nこの項目では、十月電車修理工場が製造した同型車両である81-780/781形についても解説する。"},{"page_url":"https://pl.wikipedia.org/wiki/Paciorecznik_indyjski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Cannaindica2.jpg","page_title":"Paciorecznik indyjski","context_page_description":"Paciorecznik indyjski – gatunek rośliny z rodziny paciorecznikowatych. Występuje w strefie międzyzwrotnikowej. Wbrew swojej nazwie nie pochodzi z Indii, lecz z północnego i środkowego Meksyku i Ameryki Południowej. Gatunek introdukowany do flory Stanów Zjednoczonych, w wielu miejscach uprawiany i naturalizowany. Jest jednym z gatunków wyjściowych, z których ogrodnicy wyhodowali mieszańca zwanego paciorecznikiem ogrodowym."},{"page_url":"https://no.wikipedia.org/wiki/Bl%C3%A5gr%C3%A5tt_kveldfly","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Acronicta_euphorbiae.male.jpg","page_title":"Blågrått kveldfly","context_page_description":"Blågrått kveldfly er en sommerfugl som tilhører familien nattfly. Denne arten har vinger som er mønstret i grått og svart, uten noen lysere flekker. Den kan kjennes på at tverrlinjene på forvingene er doble."},{"page_url":"https://vi.wikipedia.org/wiki/Croatia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Banski_dvori_2009.jpg","page_title":"Croatia","context_page_description":"Croatia, tên chính thức Cộng hòa Croatia là một quốc gia nằm ở ngã tư của Trung và Đông Nam Âu, giáp biển Adriatic. Thủ đô Zagreb tạo thành một trong những phân khu chính của đất nước, cùng với hai mươi quận. Croatia có diện tích 56.594 kilômét vuông và dân số năm 2019 là 4,076,246 người, hầu hết dân số là người theo Công giáo La Mã.\\nNgười Croatia đến khu vực này vào thế kỷ thứ 6 và tổ chức nhà nước thành hai lãnh địa công tước vào thế kỷ thứ 9. Tomislav I trở thành vị vua đầu tiên vào năm 925, phát triển Croatia thành một vương quốc, giữ được chủ quyền của nó trong gần hai thế kỷ, đạt đến cực thịnh trong thời cai trị của các vị vua Petar Krešimir IV và Zvonimir. Croatia gia nhập một liên minh cá nhân với Vương quốc Hungary năm 1102. Năm 1527, phải đối mặt với cuộc xâm lược của Ottoman, Quốc hội Croatia đã bầu Ferdinand của nhà Habsburg lên ngai vàng Croatia. Trong đầu thế kỷ 19, các phần của đất nước được chia thành Các tỉnh Illyrian của Pháp trong khi đế quốc Áo-Hung chiếm đóng Bosna và Hercegovina - một tranh chấp được giải quyết theo Hiệp ước Berlin."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%99%E1%83%A3%E1%83%9E%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/10_%D0%BA%D1%83%D0%BF%D0%BE%D0%BD%D0%BE%D0%B2_%D0%BB%D0%B0%D1%80%D0%B8._1._1993.jpg","page_title":"ქართული კუპონი","context_page_description":"ქართული კუპონი — საქართველოს ფულის ერთეული 1993 წლის 5 აპრილიდან 1995 წლის 2 ოქტომბრამდე. 1993 წლის 20 აგვისტოდან წარმოადგენდა გადახდის ერთადერთ კანონიერ საშუალებას საქართველოს ტერიტორიაზე. თავდაპირველად კურსი რუბლის თანაბარი იყო, სწორედ რომლის შემცვლელიც იყო ეს ვალუტა. გამოდიოდა მხოლოდ ბანკნოტები, რაოდენობით 1-დან 1 000 000 კუპონამდე. კუპონი ჰიპერ ინფლაციის ქვეშ ექცეოდა და შეცვლილი იყო ახალი ეროვნული ვალუტის მიერ — ლარი კოეფიციენტით 1 000 000: 1."},{"page_url":"https://id.wikipedia.org/wiki/Batu_Socotra","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/JADIZ_and_CADIZ_and_KADIZ_in_East_China_Sea.jpg","page_title":"Batu Socotra","context_page_description":"Batu Socotra adalah terumbu di Laut Kuning yang terletak 4,6 meter di bawah permukaan laut. Hukum laut internasional menetapkan bahwa batu atau karang yang tenggelam di bawah permukaan air laut yang terletak di luar batas teritorial laut suatu negara tidak dapat diklaim sebagai wilayah oleh negara mana pun. Namun kenyataannya, Batu Socotra merupakan subjek sengketa wilayah maritim antara Korea Selatan dan Tiongkok, yang menganggap batu terebut berada di dalam zona ekonomi eksklusif negara masing-masing.\\nBatu Socotra terletak pada 149 kilometer barat daya Pulau Mara di Korea Selatan, dan 287 km dari Pulau Yushan, Zhejiang, di Tiongkok. Batu tersebut saat ini berfungsi sebagai fondasi bagi Stasiun Penelitian Laut Ieodo milik Korea Selatan. Di stasiun penelitian tersebut juga terdapat sebuah landasan helipad untuk helikopter pengangkut suplai logistik ke stasiun penelitian tersebut."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%91%A9%E6%8B%89%E7%B6%AD%E4%BA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Tel%C4%8D.jpg","page_title":"摩拉維亞","context_page_description":"摩拉维亚，为捷克东部一地区，得名于起源该地区的摩拉瓦河。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Barkelsby","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Gut_Hohenstein_Meierei.jpg","page_title":"Liste der Kulturdenkmale in Barkelsby","context_page_description":"In der Liste der Kulturdenkmale in Barkelsby sind alle Kulturdenkmale der schleswig-holsteinischen Gemeinde Barkelsby und ihrer Ortsteile aufgelistet."},{"page_url":"https://es.wikipedia.org/wiki/Armu%C3%B1a_de_Taju%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Escudo_de_Armu%C3%B1a_de_Taju%C3%B1a.svg","page_title":"Armuña de Tajuña","context_page_description":"Armuña de Tajuña es un municipio español perteneciente a la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. En 2015 contaba con una población de 240 habitantes."},{"page_url":"https://sv.wikipedia.org/wiki/Pilanesberg_Game_Reserve","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Pilanesberg-Salt_lick-002.jpg","page_title":"Pilanesberg Game Reserve","context_page_description":"Pilanesberg Game Reserve är ett naturskyddsområde i norra Sydafrika kring den slocknade vulkanen Pilanesberg. Området marknadsförs som en nationalpark. Det administrativa centrum ligger i områdets mitt nära sjön Mankwe Dam.\\nSkyddszonen ligger i Nordvästprovinsen och den bildades 1979 när stora delar av området blev inhägnad. Reservatet är cirka 580 km² stort. Här lever bland annat de fem kända storviltarterna samt fler än 350 olika fågelarter.\\nVäxtlivet är varierande på grund av att reservatet ligger vid gränsen mellan Kalahariöknen och stäppen Veld. Typiska större växter är ormaloe, Calodendrum capense, marula, buskar av släktet Tarchonanthus, Burkea africana och Berchemia zeyheri.\\nI nordväst gränsar Black Rhino Game Reserve till naturskyddsområdet."},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Cornwall","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Lighthouse_sunset_-_geograph.org.uk_-_84855.jpg","page_title":"Civil parishes in Cornwall","context_page_description":"A civil parish is a country subdivision, forming the lowest unit of local government in England. There are 218 civil parishes in the ceremonial county of Cornwall, which includes the Isles of Scilly. The county is effectively parished in its entirety; only the unpopulated Wolf Rock is unparished. At the 2001 census, there were 501,267 people living in the current parishes, accounting for the whole of the county's population. The final unparished areas of mainland Cornwall, around St Austell, were parished on 1 April 2009 to coincide with the structural changes to local government in England.\\nPopulation sizes within the county vary considerably, Falmouth is the most populous with a population of 25,223, recorded in 2001, and St Michael's Mount the least with 29 residents. The county is governed by two separate unitary authorities; Cornwall Council covers mainland Cornwall and the Isles of Scilly are administered by their own unitary authority."},{"page_url":"https://oc.wikipedia.org/wiki/Mitologia_chinesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Yellow_Emperor.jpg","page_title":"Mitologia chinesa","context_page_description":"La mitologia chinesa es l'ensems dels relats fantastics eissits de la cultura de la China anciana. Fòrça de las siás legendas an luòc pendent lo periòde dels tres augusts e cinc emperaires. Malgrat l'influéncia de la civilizacion japonesa anciana, una granda part de la mitologia chinesa es unica. La mitologia chinesa se coneis mercé a de tèxtes que datan essencialament de la dinastia An. E mai qu'ajan mai de 2000 ans d'antiquitat, aqueles escrits se classifican coma \\"recents\\". De mai, foguèron redigits per de dòctes que reïnterpretèron de còps la mitologia d'acòrd amb las siás concepcions filosoficas. D'aquela manièra transformèron los dieus mai importants en sobeirans vertuoses, que regnavan en los temps ancians. Associèron tanben los sieus dieus amb las cinc direccions segon una cosmologia elaborada pendent l'Antiquitat primairenca. Se pòt aver una idèa de çò qu'èra la mitologia chinesa \\"originala\\" en la comparant amb los relats d'autres pòbles de l'Extrèm Orient. En espandir aquela comparason a tota Eurasia, se pòt apreciar qu'una granda part d'aquela mitologia es d'origina indoeuropèa."},{"page_url":"https://it.wikipedia.org/wiki/Guy_Evans","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Guy_Evans.jpg","page_title":"Guy Evans","context_page_description":"Guy Randolph Evans è un percussionista britannico.\\nConosciuto principalmente per la sua partecipazione al gruppo di rock progressivo dei Van der Graaf Generator, Evans ha collaborato con altri musicisti e molto spesso proprio con gli altri membri dei VdGG, come sull'album The Long Hello.\\nMentre frequentava l'Università di Warwick, Evans suonava in un gruppo universitario chiamato The New Economic Model. Il gruppo suonava principalmente musica soul americana nelle feste da ballo universitarie, ma si esibì anche come gruppo spalla a band del calibro dei Pink Floyd e dei The Move.\\nDopo aver inciso nel 1969 due singoli con i Misunderstood, inizia la sua collaborazione con i VdGG, fino al secondo scioglimento nel 1978. Dopo varie collaborazioni, Evans ha suonato fin dal 2002 con i Subterraneans ed attualmente suona con gli Echo City, un gruppo che utilizza e costruisce \\"terreni di gioco sonori\\", costruzioni all'aperto che possono essere usate per fare musica, soprattutto per bambini disabili. Ha quindi preso parte alla terza riunione dei VdGG del 2005, con i quali ancora collabora."},{"page_url":"https://pt.wikipedia.org/wiki/Linha_a%C3%A9rea_regional","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Hop%21_Canadair_CRJ100ER%3B_F-GRJO%40ZRH%3B01.04.2013_702co_%288669240431%29.jpg","page_title":"Linha aérea regional","context_page_description":"Uma linha aérea regional ou companhia aérea regional, é uma companhia aérea cuja operação se limita a voos de curta/média distância e duração, e que utiliza aeronaves de pequeno porte.\\nEstas companhias servem para ligar passageiros a linhas aéreas de longo-curso, que utilizam aviões de grande dimensão, e a cidades de pequena dimensão a grandes centros urbanos.\\nNa Europa, a associação que reúne as companhias aéreas regionais é a European Regions Airline Association."},{"page_url":"https://it.wikipedia.org/wiki/Capi_di_governo_della_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/France_Chambre_des_deputes_1932.png","page_title":"Capi di governo della Francia","context_page_description":"Questa pagina contiene l'elenco dei capi di Governo della Francia, dal 1624 ad oggi.\\nNel corso del tempo, essi hanno portato titoli diversi:\\n1624-1789: sotto la monarchia, il ministro più influente del governo, che ne assumeva de facto la direzione, era designato con il titolo ufficioso di «Principale ministro di Stato»;\\n1815-1849: con la Restaurazione, fu introdotto il titolo di «Presidente del Consiglio dei ministri», che fu mantenuto fino alla seconda repubblica;\\n1871-1940: con la terza repubblica, uno dei ministri portava inizialmente il titolo, semi-ufficiale, di «Vicepresidente del Consiglio dei ministri», quindi dal 1876 di «Presidente del Consiglio dei ministri», benché fosse, in effetti, il presidente della Repubblica a presiedere i consigli dei ministri;\\n1940-1944: sotto il regime di Vichy, fu utilizzato prima il titolo di «vicepresidente del Consiglio dei ministri», poi quello di «capo del governo»;\\n1947-1959: il titolo di «Presidente del Consiglio dei ministri» venne finalmente incluso nella costituzione della quarta Repubblica nel 1946, proprio al fine di rafforzare quella posizione;"},{"page_url":"https://de.wikipedia.org/wiki/Marienstra%C3%9Fe_(Hannover)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ernst_Walther_AK_0203_Hannover._Marienstrasse._Bildseite_...jpg","page_title":"Marienstraße (Hannover)","context_page_description":"Die Marienstraße ist eine Hauptausfallstraße im Hannoverschen Stadtteil Südstadt.\\nSie wurde zur Zeit des Königreichs Hannover nach der Marienkapelle vor dem Aegidientor benannt."},{"page_url":"https://sh.wikipedia.org/wiki/Oprtalj","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Oprtalj%2C_the_belfry_of_the_St._George_church.jpg","page_title":"Oprtalj","context_page_description":"Oprtalj - Portole, gradić i sjedište istoimene općine u sjeveroapadnoj Istri. Nalazi se u Istarskoj županiji."},{"page_url":"https://da.wikipedia.org/wiki/Greve_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Greve_Kirke_Roskilde_Denmark_belfry.jpg","page_title":"Greve Kirke","context_page_description":"Greve Kirke ligger i Greve Sogn i Greve Kommune."},{"page_url":"https://en.wikipedia.org/wiki/USS_Tulagi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/USS_TULAGI_%28CVE-72%29.jpg","page_title":"USS Tulagi","context_page_description":"USS Tulagi was a Casablanca-class escort carrier of the United States Navy.\\nShe was laid down on 7 June 1943 at Vancouver, Washington, United States, by the Kaiser Company, Inc., as Fortazela Bay; and redesignated CVE-72 on 15 July 1943. However, her name was corrected to read Fortaleza Bay on 19 October 1943, and the ship was renamed Tulagi on 6 November 1943; launched on 15 November 1943; sponsored by Mrs. James Duke Earner; and commissioned on 21 December 1943, Capt. Joseph Campbell Cronin in command."},{"page_url":"https://eu.wikipedia.org/wiki/Bocoiran_e_Nosi%C3%A8ira","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/IGP_C%C3%A9vennes_Domaine_de_Gournier_%C3%A0_Boucoiran-et-Nozi%C3%A8res.jpg","page_title":"Bocoiran e Nosièira","context_page_description":"Bocoiran e Nosièira Okzitaniako udalerri bat da. Administratiboki Frantziako Gard departamenduan dago, Okzitania eskualdean. 2013an 861 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Volkspark_Prenzlauer_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/ParkPB-Kampfgrdenk.jpg","page_title":"Volkspark Prenzlauer Berg","context_page_description":"Der Volkspark Prenzlauer Berg – entstanden aus der früheren Oderbruchkippe – ist eine circa 29 Hektar große Parkanlage am östlichen Rand des Bezirks Pankow, Ortsteil Prenzlauer Berg. Den wesentlichen Bestandteil des Parks bildet ein Trümmerberg-Doppelgipfel, der an seiner höchsten Stelle 90,9 m ü. NHN hoch ist. Der andere Gipfel, mehr zur Hohenschönhauser Straße hin gelegen, heißt zwar „Hohes Plateau“ und auf einer steinernen Markierung steht, er sei „die höchste Erhebung in Prenzlauer Berg“, was aber ungenau ist. Denn nach Vermessungen in den 1990er Jahren ist er nur 89 m hoch. Die Gipfelzwillinge gehören zu den höheren Erhebungen Berlins."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%86%D8%AF%D8%B1%D9%8A%D9%83_%D8%A8%D9%8A%D8%AA%D8%B1%D9%88%D8%B3_%D8%A8%D9%8A%D8%B1%D9%84%D8%A7%D8%AE%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Gemeente_museum.jpg","page_title":"هندريك بيتروس بيرلاخه","context_page_description":"هندريك بيتروس بيرلاخه ‏ كان مهندساً معمارياً هولندياً بارزاً."},{"page_url":"https://en.wikipedia.org/wiki/Apostolove_Raion","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Coat_of_arms_of_Apostolove_Raion.png","page_title":"Apostolove Raion","context_page_description":"Apostolove Raion is a raion of Dnipropetrovsk Oblast, southeastern-central Ukraine. Its administrative centre is located at Apostolove. Population: 53,427."},{"page_url":"https://bs.wikipedia.org/wiki/August_Horch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Gedenktafel_horch_ehrenfeld.jpg","page_title":"August Horch","context_page_description":"August Horch bio je njemački inženjer i pionir automobilizma, osnivač proizvodnog giganta koji je eventualno postao Audi."},{"page_url":"https://sv.wikipedia.org/wiki/Zermizinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Zermizinga_sinuata_%282948222181%29.jpg","page_title":"Zermizinga","context_page_description":"Zermizinga är ett släkte av fjärilar. Zermizinga ingår i familjen mätare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://pt.wikipedia.org/wiki/Segunda_Guerra_Mundial","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bundesarchiv_Bild_102-10541%2C_Weimar%2C_Aufmarsch_der_Nationalsozialisten.jpg","page_title":"Segunda Guerra Mundial","context_page_description":"A Segunda Guerra Mundial foi um conflito militar global que durou de 1939 a 1945, envolvendo a maioria das nações do mundo — incluindo todas as grandes potências — organizadas em duas alianças militares opostas: os Aliados e o Eixo. Foi a guerra mais abrangente da história, com mais de 100 milhões de militares mobilizados. Em estado de \\"guerra total\\", os principais envolvidos dedicaram toda sua capacidade econômica, industrial e científica a serviço dos esforços de guerra, deixando de lado a distinção entre recursos civis e militares. Marcado por um número significante de ataques contra civis, incluindo o Holocausto e a única vez em que armas nucleares foram utilizadas em combate, foi o conflito mais letal da história da humanidade, resultando entre 50 a mais de 70 milhões de mortes.\\nGeralmente considera-se o ponto inicial da guerra como sendo a invasão da Polônia pela Alemanha Nazista em 1 de setembro de 1939 e subsequentes declarações de guerra contra a Alemanha pela França e pela maioria dos países do Império Britânico e da Commonwealth."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A5%81%E9%97%A8%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/201806_Freight_Yard_of_Qimen_Station.jpg","page_title":"祁门站","context_page_description":"祁门站，位于中华人民共和国安徽省黄山市祁门县祁山镇高明村，是皖赣铁路上的火车站。车站于1981年5月31日启用，1982年9月16日随皖赣铁路通车而正式投入运营，1984年6月开办货运业务，由上海铁路局管辖。\\n车站每日停靠1对旅客列车，另有一对来往黄山和倒湖的通勤列车停靠，供车站及沿线铁路职工使用。2019年4月11日起，原K33/K34次列车不再停靠祁门，改由K45/46次列车停靠。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/La_Valla-en-Gier","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Le_saut_du_Gier.jpg","page_title":"La Valla-en-Gier","context_page_description":"La Valla-en-Gier sī ūi-tī Hoat-kok Rhône-Alpes toā-khu Loire séng ê chi̍t ê commune."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BA%97%E5%B1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Cho_Lon_shophouses.jpg","page_title":"店屋","context_page_description":"店屋，香港稱為下舖上居，台灣則常稱為街屋，是常見於華南地區及東南亞的風土建築，多為兩至三層高，一樓作店舖使用，二三樓為民居。店舖前設有騎樓，此設計有利通風及避雨。\\n東南亞不少店屋，礙於稅務及結構規限，都為窄長設計，當地的騎樓因為法例規定為5英尺闊，名為五腳基。"},{"page_url":"https://nl.wikipedia.org/wiki/Klaus_Dibiasi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Klaus_Dibiasi_1968b.jpg","page_title":"Klaus Dibiasi","context_page_description":"Klaus Dibiasi is een Italiaans voormalig schoonspringer. Hij vertegenwoordigde zijn vaderland op vier edities van de Olympische Zomerspelen: Tokio 1964, Mexico-Stad 1968, München 1972 en Montreal 1976. Dibiasi werd drie keer olympisch kampioen, twee keer wereldkampioen en drie keer Europees kampioen."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A8%D8%B1%D9%8A%D9%8A%D9%84_%D8%AC%D8%A7%D8%B1%D8%AB%D9%8A%D8%A7_%D9%85%D9%88%D8%B1%D9%8A%D9%86%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Gabriel_Garc%C3%ADa_Moreno.jpg","page_title":"جابرييل جارثيا مورينو","context_page_description":"جابرييل جارثيا مورينو كان محامى من اكوادور."},{"page_url":"https://en.wikipedia.org/wiki/Baskets_Oldenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Choreo_EWE_Baskets_Oldenburg_Playoffs_2014.jpg","page_title":"Baskets Oldenburg","context_page_description":"Baskets Oldenburg, for sponsorship reasons EWE Baskets Oldenburg, is a professional basketball club that is based in the city of Oldenburg, Germany. The club plays in the Bundesliga. The club's name is derived from the team's main sponsor EWE AG, which is an electric utility company. The club's home arena is the Große EWE Arena."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D8%BA%D9%8A%D9%84_%D8%A8%D8%B1%D9%8A%D9%85%D9%88_%D8%AF%D9%8A_%D8%B1%D9%8A%D9%81%D9%8A%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/14._La_playa_de_Morro_Nuevo_en_los_d%C3%ADas_del_desembarco.jpg","page_title":"ميغيل بريمو دي ريفيرا","context_page_description":"ميغيل بريمو دي ريفيرا ‏ هو ديكتاتور، أرستقراطي وضابط عسكري. ولد بمدينة شريش بإسبانيا في الثامن من يناير سنة 1870م، استلم منصب رئيس وزراء إسبانيا منذ 1923 إلى 1930 خلال فترة عودة البوربون لحكم إسبانيا.وقد آمن بشدة أن السياسيين هم الذين خربوا إسبانيا واعتقد أنه بدونهم يمكنه إعادة مجد الأمة. شعاره كان \\"الوطن، الدين، الملكية\\". واعتبر نفسه بأنه \\"جراح حديد\\" والتي طالب بها خواكين كوستا. وصفه المؤرخون بالديكتاتور الأحمق الذي يفتقر للفطنة السياسية والتفكير الواضح. فقد الملك الثقة فيه بسبب أفعاله التي خربت الملكية المطلقة خلال فترة اشتداد التوترات الاجتماعية التي أدت إلى الحرب الأهلية الإسبانية. توفي ب16 مارس سنة 1930م.\\nبعد وفاة عمه سنة 1921 أصبح بريمو دي ريفيرا ماركيز استيلا. وقد قاد وبدعم من الملك ألفونسو الثالث عشر والجيش انقلابا عسكريا استوحاه من انقلاب موسوليني في 23 سبتمبر 1923. ثم عينه الملك رئيسا الوزراء، فوعد بالقضاء على الفساد وتجديد إسبانيا. ومن أجل القيام بذلك علق الدستور وأرسى الأحكام العرفية وفرض نظام رقابة صارم وأنهى نظام تداول السلطة للأحزاب المتناوبة.\\nقال بريمو دي ريفيرا في البداية أنه سيحكم لمدة 90 يومًا فقط، لكنه فضل البقاء في السلطة. فأسس الدكتاتورية في شكل المجلس العسكري، ثم تلتها إدارة مدنية برئاسته أيضا. وتمكن من حل مشكلة المغرب بفضل إنزال الحسيمة 19257."},{"page_url":"https://fr.wikipedia.org/wiki/K%C5%8Dnosuke_Matsushita","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Konosuke_Matsushita_01.jpg","page_title":"Kōnosuke Matsushita","context_page_description":"Kōnosuke Matsushita, né le 27 novembre 1894 dans le village de Wasa et mort le 27 avril 1989 à Tōkyō, est un industriel et philosophe des affaires japonais, le fondateur de Panasonic. Il est surnommé au Japon « le dieu de la gestion » pour ses qualités de dirigeant et sa pensée économique."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A9%E6%BA%80%E5%B1%8B%E5%BA%83%E5%B3%B6%E7%B7%91%E4%BA%95%E5%BA%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Tenmaya_logo.png","page_title":"天満屋広島緑井店","context_page_description":"天満屋広島緑井店とは広島市安佐南区緑井にある天満屋の店舗である。"},{"page_url":"https://es.wikipedia.org/wiki/Mezzani","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Municipio_di_Mezzani.JPG","page_title":"Mezzani","context_page_description":"Mezzani es un municipio de 3.055 habitantes de la provincia de Parma en Italia, situado a unos 15 kilómetros al noreste de Parma. A diferencia de otros municipios cercanos, no está formado por un pueblo grande y aldeas pequeñas, sino por algunos pueblos más o menos de la misma dimensión. La palabra Mezzani deriva de la palabra latina Medianus que significa en medio de. Todos los pueblos de este municipio antiguamente eran islas del río Po. Casale, Mezzano Rondani, Mezzano Inferiore, Mezzano Superiore son los pueblos principales, Bocca d’Enza, Ghiare Bonvisi y la Valle son sólo aldehuelas."},{"page_url":"https://fr.wikipedia.org/wiki/Plaque_d%27immatriculation_tunisienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Voiture_de_la_mission_diplomatique_%28MD%29_de_la_R%C3%A9publique_du_Congo%2C_Tunis%2C_2020.jpg","page_title":"Plaque d'immatriculation tunisienne","context_page_description":"La plaque d'immatriculation tunisienne permet l'identification des véhicules enregistrés en Tunisie.\\nElle se présente sous la forme « Y تونس X », où X et Y sont des nombres, le tout écrit en blanc sur fond noir. À gauche, deux ou trois chiffres désignent la série qui est en incrémentation illimitée alors qu'à droite, les quatre chiffres désignent le numéro d'enregistrement du véhicule dans la série qui est compris entre 1 et 9 999. La série et le numéro d'enregistrement sont séparés par le nom de la Tunisie en arabe.\\nJusqu'à l'indépendance, la plaque se présente sous la forme « X TU Y ». À titre d'exemple, la voiture du leader nationaliste Farhat Hached, assassiné en 1952, était immatriculée « 2418 TU 8 »."},{"page_url":"https://fr.wikipedia.org/wiki/Alexandre-Henri_de_Schleswig-Holstein-Sonderbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Arolsen_Klebeband_02_389_4.jpg","page_title":"Alexandre-Henri de Schleswig-Holstein-Sonderbourg","context_page_description":"Alexandre-Henri de Schleswig-Holstein-Sonderbourg est un noble allemand fondateur de la lignée dite « Silésienne » des ducs de Schleswig-Holstein-Sonderbourg."},{"page_url":"https://en.wikipedia.org/wiki/Small_nucleolar_RNA_SNORD29","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/RF00070.jpg","page_title":"Small nucleolar RNA SNORD29","context_page_description":"SNORD29 is a non-coding RNA molecule which functions in the modification of other small nuclear RNAs. This type of modifying RNA is usually located in the nucleolus of the eukaryotic cell which is a major site of snRNA biogenesis. It is known as a small nucleolar RNA and also often referred to as a guide RNA.\\nU29 belongs to the C/D box class of snoRNAs which contain the conserved sequence motifs known as the C box and the D box. Most of the members of the box C/D family function in directing site-specific 2'-O-methylation of substrate RNAs.\\nIn humans U29 and several other snoRNAs are located in the introns of the same gene. U29 is proposed to guide the 2'O-ribose methylation of 28S ribosomal RNA residue A4493."},{"page_url":"https://en.wikipedia.org/wiki/2nd_Kent_Artillery_Volunteers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/18pdrMkIIOrchies23April1940.jpg","page_title":"2nd Kent Artillery Volunteers","context_page_description":"The 2nd Kent Artillery Volunteers, later 4th London Brigade, Royal Field Artillery, popularly known as the Lewisham Gunners, was a volunteer unit of the British Army from 1860 until 1967. Initially raised in suburban West Kent, its recruiting area was later incorporated within the County of London. It provided two active service units in each of the World Wars, operating as far afield as Sicily, Burma and Madagascar, and later provided an airborne unit in the Territorial Army of the 1950s."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6pingebro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/K%C3%B6pingebro_sockerfabrik.jpg","page_title":"Köpingebro","context_page_description":"Köpingebro ist mit über 1200 Einwohnern der zweitgrößte Ort in der Gemeinde Ystad in Schonen.\\n1894 wurde die Zuckerraffinerie Ystad gegründet, die den Ort zu einem wichtigen Standort der schwedischen Zuckerindustrie machte. Die Zuckerfabrik wurde Ende 2006 geschlossen."},{"page_url":"https://br.wikipedia.org/wiki/Internet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Vint_Cerf_-_2010.jpg","page_title":"Internet","context_page_description":"Internet zo ur rouedad urzhiataerel bedel. Diazezet eo war daou gomenad kehentiñ, TCP hag IP lakaet asambles dindan an anv TCP/IP. Implijet e vez evit dispakañ meur a servij war skramm evel al lizheroù elektronek hag ar World Wide Web. Troet eo bet an anv Internet gant ar ger kenrouedad ivez.\\nEvit ma vo luget an holl ardivinkoù a zo war ar rouedad ez eus bet savet ur reizhiad chomlec'hioù gant sifroù arabek, a anver \\"chomlec'h IP\\". Pep ardivink e vez roet dezhañ ur chomlec'h IP neuze, a zo un heuliad sifroù; padus pe war ar prim e vez ar chomlec'hioù IP, hervez an doare ardivink. Posupl eo ivez reiñ ur chomlec'h da neb en deus ezhomm. Ar chomlec'hioù o deus daou stumm, unan sifraouet a vez komprenet gant an ardivinkoù o-unan, hag unan all e gerioù lizherennet ha komprenapl d'an holl: 192.168.1.1 pe br.wikipedia.org, da skouer."},{"page_url":"https://sv.wikipedia.org/wiki/Maiduguri","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Locator_Map_Maiduguri-Nigeria.png","page_title":"Maiduguri","context_page_description":"Maiduguri är en stad i nordöstra Nigeria, omkring 110 kilometer sydväst om Tchadsjön. Den är administrativ huvudort för delstaten Borno och har ungefär 1,1 miljoner invånare.\\nMaiduguri grundades av britterna kring 1907. Det moderna Maiduguri utgörs även av staden Yerwa, grundad vid samma tid som huvudstad för kanurifolket. Den är ett betydligt handelscentrum och en vägknutpunkt, samt slutpunkt för järnvägen från Lagos och Port Harcourt. Stadens status som kommersiellt centrum stärktes när järnvägen kom 1964, och staden är nu en av de största i norra Nigeria. Staden har en flygplats, Maiduguri International Airport. Den är också säte för ett universitet och en teknisk högskola.\\nMajoriteten av stadens befolkning är muslimer och kanuri, men det finns också flera minoritetsgrupper, bland annat kristna. Staden har flera gånger sett våldsamma upplopp av etniskt och/eller religiöst slag, bland annat 1982, 2001, i samband med Muhammedbilderna i Jyllands-Posten 2005, samt 2009."},{"page_url":"https://en.wikipedia.org/wiki/Mombasa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Mama_ngina_drive.jpg","page_title":"Mombasa","context_page_description":"Mombasa is a coastal city of Kenya along the Indian Ocean. The city is known as the white and blue city in Kenya. It is the country's oldest and second-largest city, with a population of about 1,208,333 people according to the 2019 census. Its metropolitan region is the second-largest in the country, and has a population of 3,528,940 people.\\nMombasa is a tourism-based city; it has an extra-large port and an international airport, and is an important regional tourism center. Located on the east coast of Kenya, it also is the home of one of the State House, and is considered by some as a second capital in all but name. In 2018 the local government released an edict in which the city was painted white with blue accents and the old town was painted yellow. In Mombasa County and the former Coast Province, Mombasa's situation on the Indian Ocean made it a historical trading center, and it has been controlled by many countries because of its strategic location."},{"page_url":"https://it.wikipedia.org/wiki/Neopaganesimo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Quatro_elementos_e_pentagrama_%28In_Portuguese%29.jpg","page_title":"Neopaganesimo","context_page_description":"Neopaganesimo, neo-paganesimo o nuovo paganesimo è un termine ombrello che raggruppa un insieme di religioni, tradizioni e movimenti spirituali eterogenei, i quali si ispirano alle religioni pagane dell'età antica in Europa e nel Medio Oriente. Alcuni studiosi fanno rientrare questo gruppo di religioni nel novero dei nuovi movimenti religiosi.\\nEsistono vari approcci nell'utilizzo del termine neopaganesimo. Un primo esempio si ottiene dalla definizione data in Merriam-Webster's Encyclopedia of World Religions:\\nQuesta definizione stride però totalmente con quella fornita a esempio nel sito web adherents.com che si occupa di catalogare e comparare le religioni; citiamo la definizione che ne viene data:\\nQuesta differenza e contraddizione tra le due definizioni viene ulteriormente accentuata dal fatto che molti movimenti che rientrano soprattutto nella prima definizione rifiutano il prefisso \\"neo\\", preferendo definirsi semplicemente come \\"pagani\\": per questo, essi vengono anche definiti \\"veteropagani\\", \\"ricostruzionisti\\" o con altri termini."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85kerv%C3%A4dd","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Knautia_arvensis_%C3%A5kerv%C3%A4dd.jpg","page_title":"Åkervädd","context_page_description":"Åkervädd, Knautia arvensis Duby, är en lilafärgad blomma i familjen väddväxter."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8F%84%EB%B6%80_%EA%B8%B0%EB%A5%98_%EC%84%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ltd._Exp._Ryomo_and_Mt.Akagi.jpg","page_title":"도부 기류 선","context_page_description":"도부 철도 기류 선은 일본의 철도 노선 하나이다. 도부 철도가 운영한다. 일본 군마현 오타시에 있는 오타 역과 군마 현 미도리시에 있는 아카기 역을 잇는다."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Filipino_saints,_blesseds,_and_Servants_of_God","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/SanLaurentiusRuizdeManilaProtoMartirodeFilipinasPublication.jpg","page_title":"List of Filipino saints, blesseds, and Servants of God","context_page_description":"This is a list of Filipino saints, blesseds, venerables, and Servants of God recognized by the Catholic Church. The majority of these men and women of religious life were born, died, or lived within the Philippines.\\nFerdinand Magellan's expedition of 1521 to the islands included Catholic priests and missionaries among the crew. Some Catholic missionaries became the explorers of the native lands while converting and coercing the Indios towards Christianism. Because of the Spanish colonization which had been started by Miguel Lopez de Legazpi, Christianity was introduced as settling within Cebu. Cebu is a well known bastion of the Roman Catholic faith.\\nCatholics continue to contribute to Filipino religious life to the present day. Subsequently, several Filipino Catholics have been considered for sainthood over the past centuries. Most of these saints-to-be are from the 20th Century and moving forward. Very few from the Spanish era within the Philippines found their way to the various levels of Church \\"sanctity.\\"\\nThe first Filipino saint canonized was Lorenzo Ruiz, a married lay Dominican and member of the Rosarian Confraternity in dedication to Our Lady."},{"page_url":"https://nl.wikipedia.org/wiki/De_Barakken","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Menen_-_De_Barakken_1.jpg","page_title":"De Barakken","context_page_description":"De Barakken is een arbeiderwijk in de Belgische stad Menen, tussen de Leie en de Franse grens. De wijk ligt in tegenstelling tot Menen-centrum op de zuidelijk oever van de rivier, en vormt een bebouwd geheel met de Franse stad Halewijn.\\nDe Rijselstraat, de hoofdweg door de wijk, is vooral op zondagen erg druk, door het drukke winkeltoerisme door Noord-Fransen."},{"page_url":"https://pt.wikipedia.org/wiki/A_M%C3%BAsica_na_Pintura","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Portrait_of_a_Girl_MET_49B_022R3.jpg","page_title":"A Música na Pintura","context_page_description":"A Música na Pintura é uma lista de pinturas que constam na Wikidata como tendo representado algum instrumento musical, tema que foi tratado por um grande número de mestres pintores do passado.\\nHá provas de que a música é conhecida e praticada desde a pré-história, sendo a pintura rupestre um desses documentos. Provavelmente a observação dos sons da natureza tenha despertado no homem a necessidade de uma atividade baseada na organização de sons. A história da música confunde-se com a própria história do desenvolvimento da inteligência e da cultura humana, sendo a pintura uma dessas manifestações.\\nEsta lista é gerada a partir dos dados do Wikidata e é atualizada periodicamente por um robô.\\nEdições feitas no conteúdo da lista serão removidas na próxima atualização!\\nFim da lista gerada automaticamente."},{"page_url":"https://sv.wikipedia.org/wiki/Gonepteryx","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Gonepteryx.rhamni.mounted.jpg","page_title":"Gonepteryx","context_page_description":"Gonepteryx är ett släkte av fjärilar som beskrevs av Leach 1815. Gonepteryx ingår i familjen vitfjärilar.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://sco.wikipedia.org/wiki/Danube","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Neue_Donau_mit_der_Fu%C3%9Fg%C3%A4ngerbr%C3%BCcke_Ponte_Cagrana_in_Wien.jpg","page_title":"Danube","context_page_description":"The Danube is a river in Central Europe, the continent's seicont langest efter the Volga.\\nClassified as an internaitional watterway, it oreeginates in the toun o Donaueschingen which is in the Black Forest o Germany at the confluence o the rivers Brigach an Breg. The Danube then flaws sootheast for 2,872 km, passin through fower Central European caipitals afore emptyin intae the Black Sea via the Danube Delta in Romanie an Ukraine.\\nAnce a lang-staundin frontier o the Roman Empire, the river passes through or touches the borders o ten kintras: Romanie, Hungary, Serbie, Austrick, Germany, Bulgarie, Slovakie, Croatie, Ukraine, an Moldovae. Its drainage basin extends intae nine mair."},{"page_url":"https://it.wikipedia.org/wiki/Este","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Paolo_Monti_-_Servizio_fotografico_%28Ferrara%2C_1965%29_-_BEIC_6328803.jpg","page_title":"Este","context_page_description":"Gli Este furono una delle famiglie regnanti europee più longeve. I primi rappresentanti si possono individuare tra i discendenti dei duchi della Toscana legati a Carlo Magno mentre un ramo cadetto degli Estensi, gli Arciduchi d'Austria-Este, giunse sino al XIX secolo."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%84%D8%A7%D8%B7%D9%8A%D9%86_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%87_%D8%A7%D9%84%D8%B9%D8%AB%D9%85%D8%A7%D9%86%D9%8A%D9%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Tughra_of_Mehmed_IV.JPG","page_title":"سلاطين الدوله العثمانيه","context_page_description":"السلطان العثمانى كان هو زعيم الدوله العثمانيه"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%B7%B4%E5%B0%94%E5%A1%9E%E5%9F%BA%E7%95%A5%E5%BE%B7%E6%A0%BC%E5%85%B0%E5%8D%A1%E7%BA%B3%E9%87%8C%E4%BA%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Escudo_municipal_de_Valsequillo_de_Gran_Canaria.png","page_title":"巴尔塞基略德格兰卡纳里亚","context_page_description":"巴爾塞基略德格蘭卡納里亞，是西班牙加那利群島拉斯帕爾馬斯省的一個市鎮。總面積39平方公里，總人口7964人，人口密度204人/平方公里。"},{"page_url":"https://de.wikipedia.org/wiki/Vila_Nova_de_Milfontes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Forte_de_Milfontes_1.jpg","page_title":"Vila Nova de Milfontes","context_page_description":"Vila Nova de Milfontes ist eine Ortschaft und Gemeinde in Portugal.\\nDer Ort liegt im Parque Natural do Sudoeste Alentejano e Costa Vicentina, einem Naturschutzgebiet, das sich an der gesamten südwestportugiesischen Küste entlangzieht. Er liegt an der rechten Uferseite direkt an der Flussmündung des Rio Mira in den Atlantik."},{"page_url":"https://en.wikipedia.org/wiki/Hiroshima_Peace_Memorial_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Atomic_Bomb_Memorial_Mound.jpg","page_title":"Hiroshima Peace Memorial Park","context_page_description":"Hiroshima Peace Memorial Park is a memorial park in the center of Hiroshima, Japan. It is dedicated to the legacy of Hiroshima as the first city in the world to suffer a nuclear attack, and to the memories of the bomb's direct and indirect victims. The Hiroshima Peace Memorial Park is visited by more than one million people each year. The park is there in memory of the victims of the nuclear attack on August 6, 1945, in which the United States dropped an atomic bomb on the Japanese city of Hiroshima. The Hiroshima Peace Memorial Park was planned and designed by the Japanese Architect Kenzō Tange at Tange Lab.\\nThe location of Hiroshima Peace Memorial Park was once the city’s busiest downtown commercial and residential district. The park was built on an open field that was created by the explosion. Today there are a number of memorials and monuments, museums, and lecture halls, which draw over a million visitors annually. The annual 6 August Peace Memorial Ceremony, which is sponsored by the city of Hiroshima, is also held in the park."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Heimbach_(Eifel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Heimbach-Vlatten_Denkmal-Nr._69%2C_Auf_der_Hostert_7_%28569%29.jpg","page_title":"Liste der Baudenkmäler in Heimbach (Eifel)","context_page_description":"Die Liste der Baudenkmäler in Heimbach (Eifel) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Gemeinde Heimbach (Eifel) im Kreis Düren in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Gemeinde Heimbach (Eifel) eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%BA%D0%B0_%D0%BF%D1%80%D0%B8_%D0%99%D0%BE%D0%BB%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Slaget_vid_%C3%96land_Claus_M%C3%B8inichen_1676.jpg","page_title":"Битка при Йоланд","context_page_description":"Битката при Йоланд е морско сражение в Балтийско море между обединения датско-норвежко-холандски флот и флота на Кралство Швеция, протекло на 1 юни 1676 година. Битката е част от по-мащабната Сконска война, която се води за доминация в южно Балтийско море. В периода около битката Швеция е принудена да търси подсилване на завладените земи в Северна Германия, докато Дания търси възможност за атака на Сконе и отваряне на път за нахлуване на шведска земя.\\nМалко преди началото на битката шведският флагмански кораб „Короната“ потъва с целия екипаж на борда, включително и главнокомандващия шведския флот, адмирал на короната Лоренц Кройц. Съюзният флот под командването на холандския адмирал Корнелис Тромп се възползва от ситуацията и предизвиква паника сред останалите шведски кораби. Корабът на втория по ранг шведски адмирал Клас Угла е обграден, подложен на артилерийски огън и впоследствие подпален. Адмирал Угла се опитва да напусне горящия кораб при което се удавя. След загубата на втори адмирал, шведският флот е силно дезорганизиран.\\nБитката завършва с пълно датско надмощие в Балтийско море."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%81%D0%B0%D0%BD%D1%82%D0%BD%D0%BE-%D0%B2%D0%B5%D1%80%D1%82%D0%BE%D0%BB%D1%91%D1%82%D0%BD%D1%8B%D0%B5_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D0%B8-%D0%B4%D0%BE%D0%BA%D0%B8_%D1%82%D0%B8%D0%BF%D0%B0_%C2%AB%D0%9C%D0%B0%D0%BA%D0%B0%D1%81%D1%81%D0%B0%D1%80%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Kri_makassar-590.PNG","page_title":"Десантно-вертолётные корабли-доки типа «Макассар»","context_page_description":"Десантно-вертолётные корабли-доки типа «Макассар» — тип десантно-вертолётных кораблей-доков состоящих на вооружении ВМС Индонезии. Два корабля построено на судоверфи компании «Тэсун шипбилдинг» и вступили в строй в 2007 году, ещё три построены компанией «ПТ Пал».\\nДесантовместимость: 500 человек, 13 танков, 2 десантных катера."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E7%B4%80%E7%99%BD%E6%B5%9C%E6%B8%A9%E6%B3%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/131221_Shirahama_Onsen_Shirahama_Wakayama_pref_Japan04s3.jpg","page_title":"南紀白浜温泉","context_page_description":"南紀白浜温泉、もしくは白浜温泉は和歌山県西牟婁郡白浜町にある温泉である。かつては熱海温泉、別府温泉と並んで「日本三大温泉」と言われていた。温泉として非常に歴史が古く、日本三古湯のひとつに数えられ、古い文献では牟婁の湯と呼ばれていた。広義での白浜は温泉郷であり、さらに湯崎、大浦、古賀浦、綱不知、白浜、更に近年は東白浜、新白浜を加え7ヶ所の温泉地に細分できる。白良浜を中心に海岸沿いに温泉施設、宿泊施設が広がっており、周辺には多くの観光地もあるリゾートとなっている。\\n紀勢自動車道の南紀白浜インターチェンジ、や南紀白浜空港もあり遠方からの交通の便もよい。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%BA%D8%B1%D8%A8_%D9%88%D8%AD%D8%B4%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/United_States_1884-1889-11-02.png","page_title":"غرب وحشی","context_page_description":"سرحد آمریکایی مشتمل بر جغرافیا، تاریخ، فولکلور، و توصیف فرهنگی زندگی در موج گسترش مرزهای ایالات متحده آمریکا به سوی غرب از سکونتگاه‌های اولیه استعماری تا اوایل سده ۲۰ است. توجه گسترده رسانه‌ای بر نیمه دوم سده ۱۹، دوره‌ای که گاهی غرب وحشی یا غرب قدیمی نامیده می‌شود متمرکز است."},{"page_url":"https://fi.wikipedia.org/wiki/Komin_tasavalta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Ukhta_university.JPG","page_title":"Komin tasavalta","context_page_description":"Komi eli Komin tasavalta on Venäjän federaatioon kuuluva tasavalta Euroopan koillisosassa pääasiassa Petšoran vesistöalueella Uralvuorten länsipuolella. Se on suomensukuisen kansan, komien, nimikkotasavalta. Alueeltaan Komin tasavalta on 1,2 kertaa Suomen kokoinen. Pääosa alueesta on havumetsää, taigaa. Pohjoisessa on tundraa ja koillisessa ikiroutaa. Joet halkovat Komin maisemaa keskeisenä luonnonpiirteenä. Mannerilmaston talvi on ankarampi ja selvästi pidempi kuin Suomessa. Pakkaskausi kestää etelässä puoli vuotta ja Komin koillisosissa ⅔ vuotta.\\nKomin alueen väestö kasvoi neuvostoaikana merkittävästi ja alue venäläistyi. Kaivostyöhön ja rautateiden rakentamisen tarpeisiin tuotiin työntekijöitä osin pakolla. Neuvostoliiton hajoamisen jälkeen ja muuttorajoitusten poistuttua Komin väkiluku on pudonnut 30 %, suhteellisesti eniten Luoteis-Venäjän alueista. Vuoden 2013 alussa Komin asukasluvun arvioitiin olevan vajaa 881 000. Väestön enemmistön muodostavat venäläiset ja komit.\\nLuonnonrikkauksia on paljon. Erityisesti öljyvarojen, kivihiilen ja erilaisten malmien hyödyntäminen sekä metsäteollisuus ovat nostaneet Komin bruttokansantuotteen 1,5-kertaiseksi Venäjän keskiarvoon nähden."},{"page_url":"https://en.wikipedia.org/wiki/List_of_assault_rifles","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Ia2_ctt.jpg","page_title":"List of assault rifles","context_page_description":"An assault rifle is a rifle that uses an intermediate cartridge, a detachable magazine, and can switch between semi-automatic/fully automatic fire. Assault rifles are currently the standard service rifles in most modern armies.\\nBy strict definition, a firearm must have the following characteristics to be considered an assault rifle:\\nIt must be an individual weapon;\\nIt must be capable of selective fire, which means it has the capacity to switch between semi-automatic and burst/fully automatic fire;\\nIt must have an intermediate-power cartridge: more power than a pistol but less than a standard rifle or battle rifle. Its ammunition must be supplied from a detachable box magazine;\\nIt should have an effective range of at least 300 metres.\\nRifles that meet most of these criteria, but not all, are technically not assault rifles, despite frequently being called such.\\nFor example:\\nSelect-fire M2 carbines and Amogh carbines aren't assault rifles; their effective range is only 200 yards.\\nSelect-fire rifles such as the FN FAL battle rifle aren't assault rifles; they fire full-powered rifle cartridges."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Winterspiele_2018/Ski_Alpin_%E2%80%93_Abfahrt_(Frauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Olympics_28070999.jpg","page_title":"Olympische Winterspiele 2018/Ski Alpin – Abfahrt (Frauen)","context_page_description":"Die Abfahrt der Frauen im alpinen Skisport bei den Olympischen Winterspielen 2018 wurde am 21. Februar 2018 um 11:00 Uhr Ortszeit im Jeongseon Alpine Centre ausgetragen.\\nDie Goldmedaille gewann die Italienerin Sofia Goggia vor Ragnhild Mowinckel, die Silber gewann. Die Bronzemedaille ging an Lindsey Vonn aus den Vereinigten Staaten."},{"page_url":"https://pl.wikipedia.org/wiki/Mi%C4%99dzynarodowa_Federacja_Poga%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Paganavebury.jpg","page_title":"Międzynarodowa Federacja Pogańska","context_page_description":"Międzynarodowa Federacja Pogańska, Pagan Federation International – została powołana w Hadze w Holandii jako organizacja zrzeszająca pogan z różnych krajów i kontynentów.\\nKontynuuje na gruncie międzynarodowym działalność brytyjskiej Federacji Pogańskiej, z której się wyłoniła. Obecnie obie organizacje ściśle ze sobą współpracują. Międzynarodowa Federacja Pogańska zrzesza pogan różnych ścieżek, w tym pogan rekonstruujących dawne wierzenia przodków, wiccan, czy przeżywających duchowość na swój własny, niepowtarzalny sposób."},{"page_url":"https://en.wikipedia.org/wiki/Newlands_Forest","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Peninsula_Shale_Fynbos_-_DevilsPeak_Cape_Town.jpg","page_title":"Newlands Forest","context_page_description":"Newlands Forest is a conservancy area on the eastern slopes of Table Mountain, beside the suburb of Newlands, Cape Town. It is owned and maintained by the Table Mountain National Parks Board, along with the City Parks Department of Cape Town, and includes a Fire Station, Nursery and Reservoir.\\nThe forest itself is a popular walking and jogging destination, close and easily accessible from the city's southern suburbs. Due to its location on the mountain slopes, there are impressive views eastward over the Cape Flats."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B8%E0%B4%BF%E0%B4%97%E0%B4%BF%E0%B4%B0%E0%B4%BF%E0%B4%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Sri_Lanka-Sigiriya-Fresko.JPG","page_title":"സിഗിരിയ","context_page_description":"ശ്രീലങ്കയിൽ സ്ഥിതി ചെയ്യുന്ന ഒരു ചരിത്രസ്മാരകമാണ്‌ സിഗരിയ. യുനെസ്കോയുടെ ലോകപൈതൃകകേന്ദ്രങ്ങളിൽ സ്ഥാനം പിടിച്ചിട്ടുള്ള ഇത് 400‌-ഓളം മീറ്റർ ഉയരമുള്ള ഒരു കൂറ്റൻ പാറക്കു മുകളിൽ നാലേക്കറോളം വിസ്തൃതിയിൽ സ്ഥിതി ചെയ്യുന്ന രാജകൊട്ടരത്തിന്റേയും ബുദ്ധവിഹാരത്തിന്റേയും ചരിത്രാവശിഷ്ടങ്ങളാണ്‌. ഏറെ സാങ്കേതികമികവുകാട്ടുന്ന പ്രകൃതിജലസംഭരണസം‌വിധാനങ്ങളും, ഇന്ത്യയിൽ അജന്തയിലെ ചിത്രങ്ങളെ അനുസ്മരിപ്പിക്കുന്ന ചുവർചിത്രങ്ങളും ചേർന്ന ഈ ചരിത്രാവശിഷ്ടം ജനപ്രിയമായ ഒരു വിനോദസഞ്ചാരകേന്ദ്രമാണ്."},{"page_url":"https://ro.wikipedia.org/wiki/Albatrellus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/2008-09-11_Albatrellus_pes-caprae_Pouzar_37540_crop.jpg","page_title":"Albatrellus","context_page_description":"Albatrellus este un gen de ciuperci comestibile din încrengătura Basidiomycota în ordinul Russulales și familia Albatrellaceae cu ajustat 24 de specii. Speciile acestui gen coabitează, formând micorize pe rădăcinile arborilor, dar după câțiva autori au de asemenea calități saprofite. Bureții se dezvoltă în România, Basarabia și Bucovina de Nord pe soluri acide, sărace și nisipoase sau calcaroase în păduri de conifere prin luminișuri, preferat pe lângă pini, mai rar sub molizi sau /și în cele de foioase sau mixte sub fagi, câteodată chiar pe lemn în putrefacție. Apar în grupuri numeroase, crescând adesea în tufe, de la câmpie la munte, din septembrie până toamna târziu. Tip de specie este Albatrellus ovinus."},{"page_url":"https://ro.wikipedia.org/wiki/Kamilski_Dol,_Haskovo","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Kamilski_dol_1.jpg","page_title":"Kamilski Dol, Haskovo","context_page_description":"Kamilski Dol este un sat în comuna Ivailovgrad, regiunea Haskovo, Bulgaria."},{"page_url":"https://hu.wikipedia.org/wiki/Buz%C3%A1nszky_Jen%C5%91_Stadion","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Complementary_ticket_from_1995-96_division.jpg","page_title":"Buzánszky Jenő Stadion","context_page_description":"A Buzánszky Jenő Stadion és sporttelep Dorog város, valamint Komárom-Esztergom megye egyik legnagyobb, egyben Magyarország egyik legrégebbi sportlétesítménye. A nyilvántartásban korábban Bányász stadion, majd Dorogi Városi Stadion néven szerepelt, míg 2010. május 4. óta viseli Buzánszky Jenő nevét. A város közepén, a Köztársaság út – Iskola utca – Vasút-sor – Zsigmondy Vilmos lakótelep által közrezárt, 6334 négyzetméternyi területen található. Egykor a Dorogi Szénbányák Vállalat, 1995 óta napjainkig pedig a Dorogi Szénmedence Sportjáért Közalapítvány a tulajdonosa. 2012 óta a Dorog Város Egyesített Sportintézménye végzi az üzemeltetését. A Dorogi FC, valamint a Dorogi Egyetértés SE székhelye és centerpályája.\\nÉpítése 1914-ben kezdődött, azonban az I. világháború eseményei miatt megakadt és 1918-ban folytatódott, végül 1921-ben avatták fel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B0%D1%81%D0%BA%D0%BE%D0%BC%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Arbol_en_Chascomus.jpg","page_title":"Часкомус","context_page_description":"Часкому́с — місто на сході провінції Буенос-Айрес в Аргентині, що розташоване за 123 км на південь від Буенос-Айреса. Є адміністративним центром округу Часкомус."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDluna_zelen%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/%C5%BDluna_zelen%C3%A1%2C_zima.jpg","page_title":"Žluna zelená","context_page_description":"Žluna zelená je středně velký šplhavý pták z čeledi datlovitých."},{"page_url":"https://tr.wikipedia.org/wiki/Aleksandr_Ro%C5%9Fal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Roshal%2CAlexander_2002_Dortmund.jpg","page_title":"Aleksandr Roşal","context_page_description":"Alexander Borisovich Roshal Sovyet satranç oyuncusu ve gazetecidir. Aynı zamanda, satranç dergisi 64ün kurucusu ve editörüdür."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%B7%D0%BC%D0%B0%D1%97%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D1%80%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%BC%D1%83_%D0%BF%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D0%BE%D0%B4%D1%86%D1%8E_%D0%9E.%D0%92._%D0%A1%D1%83%D0%B2%D0%BE%D1%80%D0%BE%D0%B2%D1%83.jpg","page_title":"Ізмаїл","context_page_description":"Ізмаї́л — місто в Одеській області, адміністративний центр Ізмаїльського району, колишній центр Ізмаїльської області. Відстань до Одеси становить понад 200 км і проходить автошляхом E87. Друге найбільше місто області за кількістю населення — понад 70 тисяч осіб."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Joyeuses_Comm%C3%A8res_de_Windsor","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/FirstFolioMerryWives.jpg","page_title":"Les Joyeuses Commères de Windsor","context_page_description":"The Merry Wives of Windsor, en français : Les Joyeuses Commères de Windsor – Les Gaillardes Épouses de Windsor – Les Joyeuses Épouses de Windsor – Les Joyeuses Bourgeoises de Windsor est une comédie de William Shakespeare, publiée pour la première fois en 1602, mais probablement écrite en 1597 ou avant."},{"page_url":"https://ceb.wikipedia.org/wiki/Virginia_Beach_(kapital_sa_kondado)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Flag_of_Virginia_Beach%2C_Virginia.jpg","page_title":"Virginia Beach (kapital sa kondado)","context_page_description":"Kapital sa kondado ang Virginia Beach sa Tinipong Bansa. Ang Virginia Beach nahimutang sa kondado sa City of Virginia Beach ug estado sa Virginia, sa sidlakang bahin sa nasod, 250 km sa habagatan sa ulohang dakbayan Washington, D.C. 3 metros ibabaw sa dagat kahaboga ang nahimutangan sa Virginia Beach, ug adunay 437,994 ka molupyo.\\nAng yuta palibot sa Virginia Beach kay daghan kaayong patag. Sa amihang-sidlakan, dagat ang pinakaduol sa Virginia Beach. Ang kinahabogang dapit sa palibot dunay gihabogon nga 24 ka metro ug 8.1 km sa amihanan sa Virginia Beach. Walay laing lungsod sa palibot niini. Sa rehiyon palibot sa Virginia Beach, mga lawis, mga luuk, ug mga estretso talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Enero, sa 3 °C. Ang kasarangang pag-ulan 1,582 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 220 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 78 milimetro."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%B8%AD%E5%BF%83%E6%9C%88%E9%A3%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Lunar_eclipse_from_moon-1946Jun14.png","page_title":"中心月食列表","context_page_description":"中心月食指的是月食發生時，月球盤面會通過地球陰影中心點的月食。因此中心食在食甚時月面亮度會最低，食甚時間較長，也比較罕見。"},{"page_url":"https://ro.wikipedia.org/wiki/Scorbur%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Holey_Tree_%28772111164%29.jpg","page_title":"Scorbură","context_page_description":"Scorbura este spațiul gol și cavernos din tulpina unui copac, format în locul miezului lemnos putrezit. Scorburile se întâlnesc în principal la arborii bătrâni, fie ei vii sau morți. Ele sunt un fenoment natural frecvent întâlnit în zonele împădurite și reprezintă o resursă sau un habitat important pentru numeroase animale vertebrate și nevertebrate."},{"page_url":"https://en.wikipedia.org/wiki/Nabta_Playa","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Calendar_aswan.JPG","page_title":"Nabta Playa","context_page_description":"Nabta Playa was once a large internally drained basin in the Nubian Desert, located approximately 800 kilometers south of modern-day Cairo or about 100 kilometers west of Abu Simbel in southern Egypt, 22.51° north, 30.73° east. Today the region is characterized by numerous archaeological sites. The Nabta Playa archaeological site, one of the earliest of the Egyptian Neolithic Period, is dated to circa 7500 BC."},{"page_url":"https://es.wikipedia.org/wiki/Ford_Kuga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/2014_Ford_Kuga_%28TF_II_MY15%29_Ambiente_EcoBoost_2WD_wagon_%282014-12-14%29.JPG","page_title":"Ford Kuga","context_page_description":"El Ford Kuga es un automóvil todoterreno del segmento C producido por el fabricante estadounidense Ford Motor Company desde el año 2007. Es un cinco plazas con motor delantero transversal, carrocería de cinco puertas y chasis monocasco. Algunos de sus rivales son los Citroën C5 Aircross, Honda CR-V, Kia Sportage, Mazda CX-5, Hyundai Tucson, Nissan Qashqai, Opel Grandland X, Peugeot 3008, Renault Kadjar, SEAT Ateca, Toyota RAV4 y Volkswagen Tiguan.\\nEl 3 de diciembre de 2012 se comenzó a fabricar el nuevo modelo en la factoría de Almusafes.​"},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Hof_bei_Salzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Langhaus_Hof_bei_Salzburg.jpg","page_title":"Pfarrkirche Hof bei Salzburg","context_page_description":"Die Pfarrkirche Hof ist seit 1858 die römisch-katholische Pfarrkirche der Gemeinde Hof im Land Salzburg. Die Kirche gehört zum Dekanat Thalgau. Sie ist dem hl. Sebastian geweiht, das Patrozinium wird am 20. Jänner gefeiert."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B1%8A%E5%B2%A1%E5%B8%82%E7%AB%8B%E8%A5%BF%E6%B0%97%E5%B0%8F%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Toyooka_city_Nishiki_elementary_school.jpg","page_title":"豊岡市立西気小学校","context_page_description":"豊岡市立西気小学校とは、かつて兵庫県豊岡市日高町にあった公立小学校。豊岡市立日高西中学校とは連携校だった。"},{"page_url":"https://vi.wikipedia.org/wiki/Lorius_lory","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Black-capped_lorikeet_-_Jurong_Bird_Park%2C_Singapore.jpg","page_title":"Lorius lory","context_page_description":"Lorius lory là một loài chim trong họ Psittacidae."},{"page_url":"https://en.wikipedia.org/wiki/The_Blue_Bottle_Coffee_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Zu_den_blauen_Flaschen_painting_c1900.jpg","page_title":"The Blue Bottle Coffee House","context_page_description":"The Blue Bottle coffee house was one of the first coffee houses in Vienna, Austria. It was founded in 1686 by Polish-Ukrainian Jerzy Franciszek Kulczycki, a hero of the Battle of Vienna.\\nAccording to legend, the Blue Bottle was Vienna's first-ever coffeehouse. The story goes that Kulczycki was the only person to recognize that the sacks of dark-brown beans left behind by the invading Ottoman Turks were coffee beans, and he used these spoils to open up a coffeehouse. However, more recent research shows that the first Viennese coffeehouse actually opened in 1685. Many of the stories about Kulczycki were invented by Gottfried Uhlich in 1783.\\nIn honor of the historic Vienna coffeehouse, the \\"Blue Bottle\\" name was adopted in the 21st century by the Blue Bottle Coffee Company, a coffee roaster and chain of coffee shops based in Oakland, California, US."},{"page_url":"https://ceb.wikipedia.org/wiki/C%C3%B4te_d%27Azur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Nice-night-view-with-blurred-cars_1200x900.jpg","page_title":"Côte d'Azur","context_page_description":"Baybayon ang Côte d'Azur sa Pransiya. Nahimutang ni sa sidlakang bahin sa nasod, 700 km sa habagatan sa Paris ang ulohan sa nasod.\\nAng klima kasarangan. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Pebrero, sa 10 °C. Ang kasarangang pag-ulan 1,509 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 337 milimetro nga ulan, ug ang kinaugahan Agosto, sa 32 milimetro."},{"page_url":"https://lv.wikipedia.org/wiki/Okultisms","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Holytable.jpg","page_title":"Okultisms","context_page_description":"Okultisms ir mācība par pārdabisku spēku esamību, kurus var uztvert ar vairumam nezināmiem paņēmieniem, un vēlāk šos spēkus izmantot, lai izzinātu un ietekmētu pasaules kārtību. Okultisms reizēm attiecas uz mistiskām mācībām vai uz maģiju. Termins dažkārt popularizējot nozīmē \\"zināšanas tikai daļai cilvēku\\" vai \\"zināšanas, kas jāpatur noslēpumā\\", bet okultistiem tā esot dziļākas garīgās realitātes studēšana. Termini ezotērisks un arkāns ir ar līdzīgu nozīmi un bieži tiek lietoti kopā ar terminu okults. Termins okults tiek arī lietots, lai apzīmētu organizācijas vai sektas, kurās māca par okultismu un tiek pielietota okultisma mācība. Vārds arī saistās ar literatūru un garīgo filosofiju. Tiek piedēvēts arī raganām, burvjiem un šarlatāniem."},{"page_url":"https://pt.wikipedia.org/wiki/Margalida_Cresp%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Open_Make_Up_For_Ever_2013_-_Ona_Carbonell_-_Margalida_Crespi_-_09.jpg","page_title":"Margalida Crespí","context_page_description":"Margalida Crespí Jaume é uma nadadora sincronizada espanhola, medalhista olímpica."},{"page_url":"https://es.wikipedia.org/wiki/Dori_Caymmi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/26_Pr%C3%AAmio_da_M%C3%BAsica_Brasileira_%2818517568449%29.jpg","page_title":"Dori Caymmi","context_page_description":"Dorival Tostes Caymmi, conocido artísticamente como Dori Caymmi es un músico fuertemente ligado al desarrollo de la música popular brasileña, hijo de los también músicos Dorival Caymmi y Stella Maris. Es hermano de Danilo Caymmi y de la cantante Nana Caymmi. Está radicado en la ciudad de Los Ángeles desde finales de la década de 1980.\\nDori Caymmi es cantor, compositor y arreglador. Además de su padre, su principal influencia es la bossa nova, habiendo iniciado su carrera en los años 1960. Paulo César Pinheiro es uno de sus principales acompañantes musicales. Quest Records, la empresa de Quincy Jones, produjo algunos de los CD del artista.\\nDos de sus CD fueron nominados a los premios Grammy, Influências y Contemporâneos, además de haber conquistado dos Grammy Latinos, al mejor CD de samba Para Caymmi 90 Anos y a la mejor canción brasileña Saudade de Amar, en colaboración con Paulo César Pinheiro."},{"page_url":"https://sv.wikipedia.org/wiki/Agos-Vidalos","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Map_commune_FR_insee_code_65004.png","page_title":"Agos-Vidalos","context_page_description":"Agos-Vidalos är en kommun i departementet Hautes-Pyrénées i regionen Occitanien i sydvästra Frankrike. Kommunen ligger i kantonen Argelès-Gazost som tillhör arrondissementet Argelès-Gazost. År 2009 hade Agos-Vidalos 380 invånare."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%B7%B4%E6%8B%89%E9%A0%93%E9%AB%98%E5%9C%B0%E5%9C%8B%E5%AE%B6%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/B_szt_laszlo_cuha_volgy.jpg","page_title":"巴拉頓高地國家公園","context_page_description":"巴拉頓高地國家公園是匈牙利的國家公園，位於該國中西部巴拉頓湖西北岸，由維斯普雷姆州和佐洛州負責管轄，始建於1997年，面積570平方公里。"},{"page_url":"https://io.wikipedia.org/wiki/Grozni","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Montage-of-Grozny-%282016%29.png","page_title":"Grozni","context_page_description":"Grozni o Grozny esas la chef-urbo di la Republiko Chechena, en Rusia. Segun statistiki dil yaro 2017, ol havis 291 687 habitanti. Entote ol havas 324,16 km².\\nL'urbo jacas alonge la rivero Sunzha, proxim Kaukazo, en un ek la la regioni maxim richa pri petrolo de Rusia."},{"page_url":"https://de.wikipedia.org/wiki/Weltgesundheitsorganisation","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/World_Health_Organization_Executive_Board_Room.JPG","page_title":"Weltgesundheitsorganisation","context_page_description":"Die Weltgesundheitsorganisation ist die Koordinationsbehörde der Vereinten Nationen für das internationale öffentliche Gesundheitswesen. Es handelt sich dabei um eine Sonderorganisation der Vereinten Nationen mit Sitz in Genf. Sie wurde am 7. April 1948 gegründet und zählt heute 194 Mitgliedsstaaten. Sie wird seit Juli 2017 von WHO-Generaldirektor Tedros Adhanom Ghebreyesus geleitet."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B4%E5%89%8D%E5%AF%BA%E6%88%90%E8%B6%A3%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Kumamoto_Suizenji-jojuen04n4272.jpg","page_title":"水前寺成趣園","context_page_description":"水前寺成趣園は熊本県熊本市中央区にある大名庭園。面積約7万3000平方メートル。通称は水前寺公園。豊富な阿蘇伏流水が湧出して作った池を中心にした桃山式回遊庭園で、築山や浮石、芝生、松などの植木で東海道五十三次の景勝を模したといわれる。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A5%BF%E7%89%87_(%E6%9D%B1%E4%BA%AC%E9%83%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/%E6%96%B0%E5%9D%82_%28%E6%96%87%E4%BA%AC%E5%8C%BA%E8%A5%BF%E7%89%87%29.jpg","page_title":"西片 (東京都)","context_page_description":"西片是东京都文京区的町名。现行行政地名为西片一丁目与西片二丁目。2013年8月1日为止的居住人口有5,273人。邮递区号为113-0024。"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B6%E0%A4%BE%E0%A4%95%E0%A5%80%E0%A4%AF_%E0%A4%B5%E0%A4%BF%E0%A4%9C%E0%A5%8D%E0%A4%9E%E0%A4%BE%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Schuelp_kohlfeld_einspruehen.JPG","page_title":"शाकीय विज्ञान","context_page_description":"शाकीय विज्ञान सब्जियों के उत्पादन से सम्बन्धित विज्ञान है। इसे किसान नगदी फसल के रूप में लेते है।जो कि 2,3 महीने में ही पैदावार देने लग जाती है।इसमें भोजन के लिये अकाष्ठीय पौधों की खेती से सम्बन्धित मुद्दों का अध्ययन होता है।\\nशाकीय फसलों को निम्नलिखित ९ वर्गों में बाँटा जा सकता है-\\nशाक - जैसे पालक\\nसलाद वाली फसलें -\\nकोल फसलें - फूल गोभी तथा पत्ता गोभी\\nमूलीय फसलें - आलू, चुकन्दर, गाजर, मूली\\nबल्ब फसलें - प्याज\\nफली वाली फसलें - मटर, सेम\\nकुकुरबिट - कद्दू, खीरा आदि\\nसोलैनेसी फसलें - टमाटर\\nमीठा मक्का"},{"page_url":"https://hu.wikipedia.org/wiki/13A_busz_(P%C3%A9cs)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/P%C3%A9cs_13A_Bus_map.png","page_title":"13A busz (Pécs)","context_page_description":"A pécsi 13A jelzésű autóbusz Meszes déli csücskében található Budai Állomás és Hird, Kenderfonó között közlekedett. A járat betért Somogyba és Vasasra, így nem ez volt a legrövidebb úton közlekedő járat Hirdre. 113-as busz hamarabb kiér Hirdre, így ezt a járatot használják szívesebben az ott lakók."},{"page_url":"https://eu.wikipedia.org/wiki/Pommerit-le-Vicomte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/%5EPommerit.png","page_title":"Pommerit-le-Vicomte","context_page_description":"Pommerit-le-Vicomte Côtes-d'Armor departamenduan dagoen Bretainiako udalerria da."},{"page_url":"https://da.wikipedia.org/wiki/Maastricht","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/MaastrichtNoodkist04.jpg","page_title":"Maastricht","context_page_description":"Maastricht er en kommune og en by, beliggende i den sydlige provins Limburg i Nederlandene. Kommunens areal er på 60,03 km², og indbyggertallet er på 122.418 pr. 1. april 2016.\\nByen ligger nordøst for grænsen til Belgien og vest for grænsen til Tyskland, og der er togforbindelser til Belgien, Heerlen og Eindhoven."},{"page_url":"https://gl.wikipedia.org/wiki/Baia_de_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Barcelona_Cathedral_Interior_-_Crypt_of_Santa_Eulalia.jpg","page_title":"Baia de Barcelona","context_page_description":"Baia de Barcelona foi unha mártir cristiá. Foi canonizada en 633 e considérase santa tanto pola Igrexa católica como pola Ortodoxa.\\nÉ a patroa dos municipios de Barcelona, Pallejà, Perpiñán, Esparreguera, Santa Eulalia del Campo, Riudecols e da vila de Ribas de la Valduerna.\\nA súa simboloxía é unha cruz de Santo André, espeque e unha pomba. A súa vida confúndese ás veces coa Santa Baia de Mérida."},{"page_url":"https://es.wikipedia.org/wiki/Silla_charra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Estribos.jpg","page_title":"Silla charra","context_page_description":"La silla charra es aquella silla de montar o montura utilizada como asiento por las personas que practican la charrería. Se coloca encima del lomo del caballo para un mayor soporte y seguridad del charro. A pesar de que es muy pesada, comparada con otras sillas de montar, es muy cómoda para el caballo y jinete, sin causar daño en el lomo del animal. Es funcional para realizar cualquiera de las Suertes Charras.​"},{"page_url":"https://pl.wikipedia.org/wiki/%C3%81kos_Buzs%C3%A1ky","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Buzsacky.png","page_title":"Ákos Buzsáky","context_page_description":"Ákos Buzsáky – węgierski piłkarz występujący na pozycji środkowego lub prawego pomocnika w Ferencváros."},{"page_url":"https://simple.wikipedia.org/wiki/Dellingr","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Partially_illuminated_Ac_with_shadows.JPG","page_title":"Dellingr","context_page_description":"Dellingr is a god in the Norse mythology. He is a personification of a dawn.\\nHe married Nótt and she bore him a son named Dagr.\\nThe English family name Dallinger has been theorized as deriving from Dellingr."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%88%D8%B1_%D8%A7%D9%84%D8%AF%D9%8A%D9%86_%D8%AC%D9%87%D8%A7%D9%86%D9%83%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Jahangir_investing_a_courtier_with_a_robe_of_honour_watched_by_Sir_Thomas_Roe%2C_English_ambassador_to_the_court_of_Jahangir_at_Agra_from_1615-18%2C_and_others.jpg","page_title":"نور الدين جهانكير","context_page_description":"السُّلطَانُ الأَعظَم والخَاقَانُ المُكرَّم خُسرو گیتی پناه أَبُو الفَتح نُورُ الدِّين مُحمَّد خان سَلِيم جِهَانكِير پادشاه غازي بن مُحمَّد أكبر بن مُحمَّد همايون الگوركاني المعروف اختصارًا بِنُور الدين جهانكير أو نُور الدين مُحمَّد جهانكير أو جهانكيرشاه أو نورُ الدين مُحمَّد سليم، هو رابع سلاطين دولة المغول الهندية الذين حكموا شبه القارة الهندية طيلة 300 عام، وقد حكم البلاد من سنة 1014هـ المُوافقة لِسنة 1605م إلى سنة 1037هـ المُوافقة لِسنة 1627م. معنى اسمه «جهانكير» هو «فاتح العالم» أو «قاهر العالم»؛ ورث عن والده دولة مُترامية الأطرف، ووقَّع مُعاهدةً تجاريَّةً مع شركة الهند الشرقيَّة الإنگليزيَّة واعدًا تُجَّارها مُعاملة تفضيليَّة، فاتحًا بِذلك شبه القارَّة الهنديَّة على مصراعيها لإنگلترا لِأوَّل مرَّة.\\nاستكمل جُهُود والده في تطوير الدولة المغوليَّة، واشتهر بِكونه سُلطانًا عادلًا رحيمًا مُطلق التسامُح مع رعاياه، فكان يُتابع شكاوى المظلومين بِنفسه، فجعل سلسلةً من الذهب، مربوطة بسبعة أجراس، يدُقُّها المُشتكي فينزل السُلطان لِيحقق مظالم الناس بِنفسه، كما أصدر دُستُورًا من 12 وصيَّة أسَّس بها نظام دولة لِلصحَّة وتوطيد الأمن، وشجَّع العُلُوم والآداب والفُنُون، فازدهرت الحياة الفكريَّة والثقافيَّة في عهده، كما كان لزوجته نورجهان دورٌ كبيرٌ في إدارة الشُؤون التنظيمية والنسائيَّة في عصره."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%AC%CF%80%CE%B1%CF%82_%CE%93%CF%81%CE%B7%CE%B3%CF%8C%CF%81%CE%B9%CE%BF%CF%82_%CE%95%CE%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Pope_Gregory_V.jpg","page_title":"Πάπας Γρηγόριος Ε΄","context_page_description":"Ο Πάπας Γρηγόριος Ε΄ ήταν Πάπας από τις 3 Μαΐου του 996 έως το θάνατό του, στις 18 Φεβρουαρίου του 999.\\nΤο κοσμικό του όνομα ήταν Μπρούνο φον Κέρνθεν, και ήταν γιος του Όθωνα Α΄, δούκα της Καρινθίας, εγγονού του αυτοκράτορα Όθωνα Α΄ της Αγίας Ρωμαϊκής Αυτοκρατορίας. Ο Γρηγόριος διαδέχθηκε τον Ιωάννη ΙΕ΄ σε ηλικία μόλις 24 ετών. Ήταν εφημέριος του ξαδέλφου του, αυτοκράτορα Όθωνα Γ΄, ο οποίος τον πρότεινε για υποψήφιο.\\nΟ Γρηγόριος Ε΄ ήταν ο πρώτος Γερμανός Πάπας. Ωστόσο ορισμένες φορές ο Πάπας Βονιφάτιος Β΄ θεωρείται σαν ο πρώτος Γερμανός Πάπας, αν και ήταν Οστρογότθος.\\nΟ Γρηγόριος έδρασε κυρίως σαν αντιπρόσωπος του αυτοκράτορα στην Ρώμη και παραχώρησε μεγάλο αριθμό ειδικών προνομίων σε μοναστήρια της Αγίας Ρωμαϊκής Αυτοκρατορίας. Μια από τις πρώτες ενέργειές του ήταν να στέψει αυτοκράτορα Όθωνα Γ΄ στις 21 Μαΐου 996. Λίγες ημέρες μετά τη στέψη διεξήγαγαν από κοινού μια σύνοδο, η οποία αποκατέστησε τον Αρνούλφο στην επισκοπή της Ρεμς, ενώ ο Γερβέρτος, ο μελλοντικός Πάπας Σιλβέστρος Β΄, καταδικάστηκε σαν εισβολέας."},{"page_url":"https://en.wikipedia.org/wiki/Metraleeswar_temple","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kachi_Metrali1.jpg","page_title":"Metraleeswar temple","context_page_description":"Metraleeswarar Temple is a Hindu temple dedicated to Shiva, located in Pillaiyar Palayam area in Kanchipuram, Kanchipuram district in Tamil Nadu, India. Metraleeswarar is revered in the 7th century Tamil Saiva canonical work, the Tevaram, written by Tamil saint poets known as the nayanars and classified as Paadal Petra Sthalam, the 275 temples revered in the canon. The temple is believed to have expanded during the 13th century by Later Cholas as indicated in the inscriptions.\\nThe temple has four daily rituals at various times from 5:30 a.m. to 8 p.m., and three yearly festivals on its calendar, of which the Thirugnana Sambanda Gurupuja and Panguni Uthiram during March - April being the most prominent. The temple is maintained and administered by the Hindu Religious and Endowment Board of the Government of Tamil Nadu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D0%B1%D0%BE%D0%B2%D0%B0_(%D0%A2%D0%BE%D0%BC%D0%B0%D1%88%D0%BF%D1%96%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Wierzbowa.jpg","page_title":"Вербова (Томашпільський район)","context_page_description":"Ве́рбова — село в Україні, у Томашпільському районі Вінницької області. Населення становить 608 осіб.\\n05.02.1965 Указом Президії Верховної Ради Української РСР передано Вербівську сільраду Крижопільського району — до складу Тульчинського району."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E7%94%B0%E7%AB%99_(%E6%9D%B1%E4%BA%AC%E9%83%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Toei_Asakusa_line_symbol.svg","page_title":"三田站 (東京都)","context_page_description":"三田車站是位於日本東京都港區芝五丁目，屬於東京都交通局的鐵路車站。"},{"page_url":"https://es.wikipedia.org/wiki/Johann_Stephan_Decker","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Jean_Decker_par_Karpff.jpg","page_title":"Johann Stephan Decker","context_page_description":"Johann Stephan Decker fue un pintor francés.\\nA los veinte años fue a París, donde estudió con Jacques-Louis David y Jean-Jacques Karpff, pero en 1811 regresó a su ciudad natal. En 1821 se instaló en Viena, y trabajó para el canciller Metternich y la corte de Carlos de Austria-Teschen, enseñando dibujo y en la ejecución de miniaturas y pinturas al agua.\\nHizo retratos de personajes eminentes, como Beethoven.​\\nEra padre de los también pintores Georg Decker, Albert Decker y Gabriel Decker."},{"page_url":"https://tr.wikipedia.org/wiki/Fransa_A%C3%A7%C4%B1k_tek_kad%C4%B1nlar_%C5%9Fampiyonlar%C4%B1_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Jeanne_Matthey.jpeg","page_title":"Fransa Açık tek kadınlar şampiyonları listesi","context_page_description":"Fransa Açık Tek Kadınlar Şampiyonları Listesi, Fransa Açık tenis turnuvasının tek kadınlar şampiyonlarını ve ikincilerini göstermektedir."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B7%D5%B6%D5%A4%D6%80_%D6%87_%D4%BC%D5%B8%D6%82%D5%A1%D6%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Chateau-Azay-le-Rudeau-1.jpg","page_title":"Էնդր և Լուար","context_page_description":"Էնդր և Լուար, դեպարտամենտ Ֆրանսիայի կենտրոնում։\\nԷնդր և Լուար դեպարտամենտի կարգային թիվն է՝ 37։"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%88%EC%9A%B0%ED%86%B5_%EC%82%B0%ED%88%AC%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Nilton_Santos_-_2004.jpg","page_title":"니우통 산투스","context_page_description":"니우통 헤이스 두스 산투스는 흔히 니우통 산투스라는 이름으로 알려져 있는 브라질의 전직 축구 선수로 포지션은 레프트 백이었다. 선수 시절 최고의 수비 능력을 자랑했던 수비수 가운데 한 사람으로 여겨진다.\\n\\"백과사전\\"이라는 별명이 붙을 정도로 축구에 관한 지식을 갖고 있었으며 보타포구 소속으로 뛰었다. 1950년 FIFA 월드컵과 1954년 FIFA 월드컵, 1958년 FIFA 월드컵, 1962년 FIFA 월드컵에서 브라질 대표로 출전했으며 브라질의 1958년 FIFA 월드컵과 1962년 FIFA 월드컵 우승에 기여했다.\\n2004년 3월 펠레가 선정한 현존하는 축구 선수 목록인 FIFA 100에 선정되었다. 2013년 11월 27일 리우데자네이루에서 폐렴으로 인한 합병증으로 사망했다."},{"page_url":"https://tr.wikipedia.org/wiki/Helena,_Montana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Helena_Montana_2006.jpg","page_title":"Helena, Montana","context_page_description":"Helena, ABD'de Montana eyaletinin başkenti."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E3%81%AE%E5%B7%9E%E3%81%AE%E8%8A%B1%E4%B8%80%E8%A6%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Solidago_virgaurea_minuta0.jpg","page_title":"アメリカ合衆国の州の花一覧","context_page_description":"以下がアメリカ合衆国の州の花一覧である。"},{"page_url":"https://hr.wikipedia.org/wiki/Coro","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Coat_of_Arms_of_Santa_Ana_de_Coro.jpg","page_title":"Coro","context_page_description":"Coro, poznat i kao Santa Ana de Coro, je glavni grad pokrajine Falcón i najstariji grad zapadne Venezuele.\\nOd. 1993. godine Coro je upisan na UNESCO-v popis mjesta svjetske baštine u Aziji i Oceaniji, a od 2005. godine i na popis ugroženih mjesta svjetske baštine zbog oštećenja nastalih dugotrajnim padalinama od studenog 2004. do veljače 2005. godine, ali i izgradnjom nove šetnce na plaži i ulaznih vrata koji značajno djeluju na integritet zaštićenog lokaliteta."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre_de_Montfort-l%27Amaury","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Montfort-l%27Amaury_%C3%89glise1.jpg","page_title":"Église Saint-Pierre de Montfort-l'Amaury","context_page_description":"L'église Saint-Pierre de Montfort-l'Amaury est une église gothique des XVᵉ et XVIIᵉ siècles située à Montfort-l'Amaury.\\nElle fait l’objet d’un classement au titre des monuments historiques par la liste de 1840."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%94%E3%83%BC%E3%82%BF%E3%83%BC%E3%83%BB%E3%83%A6%E3%83%99%E3%83%AD%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Peter_Ueberroth.jpg","page_title":"ピーター・ユベロス","context_page_description":"ピーター・ヴィクター・ユベロスは、アメリカの実業家、6代目MLBコミッショナー。1984年ロサンゼルスオリンピックの大会組織委員長を務め、赤字続きだったオリンピックを放映権料やスポンサー収入などで黒字に転換させた。"},{"page_url":"https://es.wikipedia.org/wiki/Ernesto_Guerra_da_Cal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Federico_Garc%C3%ADa_Lorca_y_Ernesto_P%C3%A9rez_G%C3%BCerra%2C_Madrid%2C_1934.jpg","page_title":"Ernesto Guerra da Cal","context_page_description":"Ernesto Román Laureano Pérez Guerra, más conocido como Ernesto Guerra da Cal, nacido en Ferrol el 19 de diciembre de 1911 y fallecido en Lisboa el 28 de julio de 1994, fue un filólogo y escritor español."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%80%D0%BB%D0%B5%D0%BD%D0%BC%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Hauptstra%C3%9Fe_-_panoramio_-_Richard_Mayer_%282%29.jpg","page_title":"Ерленмос","context_page_description":"Ерленмос општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 45 општинских средишта округа Биберах. Према процјени из 2010. у општини је живјело 1.645 становника. Посједује регионалну шифру 8426043."},{"page_url":"https://hr.wikipedia.org/wiki/Ikoma,_Nara","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Ikoma-station.JPG","page_title":"Ikoma, Nara","context_page_description":"Ikoma je grad koji se nalazi na sjeverozapadnom kraju prefekture Nare u Japanu.\\nPo stanju od 2003., procjenjuje se da u Ikomi živi 112.675 stanovnika. Gustoća naseljenosti je 2120,44 osobe po km četvornome. Treći je po broju stanovnika u prefekturi Nari. Ukupne je površine 53,18 km²."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%B2%9D%E9%9C%8D%E7%B6%AD%E8%8C%A8-1%E8%A1%9D%E9%8B%92%E6%A7%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/MWP_Bechowiec.JPG","page_title":"貝霍維茨-1衝鋒槍","context_page_description":"贝霍维茨-1是波兰抵抗运动的战士在第二次世界大战中于地下工场自制的冲锋枪。"},{"page_url":"https://fr.wikipedia.org/wiki/Agriculture_au_Cameroun","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Agrofor%C3%AAts_de_Tayap.jpg","page_title":"Agriculture au Cameroun","context_page_description":"L'agriculture du Cameroun est la principale source de croissance et de devises du pays, jusqu'à 1978 quand la production de pétrole a démarré. En 2004, l'agriculture représentait 44 % du PIB. L'activité agricole et la productivité du secteur ont baissé au cours du boom du pétrole pendant les années 1980. L'agriculture est la principale occupation pour 56 % de la population active au Cameroun en 2003, bien que seulement environ 15,4 % des terres soient arables.\\nCe faible pourcentage est dû à une mauvaise politique de gestion des terres cultivables et à un enclavement presque universel des zones cultivables. En effet, très peu de routes relient les campagnes aux grandes villes, ce qui a un impact économique important étant donné que les régions susceptibles d'être exploitées ne sont pas reliées aux marchés.\\nCependant malgré ces défauts, le Cameroun jouit d'une agriculture dynamique qui réussit non seulement à atteindre l'auto suffisance alimentaire à plus de 80 %, mais aussi à stimuler les exportations des produits de consommation vers les pays voisins qui sont enclavés ainsi que ceux qui ne produisent pas assez de vivres tel que le Gabon et la Guinée équatoriale."},{"page_url":"https://fr.wikipedia.org/wiki/Botte_(agriculture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Bottes_d%27osier_brut.JPG","page_title":"Botte (agriculture)","context_page_description":"Une botte est un assemblage de produits de l'agriculture réunis au moyen d'un ou plusieurs liens. Toute plante ou élément d'une plante est susceptible d'être réuni en une botte tels la paille, le foin, les oignons, asperges, etc. C'est un type de conditionnement utilisé pour la récolte, la manutention et la vente, notamment en ce qui concerne les plantes aromatiques fraîches, les carottes, oignons, etc. La gerbe est un type de bottes particulier. La botte constitue une unité de mesure ancienne pour certains matériaux."},{"page_url":"https://simple.wikipedia.org/wiki/Tern","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Birds_of_Sweden_2016_08.jpg","page_title":"Tern","context_page_description":"Terns are seabirds in the family Sternidae. They are normally found near the sea, rivers, or wetlands.\\nThey are slender, lightly built birds with long, forked tails, narrow wings, long bills, and short legs. Most species are pale grey above and white below, with a contrasting black cap to the head, but some have dark plumage for part of the year.\\nTerns breed in noisy colonies and lay their eggs on bare ground with little or no nest material. Marsh terns make floating nests from the vegetation in their wetland habitats, and a few species build simple nests in trees, on cliffs or in crevices.\\nMost species feed on fish caught by diving from flight, but the marsh terns are insect-eaters, and some large terns may take small land vertebrates. Many terns are long-distance migrants, and the Arctic tern may see more daylight in a year than any other animal."},{"page_url":"https://et.wikipedia.org/wiki/11._ekspeditsioon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/ISS_Expedition_11_crew2.jpg","page_title":"11. ekspeditsioon","context_page_description":"11. ekspeditsioon oli rahvusvahelise Kosmosejaama 11. alaline meeskond.\\nEkspeditsioon saabus koos ESA astronaudi Roberto Vittoriga jaama 16. aprillil 2005. Vittori viibis ISS-is kaheksa päeva ja lahkus jaamast koos 10. ekspeditsiooni meeskonnaga. Ekspeditsiooni meeskonda kuulusid NASA astronaut John L. Phillips ja Roskosmose kosmonaut Sergei Krikaljov, kellest sai jaama 11. komandör. 16. augustil sai komandör Krikaljov kõige kauem kosmoses viibinud inimeseks ja tema kosmoses viibimise kogukestus on 803 päeva 9 tundi ja 39 minutit. Rekord püsis kuni 2015. aastani, mil selle ületas Gennadi Padalka.\\n18. juunil saabus jaama Vene mehitamata transpordilaev Progress, mis tõi jaama üle kahe tonni varustust. 28. juulil põkkus jaamaga kosmosesüstik Discovery ja see oli esimene kord pärast Columbia katastroofi, kui kosmosesüstik külastas Rahvusvahelist Kosmosejaama. Discovery tõi jaama uue güroskoobi ja 4,1 tonni varustust. Süstik lahkus jaamast 6. augustil. 10. septembril külastas jaama veel üks Progress, mis tõi jaama 2,3 tonni varustust.\\n3. oktoobril 2005 saabus jaama 12. ekspeditsioon koos kosmoseturisti Gregory Olseniga."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Nantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Artaud_Nozais_62_-_NANTES_-_La_Gare_de_la_Bourse.jpg","page_title":"Bahnhof Nantes","context_page_description":"Der Bahnhof Nantes ist der wichtigste Personenbahnhof im Großraum Nantes, Département Loire-Atlantique, Frankreich.\\nDie heutige Anlage stammt aus der Mitte des 20. Jahrhunderts und entstand durch Umbau aus dem alten Bahnhof Nantes-Orléans an gleicher Stelle, der von der Compagnie du chemin de fer de Paris à Orléans gebaut und betrieben worden war. In Nantes gab es als zentralen Bahnhof zusätzlich noch den Bahnhof Nantes-État als Knoten der Chemins de fer de l’État, der heute dem Güterverkehr dient."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%80%D0%B8%D1%81%D0%B2%D0%B5%D1%82%D0%B0_%D0%BF%D0%B5%D1%81%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Andrej_Rubl%C3%ABv_001.jpg","page_title":"Трисвета песма","context_page_description":"Трисвета песма или Трисхагион – молитва „Свјатиј Боже, свјатиј Крјепкиј, свјатиј Безсмертниј, помилуј нас!“ која се пева на православној литургији и погребу. Обраћа се светрема лицима Свете Тројице. Према црквеном предању један дечак чуо је где је певају анђели за време великог земљотреса у Цариграду 438. или 439. године. Када је народ отпевао трисвето земљотрес је престао. Од 5. века улази у ширу богослужбену употребу."},{"page_url":"https://es.wikipedia.org/wiki/Sig%C3%BCenza","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Bujarrabal.JPG","page_title":"Sigüenza","context_page_description":"Sigüenza es un municipio y localidad española de la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. Es también la cabeza del partido judicial homónimo y la mayor localidad de la comarca de la Serranía. En 2017 el término, que incluye aparte de a la capital municipal a 28 pedanías, contaba con una población total de 4496 habitantes. La localidad ostenta el título de ciudad."},{"page_url":"https://es.wikipedia.org/wiki/Tormenta_tropical_Beryl_(2006)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Beryl_2006_track.png","page_title":"Tormenta tropical Beryl (2006)","context_page_description":"La tormenta tropical Beryl fue la tercera tormenta tropical de la temporada de huracanes en el Atlántico de 2006. Se desarrolló de un disturbio tropical el 18 de julio siguió en general una trayectoria norte, y tomó fuerza hasta obtener vientos máximos de 95 km/h bajo condiciones favorables. Después de tomar rumbo noreste, Beryl se debilitó sobre aguas frías. El 21 de julio arremetió contra la isla de Nantucket, y poco después se convirtió en extratropical. Los remanentes extratropicales continuaron hacia el noreste a través de Nueva Escocia, y el 22 de julio se fusionó con un frente frío que se aproximaba.\\nBeryl produjo un mar enbravecido a lo larga de la costa noreste de los Estados Unidos. En Massachusetts, su impacto se limitó a ligeras precipitaciones y ráfagas de viento, los cuales no reportaron daños. Poco después, Beryl produjo lluvias moderadas y ráfagas en el Atlántico canadiense, dando como resultado apagones aunque con pocos daños. No fueron reportados fallecimientos."},{"page_url":"https://no.wikipedia.org/wiki/Karlskoga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Karlskoga_vapen.svg","page_title":"Karlskoga","context_page_description":"Karlskoga er en by i Örebro län i landskapet Värmland i Sverige. Det er Karlskoga kommunes administrasjonssenter. I 2010 hadde tettstedet 27084 innbyggere.\\nKarlskoga er kjent som Alfred Nobels hjemby, og Nobelmuseet ligger her. Dessuten ligger den svenske forsvarsindustrigiganten Bofors her."},{"page_url":"https://zh-yue.wikipedia.org/wiki/AK-47","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/AKROMAIM.jpg","page_title":"AK-47","context_page_description":"AK-47，俄文全寫Автомат Калашникова образца 1947 года，即係卡拉什尼科夫1947年自動步槍，係蘇聯槍械設計師米哈伊爾·季莫費耶維奇·卡拉什尼科夫設計嘅自動步槍。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AB%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Phyllostachys_Glauca_%27Yunzhu%27_in_flower.jpg","page_title":"竹","context_page_description":"竹，又稱竹子，是竹亞科植物的通稱，屬於禾本目禾本科，可分為3族、約123屬，是禾本科中唯一具有喬木形態的類群，如熱帶型的簕竹族與溫帶型的青籬竹族，但也包括低矮的草本竹類黍竺族。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D1%85_%D0%91%D1%96%D1%80%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Peczatka_grom_B_W.jpg","page_title":"Герб Великих Бірок","context_page_description":"Герб Великих Бірок — офіційний символ смт Великі Бірки."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B2%D8%A8%D8%A7%D8%AF_%D8%A3%D9%81%D8%B1%D9%8A%D9%82%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/African_Civet_area.png","page_title":"زباد أفريقي","context_page_description":"الزباد الأفريقي: حيث أنه يعتبر شائعا ويتوزع على نطاق واسع في الغابات و الغابات الثانوية. يتم سرد أنها بأقل القلق على القائمة الحمراء الاتحاد الدولي للحفاظ علي البيئة منذ عام 2008. وفي بعض البلدان، مهدد من قبل الصيدين، ويتم\\nالاحتفاظ بالأفرادفي البرية وصيدها لإنتاج العطور الصناعة.\\nالزباد الأفريقي هو في الأساس ليلي ويقضي اليوم نائما في نباتات كثيفة، لكنه يستيقظ عند غروب الشمس. إنه حيوان ثديي وحيد ذو لون فريد: البقع السوداء والبيضاء التي تغطي قشورها الخشنة وحلقاتها على الذيل هي نمط خفي فعال. العصابات السوداء المحيطة بأعينها تشبه إلى حد كبير تلك الخاصة بالراكون. السمات المميزة الأخرى هي الخلفية الكبيرة بشكل غير متناسب وقمة الانتصاب الظهرية. إنه اختصاصي آكل اللحوم، يتغذى على الفقاريات الصغيرة واللافقاريات والبيض والجيف والخضروات. وهي واحدة من عدد قليل من الحيوانات آكلة اللحوم القادرة على أكل اللافقاريات السامة مثل النمل الأبيض والديدان الألفية. يكتشف الفريسة أساسًا عن طريق الرائحة والصوت بدلاً من البصر."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Heinrich_Boeckler","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Johann_Heinrich_Boeckler.jpg","page_title":"Johann Heinrich Boeckler","context_page_description":"Johann Heinrich Boeckler war ein deutscher Universalgelehrter."},{"page_url":"https://he.wikipedia.org/wiki/%D7%96%27%D7%99%D7%96%27%D7%95%D7%A7%D7%94_%D7%93%D7%94_%D7%96%27%D7%A8%D7%99%D7%A7%D7%95%D7%90%D7%A7%D7%95%D7%90%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Jeri_1257a.jpg","page_title":"ז'יז'וקה דה ז'ריקואקוארה","context_page_description":"ז'יז'וקה דה ז'ריקואקוארה היא עיירה בצפון-מערב מדינת סיארה שבברזיל, לחוף האוקיינוס האטלנטי, 327 ק\\"מ מערבית לפורטלזה. בשנת 2010 התגוררו בה כ-17 אלף תושבים."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_mosqu%C3%A9es_d%27Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Luhansk_mosque.jpg","page_title":"Liste de mosquées d'Ukraine","context_page_description":"Cet article présente la liste de mosquées d'Ukraine."},{"page_url":"https://it.wikipedia.org/wiki/M%C4%83gurele_(Prahova)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/ROU_PH_Magurele_CoA.png","page_title":"Măgurele (Prahova)","context_page_description":"Măgurele è un comune della Romania di 4.877 abitanti, ubicato nel distretto di Prahova, nella regione storica della Muntenia.\\nIl comune è formato dall'unione di 3 villaggi: Coada Malului, Iazu, Măgurele."},{"page_url":"https://en.wikipedia.org/wiki/Caparo_Vehicle_Technologies","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Caparo_T1_British_International_Motorshow_2006_195999165.jpg","page_title":"Caparo Vehicle Technologies","context_page_description":"Caparo Vehicle Technologies, formerly known as Freestream, was a British company that provided advanced technology development, materials engineering, and design services to automotive, motorsport and aerospace markets. The company was founded under the name Freestream by Graham Halstead and Ben Scott-Geddes, former engineers that worked on the McLaren F1 project. In April 2006, under the guidance and lead from financier, Sean Butcher the company was acquired by Caparo, and renamed Caparo Vehicle Technologies. The company went into administration in 2015 and was then liquidated and fully dissolved by 2019 Caparo Vehicle Technologies produced a sports car called the T1."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_Rakovn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Skryje_%28okres_Rakovn%C3%ADk%29_%282%29.jpg","page_title":"Seznam památných stromů v okrese Rakovník","context_page_description":"Toto je seznam památných stromů v okrese Rakovník, v němž jsou uvedeny památné stromy na území okresu Rakovník."},{"page_url":"https://no.wikipedia.org/wiki/Junior_Eurovision_Song_Contest_2003","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/JESC_2003_Map.svg","page_title":"Junior Eurovision Song Contest 2003","context_page_description":"Junior Eurovision Song Contest 2003 var den første utgaven av Junior Eurovision Song Contest, EBUs sangkonkurranse for barn mellom åtte og femten år. Konkurransen ble arrangert lørdag 15. november 2003 i Forum København i Danmark. Elleve år gamle Dino Jelusić fra Kroatia vant med sangen «Ti si moja prva ljubav»."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Harborcreek","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Map_of_Harborcreek_Township%2C_Erie_County%2C_Pennsylvania_Highlighted.png","page_title":"Municipio de Harborcreek","context_page_description":"El municipio de Harborcreek es un municipio ubicado en el condado de Erie en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 15.178 habitantes y una densidad poblacional de 171 personas por km².​"},{"page_url":"https://es.wikipedia.org/wiki/Klezmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Xyinstrument.jpg","page_title":"Klezmer","context_page_description":"El klezmer es un género musical étnico originado en la tradición askenazí de Europa del Este. Se desarrolló rápidamente en las comunidades judías existentes antes de las dos guerras mundiales. Interpretada por los klezmorim, la música klezmer constaba principalmente de melodías de baile y muestras de piezas instrumentales para bodas y otras celebraciones en sus principios, consolidándose posteriormente como género musical independiente con características únicas y bien definidas. En la actualidad, la música klezmer todavía es interpretada en casi todo el mundo, y su esencia y sonido permanecen prácticamente inalterados."},{"page_url":"https://it.wikipedia.org/wiki/J%C3%BCrgen_Ahrend","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Eglise_r%C3%A9form%C3%A9e_de_Payerne_-_7.jpg","page_title":"Jürgen Ahrend","context_page_description":"Jürgen Ahrend è un organaro tedesco."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D8%A8%D8%B9%D8%AB%D8%A7%D8%AA_%D8%A7%D9%84%D8%AF%D8%A8%D9%84%D9%88%D9%85%D8%A7%D8%B3%D9%8A%D8%A9_%D9%81%D9%8A_%D8%B1%D9%88%D8%B3%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Konsulstvo_Sankt-Peterburg_3630.jpg","page_title":"قائمة البعثات الدبلوماسية في روسيا","context_page_description":"تعرض هذه الصفحة قائمة بأسماء الدول التي توجد لديها بعثات دبلوماسية إلى روسيا. حاليا، توجد في العاصمة روسيا 148 سفارة."},{"page_url":"https://sv.wikipedia.org/wiki/Council,_Idaho","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Council_idaho_peoples_theater.jpg","page_title":"Council, Idaho","context_page_description":"Council är en stad i den amerikanska delstaten Idaho med en yta av 2,7 km² och en folkmängd som uppgår till 839 invånare. Council är administrativ huvudort i Adams County, Idaho."},{"page_url":"https://en.wikipedia.org/wiki/Lotta_Sv%C3%A4rd","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Lottor.jpg","page_title":"Lotta Svärd","context_page_description":"Lotta Svärd was a Finnish voluntary auxiliary paramilitary organisation for women. Formed originally in 1918, it had a large membership undertaking volunteer social work in the 1920s and 1930s. It was formed to support the White Guard. During the Second World War, it mobilized to replace men conscripted into the army. It served in hospitals, at air raid warning positions, and other auxiliary tasks in close cooperation with the army. The women were officially unarmed except for an antiaircraft battery in 1944. Virtanen argues that, their \\"accountability to the nation took a masculine and military form in public, but had a private, feminine side to it including features like caring, helping and loving.\\" The organisation was suppressed by the government after the war."},{"page_url":"https://de.wikipedia.org/wiki/Lymphatisches_System","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Lymphatic_system_%28vector%29.svg","page_title":"Lymphatisches System","context_page_description":"Das lymphatische System ist ein Teil des Abwehrsystems der Wirbeltiere gegen Krankheitserreger, Fremdpartikel und krankhaft veränderte Körperbestandteile. Es gliedert sich in die lymphatischen Organe und das Lymphgefäßsystem. Das Lymphgefäßsystem hat neben der Funktion im Abwehrsystem auch eine Bedeutung beim Flüssigkeitstransport und steht in enger Beziehung zum Blutkreislauf."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%88%D9%85%D9%8A_%D8%A8%D9%8A%D8%B1%D9%86_(%D8%B3%D9%8A%D8%A7%D8%B3%D9%8A)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Tommy_Byrne.jpg","page_title":"تومي بيرن (سياسي)","context_page_description":"تومي بيرن ‏ هو لاعب كرة قاعدة وسياسي أمريكي، ولد في 31 ديسمبر 1919 في بالتيمور في الولايات المتحدة، وتوفي في 20 ديسمبر 2007 في الولايات المتحدة."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%92%D0%B0%D0%BD_%D0%93%D0%BE%D0%B3_%D0%92%D0%B8%D0%BD%D1%81%D0%B5%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Vincent_van_Gogh_%281853-1890%29_-_The_Olive_Trees_%281889%29.jpg","page_title":"Ван Гог Винсент","context_page_description":"Винсент Виллем Ван Гог, — пĕтĕм тĕнче пĕлекен нидерланд-француз ÿнерçи, импрессионизм хыçалхи тапхăрĕн элчи."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%A7%D8%B3%D9%83%D8%A7_%D9%85%D9%88%D9%86%D8%AA%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Banat_Josephinische_Landaufnahme_pg180.jpg","page_title":"ساسكا مونتانا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nساسكا مونتانا, قريه فى رومانيا."},{"page_url":"https://id.wikipedia.org/wiki/Lausanne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ouchy_waterfront_statue.JPG","page_title":"Lausanne","context_page_description":"Lausanne adalah sebuah kota di bagian Swiss yang berbahasa Prancis, di pesisir Danau Jenewa, seberang Évian-les-Bains, Prancis, dan sekitar 60 km timur laut dari Jenewa. Lausanne adalah ibu kota canton Vaud. Populasinya adalah 146.732. Ia terletak di tengah-tengah daerah penghasil anggur dan saat ini juga merupakan kota terkecil di dunia yang memiliki sistem angkutan cepat atau metro. Pada tahun 2020 Lausanne akan menjadi tuan rumah Olimpiade Remaja Musim Dingin."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B3%89%E5%8D%97%E9%83%B5%E4%BE%BF%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Sennan_post_office_41009.JPG","page_title":"泉南郵便局","context_page_description":"泉南郵便局は、大阪府泉南市にある郵便局。民営化前の分類では集配普通郵便局であった。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%B8%D5%AF%D5%BF%D5%A5%D5%B4%D5%A2%D5%A5%D6%80%D5%B5%D5%A1%D5%B6_%D5%B0%D5%A5%D5%B2%D5%A1%D6%83%D5%B8%D5%AD%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_50-%D5%A1%D5%B4%D5%B5%D5%A1%D5%AF%D5%AB_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6_(%D4%B5%D6%80%D6%87%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Revived_Armenia_Monument_Face_Cascade_Yerevan_Armenia_2013_09_01_VM.jpg","page_title":"Հոկտեմբերյան հեղափոխության 50-ամյակի հուշարձան (Երևան)","context_page_description":"Հոկտեմբերյան հեղափոխության 50-ամյակի հուշարձան, գտնվում է Երևանի Արաբկիր վարչական շրջանում՝ Ազատության պողոտայի սկզբնամասում՝ Կասկադ համալիրի վերևում։"},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99%C3%AD%C5%BEov%C3%A1_cesta_(Krnov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Cvilin_-_K%C5%99%C3%AD%C5%BEov%C3%A1_cesta.JPG","page_title":"Křížová cesta (Krnov)","context_page_description":"Křížová cesta v Krnově v okrese Bruntál se nachází na poutním místě na vrchu Cvilín přibližně 1,6 kilometru jihovýchodně od centra města Krnova."},{"page_url":"https://en.wikipedia.org/wiki/Forfar_Infirmary","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Forfar_Infirmary_-_geograph.org.uk_-_113492.jpg","page_title":"Forfar Infirmary","context_page_description":"Forfar Infirmary was a health facility in Arbroath Road in Forfar, Angus, Scotland. It was managed by NHS Tayside."},{"page_url":"https://es.wikipedia.org/wiki/Epidauro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Epidaurus_010.jpg","page_title":"Epidauro","context_page_description":"Epidauro era una pequeña ciudad griega de la Argólida, península al noreste del Peloponeso. Es principalmente conocida por su santuario de Asclepio, a unos 8 km al oeste de la ciudad, y por su teatro, que acoge representaciones aún en nuestros días. Desde 2011 es uno de los municipios de la unidad periférica de Argólida.\\nFue una ciudad-estado independiente, incorporada al distrito de Argólida por Roma. Su territorio, bastante reducido, recibía el nombre de Epidauria, y limitaba al oeste con Argólida, al norte con Corinto, al sur con Trecén, y al este con el golfo Sarónico. Estaba situada en una pequeña península que formaba una llanura con viñas y montañas. El puerto estaba en la parte norte de la península, bien protegido. La ciudad original estaba limitada a parte de la península, pero se extendió al norte y al sur.\\nEstaba solo a seis horas en barco de Atenas; estaba cerca de Egina y Argos, y todo eso contribuyó a su importancia.\\nLa ciudad fue gobernada por reyes, pero más tarde la oligarquía substituyó a la monarquía. Más tarde fue gobernada por tiranos."},{"page_url":"https://de.wikipedia.org/wiki/%C5%8Cigawa-Hauptlinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Oigawa-Toki228.jpg","page_title":"Ōigawa-Hauptlinie","context_page_description":"Die Ōigawa-Hauptlinie ist eine Eisenbahnstrecke auf der japanischen Insel Honshū, die von der Bahngesellschaft Ōigawa Tetsudō betrieben wird. Sie erschließt den mittleren Teil des Ōi-Tals in der Präfektur Shizuoka. Ursprünglich als Zubringer zu den Baustellen verschiedener Talsperren und Wasserkraftwerke errichtet, ist sie heute vor allem für den touristischen Ausflugsverkehr von Bedeutung. Die Ōigawa-Hauptlinie ist Japans einzige Bahnstrecke, auf der das ganze Jahr über Sonderfahrten mit historischen Fahrzeugen angeboten werden."},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%A3o_municipal_de_S%C3%A3o_Paulo_em_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Jose_Anibal_27maio2008.jpg","page_title":"Eleição municipal de São Paulo em 2012","context_page_description":"A eleição municipal da cidade brasileira de São Paulo ocorreu em 7 de Outubro e 28 de Outubro de 2012 para eleger um prefeito, um vice-prefeito e 55 vereadores para a administração da cidade. O prefeito anterior, Gilberto Kassab, do PSD, terminou seu mandato em 31 de dezembro de 2012 e não concorreu à reeleição. O prefeito eleito foi Fernando Haddad do PT, com 55,57% dos votos válidos, enquanto José Serra do PSDB foi derrotado com 44,43% dos votos válidos."},{"page_url":"https://it.wikipedia.org/wiki/Sampans","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Sampans_%28Jura%2C_France%29_en_janvier_2018_-_0.JPG","page_title":"Sampans","context_page_description":"Sampans è un comune francese di 903 abitanti situato nel dipartimento del Giura nella regione della Borgogna-Franca Contea."},{"page_url":"https://vec.wikipedia.org/wiki/Cr%C3%A9py","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Cr%C3%A9py_%28Aisne%29_mairie.JPG","page_title":"Crépy","context_page_description":"Crépy el xé on comun de 1 837 abitanti del departemento de Aisne che el fa parte del rejon Hauts-de-France in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Otzberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Pfarhausstra%C3%9Fe_12_Otzberg-Lengfeld.jpg","page_title":"Liste der Kulturdenkmäler in Otzberg","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Otzberg, Landkreis Darmstadt-Dieburg, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D8%A7%D9%86_%D8%B4%D9%85%D8%A7%D8%B1%D9%87_%DB%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Gokyo_Lakes_01.jpg","page_title":"استان شماره ۱","context_page_description":"استان شماره ۱ یکی از هفت استان نپال است. استان شماره ۱ ۲۵٬۹۰۵ کیلومتر مربع مساحت و ۴٬۵۳۴٬۹۴۳ نفر جمعیت دارد.\\nاین استان که براساس قانون اساسی نپال در ۲۵ سپتامبر ۲۰۱۵ تأسیس شده‌است دارای ۲۸ کرسی پارلمانی و ۹۳ کرسی استانی است که نمایندگی در انتخابات توسط مردم انتخاب می‌شوند."},{"page_url":"https://ru.wikipedia.org/wiki/Hilton_Istanbul_Bosphorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Hilton_istanbul.jpg","page_title":"Hilton Istanbul Bosphorus","context_page_description":"Hilton İstanbul Bosphorus — пятизвёздочный отель в Стамбуле. Он расположен в квартале Элмадаг, в нескольких минутах ходьбы от площади Таксим. Открытый в 1955 году как Istanbul Hilton отель с тех пор является частью гостиничной сети Hilton Hotels & Resorts.\\nЭто был первый современный отель в Европе, построенный с нуля после Второй мировой войны. Ныне он также считается самым старым членом Hilton Hotels за пределами США."},{"page_url":"https://en.wikipedia.org/wiki/Barberier","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Population_-_Municipality_code_03016.svg","page_title":"Barberier","context_page_description":"Barberier is a commune in the Allier department in the Auvergne-Rhône-Alpes region of central France."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_(%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE_%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Konstanty_Kazimierz_Brzostowski.PNG","page_title":"Секретарь (Великое княжество Литовское)","context_page_description":"Секретарь в Великом княжестве Литовском — должностное лицо, служившее в канцелярии и занимавшееся делопроизводством великого князя. Впервые упоминается в 1407 году. Считается, что изначально так назывались наиболее заслуженные писари. Со второй половины XVI века — самостоятельная должность. Иногда секретари выполняли функции ревизоров, мерников, поборцев, межевых комиссаров и др. Некоторые секретари вели документацию Рады, чем позже занимались регенты.\\nНа Сейме 1670 года была создана назначаемая великим князем министерская должность — секретарь великий духовный, не входившая в аппарат канцлера и занимавшаяся специальными поручениями.\\nЕщё в начале XVI века писарь Иван Сапега назывался, вероятно, на польский манер «великий писарь литовский». Постоянная должность с соответствующими функциями была установлена на коронационном сейме 1764 года как секретарь великий светский."},{"page_url":"https://en.wikipedia.org/wiki/Felix_Steiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Bundesarchiv_Bild_146-1973-138-14A%2C_Felix_Steiner.jpg","page_title":"Felix Steiner","context_page_description":"Felix Martin Julius Steiner was a German SS commander during the Nazi era. During World War II, he served in the Waffen-SS, the combat branch of the SS, and commanded several SS divisions and corps. He was awarded the Knight's Cross of the Iron Cross with Oak Leaves and Swords. Together with Paul Hausser, he contributed significantly to the development and transformation of the Waffen-SS into a combat force made up of volunteers and conscripts from both occupied and un-occupied lands.\\nSteiner was chosen by Heinrich Himmler to oversee the creation of and then command the SS Division Wiking. In 1943, he was promoted to the command of the III SS Panzer Corps. On 28 January 1945, Steiner was placed in command of the 11th SS Panzer Army, which formed part of a new Army Group Vistula, an ad-hoc formation to defend Berlin from the Soviet armies advancing from the Vistula River.\\nOn 21 April 1945, during the Battle for Berlin, Steiner was placed in command of Army Detachment Steiner, while Adolf Hitler ordered Steiner to envelop the 1st Belorussian Front through a pincer movement, advancing from the north of the city."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-Tout-Espoir","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/St_Gen%C3%A8s_de_Lombaud_Eglise_Chapiteaux_4_a.JPG","page_title":"Église Notre-Dame-de-Tout-Espoir","context_page_description":"L'église Notre-Dame-de-Tout-Espoir est une église catholique située dans la commune de Saint-Genès-de-Lombaud, dans le département de la Gironde, en France."},{"page_url":"https://es.wikipedia.org/wiki/Roberto_Bolle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Roberto_bolle_2.jpg","page_title":"Roberto Bolle","context_page_description":"Roberto Bolle es un bailarín italiano de danza clásica. Ha bailado en los mejores escenarios de Italia y con las más prestigiosas compañías del mundo, entre otras el Royal Ballet de Londres, el Ballet Nacional Canadiense, el Ballet de Estocolmo, el Ballet de Tokio, el American Ballet Theatre de Nueva York o las óperas de Berlín, Viena, Múnich, el Teatro Mariinski de San Petersburgo, el Teatro Bolshói de Moscú, etc. En 2003 recibió el título de étoile del Teatro de La Scala y en 2009 principal dancer del American Ballet Theatre.43 años"},{"page_url":"https://fr.wikipedia.org/wiki/Gonyosoma_boulengeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Rhynchophis_boulengeri_%287%29.jpg","page_title":"Gonyosoma boulengeri","context_page_description":"Gonyosoma boulengeri, le Serpent Ratier-Rhinocéros est une espèce de serpents de la famille des Colubridae."},{"page_url":"https://nl.wikipedia.org/wiki/Koolhydraat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Alpha-D-Glucopyranose.svg","page_title":"Koolhydraat","context_page_description":"Koolhydraten, ook sachariden genoemd, zijn een bepaald type verbindingen van koolstof-, waterstof- en zuurstofatomen waarbij de waterstof- en zuurstofatomen in een verhouding 2:1 voorkomen: algemene formule Cₙₘ. Koolhydraten kunnen als een hydraat van koolstof worden beschouwd en behoren daarmee tot de organische verbindingen. Lang niet alle verbindingen in de levende natuur die als koolhydraten zijn geclassificeerd beantwoorden evenwel aan deze verhoudingsformule. Ook derivaten met andere atoomtypen en andere verhoudingen worden tot de omvangrijke groep van de koolhydraten gerekend zolang ze dezelfde basisstructuur hebben. Zo worden ook desoxyribose en glucosamine tot de koolhydraten gerekend, melkzuur daarentegen niet."},{"page_url":"https://en.wikipedia.org/wiki/Commanders_of_World_War_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Rola-%C5%BBymierski_Micha%C5%82.jpg","page_title":"Commanders of World War II","context_page_description":"The Commanders of World War II were for the most part career officers. They were forced to adapt to new technologies and forged the direction of modern warfare. Some political leaders, particularly those of the principal dictatorships involved in the conflict, Joseph Stalin, Adolf Hitler, Benito Mussolini and Emperor Hirohito, acted as supreme military commanders as well as dictators for their respective countries or empires."},{"page_url":"https://de.wikipedia.org/wiki/Enrico_Dalgas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Dalgas_-August_Jerndorff.jpg","page_title":"Enrico Dalgas","context_page_description":"Enrico Mylius Dalgas war ein dänischer Ingenieuroffizier und Pionier der Bodenmelioration in Dänemark. Er war Nachkomme einer der französischen Hugenottenfamilien, die 1685 nach Dänemark geflüchtet war."},{"page_url":"https://de.wikipedia.org/wiki/Thomas_Dawes_(Politiker)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/ThomasDawes_ca1806_byGilbertStuart_HistoricNewEngland.png","page_title":"Thomas Dawes (Politiker)","context_page_description":"Thomas Dawes war ein US-amerikanischer Militär, Architekt und Politiker."},{"page_url":"https://el.wikipedia.org/wiki/%CE%96%CE%B1%CE%BA_%CE%BD%CF%84%CE%B5_%CE%9C%CE%BF%CE%BB%CE%B1%CE%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/JacquesdeMolay.jpg","page_title":"Ζακ ντε Μολαί","context_page_description":"Ο Ζακ ντε Μολαί ήταν ο τελευταίος Μέγας Μάγιστρος των Ιπποτών του Ναού, διοικώντας το Τάγμα από τις 20 Απριλίου του 1292 έως τη διάλυσή του από τον Πάπα Κλήμη Ε' το 1307. Αν και σχετικά λίγα είναι γνωστά για την πραγματική του ζωή και τα κατορθώματα του πριν απ' τα τελευταία του χρόνια, θεωρείται ο πιο διάσημος Ιππότης του Ναού, μαζί με τον ιδρυτή του Τάγματος και πρώτο Μέγα Μάγιστρο Ούγο ντε Παιν. Στόχος του ντε Μολέ ήταν να μεταρρυθμίσει το Τάγμα, και να το προσαρμόσει στην κατάσταση που επικρατούσε στους Αγίους Τόπους κατά την παρακμή των Σταυροφοριών. Καθώς ο ενθουσιασμός της Ευρώπης για τις Σταυροφορίες έφθινε, ο Φίλιππος Δ΄ της Γαλλίας, βαθύτατα χρεωμένος απέναντι στους Ναΐτες, διέταξε το 1307 τη σύλληψη και το βασανισμό του ντε Μολέ και άλλων Γάλλων ιπποτών ωστέ να αποσπάσει ψευδείς ομολογίες. Όταν αργότερα ο ντε Μολέ απέσυρε την κατάθεσή του, ο Φίλιππος διέταξε το θάνατό του στην πυρά σ' ένα νησί του Σηκουάνα, τον Μάρτιο του 1314."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9D%8E%E5%A1%94%E5%B8%83%E9%87%8C%E4%BA%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Panoramica_Alisas_Cantabria.jpg","page_title":"坎塔布里亚","context_page_description":"坎塔布里亚是西班牙的自治区。它北邻坎塔布连海、南接卡斯蒂利亚-莱昂、西邻阿斯图里亚斯、东连巴斯克。首府桑坦德，市区内最大的城市和主要工业中心。"},{"page_url":"https://en.wikipedia.org/wiki/Alexandria,_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Bolton_High_School%2C_Alexandria%2C_LA_IMG_4265.JPG","page_title":"Alexandria, Louisiana","context_page_description":"Alexandria is the ninth-largest city in the state of Louisiana and is the parish seat of Rapides Parish, Louisiana, United States. It lies on the south bank of the Red River in almost the exact geographic center of the state. It is the principal city of the Alexandria metropolitan area which encompasses all of Rapides and Grant parishes. Its neighboring city is Pineville. In 2010, the population was 47,723, an increase of 3 percent from the 2000 census."},{"page_url":"https://pt.wikipedia.org/wiki/Viva_la_Vida_or_Death_and_All_His_Friends","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Coldplay_Viva_La_Vida_Tour_in_Hannover_August_25th_2009.jpg","page_title":"Viva la Vida or Death and All His Friends","context_page_description":"Viva la Vida or Death and All His Friends, muitas vezes referido somente como Viva la Vida é o quarto álbum de estúdio da banda inglesa de rock alternativo Coldplay, lançado em 11 de junho de 2008 pela gravadora Parlophone. O nome do álbum contém uma expressão espanhola \\"Viva la Vida\\" que se traduz como \\"Viva a vida!\\" ou \\"Aproveite a vida\\", e outra expressão em inglês \\"Death and All His Friends\\" que se traduz como \\"A Morte e todos seus amigos\\". Liricamente, o álbum contém referências para a vida, morte e guerra.\\nAs sessões de gravação do álbum começaram em junho de 2007 e terminaram em abril de 2008. Foi produzido por Jon Hopkins, Rik Simpson, Markus Dravs e Brian Eno. O álbum foi o primeiro a ser produzido por este último. A banda resolveu explorar estilos experimentais, pois Eno havia exigido um som diferente a cada música do álbum, e expandiu os seus interesses musicais durante a gravação de Viva la Vida. A banda estava querendo fazer um álbum que durasse menos de 42 minutos. Como resultado, o álbum teve uma duração maior do que o desejado. O desenvolvimento do álbum atrasou a data de lançamento várias vezes.\\nViva la Vida foi recebido com sucesso crítico e comercial."},{"page_url":"https://de.wikipedia.org/wiki/Katja_Cronauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Schiffswrack_1.jpg","page_title":"Katja Cronauer","context_page_description":"Katja Anton Cronauer ist deutscher Nationalität, übersetzt Romane, schreibt Texte und erstellt Computercollagen. Cronauer möchte keinem Geschlecht zugeordnet sein und versteht sich als nichtbinär."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD_(%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Schwetzinger_Schlo%C3%9F_von_der_Gartenseite.jpg","page_title":"Швецинген (замок)","context_page_description":"Замокот Швецинген е замок во Швецинген што во главно служел како летна резиденција на принцовите Карл Филип и Карл Теодор. Најпозната е градината на замокот уредена во 18 век. Секоја година во замокот се одржуваат Швецингшките игри, а Фестивалот на светлината се одржува на секои две години."},{"page_url":"https://de.wikipedia.org/wiki/Fuentidue%C3%B1a","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Fuentidue%C3%B1a_soportales.JPG","page_title":"Fuentidueña","context_page_description":"Fuentidueña ist ein Ort und eine Gemeinde mit 142 Einwohnern in der zentralspanischen Provinz Segovia in der Autonomen Gemeinschaft Kastilien-León. Aufgrund der Vielzahl historischer Bauwerke wurde der Ort im Jahr 1997 als Kulturgut in der Kategorie Conjunto histórico-artístico eingestuft."},{"page_url":"https://de.wikipedia.org/wiki/Tony_Pastor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Tony_Pastor%2C_Hotel_Edison%2C_New_York%2C_N.Y.%2C_between_1946_and_1948_%28William_P._Gottlieb_14721%29.jpg","page_title":"Tony Pastor","context_page_description":"Tony Pastor war ein US-amerikanischer Sänger, Tenorsaxophonist und Bigband-Leader im Bereich des Swing und der Populären Musik."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%B3%E0%AE%B0%E0%AF%8D%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AF%82%E0%AE%9F%E0%AE%95%E0%AE%AE%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Campylobacter_jejuni.jpg","page_title":"வளர்ப்பூடகம்","context_page_description":"வளர்ப்பூடகம் என்பது நுண்ணுயிர்கள், உயிரணுக்கள், இழையம் போன்றவை வளர்வதற்கு தேவையான போசாக்கைக் கொண்டிருக்கும், செயற்கையாகத் தயாரிக்கப்பட்ட ஒரு திரவ, அல்லது கூழ்போன்ற அல்லது திண்மப் பதார்த்தமாகும். வேறுபட்ட வகையான உயிரணுக்கள், நுண்ணுயிர்கள் அல்லது இழையங்கள் வளர்வதற்கு வேறுபட்ட வளர்ப்பூடகங்கள் தேவைப்படும். வளர்ப்பூடகங்கள் உயிரணு வளர்ப்பு, இழைய வளர்ப்பு செயல்முறைகளில் பயன்படுத்தப்படும்.\\nசைகொட்ரலா படென்சு போன்ற சில பாசி வகைத் தாவரங்களும் வளர்ப்பூடகத்தில் வளர்க்கப்படுகின்றன. வெளிச் சோதனை முறை கருக்கட்டலில், கருக்கட்டல் செயல்முறைக்காக முட்டை, விந்து என்பவற்றை ஒன்றாகச் சேர்த்தும், கருக்கட்டலின் பின்னர் உருவாகும் முளையம் தாயின் கருப்பையினுள் வைக்கப்படுவதற்கு முன்னராகவும் வளர்ப்பூடகத்திலேயே பேணப்படும்\\nவளர்ப்பூடகங்கள் முக்கியமாக இரு வகைப்படும்.\\nநுண்ணுயிர்களை ஆய்வு கூடங்களில் வளர்த்தெடுக்க உதவும் வளர்ப்பூடகங்கள். இவை பாக்டீரியா, மதுவம் போன்றவற்றை வளர்க்க உதவும். நுண்ணுயிர்கள் முழுமையான உயிரினங்களாக இருப்பதனால், அவற்றிற்கான போசாக்கை வளங்குவதே வளர்ப்பூடகங்களின் நோக்கமாகும்.\\nதாவரம், விலங்குகளிலிருந்து பெறப்படும் சில உயிரணுக்களோ, கலங்களோ, வளர்வதற்குத் தேவையான வளர்ப்பூடகங்கள்."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%80%AB%E6%95%A6%E7%A2%BC%E9%A0%AD%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Canary.wharf.and.dome.london.arp.jpg","page_title":"倫敦碼頭區","context_page_description":"倫敦碼頭區是位於英國倫敦東部，泰晤士河沿岸的水濱再開發地區的名稱。橫跨了南華克區、陶爾哈姆萊茨區、紐漢區。目前主要開發為商業區和住宅區。\\n倫敦碼頭區是曾為世界最大港口倫敦港的作業區。第二次世界大戰後，隨著船舶的大型化和集裝箱化等物流革命的進行，倫敦碼頭區日益蕭條。倫敦碼頭區這一名稱是在1971年英國政府的再開發計劃的報告書中首次使用的。"},{"page_url":"https://cs.wikipedia.org/wiki/Francisco_%C3%81lvarez_Mart%C3%ADnez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Card._Alvarez_Martinez_%2830913897465%29.jpg","page_title":"Francisco Álvarez Martínez","context_page_description":"Francisco Álvarez kardinál Martínez je španělský římskokatolický kněz, emeritní arcibiskup Toleda, kardinál."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8C%96%E5%AD%B8%E5%8F%8D%E6%87%89%E5%99%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Pipe-PFR.svg","page_title":"化學反應器","context_page_description":"化学反应器是化工生产或实验上进行化学反应的装置，简称反应器，在工业上亦有工业反应器的别称。\\n反应器主要功能是控制反应过程中的各种条件参数，例如压力、温度、体积、滞留时间、各反应物浓度、反应速率、热传系数、搅拌速率等参数，以及作为反应物进行化学反应的容器。\\n一般于实验室中所使用的反应器，通常体积较小而且结构简单，例如在实验室仅需一个烧杯、一支试管即可进行一项简单的化学反应，而在工业上所使用的反应器，通常体积巨大、结构复杂，同时又不单单只进行化学反应，内部除了反应过程之外常伴随质传、热传、物料输送等工业程序。在化工生产中，反应器是相当重要的生产设备，约占生产设备总投资额的15－20%，并可依不同的生产流程与操作条件，调整反应器的规格与形式，举凡如炼油厂的轻油裂解炉、炼钢厂的高炉、塑胶工厂的聚合反应器、制药厂的药物合成装置、酿酒厂的酒精发酵槽等，均是反应器的应用。\\n有关反应器的研究科学为化学工程学、化学热力学、反应动力学、化学反应工程、数学、化学等，从事反应器相关工作的从业人员为化学工程师或机械工程师。"},{"page_url":"https://en.wikipedia.org/wiki/Active_Body_Control","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Mercedes_SL500_AMG.jpg","page_title":"Active Body Control","context_page_description":"Active Body Control, or ABC, is the Mercedes-Benz brand name used to describe hydraulic fully active suspension, that allows control of the vehicle body motions and therefore virtually eliminates body roll in many driving situations including cornering, accelerating, and braking. Mercedes-Benz has been experimenting with these capabilities for automobile suspension since the air suspension of the 1963 600 and the hydropneumatic suspension of the 1974 6.9.\\nABC is only available on rear-wheel drive models. All-wheel drive models are available only with Airmatic semi-active air suspension. Production version introduced at the 1999 Geneva Motor Show on the new Mercedes-Benz CL-Class C215."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%88%D8%B1%D8%A8%D8%B1%D8%AF%D9%87%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%AF%D9%88%D8%AF%D9%85%D8%A7%D9%86_%D8%AA%D8%A7%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Dinastia_tang%2C_gruppo_di_figure_in_porcellana_sancai%2C_dalla_rpovincia_Henan%2C_inizio_dell%27VIII_sec_03_cavalli_e_palafreniere.JPG","page_title":"گوربرده‌های دودمان تانگ","context_page_description":"گوربُرده‌های دودمان تانگ یا قَبربُرده‌های دودمان تانگ، اشیاء سُفالین و چینی‌آلات سرامیکی از جانوران و آدم‌ها بودند که در دوران سلطنت دودمان تانگ بر چین، به عنوان اثاثیهٔ فرد درگذشته، به همراه وی دفن می‌شدند."},{"page_url":"https://nl.wikipedia.org/wiki/Costa_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Vilanova_i_la_Geltr%C3%B9_-_Costa_Barcelona.jpg","page_title":"Costa Barcelona","context_page_description":"Costa Barcelona is een regio in het Spaanse Catalonië. Deze regio bevindt zich tussen de Costa Brava en Costa Daurada en is een 100 kilometer lange kuststrook aan de Middellandse Zee. Sinds 2012 is deze regio officieel erkend door de Catalaanse overheid.\\nCosta Barcelona bestaat uit de regio's Maresme, Baix Llobregat, Garraf, Alt Penedès, Vallès Occidental en Vallès Oriental. Samen met 'Paisatges Barcelona' en Pirineus Barcelona vormt Costa Barcelona de regio Barcelona.\\nDe hoofdsteden van de regio’s van Costa Barcelona zijn Mataró, Sant Feliu de Llobregat, Vilanova i la Geltrú, Vilafranca del Penedès, Terrassa en Sabadell en Granollers. Costa Barcelona heeft in totaal 159 gemeenten met een oppervlakte van 3.095,64 vierkante kilometer. De zes regio’s maken deel uit van de provincie Barcelona en bevinden zich allen in de buurt van de kust."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Chaumont-en-Vexin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Chaumont-en-Vexin_%2860%29%2C_%C3%A9glise_Saint-Jean-Baptiste%2C_verri%C3%A8re_n%C2%B0_104_IMH_-_St_Fran%C3%A7ois_Xavier%2C_par_J.F._Roussel.JPG","page_title":"Église Saint-Jean-Baptiste de Chaumont-en-Vexin","context_page_description":"L'église Saint-Jean-Baptiste est une église catholique paroissiale située à Chaumont-en-Vexin, en France. Elle est bâtie un peu à l'écart du centre du bourg sur le flanc oriental de la butte du vieux château, et l'on peut uniquement y accéder par des escaliers. L'église Saint Jean-Baptiste représente le principal édifice religieux du Vexin français qui date entièrement du XVIᵉ siècle. C'est un édifice très homogène de style gothique flamboyant, construit sous une seule campagne entre 1530 environ et 1554. Seules les clés de voûte, certains éléments du décor du portail du croisillon nord et le clocher affichent le style de la Renaissance ; cependant, le clocher est resté inachevé, et le second clocher et la première travée de la nef avec la façade occidentale n'ont jamais été construits. À l'extérieur, le portail du croisillon nord avec son élégant décor flamboyant constitue l'élément le plus remarquable. L'intérieur est vaste et lumineux, et la modénature s'avère complexe et original."},{"page_url":"https://es.wikipedia.org/wiki/Morat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Paulina_Rubio_y_Morat.png","page_title":"Morat","context_page_description":"Morat es una agrupación musical de pop latino y folk de Bogotá, Colombia, creada en el año 2015. Sus integrantes son Juan Pablo Isaza Piñeros, Juan Pablo Villamil Cortés, Simón Vargas Morales y Martín Vargas Morales. Anteriormente, hasta finales de 2016 había formado parte de la banda Alejandro Posada, pero él decidió dejar el grupo por lo que fue sustituido por Martín Vargas."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Bermeries","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Bermeries_%28Nord%2C_Fr%29_chapelle_N.D._de_Lourdes.JPG","page_title":"Bermeries","context_page_description":"Bermeries sī ūi-tī Hoat-kok Nord-Pas-de-Calais toā-khu Nord koān ê chi̍t ê commune."},{"page_url":"https://cs.wikipedia.org/wiki/Mladoboleslavsk%C3%BD_vikari%C3%A1t","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Kostel_sv._Ducha%2C_Libechov.jpg","page_title":"Mladoboleslavský vikariát","context_page_description":"Mladoboleslavský vikariát je jedním z 10 vikariátů litoměřické diecéze. Je nejjižněji položeným vikariátem v diecézi a hraničí s arcidiecézí pražskou.\\nVikariát je tvořen 47 farnostmi, v nichž je dohromady 66 kostelů."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_wakil_gubernur_perempuan_di_Amerika_Serikat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Lawton_barbara_official.jpg","page_title":"Daftar wakil gubernur perempuan di Amerika Serikat","context_page_description":"Daftar gubernur perempuan di Amerika Serikat"},{"page_url":"https://es.wikipedia.org/wiki/Museo_de_alfombras_de_Turkmenist%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/The_largest_carpet_in_the_world.JPG","page_title":"Museo de alfombras de Turkmenistán","context_page_description":"El Museo de alfombras de Turkmenistán o el Museo de Alfombras Nacional es un museo nacional, situado en la calle 5 Gorogly en Asjabad, Turkmenistán.\\nSe inauguró el 24 de octubre de 1994.​ Tiene la mayor colección de alfombras turcomanas de cualquier museo.​ Tiene una rica colección de alfombras turcomanas desde la Edad Media hasta el siglo XX, incluyendo más de 1.000 de alfombras los siglos XVIII y XIX. Además de su extensa colección de alfombras antiguas, tiene muchos artículos, alfombras, chuvals, etc. En la primera planta del museo están las alfombras Tekke y Sarik. El museo es famoso por sus alfombras Tekke enormes."},{"page_url":"https://lt.wikipedia.org/wiki/Zaha_Hadid","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pabell%C3%B3n_puente_P1022145_%2816170049179%29.jpg","page_title":"Zaha Hadid","context_page_description":"Zaha Hadid – Irako-Britanijos architektė. Taip pat kūrė baldų, teatro, juvelyrikos dizainą."},{"page_url":"https://en.wikipedia.org/wiki/Commemoration_of_the_American_Civil_War_on_postage_stamps","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/CS5.jpg","page_title":"Commemoration of the American Civil War on postage stamps","context_page_description":"The Commemoration of the American Civil War on postage stamps concerns both the actual stamps and covers used during the American Civil War, and the later postage celebrations. The latter include commemorative stamp issues devoted to the actual events and personalities of the war, as well as definitive issues depicting many noteworthy individuals who participated in the era's crucial developments.\\n... the generation that carried on the war has been set apart by its experience ... in our youth our hearts were touched with fire. It was given to us to learn at the outset that life is a profound and passionate thing. While we are permitted to scorn nothing but indifference, and ... above all, we have learned that ... [in one's life work], the one and only success which it is [for each of us] to command is to bring to his work a mighty heart. — Oliver Wendell Holmes\\nThe American Civil War is one of the secular crises in American history that produced heroes. Societies venerate people and events of the past and present, and governments likewise use a variety of official mechanisms to honor them, including place names, architecture, currency, and postage stamps."},{"page_url":"https://de.wikipedia.org/wiki/Alfred_Vollmar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Schnetzenhausen_Pfarrkirche_Sonnenuhr.jpg","page_title":"Alfred Vollmar","context_page_description":"Alfred Vollmar war ein deutscher Maler, Zeichner und Grafiker."},{"page_url":"https://hu.wikipedia.org/wiki/Edmund_Hillary","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Edmund_Hillary_by_Kubik_2004.jpg","page_title":"Edmund Hillary","context_page_description":"Sir Edmund Percival Hillary új-zélandi hegymászó. 1953. május 29-én Tendzing Norgajjal együtt elsőként mászták meg a Föld legmagasabb hegycsúcsát, a Mount Everestet."},{"page_url":"https://eo.wikipedia.org/wiki/Leono_la_1-a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Greatleoone.jpg","page_title":"Leono la 1-a","context_page_description":"Papo Leono 1-a, nomata La Granda, estis Romia aristokrato kaj estis papo de 440 ĝis 461. Li estis la unua, kiu uzis la titolon Pontifex Maximus, titolo, kiu antaŭe apartenis al la oficoj de la romiaj imperiestroj. Li estis la unua vaste konata papo, pro kio oni parolas ankaŭ pri li kiel la “unua papo”. Li haltigis la invadon de Italio far la Hunoj sub Atilo en la jaro 452 per sia morala persvado. Li estis influa teologo kaj gvidanta persono je la centrigo de la regado de la eklezio; tial li estas agnoskita Doktoro de eklezio fare de la Katolika eklezio en 1754."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%A4rle_kanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Axbergs_grav.jpg","page_title":"Järle kanal","context_page_description":"Järle kanal var ett kanalprojekt från 1640-talet som bara till en del fullbordades. Med kanalen ville man förbinda Dyltaån med Hjälmaren, för att underlätta transporter av järn och järnmalm från Bergslagen. Kanalbygget var sammankopplat med anläggandet av den nya staden Järle."},{"page_url":"https://es.wikipedia.org/wiki/Cl%C3%A1sico_de_colonias","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Legarreta_y_Rosetti_%281925%29.jpg","page_title":"Clásico de colonias","context_page_description":"El clásico de colonias corresponde a cualquiera de los partidos de fútbol disputados entre los clubes chilenos Audax Italiano, Palestino y Unión Española, clubes representantes de las colonias italiana, palestina y española respectivamente."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D1%96%D1%94%D0%B2%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B2%D0%BE%D0%B4%D0%BE%D1%81%D0%BF%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/%D0%A1%D0%BA%D0%B0%D0%BB%D0%B0_%D0%B7_%D0%B3%D1%80%D0%BE%D1%82%D0%BE%D0%BC_%D1%82%D0%B0_%D0%B2%D0%BE%D0%B4%D0%BE%D1%81%D0%BF%D0%B0%D0%B4%D0%BE%D0%BC%2C_%D1%81%D0%B5%D0%BB%D0%BE_%D0%9C%D0%B0%D0%BB%D1%96%D1%97%D0%B2%D1%86%D1%96.jpg","page_title":"Малієвецький водоспад","context_page_description":"Малієвецький водоспа́д — штучний водоспад у Малієвецькому парку, Хмельницька область."},{"page_url":"https://et.wikipedia.org/wiki/Pigim%C3%A4nd","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Pinus_rigida_foliage_Poland.jpg","page_title":"Pigimänd","context_page_description":"Pigimänd on männiliste sugukonda männi perekonda kuuluv okaspuu. Ta on lähedane sugulane ja hübridiseerub looduslikult levilate kattumispiirkonnas siilmänni, Pinus serotina ja tõrvikumänniga. Levib Põhja-Ameerika idaosas, kasvab kuni 31 m kõrguseks ja elab 150-200, harva kuni 350 aastat."},{"page_url":"https://ms.wikipedia.org/wiki/Edwin_Catmull","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/VES_Awards_89_cropped.jpg","page_title":"Edwin Catmull","context_page_description":"Edwin Earl Catmull adalah seorang saintis komputer dan presiden Pixar dan Walt Disney Animation Studios. Sebagai saintis komputer, Catmull telah menyumbang kepada banyak perkembangan penting dalam grafik komputer."},{"page_url":"https://fi.wikipedia.org/wiki/%E1%B9%AC%C4%81%E2%80%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/16-%E1%B9%AC%C4%81_transparent.png","page_title":"Ṭā’","context_page_description":"Ṭā’ on arabialaisen kirjaimiston 16. kirjain. Sen itsenäinen muoto on ط ja äännearvo arabiassa Persiassa ja urdussa ṭā’ lausutaan tavallisena -äänteenä. Urdussa ṭā’-kirjain translitteroidaan t̤, koska yhdellä pisteellä kirjoitettu ṭ on varattu retrofleksista t-äännettä ilmaisevalle kirjaimelle.\\nKirjoitettaessa ṭā’ liitetään viivalla ympäröiviin kirjaimiin."},{"page_url":"https://fr.wikipedia.org/wiki/Paul_Ier_(roi_des_Hell%C3%A8nes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Constantine_II_of_Greece_%281959%29.jpg","page_title":"Paul Ier (roi des Hellènes)","context_page_description":"Paul Iᵉʳ de Grèce, roi des Hellènes et prince de Danemark, est né à Tatoï le 14 décembre 1901 et mort à Athènes le 6 mars 1964. Troisième et dernier fils de Constantin Iᵉʳ de Grèce, il règne de 1947 à 1964.\\nLe futur Paul Iᵉʳ grandit à une époque où la Grèce connaît une forte période d'instabilité. Après avoir connu un premier exil avec ses parents en 1909-1911, le prince assiste au « Schisme national » durant la Première Guerre mondiale et au renversement subséquent de son père, le roi Constantin Iᵉʳ, en 1917. De retour dans son pays après un second exil, il est le témoin d'une nouvelle crise causée par la défaite militaire de la Grèce face à la Turquie en 1922. Dès 1923, la république est proclamée à Athènes et Paul prend une nouvelle fois le chemin de l'étranger. Privé de sa nationalité grecque, il reçoit un passeport danois et vit successivement en Roumanie, au Royaume-Uni et en Italie.\\nDésormais sans fonction ni position, Paul traverse treize années de relative oisiveté durant lesquelles il s'initie au piano, effectue une longue croisière incognito en mer Égée, fréquente les clubs britanniques et travaille aussi comme simple apprenti-mécanicien dans l'industrie aéronautique."},{"page_url":"https://en.wikipedia.org/wiki/List_of_companies_of_Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Azrieli_Towers_Sept.2007.JPG","page_title":"List of companies of Israel","context_page_description":"This is a list of notable companies in Israel."},{"page_url":"https://nl.wikipedia.org/wiki/Lordsburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Hidalgo_County_New_Mexico_Courthouse.jpg","page_title":"Lordsburg","context_page_description":"Lordsburg is een plaats in de Amerikaanse staat New Mexico, en valt bestuurlijk gezien onder Hidalgo County."},{"page_url":"https://uz.wikipedia.org/wiki/B%C3%A9thencourt-sur-Somme","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Map_commune_FR_insee_code_80097.png","page_title":"Béthencourt-sur-Somme","context_page_description":"Béthencourt-sur-Somme Fransiyaning Pikardiya mintaqasida joylashgan kommunadir. Somme departamenti Péronne tumani tarkibiga kiradi."},{"page_url":"https://et.wikipedia.org/wiki/Basaniit","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Limburgite_ss_2009.jpg","page_title":"Basaniit","context_page_description":"Basaniit on aluseline vulkaaniline kivim.\\nMineraloogiliselt koosneb basaniit peamiselt kaltsiumirikkast plagioklassist, monokliinsest pürokseenist ja feldšpatoididest.\\nBasaniidi süvakivimist analoogid on foiddioriit ja foidgabro.\\nVälimuselt sarnaneb basaniit enamasti väga basaldiga. Neid aitab eristada keemiline analüüs või kivimist valmistatud õhiku uurimine polarisatsioonimikroskoobiga.\\nBasaniit on suhteliselt tavaline kivim ookeanilistel saartel. Paljud ookeaniliste saarte \\"basaldid\\" on tegelikult basaniidid.\\nKui kivim ei sisalda oliviini, siis nimetatakse teda basaniidi asemel tefriidiks.\\nNimetuse \\"basaniit\\" pakkus välja Alexandre Brongniart aastal 1813."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BA%9A%E5%8E%86%E5%85%8B%E6%96%AF%C2%B7%E5%8D%A1%E9%B2%81%E7%B4%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Alex_Caruso.jpg","page_title":"亚历克斯·卡鲁索","context_page_description":"亞歷克斯·卡魯索，出生於德克薩斯州大學城，目前效力於NBA洛杉磯湖人 。"},{"page_url":"https://zh.wikipedia.org/wiki/M46%E5%B7%B4%E9%A0%93%E5%9D%A6%E5%85%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/The_Tank_Museum_%282173%29.jpg","page_title":"M46巴頓坦克","context_page_description":"M46是第二次世界大戰後美國第一種研製的中型坦克，也是第一代巴頓系列的坦克，設計用來取代M26潘興和M4謝爾曼。\\nM46坦克可說是M26坦克的動力昇級版，兩者的外表幾乎相同，其中很多M46坦克甚至是由M26坦克進一步改進而成。"},{"page_url":"https://pt.wikipedia.org/wiki/Fam%C3%ADlia_2C_(psicod%C3%A9licos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/2C-I-Chemdraw.png","page_title":"Família 2C (psicodélicos)","context_page_description":"2C é o nome genérico para a família de fenetilaminas psicodélicas contendo grupos de metoxilo nas posições 2 e 5 de um anel benzeno. A maioria desses compostos também carrega substituintes lipofílicos na posição 4, geralmente resultando em drogas mais potentes, metabolicamente estáveis e de ação mais longa. A maioria dos compostos 2C atualmente conhecidos foram sintetizados pela primeira vez por Alexander Shulgin nas décadas de 1970 e 1980 e publicados em seu livro PiHKAL. Shulgin também cunhou o termo 2C, sendo um acrônimo para os 2 átomos de carbono entre o anel de benzeno e o grupo amina."},{"page_url":"https://fr.wikipedia.org/wiki/5e_r%C3%A9giment_d%27infanterie_(France)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/2e_bataillon_5e_r%C3%A9g_inf_1793.png","page_title":"5e régiment d'infanterie (France)","context_page_description":"Le 5ᵉ régiment d'infanterie est un régiment d'infanterie de l'Armée de terre française créé sous la Révolution à partir du régiment de Navarre, un régiment français d'Ancien Régime, l'un des Six Grands Vieux."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D1%98%D0%B0_%D0%B3%D1%80%D0%B1%D0%BE%D0%B2%D0%B0_%D0%9C%D0%B0%D1%92%D0%B0%D1%80%D1%81%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/HUN_Fej%C3%A9r_COA.jpg","page_title":"Галерија грбова Мађарске","context_page_description":"Галерија грбова Мађарске обухвата актуелни Грб Мађарске, историјске грбове Мађарске, грбове мађарских жупанија и грбове мађарских градова."},{"page_url":"https://vi.wikipedia.org/wiki/P%C5%99echovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/P%C5%99echovice_-_rybn%C3%ADk_2.jpg","page_title":"Přechovice","context_page_description":"Přechovice là một làng thuộc huyện Strakonice, vùng Jihočeský, Cộng hòa Séc."},{"page_url":"https://pl.wikipedia.org/wiki/Saules_(Saona_i_Loara)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Saules_%28Sa%C3%B4ne-et-Loire%2C_Fr%29_%C3%A9glise%2C_calvaire%2C_monument_aux_morts.JPG","page_title":"Saules (Saona i Loara)","context_page_description":"Saules – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Saona i Loara.\\nWedług danych na rok 1990 gminę zamieszkiwało 109 osób, a gęstość zaludnienia wynosiła 53 osoby/km²."},{"page_url":"https://vi.wikipedia.org/wiki/Perdita_octomaculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Perdita_octomaculata%2C_F%2C_face%2C_Maryland%2C_Anne_Arundel_Co_2013-04-10-14.07.47_ZS_PMax_%289036641657%29.jpg","page_title":"Perdita octomaculata","context_page_description":"Perdita octomaculata là một loài Hymenoptera trong họ Andrenidae. Loài này được Say mô tả khoa học năm 1824."},{"page_url":"https://fr.wikipedia.org/wiki/Club_athl%C3%A9tique_Brive_Corr%C3%A8ze_Limousin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/CA_Brive_28-08-10.JPG","page_title":"Club athlétique Brive Corrèze Limousin","context_page_description":"Le Club athlétique Brive Corrèze Limousin est la section rugby à XV fondée en 1910 du Club athlétique briviste, club omnisports français, basé à Brive-la-Gaillarde en Corrèze. Son équipe première évolue en Top 14 en 2020-2021. Son président est Simon Gillham, l’équipe étant entraînée par le Nord-Irlandais Jeremy Davidson, épaulé par Marc Dal Maso et Jean-Baptiste Péjoine.\\nLe CA Brive est un club historique du rugby français. Il a été présent dans l'élite du rugby français quasiment sans interruption depuis 1930, à l'exception de courts passages à l'étage inférieur, dont le dernier en 2018-2019. Il remporte la Coupe d’Europe en 1997 et est finaliste de cette épreuve l'année suivante. Il participe à quatre finales de championnat de France, sans jamais toutefois conquérir le Bouclier de Brennus. Le CA Brive remporte son seul Challenge Yves du Manoir en 1996.\\nDepuis 1921, le CA Brive évolue au Stadium de Brive, rebaptisé stade Amédée-Domenech ainsi 2004 en l'honneur de l'un de ses plus illustres joueurs, pilier international dans les années 1950-1960."},{"page_url":"https://fr.wikipedia.org/wiki/Franz_Fayot","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Franz_Fayot%2C_Inauguration_plaque_comm%C3%A9morative%2C_%C2%ABVilla_Pauly%C2%BB-101.jpg","page_title":"Franz Fayot","context_page_description":"Franz Fayot, né le 28 février 1972 à Luxembourg-Ville, est un avocat et homme politique luxembourgeois, président du Parti ouvrier socialiste luxembourgeois depuis le 23 janvier 2019."},{"page_url":"https://pl.wikipedia.org/wiki/Frank_Beaurepaire","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Frank_Beaurepaire.jpg","page_title":"Frank Beaurepaire","context_page_description":"Francis Joseph Edmund \\"Frank\\" De Beaurepaire – australijski pływak i polityk. Sześciokrotny medalista olimpijski."},{"page_url":"https://ro.wikipedia.org/wiki/Nechita_Zugravu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/RO_CJ_Dancu_100_2011.jpg","page_title":"Nechita Zugravu","context_page_description":"Nechita Zugravu a fost un pictor de icoane și de tablouri murale în biserici, foarte renumit în zonele de la poalele Munților Apuseni și dealurilor Dejului și Clujului. Prestigiul său de iconar a făcut ca creațiile sale să ajungă și în zone mai îndepărtate, cum ar fi Câmpia Transilvaniei sau cursul Someșului mijlociu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D1%81%D1%82%D1%80%D1%83%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Anstruther_banner_view_from_the_rocks.jpg","page_title":"Анструтер","context_page_description":"Анструтер — містечко на сході Шотландії."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%A7%D7%99%D7%A8%D7%AA_%D7%A9%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Pulled_tooth.jpg","page_title":"עקירת שן","context_page_description":"עקירת שן היא פעולה כירורגית המבוצעת לרוב על ידי רופא שיניים ומטרתה סילוק שן שאינה ניתנת לטיפול שמרני או שיקומי מחלל הפה. ישנן סיבות רבות לביצוע עקירות: בדרך כלל הסיבה העיקרית היא לשם עקירת שיניים שאינן ניתנות לשיקום בעקבות עששת, מחלת חניכיים או טראומה דנטלית, בפרט כאשר מופיע כאב שיניים. לעיתים תבוצע עקירה בעקבות דלקת חוזרת של החניכיים, ציסטה ובעיות אחרות שיכולות לנבוע מבקיעה לא שלמה של שיני הבינה ובאורתודונטיה עשויים לעקור שיניים, בכחמישים אחוזים מהמקרים, על מנת ליצור מרחב לשאר השיניים להתיישר.\\nעקירת שן היא בדרך כלל פעולה פשוטה יחסית: רוב העקירות מבוצעות תחת הרדמה מקומית. ישנן שיניים שיותר קשה לעקור אותן וזה תלוי בכמה סיבות, בעיקר ממיקום השן, צורת שורשיו ושלמותו. אנשים שסובלים מפוביית שיניים בדרך כלל יפחדו יותר מפעולות עקירה מאשר טיפולים דנטליים רגילים כמו סתימות. אם השן קבורה מתחת לקו החניכיים, פעולה כירורגית מסובכת יותר עשויה להדרש, אשר דורשת חיתוך של החניכיים והסרה של העצם שמחזיקה את השן עם מקדחה כירורגית. לאחר הפעולה נדרשים תפרים על מנת להחזיר את החניכיים למיקומם הרגיל. פעולות מסובכות כאלו מבוצעות בדרך כלל על ידי כירורג פה ולסתות."},{"page_url":"https://ceb.wikipedia.org/wiki/Dendrobium_bowmanii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/A_Dockrillia_bowmani_flower.jpg","page_title":"Dendrobium bowmanii","context_page_description":"Espesye sa orkidya ang Dendrobium bowmanii. Una ning gihulagway ni George Bentham. Ang Dendrobium bowmanii sakop sa kahenera nga Dendrobium sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_offentlig_konst_i_Malm%C3%B6_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Amalthead%C3%A5det_-_Minnesm%C3%A4rke.jpg","page_title":"Lista över offentlig konst i Malmö kommun","context_page_description":"Lista över offentlig konst i Malmö kommun är en ofullständig förteckning över främst utomhusplacerad offentlig konst i Malmö kommun."},{"page_url":"https://de.wikipedia.org/wiki/Markus_Reinhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wolfsheim.jpg","page_title":"Markus Reinhardt","context_page_description":"Markus Reinhardt ist ein deutscher Musiker, Songwriter und Musikproduzent, der u. a. durch seine Mitwirkung beim Synthiepop-Duo Wolfsheim bekannt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Backsteinbauwerke_der_Gotik_in_Frankreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ch%C3%A2teau_de_Plessis-l%C3%A8s-Tours_3.jpg","page_title":"Liste der Backsteinbauwerke der Gotik in Frankreich","context_page_description":"Die Liste der Backsteinbauwerke der Gotik in Frankreich ist Teil des Listenwerks Backsteinbauwerke der Gotik, in dem der gesamte europäische Bestand dieser Bauwerke möglichst vollständig aufgeführt ist. Aufgenommen sind nur Bauten, an denen der Backstein irgendwo zutage tritt oder, bei geschlämmten Oberflächen, wenigstens die Backsteinstruktur von Mauerwerk erkennbar ist.\\nUmfang:\\nDiese Liste umfasst 149 Einträge von Gebäuden und Gebäudegruppen.\\nHintergrundinformation:\\nPA… = patrimoine architectural… = Eintrag in der Denkmaldatenbank des französischen Kulturministeriums.\\nP-Rhône-Alpes = Eintrag in der Denkmaldatenbank der Region Rhône-Alpes\\nBei einigen Gebäuden ist unter „“ die zugehörige Bildersammlung in Wikimedia Commons verlinkt.\\nDetaillierte Verteilingskarten:\\nBacksteinbauwerke der Gotik/Verteilung in Frankreich\\nBacksteinbauwerke der Gotik/Verteilung in den Départements Nord und Pas-de-Calais"},{"page_url":"https://fr.wikipedia.org/wiki/Chien_courant_de_la_vall%C3%A9e_de_la_Save","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Posavac.jpg","page_title":"Chien courant de la vallée de la Save","context_page_description":"Le chien courant de la vallée de la Save, également appelé chien courant de Posavatz et anciennement chien courant du bassin de Kras est une race de chiens originaire de Croatie. C'est un chien courant de taille moyenne, d'allure robuste, à la robe froment rougeâtre à marques blanches, au poil court et raide. Il s'agit d'un chien de chasse employé comme chien courant."},{"page_url":"https://en.wikipedia.org/wiki/Nathan_Mendelsohn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/NathanMendelsohn.jpg","page_title":"Nathan Mendelsohn","context_page_description":"Nathan Saul Mendelsohn, CM FRSC was an American-born mathematician who lived and worked in Canada. Mendelsohn was a researcher in several areas of discrete mathematics, including group theory and combinatorics."},{"page_url":"https://no.wikipedia.org/wiki/Dilsen-Stokkem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Kerkstokkem.jpg","page_title":"Dilsen-Stokkem","context_page_description":"Dilsen-Stokkem er en kommune i den belgiske provinsen Limburg."},{"page_url":"https://en.wikipedia.org/wiki/Miranda_Mellis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Mellis_M.jpg","page_title":"Miranda Mellis","context_page_description":"Miranda Mellis is the author of Demystifications, The Spokes, None of This Is Real, and The Revisionist. Her fiction, reviews, and essays have appeared in various publications including The Believer's The Logger, Harper’s, Conjunctions, the New York Times, Fence and elsewhere. She has received a grant from the National Endowment for the Humanities and the John Hawkes Prize in Fiction, and has been an Artist in Residence at the Headlands Center for the Arts and the Millay Colony. She co-founded and co-edited The Encyclopedia Project and once played in a band called My Invisible. She teaches at Evergreen State College."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%9F%E5%A3%A4%E5%8E%8B%E5%AE%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Seabees_compactor_roller.jpg","page_title":"土壤压实","context_page_description":"土壤壓實是指家畜或碾壓機器施加壓力在土壤上，導致土壤失去其內部的空隙。土壤壓實，也可能會導致土壤中缺水。因為土壤變得不那麽能夠吸收雨水，從而增加了地表溢流和土壤侵蝕的可能性。礦物顆粒同時加壓使得植物難以生存，壓實的土壤使土壤幾乎不留有儲存空氣和水的空間，而水與空氣對植物的根的生長來說是必要的。經過壓實的土壤對掘穴動物來說也是一個不好的環境，因為土壤密度的增加使其更難以穿透。\\n恢復土壤壓實的能力取決於氣候、礦物和動物。高收縮膨脹能力的土壤，如變性土，能在雨雪量發生改變的時候迅速從壓縮後的狀態恢復過來。但粘土不崩裂，因為它們幹不能自己從壓實的狀態恢復，除非他們所在的地方有蚯蚓等動物居住-塞西爾土壤系列就是一個例子。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Stamp_USSR_1940_CPA_727.jpg","page_title":"История почты и почтовых марок Украины","context_page_description":"История почты и почтовых марок Украины охватывает периоды развития почтовой связи на её территории во времена Киевской Руси, Русского государства, Российской империи, СССР и современной независимой Украины. Почтовые марки стали использоваться в обращении с середины XIX века; первоначально это были австрийские и российские, а на протяжении большей части XX века — советские марки. Самостоятельные выпуски имели место от имени временных государственных образований, оккупационных администраций и некоторых других украинских организаций. Украина является членом Всемирного почтового союза. С 1992 года выходят почтовые марки независимой Украины."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%AD%D9%85%D8%AF%D8%A7%D9%8A%D9%87%D8%B3%D8%A7%D9%86_%D8%AA%D9%88%D9%83%D8%AC%D9%88%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Ahmet_%C4%B0hsan_Tokg%C3%B6z.jpg","page_title":"احمدايهسان توكجوز","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاحمدايهسان توكجوز كان صحفى من توركيا."},{"page_url":"https://nl.wikipedia.org/wiki/UNOMIG","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/United_Nation_Abkhazia_small.PNG","page_title":"UNOMIG","context_page_description":"De United Nations Observer Mission in Georgia of Waarnemersmissie van de VN in Georgië in het Nederlands, werd opgericht door resolutie 858 van de Veiligheidsraad van de Verenigde Naties in augustus 1993 om te controleren op de naleving van een op 27 juli 1993 overeengekomen staakt-het-vuren tussen de Georgië en krachten in Abchazië, met bijzondere aandacht voor de situatie in de stad Sukhumi, Georgië. Er werden 88 militaire waarnemers in de regio ingezet. Het moest naast toezien op het staakt-het-vuren ook schendingen daarvan onderzoeken en proberen op te lossen met de betrokken partijen. UNOMIG moest rapporteren aan de secretaris-generaal van de Verenigde Naties over de uitvoering van zijn mandaat. De missie eindigde op 15 juni 2009, toen Rusland een veto uitsprak over een verlenging van de missie. De laatste waarnemers uit de regio vertrokken op 15 juli 2009.\\nHet mandaat van de oorspronkelijke opdracht werd ongeldig nadat in september 1993 opnieuw gevechten uitbraken in het gebied. UNOMIG kreeg vervolgens een interim-mandaat van de Veiligheidsraad in november 1993 om de contacten met de betrokken partijen te onderhouden en te rapporteren over de situatie."},{"page_url":"https://lt.wikipedia.org/wiki/Riufiskas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Rufisque-Canal.JPG","page_title":"Riufiskas","context_page_description":"Riufiskas yra miestas vakarų Senegale, Dakaro regione, Žaliojo kyšulio pusiasalyje. Mieste gyvena 162 056 gyentojai. Seniau Riufiskas buvo svarbus Senegalo uostas, tačiau šiuo metu tai yra Dakaro priemiestis.\\nRiufiskas taip pat yra to paties pavadinimo rajono sostinė."},{"page_url":"https://en.wikipedia.org/wiki/Carlo_Dolci","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Dolci_Visione_di_San_Luigi.jpg","page_title":"Carlo Dolci","context_page_description":"Carlo Dolci was an Italian painter of the Baroque period, active mainly in Florence, known for highly finished religious pictures, often repeated in many versions."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_the_Royal_Borough_of_Kingston_upon_Thames","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Kings_Mural_by_Maggie_Humphry%2C_Kingston_upon_Thames.jpg","page_title":"List of public art in the Royal Borough of Kingston upon Thames","context_page_description":"This is a list of public art in the Royal Borough of Kingston upon Thames."},{"page_url":"https://es.wikipedia.org/wiki/Zgierz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ul._Narutowicza_5.JPG","page_title":"Zgierz","context_page_description":"Zgierz es una ciudad de la Polonia central, situada apenas al norte Łódz y parte del área metropolitana del centró en esa ciudad, a 120 km al suroeste de la capital, Varsovia.\\nEn fecha 2007, tenía una población de 58.164. Situada en el Voivodato Łódzkie.\\nZgierz es una de las ciudades más viejas de Polonia central. Adquirió sus derechos de ciudad antes de 1288.\\nA pesar de su rica historia, Zgierz tiene sobre todo una arquitectura suburbana y es uno de los lugares preferidos para vivir de muchos profesionales de Łódz."},{"page_url":"https://nl.wikipedia.org/wiki/Containerlift","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Containerlift_straddle_carrier.jpg","page_title":"Containerlift","context_page_description":"Een containerlift of straddlecarrier is een voertuig dat op overslagterminals wordt ingezet om ISO-standaardcontainers te transporteren. Deze dieselaangedreven machine kan een container oppakken van onder een walkraan, transporteren en vervolgens neerzetten op de grond, op een oplegger, op een, twee of drie andere containers, of op een spoorwegwagon, door middel van een hydraulisch of elektrisch hijsmechanisme.\\nDe straddlecarrier werd - oorspronkelijk - bedacht in Finland, kort na de Tweede Wereldoorlog, voor het vervoer van staalproducten, en werd aanvankelijk door Finland massaal geëxporteerd naar de USSR.\\nIn het begin van de jaren 70 werd de machine aangepast voor de manipulatie van het nieuwe transportconcept, de ISO-container. De wereldmarkt wordt op dit ogenblik bijna totaal beheerst door twee fabrikanten: het Fins-Zweedse Kalmar, behorende tot de Cargotec groep en het Duits-Italiaanse Noell, behorende tot de Fantuzzi-groep.\\nDe straddlecarrier heeft inmiddels een reeks van officiële en officieuze bijnamen gekregen, zoals \\"containerlift\\" of \\"portaalhefwagen\\", maar ook \\"spinnenkop\\", \\"olifant\\" of \\"tram\\"."},{"page_url":"https://fr.wikipedia.org/wiki/General_Dynamics_EF-111A_Raven","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/EF-111A_Raven_at_Cannon_AFB.jpg","page_title":"General Dynamics EF-111A Raven","context_page_description":"Le EF-111A Raven est une version du bombardier F-111 Aardvark spécialisée dans la guerre électronique."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E6%B4%A5%E5%B8%82%E5%8E%86%E5%8F%B2%E9%A3%8E%E8%B2%8C%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%E6%88%90%E9%83%BD%E9%81%9369-71%E5%8F%B7%E9%93%AD%E7%89%8C.jpg","page_title":"天津市历史风貌建筑列表","context_page_description":"天津市历经600多年的建城史和近代租界的城市规划发展，出现了一大批具有较高的历史、文化、科学、艺术和人文价值并反映时代特色和地域特色的建筑和著名建筑师的代表作，市中心城区形成了包括法国、意大利、英国风格等在内的浓郁的异国风情以及民国时期的建筑风格，具有与中国其他城市截然不同的城市风情。尽管一直遭到自然和人为的损毁，这些建筑中完好保留下来的仍有很多。传统上，城市通过设立“文物保护单位”的方法对其进行保护，但随着21世纪初中国城市房地产开发的热潮，这些建筑的存在受到严重威胁。为了平衡对这些建筑的保护同市中心土地开发之间的关系，天津市第十四届人民代表大会常务委员会第二十一次会议于2005年7月20日通过名为《天津市历史风貌建筑保护条例》的地方性法规，受其保护的建筑则称为天津市历史风貌建筑。"},{"page_url":"https://pl.wikipedia.org/wiki/Lubelszczyzna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Pa%C5%82ac%2C_Pu%C5%82awy.jpg","page_title":"Lubelszczyzna","context_page_description":"Lubelszczyzna – określenie regionu używane w zależności od kontekstu w odniesieniu do ziemi lubelskiej, województwa lubelskiego z lat 1474–1795 lub do późniejszych województw lubelskich. Po 1999 r. instytucje samorządowe pod nazwą Lubelszczyzna określają obecne województwo lubelskie i stosują je zamiennie.\\nW literaturze historycznej nazwą Lubelszczyzna określa się historyczne województwo lubelskie istniejące w latach 1474–1795, którego obszar różnił się od obszaru współczesnego województwa lubelskiego. Lubelszczyzna w tym ujęciu stanowi północno-wschodnią część Małopolski. Graniczy z ziemią sandomierską na zachodzie, Mazowszem na północnym zachodzie, Podlasiem na północnym wschodzie oraz Grodami Czerwieńskimi/Rusią Czerwoną na wschodzie."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%81%93%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Shi_Rui-Xuan_Yuan_Inquires_of_the_Dao.jpg","page_title":"道教","context_page_description":"道教是华夏的本土宗教，道教思想源于黄帝，道教体系最早创始人是五斗米教的张道陵，崇拜道家老子为道祖，最早可以上溯到原始社会时期中国人的祭天、祭祖等崇拜活动，至春秋战国时期吸收神仙方术产生了方仙道，后融合道家、阴阳家的“五行”、“阴阳”等思想合并形成黄帝学派，在汉代中后期形成黄老道，至南北朝经过宗教改革，逐渐演变成现在的道教。"},{"page_url":"https://it.wikipedia.org/wiki/Francesco_Sassetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Santa_Trinita%2C_cappella_Sassetti%2C_Giuliano_da_Sangallo_1.jpg","page_title":"Francesco Sassetti","context_page_description":"Francesco Sassetti è stato un banchiere e mecenate italiano."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%96%D1%98%D1%83_%D0%B4%D0%B5_%D0%9C%D0%B0%D0%BC%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/DSC08563_tour_de_falhies.jpg","page_title":"Жју де Маму","context_page_description":"Жју де Маму насеље је и општина у централној Француској у региону Оверња, у департману Кантал која припада префектури Оријак.\\nПо подацима из 2011. године у општини је живело 742 становника, а густина насељености је износила 52,14 становника/km². Општина се простире на површини од 14,23 km². Налази се на средњој надморској висини од 640 метара."},{"page_url":"https://sv.wikipedia.org/wiki/Nilometer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Nilometro_de_Kom_Ombo.jpg","page_title":"Nilometer","context_page_description":"Nilometer var en byggnadskonstruktion för att mäta vattenståndet i Nilen i Forntida Egypten."},{"page_url":"https://sh.wikipedia.org/wiki/Butenolid","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Furan-2-one.svg","page_title":"Butenolid","context_page_description":"Butenolidi su klasa laktona sa heterocikličnim prstenovima sa četiri ugljenika. Oni se ponekad smatraju oksidovanim derivatima furana. Najjednostavniji butenolid je 2-furanon, koji je zajednička komponenta većih prirodnih proizvoda i često se naziva jednostavno \\"butenolid\\".\\nJedan od biohemijski važnih butenolida je askorbinska kiselina. Derivate butenolida poznate kao karikini proizvode neke biljke pri izlaganju visokim temperaturama usled šumskog požara. Specifično, utvrđeno je da 3-metil-2H-furo[2,3-c]piran-2-on podstiče klijanje semena kod biljki čija reprodukcija je zavisna od vatre."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%9A%E0%A5%87%E0%A4%82%E0%A4%AC%E0%A5%81%E0%A4%B0_%E0%A4%B0%E0%A5%87%E0%A4%B2%E0%A5%8D%E0%A4%B5%E0%A5%87_%E0%A4%B8%E0%A5%8D%E0%A4%A5%E0%A4%BE%E0%A4%A8%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Chembur_station.jpg","page_title":"चेंबुर रेल्वे स्थानक","context_page_description":"चेंबुर हे मुंबई शहराच्या चेंबूर भागामधील एक रेल्वे स्थानक आहे. हे स्थानक मुंबई उपनगरी रेल्वेच्या हार्बर मार्गावर स्थित आहे.\\nमुंबई मोनोरेलच्या मार्ग १ वरील चेंबूर मोनोरेल स्थानक येथून जवळच स्थित आहे."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%99%D7%90%D7%98_238","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Fiat_238_dutch_licence_registration_75-VF-23_pic04.jpg","page_title":"פיאט 238","context_page_description":"פיאט 238 הוא רכב מסחרי תוצרת חברת פיאט האיטלקית, שיוצר בין השנים 1967–1983. הדגם יוצר במספר תצורות: רכב מסחרי, טנדר, מיניבוס, אמבולנס.\\nמנועי ה-1,197 סמ\\"ק אשר הורכבו בדגם נלקחו מפיאט 124, ומנועי ה-1,438 סמ\\"ק היו של אוטוביאנקי A111 ו\\"פיאט 124 ספיישל\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%82%B8%E3%83%A3%E3%82%B9%E3%83%BB%E3%82%A2%E3%83%AB%E3%83%86%E3%82%B9%E5%AE%AE%E6%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Mexico_City_Palacio_de_bellas_artes.jpg","page_title":"ベジャス・アルテス宮殿","context_page_description":"ベジャス・アルテス宮殿は、メキシコの首都メキシコシティに位置するオペラハウス。メキシコ国立芸術院などとも表記される。宮殿は1901年にイタリアの建築家、アダモ・ボアリによってデザインされたものだが、壮観なアール・デコ様式の内観と壮麗なアール・ヌーヴォー様式の外観は、1934年になるまで建設が終了することはなかった。竣工以来、その建物全体の重量により、年々数センチメートルずつ地面へ沈下している。"},{"page_url":"https://sv.wikipedia.org/wiki/Pseudohydromys","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Pseudohydromys-Microhydromys.PNG","page_title":"Pseudohydromys","context_page_description":"Pseudohydromys är ett släkte av gnagare som ingår i familjen råttdjur.\\nIndividerna når en kroppslängd av 70 till 115 mm, en svanslängd av 90 till 101 mm och en vikt mellan 13 och 20 g. Pälsen har på ovansidan en mörkgrå eller gråbrun färg och undersidan är ljusare. Med sin avplattade skalle påminner arterna lite om näbbmöss. På grund av trampdynornas utseende antas att dessa gnagare sällan simmar. De vistas i tropiska skogar på marken och äter främst insekter samt några maskar. I bergstrakter når de 3600 meter över havet. En upphittad hona var dräktig med en unge.\\nArter enligt Wilson & Reeder samt IUCN:\\nPseudohydromys ellermani, lever i Nya Guineas centrala bergstrakter.\\nPseudohydromys fuscus, förekommer på östra Nya Guinea.\\nPseudohydromys germani, på Nya Guineas östra udde.\\nPseudohydromys murinus, i bergstrakter på östra Nya Guinea.\\nPseudohydromys musseri, på norra Nya Guinea.\\nPseudohydromys occidentalis, två mindre populationer i Nya Guineas centrala bergstrakter."},{"page_url":"https://fr.wikipedia.org/wiki/Tatura","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/TaturaVictoryHall.JPG","page_title":"Tatura","context_page_description":"Tatura est une ville de la région de Goulburn Valley dans l'état de Victoria en Australie. Elle se trouve dans la zone d'administration locale de la ville du grand Shepparton à 167 km au nord de Melbourne, la capitale de l'état et à 18 km à l'ouest du centre régional de Shepparton. Au recensement de 2006, Tatura avait une population de 3 533 habitants."},{"page_url":"https://ca.wikipedia.org/wiki/Acanthopleura_granulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Acanthopleura_granulata_plates.jpg","page_title":"Acanthopleura granulata","context_page_description":"L'Acanthopleura granulata és una espècie de poliplacòfor tropical de mida mitjana. Aquesta espècie és comuna dins la seva àrea de distribució a l'oceà Atlàntic tropical occidental, però sol passar desapercebuda amb molta freqüència, a causa del seu color i textura que la mimetitzen amb les roques de l'ambient en què viu. En els països antillans de parla anglesa, aquests i altres Chiton intermareals comuns es coneixen com a \\"Curb\\". El peu de l'animal és comestible i també es fa servir com a esquer per a la pesca."},{"page_url":"https://pt.wikipedia.org/wiki/Universidade_de_Sevilha","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Emblema_Universidad_de_Sevilla.png","page_title":"Universidade de Sevilha","context_page_description":"A Universidade de Sevilha é uma instituição pública de ensino superior com sede na cidade de Sevilha, capital da Comunidade Autónoma/Autônoma da Andaluzia, em Espanha.\\nÉ uma das duas universidades públicas da capital andaluza, em conjunto com a Universidade Pablo de Olavide, com centros distribuídos por toda a cidade. A sede da US fica situada na antiga Real Fábrica de Tabacos de Sevilla.\\nA US é a terceira maior universidade espanhola por número de estudantes e a maior da Andaluzia, sendo, por outro lado, uma das mais antigas, contado com mais de Cinco Séculos de existência, tendo sido fundada em 1505, a partir do embrião daquele que foi o Colegio de Santa María de Jesús.\\nAlguns dos mais imortantes rakings académicos/acadêmicos internacionais situavam esta instituição como uma das 500 melhores do Mundo em 2013.\\nOs seus estatutos, que datam de 1502, mostram que, naquela altura, era possível estudar Teologia, Cânones e Leis, assim como Medicina e Artes - outorgando os graus de Bacharel, Licenciatura e Doutoramento/Doutorado em todas as escolas."},{"page_url":"https://en.wikipedia.org/wiki/F%C4%83rca%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Farcas_jud_Dolj.jpg","page_title":"Fărcaș","context_page_description":"Fărcaș is a commune in Dolj County, Oltenia, Romania with a population of 3,590 people. It is composed of five villages: Amărăști, Fărcaș, Golumbelu, Golumbu and Plopu-Amărăști. It included five other villages until 2004, when they were split off to form Tălpaș Commune."},{"page_url":"https://nn.wikipedia.org/wiki/Svorkmo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Svorkmo_stasjon.jpg","page_title":"Svorkmo","context_page_description":"Svorkmo er ein tettstad i Orkladalen i Orkland kommune i Trøndelag fylke. Staden har 291 innbyggjarar per 1. januar 2017.\\nSvorkmo ligg ved Orkla, kring to mils køyring sørom sentrum i kommunesenteret Orkanger. Staden ligg på begge sidene av Orkla og Riksveg 700 kryssar elva der. Museumsjarnbanen Thamshavnbanen går gjennom staden og har ein stoppeplass der.\\nOrkland kyrkje ligg to km nordom Svorkmo."},{"page_url":"https://pt.wikipedia.org/wiki/Mosteiro_de_S%C3%A3o_Bento_da_Vit%C3%B3ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Igreja_S_Bento_Vitoria_interior1_%28Porto%29.JPG","page_title":"Mosteiro de São Bento da Vitória","context_page_description":"O Mosteiro de São Bento da Vitória localiza-se no Morro do Olival, na cidade do Porto, em Portugal.\\nO mosteiro servia aos monges beneditinos, assim como a igreja monástica, tendo sido iniciada a construção do seu conjunto em finais do século XVI, no local anteriormente ocupado pela Judiaria do Olival.\\nEm função do que tinha sido determinado no Mosteiro de Tibães, os beneditinos entraram no Porto com o intuito de construírem um mosteiro na cidade, o que veio a acontecer depois de resolvidos alguns entraves, embora a construção só tenha terminado cerca de um século depois do seu início, corria o ano de 1707.\\nDurante a Guerra Peninsular uma parte do mosteiro foi ocupada pelas tropas invasoras francesas e posteriormente pelas portuguesas, tendo-se servido dele como hospital militar.\\nNo que diz respeito à Igreja de São Bento da Vitória foi desenhada pelo arquitecto Diogo Marques Lucas, discípulo do italiano Filipe Terzio, em estilo clássico já deturpado pela Contrarreforma, com uma harmonia, solidez e proporções equilibradas."},{"page_url":"https://it.wikipedia.org/wiki/Museo_archeologico_di_Paro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Chronique_de_Paros_%28Paros%29.JPG","page_title":"Museo archeologico di Paro","context_page_description":"Il museo archeologico di Paro ha sede a Paroikia capoluogo dell'isola di Paro nell'arcipelago delle Cicladi in Grecia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B9%D0%BE%D1%82%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Mayotte_topographic_map-fr.png","page_title":"Майотта","context_page_description":"Майо́тта — заморский регион и одновременно заморский департамент Франции. Регион с 1976 года является спорной территорией между Францией и Коморами, согласно конституции которых Майотта имеет статус автономного острова. Генеральная Ассамблея ООН признаёт права государства Союз Коморских Островов на остров Майотта.\\nРегион расположен в Мозамбикском проливе, в западной части Индийского океана, между северным Мозамбиком и северным Мадагаскаром.\\nСостоит из главного острова, Майотта, меньшего по размерам острова Паманзи, и нескольких других крошечных островков. Географически относится к Коморским островам.\\nПлощадь региона — 376 км², население — 246 489 человек, плотность — 657 чел./км², ВВП по ППС на душу населения — €9100."},{"page_url":"https://nl.wikipedia.org/wiki/Vulsella_vulsella","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Naturalis_Biodiversity_Center_-_RMNH.MOL.318200_-_Vulsella_vulsella_%28Linnaeus%2C_1758%29_-_Pteriidae_-_Mollusc_shell.jpeg","page_title":"Vulsella vulsella","context_page_description":"Vulsella vulsella is een tweekleppigensoort uit de familie van de Pteriidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1758 door Linnaeus."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Erp_(Erftstadt)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Erp_Luxemburger_Stra%C3%9Fe_31_Wachhaus.jpg","page_title":"Liste der Baudenkmäler in Erp (Erftstadt)","context_page_description":"Die Liste der Baudenkmäler in Erp (Erftstadt) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Erftstadt-Erp in Nordrhein-Westfalen. Diese Baudenkmäler sind in Teil A der Denkmalliste der Stadt Erftstadt eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ceb.wikipedia.org/wiki/Ronas_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Ronashillcairn.jpg","page_title":"Ronas Hill","context_page_description":"Bungtod ang Ronas Hill sa Hiniusang Gingharian. Nahimutang ni sa dapit sa konseho sa Shetland Islands ug apil sa nasod sa Scotland, sa amihanang bahin sa nasod, 1,000 km sa amihanan sa London ang ulohan sa nasod. 288 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ronas Hill. Ang Ronas Hill nahimutang sa pulo sa Shetland Islands.\\nAng yuta palibot sa Ronas Hill kay patag sa habagatang-kasadpan, apan sa amihang-sidlakan nga kini mao ang kabungtoran. Sa amihang-kasadpan, dagat ang pinakaduol sa Ronas Hill. Ang kinahabogang dapit sa palibot dunay gihabogon nga 410 ka metro ug 1.4 km sa amihanan-sidlakan sa Ronas Hill. Dunay mga 3 ka tawo kada kilometro kwadrado sa palibot sa Ronas Hill may kaayo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Brae, 14.7 km sa habagatan sa Ronas Hill. Hapit nalukop sa kasagbotan ang palibot sa Ronas Hill. Sa rehiyon palibot sa Ronas Hill, kapuloan, mga lawis, mga luuk, ug nga bato nga pormasyon talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 2 °C. Ang kinainitan nga bulan Agosto, sa 10 °C, ug ang kinabugnawan Disyembre, sa 0 °C."},{"page_url":"https://pl.wikipedia.org/wiki/CA_Zacatepec","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Zacatepec_Siglo_XXI.PNG","page_title":"CA Zacatepec","context_page_description":"Club Atlético Zacatepec 1948 – meksykański klub piłkarski z siedzibą w mieście Zacatepec de Hidalgo, w stanie Morelos. Obecnie występuje na drugim szczeblu rozgrywek – Ascenso MX. Swoje domowe mecze rozgrywa na obiekcie Estadio Agustín Coruco Díaz."},{"page_url":"https://en.wikipedia.org/wiki/Kakepuku","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/The_lookout_was_rebuilt_in_2014._It_had_been_closed_for_a_while_due_to_rot..jpg","page_title":"Kakepuku","context_page_description":"Kakepuku rises from the plain between the Waipa and Puniu rivers, about 3 km NW of Te Kawa and 8 km SW of Te Awamutu in the Waikato region of New Zealand's North Island."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84115%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Tc115_setouchi_color.png","page_title":"国鉄115系電車","context_page_description":"国鉄115系電車は、日本国有鉄道が設計・製造した近郊形直流電車である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Herzebrock-Clarholz","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Herzebrock_Torfahrthaus_Vorderseite.jpg","page_title":"Liste der Baudenkmäler in Herzebrock-Clarholz","context_page_description":"Die Liste der Baudenkmäler in Herzebrock-Clarholz enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Gemeinde Herzebrock-Clarholz im Kreis Gütersloh in Nordrhein-Westfalen. Diese Baudenkmäler sind in Teil A der Denkmalliste der Gemeinde Herzebrock-Clarholz eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E7%81%A3%E8%A1%8C%E6%94%BF%E5%8D%80%E4%BA%BA%E5%8F%A3%E5%AF%86%E5%BA%A6%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Population_density_of_Taiwan.svg","page_title":"臺灣行政區人口密度表","context_page_description":"臺灣的人口密度為651.62人。\\n以下各章節分列各類行政區之人口密度排名，單位：人／平方公里。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/K32_HMS_Helsingborg_Anchored-of-Gotska-Sandoen_cropped.jpg","page_title":"Военно-морские силы Швеции","context_page_description":"Военно-морские силы Швеции — один из трёх видов вооруженных сил Швеции.\\nПо состоянию на 2016 год, численность ВМC Швеции составляла 2100 человек."},{"page_url":"https://en.wikipedia.org/wiki/Olaf_Geirstad-Alf","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/King_Olaf_and_the_Little_People.jpg","page_title":"Olaf Geirstad-Alf","context_page_description":"Olaf Gudrødsson, who was known after his death as Olaf Geirstad-Alf \\"Olaf, Elf of Geirstad\\", was a petty king in Norway. A member of the House of Yngling from the Ynglinga saga, he was the son of Gudrød the Hunter and according to the late Heimskringla, a half-brother of Halfdan the Black. Gudrød and Olaf ruled a large part of Raumarike."},{"page_url":"https://fr.wikipedia.org/wiki/Pawsonaster_parvus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Pawsonaster_parvus.jpg","page_title":"Pawsonaster parvus","context_page_description":"Pawsonaster parvus est une espèce d'étoile de mer de la famille des Goniasteridae, la seule espèce connue du genre Pawsonaster."},{"page_url":"https://es.wikipedia.org/wiki/Unstoppable_(pel%C3%ADcula_de_2010)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/416px_cropped_Rosario_Dawson.jpg","page_title":"Unstoppable (película de 2010)","context_page_description":"Imparable es una película de acción basada libremente en un hecho real, el incidente CSX 8888. Fue estrenada el 12 de noviembre de 2010 en Estados Unidos mientras que en España el 13 de enero de 2011, en ese mismo año se estrenó en Chile y Argentina. Está protagonizada por Denzel Washington, Chris Pine y Rosario Dawson, fue dirigida y producida por Tony Scott. Distribuida por 20th Century Fox.\\nRecibió críticas generalmente positivas, numerosos críticos indicaron que había ciertas similitudes con la película Speed, protagonizada por Keanu Reeves y Sandra Bullock.​ Con un presupuesto estimado en 100 millones de dólares ha sumado en las taquillas mundiales 167 millones.​"},{"page_url":"https://eu.wikipedia.org/wiki/Giza_hezurdura","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Columna_vertebras.jpg","page_title":"Giza hezurdura","context_page_description":"Giza hezurdura edo eskeletoa gizakion hezurrek eta kartilagoek osatzen duten multzoa da. Lokomozio-aparatuaren atala da, gihar sistemarekin batera.\\nHezur-ehunetan bizirik dauden zelulak eta osagai geldoak konbinatzen dira. Haiekin batera, kolagenoak hezurrak osatzen ditu. Kolagenoa osagai organikoa da eta proteina hori beste zuntz batzuetan era agertzen da. Hezurrak bizirik dauden organoak dira, amaitu gabe berritzen direnak.\\nHezur-sistemak gihar-sistemarekin bat egiten du lokomozio-aparatua sortzen. Eskeletoa bitan banatzen da haren ikerketarako:\\nEskeleto axiala edo nagusia: garezurra, bizkarrezurra, saihetsak eta bularrezurra.\\nEskeleto apendikularra: goiko eta beheko gorputz-adarren hezurrak, gerri eskapularra eta gerri pelbiarra.\\nEskeleto axiala 80 hezurrez dago osatua eta apendikularra 126 hezurrez."},{"page_url":"https://en.wikipedia.org/wiki/SS_Friedrich_der_Grosse","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Steerage_passengers_on_SS_Friedrich_der_Grosse.jpg","page_title":"SS Friedrich der Grosse","context_page_description":"SS Friedrich der Grosse was a Norddeutscher Lloyd liner built in 1896 which sailed Atlantic routes from Germany and sometimes Italy to the United States and on the post run to Australia. At the outset of World War I the ship was interned by the U.S. and, when that country entered the conflict in 1917, was seized and converted to a troop transport, becoming USS Huron.\\nOriginally commissioned as USS Fredrick Der Grosse, the ship was renamed Huron — after Lake Huron, the center lake of the Great Lakes — while undergoing repairs and conversion at a U.S. Navy yard. The ship carried almost 21,000 men to France during the hostilities, and returned over 22,000 healthy and wounded men after the Armistice.\\nAfter decommissioning by the U.S. Navy, the ship was turned over to the United States Shipping Board and was later transferred to the United States Mail Steamship Company, for whom she sailed in the Atlantic as SS Huron. In May 1922 the ship was allocated to the Los Angeles Steamship Co. and renamed SS City of Honolulu. The ship caught fire on 12 October 1922 during her maiden voyage, and sank with no loss of life."},{"page_url":"https://nl.wikipedia.org/wiki/Jardelund","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Jardelund-Wappen.png","page_title":"Jardelund","context_page_description":"Jardelund is een gemeente in de Duitse deelstaat Sleeswijk-Holstein, en maakt deel uit van de Kreis Schleswig-Flensburg.\\nJardelund telt 313 inwoners."},{"page_url":"https://en.wikipedia.org/wiki/The_Common_Law_Origins_of_the_Infield_Fly_Rule","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Infield_fly.jpg","page_title":"The Common Law Origins of the Infield Fly Rule","context_page_description":"\\"The Common Law Origins of the Infield Fly Rule\\" is the title of an article by William S. Stevens published in 1975 in the University of Pennsylvania Law Review. The brief eight-page article has vastly surpassed its modest original context, having been cited in federal and state judicial opinions and more than 100 works of legal literature. It has been included in a number of anthologies of baseball law, and prompted copycat and parody articles. The New York Times called the article \\"one of the most celebrated and imitated analyses in American legal history.\\""},{"page_url":"https://en.wikipedia.org/wiki/List_of_Russian_commanders_in_the_Patriotic_War_of_1812","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Zagryazhsky_Pyotr_Petrovich.jpg","page_title":"List of Russian commanders in the Patriotic War of 1812","context_page_description":"This is a list of commanders of the Russian Army in 1812 before the Patriotic War of 1812."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/AM-Noah%27s_Ark-2015-5000dram.PNG","page_title":"Памятные монеты Армении","context_page_description":"Памятные и юбилейные монеты выпускаются Центральным банком Республики Армения, начиная с 1994 года из драгоценных и недрагоценных металлов.\\nЗолотые монеты были выпущены номиналом в 100, 500, 1000, 5000, 10 000, 25 000, 50 000, 100 000, 200 000 и 1 000 000 драмов, серебряные — 5, 10, 25, 100, 200, 500, 1000, 1957, 2000, 5000, 10 000 и 20 000 драмов, медно-никелевые — 100 драмов, стальные с латунным покрытием — 50 драмов, латунные — 200 драмов.\\nВ связи с отсутствием в стране собственного монетного двора, все монеты чеканятся за рубежом: на монетных дворах Австрии, Великобритании, Германии, Литвы, Нидерландов, Польши, России, Словакии, США, Финляндии и Чехии."},{"page_url":"https://hu.wikipedia.org/wiki/Jimmy_Savile","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jimmy_Savile_2006.jpg","page_title":"Jimmy Savile","context_page_description":"Sir James Wilson Vincent „Jimmy” Savile OBE, KCSG angol lemezlovas, műsorvezető, médiaszemélyiség, szexuális bűnöző, pedofil."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%85%D1%83%D0%B4%D0%BE%D0%B6%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Net_Novostey.jpg","page_title":"Волков, Андрей Викторович (художник)","context_page_description":"Андрей Викторович Волков — советский и российский художник, живописец, действительный член Российской академии художеств."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A9%86%E7%BD%95%E9%BB%98%E5%BE%B7%C2%B7%E5%B8%95%E5%A4%8F%C2%B7%E7%B4%A2%E7%A7%91%E6%B4%9B%E7%BB%B4%E5%A5%87%E6%A1%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Visegrad_Drina_Bridge_1.jpg","page_title":"穆罕默德·帕夏·索科洛维奇桥","context_page_description":"穆罕默德·帕夏·索科洛维奇桥，是位于波斯尼亚和黑塞哥维那塞族共和国的维舍格勒，横跨在德里纳河上的一座古桥。此桥建成于1577年，是由奥斯曼帝国的著名建筑师科查·米马尔·希南在帝国大维齐尔索库鲁·穆罕默德帕夏的命令下设计建造，故此得名。2007年被列入世界遗产。"},{"page_url":"https://en.wikipedia.org/wiki/Dhanbad_Junction_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Dhanbad_Junction_platformboard.jpg","page_title":"Dhanbad Junction railway station","context_page_description":"Dhanbad Junction Railway Station, station code DHN, is a railway station of the Indian railway serving the city of Dhanbad, the headquarters of Dhanbad district in the Indian state of Jharkhand. It is the largest railway station in Jharkhand, handling over 100 trains and 100,000+ passengers every day. Dhanbad is also the headquarters of the Dhanbad Rail Division of the East Central Railway zone. Grand Chord rail-line that connects Howrah and New Delhi passes through Dhanbad junction. Dhanbad is located at 23°47′32″N 86°25′42″E. It has an elevation of 235 metres.\\nOne of the largest and busiest railway junctions, it is arguably the most important station on the Grand Chord. In fact Dhanbad is the junction at which the Grand Chord really diverges from the CIC section. CIC rail line starts from Dhanbad and ends at Singrauli in Madhya Pradesh. Besides the CIC section there was a direct line to Ranchi which goes through Bokaro and Chandrapura. Most trains bound for Ranchi take this route."},{"page_url":"https://de.wikipedia.org/wiki/Gabriel_Duvall","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/GabrielDuvall.jpg","page_title":"Gabriel Duvall","context_page_description":"Gabriel Duvall war ein US-amerikanischer Jurist und Richter am Obersten Gerichtshof der Vereinigten Staaten. Vom 11. November 1794 bis 28. März 1796 war er Abgeordneter des US-Repräsentantenhauses für den Bundesstaat Maryland."},{"page_url":"https://en.wikipedia.org/wiki/Hallstatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Alice_Schumacher_NHM_Wien_Abb_Salz-Reich_2008_Seite_133_6.jpg","page_title":"Hallstatt","context_page_description":"Hallstatt is a small town in the district of Gmunden, in the Austrian state of Upper Austria.\\nSituated between the southwestern shore of Hallstätter See and the steep slopes of the Dachstein massif, the town lies in Salzkammergut region, on the national road linking Salzburg and Graz.\\nHallstatt is known for its production of salt, dating back to prehistoric times, and gave its name to the Hallstatt culture, the archaeological culture linked to Proto-Celtic and early Celtic people of the Early Iron Age in Europe, c. 800–450 BC.\\nHallstatt is at the core of the \\"Hallstatt-Dachstein/Salzkammergut Cultural Landscape\\" declared as one of the World Heritage Sites in Austria by UNESCO in 1997. It is an area of overtourism."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B7%80%E0%B7%92%E0%B6%A7%E0%B6%B8%E0%B7%92%E0%B6%B1%E0%B7%8A_D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Cholecalciferol-3d.png","page_title":"විටමින් D","context_page_description":"විටමින් D අස්ථි ශක්තිමත් කිරීමට උපකාර වේ. ළමුන්ගේ අස්‌ථි වර්ධනයට ද කැල්සියම් ශරීරයට උරා ගැනීමටද අත්‍යවශ්‍යය. කැල්සියම් හා සම්බන්ධය විටමින් D අඩු වීමෙන් අස්ථි කැඩීමට පිපිරීමට ඉරිතලා යාමට ඉඩ ඇත. බොහෝ විට අස්ථි ඉරිතලා ගොස් තද වේදනාවක් ඇති වේ.\\nකිරි, මාළු, අක්‌මා තෙල්, බටර්, මාගරින් ආදියෙහි විටමින් D බහුලය."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%83%D0%BB%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/O%C5%A0_%22Vuk_Karad%C5%BEi%C4%87%22%2C_Tulovo%2C_Leskovac_06.JPG","page_title":"Тулово","context_page_description":"Тулово је насељено место града Лесковца у Јабланичком округу. Према попису из 2011. било је 697 становника."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Sulpice_de_Saint-Sulpice-de-Faleyrens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/St_Sulpice_de_Faleyrens_%C3%A9glise_Sanctuaire_Baie_Sud_b.JPG","page_title":"Église Saint-Sulpice de Saint-Sulpice-de-Faleyrens","context_page_description":"L'église Saint-Sulpice est une église catholique située à Saint-Sulpice-de-Faleyrens, dans le département français de la Gironde en France."},{"page_url":"https://en.wikipedia.org/wiki/Craven","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/River_Aire_-_Main_Road%2C_Kildwick_-_geograph.org.uk_-_1016839.jpg","page_title":"Craven","context_page_description":"Craven is a local government district of North Yorkshire, England centred on the market town of Skipton. In 1974, Craven district was formed as the merger of Skipton urban district, Settle Rural District and most of Skipton Rural District, all in the West Riding of Yorkshire. The population of the Local Authority at the 2011 Census was 55,409. It comprises the upper reaches of Airedale, Wharfedale, Ribblesdale, and includes most of the Aire Gap and Craven Basin.\\nThe name Craven is much older than the modern district, and encompassed a larger area. This history is also reflected in the way the term is still commonly used, for example by the Church of England."},{"page_url":"https://en.wikipedia.org/wiki/2018_United_States_Senate_election_in_Wyoming","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Wyoming_Senate_Election_Results_by_County%2C_2018.svg","page_title":"2018 United States Senate election in Wyoming","context_page_description":"The 2018 United States Senate election in Wyoming took place on November 6, 2018 to elect a member of the United States Senate to represent the State of Wyoming. The primary election took place August 21, 2018. Republican John Barrasso won reelection with 67% percent of the vote, the lowest percentage of his three U.S. Senate campaigns and the closest a Democrat got to winning a seat since the 1996 election."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%94%EC%9C%84%EB%84%88%EA%B5%AC%EB%A6%AC%EA%B3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Dugong_dugon_Hardwicke_white_background.jpg","page_title":"바위너구리과","context_page_description":"바위너구리목은 겉모습이 설치류에 가까우며, 발톱이 있는 작은 포유류이다. 토끼 정도의 크기이고 귀가 짧다. 앞다리에 4개의 발가락, 뒷다리에 3개의 발가락이 있는데, 특히 뒷다리의 둘째발가락에만 갈고리 발톱이 있다. 발바닥에는 바위 등을 기어올라갈 때 미끌어지지 않도록 하는 혹이 나 있는데, 이것은 피부가 단단하게 변한 것이다. 한 쌍의 윗앞니와 두 쌍의 아래앞니가 있다. 나무타기너구리·바위너구리 등의 6종이 알려져 있다."},{"page_url":"https://fi.wikipedia.org/wiki/Intiaanien_alkuper%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Journal.pone.0001596.g004.png","page_title":"Intiaanien alkuperä","context_page_description":"Intiaanien alkuperän katsotaan olevan perinteisen näkemyksen mukaan Itä-Siperiassa. Intiaanit olivat Amerikan alkuperäiskansaa. Joihinkin kiistanalaisiin löytöihin viitaten on ajateltu intiaanien esi-isiä olleen Amerikassa ehkä jo 50 000–16 000 vuotta sitten, mutta tätä ei kyetä pitävästi todistamaan.\\nIntiaanien esi-isät tulivat jääkauden lopulla silloin kuivana maana olleen Alaskan ja Itä-Siperian välisen Beringinsalmen yli. Beringinsalmi on saatettu ylittää noin 15 000 vuotta sitten. Jää alkoi sulaa rajusti noin 14 700 kalenterivuotta sitten.\\nKun jääkauden mannerjäätikkö alkoi sulaa, Beringian maakannas peittyi asteittain mannerjäätiköistä sulaneeseen veteen. Kanadan päällä olleeseen valtavaan jäätikköön avautui Kalliovuorten länsi- ja itäpuolelle jäätön käytävä ja paleointiaanit saattoivat matkata etelään perustamaan mammutinmetsästykseen perustuvan Clovis-kulttuurin, joka ilmestyi ehkä jo 13 500, mutta viimeistään 13 000 kalenterivuotta sitten."},{"page_url":"https://fr.wikipedia.org/wiki/Busard_p%C3%A2le","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Circus_macrourus_distribution_map.png","page_title":"Busard pâle","context_page_description":"Le Busard pâle est une espèce de rapaces diurnes de la famille des Accipitridae."},{"page_url":"https://en.wikipedia.org/wiki/Heinkel_He_177","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Daimler_Benz_DB_610.jpg","page_title":"Heinkel He 177","context_page_description":"The Heinkel He 177 Greif was a long-range heavy bomber flown by the Luftwaffe during World War II. The introduction of the He 177 to combat operations was significantly delayed, by both problems with the development of its engines, and frequent changes to its intended role. Nevertheless, it was the only long-range, heavy bomber to become operational with the Luftwaffe during the war. The He 177 had a payload/range capability similar to that of four-engined heavy bombers used by the Allies in the European theatre; it also had higher cruising and maximum speeds than its Allied counterparts.\\nWork on the design began in response to a 1936 requirement, known as Bomber A, issued by the RLM for a purely strategic bomber. Thus the He 177 was intended originally to be capable of a sustained bombing campaign against Soviet manufacturing capacity, deep inside Russia.\\nIn contrast to its heavy payload and very wide, 30 metres planform, the specifications called for the design to have only two, very powerful engines. To deliver the power required, the He 177 needed engines of at least 2,000 horsepower. Engines of this type were new and unproven at the time."},{"page_url":"https://sco.wikipedia.org/wiki/Tres_Arroyos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Palacio_luminico_tres_arroyos.jpg","page_title":"Tres Arroyos","context_page_description":"Tres Arroyos is a ceety in Buenos Aires Province, Argentinae. It is the caipital o the Tres Arroyos Partido.\\nThe ceety haes a sizable population o Dutch an Dens strynd."},{"page_url":"https://fr.wikipedia.org/wiki/Freddy_Guevara","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Freddy_Guevara_sesi%C3%B3n_AN_14.01.2016.jpg","page_title":"Freddy Guevara","context_page_description":"Freddy Guevara Cortez est un homme politique vénézuélien."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%8C%E3%83%BC%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Anouk.jpg","page_title":"アヌーク","context_page_description":"アヌーク・テーウヴェ、芸名アヌークはオランダの歌手、シンガーソングライター、プロデューサーである。\\nアヌークはオランダで最も人気の高い女性ロック歌手とみられている。1997年にシングル「Nobody's Wife」が発売されたのをきっかけにオランダおよびベルギーで多数のヒット曲を量産し、「R U Kiddin' Me」、「Michel」、「Girl」、「Lost」、「One Word」、「I Don't Wanna Hurt」「Modern World」、「Three Days in a Row」、「Woman」などが代表作として挙げられる。\\n2012年までに7枚のアルバムを発売し、2013年5月には8枚目の『Sad Singalong Songs』が発売される。また同じ2013年5月にユーロビジョン・ソング・コンテスト2013のオランダ代表としてスウェーデンのマルメで開催される同大会に出場し、「Birds」を歌う。"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AE%E0%B2%B2%E0%B2%97%E0%B3%81%E0%B2%B5_%E0%B2%95%E0%B3%8B%E0%B2%A3%E0%B3%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Langes_Tannen_Schlafzimmer_01.jpg","page_title":"ಮಲಗುವ ಕೋಣೆ","context_page_description":"ಮಲಗುವ ಕೋಣೆಯು ಜನರು ಮಲಗುವ ಮನೆ, ದೊಡ್ಡಮನೆ, ದುರ್ಗ, ಅರಮನೆ, ಹೋಟೆಲ್, ಶಯನ ಮಂದಿರ, ಅಪಾರ್ಟ್‌ಮಂಟ್, ಕಾಂಡಮಿನಿಯಮ್, ಡ್ಯೂಪ್ಲೆಕ್ಸ್ ಅಥವಾ ಟೌನ್‍ಹೌಸ್‍ನಲ್ಲಿನ ಕೋಣೆ. ಒಂದು ಸಾಮಾನ್ಯ ಪಾಶ್ಚಾತ್ಯ ಮಲಗುವ ಕೋಣೆಯು ಪೀಠೋಪಕರಣಗಳಾಗಿ ಒಂದು ಅಥವಾ ಎರಡು ಹಾಸಿಗೆಗಳು, ಬಟ್ಟೆಗಳ ಬೀರು, ಮತ್ತು ಹಾಸಿಗೆ ಪಕ್ಕದ ಮೇಜು ಹಾಗೂ ಅಲಂಕರಣ ಮೇಜು. ಮಲಗುವ ಕೋಣೆಗಳು ಸಾಮಾನ್ಯವಾಗಿ ಮನೆಯ ನೆಲಮಟ್ಟದ ಮೇಲಿನ ಮಹಡಿಗಳಲ್ಲಿ ಒಂದರಲ್ಲಿ ಇರುತ್ತವೆ.\\nದೊಡ್ಡ ವಿಕ್ಟೋರಿಯನ್ ಮನೆಗಳಲ್ಲಿ ಮಲಗುವ ಕೋಣೆಯಿಂದ ಮನೆಯ ಯಜಮಾನಿಗೆ ಬೂಡ್ವಾರ್‌ಗೆ ಮತ್ತು ಯಜಮಾನನಿಗೆ ಬಟ್ಟೆ ಬದಲಿಸುವ ಕೋಣೆಗೆ ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗಿದ್ದುದು ಸಾಮಾನ್ಯವಾಗಿತ್ತು. ಕೆಲವು ಮನೆಗಳಲ್ಲಿ ಮೇಲಟ್ಟದ ಮಲಗುವ ಕೋಣೆಗಳು ಇರುತ್ತವೆ; ಅವುಗಳನ್ನು ಹೊರಗಿನ ಗಾಳಿಯಿಂದ ಕೇವಲ ಚಾವಣಿಯು ಬೇರ್ಪಡಿಸುವುದರಿಂದ, ಅವುಗಳು ಸಾಮಾನ್ಯವಾಗಿ ಚಳಿಗಾಲದಲ್ಲಿ ಬಹಳ ತಂಪಗಿದ್ದು ಬೇಸಿಗೆಯಲ್ಲಿ ಬಹಳ ಬಿಸಿಯಾಗಿರಬಹುದು."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%8F%E0%A4%B2%E0%A4%BE%E0%A4%9D%E0%A4%97_%E0%A4%AA%E0%A5%8D%E0%A4%B0%E0%A4%BE%E0%A4%82%E0%A4%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Elaz%C4%B1%C4%9F_districts.png","page_title":"एलाझग प्रांत","context_page_description":"एलाझग हा तुर्कस्तान देशामधील एक प्रांत आहे. तुर्कस्तानच्या पूर्व भागात वसलेल्या ह्या प्रांताची लोकसंख्या सुमारे ५.५ लाख आहे. एलाझग ह्याच नावाचे शहर ह्या प्रांताची राजधानी आहे."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_9_oktober","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Gisela_Agnes_von_Rath.jpg","page_title":"Lijst van personen geboren op 9 oktober","context_page_description":"Dit is een lijst van personen die geboren zijn op 9 oktober.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n210 v.Chr. - Ptolemaeus V Epiphanes, farao bewerken\\n1200 - Isabel Marshal, uit het Koninkrijk Engeland bewerken\\n1201 - Robert de Sorbon, Franse theoloog bewerken\\n1221 - Salimbene de Adam, schrijver, historicus en broeder bewerken\\n1261 - Dionysius van Portugal, Portugese dichter, componist, schrijver en agrariër bewerken\\n1328 - Peter I van Cyprus, monarch bewerken\\n1417 - Jan II van Glymes, Nederlandse heer bewerken\\n1524 - Ottavio Farnese, hertog, politicus uit de Kerkelijke Staat bewerken\\n1556 - Cunigonda Jacoba van de Palts, Duitse bewerken\\n1574 - Elizabeth van Lotharingen, Duitse hertogin en prinses, aristocraat bewerken\\n1581 - Claude Gaspard Bachet de Méziriac, Franse wiskundige, dichter en vertaler bewerken"},{"page_url":"https://pl.wikipedia.org/wiki/Olav_Engelbrektsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Tautra_Mariakloster_Nave_West_Entry_2000_08_07.jpg","page_title":"Olav Engelbrektsson","context_page_description":"Olav Engelbrektsson – ostatni katolicki arcybiskup Nidaros. Obrońca katolicyzmu i suwerenności Norwegii. Miał znaczny wpływ na rozwój norweskiej architektury sakralnej i świeckiej."},{"page_url":"https://tr.wikipedia.org/wiki/Procter_%26_Gamble","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Cincinnati-procter-and-gamble-headquarters.jpg","page_title":"Procter & Gamble","context_page_description":"Procter & Gamble, merkezi Cincinnati, Ohio, ABD'de, bulunan, özellikle kimyevi tüketici ürünleri üreten çok uluslu şirket. Temel olarak çok çeşitli temizlik maddeleri ve kişisel bakım ve hijyen ürünleri konusunda uzmanlaşmıştır. Kellogg's firmasına Pringles'lerin satışından önce, ürün portföyü yiyecekleri, aperitifleri ve içecekleri de içeriyordu.\\n2014 yılında P&G, satışları 83.1 milyar dolar olarak kaydedildi. 1 Ağustos 2014 tarihinde Procter & Gamble, şirketin kârını %65'e çıkarıp şirketin kârını %100 oranında azaltarak ürün portföyünden 100'e yakın markayı düşürdüğünü ve sattığını açıkladı. 31 Ekim 2015'e kadar şirketin başkanı ve CEO'su A.G. Lafley, gelecekte Procter & Gamble'ın \\"yönetilmesi ve işletilmesi daha kolay olan lider markalardan çok daha basit, daha az karmaşık bir şirket\\" olacağını söyledi. David Taylor, Procter & Gamble'ın şu anki başkanı ve CEO'sudur."},{"page_url":"https://pl.wikipedia.org/wiki/Derek_Meech","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Derek_Meech_2012-05-05.JPG","page_title":"Derek Meech","context_page_description":"Derek Meech – kanadyjski hokeista."},{"page_url":"https://de.wikipedia.org/wiki/VanDusen_Botanical_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/VanDusen_Botanical_Garden_rock_garden.jpg","page_title":"VanDusen Botanical Garden","context_page_description":"Der VanDusen Botanical Garden ist ein 22 Hektar großer botanischer Garten in der kanadischen Stadt Vancouver. Er befindet sich im Stadtbezirk Shaughnessy an der Ecke West 37th Avenue/Oak Street, wird von der städtischen Parkbehörde verwaltet und von Freiwilligen gepflegt.\\nDas Gelände gehörte ursprünglich der Canadian Pacific Railway und wurde 1911 an den Shaughnessy Golf Club verpachtet. 1960 wurde der Golfplatz an einen anderen Standort verlegt und die CPR plante den Bau von Wohngebieten, was jedoch auf Widerstand stieß. 1970 unterzeichneten die Vancouver Foundation, die Provinzregierung und die Stadtverwaltung eine Vereinbarung. Finanziert durch eine Spende von W. J. VanDusen, ein Philanthrop und Manager der Holzindustrie nach dem der Garten benannt ist, begann 1971 die Umwandlung in einen botanischen Garten. Die Eröffnung erfolgte am 30. August 1975.\\nSchon früh hatte man sich darauf geeinigt, keine wissenschaftliche Forschung zu betreiben, sondern sich rein auf die Pflanzenpflege zu beschränken. Aus diesem Grund besitzt der VanDusen Botanical Garden keine Forschungseinrichtungen oder Herbarien. Allerdings gibt es im Verwaltungsgebäude eine spezialisierte Referenzbibliothek."},{"page_url":"https://es.wikipedia.org/wiki/Medalla_de_Extremadura","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/MEDALLA_DE_EXTREMADURA.png","page_title":"Medalla de Extremadura","context_page_description":"La Medalla de Extremadura es la máxima distinción institucional de la Comunidad Autónoma de Extremadura, España. Fue instaurada en 1986, siguiendo el decreto 27/1986, de 29 de abril.​ La regulación de la concesión de la Medalla de Extremadura quedó modificada por el Decreto 177/2013, de 24 de septiembre. ​\\nSe trata de un galardón anual. Desde 2013, el número máximo de medallas anuales es de cinco. Hasta esa fecha, el número de medallas por año era variable, sin exceder las diez medallas en un mismo año, exceptuando las concedidas por cortesía o reciprocidad. Es el caso del año 2008, en el que se entregaron diez Medallas con carácter ordinario, pero se otorgaron de manera extraordinaria a la Reina Sofía y al expresidente de la Junta de Extremadura, Juan Carlos Rodríguez Ibarra.\\nLa concesión del galardón se realiza por Decreto del Consejo de Gobierno a propuesta del Presidente de la Junta de Extremadura, enumerando los méritos por los que se obtiene el premio."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_dinozaurilor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Chasmosaurus_BW.jpg","page_title":"Lista dinozaurilor","context_page_description":"Această listă a dinozaurilor este o listă cuprinzătoare a tuturor genurilor care au fost vreodată incluse în superordinul Dinosauria, cu excepția claselor Aves și termeni pur vernaculari.\\nLista include toate genurile acceptate în mod obișnuit, dar și genurile care sunt considerate acum invalide, îndoielnice, sau care nu au fost publicate în mod oficial, precum și sinonime mai mici ale unor nume stabilite și genuri care nu mai sunt considerate dinozauri. Lista conține 1559 nume, dintre care aproximativ 1192 sunt considerate fie genuri valide de dinozaur, fie nomina dubia."},{"page_url":"https://bar.wikipedia.org/wiki/B%C3%B6fflamott","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Boefflamott.JPG","page_title":"Böfflamott","context_page_description":"A Böfflamott is a klassischa Rindsschmorbrodn aus da boarischn Kuche."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Sommerhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Sommerhausen%2C_Hauptstra%C3%9Fe_25%2C_Schlo%C3%9F-002.jpg","page_title":"Liste der Baudenkmäler in Sommerhausen","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Sommerhausen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 8. Mai 2020 wieder und enthält 79 Baudenkmäler."},{"page_url":"https://de.wikipedia.org/wiki/Aesica","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Altar_Stone_at_Aesica_Roman_Fort_-_geograph.org.uk_-_536668.jpg","page_title":"Aesica","context_page_description":"Aesica war ein römisches Kastell der Hilfstruppen im County Northumbria, im Nordwesten von England, Parish Greenhead, Ortsteil Haltwhistle.\\nEs gehörte zu der aus insgesamt 16 Kastellen bestehenden Festungskette des Hadrianswalls und sicherte dessen mittleren Abschnitt. Im Gegensatz zu den meisten anderen Lagern entlang des Walls, stand Aesica zur Gänze südlich der Mauer, neben den Grundfesten des ursprünglichen Walls und eines Meilenkastells, die beim Bau des Kastells beseitigt worden waren. Das Lager wurde vermutlich von 128 bis 400 n. Chr. vom römischen Militär genutzt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Naarden","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Naarden-wethouderk%C3%B6niglaan-196661.jpg","page_title":"Lijst van gemeentelijke monumenten in Naarden","context_page_description":"De plaats Naarden, onderdeel van de voormalige gemeente Gooise Meren, heeft 85 gemeentelijke monumenten; hieronder een overzicht."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E6%A0%BC%E7%8E%9B%E7%BA%A7%E6%8A%A4%E5%8D%AB%E8%88%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/PKR_Sigma_10514_%281%29.jpg","page_title":"西格玛级护卫舰","context_page_description":"西格瑪級，SIGMA為整合式模組化船艦幾何法則縮寫，為荷蘭研製的外銷用巡邏艦、護衛艦和巡防艦系列，使用模組化設計，除了可擔負邏和監視任務外還能夠適應多種作戰需求也具有優秀的可靠性和可承受性，並可針對訂購國需求加以更改，因此對許多中小型國家的海軍而言是一種能在較低的預算下獲得的現代化艦艇。\\n2015年發布了幾種巡邏艦構型，包括Sigma 8313、Sigma 8011、Sigma 7613及Sigma 6610。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%A7%E1%83%98%E1%83%9C%E1%83%95%E1%83%90%E1%83%A0%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%A2%E1%83%91%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ib%C3%B3n_de_Sabocos_%2814562086186%29.jpg","page_title":"მყინვარული ტბა","context_page_description":"მყინვარული ტბა — წყლის სხეული, რომელიც წარმოიშობა მყინვარის აქტივობის შედეგად. იგი ყალიბდება მაშინ, როდესაც მყინვარი იწვევს მიწის ეროზიას, შემდეგ კი მყინვარი დნება და ავსებს მიწის ეროზირებულ ნაწილს."},{"page_url":"https://lt.wikipedia.org/wiki/Ocelotas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ocelot.jpg","page_title":"Ocelotas","context_page_description":"Ocelotas – katinių šeimos plėšrus žinduolis.\\nŠio plėšrūno kūno ilgis siekia iki 1 m, uodegos – iki 40 cm. Gyvūno aukštis – iki 50 cm. Galva pailga, ausys apvalios. Ant kaktos ir skruostų matomos dvi juodos juostos. Nugaros ir šonų kailis – geltonas arba pilkas, su juodomis išilginėmis juostomis, kurias sudaro arti viena kitos esančių juodų dėmių eilės. Krūtinė ir pilvas – gelsvi. Kojos – taškuotos. Dėl gražaus kailio ocelotai yra medžiojami.\\nIšore ocelotas panašus į kitą savo genties atstovę – ilgauodegę katę, tik yra stambesnis."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D1%85%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%92%D1%96%D1%82%D0%B0%D0%BB%D1%96%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Kukharskyy_6160.jpg","page_title":"Кухарський Віталій Михайлович","context_page_description":"Кухарський Віталій Михайлович — проректор з науково-педагогічної роботи та інформатизації Львівського національного університету імені Івана Франка, кандидат фізико-математичних наук, доцент кафедри прикладної математики, один із засновників та член правління громадської організації «Лабораторія Ідей»"},{"page_url":"https://gl.wikipedia.org/wiki/Breog%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Breog%C3%A1n_2018.jpg","page_title":"Breogán","context_page_description":"Breogán, tamén identificado como Brigo, é un rei mitolóxico céltico de Galicia que é descrito como o fundador da cidade de Brigantia e o construtor dunha gran torre, identificada coa Torre de Hércules. A principal fonte documental sobre Breogán é o Lebor Gabála Érenn, un compendio medieval sobre os mitos fundacionais dos irlandeses. Neste compendio é descrito como o fillo de Brate, e o pai de Ite e Bile, entre outros, así como o devanceiro dos gaels. Ademais cóntase como os gaels descenden de Adán, a través dos fillos de Noé, e como chegaron a Irlanda a través de Galicia.\\nÉ a personificación nacional de Galicia, sendo mencionado dúas veces no himno Os Pinos a través de referencias metafóricas a Galicia como o \\"Fogar\\" e a \\"Nazón de Breogán\\"."},{"page_url":"https://en.wikipedia.org/wiki/Parkend_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Bilson%2C_Cinderford%2C_Coleford%2C_Lydbrook_%26_Lydney_RJD_86.jpg","page_title":"Parkend railway station","context_page_description":"Parkend railway station is located in the village of Parkend, in the Forest of Dean, Gloucestershire. It is currently the northern terminus of the Dean Forest Railway."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%82%80%E5%84%A1%E6%94%BF%E6%AC%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Coat_of_arms_of_Bophuthatswana.png","page_title":"傀儡政權","context_page_description":"傀儡政权是指形式上独立，但其内政外交却受到外国指挥、控制的政权，是从属国的一类。 一些小国内政外交往往难免会受到大国的影响，但这并不意味着受到指挥控制，不可以视为傀儡政权。\\n傀儡政权是一个特定意识形态和民族认同中产生的词汇，通常指某个政权，因为外国势力的扶持，或者由外国侵略者所建立和控制而导致其法统“非法”。这种观点认为：当一个政权的最高首脑由外国势力授意产生，而不是由本国公民选举产生，该政权必然是傀儡政权。\\n傀儡政权一词有浓厚的政治意识形态和民族主义的色彩，不少处于内战，或者有外国势力插手的战争中的政治实体，都互相指责对方是某一外国势力的“傀儡政权”，己方则是“合法政府”。比如说中华民国政府和中华人民共和国政府就曾相互指责对方为美国或苏联的傀儡政权。韩国政府和朝鲜政府也是如此。"},{"page_url":"https://de.wikipedia.org/wiki/Tullnau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nuremberg_Aerial_Tullnau_Moegeldorf.JPG","page_title":"Tullnau","context_page_description":"Tullnau ist ein Stadtteil von Nürnberg und der Name des statistischen Bezirks 28. Der Bezirk Tullnau zählte am 31. Dezember 1997 insgesamt 3.834 Einwohner."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Lierville","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Lierville_%2860%29%2C_%C3%A9glise_Saint-Martin%2C_nef%2C_vue_vers_l%27est_1.jpg","page_title":"Liste der Monuments historiques in Lierville","context_page_description":"Die Liste der Monuments historiques in Lierville führt die Monuments historiques in der französischen Gemeinde Lierville auf."},{"page_url":"https://de.wikipedia.org/wiki/Techno","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Deli_Berlin_D_04.JPG","page_title":"Techno","context_page_description":"Techno ist eine Musikrichtung, die in der zweiten Hälfte der 1980er-Jahre durch die Verschmelzung mehrerer Stilarten der elektronischen Tanzmusik entstanden ist. Als Basis dient insbesondere der minimalistische, bassdrum-betonte Grundrhythmus der House-Musik. Weitere essentielle Elemente zieht Techno aus den elektronisch generierten, meist in Europa entwickelten Stilen der 1970er- und 1980er-Jahre. Der in der Anfangszeit noch als Techno House bezeichnete Stil erlebte im Verlauf der 1990er-Jahre eine Blütezeit und brachte zahlreiche Unterarten hervor. Rund um die Musik existiert eine eigene Jugendkultur, die Technoszene.\\n„Techno“ wird auch als Oberbegriff für verschiedene miteinander verwandte Stilrichtungen der elektronischen Tanzmusik verwendet. In diesem Zusammenhang knüpft er an das Verständnis der 1980er-Jahre an, als „Techno“ eine Funktion als Sammelbezeichnung für „technologisch-fortschrittliche Musik“ innehatte."},{"page_url":"https://sv.wikipedia.org/wiki/Skata","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Pica_pica.01.jpg","page_title":"Skata","context_page_description":"Skata är en kråkfågel inom släktet skator som förekommer i stora delar av Europa samt västra och norra Asien. I Europa är skatan vanlig, särskilt i bebodda områden, och med sin karakteristiska svartvita fjäderdräkt och påfallande långa stjärt är den svår att förväxla med andra arter. Skatan är ofta starkt knuten till mänsklig bebyggelse, en så kallad kulturföljare, och uppträder både i städer och på landsbygden. Den häckar också i kustområden. Skatan är allätare och ses ofta proviantera på marken. Den äter både animalisk och vegetarisk föda under hela året.\\nDen taxonomiska indelningen av släktet skator har varit omdiskuterad. Efter genetiska studier har numera flera av skatans olika populationer i Nordafrika och Asien urskiljts som egna arter."},{"page_url":"https://fr.wikipedia.org/wiki/Berlancourt_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Berlancourt_%28Aisne%29_%C3%A9glise_%2802%29.JPG","page_title":"Berlancourt (Aisne)","context_page_description":"Berlancourt est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Ucayali","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ucayalirivermap.png","page_title":"Río Ucayali","context_page_description":"El río Ucayali es uno de los principales ríos del Perú. Históricamente se ha considerado que de su confluencia con el río Marañón nace el río Amazonas. El río Ucayali discurre por la vertiente oriental de los Andes peruanos, en la parte central del país. Tiene una longitud de 1771 km, ​ aunque considerando sus fuentes más alejadas alcanza los 2801 km.\\nEl río da nombre a la región Ucayali."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%A7%80%E6%84%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/160804_%EA%B5%AD%EA%B0%80%EB%8C%80%ED%91%9C2_%EB%AC%B4%EB%B9%84%ED%86%A0%ED%81%AC_%EC%88%98%EC%95%A0.png","page_title":"秀愛","context_page_description":"秀爱，本名朴秀爱，韩国女演员。曾获“感情戏专业演员”和“眼泪女王”的头衔。\\n1999年以电视剧《学校2》出道，2009年凭《君在远方》获第46届韩国电影大钟奖最佳女主角，2010年又凭借《深夜FM》获第31届韩国青龙电影奖最佳女主角、第28届意大利都灵国际电影节最佳女演员。"},{"page_url":"https://en.wikipedia.org/wiki/Bretwalda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Edwin_-_John_Speed.JPG","page_title":"Bretwalda","context_page_description":"Bretwalda is an Old English word. The first record comes from the late 9th-century Anglo-Saxon Chronicle. It is given to some of the rulers of Anglo-Saxon kingdoms from the 5th century onwards who had achieved overlordship of some or all of the other Anglo-Saxon kingdoms. It is unclear whether the word dates back to the 5th century and was used by the kings themselves or whether it is a later, 9th-century, invention. The term bretwalda also appears in a 10th-century charter of Æthelstan. The literal meaning of the word is disputed and may translate to either 'wide-ruler' or 'Britain-ruler'.\\nThe rulers of Mercia were generally the most powerful of the Anglo-Saxon kings from the mid 7th century to the early 9th century but are not accorded the title of bretwalda by the Chronicle, which had an anti-Mercian bias. The Annals of Wales continued to recognise the kings of Northumbria as \\"Kings of the Saxons\\" until the death of Osred I of Northumbria in 716."},{"page_url":"https://sv.wikipedia.org/wiki/Berytinus_crassipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Berytinus_crassipes.jpg","page_title":"Berytinus crassipes","context_page_description":"Berytinus crassipes är en insektsart som först beskrevs av Herrich-schaeffer 1835. Berytinus crassipes ingår i släktet Berytinus, och familjen styltskinnbaggar. Enligt den finländska rödlistan är arten nära hotad i Finland. Arten är reproducerande i Sverige. Artens livsmiljö är torra gräsmarker."},{"page_url":"https://de.wikipedia.org/wiki/Resolution_2032_des_UN-Sicherheitsrates","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Map_of_Abyei_Area_en.png","page_title":"Resolution 2032 des UN-Sicherheitsrates","context_page_description":"Die Resolution 2032 des UN-Sicherheitsrates ist eine Resolution, die der Sicherheitsrat der Vereinten Nationen in der 6699. Sitzung am 27. Dezember 2011 einstimmig beschloss. Sie trägt den Titel „Bericht des Generalsekretärs über den Sudan und Südsudan“.\\nDer Rat forderte die beiden Länder dringend zum Abschluss der Einrichtung einer „Region Abyei Verwaltung und Polizei“ im Einklang mit früheren Vereinbarungen auf und fordert den Einsatz der zur Lösung offener Fragen im Zusammenhang mit den Grenzen und der entmilitarisierten Zone entwickelten Abläufe.\\nDer Sicherheitsrat beschäftigte sich schon in der Resolution 1990 und der Resolution 2024 mit dem Thema."},{"page_url":"https://fr.wikipedia.org/wiki/Fortifications_de_la_Rhune_%C3%A0_l%27%C3%A9poque_contemporaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Urrugne_-_Redoute_des_%C3%89migr%C3%A9s.png","page_title":"Fortifications de la Rhune à l'époque contemporaine","context_page_description":"Les fortifications de la Rhune à l’époque contemporaine sont des ouvrages militaires, situés sur la montagne de la Rhune, à proximité immédiate et à l'ouest de la frontière entre l'Espagne et la France. Ils ont été construits pour certains d’entre eux lors de la campagne de 1793 - 1794 et réutilisés par la suite pour contenir l'avancée des troupes de la coalition anglo-hispano-portugaise du futur duc de Wellington. Plus de vingt redoutes se répartissent sur le territoire des communes d'Ascain, de Sare et d'Urrugne et partiellement sur ceux de Saint-Pée-sur-Nivelle et de Biriatou.\\nLes combats de la fin du XVIIIᵉ siècle se sont déroulés principalement sur la commune d’Urrugne. Les forces révolutionnaires sont alors déployées dans les redoutes Louis XIV, de Bertuste, de la Bayonnette et des Émigrés situées sur la frontière et surveillant la Bidassoa ainsi que la route qui vient de Vera de Bidassoa. Le dispositif parvient à contenir l’avancée des assaillants espagnols. Théophile de La Tour d'Auvergne, « premier grenadier de la République », s’illustre particulièrement durant ces affrontements.\\nToute autre est la situation du début du XIXᵉ siècle."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A5%D0%BE%D0%BC%D0%B5%D0%B9%D0%BD%D0%B8%D1%88%D3%99%D2%BB%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%D8%AE%D9%85%DB%8C%D9%86%DB%8C%E2%80%8C%D8%B4%D9%87%D8%B1.jpg","page_title":"Хомейнишәһр","context_page_description":"Хомейнишәһр — Иранның Исфәһан устанында урнашкан шәһәр."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Eyton_upon_the_Weald_Moors","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Eyton_upon_the_Weald_Moors%2C_Eyton_House_-_geograph.org.uk_-_1627288.jpg","page_title":"Listed buildings in Eyton upon the Weald Moors","context_page_description":"Eyton upon the Weald Moors is a civil parish in the district of Telford and Wrekin, Shropshire, England. It contains twelve listed buildings that are recorded in the National Heritage List for England. Of these, one is at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The parish contains the village of Eyton upon the Weald Moors, and is otherwise entirely rural. The Shrewsbury Canal, now disused, was built through the parish and joined its Newport Branch at Wappenshall Junction. A number of structures associated with the canal are listed, including a roving bridge, two warehouses, a toll office, and a lock keeper's cottage. The other listed buildings are houses and cottages, a farmhouse, a barn, a church, and a country house."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Commissioners%27_churches_in_southwest_England","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/St_John%27s_Church%2C_Truro.jpg","page_title":"List of Commissioners' churches in southwest England","context_page_description":"A Commissioners' church is an Anglican church in the United Kingdom built with money voted by Parliament as a result of the Church Building Act 1818, and subsequent related Acts. Such churches have been given a number of titles, including \\"Commissioners' Churches\\", \\"Waterloo Churches\\" and \\"Million Act Churches\\". In some cases the Commissioners provided the full cost of the new church; in other cases they provided a grant and the balance was raised locally. This list contains the Commissioners' churches in South West England."},{"page_url":"https://en.wikipedia.org/wiki/Dublin_Mountains_Way","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Tibradden_Chambered_Cairn.jpg","page_title":"Dublin Mountains Way","context_page_description":"The Dublin Mountains Way is a waymarked long-distance trail in the Dublin Mountains, Counties South Dublin and Dún Laoghaire–Rathdown, Ireland. The route is approximately 42 kilometres long and runs from Shankill in the east to Tallaght in the west. It has been developed by the Dublin Mountains Partnership, an umbrella group of relevant state agencies and recreational users working to improve recreational facilities in the Dublin Mountains.\\nWork on the trail began in 2008 and the first section officially opened in June 2009. The task of upgrading and building paths and waymarking the route has been carried out to a large extent by volunteers working under the direction of the Dublin Mountains Partnership. It was opened in October 2010.\\nTravelling from east to west, the route of the Dublin Mountains Way starts on the Main Street of Shankill and passes through Rathmichael, Carrickgollogan, Barnaslingan, Glencullen, Ballyedmonduff, Three Rock, Two Rock, Tibradden Mountain, Cruagh Wood, Featherbed Forest, Glenasmole and Kiltipper before ending at Seán Walsh Memorial Park in Tallaght."},{"page_url":"https://ro.wikipedia.org/wiki/Gr%C4%83dina_Botanic%C4%83_din_Singapore","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/2016_Singapur%2C_Ogrody_botaniczne_%28255%29.jpg","page_title":"Grădina Botanică din Singapore","context_page_description":"Grădina Botanică din Singapore este o grădină tropicală veche de 160 de ani, situată la marginea cartierului comercial Orchard Road din Singapore. Este una dintre cele trei grădini și singura grădină tropicală inclusă în lista patrimoniului mondial UNESCO. Începând cu 2013, grădina botanică este considerată una dintre atracțiile de top din Asia de TripAdvisor Travellers' Choice Awards. A fost prima grădină declarată Grădina Anului la International Garden Tourism Awards în 2012 și a primit calificativul de trei stele Michelin în 2008.\\nGrădina Botanică a fost fondată în locul său actual în 1859 de o societate agro-horticulturală. Aceasta a jucat un rol esențial în expansiunea comerțului cu cauciuc din regiune la începutul secolului al XX-lea, când primul său director științific, Henry Nicholas Ridley, a condus cercetările în cultivarea plantei. Prin perfecționarea tehnicii de extracție a cauciucului, folosită încă în prezent, și promovarea valorii sale economice pentru plantatorii din regiune, producția de cauciuc s-a extins rapid. În anii 1920, peninsula malaeziană producea jumătate din latexul comercializat la nivel global."},{"page_url":"https://sv.wikipedia.org/wiki/Hofmeisterella","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Hofmeisterella_eumicroscopica_and_Cyrtochilum_meirax_%28as_Oncidium_meirax%29_-_Xenia_vol.jpg","page_title":"Hofmeisterella","context_page_description":"Hofmeisterella är ett släkte av orkidéer. Hofmeisterella ingår i familjen orkidéer.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%B7_%D0%97%D0%B5%D0%BC%D0%BB%D1%96_%D0%BD%D0%B0_%D0%9C%D1%96%D1%81%D1%8F%D1%86%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Delaterrelalun00vern_0171_1.png","page_title":"Із Землі на Місяць","context_page_description":"«Із Землі на Місяць» — науково-фантастичний пригодницький роман Жуля Верна, виданий у 1865 році."},{"page_url":"https://it.wikipedia.org/wiki/Sant%27Agnello","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Chiesa_dei_Frati_Cappuccini.jpg","page_title":"Sant'Agnello","context_page_description":"Sant'Agnello è un comune italiano di 8 982 abitanti della città metropolitana di Napoli in Campania.\\nÈ un piccolo centro della costiera sorrentina, ricompreso tra i comuni di Piano di Sorrento e Sorrento. Il comune è diviso in cinque rioni: rione Angri, rione Cappuccini, rione Colli di Fontanelle, rione Maiano e rione Tordara-Trasaella."},{"page_url":"https://en.wikipedia.org/wiki/Formula_E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/5_Stoffel_Vandoorne_at_Lung_Wo_Rd%2C_Man_Yiu_St_%2820190310161031%29.jpg","page_title":"Formula E","context_page_description":"Formula E, known as ABB FIA Formula E for sponsorship reasons, is a single seater motorsport championship that uses only electric cars. The series is promoted and owned by Formula E Holdings. In 2011 it was conceived in Paris by Jean Todt at the FIA, and the inaugural championship commenced in Beijing in September 2014. It is sanctioned by the FIA. Alejandro Agag is the founder and current chairman of Formula E Holdings."},{"page_url":"https://en.wikipedia.org/wiki/Elm_Grove,_Wharton_County,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Elm_Grove_TX_Sign.JPG","page_title":"Elm Grove, Wharton County, Texas","context_page_description":"Elm Grove is an unincorporated community at the northern edge of Wharton County, in the U.S. state of Texas. The very small community is situated on Farm to Market Road 2614 to the south of Eagle Lake which is in Colorado County."},{"page_url":"https://en.wikipedia.org/wiki/WAPT","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/16WAPT.png","page_title":"WAPT","context_page_description":"WAPT, virtual channel 16, is an ABC-affiliated television station licensed to Jackson, Mississippi, United States. The station is owned by the Hearst Television subsidiary of Hearst Communications. WAPT's studios and transmitter are located on Channel 16 Way in southwest Jackson. On cable, the station can be seen on Comcast Xfinity channel 4, Cable One channel 16 and Vicksburg Video channel 9. There is a high definition feed provided on Xfinity digital channel 431, Cable One digital channel 1016 and Vicksburg Video digital channel 225."},{"page_url":"https://pt.wikipedia.org/wiki/Szabla","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Cavalry-sabre.png","page_title":"Szabla","context_page_description":"Szabla em geral é um termo genérico Língua polaca para sabre. Em particular, é usado para descrever um tipo específico de arma branca polaca, semelhante a um sabre, com uma lâmina curvada e em muitos casos, com duas lâminas semelhante a uma pena. Era inicialmente usado pela cavalaria ligeira e com o tempo evoluiu para uma variedade de armas usadas com finalidade marcial e cerimonial. Até o século XIX ele também serviu como um dos símbolos dos nobres polaca, que o consideravam ser uma das mais importantes peças do vestuário tradicional masculino."},{"page_url":"https://en.wikipedia.org/wiki/Rhythm_Room","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Red001.jpg","page_title":"Rhythm Room","context_page_description":"The Rhythm Room is a roots, blues, and concert club located in Phoenix, Arizona. It is the venue of nationally known acts on an almost nightly basis. In 2003 the club was named by the Phoenix New Times as the \\"Best Club for Blues\\" in its \\"Best of Phoenix\\" awards. In July of that same year the club hosted a live recording session by an 88-year-old Robert Lockwood, Jr. The resulting performance, Legend Live, was released the following year by M.C. Records. A 2001 Hightone Records compilation, Rhythm Room Blues, also captured live performances from the venue by R. L. Burnside, Kim Wilson, Sonny Rhodes, and others.\\nSinger-songwriter Robert Earl Keen describes a concert performed at the Rhythm Room in his song, \\"Furnace Fan\\" on his 2003 release, Farm Fresh Onions. Keen, however, misidentifies the club's location as being in the adjacent community of Scottsdale, Arizona."},{"page_url":"https://id.wikipedia.org/wiki/Monchegorsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Flag_of_Monchegorsk_%28Murmansk_oblast%29.png","page_title":"Monchegorsk","context_page_description":"Monchegorsk ialah sebuah kota di Oblast Murmansk, Rusia, didirikan pada tahun 1937 dan terletak di Semenanjung Kola. Penduduk: 52242, 68652.\\nNama kota ini diturunkan dari kata Sami monce, yang berarti \\"cantik\\".\\nMonchegorsk ialah pusat produksi nikel dan tembaga, dan daerah yang mengelilingi kota ini tercemar. Di kota ini terdapat Lapangan Udara Monchegorsk milik Angkatan Udara Rusia."},{"page_url":"https://fr.wikipedia.org/wiki/Miguel_L%C3%B3pez_de_Legazpi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Miguel_L%C3%B3pez_de_Legazpi%2C_en_La_Hormiga_de_Oro.jpg","page_title":"Miguel López de Legazpi","context_page_description":"Miguel López de Legazpi né en 1502 à Zumarraga, Espagne, décédé le 20 août 1572 à Manille, connu également comme El Adelantado et El Viejo, est un conquistador basque-espagnol qui débarqua aux îles Philippines le 5 février 1565."},{"page_url":"https://hu.wikipedia.org/wiki/Finnorsz%C3%A1g_eln%C3%B6keinek_list%C3%A1ja","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Ky%C3%B6sti_Kallio.jpg","page_title":"Finnország elnökeinek listája","context_page_description":"A listában a független Finnország elnökei találhatók."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_la_Terra_Alta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Casa_Cervell%C3%B3_al_carrer_Pes_Vell.jpg","page_title":"Llista de monuments de la Terra Alta","context_page_description":"Llista de monuments de la Terra Alta inclosos en l'Inventari del Patrimoni Arquitectònic Català per la comarca de la Terra Alta. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments, conjunts o llocs històrics, els Béns Culturals d'Interès Local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_T%C3%B6ss","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Herrliberger_Kloster_T%C3%B6ss_1741.jpg","page_title":"Kloster Töss","context_page_description":"Das Kloster Töss war ein Kloster der Dominikanerinnen aus dem 13. Jahrhundert im Winterthurer Stadtteil Töss. Es wurde zu Beginn des 19. Jahrhunderts abgebrochen. An seiner Stelle steht heute die Maschinenfabrik Rieter."},{"page_url":"https://nn.wikipedia.org/wiki/Almirante_Brown-basen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/BrownStation60.JPG","page_title":"Almirante Brown-basen","context_page_description":"Almirante Brown-basen er ein argentinsk base i Antarktis kalla opp etter admiral Guillermo Brown, som danna den argentinske marinen. Den original stasjon låg i Paradise Bay, men brende ned i 1984. Basen vart delvis bygd opp att, men er berre i bruk om sommaren."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%A0%D7%99%D7%91%D7%A8%D7%A1%D7%99%D7%98%D7%AA_%D7%90%D7%95%D7%A8%D7%94%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Aarhus_Universitet_-_Lake_and_library.jpg","page_title":"אוניברסיטת אורהוס","context_page_description":"אוניברסיטת אורהוס היא אוניברסיטה ציבורית בדנמרק אשר נוסדה בשנת 1928, מה שהופך אותה לאוניברסיטה השנייה בוותיקותה במדינה, לאחר אוניברסיטת קופנהגן. אוניברסיטת אורהוס היא האוניברסיטה הגדולה ביותר בדנמרק, עם למעלה מ-44,500 סטודנטים. ברוב דירוגי האוניברסיטאות הבינלאומיים, אורהוס ממוקמת במאה הראשונות.\\nבשנת 1997 זכה פרופסור ינס סקואו מהאוניברסיטה בפרס נובל לכימיה על גילוי האנזים מעביר היון, משאבת נתרן-אשלגן. בשנת 2010, זכה דייל מורטנסן עם עמיתיו פיטר דיאמונד וכריסטופר פיסרידס בפרס נובל לכלכלה על ניתוח שווקים עם חיכוכי חיפוש.\\nבין הבוגרות ניתן למצוא את מרגרטה השנייה, מלכת דנמרק הנוכחית. האוניברסיטה חברה ברשת אוטרכט וחברה בקבוצת קוימברה וחברה בגילדת אוניברסיטאות אירופאיות עתירות מחקר."},{"page_url":"https://fr.wikipedia.org/wiki/Dragutin_Dimitrijevi%C4%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Dragutin_Dimitrijevi%C4%87-Apis%2C_ca._1900.jpg","page_title":"Dragutin Dimitrijević","context_page_description":"Dragutin Dimitrijević né le est un officier serbe, chef du service de renseignement de l'état-major, dirigeant de l'organisation secrète de la Main noire. Il est connu à cause de son rôle dans l'attentat de Sarajevo où l’archiduc François-Ferdinand a perdu la vie en 1914, événement déclencheur de la Première Guerre mondiale. Il a une branche familiale qui habite dans les alentours de Belgrade dans une petite ville qui s'appelle Smederevska Palanka."},{"page_url":"https://en.wikipedia.org/wiki/Pony_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Pony_Express_Poster.jpg","page_title":"Pony Express","context_page_description":"The Pony Express was a mail service delivering messages, newspapers, and mail using relays of horse-mounted riders that operated from April 3, 1860, to October 24, 1861, between Missouri and California in the United States of America.\\nOperated by Central Overland California and Pikes Peak Express Company, the Pony Express was a great financial investment to the U.S. During its 18 months of operation, it reduced the time for messages to travel between the Atlantic and Pacific coasts to about 10 days. Many people used the Pony Express as a communication link. It also encouraged catalogs to be created, allowing people to buy goods and have them brought by horse to the customers. It became the West's most direct means of east-west communication before the transcontinental telegraph was established, and was vital for tying the new U.S. state of California with the rest of the United States.\\nDespite a heavy subsidy, the Pony Express was not a financial success and went bankrupt in 18 months, when faster telegraph service was established. Nevertheless, it demonstrated that a unified transcontinental system of communications could be established and operated year-round."},{"page_url":"https://vi.wikipedia.org/wiki/Polystachya_nyanzensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Polystachya_nyanzensis_001_GotBot_2016.jpg","page_title":"Polystachya nyanzensis","context_page_description":"Polystachya nyanzensis là một loài thực vật có hoa trong họ Lan. Loài này được Rendle miêu tả khoa học đầu tiên năm 1905."},{"page_url":"https://ceb.wikipedia.org/wiki/Thimphu_(ulohang_dakbayan_sa_Bhutan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Thimphu-Papiermanufaktur-08-2015-gje.jpg","page_title":"Thimphu (ulohang dakbayan sa Bhutan)","context_page_description":"Thimphu maoy ang ulohang dakbayan sa Bhutan. Ang Thimphu nahimutang sa distrito sa Thimphu Dzongkhag, sa kasadpang bahin sa nasod. 2,320 metros ibabaw sa dagat kahaboga ang nahimutangan sa Thimphu, ug adunay 98,676 ka molupyo.\\nAng yuta palibot sa Thimphu kay kabukiran sa kasadpan, apan sa sidlakan nga kini mao ang kabungtoran. Thimphu nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 3,280 ka metro ug 2.7 km sa sidlakan sa Thimphu. Walay laing lungsod sa palibot niini.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Thimphu. Dunay mga 90 ka tawo kada kilometro kwadrado sa palibot sa Thimphu medyo hilabihan populasyon. Ang klima boreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Mayo, sa 12 °C, ug ang kinabugnawan Enero, sa 4 °C. Ang kasarangang pag-ulan 1,550 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 319 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 1 milimetro."},{"page_url":"https://pt.wikipedia.org/wiki/Alexandre,_o_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Battle_of_Issus_mosaic_-_Museo_Archeologico_Nazionale_-_Naples_2013-05-16_16-25-06_BW.jpg","page_title":"Alexandre, o Grande","context_page_description":"Alexandre III da Macedônia ou Macedónia, comumente conhecido como Alexandre, o Grande ou Alexandre Magno, foi rei do reino grego antigo da Macedônia e um membro da dinastia argéada. Nascido em Pela em 356 a.C., o jovem príncipe sucedeu a seu pai, o rei Filipe II, no trono com vinte anos de idade. Ele passou a maior parte de seus anos no poder em uma série de campanhas militares sem precedentes através da Ásia e nordeste da África. Até os trinta anos havia criado um dos maiores impérios do mundo antigo, que se estendia da Grécia para o Egito e ao noroeste da Índia. Morreu invicto em batalhas e é considerado um dos comandantes militares mais bem sucedidos da história.\\nDurante sua juventude, Alexandre foi orientado pelo filósofo Aristóteles até aos 16 anos. Depois que Filipe foi assassinado em 336 a.C., Alexandre sucedeu a seu pai no trono e herdou um reino forte e um exército experiente. Havia sido premiado com o generalato da Grécia e usou essa autoridade para lançar o projeto pan-helênico de seu pai liderando os gregos na conquista da Pérsia. Em 334 a.C., invadiu o Império Aquemênida, governando a Ásia Menor, e começou uma série de campanhas que durou dez anos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Nahrendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bahnhof_Goehrde_0178.jpg","page_title":"Liste der Baudenkmale in Nahrendorf","context_page_description":"In der Liste der Baudenkmale in Nahrendorf sind die Baudenkmale der niedersächsischen Gemeinde Nahrendorf und ihrer Ortsteile aufgelistet. Der Stand der Liste ist das Jahr 1981. Eine zwischenzeitliche Löschung hier noch aufgeführter Objekte oder auch später hinzugekommene Denkmale sind also in der Regel nicht berücksichtigt."},{"page_url":"https://nl.wikipedia.org/wiki/Dichaea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Dichaea_picta_-_fl_2.jpg","page_title":"Dichaea","context_page_description":"Dichaea is een groot geslacht met meer dan honderd soorten orchideeën uit de onderfamilie Epidendroideae.\\nHet is het grootste geslacht in de subtribus Zygopetalinae, tevens het geslacht met de meest uitgesproken kenmerken, maar toch vrijwel onbekend bij orchideeënliefhebbers.\\nHet zijn epifytische planten van vochtige en beschaduwde tropische montane regenwouden uit Midden- en Zuid-Amerika, met voor de subtribus ongewone bladstengels met twee rijen kleine, overstaande bladeren, en een bloeiwijze met kleine maar welruikende bloemen."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%99%D7%90%D7%98_4_HP","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Fiat4HP_motor.jpg","page_title":"פיאט 4 HP","context_page_description":"פיאט 4 HP היא מכונית משפחתית, בתצורת קבריולט, 2 מושבים, מתוצרת קונצרן הרכב האיטלקי פיאט אשר יוצרה בין השנים 1899–1900.\\nדגם ה-\\"פיאט 4 HP\\" היה הדגם הראשון של מכונית אשר יוצר על ידי חברת פיאט.\\nעקב אורכה, מוגדרת \\"פיאט 4 HP\\" כ-מכונית מיקרו.\\nסך הכול יוצרו 24 יחידות."},{"page_url":"https://vi.wikipedia.org/wiki/Bathybatini","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Bathybates_ferox.jpg","page_title":"Bathybatini","context_page_description":"Bathybatini là tông của họ Cá hoàng đế Châu Phi và là loài đặc hữu ở hồ Tanganyika."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_orgues_d%27Auvergne_class%C3%A9s_dans_la_base_Palissy_des_monuments_historiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Saugues%2CSaint-M%C3%A9dard%2Corgue.jpg","page_title":"Liste des orgues d'Auvergne classés dans la base Palissy des monuments historiques","context_page_description":"Cette liste prend en compte les orgues d'Auvergne classés uniquement, au titre objet ou immeuble, que ce soit pour leur buffet ou leur partie instrumentale et répertoriés dans la base Palissy des Monuments historiques de France. La section Reprises recense les modifications les plus importantes. Dans certains cas le classement du buffet intègre également la tribune. À défaut de précision, le classement est réputé acquis au titre objet mais les initiales I.D. signifient au titre Immeuble par Destination et I. au titre Immeuble."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%92%D0%B8%D1%81%D0%B5%D0%BD%D1%82%D0%B5_%D0%AD%D1%81%D1%82%D0%B0%D0%B2%D0%B8%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Vicente_Estavillo_%28cropped%29.JPG","page_title":"Висенте Эставило","context_page_description":"Висенте Эставило — футболбози уругвайӣ, маснадашро анҷом додааст, зарбазананда, муррабӣ."},{"page_url":"https://en.wikipedia.org/wiki/Fo_Guang_Shan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Venerable_Hsin_Ting_At_Hsi_Lai_Temple%2C_2012.png","page_title":"Fo Guang Shan","context_page_description":"Fo Guang Shan is an international Chinese Mahāyāna Buddhist organization and monastic order based in Taiwan that practices Humanistic Buddhism. The headquarters, Fo Guang Shan Monastery is located in Dashu District, Kaohsiung, and is the largest Buddhist monastery in Taiwan. The organization is also one of the largest charity organizations in Taiwan. The organization's counterpart for laypeople is known as the Buddha's Light International Association.\\nFounded in 1967 by Hsing Yun, the order promotes Humanistic Buddhism and is known for its efforts in the modernization of Chinese Buddhism. The order is famous for its use of technology and its temples are often furnished with the latest equipment. Hsing Yun's stated position for Fo Guang Shan is that it is an \\"amalgam of all Eight Schools of Chinese Buddhism\\". The Fo Guang Shan order has an associated college, Fo Guang University, which offers undergraduate and postgraduate degrees in both Buddhist Studies and secular fields."},{"page_url":"https://ca.wikipedia.org/wiki/Estatut_pol%C3%ADtic_del_S%C3%A0hara_Occidental","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bilbao_-_Ayuntamiento_9.JPG","page_title":"Estatut polític del Sàhara Occidental","context_page_description":"L'estatut polític del Sàhara Occidental i la qüestió de la seva sobirania són objectes de controvèrsia. És un dels disset integrants de la llista de les Nacions Unides de territoris no autònoms sota supervisió de la seva Comitè Especial de Descolonització, i encara que per l'ONU la potencia administradora és Espanya, en retirar-se del territori en 1976 aquest país va renunciar a tota responsabilitat internacional sobre el Sahara Occidental. La seva sobirania és reclamada pel Regne del Marroc i la República Àrab Saharaui Democràtica, que es disputen el control de la totalitat del territori."},{"page_url":"https://sv.wikipedia.org/wiki/N%C3%B6dinge_f%C3%B6rsamling","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/N%C3%B6dinge_kyrka.JPG","page_title":"Nödinge församling","context_page_description":"Nödinge församling är en församling i Göta Älvdalens kontrakt i Göteborgs stift. Församlingen ligger i Ale kommun i Västra Götalands län och utgör ett eget pastorat."},{"page_url":"https://no.wikipedia.org/wiki/Lee_Daniels","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Lee-Daniels-2010-SAG-Awards.jpg","page_title":"Lee Daniels","context_page_description":"Lee Louis Daniels er en amerikansk skuespiller, filmprodusent og filmregissør, mest kjent for å ha produsert Monster's Ball og regissert Precious.\\nDaniels ble født i Philadelphia og studerte på Lindenwood College i St Chales i Missouri. Han begynte sin filmkarriere som rollebesetter, og etter et tilfeldig møte med en produsent endte han opp med å jobbe med Prince-filmene Purple Rain og Under a Cherry Moon.\\nDaniels grunnla Lee Daniels Entertainment, etter å ha jobbet en periode som produksjonsassistent. Selskapets første film var Monster's Ball som ble en suksess både blant kritikere og publikum, og som ga Halle Berry en Oscar for beste kvinnelige hovedrolle.\\nNeste film var The Woodsman med Kevin Bacon i hovedrollen. Filmen hadde premiere under Sundance festivalen i 2004. Den var nominert til tre Independent Spirit Awards i 2005, og fikk en CICAE Arthouse Prize under Filmfestivalen i Cannes.\\nDaniels regidebuterte i 2006 med filmen Shadowboxer, en film med bl.a. Helen Mirren og Joseph Gordon-Levitt. Daniels ble nominert for beste nye regissør under San Sebastian Film Fetival.\\nDaniels ble Oscar-nominert for regien av filmen Precious i 2010."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%8E%E5%8C%97%E8%B1%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Panthera_pardus_japonensis_JdP.jpg","page_title":"华北豹","context_page_description":"华北豹也称中国豹，是一种大型猫科食肉动物，是豹的一个亚种，为中国特有，同时被国际自然保护联盟列为极危物种。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%82%D8%AF_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Chun_Doo-hwan.png","page_title":"عقد 1980","context_page_description":"عقد 1980 هو عقد من التقويم الميلادي بدأ في 1 يناير عام 1980، وانتهى في 31 ديسمبر عام 1989."},{"page_url":"https://de.wikipedia.org/wiki/Mal%C3%BD_H%C3%A1j","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Mal%C3%BD_H%C3%A1j_-_View_from_Rudolf%C5%AFv_k%C3%A1men_%283%29.jpg","page_title":"Malý Háj","context_page_description":"Malý Háj ist ein Ortsteil von Hora Svaté Kateřiny im Okres Most in Tschechien. Der Ort entstand als Waldhufendorf, dessen Name sich wohl aus Kleiner Hain entwickelt hat und seine Lage inmitten des Waldes mit wenigen Häusern bezeichnet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%BA%D0%BE%D0%B1%D1%81%D0%B5%D0%BD,_%D0%9A%D0%B0%D1%80%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Carl_Jacobsen_%28Jerndorff%29.jpg","page_title":"Якобсен, Карл","context_page_description":"Карл Кристиан Хиллман Якобсен — датский предприниматель и меценат, сын основателя концерна Carlsberg Якоба Кристиана Якобсена."},{"page_url":"https://en.wikipedia.org/wiki/LAMP2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/PBB_GE_LAMP2_203042_at_fs.png","page_title":"LAMP2","context_page_description":"Lysosome-associated membrane protein 2 also known as CD107b, is a human gene. Its protein, LAMP2, is one of the lysosome-associated membrane glycoproteins.\\nThe protein encoded by this gene is a member of a family of membrane glycoproteins. This glycoprotein provides selectins with carbohydrate ligands. It may play a role in tumor cell metastasis. It may also function in the protection, maintenance, and adhesion of the lysosome. Alternative splicing of the gene produces three variants - LAMP-2A, LAMP-2B and LAMP-2C. LAMP-2A is the receptor for chaperone-mediated autophagy. Recently it has been determined that antibodies against LAMP-2 account for a fraction of patients who get a serious kidney disease termed focal necrotizing glomerulonephritis.\\nLAMP-2B is associated with Danon disease."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EB%A7%88%EC%9E%90%ED%86%A0%EC%97%AD_(%EC%98%A4%EC%82%AC%EC%B9%B4%EC%8B%9C_%EA%B3%A0%EC%86%8D_%EC%A0%84%EA%B8%B0%EA%B6%A4%EB%8F%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Platform_for_Imazatosuji_subway_line_of_Imazato_Station.JPG","page_title":"이마자토역 (오사카시 고속 전기궤도)","context_page_description":"이마자토역은 오사카부 오사카시 히가시나리구에 있는 철도역이다."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_du_Bon_Pasteur_(Pakila)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Church_of_the_Good_Shepherd_Helsinki_1.jpg","page_title":"Église du Bon Pasteur (Pakila)","context_page_description":"L'église du Bon Pasteur, jusqu'en 2002 église de Pakila, est une église luthérienne située dans le quartier de Pakila à Helsinki."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D1%80,_%D0%A1%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Bernhardt_as_Joan_of_Arc.jpg","page_title":"Бернар, Сара","context_page_description":"Сара Бернар — французин актриса. XX бӀешо долалуш цунах олура «исторехь массарелла гӀаръялла актриса». Дуьххьара дӀа цуьнан цӀе ягӀара Европехь 1870-гӀу шерашкахь. Цул тӀехьа цуьнан гастролеш триумфаца дӀаягӀара Америкехь. Цо дукхахьолехь ловзийра ладаме драматически ролеш."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%80%D0%B8%D0%BD%D1%8C_%D0%9B%D0%B5%D0%BE%D0%BD%D1%96%D0%B4_%D0%90%D1%80%D1%82%D0%B5%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/BrynnLA456.jpg","page_title":"Бринь Леонід Артемович","context_page_description":"Леонід Артемович Бринь — радянський і український скульптор-монументаліст."},{"page_url":"https://de.wikipedia.org/wiki/Kanton_Saint-Jean-du-Gard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Cantonsaintjeandugard.JPG","page_title":"Kanton Saint-Jean-du-Gard","context_page_description":"Der Kanton Saint-Jean-du-Gard war ein französischer Kanton im Département Gard und im Arrondissement Alès. Er hatte den Hauptort Saint-Jean-du-Gard und wurde 2015 im Rahmen der landesweiten Neugliederung der Kantone aufgelöst.\\nZum Kanton gehörten drei Gemeinden:"},{"page_url":"https://ceb.wikipedia.org/wiki/Corsley","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Corsley_Village_from_Cley_Hill_%28geograph_2463107%29.jpg","page_title":"Corsley","context_page_description":"Distrito ang Corsley sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Wiltshire ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 150 km sa kasadpan sa London ang ulohan sa nasod.\\nAng klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 16 °C, ug ang kinabugnawan Disyembre, sa 1 °C."},{"page_url":"https://en.wikipedia.org/wiki/Gordon_Mydland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Gordon_Mydland.png","page_title":"Gordon Mydland","context_page_description":"Gordon J. Mydland is a combat veteran, a former State Senator, former states attorney, former Attorney General, former South Dakota state Circuit Court Judge."},{"page_url":"https://vi.wikipedia.org/wiki/Cenotaph_(H%E1%BB%93ng_K%C3%B4ng)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Remembrance_Day_in_Hong_Kong_1.JPG","page_title":"Cenotaph (Hồng Kông)","context_page_description":"Cenotaph là một đài tưởng niệm chiến tranh được xây dựng vào năm 1923, nằm giữa quảng trường Statue và Tòa thị chính ở Trung Hoàn, Hồng Kông. Nơi đây tưởng nhớ những liệt sĩ phục vụ cho quân đội Anh tại Hồng Kông trong cả hai cuộc chiến tranh thế giới. Được xây dựng bằng đá, nó là một bản sao gần như chính xác của đài tưởng niệm Cenotaph tại Whitehall, Luân Đôn thuộc Anh Quốc. Công trình được liệt kê là di tích pháp định của Hồng Kông theo Pháp lệnh Cổ vật và Di tích."},{"page_url":"https://it.wikipedia.org/wiki/Union_Pacific_Big_Boy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/UP_Big_Boy_4014.jpg","page_title":"Union Pacific Big Boy","context_page_description":"La locomotiva a vapore Big Boy è una gigantesca locomotiva articolata della Union Pacific Railroad, oggi non più in servizio, della classe 4000 costruita dalla American Locomotive Company.\\nDopo un restauro conservativo, nel 2019 l'unità numero 4014 è tornata operativa con fini rievocativi."},{"page_url":"https://uk.wikipedia.org/wiki/Adobe_FrameMaker","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Adobe_FrameMaker_v11_icon.png","page_title":"Adobe FrameMaker","context_page_description":"Adobe FrameMaker — настільна видавнича система, що базується на структурованій розмітці документа, на відміну від систем, що ґрунтуються на подібному до верстака графічному інтерфейсі."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BD%D1%8F%D1%87%D0%BD%D0%B5_%D0%B7%D0%B0%D1%82%D0%B5%D0%BC%D0%BD%D0%B5%D0%BD%D0%BD%D1%8F_4_%D1%81%D1%96%D1%87%D0%BD%D1%8F_2011_%D1%80%D0%BE%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SE1973Jan04A.png","page_title":"Сонячне затемнення 4 січня 2011 року","context_page_description":"Сонячне затемнення 4 січня 2011 року — часткове сонячне затемнення, що спостерігалося у значній фазі на території Європи та західної Росії. Менші фази затемнення було видно на території північної Африки, Середньої Азії та Сибіру. Точка максимальної фази затемнення припала на північне узбережжя Швеції."},{"page_url":"https://vec.wikipedia.org/wiki/Torricella_Sicura","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Torricella1.jpg","page_title":"Torricella Sicura","context_page_description":"Torricella Sicura el xe on comun n'te la provincia de Teramo chel fa parte de la rejon Abruso"},{"page_url":"https://lt.wikipedia.org/wiki/1991_m._TSRS_referendumas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Soviet_Union_referendum%2C_1991.jpg","page_title":"1991 m. TSRS referendumas","context_page_description":"Referendumas dėl Tarybų Sąjungos ateities – 1991 m. kovo 17 d. vykęs referendumas klausimu:\\nAr laikote būtinu Tarybų Socialistinių Respublikų Sąjungos išsaugojimą kaip atnaujintą lygiateisių suverenių respublikų federaciją, kurioje žmogaus teisės būtų pilnai garantuotos?\\nRusų kalba: Считаете ли Вы необходимым сохранение Союза Советских Социалистических Республик как обновлённой федерации равноправных суверенных республик, в которой будут в полной мере гарантироваться права и свободы человека любой национальности?\\nKazachijos TSR biuleteniuose klausimo frazė „lygiateisės suverenios respublikos“ buvo pakeista į „lygiateisės suverenios valstybės“. Rusijos TFSR lygiagrečiai vyko referendumas dėl Rusijos prezidento institucijos įkūrimo.\\nReferendumo tikslas buvo Suverenių Valstybių Sąjungos projekto patvirtinimas. Referendumą boikotavo Armėnijos TSR, Estijos TSR, Gruzijos TSR, Latvijos TSR, Lietuvos TSR ir Moldavijos TSR. Nuosaikiosios jėgos Lietuvoje referendumą surengė atskirose vietovėse, kur jame dalyvavo ir už TSRS išsaugojimą pasisakė virš pusės milijono Lietuvos gyventojų."},{"page_url":"https://fr.wikipedia.org/wiki/Matelas_immobilisateur_%C3%A0_d%C3%A9pression","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Vakuummatratze.jpg","page_title":"Matelas immobilisateur à dépression","context_page_description":"Le matelas immobilisateur à dépression, ou MID, est un dispositif permettant d'immobiliser entièrement une personne, et en particulier la hanche et la colonne vertébrale. Il est aussi utilisé pour conditionner les grands brûlés, afin de limiter leurs mouvements et de les isoler du froid. Il a été inventé par Jean Loeb et Charles Haeberlé, qui lui ont donné le nom de matelas « coquille » ; on utilise d'ailleurs le terme « coquiller » pour dire « mettre dans un MID et immobiliser ».\\nIl se compose d'une enveloppe de toile étanche, lavable et désinfectable, qui contient des billes de polystyrène, et d'une vanne. Lorsque le matelas est sous air, les billes bougent librement et on peut mouler le matelas autour de la victime. Lorsque l'on aspire l'air avec une pompe, la pression atmosphérique plaque les billes les unes contre les autres et le matelas devient rigide."},{"page_url":"https://de.wikipedia.org/wiki/Chien-Chi_Chang","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Chang_Chien_Chi_2009.jpg","page_title":"Chien-Chi Chang","context_page_description":"Chien-Chi Chang ist ein taiwanischer Fotograf und Fotojournalist. Er ist Mitglied der Fotoagentur Magnum Photos und lebt in Graz.\\nNach Studien in Taiwan und den USA arbeitete Chang in den frühen 1990er-Jahren als Fotoreporter für die US-Zeitungen Seattle Times und Baltimore Sun. Seit 1995 fotografiert Chang für die Elite-Fotoagentur Magnum Photos, 2001 wurde er dort als Vollmitglied aufgenommen.\\nIn seinen Fotoserien kristallisieren sich die Themen Bindung und Entwurzelung als zentrale Motive heraus. Große internationale Anerkennung erfuhr Chang mit seiner Fotoserie „The Chain“, die 2001 im Pavillon von Taiwan auf der Biennale Venedig gezeigt wurde. Die Installation „The Chain“ bildete auf beinahe lebensgroßen Schwarzweißfotografien Insassen der psychiatrischen Klinik Long Ta Fang in Taiwan ab, die paarweise über eine Kette miteinander verbunden sind.\\n„The Chain“ wurde auch auf der Biennale von São Paulo gezeigt, wo Chang in eine diplomatische Kontroverse verwickelt wurde, die von der Gruppe monochrom durch ihren fiktiven Künstler Georg Paul Thomann thematisiert wurde."},{"page_url":"https://vi.wikipedia.org/wiki/Ti%E1%BB%81n_gi%E1%BA%A5y","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Billets_de_5000.jpg","page_title":"Tiền giấy","context_page_description":"Tiền giấy, thường được gọi là giấy bạc ngân hàng, là một công cụ có thể chuyển nhượng được, một kỳ phiếu do một ngân hàng phát hành phải trả cho người cầm nó, được sử dụng làm tiền tệ, và theo nhiều phạm vi pháp lý, được sử dụng làm tiền tệ chính thức. Cùng với tiền kim loại, tiền giấy tạo thành các hình thức tiền mặt của tất cả các loại tiền tệ hiện đại. Ngoại trừ các loại tiền làm bằng kim loại quý có giá trị cao để kỷ niệm và không đưa vào lưu thông, tiền xu kim loại thường được sử dụng cho các đơn vị tiền tệ có giá trị thấp hơn còn tiền giấy được sử dụng cho những mệnh giá cao hơn.\\nBan đầu, giá trị của tiền được xác định bởi giá trị nội tại mà đồng tiền đó được đúc, như bạc hay vàng. Tuy nhiên, mang theo trong người nhiều kim loại quý như thế thường phiền toái và rất nguy hiểm. Để thay thế, tiền giấy đã được phát hành. Trong thuật ngữ tài chính, một tờ giấy bạc là một tờ giấy hứa trả cho người nào đó tiền. Ban đầu, các đồng giấy bạc là một lời hứa trả cho người mang nó một khoản kim loại quý được chứa trong các kho ngầm ở đâu đó. Bằng cách này, giá trị của kim loại được chứa ở kho đã ủng hộ giấy bạc có thể chuyển đổi quyền sở hữu để đổi lấy hàng hóa hoặc dịch vụ."},{"page_url":"https://de.wikipedia.org/wiki/St._Oswald_(Tannenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/St_Oswald_Thannenberg_2.jpg","page_title":"St. Oswald (Tannenberg)","context_page_description":"Die katholische Pfarrkirche St. Oswald in Tannenberg, einem Ortsteil der Gemeinde Burggen im oberbayerischen Landkreis Weilheim-Schongau, wurde von 1819 bis 1827 errichtet. Die Kirche an der Stelle eines Vorgängerbaus, am nördlichen Ende und an der höchsten Stelle des Dorfes, ist ein geschütztes Baudenkmal."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B0%D1%80%D0%B1%D1%80%D1%8E%D0%BA%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Flag_City_of_Saarbr%C3%BCcken_%28Saarbr%C3%BCcken_County%2C_Saar%2C_Germany%29.png","page_title":"Саарбрюкен","context_page_description":"Саарбрю́кен — місто на південному заході Німеччини, столиця землі Саарланд. Населення становить 180 741 ос."},{"page_url":"https://da.wikipedia.org/wiki/Brande","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Brande_-_Storegade.jpg","page_title":"Brande","context_page_description":"Brande er en by i Midtjylland med 7.398 indbyggere, beliggende 12 km sydvest for Ejstrupholm, 14 km nordvest for Give, 26 km syd for Herning og 26 km syd for Ikast. Byen ligger i Ikast-Brande Kommune og hører til Region Midtjylland.\\nBrande Å løber gennem byen - bl.a. gennem Anlægget - og udmunder 3 km nordvest for byen i Skjern Å. Denne løber på sin vej nord om byen gennem to opdæmmede søer. Vest for Brande ligger Brandlund Bakker. 5 km nord for byen starter et større hedeområde.\\nBestseller, Brandtex, Biomar og Siemens Wind Power har hovedsæde i Brande. Byen huser også en del mellemstore virksomheder.\\nBestseller offentliggjorde i 2018 planer om opførelse af en ny nordøstlig bydel, Bestseller Village & Tower, og en kommende højhusbygning Bestseller-tårnet på 317 meters højde."},{"page_url":"https://en.wikipedia.org/wiki/Siloam_inscription","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Siloam_inscription.jpg","page_title":"Siloam inscription","context_page_description":"The Siloam inscription or Shiloah inscription or Silwan inscription, known as KAI 189, is a passage of inscribed text found in the Siloam tunnel which brings water from the Gihon Spring to the Pool of Siloam, located in the City of David in East Jerusalem neighborhood of Shiloah or Silwan. The inscription records the construction of the tunnel, which has been dated to the 8th century BCE on the basis of the writing style. It is the only known ancient inscription from the wider region which commemorates a public construction work, despite such inscriptions being commonplace in Egyptian and Mesopotamian archaeology.\\nIt is among the oldest extant records of its kind written in Hebrew using the Paleo-Hebrew alphabet, a regional variant of the Phoenician alphabet.\\nThe inscription is at permanent exhibition at the Istanbul Archaeology Museum."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Chaussade","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Ch%C3%A2teau_de_La_Chaussade_%C3%A0_Gu%C3%A9rigny%2C_Ni%C3%A8vre%2C_France.JPG","page_title":"Château de la Chaussade","context_page_description":"Le château de la Chaussade est situé sur la commune de Guérigny, dans le département de la Nièvre. Le château fait l’objet d’une inscription au titre des monuments historiques depuis le 11 octobre 2002."},{"page_url":"https://it.wikipedia.org/wiki/Tosos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Tosos_02.jpg","page_title":"Tosos","context_page_description":"Tosos è un comune spagnolo di 192 abitanti situato nella comunità autonoma dell'Aragona."},{"page_url":"https://it.wikipedia.org/wiki/Haarlem","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Haarlem_Bavo.JPG","page_title":"Haarlem","context_page_description":"Haarlem /'ha:rləm/ è una città dei Paesi Bassi di 159.340 abitanti capoluogo della provincia dell'Olanda Settentrionale. La municipalità di Haarlem comprende anche il villaggio di Spaarndam.\\nLa città è bagnata dal fiume Spaarne, si trova circa 20 km a ovest di Amsterdam ed è a fianco delle dune che precedono il mare del Nord.\\nÈ il centro di una regione di coltivazione dei fiori, specialmente tulipani.\\nIl motto di Haarlem è Vicit vim virtus."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BA%9A%E7%BD%97%E9%92%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Jarocin_ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Marcina.jpg","page_title":"亚罗钦","context_page_description":"亚罗钦是位于波兰中部大波兰省的一个镇，人口26,029人。亚罗钦是亚罗钦县的县治，该县自1999年起归属大波兰省管辖，此前则归属于卡利什省。"},{"page_url":"https://mg.wikipedia.org/wiki/Jeri_Ellsworth","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/You%27re_one_baaad_cat.jpg","page_title":"Jeri Ellsworth","context_page_description":"Jeri Ellsworth dia injeniera, mpanao asa soratra mizaka ny zom-pirenen'i Etazonia teraka ny 14 Aogositra 1974 tao Yamhill"},{"page_url":"https://lv.wikipedia.org/wiki/Mihails_Hercbergs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Michael_Herzberg.jpg","page_title":"Mihails Hercbergs","context_page_description":"Mihails Hercbergs ir vācu šaha problēmists."},{"page_url":"https://en.wikipedia.org/wiki/The_Rex,_Berkhamsted","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Berkhamsted_rex_frieze1.jpg","page_title":"The Rex, Berkhamsted","context_page_description":"The Rex is a cinema in the town of Berkhamsted, Hertfordshire, England. Designed in the art deco style by David Evelyn Nye in 1936, the cinema opened to the public in 1938. After 50 years of service, the cinema closed in 1988 and became derelict. The building was listed Grade II by English Heritage, and following a campaign to save the Rex by a local entrepreneur, the cinema re-opened to the public in 2004.\\nToday, the cinema is a fully operational independent cinema, screening films 362 days of the year. The programme ranges from vintage classic films to modern blockbusters which often attract large box office queues."},{"page_url":"https://fr.wikipedia.org/wiki/Behemoth","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Behemoth_au_Hellfest_2010.jpg","page_title":"Behemoth","context_page_description":"Behemoth est un groupe de black et death metal polonais, originaire de Gdańsk. Formé en 1991, le groupe est considéré comme ayant joué un rôle important dans l'émergence du metal extrême underground polonais. La plupart des albums de Behemoth sont axés sur des thèmes sataniques dont des références à des auteurs tels que Aleister Crowley, John Milton et William Blake.\\nDepuis la fin des années 1990, le groupe adopte un style de black metal traditionnel, avec des paroles rédigées par le chanteur Nergal et Krzysztof Azarewicz. À la suite de la parution de l'album Satanica, en 1999, le groupe montre sa présence sur la scène death metal. Bien que Behemoth soit catégorisé death, black ou thrash metal, Nergal mentionne ne pas apprécier que le groupe soit catégorisé."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8C%C3%ADnsk%C3%A1_ob%C4%8Dansk%C3%A1_v%C3%A1lka","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Yangtze_Crossing_Monument_-_detail_-_P1070673.JPG","page_title":"Čínská občanská válka","context_page_description":"Čínská občanská válka byla občanská válka probíhající na území Číny mezi vládou Čínské republiky, vedené Kuomintangem, a Komunistickou stranou Číny. Její hlavní fáze trvala s přestávkami od srpna 1927 do srpna 1950. Před rokem 1927 obě strany společně tvořily První sjednocenou frontu, která měla za cíl ukončit éru militaristů. Nicméně tato koalice se rozpadla během Severního pochodu. Obecně se čínská občanská válka dělí na dvě fáze s přestávkou v letech 1937–1945, kdy obě strany vytvořily Druhou sjednocenou frontu a společně bojovaly proti Japonsku. Na počátku války a v průběhu její první fáze měl navrch Kuomintang, který ovládal téměř celou Čínu, avšak po odražení japonské invaze přebrali iniciativu komunisté.\\nV roce 1949 komunisté kontrolovali celé území pevninské Číny, na kterém vyhlásili Čínskou lidovou republiku. Vláda Čínské republiky ustoupila na Tchaj-wan. Napětí mezi oběma stranami na opačných březích Tchajwanského průlivu stále trvá, přičemž jak Čínská lidová republika, tak Čínská republika se oficiálně prohlašují za legitimního reprezentanta celé Číny. Nebylo podepsáno žádné příměří ani mírová smlouva, debaty o přesném datu ukončení války tak dále trvají."},{"page_url":"https://nl.wikipedia.org/wiki/Varenne-Saint-Germain","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Varenne-saint-germain_mairie.jpg","page_title":"Varenne-Saint-Germain","context_page_description":"Varenne-Saint-Germain is een gemeente in het Franse departement Saône-et-Loire en telt 549 inwoners. De plaats maakt deel uit van het arrondissement Charolles."},{"page_url":"https://da.wikipedia.org/wiki/Frederikke_L%C3%B8venskiold","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Frederikke_L%C3%B8venskiold.png","page_title":"Frederikke Løvenskiold","context_page_description":"Margrethe Frederikke Sophie Løvenskiold var en dansk komponist, søster til statholder i Norge Severin Løvenskiold.\\nHun var født i Norge, men boede en del af sin barndom hos sine slægtninge på Løvenholm slot i Vestsjælland. Der udfoldede sig et rigt musikliv på slottet, og Frederikke var en vigtig del af det, sammen med sine fætre Carl og Eggert, som hun i 1812 blev gift med. Eggert havde arvet et jernværk i Norge efter sin far, og Frederikke var flyttet hjem til sine forældre og der traf de hinanden igen efter ungdomsårene og giftede sig. En af deres sønner var den senere balletkomponist Herman Severin Løvenskiold.\\nI 1829 flyttede familien permanent til Danmark idet Eggert Løvenskiold fik posten som overførster for Nordsjælland og Bornholm. Familien bosatte sig i embedsboligen ved bredden af Furesø. I de følgende år havde den musikalske familie øjensynlig tæt kontakt til tidens ”professionelle” musikpersonligheder, som C.E.F. Weyse, Kuhlau, Hartmann, Niels W. Gade, H.S. Paulli og Edvard Helsted.\\nDet første vidnedsbyrd om at Frederikke Løvenskiold komponerede stammer fra ca. 1820."},{"page_url":"https://nl.wikipedia.org/wiki/Cust%C3%B3dia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Bandeira_de_Cust%C3%B3dia%2C_PE.jpg","page_title":"Custódia","context_page_description":"Custódia is een gemeente in de Braziliaanse deelstaat Pernambuco. De gemeente telt 33.874 inwoners.\\nDe gemeente grenst aan Betânia, Flores, Carnaíba, Afogados da Ingazeira, Iguaraci, Sertânia, Ibimirim en Floresta."},{"page_url":"https://fr.wikipedia.org/wiki/Globicephala","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Spyhopping.JPG","page_title":"Globicephala","context_page_description":"Les globicéphales sont un genre de cétacés odontocètes de la famille des delphinidés. Ils sont parfois appelés « dauphins-pilotes » car on les voit fréquemment dans le sillage ou à l’étrave des navires. Dauphins au melon frontal fortement développé, ce sont des animaux sociaux qui se déplacent le plus souvent en bandes pouvant aller d'une dizaine à plusieurs centaines d'individus."},{"page_url":"https://it.wikipedia.org/wiki/Ophthalmolepis_lineolata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Ophthalmolepis_lineolata_PC079127.jpg","page_title":"Ophthalmolepis lineolata","context_page_description":"Ophthalmolepis lineolata, unica specie del genere Ophthalmolepis, è un pesce di acqua salata appartenente alla famiglia Labridae."},{"page_url":"https://ro.wikipedia.org/wiki/Isar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Isar_Georgenstein.jpg","page_title":"Isar","context_page_description":"Râul Isar, cu o lungime de 295 km, este un afluent a Dunării și curge pe teritoriul Austriei și Germaniei. După Dunăre, Inn și Main, Isar este al patrulea râu, ca lungime, din Bavaria."},{"page_url":"https://de.wikipedia.org/wiki/Friedensvertrag_von_Versailles","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Palais_des_nations.jpg","page_title":"Friedensvertrag von Versailles","context_page_description":"Der Friedensvertrag von Versailles wurde bei der Pariser Friedenskonferenz 1919 im Schloss von Versailles von den Mächten der Triple Entente und ihren Verbündeten bis Mai 1919 ausgehandelt. Mit der Unterzeichnung des Friedensvertrags endete der Erste Weltkrieg auf der völkerrechtlichen Ebene. Sie war zugleich der Gründungsakt des Völkerbunds.\\nBereits am 11. November 1918 hatte der Waffenstillstand von Compiègne die Kampfhandlungen des Ersten Weltkriegs beendet, nicht aber den Kriegszustand. Die deutsche Delegation durfte an den Verhandlungen nicht teilnehmen, sondern konnte erst am Schluss durch schriftliche Eingaben wenige Nachbesserungen des Vertragsinhalts erwirken. Der Vertrag konstatierte die alleinige Verantwortung Deutschlands und seiner Verbündeten für den Ausbruch des Weltkriegs und verpflichtete es zu Gebietsabtretungen, Abrüstung und Reparationszahlungen an die Siegermächte. Nach ultimativer Aufforderung unterzeichnete Deutschland am 28. Juni 1919 den Vertrag unter Protest im Spiegelsaal von Versailles. Nach der Ratifizierung und dem Austausch der Urkunden trat er am 10. Januar 1920 in Kraft."},{"page_url":"https://da.wikipedia.org/wiki/Ashdod","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Ashdod_Marina_Aerial_View.jpg","page_title":"Ashdod","context_page_description":"Ashdod er en by i Israel. Byen ligger ved Middelhavskysten syd for Tel Aviv.\\nAshdod har 220.174 indbyggere, og indbyggertallet vokser hurtigt.\\nDet moderne Ashdod er først grundlagt omkring 1955-57; men siden 1948 har der været et immigrant- og flygtningecenter på stedet. Ashdod er i dag en moderne og travl industriby med Israels største og vigtigste dybvandshavn. Med bygningen af et stort kraftværk, adskillige fabrikker og åbningen af havnen i 1965 er byen vokset kraftigt. I Ashdod er der også elektronikfabrikker, olie- og tekstilindustri samt anden tung industri.\\nByen har en fin strand med promenade og restauranter.\\nDet historiske Ashdod, Tel Ashdod, ligger sydøst for byen og har haft stor historisk betydning, men der er kun få rester tilbage af den gamle filistæiske by. Ashdod har været stedet for blodige slag siden bibelsk tid. Under Uafhængighedskrigen i 1948 beskyttede egypterne det dengang arabiske område, inden de senere blev slået tilbage og de oprindelige indbyggere deporteret til Gazastriben."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%A3%E3%83%BC%E3%82%AC%E3%83%BCI","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Zhukov_at_the_Tiger_tank.jpg","page_title":"ティーガーI","context_page_description":"ティーガーIは、第二次世界大戦期のナチス・ドイツで開発された重戦車である。制式名称は何度か変更されており、最終的にはVI号戦車ティーガーE型と呼ばれていた。\\nVI号戦車にはI型とII型の2種類が存在し、それぞれティーガーI、ティーガーII と呼ばれる。本稿ではI型について述べる。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Aartselaar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Neoclassicistisch_kasteel_solhof.jpg","page_title":"Lijst van onroerend erfgoed in Aartselaar","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Aartselaar. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://fr.wikipedia.org/wiki/Canyoneaustrate","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fontaine_du_parc_de_Bercy.jpg","page_title":"Canyoneaustrate","context_page_description":"Canyoneaustrate est une œuvre monumentale commandée par la Ville de Paris à l'artiste peintre et plasticien français Gérard Singer et installée sur le parvis Est du Palais omnisports de Paris-Bercy dans le 12ᵉ arrondissement de Paris, en France. Elle fut officiellement inaugurée en octobre 1988 par le maire de Paris Jacques Chirac.\\nLe nom qui lui a été attribué par son créateur est la contraction de « canyon », « eau » et « strate ».\\nLe « Canyoneaustrate » est une fontaine composée d'un grand miroir d'eau à débordement de 40 m de côté dont l'un des angles présente une sculpture en creux dont le point bas se situe à 5 m de profondeur évoquant des gorges naturelles. L'eau du bassin se déverse en cascade sur les strates des parois de cette sculpture. L'oeuvre est réalisée en béton blanc brut de coffrage, teinté à la couleur de la pierre de Paris. Ses éléments ont été réalisées à partir de moules négatifs en polystyrène expansé travaillé à la flamme, à la dimension réelle, selon un procédé inventé par l'artiste.\\nLes travaux sont réalisés sous la direction d'André Beaune."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%B4%E7%89%9B%E5%9C%B0%E9%9B%B7%E9%98%B2%E8%AD%B7%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Buffalo_IED.jpg","page_title":"水牛地雷防護車","context_page_description":"水牛地雷防护车是由Force Protection参考南非的卡斯皮地雷防护车开发而成，至2008年6月6日，美军已装备二百架。"},{"page_url":"https://es.wikipedia.org/wiki/McLaren_720S","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/McLaren_720S_IMG_0933.jpg","page_title":"McLaren 720S","context_page_description":"El McLaren 720S es un automóvil deportivo británico diseñado y fabricado por McLaren Automotive. Es el segundo automóvil completamente nuevo en McLaren Super Series, reemplazando el McLaren 650S a partir de mayo de 2017.\\nEl 720S fue lanzado en el Salón del Automóvil de Ginebra el 7 de marzo de 2017 y está construido sobre un chasis de carbono modificado, que es más ligero y más rígido en contraste con el 650S."},{"page_url":"https://es.wikipedia.org/wiki/Dracontium_spruceanum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Dracontium_spruceanum_CBM.png","page_title":"Dracontium spruceanum","context_page_description":"Jergón sacha es una especie de arbusto perteneciente a la familia de las aráceas. La raíz es utilizada dentro de la medicina tradicional amazónica en Perú para el tratamiento de mordeduras de serpiente, abscesos con gusanos y hernias.​ Se caracteriza por sus propiedades antioxidantes e inmunomoduladoras.​"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Benedictine_monasteries_in_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/La_Tour_Saint-Nicolas.jpg","page_title":"List of Benedictine monasteries in France","context_page_description":"This is a list of Benedictine monasteries, extant and non-extant, in the present territory of France. It includes both monks and nuns following the Rule of Saint Benedict, excluding the Cistercians, for whom see List of Cistercian monasteries in France. Some monasteries however belonged at various times in their histories to both the Benedictines and the Cistercians.\\nAt different times these religious houses have formed various orders, congregations or groups, of which the main ones, as far as French monasteries are concerned, are the following:\\nthe Order of Cluny\\nthe Camaldolese\\nthe Olivetans\\nthe Celestines\\nthe Order of Chalais\\nthe Order of Fontevraud\\nthe Congregation of Tiron\\nthe Congregation of La Chaise-Dieu\\nthe Congregation of Saint-Victor\\nthe Bursfelde Congregation\\nthe Alsace Congregation\\nthe Cassinese Congregation\\nthe Congregation of Chezal-Benoît\\nthe Congregation of the Exempts of Flanders\\nthe Congregation of the Exempts of France\\nthe Société de Bretagne\\nthe Congregation of St. Vanne\\nthe Congregation of St. Maur\\nthe English Benedictine Congregation in exile\\nthe Congregation of the Allobroges\\nthe Affligem group\\nthe Solesmes Congregation\\nthe Subiaco Congregation"},{"page_url":"https://ro.wikipedia.org/wiki/Sl%C4%83nic-Moldova","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Slanic_Wandelmann_izvoare_calde.jpg","page_title":"Slănic-Moldova","context_page_description":"Slănic-Moldova este un oraș în județul Bacău, Moldova, România, format din localitățile componente Cerdac, Cireșoaia și Slănic-Moldova."},{"page_url":"https://en.wikipedia.org/wiki/Holden_WB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/1982_Holden_WB_utility_%282015-06-18%29_01.jpg","page_title":"Holden WB","context_page_description":"The Holden WB series is an automobile which was produced by Holden in Australia from 1980 to 1984. It is a facelifted version of the Holden HZ series, which it replaced. Unlike the HZ and every other full size Holden series before it, the Holden WB was only offered in commercial vehicle bodystyles with no sedan or wagon passenger car variants. The long-wheelbase WB series models were marketed under the separate Statesman marque, absent of all Holden branding."},{"page_url":"https://nl.wikipedia.org/wiki/Cordieria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Cordieria_rouaultii_001.jpg","page_title":"Cordieria","context_page_description":"Cordieria is een geslacht van weekdieren uit de klasse van de Gastropoda."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BD%93%E8%82%B2%E8%A5%BF%E8%B7%AF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Tiyu_Xilu_Station_Line_3_Platform_For_Airport_S..JPG","page_title":"体育西路站","context_page_description":"體育西路站是廣州地鐵1號線和3號線的轉乘車站，位於中國廣東省廣州市天河區天河南一路體育西路口的地底。於1999年2月16日隨1號線全線通車而正式啟用；2005年12月28日隨著地鐵3號線通車成為轉乘車站。"},{"page_url":"https://nl.wikipedia.org/wiki/Grasse","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Grasse2.JPG","page_title":"Grasse","context_page_description":"Grasse is een stad in Zuid-Frankrijk. Het ligt in het departement Alpes-Maritimes en is daar een onderprefectuur van. Grasse is vooral bekend vanwege de parfumindustrie die bestaat uit de drie grote parfumhuizen van Galimard, Moulinard en Fragonard. In 1999 woonden er 43.874 mensen."},{"page_url":"https://no.wikipedia.org/wiki/Hauk%C3%A5sen_skole","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Hauk%C3%A5sen_skole.jpg","page_title":"Haukåsen skole","context_page_description":"Haukåsen skole, opprinnelig Haukåsen skole og barnehave, er en grunnskole i Oslo, bygget i 1972. Den er en spesialskole for elever med nevrologisk betingede vansker og elever med multifunksjonshemming. Skolen har klasser fra 1. – 10. klassetrinn, samt tilbud til 13 elever i videregående opplæring.\\nSkolen ble oppført som en videreføring av Blindernveien skole og barnehave. Arkitekter var Stein Finne go Jan C. Nilsen. Skolens første rektor var Solveig Pahle."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%83%A7%E3%83%AB%E3%83%8E%E3%83%BC%E3%83%96%E3%82%A3%E3%83%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/ChernobylMIR.jpg","page_title":"チョルノーブィリ","context_page_description":"チョルノーブィリは、ウクライナ北部・キエフ州の都市である。日本語では、ロシア語由来のチェルノブイリと書かれることも多い。\\n首都キエフの北方、約135kmに位置しプリピャチ川に沿う。1986年4月26日に発生したチェルノブイリ原子力発電所の爆発事故により、放射性物質に汚染されゴーストタウンと化した。ほとんどの住民は事故後、他所に避難したままだが、少数の住民はチョルノーブィリで余生を過ごすことを望んだため、完全に無人にはなっていない。事故後の人口は1987年が最も多く約1,200人、2003年現在300人。人口は減少傾向にある。事故直前の人口は10万人以上いたと言われている。\\nチョルノーブィリはかつてキエフ州のチョルノーブィリ地区に所属し、地区の首府が置かれていたが事故後の1988年にチョルノーブィリ地区は消滅。現在は南西に隣接するイヴァーンキウ地区に編入されている。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%BC%D0%B5%D1%80%D0%BD%D1%96_%D0%B7%D0%BD%D0%B0%D0%BA%D0%B8_%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%BE%D1%97_%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Licence_plates_of_Macedonia-2012.svg","page_title":"Номерні знаки Північної Македонії","context_page_description":"Автомобільні номерні знаки Північної Македонії використовуються для реєстрації транспортних засобів у Північній Македонії. Вони використовуються для перевірки законності використання, наявності страхування та ідентифікації транспортних засобів.\\nРеєстраційні знаки транспортних засобів Північної Македонії містять двобуквенний код регіону, за яким слідує 4-значний цифровий код і 2-буквений літерний код. Ліворуч — блакитне поле з міжнародним кодом країни для Північної Македонії — NMK.\\nЦифровий код містить комбінацію з чотирьох цифр, а дволітерний код складається з комбінації літер з використанням англійського алфавітного порядку.\\nСтандартні номерні знаки автомобіля, розміри 520 мм × 110 мм.\\nЗ 1993 по 20 лютого 2012 року діяло десять кодів: BT, GV, KU, OH, PP, SK, SR, ŠT, TE і VE.\\n20 лютого 2012 року, крім десяти існуючих, було введено сім нових кодів: GE, KA, KI, KO, KP, RA і SU.\\n1 березня 2013 року, крім сімнадцяти існуючих, було введено шість нових кодів: BE, DE, NE, RE, SN і VI.\\n1 вересня 2013 року, крім двадцяти трьох існуючих, був введений ще один новий код: VV.\\n4 липня 2015 року, крім двадцяти чотирьох існуючих, було введено сім нових кодів: DB, DK, MB, MK, KR, PS та VA."},{"page_url":"https://de.wikipedia.org/wiki/Tiefdruckverfahren","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Getr%C3%A4nkekarton_SIG_Combibloc_Klein_Retusche_2.Dateiendung.jpg","page_title":"Tiefdruckverfahren","context_page_description":"Das Tiefdruckverfahren ist eine Drucktechnik, bei der die abzubildenden Elemente als Vertiefungen in der Druckform vorliegen. Die gesamte Druckform wird vor dem Druck eingefärbt und die überschüssige Farbe danach mit einer Rakel oder einem Wischer entfernt, so dass sich die Druckfarbe nur noch in den Vertiefungen befindet. Ein hoher Anpressdruck und die Adhäsions­kräfte zwischen Papier und Farbe bewirken die Farbübertragung. Das Verfahren wird sowohl im gewerblichen Tiefdruck als auch im künstlerischen Bereich eingesetzt.\\nDie Tiefdruckform wird vor allem im Verpackungs-, Etiketten-, Dekor- und im Zeitschriftendruck eingesetzt. Die Lasergravur in Kombination mit dem Ätzprozess findet im Verpackungsdruck Anwendung. Zum Einsatz kommen Standard-PCs und anwendungsspezifische Programme. Zur Datensicherung stehen Datenserver mit entsprechender Kapazität zur Verfügung."},{"page_url":"https://en.wikipedia.org/wiki/Peucedanum_japonicum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Bangpung_%28Peucedanum_japonicum%29.jpg","page_title":"Peucedanum japonicum","context_page_description":"Peucedanum japonicum, also known as coastal hog fennel, is a species of Peucedanum, a genus rich in medicinal species belonging to the parsley family, Apiaceae."},{"page_url":"https://pl.wikipedia.org/wiki/Rynek_w_Katowicach","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Stare_Katowice_1.jpg","page_title":"Rynek w Katowicach","context_page_description":"Rynek w Katowicach − rynek miejski położony w centrum Katowic. Jest to jeden z głównych placów Śródmieścia do którego prowadzą: ul. 3 Maja, ul. Warszawska, ul. Staromiejska, ul. Teatralna, ul. Adama Mickiewicza, ul. św. Jana, ul. Pocztowa, ul. Młyńska i aleja Wojciecha Korfantego.\\nZabudowania przy placu powstawały od połowy XIX wieku. W latach PRL część zabytkowych kamienic wyburzono, by mogły powstać tu nowoczesne obiekty usługowe. Charakterystyczną cechą rynku jest sieć torów tramwajowych, przecinających rynek w kilku kierunkach. W ramach rynku wyróżnia się trzy place: Kwiatowy, Teatralny i Obrońców Katowic. W 2016 oddano cały rynek do użytku po gruntownej przebudowie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%AD%D0%B4%D0%B8%D0%BD%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Marie%2C_Crown_Princess_of_Romania.jpg","page_title":"Мария Эдинбургская","context_page_description":"Мари́я Алекса́ндра Викто́рия Эдинбу́ргская, в браке и вдовстве была известна как Мари́я Румы́нская — британская принцесса; дочь Альфреда, герцога Эдинбургского и Саксен-Кобург-Готского, и великой княжны Марии Александровны. По отцу — внучка королевы Виктории, по матери — императора Александра II. В браке — последняя королева Румынии.\\nДетские и юношеские годы Мария провела на Мальте, в Кенте и Кобурге. Отказавшись от предложения своего двоюродного брата, будущего короля Георга V, в 1892 году она была выбрана в качестве будущей жены кронпринца Румынии Фердинанда — племянника бездетного короля Кароля I. После свадьбы, состоявшейся в 1893 году, и до 1914 года, когда супруг Марии стал королём, она носила титул кронпринцессы Румынии. Будучи кронпринцессой, Мария была весьма популярна в народе, имела большое влияние на своего слабовольного супруга и контролировала почти все его действия.\\nПосле начала Первой мировой войны Мария принуждала Фердинанда присоединиться к Антанте и объявить войну Германии, что он в итоге сделал в 1916 году, уже став королём."},{"page_url":"https://de.wikipedia.org/wiki/Crozant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/France_Summer_2008_038.JPG","page_title":"Crozant","context_page_description":"Crozant ist eine Gemeinde in Frankreich. Sie gehört zur Region Nouvelle-Aquitaine, zum Département Creuse, zum Arrondissement Guéret und zum Kanton Dun-le-Palestel."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D8%B1%D8%B3_%D8%AF%D9%88_%D8%B3%D9%88%D8%AF_(%D8%A5%D9%82%D9%84%D9%8A%D9%85_%D9%81%D8%B1%D9%86%D8%B3%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Sartene_Vi1aJPG.jpg","page_title":"كورس دو سود (إقليم فرنسي)","context_page_description":"كورسيكا الجنوبية أو كورس دو سود ‏: هو إقليم فرنسي تابع لمنطقة كورسيكا. عدد سكانه 118593 نسمة. ومركز الإقليم أجاكسيو."},{"page_url":"https://tl.wikipedia.org/wiki/Suzhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/ChinaJiangsuSuzhou.png","page_title":"Suzhou","context_page_description":"Ang Suzhou, alternatibong romanisado bilang Soochow, ay isang pangunahing lungsod sa timog-silangang bahagi ng lalawigan ng Jiangsu ng Silangang China, sa layong humigit-kumulang 100 kilometro hilagang-kanluran ng Shanghai. Isa itong pangunahing sentrong ekonomiko at katumbukán ng kalakalan at komersiyo, at ito rin ang pangalawang pinakamalaking lungsod sa lalawigan, kasunod ng kabisera nitong Nanjing. Ang lungsod ay matatagpuan sa ibabang abot ng Ilog Yangtze at sa pampang ng Lawa ng Tai, at nasa rehiyon ng Delta ng Ilog Yangtze. Administratibong isang antas-prepektura na lungsod ang Suzhou na may populasyong 4.33 milyong katao sa city proper nito, at kabuoang residenteng populasyon na 10.58 milyon sa pook administratibo nito. Lumaki nang 6.5% ang populasyong urbano nito mula 2000 hanggang 2014, isa sa pinakamataas sa mga lungsod na may populasyong higit sa 5 milyong katao.\\nAng Suzhou, na itinatag noong 514 BK, ay may higit sa 2,500 taon ng kasaysayan, kalakip ang napakaraming mga relikiya at sityong may kaugnayan sa kasaysayan."},{"page_url":"https://en.wikipedia.org/wiki/Nyssa_sylvatica","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Nyssa_sylvatica_JPG1b.jpg","page_title":"Nyssa sylvatica","context_page_description":"Nyssa sylvatica, commonly known as tupelo, black tupelo, black gum or sour gum, is a medium-sized deciduous tree native to eastern North America from the coastal Northeastern United States and southern Ontario south to central Florida and eastern Texas, as well as Mexico."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AB%E0%B8%A5%E0%B8%A7%E0%B8%87%E0%B8%9E%E0%B9%88%E0%B8%AD%E0%B9%82%E0%B8%95_%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%9B%E0%B9%88%E0%B8%B2%E0%B9%80%E0%B8%A5%E0%B9%84%E0%B8%A5%E0%B8%A2%E0%B8%81%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Luang_Pho_To_Wat_Pa_Lelai_Suphanburi.jpg","page_title":"หลวงพ่อโต วัดป่าเลไลยก์","context_page_description":"หลวงพ่อโตวัดป่าเลไลยก์ เป็นพระพุทธรูปคู่บ้านคู่เมืองสุพรรณมาแต่โบราณกาล ตามพงศาวดารเหนือกล่าวว่า พระเจ้ากาแลโปรดให้บูรณะวัดป่าเลไลยก์ เมื่อ พ.ศ. 1724 แสดงว่าแสดงว่าวัดนี้ได้สร้างมาแล้วก่อนหน้านั้น\\nองค์พระประดิษฐานอยู่ในวิหารที่สูงใหญ่ มองเห็นเด่นแต่ไกล เป็นพระพุทธรูปปูนปั้นปิดทองปางป่าเลไลยก์ขนาดใหญ่สูง 23 เมตรเศษ สร้างตามแบบศิลปอู่ทองรุ่นที่สอง ซึ่งเป็นศิลปะฝีมือสกุลช่างอู่ทองแท้ ๆ เดิมทีองค์พระประดิษฐานอยู่กลางแจ้ง พระหัตถ์ขวาหัก ช่างได้สร้างวิหารครอบ โดยให้ผนังวิหารชิดกับพระหัตถ์ขวา ส่วนทางพระหัตถ์ซ้ายให้มีที่ว่าง ด้านหลังองค์พระสร้างชิดกับผนังวิหารทำให้แข็งแรง นับเป็นความชาญฉลาดของช่างเป็นอย่างยิ่ง\\nมีผู้สันนิษฐานว่า เดิมเป็นพระพุทธรูปปางปฐมเทศนา ประทับนั่งอยู่กลางแจ้ง พระกรทั้งสองข้างหักหายไป ผู้ที่มาบูรณใหม่ได้ทำเป็นปางป่าเลไลยก์ตามที่นิยมกันในสมัยหลัง ลักษณะประทับนั่งห้อยพระบาท พระหัตถ์ซ้ายวางคว่ำบนพระชานุข้างซ้าย พระหัตถ์ขวาวางหงายบนพระชานุข้างขวาในท่าทรงรับของถวาย พระวิหารที่สร้างครอบองค์พระ สร้างในรัชสมัยพระบาทสมเด็จพระจอมเกล้าเจ้าอยู่หัว จะเห็นว่าที่หน้าบันของพระวิหาร มีพระราชลัญจกรประจำพระองค์ คือเป็นรูปพระมหามงกุฎอยู่ระหว่างฉัตรคู่ปรากฏอยู่"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%94%EB%84%A4%ED%82%A4%EC%93%B0_%EB%A7%88%EC%82%AC%ED%86%A0%EC%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Yonekitsu_Masatoshi.jpg","page_title":"요네키쓰 마사토시","context_page_description":"요네키쓰 마사토시는 일본 에도 시대의 다이묘로, 나가토로 번의 5대 번주, 지번사이며, 오아미 번 지번사, 류가사키 번 지번사이다. 나가토로 번의 4대 번주 요네키쓰 마사아키의 맏아들로 태어났으며, 관위는 종5위하, 이세노카미이며, 메이지 시대에는 자작이다.\\n게이오 원년 12월 11일, 아버지 마사아키가 은거함에 따라 가문을 계승하였다. 게이오 2년 12월 18일에 종5위하, 이세노카미에 서임되었다. 보신 전쟁에서는 신정부군 측에 가담하여, 게이오 4년 윤4월에 덴도 번과 싸웠으나 패하였고, 이때 나가토로 진야가 불에 탔다. 메이지 2년 6월, 판적봉환으로 나가토로 번 지번사가 되었고, 같은 해 11월, 정청을 나가토로에서 가즈사노쿠니 오아미로 옮겼으며, 메이지 4년 2월에는 다시 히타치노쿠니 류가사키 촌으로 옮겼다. 결국 그해 7월 15일, 폐번치현으로 인해 면직되었다. 이후 육군 도야마 학교를 졸업하고 메이지 10년에 육군소위가 되었으며, 이후 중위로 진급하여 근위사단 문고 주관 등으로 근무했다. 메이지 17년에 자작이 되었고, 메이지 23년 7월에 귀족원 의원으로 당선되어 죽을 때까지 재임하였다. 나시모토노미야의 가령으로도 근무하였다. 메이지 28년에 45세로 사망하였다."},{"page_url":"https://id.wikipedia.org/wiki/Yakovlev_AIR-3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Koshits_D._A._%28right%29_and_mechanic_Podlesniy_B._N._the_aircraft_Yakovlev_AIR-3.jpg","page_title":"Yakovlev AIR-3","context_page_description":"Yakovlev AIR-3 adalah sebuah monoplane penerbangan umum dua kursi 1920 Soviet yang dirancang dan dibangun oleh Aleksandr Sergeyevich Yakovlev.\\nSetelah desain dari sebelumnya AIR-1 dan AIR-2, Yakovlev diambil sebagai mahasiswa di Akademi Teknik Angkatan Udara Nikolai Zhukovsky, di mana ia merancang AIR-3, yang mirip dengan sebelumnya biplane AIR-2 tetapi dengan sayap-sayap tinggi."},{"page_url":"https://bs.wikipedia.org/wiki/Spisak_dobitnika_Nobelove_nagrade_za_fiziologiju_ili_medicinu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/RobertKoch_cropped.jpg","page_title":"Spisak dobitnika Nobelove nagrade za fiziologiju ili medicinu","context_page_description":"Spisak dobitnika Nobelove nagrade za fiziologiju ili medicinu obuhvata sve laureate u periodu od 1901. do danas. Nobelova nagrada za fiziologiju ili medicinu je jedna je od pet Nobelovih nagrada koju dodjeljuje Švedska kraljevska akademija nauka svake godine za izuzetna otkrića u području fiziologije i medicine."},{"page_url":"https://es.wikipedia.org/wiki/Pont-Aven","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Paul_Gauguin_032.jpg","page_title":"Pont-Aven","context_page_description":"Pont-Aven es una población y comuna francesa, situada en la región de Bretaña, departamento de Finisterre, en el distrito de Quimper. Es el chef-lieu del cantón de su nombre. Pont-Aven es apodada \\"la ciudad de los pintores\\" debido a los numerosos pintores que han pasado por la localidad."},{"page_url":"https://de.wikipedia.org/wiki/Sauerbachtal_B%C3%BClheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Lichtenau_-_2017-08-06_-_Sauerbachtal_B%C3%BClheim_%2816%29.jpg","page_title":"Sauerbachtal Bülheim","context_page_description":"Das Naturschutzgebiet Sauerbachtal Bülheim liegt im Kreis Paderborn. Es umfasst einen Teil des Tals der Sauer im südlichen Teil der Bülheimer Heide. Es besteht seit 1938 und ist 56,96 ha groß.\\nDurch das Tal mäandert die Sauer. Den gewässernahen Bereich bestimmt ein naturnaher Erlenauenwald. Am südlichen Talrand kommt es zu Versumpfungen und Vermoorungen, teilweise in Form von Birken-Moorwäldern. Eine größere, jedoch überwiegend trockene Moorfläche liegt am Rand des Naturschutzgebietes bei Gut Bülheim. Abseits des Gewässers deuten alte Buchenbestände auf einen mittelalterlichen Hudewald hin, ansonsten werden die Waldbereiche von Fichten dominiert.\\nSchutzziele sind die Bewahrung und Wiederherstellung des Bachlaufs mit seiner ausgeprägten Unterwasservegetation, der Nass- und Feuchtgrünlandbrachen, der moorigen Quellbereiche und des bachbegleitenden Erlen-Eschen-Auwaldes und Birken-Moorwaldes sowie der Kleinseggenriede, Feuchtheide, Hochstaudenflure, der Heidevegation und der Weidebuchen.\\nAls schützenswerte Vogelarten gemäß FFH- und Vogelschutzrichtlinie wurden festgestellt: Neuntöter, Rotmilan, Schwarzspecht und Schwarzstorch."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%8C%CE%BB%CE%B5%CE%BC%CE%BF%CF%82_%CF%84%CE%B7%CF%82_%CE%92%CE%BF%CF%83%CE%BD%CE%AF%CE%B1%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Klepci_1992.jpg","page_title":"Πόλεμος της Βοσνίας","context_page_description":"Ο Πόλεμος της Βοσνίας ήταν πολεμική σύγκρουση στα πλαίσια των εμφυλίων συρράξεων της Γιουγκοσλαβίας, η οποία έλαβε χώρα στη Βοσνία-Ερζεγοβίνη από το Μάρτιο του 1992 μέχρι το Δεκέμβριο του 1995. Ο πόλεμος αυτός ήταν η τρίτη κατά διαδοχική σειρά πολεμική σύρραξη στα πλαίσια του γιουγκοσλαβικού εμφυλίου και ήταν άμεσα συνδεδεμένος με τον Πόλεμο της Κροατίας, ο οποίος είχε αρχίσει ένα χρόνο νωρίτερα. Είναι επίσης γνωστός ως πόλεμος της Βοσνιακής Ανεξαρτησίας. Στην πολεμική αυτή σύρραξη ενεπλάκη για πρώτη φορά και το ΝΑΤΟ, υλοποιώντας αρχικά την επιχείρηση \\"Deny Flight\\", επιβάλλοντας απόφαση του συμβουλίου ασφαλείας του Ο.Η.Ε. που όριζε τον εναέριο χώρο της Βοσνίας - Ερζεγοβίνης ως \\"No fly zone\\" με την οποία απαγορεύονταν πτήσεις αεροσκαφών στον εναέριο χώρο της Βοσνίας - Ερζεγοβίνης. Επιπλέον, η άμεση συμμετοχή της Κροατίας στον πόλεμο και της Ομοσπονδιακής Δημοκρατίας της Γιουγκοσλαβίας, ο μεγάλος αριθμός των ξένων εθελοντών καθώς και η συμμετοχή του ΝΑΤΟ που χαρακτήρισαν την εμφύλια αυτή διαμάχη, έκαναν τον πόλεμο να μετατραπεί σε μια πολύπλοκη διεθνή σύγκρουση, με βαθιές πολιτικές και θρησκευτικές προεκτάσεις."},{"page_url":"https://es.wikipedia.org/wiki/Campa%C3%B1a_parta_de_Trajano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/PacorusII.jpg","page_title":"Campaña parta de Trajano","context_page_description":"La campaña parta de Trajano, fue una campaña militar ejecutada por el emperador romano Trajano en el año 115 contra el Imperio Parto en Mesopotamia. La guerra fue inicialmente exitosa para los romanos, pero debido a una serie de reveses, incluidas las rebeliones a gran escala en el Mediterráneo oriental y el norte de África, así como la muerte de Trajano en 117, terminó en una retirada romana."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E6%B4%A5%E5%B8%82%E5%8E%86%E5%8F%B2%E9%A3%8E%E8%B2%8C%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/%E5%AE%8B%E6%A3%90%E5%8D%BF%E6%97%A7%E5%B1%852.jpg","page_title":"天津市历史风貌建筑列表","context_page_description":"天津市历经600多年的建城史和近代租界的城市规划发展，出现了一大批具有较高的历史、文化、科学、艺术和人文价值并反映时代特色和地域特色的建筑和著名建筑师的代表作，市中心城区形成了包括法国、意大利、英国风格等在内的浓郁的异国风情以及民国时期的建筑风格，具有与中国其他城市截然不同的城市风情。尽管一直遭到自然和人为的损毁，这些建筑中完好保留下来的仍有很多。传统上，城市通过设立“文物保护单位”的方法对其进行保护，但随着21世纪初中国城市房地产开发的热潮，这些建筑的存在受到严重威胁。为了平衡对这些建筑的保护同市中心土地开发之间的关系，天津市第十四届人民代表大会常务委员会第二十一次会议于2005年7月20日通过名为《天津市历史风貌建筑保护条例》的地方性法规，受其保护的建筑则称为天津市历史风貌建筑。"},{"page_url":"https://en.wikipedia.org/wiki/Nikolai_Chelnokov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87_%D0%A7%D0%B5%D0%BB%D0%BD%D0%BE%D0%BA%D0%BE%D0%B2.jpg","page_title":"Nikolai Chelnokov","context_page_description":"Nikolai Vasilyevich Chelnokov was an assault aviation pilot in the Soviet Navy who was twice awarded the title Hero of the Soviet Union during World War II. He joined the Soviet Armed Forces in 1928 and within a few years became a Soviet Navy pilot and flight instructor. During World War II he received promotion to squadron and then regimental commander. After the war he became a major general before retiring from the military in 1954."},{"page_url":"https://en.wikipedia.org/wiki/Dmitry_Grigorovich","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Dmitry_Vasilyevich_Grigorovich_2.jpg","page_title":"Dmitry Grigorovich","context_page_description":"Dmitry Vasilyevich Grigorovich was a Russian writer, best known for his first two novels, The Village and Anton Goremyka, and lauded as the first author to have realistically portrayed the life of the Russian rural community and openly condemn the system of serfdom."},{"page_url":"https://no.wikipedia.org/wiki/Filosofi%C3%A5ret_1792","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Victorcousin.JPG","page_title":"Filosofiåret 1792","context_page_description":"Filosofiåret 1792 er en oversikt over hendelser, utgivelser og personer med tilknytning til filosofi i 1792."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Meridian,_Mississippi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Meridian%2C_MS_Historic_Districts.PNG","page_title":"History of Meridian, Mississippi","context_page_description":"The history of Meridian, Mississippi begins in the early 19th century before European-American settlement. Originally settled by the Choctaw Indians, the land was bought by the United States according to the Treaty of Dancing Rabbit Creek in 1830. The city grew around the intersection of the Mobile and Ohio Railroad and the Southern Railway of Mississippi and developed a largely rail-based economy. Although much of the city was burned down in the Battle of Meridian during the American Civil War, the city was rebuilt and entered a \\"Golden Age.\\" Between about 1890 and 1930, the city was the largest in Mississippi and a leading center for manufacturing in the Southern United States. After the decline of the railroading industry in the 1950s, the city's economy was devastated, resulting in a slow population decline. The population has continued to decline as the city has struggled to create a new, more modern economy based on newer industries. In the past 20 years or so, Meridian has attempted to revitalize the city's economy by attracting more business and industry to the city, most specifically the downtown area."},{"page_url":"https://de.wikipedia.org/wiki/Ruphay","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/05-ruphay-1984.jpg","page_title":"Ruphay","context_page_description":"Ruphay – in Europa auch als Los Rupay bekannt – ist eine bolivianische Musikgruppe, die 1968 von dem angehörigen des Volks der Aymara Mario Porfirio Gutiérrez in La Paz gegründet wurde und bis heute weltweit aktiv ist. Ruphay war die erste Gruppe, die die indigenen Musikinstrumente und Melodien in ihrer unverfälschten Form zunächst auf die Bühnen Boliviens und Lateinamerikas, später auch nach Europa brachte. 17 Alben bis heute zeugen davon."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Smyth_(sculptor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Dublin_Castle_Detail.jpg","page_title":"Edward Smyth (sculptor)","context_page_description":"Edward Smyth was an Irish sculptor.\\nThe son of a stone-cutter, Smyth was born in Meath, Ireland. He was employed by Henry Darley, who was in turn an employee of James Gandon. By this connection Smyth met Gandon who was greatly impressed with his work. Gandon employed Smyth as sculptor to the Custom House as well as for all of his Dublin projects. These included the Four Courts, House of Lords, and King's Inns.\\nSmyth in 1787 completed statues to his own design above the Westmoreland St entrance of the Irish Houses of Parliament. In 1807 he carved the statues above the main entrance of the same building on College Green. These represent Hibernia flanked by Commerce and Fidelity.\\nSmyth was also employed by the architect Francis Johnston. He carved the heads on the exterior of Johnston's Chapel Royal in Dublin Castle until his death, whereupon his son John continued the work.\\nSmyth was the first Master of the Dublin Society School of Modeling and sculpture. He died suddenly on 2 August 1812, at his home at 36 Montgomery Street in Dublin. His son, John Smyth, was also a sculptor and succeeded him as Master of Modeling at the Dublin School."},{"page_url":"https://en.wikipedia.org/wiki/Uttwil","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Uttwil_Gasthaus_Frohsinn.JPG","page_title":"Uttwil","context_page_description":"Uttwil is a municipality in the district of Arbon in the canton of Thurgau in Switzerland."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%9Bnik_niszczyciel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Plagionotus_detritus_under.jpg","page_title":"Paśnik niszczyciel","context_page_description":"Paśnik niszczyciel – gatunek chrząszcza z rodziny kózkowatych i podrodziny kózkowych."},{"page_url":"https://fr.wikipedia.org/wiki/BMW_R_80_ST","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/R_80_ST.jpg","page_title":"BMW R 80 ST","context_page_description":"La R 80 ST est un modèle de motocyclette du constructeur allemand BMW.\\nFort du succès de la R 80 G/S et afin d'exploiter au mieux les qualités routières de cette moto, BMW décide de l'éditer en 1982 en une version plus routière. Ainsi est créée la R 80 ST.\\nPour ce faire, elle adopte une roue avant de 19, ses suspensions sont légèrement rabaissées et est habillée d'éléments plus routiers. Cette moto gagne un train avant plus précis et des pneumatiques plus adaptés aux conditions routières.\\nEsthétiquement, la ST diffère donc de la R 80 G/S. Le réservoir contient 0,5 litres d’essence de moins et le bouchon intégré affleure son sommet. La ST abandonne la tête de fourche en plastique avec phare intégré de la G/S pour un ensemble plus classique avec un grand phare chromé, et une instrumentation plus complète et plus lisible. Le pot est chromé, les caches latéraux sont spécifiques et le garde-boue avant est placé au raz de la roue. Outre ces différences, elle reprend la quasi totalité des éléments de la G/S dont le moteur bicylindre à plat de 797,5 cm³ qui délivre 50 ch à 6 500 tr/min. La boite à 5 rapport et la transmission acatène sont également identiques."},{"page_url":"https://ru.wikipedia.org/wiki/Olivetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Olivetti_Lettera_22_by_LjL.jpeg","page_title":"Olivetti","context_page_description":"Olivetti, полное название Ing. C. Olivetti & Co., SpA., — итальянская компания, производитель пишущих машинок, компьютеров, принтеров и аппаратуры различного назначения."},{"page_url":"https://en.wikipedia.org/wiki/Kingdom_of_Slavonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Slavonia02.png","page_title":"Kingdom of Slavonia","context_page_description":"The Kingdom of Slavonia was a province of the Habsburg Monarchy and the Austrian Empire that existed from 1699 to 1868. The province included northern parts of present-day regions of Slavonia and Syrmia. The southern parts of these regions were part of the Slavonian Military Frontier, which was a section of the Military Frontier."},{"page_url":"https://en.wikipedia.org/wiki/Quantum_gravity","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Point%26string.png","page_title":"Quantum gravity","context_page_description":"Quantum gravity is a field of theoretical physics that seeks to describe gravity according to the principles of quantum mechanics, and where quantum effects cannot be ignored, such as in the vicinity of black holes or similar compact astrophysical objects where the effects of gravity are strong.\\nThree of the four fundamental forces of physics are described within the framework of quantum mechanics and quantum field theory. The current understanding of the fourth force, gravity, is based on Albert Einstein's general theory of relativity, which is formulated within the entirely different framework of classical physics. However, that description is incomplete: describing the gravitational field of a black hole in the general theory of relativity, physical quantities such as the spacetime curvature diverge at the center of the black hole.\\nThis signals the breakdown of the general theory of relativity and the need for a theory that goes beyond general relativity into the quantum. At distances very close to the center of the black hole, quantum fluctuations of spacetime are expected to play an important role. To describe these quantum effects a theory of quantum gravity is needed."},{"page_url":"https://ca.wikipedia.org/wiki/Embotellament","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Congestion_caused_by_a_road_accident%2C_Algarve%2C_Portugal.jpg","page_title":"Embotellament","context_page_description":"Un embotellament o Congestió de trànsit és la condició d'un flux vehicular que es veu saturat a causa de l'excés de demanda de les vies, tant a nivell urbà com interurbà, produint increments en els temps de viatge i embussos. Aquest fenomen es produeix normalment en les hores punta, i resulten frustrants per als automobilistes, ja que resulten en pèrdues de temps i consum excessiu de combustible.\\nLes conseqüències de les congestions vehiculars denoten en accidents, tot i que els automòbils no poden circular a gran velocitat, ja que l'automobilista perd la calma en trobar-se estàtic per molt temps en un lloc de la via. Això també deriva en violència viària, d'altra banda redueix la gravetat dels accidents, ja que els vehicles no es desplacen a una velocitat important per ser víctima de danys o lesions de més gravetat. També, els vehicles perden innecessàriament combustible pel fet que s'està inactiu per molt temps en un mateix lloc, sense avançar en el trajecte d'un punt a un altre.\\nD'acord amb la Revista Time, la ciutat de São Paulo pateix les pitjors congestions del món."},{"page_url":"https://sv.wikipedia.org/wiki/Teen_Spirit_(deodorant)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Teen_Spirit.jpg","page_title":"Teen Spirit (deodorant)","context_page_description":"Teen Spirit är en deodorant som till en början såldes av Mennen, men som sedan 1992 säljs av Colgate-Palmolive efter att de köpt upp Mennen. Deodoranten började säljas av Mennen tidigt under 1991 och efter mycket marknadsföring blev märket populärt främst hos flickor i tonåren. Efter att Colgate-Palmolive köpt upp Mennen började de planera för en serie hårvårdsprodukter som skulle använda sig av namnet Teen Spirit. Dessa lanserades i augusti 1992 och sålde till en början väl. Dock försvann dess popularitet relativt snabbt och Colgate-Palmolive valde att upphöra med denna serie hårvårdsprodukter. Teen Spirit återgick till att enbart vara en deodorant, nu i stiftformat.\\nTeen Spirit är även känt för att ha gett upphovet till titeln på Nirvanas låt \\"Smells Like Teen Spirit\\", som släpptes i september 1991. Bandets sångare Kurt Cobain kom på namnet på låten när hans vän Kathleen Hanna, den dåvarande sångerskan i riot grrrl-bandet Bikini Kill, sprejade orden \\"Kurt smells like Teen Spirit\\" på hans vägg. Eftersom de båda tidigare hade diskuterat ämnen såsom anarkism och punkrock antog Cobain att meningen hade någon sorts revolutionär mening."},{"page_url":"https://en.wikipedia.org/wiki/Heather_Terrell","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Heather_Terrell_2013.jpg","page_title":"Heather Terrell","context_page_description":"Heather Benedict Terrell is an American novelist and lawyer who writes some of her novels as Marie Benedict."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BB%BA%E5%B7%9D%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Jianchuan_Museum_Curator_Confession_20161123.jpg","page_title":"建川博物馆","context_page_description":"建川博物館，全稱建川博物館聚落，是國家級文化示範基地，由民營企業家樊建川創建，位於中國四川省成都市大邑縣安仁古鎮。建築面積10餘萬平方米，藏品1000餘萬件，包括國家一級文物425件。博物館包括抗戰、民俗、紅色年代、抗震救災四大主題共32座分館。"},{"page_url":"https://cs.wikipedia.org/wiki/Okrouhl%C3%A1_(okres_Blansko)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/B%C4%9Bl%C3%A1_v_Melkov%C4%9B%2C_Okrouhl%C3%A1%2C_okres_Blansko.jpg","page_title":"Okrouhlá (okres Blansko)","context_page_description":"Okrouhlá je obec v okrese Blansko v Jihomoravském kraji. Žije zde 588 obyvatel."},{"page_url":"https://lt.wikipedia.org/wiki/Aleksandro_Nevi%C5%A1kio_ordinas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Badge_to_Order_St_Alexander_Nevsky_1820-1830.jpg","page_title":"Aleksandro Neviškio ordinas","context_page_description":"Aleksandro Neviškio ordinas, Šv. Aleksandro Neviškio ordinas – Rusijos imperijos, TSRS ir Rusijos Federacijos ordinas."},{"page_url":"https://fr.wikipedia.org/wiki/Invasions_fran%C3%A7aises_du_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/The_Battle_of_Cape_St_Vincent%2C_14_February_1797_RMG_BHC0486.jpg","page_title":"Invasions françaises du Portugal","context_page_description":"Les grandes invasions napoléoniennes de la péninsule Ibérique, menées dans le cadre de la « Guerre d'Espagne », donnent lieu à ce que l'on nomme la « Guerre d'indépendance espagnole » en Espagne, et à ce que l'on appelle la « Guerre péninsulaire » au Portugal.\\nDans les deux pays, les opérations militaires sont à la fois clairement distinctes du fait des jeux d'alliances opposés, des commandements séparés et de l'existence de gouvernements différents, mais aussi étroitement imbriquées du fait de la continuité territoriale de la Péninsule, de la synchronicité des soulèvements populaires et surtout de la présence à partir de 1807 d'un ennemi commun. Conflit fondateur pour le XIXᵉ siècle portugais, cet épisode majeur de l'histoire du Portugal englobe des batailles et des mouvements de troupes déterminants pour expliquer la chute de l'Empire français, et par contrecoup l'indépendance des Indes de Castille et du Brésil portugais.\\nLa « guerre péninsulaire » portugaise est sensiblement différente dans ses dynamiques et dans sa chronologie de la guerre d'indépendance espagnole."},{"page_url":"https://en.wikipedia.org/wiki/Rathvilly_(barony)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Rathvilly_%28Barony%29.png","page_title":"Rathvilly (barony)","context_page_description":"Rathvilly is a barony in County Carlow, Republic of Ireland."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%80%81%E9%97%86%E4%B8%8D%E6%98%AF%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Kevin_Spacey_Premiere.jpg","page_title":"老闆不是人","context_page_description":"《老闆不是人》是一部於2011年上映的美國黑色喜劇電影，為塞斯·戈登執導，麥克·馬科維茨、約翰·法蘭西斯·戴利與喬納森·戈德施泰因共同編劇，劇情基於馬科維茨所撰的劇本。傑森·貝特曼、珍妮佛·安妮斯頓、柯林·法洛、凱文·史貝西及傑米·福克斯等人主演。\\n新線電影在2005年購買了馬科維茨的劇本，電影在不同的預製狀態下擱置了6年的時間，各種演員紛紛以不同角色加盟。直到2010年，戈德施泰因和戴利重新改寫劇本，電影終於投入製作。\\n電影在2011年6月30日在洛杉磯首映，同年7月8日發行。該片超越了票房預期，前3天收穫即突破2,800萬美元，並成為歷史總榜上黑色喜劇電影的票房冠軍，打破了由1990年電影《玫瑰戰爭》所創下的紀錄。在其上映檔期間於世界各地的總收入超過2.09億美元。\\n該部電影收穫了影評人的積極評價。劇情則受到褒貶不一的反響；一些影評人認為，它以黑色幽默為前提所做了很好的探討，而另一些人認為這些笑話涉及種族主義、同性戀恐懼及厭女症。續集《老闆不是人2》於2014年11月26日上映。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B0%E0%A6%BE%E0%A6%B7%E0%A7%8D%E0%A6%9F%E0%A7%8D%E0%A6%B0_%E0%A6%85%E0%A6%A8%E0%A7%81%E0%A6%AF%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A7%80_%E0%A6%AC%E0%A7%83%E0%A6%B9%E0%A6%A4%E0%A7%8D%E0%A6%A4%E0%A6%AE_%E0%A6%B6%E0%A6%B9%E0%A6%B0_%E0%A6%93_%E0%A6%A6%E0%A7%8D%E0%A6%AC%E0%A6%BF%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%AC%E0%A7%83%E0%A6%B9%E0%A6%A4%E0%A7%8D%E0%A6%A4%E0%A6%AE_%E0%A6%B6%E0%A6%B9%E0%A6%B0%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Alexandria_2122972.jpg","page_title":"রাষ্ট্র অনুযায়ী বৃহত্তম শহর ও দ্বিতীয় বৃহত্তম শহরের তালিকা","context_page_description":"এই নিবন্ধে জনসংখ্যা অনুযায়ী প্রত্যেক রাষ্ট্রের বৃহত্তম ও দ্বিতীয় বৃহত্তম শহরের তালিকা উপস্থাপন করা হয়েছে। রাজ্যাংশ বা পরাধীন অঞ্চলের নামের সামনেই প্রথম বন্ধনীতে রাষ্ট্রের নাম উল্লেখ করা আছে।\\nরাজধানী শহরসমূহ গাঢ় লেখাতে আছে।"},{"page_url":"https://fr.wikipedia.org/wiki/La_Maison_de_la_sorci%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Brown_Jenkin_by_Muzski.jpg","page_title":"La Maison de la sorcière","context_page_description":"La Maison de la sorcière est une nouvelle d'horreur fantastique et de science-fiction de l'écrivain américain Howard Phillips Lovecraft, publiée pour la première fois en juin 1933 dans le magazine Weird Tales. L'œuvre s'inscrit dans le cycle du mythe de Cthulhu.\\nIl s'agit d'une nouvelle d'une quarantaine de pages rédigée par Lovecraft entre janvier et février 1932.\\nElle est traduite en français par Jacques Papy puis publiée dans le recueil de nouvelles Dans l'abîme du temps, dans la collection Présence du futur, en juin 1954. Elle est rééditée en 2013 par Bragelonne dans l'ouvrage Cthulhu, le mythe dans une traduction de Maxime Le Dain et Sonia Quéméner."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%80%D0%B5%D0%B4%D0%BD%D0%B5%D0%B5%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%B2%D0%BD%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Europe_landforms_-_North_European_Plain.svg","page_title":"Среднеевропейская равнина","context_page_description":"Среднеевропе́йская равни́на — равнина в Европе, расположенная на территории Польши, Германии, Дании, а также Бельгии и Нидерландов. Ограничена на севере побережьями Северного и Балтийского морей, на юге — горами и возвышенностями Герцинской Европы.\\nПротяжённость равнины с запада на восток составляет около 600 км, ширина — от 200 до 500 км. Преобладают высоты — от 50 до 100 м. Равнина сложена главным образом известняками и песчаниками, перекрытыми ледниковыми отложениями.\\nКлимат умеренный, переходный от морского к континентальному. Годовая сумма осадков уменьшается с запада на восток с 800 до 500 мм. Снежный покров на западе неустойчив, на востоке сохраняется 1,5—2 месяца. Густая сеть рек. Многочисленные ледниковые озёра.\\nПреобладают бурые лесные и подзолистые почвы. Естественная растительность — дубово-буковые и смешанные леса — в значительной степени сведена или замещена насаждениями хвойных пород; на севере — верещатники, торфяники. По долинам рек — луга. Большие площади заняты под посевы зерновых, сахарной свёклы, используются как пастбища.\\nСреднеевропейская равнина густо заселена."},{"page_url":"https://nl.wikipedia.org/wiki/Kawasaki_(motorfiets)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/1967_Kawasaki_W1SS.jpg","page_title":"Kawasaki (motorfiets)","context_page_description":"Kawasaki is een van de grote vier Japanse motorfietsmerken. De motorendivisie is een onderdeel van Kawasaki Heavy Industries Ltd."},{"page_url":"https://pl.wikipedia.org/wiki/Ratusz_w_O%C5%82awie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Ratusz_Olawski_4.jpg","page_title":"Ratusz w Oławie","context_page_description":"Ratusz w Oławie – neoklasycystyczna budowla wzniesiona w roku 1823 według projektu Karola Schinkla. Budynek przebudowywano w latach 1910-1915, oraz w roku 1924. Obecnie ratusz jest siedzibą władz miasta oraz Izby Muzealnej Ziemi Oławskiej i biblioteki."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Mannheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Dr._Otto_Beck_-_Senior_mayor_of_Mannheim_%281891-1908%29.jpg","page_title":"University of Mannheim","context_page_description":"The University of Mannheim, abbreviated UMA, is a public research university in Mannheim, Baden-Württemberg, Germany. Founded in 1967, the university has its origins in the Palatine Academy of Sciences, which was established by Elector Carl Theodor at Mannheim Palace in 1763, as well as the Handelshochschule, which was founded in 1907.\\nThe university offers undergraduate and graduate programs in business administration, economics, law, social sciences, humanities, mathematics, computer science and information systems. The university's campus is located in the city center of Mannheim and its main campus is in the Mannheim Palace. In the academic year 2016/2017 the university had 12,000 full-time students, 907 academic staff, with 194 professors, and a total income of around €123 million. It is organized into five schools and two graduate colleges."},{"page_url":"https://de.wikipedia.org/wiki/Hans_Carl_von_Carlowitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Carlowitz_Sylvicultura.jpg","page_title":"Hans Carl von Carlowitz","context_page_description":"Hans Carl von Carlowitz, eigentlich Johann „Hannß“ Carl von Carlowitz, war ein deutscher Kameralist, königlich-polnischer und kurfürstlich-sächsischer Kammer- und Bergrat sowie Oberberghauptmann des Erzgebirges. Er schrieb mit der Sylvicultura oeconomica, oder haußwirthliche Nachricht und Naturmäßige Anweisung zur wilden Baum-Zucht das erste geschlossene Werk über die Forstwirtschaft und gilt als wesentlicher Schöpfer des forstlichen Nachhaltigkeitsbegriffs."},{"page_url":"https://tr.wikipedia.org/wiki/Ege_kedisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Aegean_cat.jpg","page_title":"Ege kedisi","context_page_description":"Ege kedisi, Yunanistan'ın Kiklad Adaları çevresinde doğal olarak oluşan bir kedi ırkıdır. Yunan kedi yetiştiricileri 1990'lı yıllardan itibaren, Ege kedisinin resmî bir kedi türü olarak sayılması için çalışmaktadırlar. Ancak Ege kedisi günümüzde resmî bir kedi türü olarak kabul edilmemektedir."},{"page_url":"https://fr.wikipedia.org/wiki/Piste_d%27athl%C3%A9tisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Piste_athl%C3%A9tisme-fr.svg","page_title":"Piste d'athlétisme","context_page_description":"Une piste d'athlétisme standard est une surface plane oblongue composée de deux lignes droites et deux demi-cercles, dont le périmètre intérieur est de 400 m en plein air. La largeur et le nombre de couloirs sont variables. La piste d'athlétisme est souvent associée à d'autres aires, destinées à la pratique d'autres disciplines de l'athlétisme ou à d'autres sports."},{"page_url":"https://es.wikipedia.org/wiki/Torremocha_de_Jadraque","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Torremocha_de_Jadraque%2C_Guadalajara%2C_Espa%C3%B1a%2C_2015-12-28%2C_DD_155.JPG","page_title":"Torremocha de Jadraque","context_page_description":"Torremocha de Jadraque es un municipio español de la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. Tiene una superficie de 11,17 km² con una población de 27 habitantes y una densidad de 2,51 hab/km².\\nLinda con los términos municipales de Pinilla de Jadraque, Medranda, Cendejas de Padrastro, Pálmaces de Jadraque y Negredo. Buena parte del término está ocupado por cultivos cerealistas salvo las zonas más abruptas donde están presentes bosquetes de quejigo y encina.\\nEn el término municipal hay una estación de anillamiento de aves inaugurada en los años 1980."},{"page_url":"https://pt.wikipedia.org/wiki/Dows","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Dows_Depot.jpg","page_title":"Dows","context_page_description":"Dows é uma cidade localizada no estado americano de Iowa, no Condado de Franklin e Condado de Wright."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%AF%B8%E8%91%9B%E4%BA%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Baidicheng_Wu_hou_ci.jpg","page_title":"诸葛亮","context_page_description":"诸葛亮，字孔明，东汉末年徐州琅琊阳都人。三国蜀汉丞相，是中国历史上著名的政治家、军事家、发明家、及散文家。隐居隆中，自比管仲、乐毅，人称“卧龙”。刘备三顾始见之，为备画据荆益、联孙权、拒曹操之策，佐备取荆州，定益州，遂与魏、吴成鼎足之势。曹丕代汉，备称帝于成都，以亮为丞相。备死，亮辅后主刘禅，以丞相封武乡侯，兼领益州牧。整官制，修法度，志复中原。屡次北伐，与魏相攻战。建兴十二年卒于五丈原军中，年五十四，谥为忠武侯。《三国志·蜀志》有传。诸葛亮的才能、品格备受后世敬仰，故常被尊称为武侯、诸葛武侯。后民间小说、戏曲谓其通晓阴阳，料事如神。其一生“鞠躬尽瘁、死而后已”，是中国传统文化里忠臣与智者之代表。明罗贯中《三国演义》所刻画者，流传众口，最为著称。与汉昭烈帝刘备在统治蜀汉期间，提拔诸多名将与能臣，并奠定基础。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D8%A7%D8%AC_%D8%A8%D8%A7%D9%84%D9%84%D9%8A%D8%AB%D9%8A%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Lithium-citrate-2D-skeletal.png","page_title":"علاج بالليثيوم","context_page_description":"العلاج بالليثيوم هي مجموعة الطرق التي تستخدم مركبات الليثيوم في الطب النفسي كمثبتات للمزاج من أجل علاج الاضطراب ثنائي القطب بشكل أساسي، حيث يلعب دوراً في علاج الاكتئاب والهوس المرافق لهذه الحالة، كما أنه يخفف من خطر انتحار الأشخاص المصابين بهذا الاضطراب.\\nيعد مركب كربونات الليثيوم، والذي يباع تحت أسماء تجارية عدة، أكثر مركبات الليثيوم انتشاراً في علاج الحالات النفسية العصبية، وذلك بالإضافة إلى مركب سترات الليثيوم وأوروتات الليثيوم. استخدم في السابق مركبات هاليدات الليثيوم المختلفة في العلاج، إلا أن الآثار الجانبية نتيجة السميّة حدّت من انتشارها.\\nهناك عدة تفسيرات للآلية التي يعمل بها العلاج بالليثيوم، إلا أن التفسير الكيميائي الحيوي المفصل لا يزال غير معروف."},{"page_url":"https://ca.wikipedia.org/wiki/Mol%C3%AD_del_Mig_(Figar%C3%B3-Montmany)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Figaro_Moli_del_Mig_IPA-39576_6056_resize.jpg","page_title":"Molí del Mig (Figaró-Montmany)","context_page_description":"El Molí del Mig és un edifici del municipi de Figaró-Montmany inclòs en l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://nl.wikipedia.org/wiki/Oedipoda_canariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Oedipoda_canariensis_-_Flickr_-_S._Rae.jpg","page_title":"Oedipoda canariensis","context_page_description":"Oedipoda canariensis is een rechtvleugelig insect uit de familie veldsprinkhanen. De wetenschappelijke naam van deze soort is voor het eerst geldig gepubliceerd in 1892 door Krauss."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%B5%D1%98%D1%88%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ayano.jpg","page_title":"Гејша","context_page_description":"Гејши, геико или гејџи се традиционални женски jапонски забавувачkи, чии вештини вклучуваат изведба на различни јапонски уметности, како што се музика, танцување и поезија. Некои веруваат дека гејшите се проститутки, но тоа сепак е погрешно. Терминот „гејша“ е составен од 2 јапонски збора 芸 што значи уметност и 者 што значи „личност што прави“ или „се занимава со...“. Најбуквален превод на зборот гејша е уметник. Гејшите се многу почитувани и тешко е да се стане гејша.\\nМодерните гејши сѐ уште живеат во традиционалните куќи за гејши наречени „окија“ во квартови наречени ханамачи. Сепак, постарите гејши кои се успешни поседуваат своја куќа. Според зборовите на славната гејша Минеко Ивасаки „гејшата е како цвет, убава на свој начин, и како врба, грациозна, флексибилна и силна.“\\nВо Јапонија гејшата се смета за културна икона."},{"page_url":"https://lt.wikipedia.org/wiki/Tikrieji_pesliai","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Schwanz-Milane.jpg","page_title":"Tikrieji pesliai","context_page_description":"Tikrieji pesliai – sakalinių paukščių būrio, vanaginių šeimos, peslių pošeimio gentis. Priskiriami plėšriųjų paukščių kategorijai."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%A1%D5%B9%D5%A5%D5%AC%D5%B4%D5%BD%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6_(%D5%8A%D5%A5%D5%B6%D5%A6%D5%A1%D5%B5%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Penzenskaya_oblast_Pachelmsky_rayon.png","page_title":"Պաչելմսկի շրջան (Պենզայի մարզ)","context_page_description":"Պաչելմսկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Պենզայի մարզում։\\nՍտեղծվել է 1928 թվականին։ Վարչական կենտրոնը՝ Պաչելմա։"},{"page_url":"https://fr.wikipedia.org/wiki/Antiparall%C3%A9logramme","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Antiparallelogram.svg","page_title":"Antiparallélogramme","context_page_description":"L'antiparallélogramme est un quadrilatère croisé dont les côtés non adjacents sont de même longueur.\\nCe n'est pas un parallélogramme : il a deux côtés opposés qui ne sont pas parallèles et même, qui se coupent."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Media_Forest_most-broadcast_songs_of_2009_in_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Black_Eyed_Peas_at_Walmart_meeting.jpg","page_title":"List of Media Forest most-broadcast songs of 2009 in Romania","context_page_description":"Since July 2009, Israeli broadcast monitoring service Media Forest has been publishing four rankings which list the top ten most-broadcast Romanian and foreign songs on Romanian radio stations and television channels separately on a weekly basis. Nine radio stations—Europa FM, Info Pro, Kiss FM, Magic FM, National FM, Pro FM, Radio 21, Radio România Actualități and Radio ZU—and five television channels—1 Music Channel, Kiss TV, MTV Romania, Party TV and UTV Romania—were taken into consideration for the charts' compilation in 2009. They are based on the number of times tracks are broadcast, determined by acoustic fingerprinting.\\nMedia Forest also releases year-end charts in regards to the radio airplay, listing the most-broadcast songs of Romanian origin of the respective year, weighted by the official audience numbers provided by Asociația pentru Radio Audiență. David Deejay and Dony reached number one on the 2009 ranking with \\"So Bizarre\\". In 2009, eight and eleven singles were listed by Media Forest as the most-broadcast tracks on radio and television respectively."},{"page_url":"https://fr.wikipedia.org/wiki/John_Blankenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sparta-PSV_1-1_scheidsrechter_J._Blankenstein%2C_Bestanddeelnr_933-7309.jpg","page_title":"John Blankenstein","context_page_description":"John Blankenstein, né le 12 février 1949 à De Bilt et mort le 25 août 2006 à La Haye, est un arbitre néerlandais de football.\\nIl débuta en tant qu'arbitre amateur de 1966 à 1979, année où il officia en première division néerlandaise. En 1985, il reçut son accréditation internationale et mit fin à sa carrière d'arbitre en 1996.\\nIl fut l'un des premiers aux Pays-Bas à avoir affiché clairement son homosexualité et mena des combats contre la discrimination des personnes homosexuelles. Il mourut d'une maladie rare des reins en 2006."},{"page_url":"https://nl.wikipedia.org/wiki/Barbeel","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/JuvenielBarbeeltje.JPG","page_title":"Barbeel","context_page_description":"De barbeel is een gestroomlijnde karperachtige vis van de middenlopen van rivieren, de zogenaamde barbeelzone."},{"page_url":"https://bg.wikipedia.org/wiki/Sympetrum_sanguineum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/14-18-29-symp-sang.jpg","page_title":"Sympetrum sanguineum","context_page_description":"Sympetrum sanguineum е вид водно конче от семейство Libellulidae. Видът не е застрашен от изчезване."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_Kepala_Daerah_dan_Wakil_Kepala_Daerah_Kabupaten/Kota_di_Sumatra_Barat","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Lambang_Kota_Payakumbuh.png","page_title":"Daftar Kepala Daerah dan Wakil Kepala Daerah Kabupaten/Kota di Sumatra Barat","context_page_description":"Berikut daftar Kepala Daerah dan Wakil Kepala Daerah di 19 kabupaten/kota di Sumatra Barat adalah:\\nCatatan:\\n\\"Mulai menjabat\\" merupakan awal periode kepemimpinan yang saat ini sedang berjalan atau, untuk penjabat bupati/walikota, merupakan tanggal pengangkatan sebagai penjabat bupati/walikota."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%93%AC%E9%B0%95%E8%99%8E%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/PseudogobiusOlorumWaite.jpg","page_title":"擬鰕虎屬","context_page_description":"拟虾虎鱼属是背眼虾虎鱼科下的一个属，广泛分布于印度洋和太平洋的热带和温带海域，此外也见于河口。"},{"page_url":"https://eo.wikipedia.org/wiki/Al%C4%9Deria_Armeo","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/R%C3%A9gions_militaires-Alg%C3%A9rie.jpg","page_title":"Alĝeria Armeo","context_page_description":"La Popola Nacia Armeo estas la armeo de la Armitaj Fortoj de Alĝerio. La ekipado de la Alĝeria Armeo estas havigita de Rusio, de Ĉinio, kaj de variaj aliaj landoj.\\nTiu Armeo inkludas du armigitajn kaj tri mekanizitajn diviziojn, unu el kiuj estas la 8a Armigita Divizio baze ĉe Ras El Ma, 90 kilometrojn el Sidi Bel Abbes, en la 2a Militregiono. La divizio estis formita el la 8a Armigita Brigado post 1988. Alia estas la 40a Mekanizita Infanteria Divizio ŝajne baze en la 3a Militregiono. La misio de la 40a Mekanizita Divizio estas kutime la protektado de la limo inter Alĝerio kaj Maroko, kiu estas la najbara lando kun kiu Alĝerio tenas plej neamikajn rilatojn. La IISS Military Balance 2013 nomigis unu el la aliaj Mekanizitaj Divizioj kiel 12a Mekanizita Infanteria Divizio."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B9%D0%BB-%D0%9A%D1%80%D1%96%D0%BA_%D0%A2%D0%B0%D1%83%D0%BD%D1%88%D0%B8%D0%BF_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%92%D0%B5%D0%BD%D0%B0%D0%BD%D0%B3%D0%BE,_%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Oil_Creek_State_Park_Toy_Run.jpg","page_title":"Ойл-Крік Тауншип (округ Венанго, Пенсильванія)","context_page_description":"Ойл-Крік Тауншип — селище в США, в окрузі Венанго штату Пенсильванія. Населення — 854 особи."},{"page_url":"https://en.wikipedia.org/wiki/Asian_palm_civet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Common_Palm_Civet_%28Paradoxurus_hermaphroditus%29_%287781509830%29.jpg","page_title":"Asian palm civet","context_page_description":"The Asian palm civet is a viverrid native to South and Southeast Asia. Since 2008, it is IUCN Red Listed as Least Concern as it accommodates to a broad range of habitats. It is widely distributed with large populations that in 2008 were thought unlikely to be declining.\\nIn Indonesia, it is threatened by poaching and illegal wildlife trade; buyers use it for the increasing production of kopi luwak, a form of coffee that involves ingestion and excretion of the beans by the animal.\\nAsian palm civets are claimed to be the carrier that transmitted SARS from horseshoe bats to humans."},{"page_url":"https://en.wikipedia.org/wiki/J._Ernest_Wharton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/J._Ernest_Wharton.jpg","page_title":"J. Ernest Wharton","context_page_description":"James Ernest Wharton was an American attorney and politician. A Republican, he served as a member of the United States House of Representatives from New York from 1951 to 1965."},{"page_url":"https://es.wikipedia.org/wiki/Macavity","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Koty_GSuski.jpg","page_title":"Macavity","context_page_description":"Macavity es un personaje ficticio que se describe en un poema de El libro de los gatos habilidosos del viejo Possum escrito por T.S. Eliot. El personaje también aparece en la obra musical Cats de Andrew Lloyd Webber."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Landsberg_(Ratingen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Schloss_Landsberg_Ratingen_Gartenanlagen_1904.jpg","page_title":"Schloss Landsberg (Ratingen)","context_page_description":"Das Schloss Landsberg ist eine Schlossanlage im Ruhrtal auf dem Stadtgebiet von Ratingen in unmittelbarer Nähe des Schlosses Hugenpoet. Es steht nahe dem Kettwiger Ortsteil Vor der Brücke etwa einen Kilometer südwestlich des Zentrums von Kettwig an der Straße nach Mülheim an der Ruhr-Mintard inmitten eines englischen Landschaftsparks mit ausgedehntem Waldgebiet.\\nDie Anlage geht auf eine mittelalterliche Höhenburg vom Ende des 13. Jahrhunderts zurück, die durch den Grafen Adolf V. von Berg erbaut wurde. Sie diente in jener Zeit vornehmlich zur Sicherung der nahe gelegenen wichtigen Brücke über die Ruhr, die Kettwig mit Ratingen verband. Seit spätestens 1288 gehörte die Burg den Herren von Landsberg, die ihren Stammsitz – mit einer Unterbrechung von 120 Jahren – bis 1903 besaßen.\\nWährend des 17. und 18. Jahrhunderts mehrfach verändert, erhielt die Anlage ihre heutige Gestalt im Stil des Historismus durch den Industriellen August Thyssen, der sie 1903 erwarb und zu seinem repräsentativen Wohnsitz umgestalten ließ. Das frühere Gut Landsberg wird seit diesen baulichen Veränderungen Schloss Landsberg genannt. Es gehört seit 1926 einer Stiftung der Familie Thyssen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E7%8F%AD%E7%89%99%E5%9F%8E%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Kathedrale.Murcia.Spanien.JPG","page_title":"西班牙城市列表","context_page_description":"本條目為西班牙城市列表：\\n阿爾梅里亞\\n阿爾赫西拉斯\\n阿利坎特\\n畢爾巴鄂\\n拜倫\\n巴塞隆納\\n雷阿爾城\\n卡斯特利翁-德拉普拉納\\n科爾多瓦\\n休達\\n埃爾切\\n希洪\\n格爾尼卡\\n格拉納達\\n伊倫\\n拉科魯尼亞\\n拉斯帕爾馬斯\\n洛格羅尼奧\\n馬拉加\\n穆爾西亞\\n馬德里\\n奧維耶多\\n帕爾馬\\n潘普洛納\\n聖塞瓦斯提安\\n索里亞\\n孔波斯特拉的聖地牙哥\\n塞維利亞\\n托萊多\\n比利亞雷亞爾\\n維戈\\n巴利亞多利德\\n比利亞羅夫萊多\\n巴倫西亞\\n蘇馬拉加\\n薩拉戈薩\\n阿爾瓦塞特"},{"page_url":"https://ckb.wikipedia.org/wiki/%DA%95%DB%95%D9%86%DA%AF%DA%A9%D9%88%DB%8E%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Ishihara_11.PNG","page_title":"ڕەنگکوێری","context_page_description":"ڕەنگکوێری نەخۆشییەکی میراتییە. کەسێکی تووشی ڕەنگکوێری بووە ناتوانێت ڕەنگەکان لە یەک جیا بکاتەوە و بە جێی ئەو ڕەنگانە کە نایبینێت، شەبەنگێک ڕەنگ لە نێوان تووسی و ڕەشدا دەبینێت."},{"page_url":"https://sr.wikipedia.org/wiki/3._korpus_Armije_Republike_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/3._Korpus_Armije_RBIH_v1.png","page_title":"3. korpus Armije Republike Bosne i Hercegovine","context_page_description":"Treći korpus Armije Republike Bosne i Hercegovine je jedan od sedam korpusa koji je za vrijeme Rata u Bosni i Hercegovini djelovao u sastavu Armije Republike Bosne i Hercegovine. Osnovan je 1. decembra 1992. godine, na osnovu odluke od 18. avgusta kojom je tadašnji komandant Štaba Vrhovne komande Sefer Halilović naredio osnivanje vojnih korpusa. Sjedište korpusa je bilo u Zenici."},{"page_url":"https://ca.wikipedia.org/wiki/Lar%C3%A7ay","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Map_commune_FR_insee_code_37124.png","page_title":"Larçay","context_page_description":"Larçay és un municipi francès, situat al departament de l'Indre i Loira i a la regió de Centre – Vall del Loira. L'any 2007 tenia 2.285 habitants."},{"page_url":"https://eo.wikipedia.org/wiki/Gotika_arkitekturo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Bath.abbey.fan.vault.arp.jpg","page_title":"Gotika arkitekturo","context_page_description":"Gotika arĥitekturo estas eŭropa arĥitekturo de alta kaj malfrua mezepoko konstruita en gotika stilo. La gotiko estas epoko de arĥitekturo kaj arto de la mezepoko en Eŭropo. Ĝi estiĝis kiel karakteriza arĥitektura stilo proksimume 1140 en centra Francujo, pli precize en Francilio kaj de tie ĝi iom post iom disvastiĝis en plimulton de la ceteraj landoj de okcidenta kaj centra Eŭropo kaj daŭris norde de la Alpoj ĝis proksimume 1500–1550. La antaŭe regantan arĥitekturan kaj artan stilon oni nomas romaniko, la postsekvan renesanco. En la postgotiko la gotika arĥitekturo pluvivis ankaŭ ekster sia epoko ĝis en la barokepoko; la romantismo treege interesiĝis pri la stilo kaj kreis la novgotikon kiel variaĵo de la historiismo. La gotika stilo estas klare difinebla nur en la arĥitekturo, dum kiam tio ĉi ne samklare eblas sur la kampoj de plastiko kaj pentrarto.\\nLa gotiko estis epoko de bildigo de la kristana idearo kaj je tio utiligis al si grandkvante simbolojn kaj alegoriojn. Elstara arta kreitaĵo estas la gotika katedralo, kiu kiel tutarta verko unuigas arĥitekturon, plastikon kaj pentradon de la mezepoko."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Rohrbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Aigen-Schl%C3%A4gl_Wappen.png","page_title":"Bezirk Rohrbach","context_page_description":"Der Bezirk Rohrbach ist ein politischer Bezirk des Landes Oberösterreich.\\nEr ist der nördlichste Bezirk des Landes und gehört zum Mühlviertel."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B7%D9%86%D8%B7%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/TantaAliBek.jpg","page_title":"طنطا","context_page_description":"طنطا میصر اؤلکه‌سینین شهرلریندن بیریدیر. دنیز سَویه‌سیندن ۱۲ متر یۆکسکلیکده قۇرولان شهر سوْن نۆفوس ساییمینا گؤره توْپلام جمعیتی ۶۵۸۷۹۸ نفردیر و بۇ باخمیدان اؤلکه‌نین بؤیوک شهرلریندن بیری سایا گلیر."},{"page_url":"https://pt.wikipedia.org/wiki/Carlos_Filipe_Ximenes_Belo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Dom_Filipe_Ximenes_Belo_Assinatura.jpg","page_title":"Carlos Filipe Ximenes Belo","context_page_description":"Carlos Filipe Ximenes Belo, S.D.B. é um bispo católico timorense que, em conjunto com José Ramos-Horta, foi agraciado com o Nobel da Paz de 1996, pelo seu trabalho \\"em prol de uma solução justa e pacífica para o conflito em Timor-Leste\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Haras_national_de_Besan%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Haras_de_Besan%C3%A7on_0026.jpg","page_title":"Haras national de Besançon","context_page_description":"Le haras national de Besançon est un haras des haras nationaux de France du XVIIIᵉ siècle à Besançon dans le Doubs en Franche-Comté."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D1%84%D0%B8%D0%B3%D1%83%D1%80%D0%B8%D1%82%D0%B5_%D0%B2_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BC%D0%B8%D1%8F%D1%82%D0%B0_%D0%BD%D0%B0_%D0%93%D1%80%D0%B5%D0%B9:_IX._%D0%9D%D0%B5%D0%B2%D1%80%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Gray753.png","page_title":"Списък на фигурите в Анатомията на Грей: IX. Неврология","context_page_description":"Фигурите по-долу се срещат в глава IX-та: Неврология от Анатомията на Грей"},{"page_url":"https://es.wikipedia.org/wiki/L%C3%ADnea_Sur_del_Metro_de_Recife","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Montedosg.jpg","page_title":"Línea Sur del Metro de Recife","context_page_description":"La Línea Sur: Recife ↔ Cajueiro Seco es una de las líneas del Metro de Recife."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D1%82%D0%B5%D1%80_%D0%9C%D0%BE%D0%B4%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Walter_Model_October_1944%282%29.jpg","page_title":"Валтер Модел","context_page_description":"Ото Мориц Валтер Модел је био немачки фелдмаршал у Другом светском рату, командант армије и групе армија, одликован дијамантима за мачеве и храстово лишће Витешког крста. Познат је по надимком „Хитлеров ватрогасац“."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_County_of_Brant","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Brant_Monument_in_Brantford_Ontario_1.jpg","page_title":"List of historic places in County of Brant","context_page_description":"This is a list of historic places in County of Brant, Ontario, containing heritage sites listed on the Canadian Register of Historic Places, all of which are designated as historic places either locally, provincially, territorially, nationally, or by more than one level of government."},{"page_url":"https://en.wikipedia.org/wiki/Japanese_addressing_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Ginza_%2B_Shimbashi_Gaiku_plate.png","page_title":"Japanese addressing system","context_page_description":"The Japanese addressing system is used to identify a specific location in Japan. When written in Japanese characters, addresses start with the largest geographical entity and proceed to the most specific one. When written in Latin characters, addresses follow the convention used by most Western addresses and start with the smallest geographic entity and proceed to the largest. The Japanese system is complex and idiosyncratic, the product of the natural growth of urban areas, as opposed to the systems used in cities that are laid out as grids and divided into quadrants or districts."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D1%99%D0%BD%D0%BE_%D0%B2%D0%B0%D1%82%D1%80%D0%BE%D0%B3%D0%B0%D1%81%D0%BD%D0%BE_%D0%B4%D1%80%D1%83%D1%88%D1%82%D0%B2%D0%BE_%D1%83_%D0%92%D1%80%D0%B1%D0%B0%D1%81%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Muzej_u_Vrbasu%2C_Koplje_za_zastavu.jpg","page_title":"Добровољно ватрогасно друштво у Врбасу","context_page_description":"Добровољно ватрогасно друштво у Врбасу је удружење грађана, основано на њихову сопствену иницијативу, ради гашења пожара. Основано је 1904. године."},{"page_url":"https://es.wikipedia.org/wiki/Cumbia_norte%C3%B1a_mexicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Prague_Street_Musicians_%28Polka_Band%29.jpg","page_title":"Cumbia norteña mexicana","context_page_description":"Cumbia norteña es un subgénero musical de la cumbia mexicana, gestada en el noreste de México y parte de Texas.\\nLa cumbia fue introducida en México por el colombiano Luis Meyer soportado por la orquesta y voz de los mexicanos Tony Camargo y Rafael de Paz que permitieron al ritmo popularizarse en la parte central del país desde principio de los años 40's, además esporádicamente, se introdujeron temas de cumbia en películas mexicanas como parte de la trama dando a conocer más aún el ritmo.\\nLa consolidación del ritmo tanto en México como en otros países de Latinoamérica ya era un hecho a principios de los años 60's. por lo que grupos de todas las latitudes y géneros comienzan a inquetarse por el nuevo ritmo tropical e inician la interpretacíón de la misma con los instrumentos que poseían combinado con los folklores locales o incluso otros géneros tropicales dando lugar a nuevas variaciones de la cumbia original de Colombia. La cumbia norteña es el resultado de la mezcla de la música norteña y la cumbia mexicana, donde la música norteña forma parte del folklore mexicano reconocido internacionalmente y aún es uno de los géneros musicales mexicanos más antiguos de la era moderna."},{"page_url":"https://fr.wikipedia.org/wiki/Cantique_des_Cantiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/O%C3%B9_paissent_les_brebis_04221.JPG","page_title":"Cantique des Cantiques","context_page_description":"Le Cantique des Cantiques, dit aussi Cantique ou Chant de Salomon, est un livre de la Bible. Il revêt la forme d'une suite de poèmes, de chants d'amour alternés entre une femme et un homme, qui prennent à témoin d'autres personnes et des éléments de la nature. C'est l'un des livres de la Bible les plus poétiques.\\nSon écriture est attribuée traditionnellement à Salomon, roi d'Israël. Le texte est lu à la synagogue lors du shabbat de la fête de Pessa’h ainsi que, dans la tradition séfarade, lors de l’office de chaque vendredi soir."},{"page_url":"https://de.wikipedia.org/wiki/Zitadelle_J%C3%BClich","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Siege_and_capture_of_Julich_by_Maurice_of_Orange_in_1610.jpg","page_title":"Zitadelle Jülich","context_page_description":"Die Zitadelle Jülich war einst Bestandteil der Festung Jülich und ist das wichtigste erhaltene Baudenkmal der Stadt, und eine der am besten erhaltenen Festungen im Bastionärsystem in Deutschland. Sie wurde in den Jahren nach 1545 als Bestandteil einer Idealstadt der Renaissance erbaut und ist die älteste Zitadelle nördlich der Alpen. Ihr Baumeister war Alessandro Pasqualini. Sie stellt sich heute als eine vierzackige, bastionierte Festung mit einem Umfang von etwa 1200 Metern dar. Umgeben ist die Zitadelle von einem 10 Meter tiefen und 20 bis 30 Meter breiten, teilweise Wasser führenden Graben, aus dessen Grund sie emporwächst. Die Anlage überragt ihre Umgebung im Ganzen noch um etwa 5–10 m. Der Zugang von der Stadtseite aus erfolgt seit einigen Jahren über die Pasqualini-Brücke, über den Graben hinweg, durch eine Poterne. Auch von Norden erreicht man den Innenhof durch einen solchen Tunnel; nur wird der Graben hier nicht durch eine Brücke, sondern durch einen Damm überspannt.\\nDie Zitadelle ist heute Sitz des Gymnasiums Zitadelle der Stadt Jülich und ein geschütztes Kulturgut nach der Haager Konvention."},{"page_url":"https://ro.wikipedia.org/wiki/Brauvilliers","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Map_commune_FR_insee_code_55075.png","page_title":"Brauvilliers","context_page_description":"Brauvilliers este o comună în departamentul Meuse din nord-estul Franței. În 2010 avea o populație de 172 de locuitori."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%B5%D1%80%D0%B4%D0%B5%D1%80_(%D0%A5%D0%B0%D1%84%D0%B5%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/DEU_Werder_%28Havel%29_COA.png","page_title":"Вердер (Хафел)","context_page_description":"Вердер (Хафел) — град во сојузната покраина Бранденбург, Германија, сместен на реката Хафел во округот Потсдам-Мителмарк, западно од покраинскиот главен град Потсдам.\\nВердер има долга и богата историја и е национално признаен како место за одмор, означување од државата доделувана на региони во Германија кои се признаени и постојани се оценувани со соодветни воздушни и климатски квалитети, кои обезбедуваат здравствена средина на посетителите. Вердер е исто така познат како домаќин на еден од трите најголеми фестивали во Германија, Baumblütenfest, кој се одржува секоја година во мај."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%93%E3%83%83%E3%83%88%E6%BC%94%E7%AE%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Rotate_right_through_carry.svg","page_title":"ビット演算","context_page_description":"ビット演算とは、固定長のワードなどといった「ビットのカタマリ」に対して、各々のビット全てに対する論理演算をいっぺんに行う演算操作である。\\n実装の観点からは、現在一般的な二進法式の電子式コンピュータでは、加減算ではビットあたり数個程度の論理ゲートに加え多少複雑なキャリー伝搬の処理が、乗除算では多段に渡る処理が必要であるのに対し、ビット演算は1個か高々2個の論理ゲートで行えるため、多くの場合、最短サイクルしか必要としない。そのことから、高性能なプログラムを実現するための機械語コーディングではビット演算の使いこなしは重要なテクニックである。\\nビットマスクを利用したフラグ管理などに用いられるほか、Bitapアルゴリズムなど、各種のビット並列アルゴリズムの実装にも使われる。ビット並列アルゴリズムは特に、NEONあるいはSSE/AVXなどのSIMD拡張命令をサポートするCPUやGPUといった、容易に入手可能なハードウェアにおける高効率プログラミングの鍵である。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%80%8D%E5%A3%93%E5%99%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Voltage_quadrupler.svg","page_title":"倍壓器","context_page_description":"倍压器是提升电压的电路，利用输入电压将电容器充电，并且利用电路的切换，在理想情形下，可以使电容器的电压恰为输入电压的二倍。\\n最简单的倍压器是一种特殊的整流器，输入是交流电压，输出是两倍的直流电压，其切换元件为二极管，其切换只是因着输入电压的正负电压变化而切换导通或关闭。直流－直流的倍压器像交流－直流的倍压器，只是根据输入电压的正负变化而进行切换，需要驱动电路来控制其切换，多半也需要可受控的切换元件，例如晶体管。\\n倍压器是多倍压器电路的一种变形，许多的倍压器可以视为高倍率倍压器中的一级，若组合数个倍压器，可以达到更高的倍率。"},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Robeasca,_Buz%C4%83u","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Robeasca_jud_Buzau.png","page_title":"Comuna Robeasca, Buzău","context_page_description":"Robeasca este o comună în județul Buzău, Muntenia, România, formată din satele Moșești și Robeasca."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_l%C3%A9%C4%8Div%C3%BDch_rostlin,_S%E2%80%93%C5%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Clinopodium_vulgare_%E2%80%94_Flora_Batava_%E2%80%94_Volume_v11.jpg","page_title":"Seznam léčivých rostlin, S–Š","context_page_description":"Toto je seznam léčivých rostlin, jejichž český název začíná písmeneny S a Š.\\nCELÝ SEZNAM A-B-C-Č-D+Ď-E+F+G-H-Ch+I+J-K-L-M-N+O-P-R+Ř-S+Š-T+U-V+W+Y-Z+Ž"},{"page_url":"https://ro.wikipedia.org/wiki/Alegeri_locale_%C3%AEn_Bucure%C8%99ti,_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Nicu%C8%99or_Dan_candidatura_bgiu.jpg","page_title":"Alegeri locale în București, 2020","context_page_description":"Alegerile locale din Bucuresti vor avea loc pe 27 septembrie 2020. Autoritățile le vor asigura alegătorilor, la nivel național, măști și substanțe dezinfectante."},{"page_url":"https://en.wikipedia.org/wiki/War_in_Donbass","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/2014-09-20._%D0%9A%D1%83%D0%B7%D0%BD%D0%B5%D1%87%D0%BD%D1%8B%D0%B9_%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D1%8C_%D0%B2_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B5_370.jpg","page_title":"War in Donbass","context_page_description":"The War in Donbass is an armed conflict in the Donbass region of Ukraine, part of the Ukrainian crisis and the broader Russo-Ukrainian War. From the beginning of March 2014, in the aftermath of the 2014 Ukrainian revolution and the Euromaidan movement, protests by Russia-backed anti-government separatist groups took place in the Donetsk and Luhansk oblasts of Ukraine, collectively called the \\"Donbass\\". These demonstrations, which followed the February–March 2014 annexation of Crimea by the Russian Federation, and which were part of a wider group of concurrent protests across southern and eastern Ukraine, escalated into an armed conflict between the separatist forces of the self-declared Donetsk and Luhansk People's Republics, and the Ukrainian government. While the initial protests were largely native expressions of discontent with the new Ukrainian government, Russia took advantage of them to launch a co-ordinated political and military campaign against Ukraine. Russians citizens led the separatist movement in Donetsk from April until August 2014, and were supported by volunteers and materiel from Russia."},{"page_url":"https://en.wikipedia.org/wiki/Washington_Football_Team_draft_history","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Fred_Smoot.jpg","page_title":"Washington Football Team draft history","context_page_description":"This is a list of the Washington Football Team selections in the NFL Draft. The team was founded as the Boston Braves 1932, named after the local baseball franchise. The team changed their name to the Redskins in 1933 and moved to Washington, D.C. in 1937.\\nEvery year during April, each NFL franchise seeks to add new players to its roster through a collegiate draft known as the \\"NFL Annual Player Selection Meeting\\", which is more commonly known as the NFL Draft. Teams are ranked in inverse order based on the previous season's record, with the worst record picking first, and the second worst picking second and so on. The two exceptions to this order are made for teams that appeared in the previous Super Bowl; the Super Bowl champion always picks 32nd, and the Super Bowl loser always picks 31st. Teams have the option of trading away their picks to other teams for different picks, players, cash, or a combination thereof. Thus, it is not uncommon for a team's actual draft pick to differ from their assigned draft pick, or for a team to have extra or no draft picks in any round due to these trades."},{"page_url":"https://eu.wikipedia.org/wiki/Madeirako_Parke_Naturala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Cabo_Gir%C3%A3o_-_panoramio.jpg","page_title":"Madeirako Parke Naturala","context_page_description":"Madeirako Parke Naturala izen bereko uhartean dagoen erreserba biogenetikoa da. Bertan aurkitu daitekeen flora eta fauna oso bereziak dira. Horren arrazoia zera da: uhartea itsasoan isolatua dagoela"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8F%D0%BD%D1%8C%D1%88%D0%B0%D0%BD%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/ChinaHuludaoLianshan.png","page_title":"Ляньшань","context_page_description":"Ляньша́нь — район городского подчинения городского округа Хулудао провинции Ляонин."},{"page_url":"https://nl.wikipedia.org/wiki/Mallemolen_(Gouda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/GoudaMallemolen.jpg","page_title":"Mallemolen (Gouda)","context_page_description":"De Mallemolen of Molen van de Oostpolder in Schieland is een windmolen aan de Waddinxveense Wetering in de Nederlandse plaats Gouda.\\nDe molen werd in 1804 als poldermolen gebouwd, in opdracht van het Ambacht Moordrecht. In 1863 ging de molen over naar de nieuw opgerichte Oostpolder in Schieland. De Mallemolen bleef tot 1904 in bedrijf. In dat jaar werd bij de molen een gemaal gebouwd, dat door een zuiggasmotor werd aangedreven. Een jaar later werd de molen onttakeld om verbouwd te worden tot woning voor de machinist van het gemaal.\\nIn juni 2009 is men begonnen de Mallemolen te restaureren tot een maalvaardige molen voor educatieve doeleinden. Op 21 april 2010 is de kap geplaatst en is de Mallemolen na meer dan honderd jaar weer een complete molen geworden."},{"page_url":"https://en.wikipedia.org/wiki/Argel%C3%A8s-sur-Mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Plage_%281%29.JPG","page_title":"Argelès-sur-Mer","context_page_description":"Argelès-sur-Mer is a commune in the Pyrénées-Orientales department in southern France.\\nIt is about 25 km from Perpignan."},{"page_url":"https://fy.wikipedia.org/wiki/Searjemoardner","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/BathoryErzsebet.jpg","page_title":"Searjemoardner","context_page_description":"In searjemoardner is in persoan dy't trije of mear minsken apart faninoar, by ferskillende gelegenheden, fermoarde hat, wêrby't de moarden plakfine oer in perioade fan mear as in moanne tiid. De oarsaken fan searjemoarden moatte hast altyd socht wurde yn 'e geastlike ôfwikings fan 'e dieder. Hoewol't de media en de film- en tillefyzjeyndustry it foarkomme litte as is it ferskynsel 'searjemoardner' wat nijs, hawwe der nei alle gedachten altyd al searjemoardners west, allinnich waarden spesifike gefallen yn it ferline selden goed dokumintearre. Saakkundigen binne fan betinken dat leginden oer wearwolven en fampieren wierskynlik weromgeane op oantinkens oan eardere searjemoardners. Yn 'e tweintichste iuw fûn 76% fan alle bekende gefallen fan searjemoarden yn 'e Feriene Steaten plak."},{"page_url":"https://en.wikipedia.org/wiki/R%C3%B8yken_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Royken_krk1.jpg","page_title":"Røyken Church","context_page_description":"Røyken Church is a church in the Røyken municipality in Viken county, Norway.\\nRøyken Church serves Røyken parish in the Lier rural deanery of the Church of Norway. Røyken Church is a medieval nave stone church. It was constructed of local red granite. It is believed to date from the 1220s. The first written record of the church appeared in Eysteinn Erlendsson's Røde Bok in 1392. The church is characterized by the same strict simplicity that characterizes many churches from the same time.\\nThe church has a rectangular nave with stone walls that are around 2 meters thick. The interior, which has been painted several times, was restored in the 1930s. The church has a medieval baptismal font in soapstone."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%88%E8%90%8C%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Aeschynomene_fluitans.JPG","page_title":"合萌属","context_page_description":"合萌属是蝶形花科下的一个属，为草本或灌木植物。该属共有约250种，包括合萌，分布于热带和亚热带地区。"},{"page_url":"https://de.wikipedia.org/wiki/Ehrenstrafe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Eselsritt.jpg","page_title":"Ehrenstrafe","context_page_description":"Schand- oder Ehrenstrafen sind Strafen, die einen Verurteilten demütigen und bloßstellen. Im Unterschied zu den Leibesstrafen wird der Verurteilte nicht oder nur gering körperlich geschädigt. Allerdings wurden Schandstrafen oft zusammen mit vorangehenden Rutenstrafen und Auspeitschungen verhängt.\\nSchandstrafen wurden in Europa im späten Mittelalter und in der Frühen Neuzeit durch die Niedere Gerichtsbarkeit verhängt. Zu den Schandstrafen zählten der Pranger, der Schandpfahl, der Schandkorb, der Lästerstein, die Halsgeige, die Schandflöte sowie der Eselsritt."},{"page_url":"https://cs.wikipedia.org/wiki/D%C4%9Brn%C3%A1_p%C3%A1ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/D%C4%9Brn%C3%A1_p%C3%A1ska.JPG","page_title":"Děrná páska","context_page_description":"Děrná páska je historické paměťové médium. Používala se v dálnopisech a též v terminálech, kde nahradila děrný štítek.\\nVětšinou se jednalo o papírový nosič. Avšak jako nosič dat pro řízení činnosti pořizovačů dat se používala trvanlivější kovová. Dálnopisná páska byla pětistopá. Páska pro pořízení dat do počítače byla osmistopá. Kontrola bezchybného děrování byla mimo jiné prováděna pomocí liché nebo sudé parity, tzn., že veškeré znaky měly buď lichý nebo sudý počet děrovaných otvorů.\\nČtení děrné pásky probíhalo buď mechanicky nebo opticky.\\nU mechanického principu byla pod děrnou páskou kovová plocha a nad děrnou páskou byly umístěny kovové kartáčky, které klouzaly po povrchu pásky. Pak byl spuštěn pohyb pásky a v místech, kde měla páska dírku došlo k vodivému propojení kartáčků s podkladem, což vydalo elektrický impulz.\\nU optického principu byla páska prosvětlována tenkým paprskem světla a v místech, kde byly dírky, došlo k světelnému impulzu na snímací ploše pod páskou, což vydalo elektrický impulz.\\nOba způsoby čtení byly náchylné k chybám."},{"page_url":"https://fi.wikipedia.org/wiki/Milton_Erickson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Erickson_college.jpg","page_title":"Milton Erickson","context_page_description":"Milton Hyland Erickson, oli yhdysvaltalainen lääkäri ja psykiatri, joka erikoistui hypnoterapiaan ja perheterapiaan.\\nHänen terapiaotteensa olivat omintakeisia ja ehkä siksikin usein menestyksellisiä. Hän käytti narratiivista menetelmää ja metaforia terapiassaan. Hän on eräs lyhytterapian edelläkävijöitä ja kuuluu myös ensimmäisiin terapeutteihin, jotka tutkivat ihmisen psyykkisiä ongelmia perhesysteemitaustalta. Lyhytterapauttisiin lähestymisiin luettava ratkaisukeskeinen psykoterapia sai vaikutteita Milton H. Ericksonin opeista. Hän vältti psykopatologiaan liittyviä terapeuttisia lähestymistapoja. Niiden sijaan hän piti kaikkia asiakkaitaan pohjimmiltaan terveinä. Hänen vaikutuksensa näkyi myös NLP:n kehittymisessä.\\nMilton Erickson syntyi toisena lapsena 11-lapsiseen suurperheeseen, kasvoi maalla ja aikoin maanviljelijäksi kuten isänsä. Hänen puheensa kehitys oli viivästynyttä. 17-vuotiaana hän sai polion ja oli pitkiä aikoja halvaantuneena elämän tarkkailijana, joka oli ilmeisesti se aika, jolloin hän kehitti näkemyksiään ihmisen psyykestä."},{"page_url":"https://pl.wikipedia.org/wiki/St_Endellion","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/The_Collegiate_Church_of_St_Endellion_-_geograph.org.uk_-_216898.jpg","page_title":"St Endellion","context_page_description":"St Endellion – wieś w Anglii, w Kornwalii. Leży 72 km na północny wschód od miasta Penzance i 346 km na zachód od Londynu. W 2001 miejscowość liczyła 1143 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Matthew_Dub%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Matthew_Dub%C3%A9%2C_d%C3%A9put%C3%A9%2C_mars_2018.jpg","page_title":"Matthew Dubé","context_page_description":"Matthew Dubé is a Canadian politician who was elected to the House of Commons in the 2011 federal election to represent the electoral district of Chambly—Borduas in Quebec as a member of the New Democratic Party. He was re-elected in 2015 to the redistributed riding of Beloeil—Chambly but lost his seat in 2019."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%AC%CF%81%CE%BA%CE%BB%CE%B5%CF%8A_%CE%A7%CE%B5%CE%BD%CF%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Barclay_Vincent_Head.jpg","page_title":"Μπάρκλεϊ Χεντ","context_page_description":"O Μπάρκλεϊ Βίνσεντ Χεντ ήταν Βρετανός νομισματολόγος και επιμελητής του Τμήματος Νομισμάτων και Μεταλλίων στο Βρετανικό Μουσείο.\\nΟ Χεντ ξεκίνησε να δουλεύει στο Βρετανικό Μουσείο το 1864. Ανήλθε στη θέση του επιμελητή του Τμήματος Νομισμάτων και Μετάλλων του Βρετανικού Μουσείου, την οποία κατείχε από το 1893 ως το 1906. Δημοσίευσε οκτώ από τα τριάντα βιβλία του καταλόγου των ελληνικών νομισμάτων του Μουσείου. Δημοσίευσε επίσης μία έκδοση αναφοράς για το αντικείμενο, η οποία είχε και δεύτερη έκδοση.\\nΤο 1907 του απονεμήθηκε το μετάλλιο της Βασιλικής Νομισματολογικής Εταιρείας και το 1914 εξελέγη Επίτιμο Μέλος της Academia Romana του Βουκουρεστίου."},{"page_url":"https://en.wikipedia.org/wiki/Wabash_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Sunset_Point_near_Delphi.jpg","page_title":"Wabash River","context_page_description":"The Wabash River is a 503-mile-long river that drains most of the state of Indiana in the United States. It flows from the headwaters in Ohio, near the Indiana border, then southwest across northern Indiana turning south near the Illinois border where the southern portion forms the Indiana-Illinois border before flowing into the Ohio River. It is the largest northern tributary of the Ohio River and third largest overall, right behind the Cumberland and Tennessee Rivers. From the dam near Huntington, Indiana, to its terminus at the Ohio River, the Wabash flows freely for 411 miles. Its watershed drains most of Indiana. The Tippecanoe River, White River, Embarras River and Little Wabash River are major tributaries. The river's name comes from a Miami Indian word meaning \\"water over white stones\\".\\nThe Wabash is the state river of Indiana, and subject of the state song \\"On the Banks of the Wabash, Far Away\\" by Paul Dresser."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Suomen_ortodoksisista_kirkoista","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Kristuksen_taivaaseenastumisen_kirkko_Vantaa.jpg","page_title":"Luettelo Suomen ortodoksisista kirkoista","context_page_description":"Tämä on luettelo Suomen ortodoksisista kirkkorakennuksista. Sijainti-sarakkeessa on määreenä ensiksi kirkon nykyinen sijaintikunta, sen jälkeen paikkakunta tai entinen kunta."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Knights_Grand_Cross_of_the_Royal_Guelphic_Order","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/2ndDukeOfGloucester.jpg","page_title":"List of Knights Grand Cross of the Royal Guelphic Order","context_page_description":"Below is an incomplete list of Knights Grand Cross of the Royal Guelphic Order from the creation of the order in 1815 until 1837. A Hanoverian order, appointments have not been conferred by the British monarch since the death of King William IV in 1837, when the personal union of the United Kingdom and Hanover ended. After 1837 the order continued to be conferred by the Kingdom of Hanover, until the Kingdom was dissolved by Prussia in 1866. After this it became an order of the Royal House of Hanover."},{"page_url":"https://en.wikipedia.org/wiki/Samo%C3%ABns","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Samoens.jpg","page_title":"Samoëns","context_page_description":"Samoëns is a commune in the Haute-Savoie department in the Auvergne-Rhône-Alpes region in south-eastern France. It is the principal commune for the canton which bears its name. The town of Samoëns is located in the Vallée du Giffre in the French Alps."},{"page_url":"https://et.wikipedia.org/wiki/Charles_Curtis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Charles_Curtis-portrait.jpg","page_title":"Charles Curtis","context_page_description":"Charles Curtis oli Ameerika Ühendriikide poliitik, asepresident aastail 1929–1933.\\nTema ema oli päritolult kansa. Curtis oli esimene ja siiani viimane põlisameeriklane, kes nii kõrgele ametikohale on tõusnud."},{"page_url":"https://ca.wikipedia.org/wiki/Bruc","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Erica_multiflora.jpg","page_title":"Bruc","context_page_description":"El gènere Erica inclou al voltant de 700 d'arbusts, anomenats brucs, pertanyents a la família de les ericàcies. Són generalment plantes resistents a la sequera i al foc. El matollar de bruc s'anomena bruguerar, brugosa, bruguer o bruguera."},{"page_url":"https://nl.wikipedia.org/wiki/Mart%C3%ADn_Luis_Guzm%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Mart%C3%ADn_Luis_Guzm%C3%A1n.JPG","page_title":"Martín Luis Guzmán","context_page_description":"Martín Luis Guzmán was een Mexicaans schrijver en journalist.\\nGuzmán studeerde recht in Mexico-Stad en sloot zich in 1914 aan bij de revolutionairen van Pancho Villa. Nadat hij gevangen werd genomen vluchtte hij naar Spanje waar hij zijn eerste boek publiceerde. Tussen 1916 en 1920 woonde hij in de Verenigde Staten, waar hij een Spaanstalig tijdschrift publiceerde. In 1920 keerde hij terug naar Mexico, om tot afgevaardigde te worden gekozen. Wegens nieuwe problemen vluchtte hij in 1924 wederom naar Spanje, waar hij bleef tot het uitbreken van de Spaanse Burgeroorlog in 1936.\\nGuzmán geldt als een van de grondleggers van de 'revolutionaire roman'. Hij schreef onder andere La sombra del caudillo en El águila y la serpiente Tussen 1936 en 1951 schreef hij een vijfdelige biografie over Pancho Villa. Guzmán heeft ook gediend als ambassadeur bij de Verenigde Naties. Hij werd tot senator gekozen in 1970 en overleed zes jaar later."},{"page_url":"https://it.wikipedia.org/wiki/Pu%C5%A1%C4%8Dino","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Flag_of_Puschino_%28Moscow_oblast%29.png","page_title":"Puščino","context_page_description":"Puščino è una città della Russia europea centrale, nell'oblast' di Mosca; sorge lungo il fiume Oka, 119 km a sud della capitale.\\nIl villaggio è attestato già nel XVI secolo; nel 1956 iniziò la costruzione di una cittadella della scienza, mentre nel 1966 venne concesso lo status di città.\\nPuščino è sede del Centro russo per l'innovazione biotecnologica; nei pressi della cittadina, inoltre, sull'opposta sponda del fiume Oka, si trova la riserva naturale Prioksko-Terrasnyj."},{"page_url":"https://ro.wikipedia.org/wiki/Cautethia_grotei","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Cautethia_grotei_MHNT_CUT_2010_0_254_Florida_City%2C_Florida%2C_male_ventral.jpg","page_title":"Cautethia grotei","context_page_description":"Cautethia grotei este o specie de molie din familia Sphingidae. Este întâlnită în Florida, Statele Unite și în Insulele din Caraibe.\\nAnvergura este de 28-40 mm. Există mai multe generații într-un singur an în Florida. Adulții se hrănesc cu nectare de la diferite specii de flori, cum ar fi Asystasia gangetica și Dracaena fragrans.\\nLarvele au fost observate hrănindu-se pe specii variate de Rubiaceae, printre care se numără Chiococca alba, Erithalis fruticosa și Symphoricarpos albus."},{"page_url":"https://nl.wikipedia.org/wiki/Overstag_gaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Windhoeken.JPG","page_title":"Overstag gaan","context_page_description":"Overstag gaan is een manoeuvre waarbij de voorsteven van de zeilboot door de wind wordt gedraaid. Als gevolg daarvan worden de zeilen naar het andere boord verplaatst door de wind. Om het overstag gaan te vergemakkelijken en tijdens de draai minder snelheid te verliezen kunnen handmatig wisselingen in de zeilstanden van de verschillende zeilen tijdens en vlak voor het overstag gaan worden aangebracht. Gijpen kan worden uitgevoerd door op het moment dat de wind recht van achteren komt het zeil handmatig naar de andere zijde van de boot te trekken en daar weer uit te vieren."},{"page_url":"https://nl.wikipedia.org/wiki/Heilig_Hartkerk_(Koblenz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Bundesarchiv_Bild_146-1974-115-53%2C_Koblenz%2C_besch%C3%A4digte_Herz-Jesu-Kirche.jpg","page_title":"Heilig Hartkerk (Koblenz)","context_page_description":"De Kerk van het Heilig Hart van Jezus is een rooms-katholiek kerkgebouw in de Duitse stad Koblenz. Het is een van de belangrijkste neoromaanse kerkgebouwen van Duitsland. Sinds 2002 prijkt de kerk op de Werelderfgoedlijst Boven Midden-Rijndal. De kerk valt ook onder het beschermd cultuurgoed van de Haagse Conventie. De kerk is gewijd aan het Heilig Hart van Jezus."},{"page_url":"https://no.wikipedia.org/wiki/James_W._Gerard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/James_W._Gerard.png","page_title":"James W. Gerard","context_page_description":"James Watson Gerard var en amerikansk diplomat.\\nGerard tok høyere jus-eksamener ved Columbia University og ble advokat i New York i 1892. Han ble et framtredende medlem av Det demokratiske parti. I 1913 ble han utnevnt til USAs ambassadør i Tyskland. Den 3. februar 1917 forlot han landet ettersom de diplomatiske forbindelsene mellom landene ble avbrutt ved USAs inntreden i verdenskrigen, og ble deretter på nytt praktiserende diplomat i New York. Gerard har skrevet to bøker om sin tid i Tyskland, My Four Years in Germany, og Face to Tace with Kaiserism – begge sterkt tysklandskritiske. Den førstnevnte boken ble omskrevet til filmmanus og filmatisert i 1918."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%9D%D0%9A-%D1%96%D0%BD%D1%82%D0%B5%D1%80%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D1%86%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Celegans_wt_nhr80rnai.png","page_title":"РНК-інтерференція","context_page_description":"РНК-інтерференція, РНКі — система контролю активності генів еукаріотичних клітин, що здійснюється за допомогою коротких молекул рибонуклеїнової кислоти. Ключовими молекулами в РНКі є малі інтерферуючі РНК та мікроРНК, ці молекули можуть вступати у взаємодію із комплементарними послідовностями в інших молекулах РНК, наприклад у матричних РНК і підвищувати або пригнічувати їхню активність. Одним найпоширеніших та найкраще вивчених механізмів дії РНКі є посттранскрипційне пригнічення експресії генів шляхом руйнування або деаденілювання мРНК.\\nРНК-інтерференція виявлена у клітинах більшості еукаріот. Вона є важливим механізмом захисту клітини від паразитуючих генів — вірусів та транспозонів, також бере участь у регуляції експресії власних генів організму, зокрема у процесі ембріогенезу.\\nВибірковий і потужний характер впливу РНКі на експресію генів дозволяє використовувати це явище як зручний інструмент біологічних досліджень, як у культурах клітин так і в живих організмах. Використання цього шляху також є багатообіцяючим для біотехнології та медицини, зокрема для розробки та впровадження нового покоління ліків."},{"page_url":"https://nl.wikipedia.org/wiki/Rijn_en_Weert","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Werkhoven_-_molen_Rijn_en_Weert_tegen_avondlucht.jpg","page_title":"Rijn en Weert","context_page_description":"De Rijn en Weert is een korenmolen in Werkhoven in de provincie Utrecht.\\nDe molen werd in 1882 gebouwd ter vervanging van een molen bij kasteel Beverweerd. De molen bleef tot in de jaren twintig van de twintigste eeuw op windkracht in bedrijf, een elektromotor nam de functie over, waarna van de molen op den duur alleen de stenen romp overbleef. De Stichting Korenmolen Werkhoven heeft zich vanaf 1986 ingezet voor complete restauratie. In 1994 werd de molen weer maalvaardig op windkracht in bedrijf genomen. De roeden zijn 23,7 meter lang en zijn voorzien van het oudhollands wieksysteem met zeilen. De molen maalt wekelijks op vrijwillige basis graan dankzij enkele vrijwillige molenaars."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Alison_Nicholas","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/2009_Solheim_Cup_-_Alison_Nicholas_%281%29.jpg","page_title":"Alison Nicholas","context_page_description":"Alison Nicholas sī chi̍t-ūi Eng-kok ê chit-gia̍p soaⁿ-kiû soán-chhiú."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D0%B4%D0%B6_%D0%B0%D0%BB-%D0%90%D1%80%D0%B0%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Burj_Al_Arab_Hotel_Interior.JPG","page_title":"Бурдж ал-Араб","context_page_description":"„Бурдж ал Араб“ е луксозен 7-звезден хотел в Дубай, Обединени арабски емирства. Със своите 321 m, той е четвъртият най-висок хотел в света.\\nУникалната сграда е построена върху изкуствен остров, отдалечен на 280 м от брега на Персийския залив, свързан с него чрез тесен мост, който минава над самата водна повърхност.\\nСтроежът на хотела започва през 1994 г. и е отворен за гости на 1 декември 1999 г. Хотелът има формата на корабно платно. На самия му връх има площадка за хеликоптери, ресторант Ал Мунтаха и бар Скайвю бар с гледка към океана.\\nЛюбопитен е фактът, че погледнат от към морето, очертанията на хотела наподобяват „християнски кръст“.\\nВ „Бурдж ал Араб“ няма стандартни стаи. Най-малкият апартамент заема 169 m², а най-големият – около 780 m². Цената за нощувка варира между 1000 $ и 15 000 $. Кралският апартамент е най-скъп – 28 000 $."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lyaud","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Map_commune_FR_insee_code_74157.png","page_title":"Lyaud","context_page_description":"Lyaud sī ūi-tī Hoat-kok Rhône-Alpes toā-khu Haute-Savoie koān ê chi̍t ê commune."},{"page_url":"https://eu.wikipedia.org/wiki/Pseudoleistes_guirahuro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/CHOPIM-DO-BREJO_%28Pseudoleistes_guirahuro%29.jpg","page_title":"Pseudoleistes guirahuro","context_page_description":"Pseudoleistes guirahuro Pseudoleistes generoko animalia da. Hegaztien barruko Icteridae familian sailkatua dago."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D6%80%D5%A1%D6%81%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AC%D5%A1%D6%80%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Ge-money-tetri-50-2006-obv.jpg","page_title":"Վրացական լարի","context_page_description":"Լարի, Վրաստանի դրամական միավորը։ Լարիի մանրը թեթրին է, 1 լարին = 100 թեթրի։\\nISO 4217 կոդը GEL-ն է։ Շրջանառության մեջ է մտել 1995 թվականից նախագահ Էդուարդ Շևարդնաձեի իշխանության օրոք։\\nՆերկայումս շրջանառության մեջ են 1, 2, 5, 10, 20, 50 թեթրի, 1, 2 և 10 լարի մետաղադրամներ, և 1, 2, 5, 10, 20, 50, 100, 200 լարի թղթադրամներ։"},{"page_url":"https://pl.wikipedia.org/wiki/Hoxne","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Village_Hall%2C_Hoxne_-_geograph.org.uk_-_789470.jpg","page_title":"Hoxne","context_page_description":"Hoxne – wieś w Anglii, w hrabstwie Suffolk, w dystrykcie Mid Suffolk. Leży 33 km na północ od miasta Ipswich i 131 km na północny wschód od Londynu."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Brig","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/ETR_610_Brig.JPG","page_title":"Station Brig","context_page_description":"Station Brig is een Zwitsers spoorwegstation in de gemeente Brig-Glis in het kanton Wallis. Het station is een knooppunt van verschillende belangrijke Zwitserse spoorwegassen. Het ligt op een hoogte van 671,7 m.ü.M.\\nHet station ligt in het noorden van Brig aan de zuidelijke linkeroever van de Rhône. De eerste spoorlijn naar Brig, afgewerkt in 1874, volgde de Rhônevallei vanuit het westen tot Brig vanwaar reizigers konden verder reizen over de Simplonpas. De eerste Simplontunnel, waarvan de noordelijke tunnelmond vlak naast het station van Brig is gelegen, opende, samen met het huidige stationsgebouw, in 1906 en leverde een verbinding met Italië, een tweede koker afgewerkt in 1922 verdubbelde de capaciteit. De Lötschbergtunnel, afgewerkt in 1913 leverde een verbinding met het noorden van Zwitserland en Bern op. Deze verbinding werd in 2007 gevoelig verbeterd met de ingebruikname van de Lötschberg-basistunnel. De oostelijke ontsluiting van de hogere Rhônevallei werd in 1915 gerealiseerd middels de gedeeltelijke aanleg van de spoorlijn Brig - Disentis die in 1925 werd voltooid. Toen ontstond de verbinding met de Rhätische Bahn en de doorsteek naar Graubünden."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Bothmer","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Bothmer%2C_Reithalle%2C_Gesindehaus.JPG","page_title":"Schloss Bothmer","context_page_description":"Das Schloss Bothmer befindet sich am südlichen Ortsrand der nordwestmecklenburgischen Kleinstadt Klütz. Der denkmalgeschützte Komplex aus mehrflügeligem Schloss und rechteckiger Garteninsel bildet die größte erhaltene Barockanlage Mecklenburg-Vorpommerns. Die zum Schloss führende Festonallee aus spalierartig gezogenen Bäumen ist ein in Deutschland einzigartiges Gartendenkmal.\\nDas Schloss wurde nach englischen und niederländischen Vorbildern für den in Diensten des englischen Königshauses stehenden Reichsgrafen Hans Caspar von Bothmer von 1726 bis 1732 als Stammsitz seiner Familie erbaut. Zusammen mit zahlreichen benachbarten Gütern befand es sich über 200 Jahre im Eigentum der Bothmer. Nach dem Zweiten Weltkrieg wurde der Besitz enteignet und das Schloss in der Zeit der DDR zu einem Altenheim umfunktioniert. Nachdem ein privater Investor ein geplantes Nutzungskonzept nicht umsetzen konnte, wurde es Eigentum des Landes Mecklenburg-Vorpommern und kam in die Obhut der Staatlichen Schlösser und Gärten im Finanzministerium Mecklenburg-Vorpommern. Nach einer Zeit des Leerstands und Verfalls wurde es saniert; im Mai 2015 wurde das Schlossmuseum im Corps de Logis eröffnet."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%B4%D0%B7%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/The_fresco_of_Christ_in_Vardzia%2C_Georgia.jpg","page_title":"Вардзия","context_page_description":"Вардзия е древен пещерен манастирски комплекс и град от 12 – 13 век, разположен в южната част на Грузия, важен паметник на грузинското фортификационно, архитектурно и художествено изкуство. През годините играе важна роля в политическия, културния, образователния и духовния живот на страната. Със стенописите на Вардзия са положени основите на нов, динамичен декоративен художествен стил. През 2007 г. манастирът е предложен за включване в Списъка на световно културно и природно наследство на ЮНЕСКО, заедно с историческата крепост Хертвиси."},{"page_url":"https://sv.wikipedia.org/wiki/Arkitektur_och_stadsbyggnad_i_Skellefte%C3%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/P_O_Hallman_1890.jpg","page_title":"Arkitektur och stadsbyggnad i Skellefteå","context_page_description":"Arkitekturen och stadsbyggnaden i Skellefteå sträcker sig längre tillbaka än till staden Skellefteås grundläggande 1845. Här finns en kyrka som är äldre, och Skellefteå socken har rötter till 1300-talet. Fram till 1800-talets slut växte Skellefteås invånarantal till endast något tusental personer, men under 1900-talet utökades invånarantalet i tätorten till över 30 000.\\nEtt antal stadsplaner har präglat den arkitektoniska utvecklingen. Där finns rutnätsstaden, esplanadernas stad, trädgårdsstaden och den funktionella staden."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%AB%E0%A6%97%E0%A6%BE%E0%A6%A8%E0%A6%BF%E0%A6%B8%E0%A7%8D%E0%A6%A4%E0%A6%BE%E0%A6%A8%E0%A7%87%E0%A6%B0_%E0%A6%B8%E0%A7%8D%E0%A6%95%E0%A7%81%E0%A6%B2%E0%A6%97%E0%A7%81%E0%A6%B2%E0%A7%8B%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/School_children_watch_members_of_Afghan_National_Security_Force_and_Kandahar_Provincial_Reconstruction_Team.jpg","page_title":"আফগানিস্তানের স্কুলগুলোর তালিকা","context_page_description":"আফগানিস্তানে অবস্থিত বিদ্যালয়ের এই তালিকায় রয়েছে দেশের প্রাথমিক ও মাধ্যমিক বিদ্যালয়গুলি । আফগান শিক্ষা মন্ত্রণালয়ের মতে, আফগানিস্তান জুড়ে প্রায় ১৮, ০০০ স্কুল রয়েছে। আফগানিস্তানের তৃতীয় স্কুলগুলো আফগানিস্তানের বিশ্ববিদ্যালয়ের তালিকার একটি পৃথক উপ-তালিকায় তালিকাভুক্ত রয়েছে । তালিকাটি বর্ণানুক্রমিকভাবে প্রদেশ দ্বারা এবং একটি প্রদেশের মধ্যে, স্কুল নামের দ্বারা বর্ণানুক্রমিকভাবে সংগঠিত হয়।"},{"page_url":"https://en.wikipedia.org/wiki/History_of_Shimer_College","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Shimer_class_Recondite_67_2.jpg","page_title":"History of Shimer College","context_page_description":"Shimer College was founded in 1852, when the pioneer town of Mt. Carroll, Illinois, lacking a public school, incorporated the Mt. Carroll Seminary with no land, no teachers, and no money for this purpose.\\nFounded as non-denominational, it was affiliated with Baptists from 1896 into the 1950s, and subsequently with The Episcopal Church between 1959 and 1973, after which it became non-denominational once again.\\nShimer has evolved over time from a coeducational seminary to a women's seminary, a women's academy, a women's junior college, a women's college, and finally a coeducational Great Books college.\\nThroughout its existence, it has been involved a series of crises and profound changes. Because of this, the college is often symbolized by a phoenix which is reborn from its own ashes. Crises throughout Shimer's history have included three abandonments of the college by its board in 1855, 1973 and 1977; a catastrophic fire in 1906; bankruptcies in 1974 and 1977; and struggles over governance in 1966 and 2010.\\nFaculty and students have historically worked together to keep the college viable."},{"page_url":"https://de.wikipedia.org/wiki/Konstantin_II._(Griechenland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/T.M._Constantine_%26_Anne-Marie_of_Greece_Allan_Warren.jpg","page_title":"Konstantin II. (Griechenland)","context_page_description":"Konstantin II. von Griechenland war vom 6. März 1964 bis zum 1. Juni 1973 der letzte König der Hellenen. Seine Schwester Sophia ist die frühere Königin von Spanien, seine Schwägerin Margrethe II. die amtierende Königin von Dänemark. Konstantin II. entstammt dem Haus Schleswig-Holstein-Sonderburg-Glücksburg."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%A1%D5%AD%D5%B4%D5%A1%D5%BF%D5%A8_%D5%80%D5%A1%D5%B5%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Chess%2C_Vernissage%2C_Yerevan.jpg","page_title":"Շախմատը Հայաստանում","context_page_description":"Հայաստանում շախմատը հայտնի է դեռ վաղ միջնադարից, սակայն լայն ճանաչում է ստացել ԽՍՀՄ տարիներին: Երկրի ամենաժողովրդական խաղերից է: Հայաստանում շախմատը լայն ճանաչում է ձեռք բերել 1960-ական թվականներին, երբ Տիգրան Պետրոսյանը դարձավ շախմատի աշխարհի չեմպիոն: Մոտ երեք միլիոն բնակչությամբ Հայաստանը համարվում է աշխարհի ամենաուժեղ շախմատային երկրներից մեկը: Հայաստանն աշխարհում մեկ շնչի հաշվով ամենաշատ գրոսմայստերներ ունեցող երկրներից է:\\nԱնկախացումից հետո Հայաստանի շախմատի տղամարդկանց հավաքականը հաղթել է Եվրոպայի թիմային առաջնությունում, աշխարհի առաջնությունում և շախմատային օլիմպիադայում ։ Կանանց հավաքականը հաղթել է 2003 թվականի Եվրոպայի առաջնությունում։ 2015 թվականի սեպտեմբերի դրությամբ Հայաստանը լավագույն 10 շախմատիստների միջին էլո վարկանշով աշխարհում յոթերորդն է: 2015 թվականի սեպտեմբերի դրությամբ Հայաստանի ամենաբարձր վարկանիշ ունեցող շախմատիստը՝ Լևոն Արոնյանը, ՖԻԴԵ-ի վարկանիշային աղյուսակում զբաղեցնում է 11-րդ հորիզոնականը:\\n2011-2012 ուսումնական տարվանից սկսած՝ Հայաստանի հանրակրթական դպրոցներում շախմատը դարձել է պարտադիր առարկա:\\nԳարի Կասպարովը Հայաստանում շախմատի ժողովրդականությունը համեմատել է Լատինական Ամերիկայում ֆուտբոլի ժողովրդականության հետ:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D1%82%D0%B0%D0%BD%D0%BA%D0%B0_%D0%93%D0%BB%D1%96%D0%B1%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%D0%90%D0%BB%D1%8C%D1%82%D0%B0%D0%BD%D0%BA%D0%B0_%D0%93%D0%BB%D1%96%D0%B1%D0%BE%D0%B2%D0%B0.%D0%A1%D0%B5%D0%B4%D0%BD%D1%96%D0%B2.5.JPG","page_title":"Альтанка Глібова","context_page_description":"Альтанка Глібова — восьмиколонна ротонда, знаходиться у селищі Седнів Чернігівської області на схилі високого пагорбу над річкою Снов. Побудована у першій половині ХІХ століття. Є складовою частиною парку садиби Лизогубів. Свою назву отримала від імені відомого українського поета Л. І. Глібова, який гостював у Лизогубів і любив відпочивати у цій альтанці. Пам'ятка архітектури національного значення, охоронний номер 863/2."},{"page_url":"https://hu.wikipedia.org/wiki/Jakob_Fugger_(bank%C3%A1r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Fuggerkontor.jpg","page_title":"Jakob Fugger (bankár)","context_page_description":"Jakob Fugger Jakob Fugger der Reiche a középkor egyik legsikeresebb bankára. A hatalmas vagyonnal rendelkező Fugger Jakab az akkori Európa leggazdagabb emberei közé tartozott."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%B1%D9%BE%D9%8A%D8%A7%D8%B1_%D8%A7%D8%B1%D9%BE%D9%8A%D8%A7%D8%B1%D9%8A%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Arpiarapiraian.jpg","page_title":"ارپيار ارپياريان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nارپيار ارپياريان كان صحفى من امبراطوريه عثمانيه."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%80%D1%9A%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/XN_Fruehjahrswiese_01.jpg","page_title":"Трњина","context_page_description":"Трњина је врста шљиве у народу позната и као дивља шљива или црни трн. Има је у Европи, Западној Азији и на северозападу Африке. Такође је натурализована и на Новом Зеланду и на истоку Северне Америке."},{"page_url":"https://de.wikipedia.org/wiki/Steve_Spurrier-Florida_Field_at_Ben_Hill_Griffin_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/BenHillGriffinStadium.png","page_title":"Steve Spurrier-Florida Field at Ben Hill Griffin Stadium","context_page_description":"Das Steve Spurrier-Florida Field at Ben Hill Griffin Stadium ist ein College-Football-Stadion auf dem Campus der University of Florida in der US-amerikanischen Stadt Gainesville im Bundesstaat Florida. Es dient als Austragungsort für die Heimspiele des College-Football-Teams der Florida Gators. Die Anlage ist mit einer Kapazität von 88.548 Besuchern das zwölftgrößte Stadion im College Football. Es werden aber regelmäßig Zuschauerzahlen von über 90.000 erreicht."},{"page_url":"https://ast.wikipedia.org/wiki/Kazuhiko_Chiba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Kazuhiko_Chiba_-_Albirex_Niigata.jpg","page_title":"Kazuhiko Chiba","context_page_description":"Kazuhiko Chiba, ye un futbolista xaponés."},{"page_url":"https://de.wikipedia.org/wiki/Dolmen","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Dolmen_du_Djebel_Gorra._Thibar14._Tunisie.JPG","page_title":"Dolmen","context_page_description":"Ein Dolmen ist in der Regel ein aus großen, unbehauenen oder behauenen Steinblöcken errichtetes Megalithgrab. Es besteht aus drei oder mehr aufrecht stehenden Tragsteinen, auf denen eine oder mehrere Deckplatten ruhen. Dolmen werden traditionell als die einfachste Form eines Megalithgrabes angesprochen. In Europa waren Dolmen meist ursprünglich von Hügeln aus Steinen oder Erde bedeckt."},{"page_url":"https://en.wikipedia.org/wiki/Philippines_campaign_(1941%E2%80%931942)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Invasion_of_the_Philippines%2C_1941.jpg","page_title":"Philippines campaign (1941–1942)","context_page_description":"The Philippines campaign, also known as the Battle of the Philippines or the Fall of the Philippines, from 8 December 1941 – 8 May 1942, was the invasion of the Philippines by Imperial Japan and the defense of the islands by United States and Philippine forces during the Second World War.\\nThe Japanese launched the invasion by sea from Formosa, over 200 miles north of the Philippines. The defending forces outnumbered the Japanese by 3 to 2, but were a mixed force of non-combat experienced regular, national guard, constabulary and newly created Commonwealth units. The Japanese used first-line troops at the outset of the campaign, and by concentrating their forces swiftly overran most of Luzon during the first month.\\nThe Japanese high command, believing they had won the campaign, made a strategic decision to advance by a month their timetable of operations in Borneo and Indonesia, withdrawing their best division and the bulk of their airpower in early January 1942. This, coupled with the defenders' decision to withdraw into a defensive holding position in the Bataan Peninsula, enabled the Americans and Filipinos to successfully hold out for four more months."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Conthey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Ardon-blazono.png","page_title":"Bezirk Conthey","context_page_description":"Der District de Conthey im Kanton Wallis besteht aus folgenden Gemeinden:\\n1815 entstand der Bezirk Conthey durch den Zusammenschluss der Gebiete der früheren Kastlanei sowie der Gemeinen Ardon und Chamoson.\\nLokale Spezialitäten sind geräucherte Forelle, Spanlamm, Älplerkäse und Gebäck. Erwähnenswert sind zudem verschiedenste Weinsorten und deren Anbau sowie das eigene Klima, die Fauna, die Flora und die Geologie."},{"page_url":"https://nl.wikipedia.org/wiki/Standbeeld_van_Martinus_van_Beek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Sint_Michielsgestel_-_Theerestraat_42_-_Martinus_van_Beek_%282%29.jpg","page_title":"Standbeeld van Martinus van Beek","context_page_description":"Het standbeeld van Martinus van Beek is een gedenkteken in de Nederlandse plaats Sint-Michielsgestel."},{"page_url":"https://nn.wikipedia.org/wiki/Lilje","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Lilium_kelloggii.jpg","page_title":"Lilje","context_page_description":"Liljer er ei slekt av laukplantar som gjev store blomar. Ho er utbreidd i Eurasia og Nord-Amerika.\\nPlantane veks i store delar av Europa og Asia sørover til Nilgirifjella i India og Filippinane. I Amerika finn ein dei sør i Canada og i store delar av USA.\\nDei store, prangande blomane har seks kronblad, ofte lukt, og finst i ei rekkje fargar frå kvitt til gult til raudt. Dei kan vera einsfarga eller mønstra.\\nLiljelaukar er stiverike og kan etast som rotfrukter, men mange av dei har ein bitter smak. Laukar som ikkje er bitre, som L. lancifolium, L. pumilum og særleg L. brownii, blir dyrka i stor skala i Kina som luksus- eller helsemat som hovudsakleg blir seld i tørka tilstand. Desse blir særleg etne om sommaren fordi dei har ein kjølande effekt på kroppen."},{"page_url":"https://it.wikipedia.org/wiki/James_Juvenal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Rowing_mens_eight_USA_1900.jpg","page_title":"James Juvenal","context_page_description":"James Benner Juvenal è stato un canottiere statunitense.\\nJuvenal partecipò ai Giochi olimpici di Parigi 1900 con la squadra Vesper Boat Club di Filadelfia nella gara di otto, in cui conquistò la medaglia d'oro. Prese parte anche ai Giochi olimpici di Saint Louis 1904 nella gara del singolo, in cui giunse conquistò la medaglia d'argento."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B0%E0%A6%BE%E0%A6%9C%E0%A6%B6%E0%A6%BE%E0%A6%B9%E0%A7%80_%E0%A6%95%E0%A6%B2%E0%A7%87%E0%A6%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Rajshahi_College_Muslim_Hostel.jpg","page_title":"রাজশাহী কলেজ","context_page_description":"রাজশাহী কলেজ বাংলাদেশের রাজশাহী শহরে অবস্থিত একটি শিক্ষাপ্রতিষ্ঠান। ১৮৭৩ সালে এই কলেজটি প্রতিষ্ঠিত হয়। ঢাকা কলেজ ও চট্টগ্রাম কলেজ এর পরে রাজশাহী কলেজ বাংলাদেশের ৩য় প্রাচীনতম কলেজ। জাতীয় বিশ্ববিদ্যালয়ের অধিভুক্ত স্নাতক ও স্নাতকোত্তর স্তরের ৬৮৫টি কলেজের ২০১৫ সালের তথ্যের ভিত্তিতে রাজশাহী কলেজ বাংলাদেশের সেরা কলেজ। বাংলাদেশে এই কলেজ হতেই সর্বপ্রথম মাস্টার্স ডিগ্রি প্রদান করা শুরু হয়। কলেজটি রাজশাহী শহরের কেন্দ্রস্থলে রাজশাহী কলেজিয়েট স্কুল এর পাশে অবস্থিত। এই প্রাচীন কলেজের পাশে অবস্থিত হবার কারণে স্কুলটির নাম কলেজিয়েট রাখা হয়েছিলো । এটি বাংলাদেশ জাতীয় বিশ্ববিদ‍্যালয়ের অধীনে মাস্টার্স ও সম্মান ডিগ্রি প্রদান করে থাকে। ১৯৯৬ সাল থেকে এই কলেজে উচ্চ মাধ্যমিক স্তরে ছাত্র নথিভুক্ত করা বন্ধ করা হলেও বর্তমানে ২০১০-১১ শিক্ষাবর্ষ থেকে পুনরায় ভর্তি করা হচ্ছে।"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%98%E1%83%9A%E1%83%90%E1%83%93%E1%83%94%E1%83%9A%E1%83%A4%E1%83%98%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%A3%E1%83%A1%E1%83%98%E1%83%99%E1%83%98%E1%83%A1_%E1%83%90%E1%83%99%E1%83%90%E1%83%93%E1%83%94%E1%83%9B%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2013_Academy_of_Music_from_south.jpg","page_title":"ფილადელფიის მუსიკის აკადემია","context_page_description":"მუსიკის აკადემია ფილადელფიაში — უძველესი ოპერის თეატრი აშშ-ში, რომელიც ამჟამადაც მისი თავდაპირველი მიზნებისთვის გამოიყენება. „ბროდ სტრიტის დიდი მხცოვანი ლედი“, აკადემია პენსილვანიის ბალეტისა და ფილადელფიის საოპერო კომპანიის ბინაა. მრავალი წლის განმავლობაში ის ასევე ფილადელფიის ორკესტრის ბინა იყო და მასში კვლავ ტარდება საორკესტრო კონცერტები.\\nშენობის მშენებლობა 1855 წელს დაიწყო და 1857 წლის 26 იანვარს აკადემია დიდი ბალით გაიხსნა. ამ შენობაში შესრულებული პირველი ოპერა იყო დასავლეთ ნახევარსფეროში ვერდის \\"ილ ტროვატორეს\\" პრემიერა, იმავე წლის 25 თებერვალს. აკადემია მას შემდეგ მუდმივად ფუნქციონირებს, მასპინძლობდა რა მრავალ მსოფლიოში განთქმულ შემსრულებელს, დირიჟორსა და კომპოზიტორს. აქ სტანდარტული საოპერო და კლასიკური რეპერტუარის მრავალი ამერიკული პრემიერა მოწყობილა. შენობა გამოიყენება ასევე არა-სამუსიკო ღირსშესანიშნაობებისთვისაც—გროვერ კლივლანდსა და რიჩარდ ნიქსონს მონაწილეობა მიუღიად აქ გამართულ ოფიციალურ წვეულებებზე, ხოლო ალბერტ აინშტაინს კი ლექცია გაუმართავს.\\nდარბაზის დიზაინი ევროპის დიდი ოპერის სახლების მანერითაა შესრულებული, მოხატული ჭერითა და სამ იარუსიანი ბალკონით, რომელთაც არწივები და სხვა დეკორაციები ამშვენებს."},{"page_url":"https://uk.wikipedia.org/wiki/Cycas_media","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Cycas_media%2C_Cooktown_2010.jpg","page_title":"Cycas media","context_page_description":"Cycas media — вид голонасінних рослин класу Саговникоподібні."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%A4%E3%82%B9%E3%83%A9%E3%83%B3%E3%83%89%E3%81%AE%E9%A6%96%E7%9B%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Tryggvi_%C3%9E%C3%B3rhallson.jpg","page_title":"アイスランドの首相","context_page_description":"アイスランドの首相は、アイスランド政府の長である。"},{"page_url":"https://en.wikipedia.org/wiki/Unity_Mitford","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Nancy%2C_Unity_and_Diana_Mitford_gravestones_%28Nancy%29.jpg","page_title":"Unity Mitford","context_page_description":"Unity Valkyrie Freeman-Mitford was a British socialite, known for her relationship with Adolf Hitler. Both in Great Britain and Germany, she was a prominent supporter of Nazism, fascism and antisemitism, and belonged to Hitler's inner circle of friends. After the declaration of World War II, Mitford attempted suicide in Munich, and was officially allowed safe passage back to England in her invalid condition, but never recovered.\\nUnity was a member of the Mitford family, tracing its origins in Northumberland back to the 11th-century Norman settlement of England. Her sister Diana was married to Oswald Mosley, leader of the British Union of Fascists."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%80%D1%8B%D0%B2%D0%B0%D0%BB%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Coat_of_Arms_of_Pryva%C5%82ka.png","page_title":"Прывалкі","context_page_description":"Прыва́лкі, Прывалка — вёска ў Беларусі, на рацэ Нёман. Уваходзяць у склад Гожскага сельсавета Гродзенскага раёна. Насельніцтва 284 чал. Знаходзяцца за 37 км на паўночны захад ад Гродна, на шашы Р42."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D8%A7%DB%8C%D9%87%D8%A7%D8%AA%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/1957_Daihatsu_Midget_01.jpg","page_title":"دایهاتسو","context_page_description":"دایهاتسو یان قۇرولوش و یا تابعه شیرکت. بۇ شیرکت اوتوموبیل ساحه‌سینده فعالیّت گؤستریر. چالیشان ایشچی‌لرینین سایی‌سی ۱۱٬۸۷۳ نفر اوْلوب."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%8A%D8%AE%D9%8A%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Iglesia_Nuestra_Se%C3%B1ora_del_Socorro_-_Tejeda_-_Interior.jpg","page_title":"تيخيدا","context_page_description":"بلدية تيخيدا هي بلدية تقع في مقاطعة لاس بالماس التابعة لمنطقة جزر الكناري جنوب غرب إسبانيا."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Mard-de-R%C3%A9no","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Saint_Mard_de_R%C3%A9no_%2861%29_-_Eglise.jpg","page_title":"Saint-Mard-de-Réno","context_page_description":"Saint-Mard-de-Réno est une commune française, située dans le département de l'Orne en région Normandie, peuplée de 429 habitants."},{"page_url":"https://it.wikipedia.org/wiki/Stamford_Brook","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/StamfordBrook2.jpg","page_title":"Stamford Brook","context_page_description":"Stamford Brook è una stazione della linea District della metropolitana di Londra."},{"page_url":"https://en.wikipedia.org/wiki/Ceres_(dwarf_planet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Toharu_crater.jpg","page_title":"Ceres (dwarf planet)","context_page_description":"Ceres is the largest object in the main asteroid belt that lies between the orbits of Mars and Jupiter. With a diameter of 940 km, Ceres is both the largest of the asteroids and the only dwarf planet inside Neptune's orbit. It is the 25th-largest body in the Solar System within the orbit of Neptune.\\nCeres was the first asteroid to be discovered. It was originally considered a planet, but was reclassified as an asteroid in the 1850s after many other objects in similar orbits were discovered.\\nCeres is the only object in the asteroid belt rounded by its own gravity, although Vesta and perhaps other asteroids were so in the past. From Earth, the apparent magnitude of Ceres ranges from 6.7 to 9.3, peaking once at opposition every 15 to 16 months, which is its synodic period. Thus even at its brightest, it is too dim to be seen by the naked eye, except under extremely dark skies. Ceres has been classified as a C-type asteroid and, due to the presence of clay minerals, as a G-type asteroid.\\nCeres appears to be partially differentiated into a muddy mantle/core and a less-dense but stronger crust that is at most 30 percent ice."},{"page_url":"https://pt.wikipedia.org/wiki/Condado_de_Essex_(Nova_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/South_Mountain_View.jpg","page_title":"Condado de Essex (Nova Jersey)","context_page_description":"O Condado de Essex é um dos 21 condados do estado americano de Nova Jérsei. A sede e maior cidade do condado é Newark. Foi fundado em 7 de março de 1683.\\nO condado possui uma área de 336 km², dos quais 327 km² estão cobertos por terra e 9 km² por água, uma população de 783 969 habitantes, e uma densidade populacional de 2 398,3 hab/km². É o terceiro condado mais populoso de Nova Jérsei."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BA_%D0%BB%D0%B0%D0%B1%D1%96%D1%80%D0%B8%D0%BD%D1%82%D1%96%D0%B2_%D0%9E%D1%80%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/General_Map_-_Parc_del_Laberint_d%E2%80%99Horta_-_Barcelona.svg","page_title":"Парк лабіринтів Орти","context_page_description":"Парк лабіринтів Орти — історичний парк в районі Horta-Guinardó в Барселоні, найстаріший парк цього типу в місті. Розташований на території колишньої садиби родини Десвалльс, на схилі однієї з гір гряди. Парк включає сад XVIII століття в неокласичному стилі і романтичний сад XIX століття."},{"page_url":"https://nl.wikipedia.org/wiki/Boekhandel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Johannes_Jelgerhuis_-_De_winkel_van_boekhandelaar_Pieter_Meijer_Warnars_op_de_Vijgendam_te_Amsterdam.jpg","page_title":"Boekhandel","context_page_description":"Een boekhandel is een bedrijf waar men boeken kan kopen. Een vestiging van een boekhandel heet een boekwinkel. In de praktijk zijn 'boekhandel' en 'boekwinkel' min of meer synoniemen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_churches_in_Bj%C3%B8rgvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Husnes_Kyrkje.jpg","page_title":"List of churches in Bjørgvin","context_page_description":"The list of churches in Bjørgvin is a list of the Church of Norway churches in the Diocese of Bjørgvin which includes all of Vestland county in Norway. The list is divided into several sections, one for each deanery in the diocese. Administratively within each deanery, the churches are divided by municipalities each of which has their own church council and then into parishes which have their own councils. Each parish may have one or more local church.\\nHistorically, the diocese has had many deaneries, but the number of deaneries has been reduced in recent years. The Laksevåg deanery in Bergen was dissolved in 2013 and its churches were divided between the Bergen domprosti and the Fana prosti. Also in 2013, the old Ytre Sogn prosti was dissolved. The old deanery included Gulen, Solund, Hyllestad, Høyanger, Balestrand, and Vik municipalities. The municipalities of Gulen and Solund were transferred to the Nordhordland prosti, which includes the northern municipalities in the old Hordaland county. Hyllestad and Høyanger were transferred to Sunnfjord prosti, and Balestrand and Vik were transferred to Indre Sogn prosti and it was renamed Sogn deanery."},{"page_url":"https://ht.wikipedia.org/wiki/Pell_City_(Alabama)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/ALMap-doton-PellCity.PNG","page_title":"Pell City (Alabama)","context_page_description":"Pell City (Alabama) se yon vil Etazini. Li sitye nan leta Alabama.\\nChèf-lye li se Saint Clair."},{"page_url":"https://en.wikipedia.org/wiki/This_Is_Going_to_Hurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Adam_Kay_20171207_01.jpg","page_title":"This Is Going to Hurt","context_page_description":"This is Going to Hurt: Secret Diaries of a Junior Doctor is a nonfiction book by the British comedy writer Adam Kay, published in 2017 by Picador. It is a collection of diary entries written by Kay during his medical training from 2004 to 2010. Kay's book discusses political issues in the health care system of the National Health Service in the United Kingdom and societal conflicts between the general population and neglected doctors. Kay accomplishes this by incorporating humour into his personal anecdotes that depict his life as he progresses through his medical training, and his eventual resignation from this career."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_fine","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Tiger%27s_eye_2.jpg","page_title":"Pierre fine","context_page_description":"Les pierres fines sont des pierres gemmes non classées parmi les quatre pierres précieuses. Bien que parfois appelées semi-précieuses, ce terme est interdit dans le commerce, en France, par un décret du 14 janvier 2002.\\nLes pierres fines sont définies par une liste de la CIBJO dressée en 1970 à Zurich qui les considère comme des minéraux extraits de gîtes naturels.\\nCes gemmes sont notamment utilisées en joaillerie."},{"page_url":"https://fr.wikipedia.org/wiki/Caveau_de_d%C3%A9gustation","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Caveau_de_d%C3%A9gustation%2C_Amisfield%2C_Central_Otago%2C_Nouvelle-Z%C3%A9lande.jpg","page_title":"Caveau de dégustation","context_page_description":"Un caveau de dégustation est un espace commercial qui permet la dégustation du vin dans un domaine viticole, chez un caviste, pour le public. Il est destiné à la dégustation des vins qui sont à la vente dans l’établissement.\\nIl est à différencier d'une salle de dégustation, utilisée pour l’enseignement ou les jurys de concours ou d'agrément, et qui permet de réaliser dans des conditions idéales la dégustation du vin, de manière professionnelle."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EC%9D%BC%EB%9E%9C%EB%93%9C%EC%9D%98_%EB%A7%89%EB%8B%AC%EB%A0%88%EB%82%98_%EC%84%B8%ED%83%81%EC%86%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Magdalen-asylum.jpg","page_title":"아일랜드의 막달레나 세탁소","context_page_description":"아일랜드 섬의 막달레나 세탁소들은 막달레나 수용소라고도 했으며, 18세기에서 20세기 말에 걸쳐 \\"몸을 버린 여자\\"들에게 거처를 제공한다는 명목하에 주로 천주교 세력의 주도로 세워진 시설들이다. 아일랜드에서 막달레나 세탁소를 거쳐간 여성들의 수는 약 30,000명으로 추산된다. 1993년에는 한 막달레나 세탁소에서 시신 155구가 암매장된 집단묘지가 발견되기도 했다. 이 사건으로 인해 폐쇄적으로 운영되는 이들 시설들에 대한 언론의 폭로가 뒤따르게 되었고, 2013년에는 국가 차원에서의 사과문이 발표되고 생존자들에게 배상을 해주기 위한 기금 5천만 파운드가 조성되었다. 아일랜드 천주교회는 이 기금에 돈을 보태기를 거부했다."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A6%D9%8A%D8%B3_%D8%B1%D9%88%D8%B3%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Vladimir_Putin_-_2006.jpg","page_title":"رئيس روسيا","context_page_description":"رئيس روسيا ‏ هو رئيس الدولة والقائد الأعلى للقوات المسلحة وحامل أعلى منصب في الاتحاد الروسي. الرئيس الحالي لروسيا هو فلاديمير بوتين.\\nفي عام 1991 كان المكتب يعرف لفترة وجيزة باسم رئيس الجمهورية الروسية السوفيتية الاتحادية الاشتراكية ‏ حتى 25 ديسمبر 1991. وفقاً للدستور الروسي لعام 1978، كان رئيس روسيا رئيس السلطة التنفيذية ورئيس مجلس الوزراء، ووفقاً للدستور الروسي الحالي لعام 1993، فإن رئيس روسيا ليس جزءًا من الحكومة التي تمارس السلطة التنفيذية.\\nوفي الحالات التي يتعذر فيها على رئيس الاتحاد الروسي القيام بواجباته، ينتدب العمل مؤقتاً إلى رئيس الوزراء الذي يصبح رئيساً بالنيابة لروسيا. رئيس مجلس الاتحاد الروسي هو المنصب الثالث المهم بعد الرئيس ورئيس الوزراء. وفي حالة عجز الرئيس ورئيس الوزراء، يصبح رئيس مجلس الشيوخ في البرلمان رئيساً للدولة بالنيابة."},{"page_url":"https://fr.wikipedia.org/wiki/Immigration_fran%C3%A7aise_au_Mexique","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/EBoban.jpg","page_title":"Immigration française au Mexique","context_page_description":"L'immigration française au Mexique est un phénomène qui remonte principalement au XIXᵉ siècle, suite à l'indépendance mexicaine accomplie en 1821. En effet, auparavant, la présence espagnole empêchait que d’autres communauté européennes et étrangères ne viennent s’installer à part les groupes religieux.\\nIl est nécessaire de faire ici une mention particulière, parmi cette immigration française, du phénomène migratoire exceptionnel des « Barcelonnettes », amorcé par les frères Arnaud au XIXᵉ siècle."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B3%95%E6%8B%89%E7%AC%AC%E6%9D%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Faraday_cup.jpg","page_title":"法拉第杯","context_page_description":"法拉第杯是一种金属制设计成杯状，用来测量带电粒子入射强度的一种真空侦测器。测得的电流可以用来判定入射电子或离子的数量。\\n法拉第杯是用在电学有卓著贡献的麦可·法拉第的姓氏来命名。"},{"page_url":"https://en.wikipedia.org/wiki/Right_gastric_artery","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gray533.png","page_title":"Right gastric artery","context_page_description":"The right gastric artery arises, in most cases, from the proper hepatic artery, descends to the pyloric end of the stomach, and passes from right to left along its lesser curvature, supplying it with branches, and anastomosing with the left gastric artery. It can also arise from the region of division of the common hepatic artery, the left branch of the hepatic artery, the gastroduodenal artery, and most rarely, the common hepatic artery itself."},{"page_url":"https://sv.wikipedia.org/wiki/Sedefkar_Mehmed_Agha","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Sultan_Ahmed_Mosque.jpg","page_title":"Sedefkar Mehmed Agha","context_page_description":"Sedefkar Mehmed Agha eller Sedefqar Mehmeti av Elbasan Turkiska: Sedefkâr Mehmet Ağa, född cirka 1540, död 1617, var en osmansk arkitekt av albanskt ursprung, som ritade Blå moskén i Istanbul. Enligt levnadstecknaren Cafer Effendi, tros han ha haft albanskt ursprung, från staden Elbasan."},{"page_url":"https://tg.wikipedia.org/wiki/AEA_Silver_Dart","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Silver_Dart_Replica.JPG","page_title":"AEA Silver Dart","context_page_description":"AEA Silver Dart — як ҳавогарди сохтаи Aerial Experiment Association аст ки дар соли 1908 сохта шуд. нахустин истифодакунандаи ин ҳавогард Aerial Experiment Association будааст. Ин ҳавогард дар Феврал 23, 1909 нахустин парвози худро анҷом дод."},{"page_url":"https://pt.wikipedia.org/wiki/Viola_tricolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/DBP_1976_907_Wohlfahrt_Gartenblumen_Stiefm%C3%BCtterchen.jpg","page_title":"Viola tricolor","context_page_description":"Viola tricolor, popularmente conhecida como amor-perfeito e erva-trindade, é uma flor bienal selvagem eurasiática. É uma pequena planta rasteira que atinge no máximo 15 cm de altura, com flores de cerca de 1,5 cm de diâmetro. Cresce nos prados e nas fazendas abandonadas, principalmente em solos ácidos ou neutros. É geralmente encontrada onde há sombra parcial. Floresce de Abril a Setembro. As flores da viola tricolor ou amores perfeitos podem ser roxas, azuis, amarelas ou brancas. É hermafrodita e autofértil, polinizada pelas abelhas."},{"page_url":"https://fr.wikipedia.org/wiki/Max_Ryan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Max_Ryan_2012.jpg","page_title":"Max Ryan","context_page_description":"Max Ryan est un acteur britannique."},{"page_url":"https://en.wikipedia.org/wiki/Navy_Day_(Russia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Navy_Day_in_Russia_2017_%287%29.jpg","page_title":"Navy Day (Russia)","context_page_description":"Day of the Russian Navy is national holiday in the Russian Federation and a senior holiday in the Russian Armed Forces. The day honors the sailors in units of the Russian Navy and its specialized arms. It is celebrated annually, on the last Sunday of July."},{"page_url":"https://en.wikipedia.org/wiki/Customs_House,_Rockhampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Customs_House_Rockhampton%2C_from_NE%2C_Quay_Street_%282009%29.jpg","page_title":"Customs House, Rockhampton","context_page_description":"The Rockhampton Customs House is a heritage-listed customs house at 208 Quay Street, Rockhampton, Rockhampton Region, Queensland, Australia. It was built from 1899 to 1900 by Caskie and Thompson. It was added to the Queensland Heritage Register on 7 February 2005."},{"page_url":"https://nl.wikipedia.org/wiki/Woestijnleguaan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/DesertIguana031611.jpg","page_title":"Woestijnleguaan","context_page_description":"De woestijnleguaan is een hagedis uit de familie leguanen."},{"page_url":"https://cs.wikipedia.org/wiki/Nov%C3%BD_Dv%C5%AFr_(okres_Nymburk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Nov%C3%BD_Dv%C5%AFr%2C_bus_stop.jpg","page_title":"Nový Dvůr (okres Nymburk)","context_page_description":"Nový Dvůr je obec ležící v okrese Nymburk, 7 km severovýchodně od Nymburku. Žije zde 75 obyvatel. Katastrální území obce měří 246 hektarů."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%BC%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/1_-_Annemasse_vu_du_ciel.jpg","page_title":"Анмас","context_page_description":"Анмас — коммуна во Франции, департамент Верхняя Савойя, регион Овернь — Рона — Альпы. Является центром кантона Анмас. Округ коммуны — Сен-Жюльен-ан-Женевуа. Код INSEE коммуны — 74012. Мэр коммуны — Кристиан Дюрюсе, мандат действует на протяжении 2014—2020 гг.\\nАнмас расположен на границе со Швейцарией, приблизительно в 8 километрах к востоку от Женевы. Это вторая по величине коммуна в департаменте с населением в 33 166."},{"page_url":"https://sv.wikipedia.org/wiki/Petroscirtes_lupus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Juvenile_Brown_sabretooth_blenny_-_Petroscirtes_lupus_%2816318657361%29.jpg","page_title":"Petroscirtes lupus","context_page_description":"Petroscirtes lupus är en fiskart som först beskrevs av De Vis, 1885. Petroscirtes lupus ingår i släktet Petroscirtes och familjen Blenniidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Tateomys_macrocercus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Tateomys_macrocercus_distribution.png","page_title":"Tateomys macrocercus","context_page_description":"Tateomys macrocercus est une espèce de rongeur de la famille des Muridae, du genre Tateomys endémique d'Indonésie."},{"page_url":"https://ro.wikipedia.org/wiki/Premiul_Oscar_pentru_cel_mai_bun_actor_%C3%AEn_rol_secundar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Jack_Albertson_in_1976%27s_The_Sad_and_Lonely_Sundays.jpg","page_title":"Premiul Oscar pentru cel mai bun actor în rol secundar","context_page_description":"Premiul Oscar pentru cel mai bun actor în rol secundar este unul dintre premiile acordate actorilor care lucrează în industria filmului în cadrul ceremoniei Premiilor Oscar. Premiul este acordat de Academy of Motion Picture Arts and Sciences; nominalizările sînt făcute de membrii Academiei care sunt actori și actrițe.\\nPremiul se decernează anual începând cu 1937 pentru filmul din anul 1936. În tabelul de mai jos apar anii pentru care s-a acordat Premiul Oscar."},{"page_url":"https://es.wikipedia.org/wiki/W%C3%B6rth_an_der_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/DEU_W%C3%B6rth_a.d._Donau_COA.svg","page_title":"Wörth an der Donau","context_page_description":"Wörth an der Donau es una ciudad situada en el distrito de Ratisbona, en el estado federado de Baviera, con una población a finales de 2016 de unos 4743 habitantes.​\\nSe encuentra ubicada en el centro del estado, en la región de Alto Palatinado, a la orilla del Río Danubio y cerca de la ciudad de Ratisbona."},{"page_url":"https://sv.wikipedia.org/wiki/G%C3%B6rel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/G%C3%B6rel_Crona_2014-05-13_001.jpg","page_title":"Görel","context_page_description":"Görel är ett äldre nordiskt kvinnonamn. Namnet har bildats av de fornisländska orden för spjut och strid Det är en yngre form av det danska namnet Görvel som i sin tur härstammar från namnet Gerwer sammansatt av orden ger och wer.\\nGörel har sedan mitten av 1500-talet främst använts inom några adelssläkter och hade in på 1900-talet kvar lite av en adlig prägel. Namnet har dock aldrig blivit direkt vanligt. Bland de yngsta är namnet extremt ovanligt.\\nGörild är en sidoform till Görel. Det äldsta belägget i Sverige är från år 1889.\\nDen 31 december 2018 fanns det totalt 1 377 kvinnor folkbokförda i Sverige med namnet Görel, varav 850 bar det som tilltalsnamn. Motsvarande siffror för Görild var 22 respektive 11, och antalet bärare sjunker.\\nNamnsdag: 19 juni,"},{"page_url":"https://cs.wikipedia.org/wiki/Roland_(ryt%C3%AD%C5%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Orlando_Furioso_5.jpg","page_title":"Roland (rytíř)","context_page_description":"Rytíř Roland byl vojenský velitel a náčelník Bretonské marky v severní Francii za vlády Karla Velikého. Byl zabit divokými Basky v bitvě u Roncevaux v horské soutěsce v Pyrenejích, když se vracel z jinak úspěšného tažení Karla Velikého do Španělska. Toto je jediná historická zmínka o Hruodlandovi, jak ji zapsal životopisec Karla Velikého Einhard ve svém díle Vita Karoli Magni z první poloviny 9. století."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%80%D0%B8%D0%BD%D1%9F_(%D0%92%D0%B8%D1%80%D1%9F%D0%B8%D0%BD%D0%B8%D1%98%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/VAMap-doton-Orange.PNG","page_title":"Оринџ (Вирџинија)","context_page_description":"Оринџ град је у америчкој савезној држави Вирџинија. По попису становништва из 2010. у њему је живело 4.721 становника."},{"page_url":"https://nds.wikipedia.org/wiki/Granada","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Alhambra-granada.jpg","page_title":"Granada","context_page_description":"Dit Woort hett noch annere Bedüden: kiek dorför ünner Granada.\\nGranada is de Hööftstadt vun de südspaansche Provinz Granada un hett 241.000 Inwahners. Se liggt in de fruchtbare Vega de Granada to Föten van de Sierra Nevada an den Rio Genil. Se is ene van de schöönsten un historisch bedüüdsaamsten Städer van Europa.\\nGranada is beröhmt wegen de velen historischen Denkmalen ut de maurische Tiet un ok ut de Gotik un Renaissance. De bedüdenste Bo ut de maurische Tiet is de Borg Alhambra. Se wurr in dat 13. un 14. Jahrhunnert as Residenz för den maurischen König upboot. Beröhmt is de Alhambra för ehre Stuckdeken un den Lövenborn. König Karl V. leet enen Palast up dat Borggrundstück boon un so wurr en Deel van den originalen Palast tonicht maakt.\\nEn anner Denkmaal, is de Generalife, de Sommerresidenz van den Kalif. Dör ene Zypressenallee, vörbi an Springborns, de stännig palscht, kummt man an dat Ingangsgeböde. Darachter liggt de Patio mit ene Zypress, de noch ut de maurische Tiet stammen schall. Alhambra un Albacin, dat ehrmalig maurische Wahnviddel, sünd as Weltkulturarv van de UNESCO uttekent wurrn."},{"page_url":"https://fr.wikipedia.org/wiki/Opel_Astra_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/IAA_2001_176_-_Flickr_-_Axel_Schwenke.jpg","page_title":"Opel Astra G","context_page_description":"L'Opel Astra G est une automobile qui fut produite par Opel de 1998 à 2004. Il s'agit de la deuxième génération de l'Opel Astra depuis 1991."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/S%C3%B6%C4%9F%C3%BCt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Ertu%C4%9Frul_Gazi_M%C3%BCzesi.JPG","page_title":"Söğüt","context_page_description":"Söğüt sī Türkiye Bilecik séng ê chi̍t ê koān."},{"page_url":"https://en.wikipedia.org/wiki/Putinversteher","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Putinversteher.png","page_title":"Putinversteher","context_page_description":"Putinversteher or Putin-Versteher is a German political neologism and a buzzword, which literally translates \\"Putin understander\\", i.e., \\"one who understands Putin\\". It is a pejorative reference to politicians and pundits who express empathy to Vladimir Putin, i.e., who say \\"yes, but you have to understand Putin's position\\". A major cornerstone of \\"Putin-friendly\\" attitude is the \\"legitimate interests of Russia\\" in the post-Soviet states, while another typical trait is anti-Americanism. A similar term is Russlandversteher, \\"Russia understander\\". It may also be translated as \\"Putin-Empathizer.\\nThe Putinversteher circle is politically heterogeneous and includes figures on both the left and right. It also includes businesspeople with business interests in Russia. Paul Roderick Gregory wrote that they \\"serve as Putin’s first line of defense against meaningful European sanctions for the Anschluss of Crimea\\".\\nAn example of Putinversteher is former Chancellor of Germany Helmut Schmidt, who said that Putin's annexation of Crimea, while illegitimate, was \\"understandable\\"."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Schlesien","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/SM_Ma%C5%82usz%C3%B3w_pa%C5%82ac_%282%29_ID_591373.jpg","page_title":"Liste von Burgen und Schlössern in Schlesien","context_page_description":"Die Liste von Burgen und Schlössern in Schlesien enthält Schlösser, Burgen und Ruinen in der historischen Region Schlesien.\\nErläuterung:\\nWoiwodschaft NS = Niederschlesien, OP = Oppeln, OS = Oberschlesien, LB = Lebus"},{"page_url":"https://es.wikipedia.org/wiki/Sellos_de_Rusia_en_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Stamp_of_Russia_2014_No_1851_Medal_For_the_Defence_of_Kiev.png","page_title":"Sellos de Rusia en 2014","context_page_description":"Los sellos de Rusia en el año 2014 fueron puestos en circulación por Pochta Rossii, la administración postal rusa. En total se emitieron 147 sellos postales, comprendidos en 61 series filatélicas con temáticas diversas."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%DB%8C%D9%84_%D8%AA%D9%88%D8%A6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/THUAYRE_Daniel.JPG","page_title":"دانیل توئر","context_page_description":"دانیل توئر دوچرخه‌سوار اهل فرانسه بود."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Paris_(Maine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Oxford_County_Courthouse%2C_South_Paris%2C_ME.jpg","page_title":"Paris (Maine)","context_page_description":"Paris sī Bí-kok Maine chiu Oxford kūn ê chi̍t ê chng-thâu."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_mexicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Merida-cathedral.jpg","page_title":"Arquitectura mexicana","context_page_description":"Por arquitectura mexicana se entiende la existente en lo que actualmente es territorio mexicano y la realizada por arquitectos mexicanos en otros países, cuya influencia es muy marcada y notoria haciendo referencia a las construcciones del México prehispánico, colonial y moderno.\\nPor la relevancia artística de muchas de las estructuras arquitectónicas de México, incluyendo partes enteras de ciudades prehispánicas y coloniales, han sido designadas Patrimonio de la Humanidad. El país posee el primer lugar en número de lugares declarados Patrimonio de la Humanidad por la Unesco en el continente americano."},{"page_url":"https://pl.wikipedia.org/wiki/Chamadelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Chamadelle_vue.JPG","page_title":"Chamadelle","context_page_description":"Chamadelle – miejscowość i gmina we Francji, w regionie Nowa Akwitania, w departamencie Żyronda.\\nWedług danych na rok 1990 gminę zamieszkiwały 562 osoby, a gęstość zaludnienia wynosiła 37 osób/km²."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%81%EB%8F%84%EA%B5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Busandaegyo.jpg","page_title":"영도구","context_page_description":"영도구는 대한민국 부산광역시 남부 영도에 위치해 있는 구이다. 대한민국의 자치구 중 유일하게 섬으로만 구성된 곳이다. 영도의 옛 이름은 절영도이다."},{"page_url":"https://nl.wikipedia.org/wiki/Chileense_presidentsverkiezingen_1891","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Jorge_Montt-1909.jpg","page_title":"Chileense presidentsverkiezingen 1891","context_page_description":"De Chileense presidentsverkiezingen van 1891 vonden op 25 september van dat jaar plaats. De verkiezingen werden kort na de Burgeroorlog van dat jaar plaats. Revolutionaire troepen onder aanvoering van kapitein-ter-zee Jorge Montt hadden de autoritaire president José Manuel Balmaceda verdreven. Het ontstane machtsvacuüm werd opgevuld door de unanieme verkiezing van Montt tot president van de republiek."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigreich_Libyen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Piazza_28_Ottobre%2C_Bengasi.jpg","page_title":"Königreich Libyen","context_page_description":"Das Königreich Libyen war ein Staat in Nordafrika auf dem Gebiet des heutigen Libyen. Das Königreich wurde am 24. Dezember 1951 mit Idris als König gegründet. Bis zur Verfassungsänderung vom 25. April 1963 galt zunächst die Bezeichnung Vereinigtes Königreich Libyen. Am 1. September 1969 wurde das Königreich Libyen durch einen Putsch unter Muammar al-Gaddafi abgeschafft, der die Libysche Arabische Republik ausrief."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%AB%D5%A4%D5%AB%D5%BD%D5%A9%D5%A1%D5%BE%D5%AB_(%D4%B3%D5%B8%D6%80%D5%AB%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Village_Khidistavi.jpg","page_title":"Խիդիսթավի (Գորիի շրջան)","context_page_description":"Խիդիսթավի, գյուղ Վրաստանում: Գտնվում է Շիդա Քարթլի մարզի Գորիի շրջանում:"},{"page_url":"https://nl.wikipedia.org/wiki/Grafenwalder","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Grafenwalder_Wei%C3%9Fbier_%28can%29.jpg","page_title":"Grafenwalder","context_page_description":"Grafenwalder is een pils uit de lagere prijsklasse. Dit biermerk is verkrijgbaar in de Lidl-supermarkten. De inhoud van een blik is 50 cl. Het bier bevat 4,9% alcohol en wordt gebrouwen in Duitsland in de Lindenbrauerei te Unna in Noordrijn-Westfalen. Het bier wordt gebrouwen volgens het Reinheitsgebot. Grafenwalder heeft vijf producten, namelijk Grafenwalder Pilsner, Grafenwalder Special, Grafenwalder Hefe-Weissbier, Grafenwalder Radler en Grafenwalder Strong."},{"page_url":"https://en.wikipedia.org/wiki/SS_American_Legion","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/S.S._American_Legion_being_towed_up_River_Plate_%283567381161%29.jpg","page_title":"SS American Legion","context_page_description":"American Legion was built for the United States Shipping Board, one of the planned World War I troop transports converted before construction into passenger and cargo vessels, the Emergency Fleet Corporation Design 1029 ships. The ship was laid down as Koda and perhaps assigned the name Badger State at one point, but renamed American Legion before launch and one of only a few of the design not taking a state nickname. Originally operated by the USSB's agents and the Munson Steamship Line the ship saw commercial service until laid up 13 March 1939.\\nAmerican Legion was formally transferred to the War Department for use as a United States Army transport on 19 December 1939 operating as USAT American Legion until transfer to the United States Navy 22 August 1941. The Navy commissioned the ship USS American Legion initially classifying the ship a transport with hull number AP-35. On 1 February 1943 the Navy reclassified the ship as an attack transport with hull number APA-17. American Legion decommissioned on 28 March 1946 and was sold for scrap 5 February 1948."},{"page_url":"https://en.wikipedia.org/wiki/Arrondissement_of_Lille","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Locator_map_of_Arrondissement_Lille_2019.png","page_title":"Arrondissement of Lille","context_page_description":"The arrondissement of Lille is an arrondissement of France in the Nord department in the Hauts-de-France region. It has 124 communes. Its population is 1,237,472, and its area is 879.5 km²."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Amatitl%C3%A1n","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Pacaya-09.JPG","page_title":"Lake Amatitlán","context_page_description":"Lake Amatitlán is a lake located within the Amatitlán caldera in south-central Guatemala, fairly close to Guatemala City. It lies in the central highlands, 1,186 m above sea level. Its maximum depth is 33 m and an average of 18 m. The lake is 11 km long and 3 km wide; with an area of 15.2 square kilometers and a water volume of 0.286 cubic kilometers.\\nThe lake's primary inflow is the Villalobos River, and the lake is drained by the Michatoya River, an important tributary of the María Linda River. The town of Amatitlán is situated at the head of the Michatoya river. A dam with a railway on top was constructed at the narrowest point, thus effectively dividing the lake into two water bodies with different physical, chemical and biological characteristics: a north-western and a south-eastern basin.\\nThe lake is used as a water source, for navigation and transportation, sightseeing and tourism, recreation and fisheries."},{"page_url":"https://ca.wikipedia.org/wiki/Chartres-de-Bretagne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Chartres-bretagne1.jpg","page_title":"Chartres-de-Bretagne","context_page_description":"Chartres-de-Bretagne és un municipi francès, situat a la regió de Bretanya, al departament d'Ille i Vilaine. L'any 2006 tenia 7.033 habitants."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B8%88%ED%98%B8%EA%B3%A0%EC%86%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%EA%B8%88%ED%98%B8%EA%B3%A0%EC%86%8D.jpg","page_title":"금호고속","context_page_description":"금호고속은 여객 운송업을 주 업종으로 하는 광주광역시를 거점으로 한 기업이다. 1948년에 세운 광주여객자동차가 시초며, 1993년 금호고속으로 사명을 변경하기 이전에는 거북이 그림과 함께 \\"광주고속\\"이라는 이름을 썼다. 현재 금호아시아나그룹 지주회사다."},{"page_url":"https://ja.wikipedia.org/wiki/161%E4%B8%81%E7%9B%AE-%E3%83%A4%E3%83%B3%E3%82%AD%E3%83%BC%E3%83%BB%E3%82%B9%E3%82%BF%E3%82%B8%E3%82%A2%E3%83%A0%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/161_St_Yankee_Stadium_vc.jpg","page_title":"161丁目-ヤンキー・スタジアム駅","context_page_description":"161丁目-ヤンキー・スタジアム駅はニューヨーク市地下鉄IRTジェローム・アベニュー線とINDコンコース線の乗換駅である。ブルックリン区ハイブリッジとコンコースに掛かるリバー・アベニューと東161丁目の交差点に位置し、4系統が終日、B系統がラッシュ時のみ、D系統がラッシュ時混雑方向を除く終日停車する。\\nなお、当駅の2015年の乗降客数は892万2188人であり、ブロンクス区内にあるニューヨーク市地下鉄の39駅の中で最も乗降客数の多い駅となっている。また、ブロンクス区内の乗換駅2駅の内の1駅である。"},{"page_url":"https://en.wikipedia.org/wiki/Ben_Edlund","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ben_Edlund_by_Gage_Skidmore.jpg","page_title":"Ben Edlund","context_page_description":"Ben Edlund is an American cartoonist, screenwriter, television producer, and television director. Prior to his involvement in TV, he was best known as the creator of the satirical superhero character The Tick."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AA%E0%A9%81%E0%A8%B8%E0%A8%BC%E0%A8%95%E0%A8%BF%E0%A8%A8_%E0%A8%AE%E0%A8%BF%E0%A8%8A%E0%A8%9C%E0%A8%BC%E0%A9%80%E0%A8%85%E0%A8%AE","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Gmii.jpg","page_title":"ਪੁਸ਼ਕਿਨ ਮਿਊਜ਼ੀਅਮ","context_page_description":"ਲਲਿਤ ਕਲਾਵਾਂ ਦਾ ਪੁਸ਼ਕਿਨ ਮਿਊਜ਼ੀਅਮ ਮਾਸਕੋ ਵਿੱਚ ਯੂਰਪੀ ਕਲਾ ਦਾ ਸਭ ਤੋਂ ਵੱਡਾ ਮਿਊਜ਼ੀਅਮ ਹੈ। ਇੰਟਰਨੈਸ਼ਨਲ ਸੰਗੀਤਕ ਤਿਉਹਾਰ ਸਵਿਆਤੋਸਲਾਵ ਰਿਕਟਰ ਦਾ ਦਸੰਬਰ ਦੀਆਂ ਰਾਤਾਂ 1981 ਦੇ ਬਾਅਦ ਪੁਸ਼ਕਿਨ ਮਿਊਜ਼ੀਅਮ ਵਿੱਚ ਆਯੋਜਿਤ ਕੀਤਾ ਜਾਂਦਾ ਹੈ।"},{"page_url":"https://ast.wikipedia.org/wiki/Viguera","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Casta%C3%B1ares_de_las_Cuevas_-_Iglesia_de_la_Asunci%C3%B3n_-_DSC_5041.jpg","page_title":"Viguera","context_page_description":"Viguera ye un conceyu de la comunidá autónoma de La Rioxa, asitiáu a veres del ríu Iregua."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BB%D1%83%D0%BA-%D0%92%D0%BE%D0%BD%D0%B4%D0%B0%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Lambang_Kabupaten_Teluk_Wondama.png","page_title":"Телук-Вондама","context_page_description":"Телук-Вондама — округ, находящийся на востоке индонезийской провинции Западное Папуа. Столица этого округа, носящяя название Расиеи и расположенная на западном побережье полуострова Васиор, является также административным центром одного из районов округа Телук-Вондама — Васиор Селатан. В этот округ входят такие районы, как:\\nРумберпон;\\nВамеса;\\nВасиор;\\nВасиор Барат;\\nВасиор Селатан;\\nВасиор Утара;\\nВиндеси."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B1%9F%E6%88%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Inasegawa_Seizoroi_no_Ba.jpg","page_title":"江戸","context_page_description":"江戸 は、東京の旧称であり、1603年から1868年まで江戸幕府が置かれていた都市である。\\n現在の東京都区部の中央部に位置し、その前身及び原型に当たる。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A6%E0%B5%81%E0%B4%83%E0%B4%96%E0%B4%B5%E0%B5%86%E0%B4%B3%E0%B5%8D%E0%B4%B3%E0%B4%BF%E0%B4%AF%E0%B4%BE%E0%B4%B4%E0%B5%8D%E0%B4%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Cristo_de_San_Pl%C3%A1cido%2C_by_Diego_Vel%C3%A1zquez.jpg","page_title":"ദുഃഖവെള്ളിയാഴ്ച","context_page_description":"ലോകമെമ്പാടുമുള്ള ക്രിസ്ത്യാനികൾ ഈസ്റ്ററിനു തൊട്ടു മുൻപുള്ള വെള്ളിയെ ദുഃഖവെള്ളിയാഴ്ച ആയി ആചരിക്കുന്നു. യേശു ശിഷ്യന്മാരോടൊപ്പം അന്ത്യ അത്താഴം കഴിച്ച, അവരുടെ കാലുകൾ കഴുകി വിനയത്തിന്റെ ഉദാത്ത മാതൃക കാണിച്ച പെസഹാ വ്യാഴത്തിന്റെ തുടർന്നുള്ള ഈ ദിവസത്തിൽ ‍യേശുക്രിസ്തുവിന്റെ പീഡാസഹനത്തെയും കാൽവരി മലയിലെ കുരിശു മരണത്തെയും ക്രൈസ്തവർ അനുസ്മരിക്കുന്നു. പാശ്ചാത്യ രാജ്യങ്ങളിൽ ഈ ദിവസത്തെ ഗുഡ്‌ ഫ്രൈഡേ എന്നും പോളണ്ട് സഭ, യവന സഭ, സുറിയാനി സഭ തുടങ്ങിയ‍ ഓർത്തഡോക്സ്‌ സഭകളിൽ ഈ ദിവസം വലിയ വെള്ളിയാഴ്ച അഥവാ ഗ്രെയിറ്റ്‌ ഫ്രൈഡേ എന്നും വിളിക്കുന്നു. കേരളത്തിലെ സുറിയാനി സഭകൾ ഹാശാ ആഴ്ചയിലെ അഥവാ കഷ്ടാനുഭവ ആഴ്ചയിലെ ഈ വെള്ളിയാഴ്ചയെ ഹാശാ വെള്ളി എന്നും വിളിക്കുന്നു."},{"page_url":"https://de.wikipedia.org/wiki/Toggenburger_Hausorgel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Hausorgel_Heinrich_Ammann.jpg","page_title":"Toggenburger Hausorgel","context_page_description":"Toggenburger Hausorgeln sind Hausorgeln in der im Toggenburg typischen Ausbildungsform. Der Toggenburger Hausorgelbau umfasst mehr als 100 Instrumente mit Datierungen von 1754 bis 1821. Sie sind geschmückt mit Schnitzereien und bemalt mit floralen Ornamenten und Rocaillenwerk. Gespielt wurden die Toggenburger Hausorgeln zumeist von Frauen. Mit ihrem festlichen Klang unterstützten die Instrumente die pietistisch getönten Hausandachten."},{"page_url":"https://az.wikipedia.org/wiki/Bolqar%C4%B1stan_H%C9%99rb_Tarixi_Muzeyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Aero_L-29_%28NMMH%29.jpg","page_title":"Bolqarıstan Hərb Tarixi Muzeyi","context_page_description":"Bolqarıstan Hərb Tarixi Muzeyi — Bolqarıstanda yerləşən hərb tarixi muzeyidir. Muzey Bolqarıstanın Sofiya şəhərində yerləşir. Müdafiə Nairliyinin tabeliyində olan muzey müxtəlif adlar altında 1 avqust 1914-cü ildə müəssisə şəklində yaradılmışdır. 4 iyul 1916-cı ildə isə muzey statusu almışdır. Qapalı sahənin ərazisi 5000 kvadrat kilometrdir. Açıq sərgi sahəsinin ərazisi isə 40000 kvadrat kilometrdir. Həmçinin muzeydə kitabxana və kompüter mərkəzi fəaliyyət göstərir."},{"page_url":"https://pl.wikipedia.org/wiki/Jakiw_Ho%C5%82owacki","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Vasnetsov_Bapt_Vladimir.jpg","page_title":"Jakiw Hołowacki","context_page_description":"Jakiw Hołowacki, ukr. Яків Федорович Головацький, pol. Jakub Hołowacki lub Głowacki, ros. Яков Федорович Головацкий – ukraiński działacz narodowy, badacz galicyjskiego folkloru, profesor Uniwersytetu Lwowskiego w katedrze Literatury i Języka Ruskiego, następnie jeden z liderów moskalofilstwa.\\nPochodził z rodziny duchownego greckokatolickiego. Od młodości zafascynowany folklorem Rusinów galicyjskich, postanowił zostać duchownym, by móc zaangażować się w ich formujący się ruch narodowy i poznawać ruską kulturę ludową. W czasie studiów razem z Markijanem Szaszkewyczem i Iwanem Wahyłewyczem powołał do życia grupę samokształceniowo-literacką nazwaną Ruską Trójcą, w ramach której rozpoczął badania nad kulturą ludową Galicji. Dzięki staraniom Hołowackiego grupa wydała tom zatytułowany Rusałka Dnistrowaja, w którym zawarli kilka pieśni ludowych, kilka utworów własnych, tłumaczeń z różnych języków słowiańskich oraz rozważania nad piśmiennictwem staroruskim. Jego publikacja była jednym z momentów zwrotnych w rozwoju ukraińskiego ruchu narodowego w Galicji."},{"page_url":"https://de.wikipedia.org/wiki/Kof%C3%A7az","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kofcaz_-_panoramio.jpg","page_title":"Kofçaz","context_page_description":"Kofçaz ist eine Stadt und Hauptort des gleichnamigen Landkreises in der Provinz Kırklareli in Ostthrakien. Der Ort liegt ca. 24 km nördlich von der Provinzhauptstadt Kırklareli am Fındıklı-Bach.\\nKofçaz war bis zum Zweiten Balkankrieg 1913 ein bulgarisches Dorf, als die bulgarische Bevölkerung im Zuge der Rückeroberung Ostthrakiens von den Türken vertrieben wurde.\\nDer im Norden der Provinz gelegene Landkreis grenzt im Süden an den zentralen Landkreis Kırklareli, im Westen an die Provinz Edirne und im Norden an Bulgarien. Er ist der Landkreis mit der geringsten Bevölkerungszahl und hat auch die niedrigste Bevölkerungsdichte in der Provinz. Neben der Kreisstadt besteht er aus 16 Dörfern mit durchschnittlich 108 Bewohnern. Die Palette der Einwohnerzahlen reicht von 245 bis 32.\\nDie Yıldız Dağları nehmen einen Teil des Landkreises ein."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%9C%97%E8%B1%AA%E5%9D%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Langham_Place_Minibus_Station_2016.jpg","page_title":"朗豪坊","context_page_description":"朗豪坊是香港一组摩天大楼建筑群，位于九龙旺角亚皆老街8号，于2004年10月落成并于2005年开幕，是该区著名地标。\\n朗豪坊属于三合一大型发展项目，分别由商场、写字楼、酒店组成。朗豪坊三个项目有互惠互补的特点，大型商场设有大量商店、食肆及娱乐设施，而高级写字楼和五星级酒店则分别为商场带来高消费力的上班族及旅客，形成一个稳定的消费链。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B1%D9%81%D9%88%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hospitalkirche_Erfurt.JPG","page_title":"ارفورت","context_page_description":"ارفورت آلمانین تورینقن ایالتینده یئر آلان بیر شهردیر و ۱۹۴ متر دنیز سئویه سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا 204880 نفر دیر. بۇ شهرین 269.17 کیلومتر موربع ساحه سی وار."},{"page_url":"https://fy.wikipedia.org/wiki/Sitfollybal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Sitting_volleyball_player.jpg","page_title":"Sitfollybal","context_page_description":"Sitfollybal is in fariant fan de sealsport follybal. Sitfollybal mei yn Nederlân troch eltsenien spile wurde, it wurdt benammen spile troch minsken dy't yn in rolstoel sitte, mar minksen dy’t net beheind binne en wol in blessuere hawwe, meie ek meidwaan.\\nSitfollybal is nasjonaal sûnt 1996 in ûnderdiel fan de NeVeBo en is ynternasjonaal oansletten by de WOVD. Sûnt 1980 is sitfollybal in offisjele Paralympyske sport foar manlju, sûnt 2004 jildt dat ek foar de froulju."},{"page_url":"https://no.wikipedia.org/wiki/Mellomsaksere","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/FlagOfMiddlesex.PNG","page_title":"Mellomsaksere","context_page_description":"Mellomsaksere eller midtresaksere viser til det angelsaksiske folket eller stammen av dette navnet og deres område som lå midt mellom de andre angelsaksiske rikene i tidlig middelalder i England. Dette området ble siden, om enn med noe endrede grenser, til fylket Middlesex. Det inkluderte tidlig bosetning i London. Det samme var tilfellet for Westminster. Begge byene hadde en utpreget form for selvstendighet. Hele området var en del av kongedømmet Essex, men ble avgitt til kongedømmet Mercia på 700-tallet."},{"page_url":"https://fr.wikipedia.org/wiki/Nessos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Sebastiano_Ricci_013.jpg","page_title":"Nessos","context_page_description":"Dans la mythologie grecque, Nessos ou Nessus est un centaure, issu comme la plupart de ses congénères de l'union d'Ixion et Néphélé."},{"page_url":"https://nl.wikipedia.org/wiki/Kanton_La_Motte-Servolex","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Locator_map_of_Kanton_La_Motte-Servolex.png","page_title":"Kanton La Motte-Servolex","context_page_description":"Kanton La Motte-Servolex is een kanton van het Franse departement Savoie. Het kanton maakt deel uit van het arrondissement Chambéry."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D9%88%D8%B3%DB%8C%D9%87_%D8%B4%D9%87%D8%B1%D9%84%D8%B1%DB%8C%D9%86_%D9%86%DB%86%D9%81%D9%88%D8%B3%D8%A7_%DA%AF%D8%A4%D8%B1%D9%87_%D8%B3%DB%8C%D8%B1%D8%A7%D9%84%D8%A7%D9%86%D9%85%D8%A7%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ramenskoe-pond.jpg","page_title":"روسیه شهرلرین نۆفوسا گؤره سیرالانماسی","context_page_description":"اوبلاست\\nروسیه\\nروسیه‌نین فدرال بؤلگه‌لری\\nروسیه‌نین اکونومیک بؤلگه‌لری"},{"page_url":"https://hu.wikipedia.org/wiki/Vantoux-et-Longevelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Mairie_de_Vantoux.jpg","page_title":"Vantoux-et-Longevelle","context_page_description":"Vantoux-et-Longevelle település Franciaországban, Haute-Saône megyében. Lakosainak száma 181 fő. +/- Vantoux-et-Longevelle La Chapelle-Saint-Quillain, Velleclaire, Bucey-lès-Gy, Étrelles-et-la-Montbleuse, Villers-Chemin-et-Mont-lès-Étrelles és Vellefrey-et-Vellefrange községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Saint-Alban-les-Eaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/036_St_Alban-les-Eaux_%28_42370_%29.JPG","page_title":"Saint-Alban-les-Eaux","context_page_description":"Saint-Alban-les-Eaux ist eine französische Gemeinde mit 969 Einwohnern im Département Loire in der Region Auvergne-Rhône-Alpes. Saint-Alban-les-Eaux gehört zum Arrondissement Roanne und zum Kanton Renaison."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_Alexander_Moritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Moritzheim.jpg","page_title":"Friedrich Alexander Moritz","context_page_description":"Johann Friedrich Alexander Moritz war ein preußischer Offizier und Landrat im Kreis Zell."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D5%B6%D5%AA%D5%B8%D6%82%D5%AB%D5%AF%D5%AB_%D5%B4%D5%B8%D5%A3%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B7%D5%A1%D5%BF%D6%80%D5%BE%D5%A1%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Font_M%C3%A0gica_de_Montju%C3%AFc_17_%282009-05-24%29.JPG","page_title":"Մոնժուիկի մոգական շատրվան","context_page_description":"Մոնժուիկի մոգական շատրվան, գտնվում է Բարսելոնայի Մոնժուիկ բլրի վրա։\\nՄեծ շատրվանը կառուցվել է Բարսելոնայում 1919 թվականի Համաշխարհային ցուցահանդեսի առթիվ, ֆուտուրիստական ոճով, էլիպսաձև նախագծով։ Կառուցվել է ինժեներ Կառլոս Բուիգասի կողմից։\\nՄինչև 1992 թվականը կառույցը գործել է առանց վերանորոգման\` ուրախացնելով Կատալոնիայի մայրաքաղաքի բնակիչներին ու հյուրերին։ Սակայն 1992 թվականի Օլիմպիական խաղերից առաջ որոշեցին շատրվանը դարձնել քաղաքի խորհրդանիշերից մեկը\` ավելացնելով երաժշտական ձևավորում։\\n3000-ից ավելի աշխատողներ իրականացրել են լայնածավալ ծրագիրն ընդամենը մեկ տարվա ընթացքում։ Իսպանիայի հրապարակի երկու աշտարակներից դեպի շատրվան կան լուսավորված կասկադներ։ Ջրատարածքի մոտ բոլոր կողմերում հնչում է նրբագեղ երաժշտություն, որի ներքո ջրի 3620 շիթերը կարծես թե պարում են։ Մեկ տարվա ընթացքում Մոնժուիկ է այցելում ավելի քան 2,5 միլիոն մարդ։\\nՍկզբում մոտ 20 հոգի ներգրավված էր շոուի սպասարկման մեջ: Նրանք կարգավորում էին ջրի հոսքը, երաժշտությունը և լույսերը։ Հետագայում այդ գործընթացները դարձան ինքնակարգավորվող։\\nՇատրվանն աշխատում է ըստ հետևյալ ժամանակացույցի.\\nԱպրիլի 30-ից մինչև սեպտեմբերի 30-ը\` հինգշաբթիից մինչև կիրակի, 21:00 – 23:30 ։\\nՀոկտեմբերի 1-ից մինչև ապրիլի 30-ը\` ուրբաթ և շաբաթ օրեր, 19։00 – 21։"},{"page_url":"https://de.wikipedia.org/wiki/Fell-Lokomotive","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Fell_Engine_Museum_-_2002-03-20.jpg","page_title":"Fell-Lokomotive","context_page_description":"Die Fell-Lokomotive ist eine Bauart von Lokomotiven, bei der zusätzliche Reibräder die übertragbare Zugkraft erhöhen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B3%D0%B0%D0%B4%D0%B0%D0%BD_(%D1%82%D0%B5%D0%BB%D0%B5%D1%80%D0%B0%D0%B4%D0%B8%D0%BE%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Vesti_Magadan.png","page_title":"Магадан (телерадиокомпания)","context_page_description":"Государственная телевизионная и радиовещательная компания «Магадан» — филиал ФГУП «Всероссийская государственная телевизионная и радиовещательная компания» осуществляющий его местное теле- и радиовещание в Магаданской области."},{"page_url":"https://en.wikipedia.org/wiki/Pessan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Pessan_%2832%29_Mairie.JPG","page_title":"Pessan","context_page_description":"Pessan is a commune in the Gers department in southwestern France."},{"page_url":"https://es.wikipedia.org/wiki/Metronome","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Union_Square_New_York_April_2016_3.JPG","page_title":"Metronome","context_page_description":"Metronome es una gran instalación de arte público situada en el extremo sur de Union Square en Nueva York, Estados Unidos. Esta obra fue encargada por Related Companies, promotora de One Union Square South, con la participación del Public Art Fund y la Municipal Art Society. Los 4,2 millones de dólares pagados por esta promotora lo hacen una de las obras de arte público más caras encargadas por el sector privado.\\nEsta obra fue creada por Kristin Jones and Andrew Ginzel y se compone de varias secciones, incluido un agujero circular del que salen chorros de vapor blanco durante el día, y un reloj con grandes dígitos LED de color naranja. La instalación de Metronome empezó en febrero de 1999, y su inauguración se realizó el 26 de octubre de 1999."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B5%D0%BC%D0%BF,_%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82_%D0%AD%D0%B4%D0%B2%D0%B0%D1%80%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Mewburn_with_Borden_and_Kemp.png","page_title":"Кемп, Альберт Эдвард","context_page_description":"Сэр А́льберт Э́двард Кемп KCMG PC — канадский предприниматель и политик. В качестве предпринимателя известен как владелец одной из крупнейших металлургических компаний Канады — Kemp Manufacturing. Занимал посты министра без портфеля, министра милиции и обороны и министра заморских вооружённых сил в правительстве Роберта Бордена. На двух последних постах был одним из руководителей канадских вооружённых сил в Первой мировой войне. в Пять раз избирался депутатом Палаты общин от Консервативной и Юнионистской партий. В 1921 году назначен премьером Артуром Мейеном в Сенат Канады, где служил до своей смерти в 1929 году, представляя провинцию Онтарио."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rimpar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Rimpar_St._Peter_und_Paul_Riemenschneiderepitaph_f%C3%BCr_Eberhardt_von_Grumbach_1487-001.jpg","page_title":"Liste der Baudenkmäler in Rimpar","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Rimpar zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 60 Baudenkmäler"},{"page_url":"https://en.wikipedia.org/wiki/Zalakaros","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Zalakaros_panorama_%2818787554754%29.jpg","page_title":"Zalakaros","context_page_description":"Zalakaros is a town in Zala County, Hungary.\\nZalakaros is famous for its thermal spring baths. It gained its fame in 1967, when prospective oil drilling struck a nearly 96 °C source at a depth of 1000 metres."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Nurmeksen_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/H%C3%B6lj%C3%A4k%C3%A4n_sh..jpg","page_title":"Luettelo Nurmeksen julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Nurmeksen julkisista taideteoksista ja muistomerkeistä sisältää Nurmeksen kaupungissa olevat pysyvät patsaat, muistomerkit ja muistolaatat. Nurmekseen on liitetty Nurmeksen maalaiskunta ja Valtimo.\\nLuettelossa on pysyvästi julkisilla paikoilla olevia taideteoksia, muistomerkkejä ja muistolaattoja sekä hautausmailla olevia yleisiä muistomerkkejä ja patsaita. Luettelossa ei mainita rakennusten sisällä ja suljetuilla sisäpihoilla olevia julkisia teoksia eikä yksittäisten hautojen veistoksia. Teokset ovat luettelossa nimensä mukaisessa aakkosjärjestyksessä. Sijaintipaikka on puiston, aukion, rakennuksen tai muun vastaavan nimi ja/tai katuosoite. Alue tarkoittaa kaupunginosaa/kunnanosaa, taajamaa, kylää, osa-aluetta tai asuinaluetta. Karttalinkki osoittaa teoksen sijaintipaikan kymmenien metrien tarkkuudella. Paljastusvuosi on teoksen julkistuksen tai paljastuksen vuosi sijaintipaikalla."},{"page_url":"https://nl.wikipedia.org/wiki/Raadhuis_van_Bazel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/BASILEA_-_BASEL_-_RATHAUS.jpg","page_title":"Raadhuis van Bazel","context_page_description":"Het Raadhuis van Bazel is een gebouw aan de Marktplatz in de Zwitserse stad Bazel. Het raadhuis wordt als vergaderruimte van zowel de regering als het parlement van halfkanton Basel-Stadt gebruikt."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%A2%E7%89%8C%E6%A5%BC%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Platform_of_Hongpailou_Station.JPG","page_title":"红牌楼站","context_page_description":"红牌楼站位于成都市武侯区佳灵路，是成都地铁3号线的地下岛式车站，于2016年7月31日启用。明代嘉靖年间，蜀王为迎接西藏前来送贡礼、做生意的藏族使者及商人，故按藏族的风俗习惯设立红色牌坊——红牌楼，牌坊今已不存，本站临近原址，因其而得名。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B8%D0%BD%D1%86%D0%B8%D0%BD%D0%BD%D0%B0%D1%82%D0%B8/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%9A%D0%B5%D0%BD%D1%82%D1%83%D0%BA%D0%BA%D0%B8_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/18_Cincinnati_airport-03.JPG","page_title":"Цинциннати/Северный Кентукки (аэропорт)","context_page_description":"Международный аэропорт Цинциннати/Северный Кентукки, — расположен в неиндустральной зоне Хеброн округа Бун. Собственный код аэропорт получил по сокращенному названию ближайшего крупного, на момент его открытия, города Ковингтон. Несмотря на то, что аэропорт находится в округе Бун, деятельность его координируется и управляется Администрацией аэропорта, расположенной в округе Кентон. Международный аэропорт Цинциннати/Северный Кентукки занимает общую площадь в 28 квадратных километров."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D1%8B%D0%B9_%D0%90%D0%BA%D1%82%D1%83%D1%80%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/School_Aktru_2011.jpg","page_title":"Малый Актуру","context_page_description":"Малый Актуру — ледник в окрестностях горы Актуру Северо-Чуйского хребта Алтайских гор. Расположен на территории Кош-Агачского района Республики Алтай. Имеет длину около 3 км и площадь — 3 км²."},{"page_url":"https://eu.wikipedia.org/wiki/Hekuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Dream_hecuba_hi.jpg","page_title":"Hekuba","context_page_description":"Hekuba, greziar mitologian, Priamo, Troiako erregea eta Iliadako pertsonaiaren bigarren emaztea da. Frigiako errege zen Dimasen alaba da lan honen arabera, Sangarios eta Evagora ninfaren alabatzat ere hartu den arren.\\nHekubak, Priamorekin, seme-alaba ugari izan zituen, iturrien arabera, Apolodoro Atenaskoak aipatzen dituen 14tatik, Euripidesek aipatutako 50 arte, tradizio hedatuenak aipatzen dituen 19etatik pasatuz. Bere seme-alabarik ezagunenen artean, Hektor, Kasandra, Paris, Heleno, Polixena eta Troilo zeuden."},{"page_url":"https://es.wikipedia.org/wiki/Regi%C3%B3n_Oriental_del_Paraguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Bandera_del_Departamento_de_Caazap%C3%A1.png","page_title":"Región Oriental del Paraguay","context_page_description":"La Región Oriental del Paraguay, también denominada Paraneña paraguaya, es una de las dos regiones que forman la República del Paraguay. Está formada por catorce de los diecisiete departamentos del país, a los que hay que sumar el distrito capital Asunción, que no está integrada a ningún departamento.\\nLimita al norte con Brasil, al este y sur con el río Paraná que la separa de Brasil y Argentina, y al oeste con el río Paraguay que la separa de Argentina y del Chaco paraguayo, la región occidental.\\nSegún estimaciones de la DGEEC, la Región Oriental cuenta con 6 936 240 habitantes para el año 2019, lo que supone el 97% de la población total del país. Sin embargo, con una extensión de 159 827 km², abarca sólo el 39% de la extensión total del país. La densidad de población de esta región es de 43,39 hab/km².\\nEs la región más desarrollada, pues están las principales instituciones de la República y los más importantes patrimonios históricos y culturales. Contiene la mayor estructura sanitaria, vial, educativa, de comunicación y servicios básicos del país."},{"page_url":"https://ro.wikipedia.org/wiki/Karolino-Bugaz,_Ovidiopol","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Karolino_bugaz_prapor.png","page_title":"Karolino-Bugaz, Ovidiopol","context_page_description":"Karolino-Bugaz este o comună în raionul Ovidiopol, regiunea Odesa, Ucraina, formată numai din localitatea de reședință.\\nLocalitatea este o importantă stațiune balneară ucraineană de pe litoralul nord-vestic al Mării Negre, la 60 km sud-vest de Odesa. Este situată la est de strîmtoarea Țarigrad, pe o peninsulă alungită și lată de numai câteva sute de metri ce separă Limanul Nistrului de restul Mării Negre.\\nLocalitatea a fost întemeiată în anul 1813 de către contele polonez Ignacy-Karol Ścibor-Marchocki. Conform recensămîntului din 2001 la Karolino-Bugaz locuiau 2.240 de persoane."},{"page_url":"https://war.wikipedia.org/wiki/Onchidoris_bilamellata","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Onchidoris_bilamellata.jpg","page_title":"Onchidoris bilamellata","context_page_description":"Onchidoris bilamellata in uska species han Gastropoda nga syahan ginhulagway ni Linnaeus hadton 1767. An Onchidoris bilamellata in nahilalakip ha genus nga Onchidoris, ngan familia nga Onchidorididae. Waray hini subspecies nga nakalista."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D9%86%D8%B1_%D8%BA%D9%84%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Tanner_Glass_2013-01-18_2.JPG","page_title":"تانر غلاس","context_page_description":"تانر غلاس هو لاعب هوكي جليد كندي، ولد في 29 نوفمبر 1983 في ريجاينا في كندا."},{"page_url":"https://vi.wikipedia.org/wiki/1969","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Gwen_Stefani.jpg","page_title":"1969","context_page_description":"Theo lịch Gregory, năm 1969 là một năm nhuận bắt đầu từ ngày thứ tư."},{"page_url":"https://sk.wikipedia.org/wiki/Mia_Farrowov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Mia_Farrow_-_Rosemary%27s_Baby.jpg","page_title":"Mia Farrowová","context_page_description":"María de Lourdes Villiers Farrow známa tiež ako Mia Farrow, je americká herečka a aktivistka. Známa je z filmov ako Rosemaryino dieťa, Súkromný detektív, Veľký Gatsby, Purpurová ruža z Káhiry, Iná žena, Alice, Nikdy na mňa nezabudnite, Satan prichádza, Prosíme pretočte či Čierny kôň."},{"page_url":"https://en.wikipedia.org/wiki/Henri_Schneider","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Henri_Schneider_%281840-1898%29.png","page_title":"Henri Schneider","context_page_description":"Henri Adolphe Eugène Schneider was a French businessman and politician. He served as a member of the Chamber of Deputies from 1889 to 1898.\\nHenri Schneider was born in Le Creusot, rural France. His father, Eugène Schneider, co-founded Schneider-Creusot with his uncle, Adolphe Schneider, in 1836.\\nHe died in 1898 in Paris, France. His statue in the centre of Le Creusot, designed by Emile Peynot, was dedicated in 1923."},{"page_url":"https://cs.wikipedia.org/wiki/Indianapolis_City-County_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/City_and_County_Building_from_SSM.JPG","page_title":"Indianapolis City-County Building","context_page_description":"Indianapolis City-County builing je mrakodrap nacházející se na 200 E. Washington Street v americkém městě Indianapolis. Budova je sídlem vlády okresu Marion County. V budově je také sídlo Marion County Courts, Indianapolis Metropolitan Police Department a Indianapolis City-County Council. Kancelář starosty se nachází na nejvyšším patře."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%82%D8%A7%D8%B1_%D8%A7%D9%84%D8%AE%D8%B4%D8%A8_%D8%B0%D9%88_%D8%A7%D9%84%D8%B9%D8%B1%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/PileatedWoodpeckerNest.jpg","page_title":"نقار الخشب ذو العرف","context_page_description":"نقّار الخشب ذو العرف، هو نقّار خشبٍ أميركيٌ شمالي ذو حجمٍ كبيرٍ جداً يُقارب حجم الغراب، يعيش في الغابات النفضية في الشّمال الشرقي من أميركا وفي البحيرات العظمى و غابات التايغا الشمالية في كندا و في أجزاءٍ من سواحل المحيط الهادئ. يُعدّ أكبر نقّار للخشب في الولايات المتحدة الأميركية إذا ما استُثني نقار الخشب عاجي المنقار المحتمَلُ انقراضُه."},{"page_url":"https://en.wikipedia.org/wiki/The_Apotheosis_of_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Flickr_-_USCapitol_-_Apotheosis_of_Washington%2C_Commerce.jpg","page_title":"The Apotheosis of Washington","context_page_description":"The Apotheosis of Washington is the fresco painted by Greek-Italian artist Constantino Brumidi in 1865 and visible through the oculus of the dome in the rotunda of the United States Capitol Building. The fresco is suspended 180 feet above the rotunda floor and covers an area of 4,664 square feet. The figures painted are up to 15 feet tall and are visible from the floor below. The dome was completed in 1863, and Brumidi painted it over the course of 11 months at the end of the Civil War. He was paid $40,000 for the fresco.\\nBrumidi had worked for three years in the Vatican under Pope Gregory XVI, and served several aristocrats as an artist for palaces and villas, including the prince Torlonia. He immigrated to the United States in 1852, and spent much of the last 25 years of his life working in the Capitol. In addition to The Apotheosis of Washington he designed the Brumidi Corridors."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ch%C3%A2teaux_de_Sa%C3%B4ne-et-Loire","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Ch%C3%A2teau_de_Chamilly_%2871%29_-_1.JPG","page_title":"Liste des châteaux de Saône-et-Loire","context_page_description":"Cet article recense de manière non exhaustive les châteaux, maisons fortes, mottes castrales, situés dans le département français de Saône-et-Loire. Il est fait état des inscriptions et classements au titre des monuments historiques."},{"page_url":"https://id.wikipedia.org/wiki/Kleve_(distrik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Lage_des_Kreises_Kleve_in_Deutschland.PNG","page_title":"Kleve (distrik)","context_page_description":"Kleve adalah sebuah distrik di Nordrhein-Westfalen, Jerman."},{"page_url":"https://eu.wikipedia.org/wiki/Egon_Schiele","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Egon_Schiele_037.jpg","page_title":"Egon Schiele","context_page_description":"Egon Schiele, austriar margolari figuratiboa, espresionismoaren ordezkari goiztiarra izan zen. Gustav Klimt eta Oskar Kokoschkarekin batera, austriar espresionismoa delakoa osatu zuen.\\nAustriako espresionismoko pintore nagusietako bat izan zen, margolaria, marrazkilaria eta grabatzailea, eta bere irudien erotismoagatik nabarmendu zen. Vienako Arte eta Lanbide eskolan egin zituen ikasketak. Garai hartan harreman handia izan zuen Alemaniako art noveau-rekin, eta Gustav Klimt ere ezagutu zuen, Klimt Vienako Sezesioa taldeko buru zela. Izan ere, Schieleren estilo sotilak asko zor dio Klimten dotoretasun dekoratiboari. Nolanahi ere, Schielek garrantzi handiagoa eman zion espresioari dekorazioari baino, eta lerroaren ahalmen hunkigarria indartu zuen tentsio sukartsu batez.\\nHasiera-hasieratik, giza irudia landu zuen batez ere, eta gai erotikoak tratatzen zituen modu irekiak harridura handia sortu zuen. Vienako Akademiaren kontserbadorismoaz asperturik, 1909an Vienako Neukunstgruppe taldea sortu zuten artisteetariko bat izan zen. 1910etik aurrera, erakusketak egin zituen Europan zehar; 1918an areto bat eskaini zioten bere lanari Vienako sezesionisten erakusketan."},{"page_url":"https://zh.wikipedia.org/zh-sg/ATX%E8%A6%8F%E6%A0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/ATX_Power_connectors_24pin_8pin_4pin_Motherboard.jpg","page_title":"ATX規格","context_page_description":"ATX主板规格由英特尔公司在1995年制定。这是多年来第一次电脑机壳与主板设计的重大改变。ATX取代AT主板规格，成为较新电脑系统默认的主板规格。ATX解决以往AT规格中，令电脑组装人士烦恼的问题。ATX有7条扩充槽。其他派生的主板规格保留ATX基本的背板设置，但主板的面积减少，扩展槽的数目也有所删减。\\n自英特尔在1995年发表最初的ATX官方规格后，此规格经历多次变更；最新规格ATX12VO于2020年发表。标准的ATX主机版，长12英寸，宽9.6英寸。这也容许标准的ATX机箱容纳较小的microATX主板。\\n2003年，英特尔发布全新的BTX主板规格，以其作为ATX的替代规格。但由于兼容性的问题，ATX规格仍为组装电脑最通行的主板规格，只有大型厂商的零售电脑采用BTX，因此英特尔于2006年放弃BTX的发展。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Nippes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/2013-03-29_koeln_neusserstr_335.JPG","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Nippes","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Nippes, Stadtbezirk Köln-Nippes, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://it.wikipedia.org/wiki/Circoscrizione_Liguria_(Camera_dei_deputati)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Collegio_elettorale_di_Genova-Parenzo_1994-2001_%28CD%29.png","page_title":"Circoscrizione Liguria (Camera dei deputati)","context_page_description":"La circoscrizione X Liguria, per l'elezione della Camera dei deputati, venne istituita con la legge 4 agosto 1993, n. 277, confermata nella legge 21 dicembre 2005, n. 270 e nella successiva legge 3 novembre 2017, n. 165.\\nLa circoscrizione comprende geograficamente l'intera regione Liguria e sostituisce, ai fini dell'elezione della Camera la precedente circoscrizione, Genova nota anche come Genova-Imperia-La Spezia-Savona, in vigore dalle elezioni del 1946 fino a quelle del 1992. Con la Legge Mattarella la circoscrizione ha eletto 19 deputati, scesi a 17 con la Legge Calderoli. A seguito del Censimento del 2011 la circoscrizione ha perso un ulteriore rappresentante arrivando ad eleggere 16 deputati confermati poi dalla Legge Rosato."},{"page_url":"https://vi.wikipedia.org/wiki/Si%C3%AAu_ph%E1%BA%A3n_di%E1%BB%87n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Batman_villains_1966.jpg","page_title":"Siêu phản diện","context_page_description":"Siêu phản diện là một nhân vật phản diện hư cấu thường được tìm thấy trong những quyển sách truyện tranh của Mỹ và đôi khi họ sở hữu siêu năng lực. Một supervillain là hình ảnh trái ngược của một superhero.\\nNhững Supervillain thường gây khó khăn, thách thức cho những siêu anh hùng. Trong trường hợp các supervillain không có siêu năng lực, sức mạnh thần bí, hoặc sức mạnh ngoài hành tinh, thì họ thường sở hữu một trí tuệ thiên tài hay những kỹ năng cho phép họ để soạn ra những đề án phức tạp hoặc phạm tội theo cách mà người bình thường không thể thực hiện được."},{"page_url":"https://tr.wikipedia.org/wiki/Rade_%C5%A0erbed%C5%BEija","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Rade_Serbedzija.jpg","page_title":"Rade Šerbedžija","context_page_description":"Rade Šerbedžija, Hırvat aktör, yönetmen ve müzisyen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BA%D1%91%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/HotelDeVilleArcueil.JPG","page_title":"Аркёй","context_page_description":"Аркёй — коммуна во Франции, в регионе Иль-де-Франс, департамент Валь-де-Марн.\\nКоммуна находится на расстоянии около 5.3 км на юг от центра Парижа.\\nПересекается рекой Бьевр. Площадь составляет 233 га, в том числе 20 га зеленых насаждений. Коммуна более чем на 90 % урбанизирована и уже в 2010 году состояла на 45 % из социального жилья. Урбанизация происходила в разные периоды времени, что заметно в облике зданий, построенных в стилях различных эпох."},{"page_url":"https://it.wikipedia.org/wiki/Fran%C3%A7ois-Thomas-Marie_de_Baculard_d%27Arnaud","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/P%C3%A8re-Lachaise_-_Division_10_-_Baculard_d%27Arnaud_02.jpg","page_title":"François-Thomas-Marie de Baculard d'Arnaud","context_page_description":"François-Thomas-Marie de Baculard d'Arnaud è stato uno scrittore, poeta e drammaturgo francese."},{"page_url":"https://de.wikipedia.org/wiki/Pultdach","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pultowa_trecha.svg","page_title":"Pultdach","context_page_description":"Ein Pultdach ist eine Dachform aus nur einer geneigten Dachfläche. Die untere Kante bildet die Dachtraufe, die obere den Dachfirst. Die Wand am First wird die Hohe Wand genannt. Die übliche Konstruktion ist ein einseitig geneigtes Pfettendach. Die Dachneigung von Pultdächern ist meistens gering.\\nIn der europäischen Architekturgeschichte finden sich Pultdächer üblicherweise über angegliederten Gebäudeteilen, beispielsweise über Erkern, Anbauten oder Seitenschiffen von Basiliken. Als Hauptdach eines Gebäudes hingegen sind sie in der historischen Architektur nur selten anzutreffen.\\nSeit der Industrialisierung finden Pultdächer vor allem Anwendung für die Bedachung von Garagen, Produktions- und Lagerstätten oder Nebengebäuden. Ab der Mitte des 20. Jahrhunderts wird das Pultdach auch häufiger als Hauptdach für Wohngebäude oder Kirchen verwendet, um einen architektonischen Akzent zu setzen. Bei Wohnhäusern kann der Wohnraum unter dem Dach durch ein nur leicht geneigtes Pultdach als Vollgeschoss genutzt werden. Die einfach zu konstruierende Dachform ist kostengünstig in der Errichtung."},{"page_url":"https://de.wikipedia.org/wiki/Ortskampfanlage_Bonnland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Friedhof_Bonnland_GrGr.jpg","page_title":"Ortskampfanlage Bonnland","context_page_description":"Bonnland ist ein ab 1937 abgesiedeltes Dorf mit 120 Gebäuden, das jetzt als Ortskampfanlage auf dem Truppenübungsplatz Hammelburg verwendet wird. Das Übungslager Hammelburg besteht seit 1896, die ersten Schießbahnen wurden 1895 angelegt.\\nDie ersten Schießübungen fanden im Herbst 1895 statt. An den Übungen nahmen u. a. das Königlich Bayerische 19. Infanterieregiment und das Königlich Bayerische 5. Feldartillerieregiment teil. Bis 1910 übten sämtliche zum Königlich Bayerischen II. Armee-Korps gehörenden Verbände mehrere Wochen im Jahr in Hammelburg.\\nBonnland dient wie der gleichfalls aufgelöste Nachbarort Hundsfeld als Ausbildungsplatz für die Infanterieschule in Hammelburg und in den letzten Jahren vermehrt für die Ausbildung von Soldaten der Bundeswehr, die für Auslandseinsätze vorgesehen sind.\\nAuch Polizei, Bundespolizei, THW, Katastrophenschutz, Hundestaffeln und Feuerwehren nutzen das ehemalige Dorf zu Ausbildungszwecken."},{"page_url":"https://en.wikipedia.org/wiki/Facultad_de_Ciencias_M%C3%A9dicas_(UNR)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Facultad_de_Medicina_Rosario_1.jpg","page_title":"Facultad de Ciencias Médicas (UNR)","context_page_description":"The Faculty of Medical Sciences of the National University of Rosario is located in the city of Rosario, Argentina, in the central Santa Fe Avenue with France Avenue, segmenting the latter into two parts, form a set of four interlocking blocks of streets and interior corridors between different departments where there is also the Centennial Provincial Hospital."},{"page_url":"https://en.wikipedia.org/wiki/Heraklion","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Kreta_-_Iraklion_-_Alter_Hafen2.jpg","page_title":"Heraklion","context_page_description":"Heraklion or Iraklion is the largest city and the administrative capital of the island of Crete and capital of Heraklion regional unit. It is the fourth largest city in Greece with a population of 211,370 according to the 2011 census. The population of the municipality was 173,993.\\nThe Bronze Age palace of Knossos, also known as the Palace of Minos, is located nearby.\\nHeraklion was Europe's fastest growing tourism destination for 2017, according to Euromonitor, with an 11.2% growth in international arrivals. According to the ranking, Heraklion was ranked as the 20th most visited region in Europe, as the 66th area on the Planet and as the 2nd in Greece for the year 2017, with 3.2 million visitors and the 19th in Europe for 2018, with 3.4 million visitors."},{"page_url":"https://it.wikipedia.org/wiki/Carauari","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Carauari_-_brasao.jpg","page_title":"Carauari","context_page_description":"Carauari è un comune del Brasile nello Stato dell'Amazonas, parte della mesoregione di Sudoeste Amazonense e della microregione di Juruá."},{"page_url":"https://vi.wikipedia.org/wiki/Kobzar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Kobzars_Kravchenko_Dremchenko.jpg","page_title":"Kobzar","context_page_description":"Kobzar là người hát rong ở Ukraina, thường là người lính Cô-dắc bị mù hát những bài hát tự sáng tác và sử dụng các nhạc cụ dân tộc như kobza hoặc bandura. Những người hát rong dân gian có một ý nghĩa quan trọng trong việc phát triển con người và văn hóa dân tộc, đặc biệt là thời kỳ chưa có chữ viết. Họ bảo tồn và truyền lại cho thế hệ tương lai những kiến thức quan trọng về quá khứ của tổ tiên bằng hình thức dễ thuộc dễ nhớ nhất là những câu chuyện qua những bài hát.\\nNhững người hát rong rất phổ biến ở Ukraina từ năm 1930 trở về trước. Từ xưa những người hát rong thường tập hợp theo hội, gắn liền với phong trào Cô-dắc. Họ tham gia vào các cuộc khởi nghĩa của nông dân trên lãnh thổ Ukraina, đôi khi cả ở nước ngoài. Họ đứng ngoài vòng pháp luật, không tuân thủ chính quyền của Nga hoàng cũng như Liên Xô sau này, bởi thế họ bị coi là mối đe dọa cho quyền lực tập trung và thường bị đàn áp."},{"page_url":"https://pl.wikipedia.org/wiki/W%C5%82odzimierz_Kleszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/MamadouKleszcz20110429.jpg","page_title":"Włodzimierz Kleszcz","context_page_description":"Włodzimierz Kleszcz – dziennikarz muzyczny, producent, propagator muzyki folk i world music."},{"page_url":"https://sv.wikipedia.org/wiki/Acrothamnus_spathaceus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Leucopogon_spathaceus_1.jpg","page_title":"Acrothamnus spathaceus","context_page_description":"Acrothamnus spathaceus är en ljungväxtart som först beskrevs av Leslie Pedley, och fick sitt nu gällande namn av Christopher John Quinn. Acrothamnus spathaceus ingår i släktet Acrothamnus och familjen ljungväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/List_of_buildings_at_Ohio_State_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/The_Ohio_State_University_June_2013_30_%28John_Glenn_School_of_Public_Affairs%29.jpg","page_title":"List of buildings at Ohio State University","context_page_description":"This is an alphabetical list of buildings, facilitates and other structures at Ohio State University, a public research university in Columbus, Ohio."},{"page_url":"https://fr.wikipedia.org/wiki/Princesse_Reishi","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Kamidaigoji7316.JPG","page_title":"Princesse Reishi","context_page_description":"La princesse Reishi, 30 juin 1078 – 25 mai 1144, est une impératrice du Japon, belle-mère de l'empereur Toba."},{"page_url":"https://no.wikipedia.org/wiki/Salt_lakris","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Salmiak_balls.jpg","page_title":"Salt lakris","context_page_description":"Salt lakris, også kjent som salmiakk, er et godteri med smak av lakris som er smakstilsatt med saltet salmiakk og får derfor en salt smak. Salt lakris selges og konsumeres hovedsakelig i de nordiske landene, særlig Finland, og i Nederland, Baltikum, og i nordlige Tyskland. Salt lakris eller salmiakk må ikke forveksles med ren lakris eller lakrisplanten.\\nAmmoniumklorid gir en streng salt smak som har blitt beskrevet som «å lamme tungen», særlig for de som ikke er vant til smaken. Salt lakris er således en ervervet smak og de som ikke er vant med salmiakk kan oppleve smaken som ikke godt i det hele tatt og fysisk overveldende. Salt lakris er bortimot alltid svart eller meget mørk brun i fargen og produktene kan variere fra meget myk til meget hard, og kan være skjør eller sprø i konsistensen. Andre farger som er brukt er hvit og varianter av grå. Karbon svart er benyttet som fargestoff i disse godteriene. Salt lakris er også benyttet som smakstilsetning for andre produkter, slikt som iskrem og alkoholvarer."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%90%E3%83%BC%E3%83%88%E3%83%BB%E3%83%96%E3%83%A9%E3%82%A6%E3%83%8B%E3%83%B3%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Robert_Browning_by_Herbert_Rose_Barraud_c1888.jpg","page_title":"ロバート・ブラウニング","context_page_description":"ロバート・ブラウニングは、イギリスの詩人。エリザベス・バレット・ブラウニングの夫であり、彫刻家ロバート・バレット・ブラウニングの父。\\nロンドン郊外の裕福な家庭に生まれ、蔵書家の父と音楽家の母の薫陶を受け、当時の上流階級の慣習から正規の学校教育を受ける機会はわずかであった。12歳で詩集を作り、14歳でギリシア語・ラテン語をマスターし、古典を耽読した。21歳から詩や戯曲を発表したが、あまりにも難解だった。1846年、34歳のとき6歳年上の女性詩人エリザベス・バレットと結婚するも、岳父の反対によってフィレンツェに移住する。愛妻の死後にロンドンに戻る。55歳のとき、17世紀ローマで起きた現実の殺人事件をめぐって、10人の異なる証言で構成した壮大な物語詩『指輪と本』を発表、ようやく当代一流の詩人と認められるに至った。晩年にヨーロッパを渡り歩いた末にイタリアに戻り、最後の詩集が刊行された日にヴェネツィアで客死。ウェストミンスター寺院南翼廊の、アルフレッド・テニスンの隣に埋葬されている。\\n代表作としては劇詩「ピッパが通る Pippa Passes」が挙げられ、特にその一節「\\"God's in his heaven. All's right with the world.」が広く知られる。"},{"page_url":"https://cs.wikipedia.org/wiki/Miro%C5%A1ovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Mirosovice_PH_CZ_railway_station_012.jpg","page_title":"Mirošovice","context_page_description":"Obec Mirošovice se nachází v okrese Praha-východ, kraj Středočeský, jihovýchodním směrem zhruba 10 km od Říčan a 28 km od centra hlavního města Prahy, při křižovatce dálnice D1 se silnicí I/3 a při železniční trati 221, tedy hlavních spojnicích Prahy s Benešovem, Táborem a Českými Budějovicemi. Žije zde přibližně 1 400 obyvatel."},{"page_url":"https://de.wikipedia.org/wiki/Dean_Cain","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/TeriHatcher_DeanCain.jpg","page_title":"Dean Cain","context_page_description":"Dean Cain ist ein US-amerikanischer Schauspieler. Er wirkte in vielen Fernseh- und Kinoproduktionen mit. Seine bekannteste Rolle hatte er als Clark Kent in der Fernsehserie Superman – Die Abenteuer von Lois & Clark."},{"page_url":"https://de.wikipedia.org/wiki/Kohldistel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Cirsium_oleraceum.jpg","page_title":"Kohldistel","context_page_description":"Die Kohl-Kratzdistel, auch einfach Kohldistel genannt, ist eine Pflanzenart aus der Gattung der Kratzdisteln innerhalb der Familie der Korbblütler."},{"page_url":"https://it.wikipedia.org/wiki/Storia_postale_della_Cina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Chinese_stamp_in_1950.jpg","page_title":"Storia postale della Cina","context_page_description":"La complicata storia postale cinese è strettamente legata ai vari avvenimenti storici che hanno visto il graduale declino della Cina imperiale, gli anni della guerra civile e il periodo dell'occupazione giapponese tra gli anni trenta e gli anni quaranta."},{"page_url":"https://it.wikipedia.org/wiki/Vince_Banonis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Vince_Banonis.jpg","page_title":"Vince Banonis","context_page_description":"Vincent Joseph Banonis è stato un giocatore di football americano statunitense che ha militato nel ruolo di centro e defensive tackle nella National Football League."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Vr%C3%A1%C5%BE_(Tiong_Bohemia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Znak_vraz.jpg","page_title":"Vráž (Tiong Bohemia)","context_page_description":"Vráž sī Czech Tiong Bohemia chiu Beroun koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://fr.wikipedia.org/wiki/Mythologie_chibcha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Erythroxylum_coca.jpg","page_title":"Mythologie chibcha","context_page_description":"La mythologie chibcha désigne les croyances précolombiennes de la culture chibcha, concernant les origines du monde."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%9A%D1%8D%D0%BD%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Valve_monochrome_canny_%286%29.PNG","page_title":"Оператор Кэнни","context_page_description":"Оператор Кэнни в дисциплине компьютерного зрения — оператор обнаружения границ изображения. Был разработан в 1986 году Джоном Кэнни и использует многоступенчатый алгоритм для обнаружения широкого спектра границ в изображениях.\\nКэнни изучил математическую проблему получения фильтра, оптимального по критериям выделения, локализации и минимизации нескольких откликов одного края. Он показал, что искомый фильтр является суммой четырёх экспонент. Он также показал, что этот фильтр может быть хорошо приближен первой производной Гауссианы. Кэнни ввёл понятие подавления немаксимумов, которое означает, что пикселями границ объявляются пиксели, в которых достигается локальный максимум градиента в направлении вектора градиента.\\nХотя его работа была проведена на заре компьютерного зрения, детектор границ Кэнни до сих пор является одним из лучших детекторов. Кроме особенных частных случаев трудно найти детектор, который бы работал существенно лучше, чем детектор Кэнни."},{"page_url":"https://vi.wikipedia.org/wiki/Tricyrtis_hirta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Tricyrtis_hirta_-_blossom_top_%28aka%29.jpg","page_title":"Tricyrtis hirta","context_page_description":"Tricyrtis hirta là một loài thực vật có hoa trong họ Măng tây. Loài này được Hook. miêu tả khoa học đầu tiên năm 1863."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%85%D8%A7%D8%AF%D9%8A_%D8%A7%D9%84%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Hamadi-daou-diplome.jpg","page_title":"حمادي الدو","context_page_description":"حمادي الدو من مواليد 2 جويلية 1969 بمدينة صفاقس و من عائلة رياضية باعتباره نجل المسؤول السابق للنادي الرياضي الصفاقسي على مدى 50 سنة عبد القادر الدو"},{"page_url":"https://nl.wikipedia.org/wiki/Ku%C5%99imsk%C3%A1_Nov%C3%A1_Ves","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Ku%C5%99imsk%C3%A1_Nov%C3%A1_Ves_%280764%29.jpg","page_title":"Kuřimská Nová Ves","context_page_description":"Kuřimská Nová Ves is een Tsjechische gemeente in de regio Zuid-Moravië, en maakt deel uit van het district Brno-venkov.\\nKuřimská Nová Ves telt 133 inwoners."},{"page_url":"https://nl.wikipedia.org/wiki/Belastings-_en_aansluitfactor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Aansluitfactor.jpg","page_title":"Belastings- en aansluitfactor","context_page_description":"Een belastingsfactor is een getal dat aangeeft hoe zwaar een apparaat zoals een telefoontoestel, antwoordapparaat, fax, modem of DECT-basisstation een openbaar telecommunicatienetwerk belast. Hiermee kan worden bepaald hoeveel apparaten op het netwerk mogen worden aangesloten. Aansluitfactor is een term voor in principe hetzelfde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Nitra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kalvaria_Nitra-8_kaplnka.jpg","page_title":"Liste der denkmalgeschützten Objekte in Nitra","context_page_description":"Die Liste der denkmalgeschützten Objekte in Nitra enthält die 187 nach slowakischen Denkmalschutzvorschriften geschützten Objekte in der Gemeinde Nitra im Okres Nitra."},{"page_url":"https://en.wikipedia.org/wiki/California%27s_1st_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Thomas_J._Geary.jpeg","page_title":"California's 1st congressional district","context_page_description":"California's 1st congressional district is a congressional district in the U.S. state of California.\\nDoug LaMalfa, a Republican, has represented the district since January 2013.\\nCurrently, the district encompasses the northeastern part of the state. It consists of:\\nButte County\\nLassen County\\nModoc County\\nPlumas County\\nShasta County\\nSierra County\\nSiskiyou County\\nTehama County\\nmost of Nevada County\\npart of Glenn County\\npart of Placer County\\nPrior to redistricting by the California Citizens Redistricting Commission of 2011, the district encompassed much of the North Coast and Wine Country, as well as part of the Sacramento Valley. It consisted of Del Norte, Humboldt, Lake, Mendocino, and Napa counties plus portions of Sonoma and Yolo counties. That area is now primarily within the 2nd district, with the rest falling within the 5th and 3rd districts. The current district comprises much of the territory that had been the 2nd and 4th districts."},{"page_url":"https://pl.wikipedia.org/wiki/PZL_S%C4%99dzisz%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Filtry_PZL_Sedziszow.jpg","page_title":"PZL Sędziszów","context_page_description":"PZL Sędziszów S.A. to firma zajmująca się produkcją filtrów. Zakład zlokalizowany w Sędziszowie Małopolskim od 75 lat produkuje filtry paliwa, powietrza, kabiny i oleju dla motoryzacji, rolnictwa, lotnictwa oraz przemysłu ciężkiego. Od 60 lat prowadzi też zaawansowane badania w dziedzinie rozwoju technologii filtracyjnych."},{"page_url":"https://sv.wikipedia.org/wiki/Guhrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Guhrow%2C_Am_Sportplatz.jpg","page_title":"Guhrow","context_page_description":"Guhrow är en kommun och ort i Landkreis Spree-Neisse i förbundslandet Brandenburg i Tyskland.\\nKommunen ingår i kommunalförbundet Amt Burg tillsammans med kommunerna Briesen, Burg, Dissen-Striesow, Schmogrow-Fehrow och Werben."},{"page_url":"https://en.wikipedia.org/wiki/Rashidun_Caliphate","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Umar.png","page_title":"Rashidun Caliphate","context_page_description":"The Rashidun Caliphate was the first of the four major caliphates established after the death of the Islamic prophet Muhammad. It was ruled by the first four successive caliphs of Muhammad after his death in 632 CE. These caliphs are collectively known in Sunni Islam as the Rashidun, or \\"Rightly Guided\\" caliphs. This term is not widely used in Shia Islam as Shia Muslims do not consider the rule of the first three caliphs as legitimate.\\nThe Rashidun Caliphate is characterized by a twenty-five year period of rapid military expansion, followed by a five-year period of internal strife.\\nThe Rashidun Army at its peak numbered more than 100,000 men. By the 650s, the caliphate in addition to the Arabian Peninsula had subjugated the Levant, to the Transcaucasus in the north; North Africa from Egypt to present-day Tunisia in the west; and the Iranian plateau to parts of Central Asia and South Asia in the east.\\nThe caliphate arose out of the death of Muhammad in 632 CE and the subsequent debate over the succession to his leadership. Abu Bakr, a close companion of Muhammad from the Banu Taym clan, was elected the first Rashidun leader and began the conquest of the Arabian Peninsula."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%AB%98%E5%8E%8B%E7%94%B5%E7%BA%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Electric_Sails.jpg","page_title":"高压电线","context_page_description":"高压电线，简称高压线，是一种主要用作电力传输的电线，一般基于避免电力损耗，均会采用高压电的传输方式，而根据电力的输送范围而作电压上的调整。\\n交流电输电系统的电压可达至800 kV。加拿大魁北克建有大规范商业运行的735/765kV输电系统，总长度超过32,000公里，把水电输往加拿大及美国东北部。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%8E%E5%8D%97%E7%90%86%E5%B7%A5%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/South_China_University_of_Technology_Building_No._6.jpg","page_title":"华南理工大学","context_page_description":"华南理工大学位于中华人民共和国广东省广州市，是直属教育部的全国重点大学，拥有五山、大学城和广州国际三个校区。华工的历史可追溯至1918年成立的广东省立第一甲种工业学校，正式组建于1952年11月中国高校院系调整时期，时名“华南工学院”，是当时全国“四大工学院”之一，1988年1月改为现名。华工目前已发展为以工科见长，理工结合，涵盖管、文、经、法、艺、农、医、教等多学科的综合性研究型大学，是中国“双一流”A类学校和“111计划”的重要成员，也是“985工程”和“211工程”的重点建设大学。"},{"page_url":"https://ro.wikipedia.org/wiki/Boala_viral%C4%83_Ebola","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/EpomophorusFranquetiFord.jpg","page_title":"Boala virală Ebola","context_page_description":"Boala virală Ebola sau febra hemoragică Ebola este o boală infecțioasă virală severă, adesea fatală, provocată de virusul Ebola, care se manifestă prin afecțiuni hemoragice severe la oameni, primate și antilopele duiker, survenind în focare epidemice în Africa Centrală și Africa de Vest. Are o rată de letalitate de până la 90% la om. Se presupune că liliecii frugivori din familia Pteropodidae sunt gazdele naturale ale virusului Ebola. Virusul Ebola este introdus în populația umană după un contact strâns cu sângele, secrețiile, organele sau fluidele biologice ale animalelor infectate: cimpanzei, gorile, lilieci frugivori, antilope de pădure duiker și porci spinoși. Apoi, boala se propagă în comunități prin transmitere interumană, ca urmare a contactului direct cu sângele, organele, secrețiile sau lichidele biologice ale persoanelor infectate sau prin contact indirect prin intermediul mediilor contaminate cu aceste lichide. Ritualurile funerare în care rudele și prietenii celor decedați se află în contact direct cu corpul decedatului pot juca, de asemenea, un rol în transmiterea virusului Ebola."},{"page_url":"https://de.wikipedia.org/wiki/Hinterglasmalerei","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Hinterglasbild_Hl_Barbara.jpg","page_title":"Hinterglasmalerei","context_page_description":"Unter dem Begriff Hinterglasmalerei fasst man Glasbilder zusammen, die von der Rückseite der Glasplatte her bemalt sind und in der Aufsicht betrachtet werden. Sie unterscheiden sich darin von den aus Kirchenfenstern bekannten Glasmalereien, die erst in der Durchsicht ihre Leuchtkraft entfalten. Die Ausführung auf der Rückseite der Flachglasscheiben intensiviert die Farben der Hinterglasbilder und verleiht ihnen dauerhaften Glanz.\\nWährend einige frühe Beispiele von Hinterglasmalerei in Technik und Ausführung von höchster Qualität sind, aber in verschwindend geringer Zahl erhalten blieben, haben die religiös-volkstümlichen Hinterglasbilder des späten 18. und des 19. Jahrhunderts weite Verbreitung gefunden, sind im 20. Jahrhundert wieder sehr populär geworden und haben zur Nachahmung angeregt."},{"page_url":"https://fi.wikipedia.org/wiki/Norrt%C3%A4ljen_kunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Swedish_church_Ununge_Sweden.JPG","page_title":"Norrtäljen kunta","context_page_description":"Norrtäljen kunta on Tukholman läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Uplantiin. Kunnan keskustaajama on Norrtälje.\\nKunnan maapinta-ala on 2 015,35 neliökilometriä ja asukasluku 58 669 henkeä.\\nNorrtäljen naapurikuntia ovat Värmdö, Österåker, Vallentuna, Sigtuna, Knivsta, Uppsala ja Östhammar. Märketin saaresta osa kuuluu Norrtäljen kuntaan ja saarella Norrtäljen naapuri on lisäksi ahvenanmaalainen Hammarland.\\nNorrtäljen kuntaan kuuluu useita isoja Itämeren rannikon saaria kuten Blidö, Vätö ja Väddö. Lisäksi kuntaan kuuluu myös Kapellskärin satama, josta on laivaliikennettä Suomeen ja Viroon, sekä Grisslehamn, josta liikennöi autolautta Ahvenanmaalle.\\nVuonna 2007 kunnassa oli 263,82 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 13,1 prosenttia kunnan maapinta-alasta."},{"page_url":"https://pl.wikipedia.org/wiki/Alba%C5%84ska_Deklaracja_Niepodleg%C5%82o%C5%9Bci","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Flag_of_Albanian_Provisional_Government_1912-1914.gif","page_title":"Albańska Deklaracja Niepodległości","context_page_description":"Albańska Deklaracja Niepodległości – dokument podpisany 28 listopada 1912 we Wlorze ogłaszający powstanie niepodległego państwa albańskiego."},{"page_url":"https://af.wikipedia.org/wiki/Tipe_206-klas_duikboot","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/S195_et_S197_au_Port_de_Kiel.jpg","page_title":"Tipe 206-klas duikboot","context_page_description":"Die Tipe 206-klas duikboot is 'n konvensionele diesel-elektriese aangedrewe duikboot van die Duitse Vloot. Dit is een van die kleinste duikbote en vir sy grote, een van die suksesvolste aanvalsduikbote in die wêreld. Die eerste geslag verplaas net 459 ton water op die oppervlakte. Die eerste tipe 206 is in die vroeë 1970's in diens gestel nadat sewentien eenhede bestel was. Later is nog veertien duikbote afgelewer, hulle het as tipe 206A bekend gestaan. Twaalf van die eerste sewentien eenhede is die vroeë 1990's opgradeer na tipe 206A.\\nHierdie klas was ontwikkel om in vlak water te kan werk soos die Baltiese See tydens die Koue oorlog; hulle kan in water van slegs 20 m werk. Hulle rol is teen-duikboot operasies, lê van seemyne en verkenning. Teen die jaar 2000 was veertien eenhede van die duikbote nog in gebruik. Teen 2003 was twaalf nog in gebruik. Interessant genoeg was hulle gebruiks area uitgebrei na die Atlantiese Oseaan en die Middellandse See.\\nVier van die duikbote is in 1998 deur Indonesië gekoop."},{"page_url":"https://es.wikipedia.org/wiki/Instituto_T%C3%A9cnico_Militar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Belen_School_front%2C_pre_1950-_Havana.jpg","page_title":"Instituto Técnico Militar","context_page_description":"Instituto Técnico Militar fue diseñado por la empresa arquitectónica cubana de Morales & Cia en 1925. Está situado en las calles 45 y 66, en Marianao, La Habana, Cuba."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_femmes_ministres_fran%C3%A7aises","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sylvie_Goulard_-_Festival_Economia_2013.JPG","page_title":"Liste de femmes ministres françaises","context_page_description":"Cette liste de femmes ministres françaises recense, par présidence ou par gouvernement, toutes les femmes qui ont été membres d'un gouvernement, depuis les années 1930.\\nElles constituent au début des exceptions au sein de la vie politique française. On ne compte au départ que des secrétaires d'État ; il faut attendre 1947 pour qu'une femme soit ministre de plein exercice, et 1974 pour la deuxième. En 1974, Valéry Giscard d'Estaing est le premier président à modifier les choses en promouvant la nomination de femmes issues de la société civile. En 1981, Nicole Questiaux est la première ministre d'État. En 1991, Édith Cresson est la première femme à diriger un gouvernement. En 1995, le premier gouvernement d'Alain Juppé promeut pour la première fois, mais pour peu de temps, un grand nombre de femmes à des portefeuilles ministériels. C'est ensuite tout au long des années 2000 que celles-ci obtiennent un à un les différents ministères. La stricte parité numérique fut mise en place sous les gouvernements de Jean-Marc Ayrault."},{"page_url":"https://sk.wikipedia.org/wiki/Filozofia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Aristoteles_Louvre.jpg","page_title":"Filozofia","context_page_description":"Filozofia je štúdia hlavných, všeobecných a fundamentálnych problémov, ako sú bytie, existencia, poznanie a otázka pravdy, hodnoty, otázka existencie a povahy Boha, podstaty a prirodzenosti človeka, pravidlá platného usudzovania, myseľ, jazyk, morálne normy a mravnosť konania, krásno a ďalšie. V porovnaní s mytológiou a mysticizmom alebo náboženstvom sa filozofia odlišuje hlavne svojím kritickým prístupom, systematikou práce a dôverou v odôvodnené argumenty. V jej základe stojí pojmové, racionálne a kritické myslenie. Na rozdiel od exaktnej alebo reálnej vedy filozofia nemá definovaný svoj predmet a nepoužíva formalizovanú metodológiu. Napriek tomu niektoré jej disciplíny môžu za určitých okolností nadobudnúť vedecký charakter a precíznosť.\\nPôvodne filozofia zahŕňala všetko teoretické poznanie, ale postupne sa z nej vyčlenili exaktné, prírodné a spoločenské vedy. Takto vznikla určitá medzera medzi filozofiou a z nej vyčlenenými vednými odbormi. O vyplnenie tejto medzery sa snažia niektoré hraničné disciplíny."},{"page_url":"https://nl.wikipedia.org/wiki/Lindenau_(Dermbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/WAK_Dermbach_Lindenau_01.jpg","page_title":"Lindenau (Dermbach)","context_page_description":"Lindenau is een kleine nederzetting in de Duitse gemeente Dermbach in Thüringen. De gemeente maakt deel uit van het Wartburgkreis. Lindenau wordt voor het eerst genoemd in een oorkonde uit 1130. In 1957 werd het dorp samengevoegd met Dermbach."},{"page_url":"https://en.wikipedia.org/wiki/Cuiab%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Reitoria_da_UFMT.jpg","page_title":"Cuiabá","context_page_description":"Cuiabá is the capital city of the Brazilian state of Mato Grosso. It serves as the Geographical Centre of South America and forms the metropolitan area of the state, along with the neighbouring town of Várzea Grande. The city's name is an indigenous Bororo word meaning ‘arrow-fishing’, The city was founded in 1719, during the gold rush, it has been the state capital since 1818. The city is a trading centre for an extensive cattle-raising and agricultural area. The capital is among the fastest-growing cities in Brazil, followed by the growth of agribusiness in Mato Grosso, despite the recession that is affecting Brazilian industries. Cuiabá was one of the host cities for the 2014 FIFA World Cup.\\nCuiaba is the heart of an urban area that also includes the state's second largest city, Várzea Grande. Thermal electric and hydroelectric plants located in the area have been expanded since the completion of a natural gas pipeline from Bolivia in 2000. The city is the seat of the Federal University of Mato Grosso and the largest soccer stadium of the state, Arena Pantanal.\\nThe city is a rich mix of European, African and Native American influences and numerous museums reflect this."},{"page_url":"https://en.wikipedia.org/wiki/Marimatha_piscimala","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Marimatha_piscimala_male_%28right%29_female_%28left%29.JPG","page_title":"Marimatha piscimala","context_page_description":"Marimatha piscimala is a moth of the family Noctuidae. It is found from south-eastern Texas to Arizona southward to Panama.\\nAdults are on wing from mid-April to mid-October, probably in several generations."},{"page_url":"https://de.wikipedia.org/wiki/Leon_Abgarowitsch_Orbeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/%D0%9B%D0%B5%D0%BE%D0%BD_%D0%90%D0%B1%D0%B3%D0%B0%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%9E%D1%80%D0%B1%D0%B5%D0%BB%D0%B8.jpg","page_title":"Leon Abgarowitsch Orbeli","context_page_description":"Leon Abgarowitsch Orbeli war ein armenisch-russischer Physiologe und Hochschullehrer."},{"page_url":"https://en.wikipedia.org/wiki/Toronto","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Tigersbluejaysapril2008.jpg","page_title":"Toronto","context_page_description":"Toronto is the capital city of the Canadian province of Ontario. With a recorded population of 2,731,571 in 2016, it is the most populous city in Canada and the fourth most populous city in North America. The city is the anchor of the Golden Horseshoe, an urban agglomeration of 9,245,438 people surrounding the western end of Lake Ontario, while the Greater Toronto Area proper had a 2016 population of 6,417,516. Toronto is an international centre of business, finance, arts, and culture, and is recognized as one of the most multicultural and cosmopolitan cities in the world.\\nPeople have travelled through and inhabited the Toronto area, located on a broad sloping plateau interspersed with rivers, deep ravines, and urban forest, for more than 10,000 years. After the broadly disputed Toronto Purchase, when the Mississauga surrendered the area to the British Crown, the British established the town of York in 1793 and later designated it as the capital of Upper Canada. During the War of 1812, the town was the site of the Battle of York and suffered heavy damage by American troops. York was renamed and incorporated in 1834 as the city of Toronto."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A4%E5%90%89%E6%8B%89%E7%89%B9%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Om.svg","page_title":"古吉拉特人","context_page_description":"古吉拉特人是一个来自印度古吉拉特邦的传统族群，讲古吉拉特语，其属于印度-雅利安语支。古吉拉特人在创业和企业活动中占有一席之地，圣雄甘地、瓦拉巴伊·帕特尔等人物在印度独立运动与英属印度的斗争中发挥了历史性作用。巴基斯坦的建立者穆罕默德·阿里·真纳是古吉拉特人。印度现任总理纳伦德拉·莫迪和亚洲首富穆克什·安巴尼也是古吉拉特人。"},{"page_url":"https://fr.wikipedia.org/wiki/Refuge_de_la_Rencluse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Benasque_-_Refugio_de_la_Renclusa_01.jpg","page_title":"Refuge de la Rencluse","context_page_description":"Le refuge de la Rencluse, en espagnol refugio de la Renclusa, est un refuge des Pyrénées espagnoles situé au pied du massif de la Maladeta, à 2 140 m d'altitude, dans la vallée de l'Ésera. C'est le point de départ pour les excursions vers les sommets de la Maladeta, des monts Maudits et de l'Aneto, point culminant des Pyrénées. Il se situe administrativement dans la commune de Benasque, au nord-est de la province de Huesca, en Espagne."},{"page_url":"https://gl.wikipedia.org/wiki/Forzas_armadas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Roman_legionaire_in_lorica_segmentata.jpg","page_title":"Forzas armadas","context_page_description":"As forzas armadas dun país son o conxunto de institucións oficiais e permanentes encargadas de aplicar as políticas de defensa nacional, así como a política exterior pola vía militar. Adoitan estar divididas nunha serie de ramas que agrupan os recursos militares do Estado en terra, mar e aire.\\nA organización das forzas armadas baséase na xerarquía e na disciplina. Polo xeral, as forzas armadas son exclusivamente militares, aínda que en certos países considérase como parte delas a un corpo de xendarmería. Algúns países posúen forzas armadas irregulares, coñecidos como grupos paramilitares.\\nO estudio do emprego das forzas armadas coñécese como ciencia militar. En termos xerais, implica a consideración de ataque e defensa en tres niveis: estratexia, arte operativo e táctica. Cada un destes niveis estuda o uso da forza para alcanzar uns determinados obxectivos."},{"page_url":"https://pt.wikipedia.org/wiki/Mirmil%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mirmillon.jpg","page_title":"Mirmilão","context_page_description":"Mirmilão era um tipo de gladiador do Império Romano que carregava um grande escudo numa mão e na outra uma espada curta. Seu capacete se assemelhava a um peixe. Os mirmilões eram os oponentes dos trácios e dos hoplômacos."},{"page_url":"https://en.wikipedia.org/wiki/Greyfriars_Church,_Aberdeen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Greyfriars_%28John_Knox%29_Kirk%2C_Broad_Street%2C_Aberdeen.jpg","page_title":"Greyfriars Church, Aberdeen","context_page_description":"Greyfriars Church is a Category A Listed building in Aberdeen, Scotland. It was designed by the architect Alexander Marshall Mackenzie and built in 1903. It is situated on Broad Street and forms the south-east corner of Marischal College, also designed by Mackenzie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Wohn-_und_Gesch%C3%A4ftsh%C3%A4user,_Siedlungs-_und_Mietsh%C3%A4user_in_Radebeul","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Altk%C3%B6tzschenbroda_11_Radebeul_2.JPG","page_title":"Liste der denkmalgeschützten Wohn- und Geschäftshäuser, Siedlungs- und Mietshäuser in Radebeul","context_page_description":"Die Liste der denkmalgeschützten Wohn- und Geschäftshäuser, Siedlungs- und Mietshäuser in Radebeul gibt eine Übersicht über die unter Denkmalschutz stehenden Wohn- und Geschäftshäuser, Siedlungs- und Mietshäuser in der sächsischen Stadt Radebeul:"},{"page_url":"https://de.wikipedia.org/wiki/AMD_Am486","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/AMD_80486DX4-100_die.JPG","page_title":"AMD Am486","context_page_description":"Die Am486-Prozessorfamilie ist AMDs Pendant zur i486-Prozessorfamilie aus dem Hause Intel."},{"page_url":"https://el.wikipedia.org/wiki/2%CE%B7_%CE%9A%CF%85%CE%B2%CE%AD%CF%81%CE%BD%CE%B7%CF%83%CE%B7_%CF%84%CE%BF%CF%85_%CE%9A%CF%8C%CE%BD%CF%84%CE%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Lorenzo_Fioramonti_daticamera_2018.jpg","page_title":"2η Κυβέρνηση του Κόντε","context_page_description":"Η 2η Κυβέρνηση του Ιταλού Πρωθυπουργού Τζουζέπε Κόντε ορκίστηκε την 5η Σεπτεμβρίου 2019. Είναι η 66η κυβέρνηση της Ιταλικής Δημοκρατίας.\\nΕίναι κυβέρνηση συνεργασίας που περιλαμβάνει μέλη από το αντικαθεστωτικό Κίνημα Πέντε Αστέρων, το κεντροαριστερό Δημοκρατικό Κόμμα, την αριστερή κοινοβουλευτική ομάδα Ελεύθεροι και Ίσοι και, από την 17η Σεπτεμβρίου, από το κεντρώο κόμμα Ιτάλια Βίβα (IV), που ιδρύθηκε με διάσπαση από το ΔΚ εκείνη την ημέρα.\\nΤα μέλη της είναι τα νεαρότερα στην ιστορία της Ιταλικής Δημοκρατίας."},{"page_url":"https://it.wikipedia.org/wiki/Carlo_Maurizio_Ruspoli_di_Poggio_Suasa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Macchi_C205_Veltro_del_4%C2%B0_stormo_Duca_d%27Aosta.jpg","page_title":"Carlo Maurizio Ruspoli di Poggio Suasa","context_page_description":"Carlo Maurizio Ruspoli di Poggio Suasa è stato un militare e aviatore italiano, decorato di tre medaglia d’argento al valor militare e con la Croce di Ferro di seconda classe, fu un Asso della Regia Aeronautica durante la seconda guerra mondiale con 10 vittorie al proprio attivo."},{"page_url":"https://fi.wikipedia.org/wiki/Kot%C5%A1an","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Kochan_Panorama.png","page_title":"Kotšan","context_page_description":"Kotšan on kylä Bulgariassa. Kotšan asukasluku oli vuoden 2018 arvion mukaan 2 371. Se sijaitsee Satovtšan kunnassa Blagoevgradin alueella."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D9%88%D9%86%D8%AA%D8%B3%D8%A7_%D8%A7%D9%86%D8%AA%D9%84%DB%8C%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Comune_di_Contessa_Entellina_skyline.jpg","page_title":"کونتسا انتلینا","context_page_description":"کونتسا انتلینا ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۲۱۸۴ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۵۷۱ متر یۇکسک‏لیکده یئر آلیب. و سیسیل اوستانیندا دا یئرلشیب."},{"page_url":"https://de.wikipedia.org/wiki/Zivania","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Zivania.jpg","page_title":"Zivania","context_page_description":"Zivania ist ein zyprischer Tresterbrand.\\nSeit dem 14. Jahrhundert wird auf Zypern Zivania aus vergorenem Traubentrester hergestellt. Seit 2004 ist der Begriff Zivania von der EU geschützt und darf ausschließlich für in der Republik Zypern hergestellte Produkte verwendet werden.\\nDas Getränk ist farblos und hat ein leichtes Rosinenaroma. Der Alkoholgehalt liegt meist etwa bei 45 % Vol.\\nDas Dorf Mehmetçik/Galatia in der Türkischen Republik Nordzypern ist bekannt für seinen Zivania."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Bad_Schandau","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Krippen-B%C3%A4chelweg-21.jpg","page_title":"Liste der Kulturdenkmale in Bad Schandau","context_page_description":"Die Liste der Kulturdenkmale in Bad Schandau enthält die Kulturdenkmale in Bad Schandau.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Sächsische Schweiz-Osterzgebirge.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Godramstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Godramstein_Bornergasse_3.jpg","page_title":"Liste der Kulturdenkmäler in Godramstein","context_page_description":"In der Liste der Kulturdenkmäler in Godramstein sind alle Kulturdenkmäler im Stadtteil Godramstein der rheinland-pfälzischen Stadt Landau in der Pfalz aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%DB%8C%D9%85%DB%8C_%D9%87%DB%8C%D9%88%D8%A7%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Jimmy_Hayward.jpg","page_title":"جیمی هیوارد","context_page_description":"جیمی هِـیوارد یک کارگردان و نویسنده اهل کانادا است.\\nاز فیلم‌ها یا مجموعه‌های تلویزیونی که وی در آن‌ها نقش داشته‌است می‌توان به جونا هکس، هورتون صدایی می‌شنود و پرندگان آزاد اشاره نمود."},{"page_url":"https://fr.wikipedia.org/wiki/Hirado","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/View_of_Hirado_Strait_from_Hirado_castle_Nagasaki%2CJAPAN.jpg","page_title":"Hirado","context_page_description":"Hirado est une ville japonaise située dans la préfecture de Nagasaki. Elle occupe une île reliée à celle de Kyūshū par un pont."},{"page_url":"https://nn.wikipedia.org/wiki/Ariar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Major_Indo-Aryan_languages.png","page_title":"Ariar","context_page_description":"Ariar er eit omgrep som blei brukt av visse iranske og indiske folk i vedisk tid om seg sjølv. Arya har seinare hatt ei vikrig tyding i fleire asiatiske religionar, og er opphavet til landnamnet Iran.\\nOrdet er seinare blitt nytta som samnamn på folk som snakka indoariske språk, eller om indoeuropeiske språk.\\nNokre vestlege tenkjarar tok ordet i bruk om ein tenkt menneskerase som skulle ha vandra gjennom verda og grunnlagd dei store kulturane. Omgrepet blei nytta av nazistane om ein privilegert herskarrase. Omgrepet blir i dag stort sett berre brukt vitskapleg om indoariske språk."},{"page_url":"https://pt.wikipedia.org/wiki/Pal%C3%A1cio_de_Ghumdan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Old_sanaa.jpg","page_title":"Palácio de Ghumdan","context_page_description":"O Palácio Ghumdan, também conhecido como Qasir Ghumdan ou Palácio Ghamdan, é um antigo palácio e fortaleza em Saná, Iêmen. Tudo o que resta do antigo local de Ghumdan é um campo de ruínas emaranhadas em frente à primeira e segunda portas orientais da Mesquita de Jami. Esta parte de Saná forma uma proeminência que é conhecida por conter os escombros dos tempos antigos. O local está localizado no extremo sudeste da antiga cidade fortificada de Saná, al-Qaṣr, a oeste de onde a Grande Mesquita de Saná posteriormente, a qual faz parte do Património Mundial UNESCO. da Cidade Velha de Saná. É por vezes referido como Torre Ghumdan.\\nDe acordo com o geógrafo e historiador árabe, Al-Hamdani, as pedras fundamentais do Palácio Ghumdan foram estabelecidas por Shem, filho de Noé, ou por Sha'r Awtar que construiu muros na cidade de Saná. Outros sugerem que pode datar dos tempos pré-islâmicos, construídos pelos Sabeus em meados do século III pelo último grande rei de Sabá, El Sharih Yahdhib. Alguns historiadores datam do início do século II ou do primeiro século. O palácio foi destruído pelo califa Otomão, ou ainda antes, pelo conquistador abissínio Abrahah Al-Hubashi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%87%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/GASSR.png","page_title":"Чеченський національний округ","context_page_description":"Чеченський національний округ — колишня адміністративно-територіальна одиниця РРФСР, що існувала з 21 січня 1920 року по 30 листопада 1922 року.\\nАдміністративний центр — місто Грозний."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrali_in_Senegal","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/ZiguinchorCath%C3%A9drale.JPG","page_title":"Cattedrali in Senegal","context_page_description":"Questa è una lista delle cattedrali in Senegal."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%BC%E3%82%AD%E3%83%B3%E3%82%B0%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Barking_station_4.jpg","page_title":"バーキング駅","context_page_description":"バーキング駅 は、イギリスのロンドンにある鉄道駅である。ナショナル・レール、ロンドン地下鉄およびロンドン・オーバーグラウンドの列車が発着する。\\nイースト・ロンドンのバーキング・アンド・ダゲナム・ロンドン特別区内、バーキングに位置する。"},{"page_url":"https://pl.wikipedia.org/wiki/Ilja_Siega%C5%82owicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Segalovich_Ilya_at_MIPT_2010_DSC5517.jpg","page_title":"Ilja Siegałowicz","context_page_description":"Ilja Walentinowicz Siegałowicz – współtwórca rosyjskiej wyszukiwarki internetowej Yandex. Był dyrektorem ds. technologii i dyrektorem Yandexu od 2000 roku aż do śmierci w 2013."},{"page_url":"https://pl.wikipedia.org/wiki/Halina_%C5%81abonarska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Halina.%C5%81abonarska.JPG","page_title":"Halina Łabonarska","context_page_description":"Halina Łabonarska – polska aktorka."},{"page_url":"https://it.wikipedia.org/wiki/Zoarcidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Pachycara_bulbiceps.jpg","page_title":"Zoarcidae","context_page_description":"Gli Zoarcidae sono una numerosa famiglia di pesci ossei marini appartenenti all'ordine Perciformes."},{"page_url":"https://gl.wikipedia.org/wiki/Catarina_I_de_Navarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Catherine_I_of_Navarre.jpg","page_title":"Catarina I de Navarra","context_page_description":"Catarina, nada en 1468 e finada en Mont-de-Marsan o 12 de febreiro de 1517, foi raíña de Navarra entre 1483 e 1517. Foi ademais duquesa de Gandia, Montblanc e Peñafiel, condesa de Foix, Bigorra e Ribagorça e vizcondesa de Bearn."},{"page_url":"https://fr.wikipedia.org/wiki/Garrett_Mock","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/GarrettMock.jpg","page_title":"Garrett Mock","context_page_description":"Garrett Lee Mock est un lanceur droitier de baseball qui joue en Ligue majeure de 2008 à 2010 pour les Nationals de Washington."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D8%B3%D8%A7%D8%AC%D8%AF_%D8%A7%D9%84%D9%83%D8%A8%D9%8A%D8%B1%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/JAmia_Masjid.jpg","page_title":"قائمة المساجد الكبيرة","context_page_description":"قائمة أقدم المساجد"},{"page_url":"https://en.wikipedia.org/wiki/Walter_Hussey","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/John_Piper_tapestry%2C_Chichester_Cathedral_-_geograph.org.uk_-_816472.jpg","page_title":"Walter Hussey","context_page_description":"John Walter Atherton Hussey was an English priest of the Church of England who had a great fondness for the arts, commissioning a number of musical compositions and visual art for the church as well as amassing his own collection."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ultras_of_South_America","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Scratching_the_Sky.jpg","page_title":"List of Ultras of South America","context_page_description":"This is a list of the 209 ultra prominent peaks, or Ultras in South America. An Ultra is a mountain summit with a topographic prominence of 1,500 metres or more."},{"page_url":"https://nl.wikipedia.org/wiki/Gipfelkreuz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Croce_del_Monte_Musin%C3%A8.jpg","page_title":"Gipfelkreuz","context_page_description":"Een gipfelkreuz is een kruis van hout of metaal dat op de top van een berg gemonteerd wordt.\\nGipfelkreuze hebben meestal een hoogte van twee tot vier meter en staan overwegend in de Oostelijke Alpen en Duitsland, maar zijn bijvoorbeeld ook in de Verenigde Staten te vinden. In de Italiaanse Alpen staat meestal een Madonnabeeld op de top.\\nGipfelkreuze worden meestal door de plaatselijke toeristenverenigingen of alpenverenigingen op de bergen gemonteerd op bergen die de boomgrens overschrijden. Niet zelden bevindt zich bij het kruis een overkapping of waterdichte opbergmogelijkheid waarin een gipfelbuch opgeborgen is, alsmede een fles schnaps.\\nRechtskundig gezien zijn gipfelkreuze in het alpengebied een fenomeen: ze worden doorgaans zonder bouwvergunning opgericht.\\nGipfelkreuze in het Duitse Middengebergte vindt men:\\nin het Fichtelgebirge op de bergen Platte, Hohe Matze en in het rotsenlabyrinth van de Luisenburg bij Wunsiedel;\\nin Opper Franken bijvoorbeeld op de Schlüsselstein/Kreuzberg bij Ebermannstadt\\nin de Harz op de Kapitelsberg bij Tanne, op de Schnarchenklippen bij Schierke en op de Großen Gegenstein bij Ballenstedt.\\nin Beieren op diverse bergen."},{"page_url":"https://cs.wikipedia.org/wiki/Pozoun","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Trombone_CG_Bach42AG.jpg","page_title":"Pozoun","context_page_description":"Trombon či pozoun je žesťový hudební nástroj. Název trombón pochází z latiny, kdežto pozoun z němčiny a jsou naprosto rovnocenné – nezřídka se člověk ale může setkat s názorem, že trombón je větší, což je pravděpodobně způsobeno fonologickou podobností se slovem bombardón, tedy je lidovým označením pro heligón, či že obsahuje mechaniku – trombony s větší menzurou zpravidla mívají tzv. kvartu, čili kvartovou klapkou. Přesto jsou to synonyma a tato dvě označení jsou tedy neomezeně zaměnitelná. Podle Sachs-Hornbostelovy klasifikace patří mezi aerofony. Zvuk vzniká chvěním rtu na nátrubku. V soustavě trubek ústících do ozvučníku se pak vytváří charakteristický tón, samotný zvuk rtů nebo nátrubku zní totiž jaksi „chudě“."},{"page_url":"https://sl.wikipedia.org/wiki/Kiowa_Gordon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/KiowaGordon2009mediaconf.JPG","page_title":"Kiowa Gordon","context_page_description":"Kiowa Gordon, ameriški filmski igralec, *1990. Najbolj znan je kot Embry Call v drugem filmu serije Somrak, Mladi luni."},{"page_url":"https://sh.wikipedia.org/wiki/Tsukuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Tsukuba_in_Ibaraki_Prefecture_Ja.svg","page_title":"Tsukuba","context_page_description":"Cukuba je grad u Japanu u prefekturi Ibaraki. Prema popisu stanovništva iz 2005. u gradu je živelo 200.546 stanovnika."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D1%81%D0%BF%D0%B5%D1%86%D0%B8%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D1%8F_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/SNN2227SAS-280_536049a.jpg","page_title":"Войска специального назначения Великобритании","context_page_description":"Войска специального назначения Великобритании — два спецподразделения: SAS и SBS. Оба подразделения ведут своё начало от одного и того же подразделения коммандос времён Второй мировой войны."},{"page_url":"https://ru.wikipedia.org/wiki/Bad_Robot_Productions","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/1221olympicblvd.jpg","page_title":"Bad Robot Productions","context_page_description":"Bad Robot Productions — американская кинокомпания, принадлежащая Дж. Дж. Абрамсу. Она стала известна благодаря таким сериалам как «Шпионка», «Остаться в живых», «Грань», «Под прикрытием», «В поле зрения», «Алькатрас», «Революция», а также фильмам «Монстро», «Звёздный путь», «Стартрек: Возмездие», «Супер 8», «Миссия невыполнима: Протокол Фантом»."},{"page_url":"https://it.wikipedia.org/wiki/Asia%27s_Next_Top_Model","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Asia%27s_Next_Top_Model_logo.png","page_title":"Asia's Next Top Model","context_page_description":"Asia's Next Top Model è un reality show televisivo nel quale aspiranti modelle provenienti dalla zona dell'Asia Pacifica si sfidano tra servizi fotografici, casting, pubblicità e sfilate per ottenere il titolo di miglior modella asiatica e dare così una spinta notevole alla propria carriera."},{"page_url":"https://ca.wikipedia.org/wiki/Santa_Pau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Catalonia-CastellDeSantaPau.jpg","page_title":"Santa Pau","context_page_description":"Santa Pau és una vila i municipi de la comarca de la Garrotxa, a les Comarques Gironines."},{"page_url":"https://cy.wikipedia.org/wiki/Rumney,_New_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Grafton-Rumney-NH.png","page_title":"Rumney, New Hampshire","context_page_description":"Tref yn Grafton County, yn nhalaith New Hampshire, Unol Daleithiau America yw Rumney, New Hampshire. ac fe'i sefydlwyd ym 1767."},{"page_url":"https://en.wikipedia.org/wiki/Immovable_Cultural_Monuments_of_National_Significance","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Tiri_Monastery%2C_Georgia_01.jpg","page_title":"Immovable Cultural Monuments of National Significance","context_page_description":"The Immovable Cultural Monuments of National Significance are buildings, structures, sites, or places in Georgia that have been determined to have nationwide cultural significance by meeting special criteria developed by the Ministry of Culture and are subject to preservation by the state.\\nThe monument must have an outstanding artistic or aesthetic value, be associated with a particularly important historical event, person, or overall national values.\\nThe original list of the Immovable Monuments of Cultural Heritage was approved in the Presidential decree No. 665 of 7 November 2006. Since then, it has been updated several times. After the amendments of 2013, the monument can be defined as having national significance by the resolution of the Government of Georgia based on the submission of the Ministry of Culture."},{"page_url":"https://pt.wikipedia.org/wiki/Saint-Vincent-sur-Jard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Maison_Georges_Clemenceau%2C_Saint_Vincent_sur_jard_%283%29.JPG","page_title":"Saint-Vincent-sur-Jard","context_page_description":"Saint-Vincent-sur-Jard é uma comuna francesa na região administrativa da Pays de la Loire, no departamento de Vendéia. Estende-se por uma área de 14,65 km². Em 2010 a comuna tinha 1 229 habitantes."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%AD%D0%B4%D0%B8%D0%BD%D0%B1%D1%83%D1%80%D0%B3_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/St_Giles%27Cathedral_Edinburgh.jpg","page_title":"Эдинбург соборы","context_page_description":"Изге Эгидий соборы — Эдинбургтағы собор; Шотландия пресвитериан сиркәүенә ҡарай. Король миленең үҙәгендә урынлашҡан һәм маршруттың биҙәүесе булып тора. 900 йыл дауамында был собор Эдинбург ҡалаһының дини тормошоноң үҙәге була һәм хәҙерге көнгә тиклем пресвитерианлыҡ үҙәге булып иҫәпләнә."},{"page_url":"https://ms.wikipedia.org/wiki/Kerbau_Afrika","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Cape_buffalo_in_the_mud.jpg","page_title":"Kerbau Afrika","context_page_description":"Kerbau Afrika, affalo, nyati, mbogo atau Kerbau Tanjung, merupakan haiwan bovin Afrika terbesar. Ia tiada kaitan dengan kerbau liar Afrika yang besar sedikit, tetapi leluhurnya kekal tidak jelas. Disebabkan sifatnya yang sukar dijangka, yang menjadikannya amat merbahaya pada manusia, ia tidak dipelihara tidak seperti kerbau Afrika yang serupa. Di sebalik kepercayaan popular, kerbau Afrika bukanlah leluhur lembu peliharaan, dan hanya memiliki sedikit kaitan dengan hawian berkuku bovin besar lain."},{"page_url":"https://en.wikipedia.org/wiki/Seacoast_defense_in_the_United_States","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/200pdrParrott.jpg","page_title":"Seacoast defense in the United States","context_page_description":"Seacoast defense was a major concern for the United States from its independence until World War II. Before airplanes, many of America's enemies could only reach it from the sea, making coastal forts an economical alternative to standing armies or a large navy. After the 1940s, it was recognized that fixed fortifications were obsolete and ineffective against aircraft and missiles. However, in prior eras foreign fleets were a realistic threat, and substantial fortifications were built at key locations, especially protecting major harbors.\\nThe defenses heavily depended on fortifications but also included submarine minefields, nets and booms, ships, and airplanes. Therefore, all of the armed forces participated in seacoast defense, but the U.S. Army Corps of Engineers played the central role in constructing fixed defenses.\\nDesigns evolved and became obsolete with changes in the technology available to both the attacking forces and the defenders. The evolution of the U.S. seacoast defense system is generally identified among several \\"systems\\", which are somewhat defined by the styles used, but more so by the events or trends which periodically stimulated new funding and construction."},{"page_url":"https://pl.wikipedia.org/wiki/Schlepzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Schlepzig_church.jpg","page_title":"Schlepzig","context_page_description":"Schlepzig – miejscowość i gmina w Niemczech w kraju związkowym Brandenburgia, w powiecie Dahme-Spreewald, wchodzi w skład urzędu Unterspreewald. Do 31 grudnia 2012 wchodziła w skład urzędu Unterspreewald."},{"page_url":"https://es.wikipedia.org/wiki/Euskal_Herria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lurraldeen_Kokapena.jpg","page_title":"Euskal Herria","context_page_description":"La región histórica del País Vasco​ es el territorio europeo en el que se ha desarrollado la cultura vasca. Situado a ambos lados de los Pirineos, comprende territorios de España y Francia:​ los denominados País Vasco español y País Vasco francés. Tradicionalmente su capital se fija en Pamplona.​​\\nEl término Euskal Herria aparece en escritos vascos por primera vez en el siglo XVI, pero no empieza a ser empleado en español hasta el siglo XIX, en el contexto histórico y político del surgimiento del nacionalismo vasco.​ Desde entonces, el término suele asociarse al nacionalismo vasco, y ha llegado a generar tensiones institucionales entre las comunidades autónomas del País Vasco y de Navarra.​​​ La primera referencia a Euskal Herria aparece en un manuscrito en euskera del alavés Juan Pérez de Lazarraga, datado entre 1564 y 1567, escrito como eusquel erria y eusquel erriau. También aparece en la traducción al euskera del Nuevo Testamento del labortano Joanes Leizarraga, publicada en 1571, como heuscal herria o Heuscal-Herrian."},{"page_url":"https://sl.wikipedia.org/wiki/Alenka_Vipotnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Alenka_Vipotnik_kot_Lucija_1965.jpg","page_title":"Alenka Vipotnik","context_page_description":"Alenka Vipotnik, slovenska gledališka in filmska igralka, * 18. januar 1943 Rakek, † 17. april 2014.\\nAlenka Vipotnik je bila dolgoletna stalna članica ansambla SNG Drama Ljubljana, nastopila pa je tudi v več filmih."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B7%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%B7%D0%BD%D0%B0%D0%BA%D0%B8_%D1%80%D0%B0%D0%B7%D0%BB%D0%B8%D1%87%D0%B8%D1%8F_%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D1%81%D0%B8%D0%BB_%D0%98%D1%80%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/15-_Sarhang_2nd-IRGC.png","page_title":"Воинские звания и знаки различия Вооружённых сил Ирана","context_page_description":null},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%B0%D1%80%D1%81%D1%8C%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Angarsk_station.jpg","page_title":"Ангарськ","context_page_description":"Анга́рськ — місто в Іркутській області Росії, засноване в 1951 році, центр Ангарського Муніципального Утворення.\\nНаселення близько 300 тисяч осіб\\nОсновні підприємства — Ангарська нафтохімічна компанія, Ангарський електролізно-хімічний комбінат.\\nДо першої — одного з найбільших нафтопереробних підприємств Сибіру — підведено нафтогін Туймази — Ангарськ. Основна продукція — бензин, дизельне пальне, нафтопродукти, пластики, фторид урану. Пряме автомобільне сполучення з містами Іркутськ та Усольє-Сибірське.\\nЗа час існування Ангарськ став відомий своєю найбільшою в Азії промисловою зоною, котра протягнулася вздовж річки Ангара на 30 кілометрів. Основою нафтохімічної промисловості стало обладнання для вигону синтетичних бензинів з кам'яного вугілля, вивезене з Німеччини в рамках репарацій після перемоги СРСР у Другій світовій війні.\\nВ роки «перебудови» стали загальносоюзновідомими майстри-шапочники, котрі займались масовим виготовленням та продажем шапок із шкурок бабака та норки. Розглядався навіть проект встановлення пам'ятника монгольському бабаку-тарбагану біля ресторану «Баргузін», але цей проект так і не було втілено."},{"page_url":"https://en.wikipedia.org/wiki/Fremantle","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Jane_Eliza_Currie_-_Panorama_of_the_Swan_River_Settlement%2C_1831.jpg","page_title":"Fremantle","context_page_description":"Fremantle is a port city in Western Australia, located at the mouth of the Swan River in the metropolitan area of Perth, the state capital. Fremantle Harbour serves as the port of Perth. In 2016, Fremantle had a population of approximately 29,000. The Western Australian vernacular diminutive for Fremantle is Freo.\\nPrior to British settlement, the indigenous Noongar people inhabited the area for millennia, and knew it by the name of Walyalup. Visited by Dutch explorers in the 1600s, Fremantle was the first area settled by the Swan River colonists in 1829, and is named after Captain Charles Fremantle, an English naval officer who claimed the west coast of New Holland as British territory. The settlement struggled in its first decades, and in 1850, with the advent of penal transportation to the colony, Fremantle became Australia's primary destination for convicts. The convict-built Fremantle Prison operated long after transportation ended in 1868, and is now a World Heritage Site."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%B4%D0%B4%D0%B5%D1%80_(%D0%B2%D1%81%D0%BF%D0%BE%D0%BC%D0%BE%D0%B3%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B5%D0%B9%D1%81%D0%B5%D1%80)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Nordmark2_Hapag.jpg","page_title":"Виддер (вспомогательный крейсер)","context_page_description":"«Виддер» — немецкий вспомогательный крейсер времён Второй мировой войны. HSK-3, бывшее грузовое судно «Ноймарк», в германском флоте обозначался как «Судно № 21», во флоте Великобритании — «Рейдер „D“»."},{"page_url":"https://en.wikipedia.org/wiki/Barcs","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/R.k._templom_%287805._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"Barcs","context_page_description":"Barcs is a border town in Somogy County, Hungary and the seat of Barcs District. The Drava River marks the southern boundary of the settlement."},{"page_url":"https://sv.wikipedia.org/wiki/Fredriksdal_museer_och_tr%C3%A4dg%C3%A5rdar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Fredriksdals_m%C3%B6lla_B%C3%85N.JPG","page_title":"Fredriksdal museer och trädgårdar","context_page_description":"Fredriksdal museer och trädgårdar är ett friluftsmuseum på 36 hektar i Helsingborg uppbyggt kring en herrgårdsliknande huvudbyggnaden på egendomen Fredriksdal. Fredriksdal var ursprungligen anlagt som ett landeri, ett slags sommarställe, av Fredrik Wilhelm Cöster år 1787. Egendomen köptes av konsul Oscar Trapp i slutet av 1800-talet och stora delar av marken tillsammans med huvudbyggnad och ekonomibyggnader donerades till Helsingborgs stad av dennes änka, Gisela Trapp, år 1918. Friluftsmuseet öppnade för allmänheten år 1923. Museet med sina 36 hektar är en av de största anläggningarna i sitt slag i Sverige och är dessutom speciell för sin betoning på det biologiska kulturarvet. Fredriksdal omfattar idag de ursprungliga byggnaderna, de historiska parkerna, köksträdgården, äldre allmogegårdar, historiska lantbruk, det gamla stadskvarteret från centrala Helsingborg samt en botanisk trädgård med skånska växter och biotoper. På området finns även Fredriksdalsteatern som anlades 1923 som en häckteater i barockstil.\\nMuseets logotyp består av ett stiliserat träd i vitt på en olivgrön bakgrund och är designad av Bodil Tegsell."},{"page_url":"https://qu.wikipedia.org/wiki/Palistina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/UN_Partition_Plan_Palestine.png","page_title":"Palistina","context_page_description":"Palistina icha Philistina icha Urdun nisqaqa Asyapi huk mama llaqtam.\\nAllpapura hatun quchawan Jordan mayup chawpinpim.\\nKunan pacha Israyil mama llaqtap kamachiyninpim kachkan, huk rakichankunataq Palistina kamachikuy nisqam kikintataq kamachikuchkanpas.\\nPalistinaqa ancha ñawpa pacha Kanaan nisqa kasqa."},{"page_url":"https://nl.wikipedia.org/wiki/Griblje","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Bela_krajina_Kolpa.jpg","page_title":"Griblje","context_page_description":"Griblje is een plaats in Slovenië en maakt deel uit van de Sloveense gemeente Črnomelj in de NUTS-3-regio Jugovzhodna Slovenija. De plaats telt 356 inwoners."},{"page_url":"https://az.wikipedia.org/wiki/Kimya_%C3%BCzr%C9%99_Nobel_m%C3%BCkafat%C4%B1_laureatlar%C4%B1n%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Francis_William_Aston.jpg","page_title":"Kimya üzrə Nobel mükafatı laureatlarının siyahısı","context_page_description":"Kimya üzrə Nobel mükafatı — İsveç Kral Elmlər Akademiyası tərəfindən kimyanın müxtəlif sahələri üzrə elm adamlarına təqdim olunan illik mükafat. Bu mükafat Alfred Nobelin 1895-ci ildəki vəsiyyəti əsasında təsis edilmiş edilmiş beş Nobel mükafatından biridir. Bu mükafatlar kimya, fizika, ədəbiyyat, sülh və fiziologiya və ya tibb sahələri üzrə əlamətdar töhfələr verənlərə təqdim olunur. Nobelin vəsiyyətinə əsasən, mükafat Nobel Fondu tərəfindən idarə olunur və Royal İsveç Elmlər Akademiyası tərəfindən verilir. Kimya üzrə Nobel mükafatına ilk dəfə 1901-ci ildə hollandiyalı alim Yakob Vant-Hoff layiq görülmüşdür. Hər laureat bir medal, bir diplom və illər ərzində dəyişən miqdarda pul mükafatı alır. 1901-ci ildə Yakob Vant-Hoffa verilmiş mükafat pulunun məbləği 150.782 İsveç kronu təşkil edirdi, 2007-ci ilin dekabr ayında bu məbləğ 7.731.004 İsveç kronuna bərabər idi. Mükafat Stokholmda 10 dekabr - Alfred Nobelin ölüm ildönümü ilə bağlı illik mərasimdə təqdim olunur.\\nƏn azı 25 laureat, digər kimya sahələrindən daha çox üzvi kimya sahəsindəki töhfələrinə görə Nobel mükafatına layiq görülmüşdür."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D9%86_%D8%AF%D9%88_%D9%85%D8%A7%D8%B1%D8%B3%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Map_commune_FR_insee_code_40192.png","page_title":"مون دو مارسان","context_page_description":"مون دو مارسان ‏ هي بلدية في فرنسا، تقع في لاند، وهي عاصمتها، بلغ عدد سكانها 31,334 نسمة وذلك حسب إحصائيات سنة 2013، تبلغ مساحتها 36.88 كيلومتر مربع، رمزها البريدي هو 40000."},{"page_url":"https://en.wikipedia.org/wiki/Roujet_D._Marshall","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Roujet_DeLisle_Marshall.png","page_title":"Roujet D. Marshall","context_page_description":"Roujet DeLisle Marshall was an American judge who served as a justice of the Wisconsin Supreme Court from 1895 to 1918.\\nHe was named after the writer of the French national anthem, La Marseillaise, Claude Joseph Rouget de Lisle."},{"page_url":"https://hu.wikipedia.org/wiki/R%C3%B3zs%C3%A1k_tere_(Marosv%C3%A1s%C3%A1rhely)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Marosv%C3%A1s%C3%A1rhely_-_2013.07.11_%282%29.JPG","page_title":"Rózsák tere (Marosvásárhely)","context_page_description":"A Rózsák tere, közismert nevén Főtér, Marosvásárhely központi tere és fontos turisztikai látványossága. Délnyugati irányban a Győzelem térben, északkelet felé a Szentgyörgy utcában folytatódik. Itt van a város több látnivalója, például a Kultúrpalota, a katolikus és az ortodox nagytemplom, vagy a Toldalagi-palota, és innen nyílik az 1970-es években létesített Színház tér.\\nA teret a 14. században alakította ki a Maros egy mellékága. Marosvásárhely évszázadokon keresztül a székelység vásártartó központja volt, és a hely a középkortól egészen az 1950-es évekig piactérként szolgált, ahol a vidék legnagyobb és legfontosabb vásárait tartották, melyeket egész Erdélyből, sőt idegen országokból is felkerestek. A 18–19. században a tér szélei fokozatosan beépültek, északról dél felé terjeszkedve. Jelenlegi kinézetét és funkcióját viszonylag későn, a 20. század első évtizedeiben nyerte el. A 20. század második felében tömbházakat is emeltek, és egy 18. századi ferences kolostor lebontásával alakították ki az északnyugati oldalt megtörő Színház teret."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%98%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Prambanan_LaraJonggrang.JPG","page_title":"История Индонезии","context_page_description":"История Индонезии — история Республики Индонезии, а также существовавших ранее на территории этой страны других государственных образований, колониальных владений и иных человеческих общностей.\\nВ доисторическое время на территории Индонезии находились одни из самых ранних ареалов древних людей. Её заселение человеком разумным началось около 45 000 лет назад, в последующем имело место несколько крупных миграционных волн из континентальной части Азии.\\nФормирование государственных образований началось в I—III веках н. э. Крупнейшими средневековыми государствами были Шривиджая и Маджапахит, распространявшие свой контроль на значительную часть Малайского архипелага.\\nВ первой половине XVI века началось проникновение европейских колонизаторов. Победу в борьбе за освоение этой части Юго-Восточной Азии одержали Нидерланды, которые к началу XX века объединили под своей властью практически всю территорию современной Индонезии в составе владения Нидерландская Ост-Индия.\\nНезависимость страны была провозглашена 17 августа 1945 года после её трёхлетней оккупации вооружёнными силами Японии."},{"page_url":"https://en.wikipedia.org/wiki/Baruny","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Kasciol_Sviatych_Apostalau_Piatra_j_Paula_j_manastyr_bazyljanau_%28Baruny%29.jpg","page_title":"Baruny","context_page_description":"Baruny is a village in Belarus, not far from the town of Ashmyany. In the 18th and 19th centuries the local Basilian monastery was famous for its school, where many of young local noblemen such as poet Antoni Edward Odyniec and writer Ignacy Chodźko received their primary education. The monastery originally rose into prominence because of the venerated image of Virgin Mary, which is still preserved in the church in our days."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%A3%D5%A1%D6%80%D5%BF%D5%A1%D5%AE%D5%A1%D5%B2%D5%AB%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Bellisannua1.jpg","page_title":"Մարգարտածաղիկ","context_page_description":"Մարգարտածաղիկ, բարդածաղկավորների ընտանիքի միամյա կամ բազմամյա խոտաբույսերի ցեղ։ Հայրենիքը Եվրոպան է։ Մարգարտածաղիկը բազմամյա, 15 սմ բարձրությամբ կոմպակտ բույս է, սակայն մշակվում է որպես երկամյա։"},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois_Mouly","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Mouly%2C_Fran%C3%A7ois.jpg","page_title":"François Mouly","context_page_description":"François-Jean-Joseph Mouly, né à Clermont-Ferrand le 21 septembre 1846 et mort à Libourne le 25 octobre 1886, est un sculpteur français."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_160_(Infrabel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Belgian_Railway_Line_160.png","page_title":"Ligne 160 (Infrabel)","context_page_description":"La ligne 160 est une ligne de chemin de fer périurbaine belge, située en bordure est de l'agglomération bruxelloise, qui reliait la gare de Bruxelles-Luxembourg à la gare de Tervueren. Fermée au trafic voyageurs en 1958 et à celui des marchandises en 1970, elle est déferrée en 1972. Sa plateforme est réutilisée suivant les sections, en : bretelle autoroutière, sentier pédestre et voie de tramway."},{"page_url":"https://eu.wikipedia.org/wiki/Arrano_arrantzale","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Pandion_haliaetus_MHNT.ZOO.2010.11.93.9.jpg","page_title":"Arrano arrantzale","context_page_description":"Arrano arrantzalea erdi-mailako hegazti harraparia da, arrantzan nagusia, bere elikadura arrainetan oinarritzen da eta mundu osoan zehar aurki daiteken espeziea da.\\nGarai batean espezieak Euskal Herrian habia egiten bazuen ere, egun desagertuta dago finkatutako espezie bezala, nahiz eta neguan arrano arrantzaleak gurean azaltzen diren. Urdaibain esate baterako neguko ohiko bisitariak dira."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B3%A2%E4%B8%8A%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Naminoueg%C5%AB_Honden.JPG","page_title":"波上宮","context_page_description":"波上宮は沖縄県那覇市にある神社。近代社格制度では官幣小社に列格され、現在では神社本庁の別表神社に指定されている。那覇港を望む高台の上に位置し、「なんみんさん」「ナンミン」として親しまれてきた。琉球八社の一つで、全国一の宮会より琉球国新一の宮に認定されている。"},{"page_url":"https://pt.wikipedia.org/wiki/Edward_J._Schulte","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Saint_Michael_Catholic_Church_-_Houston_01.JPG","page_title":"Edward J. Schulte","context_page_description":"Edward J. Schulte foi um arquiteto que projetou um generoso número de igrejas ao longo de sua vida, sendo as mais conhecidas as realizadas em meados do século XX, as quais mesclam o arrojo da chamada arquitetura moderna com variados elementos da arquitetura tradicional. Mas também fez importantes casas e prédios públicos. Inspirado por um encontro que teve com Ralph Adams Cram, Schulte devotou-se a projetar igrejas, tendo desenhado mais de 88. Ele serviu, também, como presidente da filial de Cincinnati do Instituto Americano de Arquitetos.\\nSchulte desempenhou prática solo até 1912, então passou a trabalhar com Robert. E. Crowe entre 1921 e 1934. Por fim, voltou a exercer o ofício sozinho até sua aposentadoria, em 1967."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9F%B6%E5%B1%B18%E5%9E%8B%E7%94%B5%E5%8A%9B%E6%9C%BA%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/SS8_2001%40XZH_%2820151005115417%29.jpg","page_title":"韶山8型电力机车","context_page_description":"韶山8型电力机车是中国铁路使用的电力机车车型之一，由株洲电力机车厂与株洲电力机车研究所共同研制。韶山8型电力机车是四轴准高速干线客运电力机车，是中国第八个五年计划重点科技攻关项目，原设计是用于广深准高速铁路的电力机车，后成为用于中国干线铁路牵引提速旅客列车的主型机车。机车最大运行速度为170公里/小时，最高试验速度达到240公里/小时。"},{"page_url":"https://fi.wikipedia.org/wiki/Wrightin_veljekset","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Side_view_of_the_original_Wright_Aeroplane_near_Kitty_Hawk%2C_NC._1903.10466_A.S..jpg","page_title":"Wrightin veljekset","context_page_description":"Wrightin veljeksiä, Orville Wrightia ja Wilbur Wrightia, pidetään yleisesti ensimmäisen toimivan lentokoneen suunnittelijoina ja rakentajina sekä ensimmäisen ohjatun, moottorikäyttöisen ilmaa raskaamman lennon suorittajana ja useiden muiden ilmailun merkkipaalujen saavuttajina.\\nKuitenkin jotkut henkilöt ja valtiot ovat alusta lähtien kyseenalaistaneet sen olivatko Wrightin veljekset ensimmäisiä lentokoneen keksijöitä. Esimerkiksi Brasilian hallituksen kanta on, että brasilialainen Alberto Santos-Dumont olisi ollut lentokoneen keksijä."},{"page_url":"https://en.wikipedia.org/wiki/Hollywood_Park_Racetrack","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Hollywood_Park.jpg","page_title":"Hollywood Park Racetrack","context_page_description":"Hollywood Park, later sold and referred to as Betfair Hollywood Park, was a thoroughbred race course located in Inglewood, California, about 3 miles from Los Angeles International Airport and adjacent to the Forum indoor arena. In 1994, Hollywood Park Casino, with a poker card room, was added to the racetrack complex. Horse racing and training were shut down in December 2013 though the casino operations continued until a new state of the art casino building opened in October 2016.\\nThe track was demolished in stages from 2014 until 2016 and the area is now the site of a master planned neighborhood in development named Hollywood Park after the former track. The most prominent parts of the development are SoFi Stadium, home of the Los Angeles Rams and Los Angeles Chargers of the National Football League and a 6,000 seat performance arts venue, the Hollywood Park Casino, and the NFL Media building which will be home to NFL Network, NFL RedZone, NFL.com, and the NFL app."},{"page_url":"https://sv.wikipedia.org/wiki/Negastrius_pulchellus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Negastrius.pulchellus.-.calwer.26.03.jpg","page_title":"Negastrius pulchellus","context_page_description":"Negastrius pulchellus är en skalbaggsart som först beskrevs av Carl von Linné 1761. Negastrius pulchellus ingår i släktet Negastrius, och familjen knäppare. Arten är reproducerande i Sverige."},{"page_url":"https://fi.wikipedia.org/wiki/T%C3%A4pl%C3%A4huuhkaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Spottedeagleowl.jpg","page_title":"Täplähuuhkaja","context_page_description":"Täplähuuhkaja on keskikokoinen pöllöihin kuuluva lintu. Se on pienimpiä huuhkajia. Sen korkeus on 45 cm, ja se painaa 480–850 g. Sen siipiväli on 100–140 cm Sen naama on valkeahko tai vaalean okra, silmät ovat keltaiset. Korvatupsut ovat suuret, ja ylävartalo on tummanruskea, alaosa on valkeahko ruskein raidoin. Ennen vuotta 1999 täplähuuhkajaa pidettiin samana lajina kuin tuhkahuuhkajaa, mutta nykyisin se luokitellaan eri lajiksi.\\nSitä tavataan lähes koko Saharan eteläpuolisessa Afrikassa. Sen elinpiiriä ovat subtrooppiset ja trooppiset kuivat metsät, savannit subtrooppiset ja trooppiset kuivat pensastot ja ruohikkoalueet sekä kallioiset alueet ja aavikot."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D1%80%D0%BD%D1%83%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Reformed_church_in_Radn%C3%B3t_from_the_garden.jpg","page_title":"Ернут","context_page_description":"Ернут — город в Румынии, входит в состав жудеца Муреш.\\nНаселение — 9658 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Col_de_Tanggula","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Tanggula_Pass.jpg","page_title":"Col de Tanggula","context_page_description":"Le col de Tanggula est un col des monts Tanggula, situé à la limite entre la région autonome du Tibet et la province du Qinghai. Il culmine à 5 231 mètres d'altitude."},{"page_url":"https://ast.wikipedia.org/wiki/Chueta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Xuetes_a_Ciutat.png","page_title":"Chueta","context_page_description":"Los chuetas, del catalán xueta/ye, conformen un grupu social de la isla de Mallorca, descendientes d'una parte de los xudíos mallorquinos conversos al cristianismu y de los cualos, a lo llargo de la hestoria, caltúvose conciencia colectiva del so orixe, por ser portadores de dalgún de los apellíos, de llinaxe conversu, afeutáu poles condena inquisitoriales por criptojudaísmo nel postreru cuartu del sieglu XVII, o por tar estrechamente emparentaos con ellos. Históricamente fueron estigmatizaos y segregaos, polo cual, y hasta la primer metá del sieglu XX, practicaron una estricta endogamia. Anguaño, ente 18 000 y 20 000 persones na isla son portadores de dalgún d'estos apellíos."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA_%D0%A0%D1%83%D1%84%D1%84%D0%B0%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Mark_Ruffalo_at_the_Toronto_premiere_of_The_Avengers.jpg","page_title":"Марк Руффало","context_page_description":"Марк Алан Руффало — америкалық киноактер. «Вид сверху лучше», «Зодиак», «Остров проклятых» және «Мстители» сияқты фильмдердің арқасында танымал болған. «Детки в порядке» және «Охотник на лис» жобаларынағы атқарған жұмысы үшін көптеген сыйларды иеленген."},{"page_url":"https://bs.wikipedia.org/wiki/Svjetsko_prvenstvo_u_nogometu_2014.","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/James_Rodriguez.jpg","page_title":"Svjetsko prvenstvo u nogometu 2014.","context_page_description":"Svjetsko prvenstvo u nogometu 2014. jeste nogometni turnir u organizaciji FIFA-e, koji se odigrao od 12. juna do 13. jula 2014. u Brazilu. Prvak svijeta je postala reprezentacija Njemačke, pobijedivši Argentinu rezultatom 1-0. Ovo je prvi naslov Njemačkoj nakon ujedinjenja 1990. godine.\\nOvo je bilo drugi put da ta zemlja bude domaćin takmičenja, jer je to prvi put bila 1950. Brazil je postao peta država sa dvostrukim domaćinstvom prvenstva nakon Meksika, Italije, Francuske i Njemačke.\\nTo je bilo prvo svjetsko prvenstvo u Južnoj Americi nakon onog iz 1978. u Argentini i drugo uzastopno prvenstvo održano na južnoj hemisferi.\\n17 gradova iskazalo je interes da budu izabrani kao domaćini prvenstva: São Paulo, Rio de Janeiro, Belo Horizonte, Porto Alegre, Brasília, Belém, Campo Grande, Cuiabá, Curitiba, Florianópolis, Fortaleza, Goiânia, Manaus, Natal, Recife/Olinda, Rio Branco i Salvador. Maceió je odustao.\\nU skladu s FIFA-inom praksom, samo jedan grad može koristiti 2 stadiona, a broj gradova domaćina ograničen je na između 8 i 10. Brazilska konfederacija tražila je odobrenje da najbolje nogometaše svijeta ugosti u 12 gradova. 26. decembra 2008."},{"page_url":"https://vi.wikipedia.org/wiki/Lochmaea_caprea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Lochmaea_caprea.jpg","page_title":"Lochmaea caprea","context_page_description":"Lochmaea caprea là một loài bọ cánh cứng trong họ Chrysomelidae. Loài này được Linnaeus miêu tả khoa học năm 1758."},{"page_url":"https://pl.wikipedia.org/wiki/Mart_Stam","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Mart_Stam_1920.jpg","page_title":"Mart Stam","context_page_description":"Mart Stam właściwe Martinus Adrianus Stam, także: Mostam, ur. 5 sierpnia 1899 w Purmerend w Holandii, zm. 23 lutego 1986 w Szwajcarii) - holenderski architekt modernistyczny, rysownik i teoretyk architektury, działający także w Szwajcarii, Niemczech i Związku Radzieckim.\\nStam jako uczeń działał w organizacjach katolickich, miał jednak również związki z socjalistami. Uczył się zawodu stolarza, a później kreślarza budowlanego. Po I wojnie śwatowej pracował jako kreślarz w biurach Granpré Molière'a w Rotterdamie, Karla Mosera w Zürichu i Maksa Tauta i Hansa Poelziga w Berlinie. Jednocześnie współtworzył też pierwsze niezależne projekty. Nieoczekiwaną sławę przyniósł mu w 1922 wielokrotnie publikowany i często komentowany projekt betonowo-szklanego wieżowca w Królewcu, mający cechy konstruktywistyczne. Następnie Stam wydawał nieregularnie ukazujący się periodyk ABC i wywarł tym znaczny wpływ na rozwój nowoczesnego projektowania. W 1927 został zaproszony do wzięcia udziału w wystawie Werkbundu na Weißenhofie w Stuttgarcie i zbudował trzysegmentowy dom szeregowy z tarasami dachowymi, będący jego pierwszym samodzielnym projektem a zarazem przykładem dojrzałego stylu międzynarodowego."},{"page_url":"https://it.wikipedia.org/wiki/Simone_Massi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Simone_Massi_Abbecedario.jpg","page_title":"Simone Massi","context_page_description":"Simone Massi è un animatore, regista e illustratore italiano vincitore di un David di Donatello 2012 per il miglior cortometraggio e di due Nastri d'argento nel 2014 e 2015."},{"page_url":"https://eo.wikipedia.org/wiki/Cz%C4%99stochowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/2018_0546-001_Cz%C4%99stochowaPride-Parade.jpg","page_title":"Częstochowa","context_page_description":"Częstochowa [ĉenstoĥova] estas urbo en Silezio en suda Pollando, ĉe rivero Warta. Ĝi apartenas al komunumo Częstochowa, en samnoma distrikto.\\nLa urbo estas loko kie naskiĝis Stanislaw Zygmunt Braun. Ĝi estas ankaŭ la plej grava pilgrimloko de Pollando."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Leleasca-%C8%98tef%C4%83ne%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Parosi.pridvorul.02.jpg","page_title":"Biserica de lemn din Leleasca-Ștefănești","context_page_description":"Biserica de lemn din Leleasca-Ștefănești se află în cătunul Ștefănești, localitatea Leleasca, județul Olt și aparține de parohia Păroși. Biserica a fost ridicată pe locul actual de moșnenii fostului sat Ștefănești între anii 1765-1771 și poartă hramul „Adormirea Maicii Domnului”. Aceasta este una dintre cele mai reprezentative biserici de lemn de la sud de Carpați. Se distinge într-un ansamblu caracteristic zonei, compus din poartă și gard de lemn, precum și „șetrile cu mesile pentru pomeni la sărbători” din cuprinsul incintei. Remarcabile sunt dimensiunile mari ale lăcașului, decorația sculptată bogată, atât exterioară cât și interioară, precum și semnăturile meșterului și ctitorilor împreună cu datările de pe peretele de la intrare. Cel mai semnificativ este pridvorul, care excelează atât prin amploare cât și prin diversitatea și bogăția motivelor sculptate, un adevărat punct culminant în arta pridvoarelor de biserici de lemn de la sud de Carpați. În interior ies în evidență câteva sculpturi puternic reliefate, îndeosebi funia de pe portalul naosului și cei doi cai-consolă ce sprijină grinda de sub cerul bolții."},{"page_url":"https://nl.wikipedia.org/wiki/Barcin_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Barcin_market_square.JPG","page_title":"Barcin (plaats)","context_page_description":"Barcin is een stad in het Poolse woiwodschap Koejavië-Pommeren, gelegen in de powiat Żniński. De oppervlakte bedraagt 3,69 km², het inwonertal 7864.\\nIn deze plaats bevindt zich Station Barcin."},{"page_url":"https://de.wikipedia.org/wiki/Ad%C3%A9la%C3%AFde_Labille-Guiard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Labille-Guiard_-_Madame_Alexis_1787.jpg","page_title":"Adélaïde Labille-Guiard","context_page_description":"Adélaïde Labille-Guiard, später auch Madame Vincent genannt, war eine französische Malerin des Klassizismus im ausgehenden 18. Jahrhundert und Gründerin der ersten Pariser Frauenschule für Malerinnen."},{"page_url":"https://en.wikipedia.org/wiki/Klipspringer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Klipspringer.jpg","page_title":"Klipspringer","context_page_description":"The klipspringer is a small antelope found in eastern and southern Africa. The sole member of its genus, the klipspringer was first described by German zoologist Eberhard August Wilhelm von Zimmermann in 1783. The klipspringer is a small, sturdy antelope; it reaches 43–60 centimetres at the shoulder and weighs from 8 to 18 kilograms. The coat of the klipspringer, yellowish gray to reddish brown, acts as an efficient camouflage in its rocky habitat. Unlike most other antelopes, the klipspringer has a thick and coarse coat with hollow, brittle hairs. The horns, short and spiky, typically measure 7.5–9 cm.\\nTypically nocturnal, the klipspringer rests during the middle of the day and late at night. A gregarious animal, the klipspringer is monogamous to a much greater extent than other antelopes; individuals of opposite sexes exhibit long-term to lifelong pair bonding. The mates tend to stay as close as within 5 m of each other at most times. Males form territories, 7.5–49 hectares, in which they stay with their partners and offspring. Primarily a browser, the klipspringer prefers young plants, fruits and flowers."},{"page_url":"https://de.wikipedia.org/wiki/Netzebene_(Kabelfernsehen)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/HUP862_astro.jpg","page_title":"Netzebene (Kabelfernsehen)","context_page_description":"Die Netzebenen sind verschiedene Abschnitte des Kabelfernsehnetzes."},{"page_url":"https://en.wikipedia.org/wiki/Bellavista_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Municipalidad_de_Bellavista-Callao.png","page_title":"Bellavista District","context_page_description":"Bellavista is a district of the Constitutional Province of Callao in Peru, and one of the seven districts that comprise the port city of Callao.\\nThe current mayor of the district is Daniel Malpartida."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%8E%E6%9D%B0%E5%A2%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Tomb_of_Li_Jie_07_2012-10.JPG","page_title":"李杰墓","context_page_description":"李傑墓位於中國江蘇省南京市雨花台區雨花台風景區內東南側、二忠祠以西，原在南京晨光集團廠區內，為明初開國功臣、鎮國上將軍李傑的墓葬，建於明洪武二年，現存神道碑一通，其上為宋濂所撰《宣武將軍僉廣武衛指揮使司事贈驃騎將軍僉都督府事李公神道碑銘》，其後為石羊、石虎、石馬、石翁仲各一對，墓室已無跡可尋，石刻因城市建設曾多次遷移，1996年遷入雨花台內保存。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%98%E1%83%9C%E1%83%92%E1%83%95%E1%83%94%E1%83%9A%E1%83%98%E1%83%A0%E1%83%98%E1%83%A1_%E1%83%94%E1%83%A0%E1%83%9D%E1%83%95%E1%83%9C%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%9E%E1%83%90%E1%83%A0%E1%83%99%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Thingvellir1-2.jpg","page_title":"თინგველირის ეროვნული პარკი","context_page_description":"თინგველირი — ველი ისლანდიის სამხრეთ-დასავლეთ ნაწილში, რეიკიანესის ნახევარკუნძულთან ახლოს; იგივე სახელი ეწოდება ეროვნულ პარკს, რომელიც იუნესკოს მსოფლიო მემკვიდრეობის სიაშია შეტანილი."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%B8%D5%A2%D5%A5%D5%AC%D5%B5%D5%A1%D5%B6%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AF%D5%A1%D5%B4%D5%A1%D6%80_(%D4%BF%D5%A1%D5%A6%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Krasny_vorota.jpg","page_title":"Հոբելյանական կամար (Կազան)","context_page_description":"Հոբելյանական կամար, հուշային կառույց, որն ընդգրկված է Կազան քաղաքի Պետրովի անվան այգու համալիրի կազմում: Ունի հանրապետական նշանակության պատմության և մշակույթի հուշարձանի կարգավիճակ:"},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_Naj%C5%9Bwi%C4%99tszej_Maryi_Panny_Kr%C3%B3lowej_R%C3%B3%C5%BCa%C5%84ca_%C5%9Awi%C4%99tego_w_Boronowie","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Boron%C3%B3w_ko%C5%9Bci%C3%B3%C5%82_276.jpg","page_title":"Kościół Najświętszej Maryi Panny Królowej Różańca Świętego w Boronowie","context_page_description":"Kościół NMP Królowej Różańca świętego w Boronowie – drewniany kościół z 1611 roku położony na terenie miejscowości Boronów w dekanacie Woźniki, w diecezji gliwickiej, siedziba parafii NMP Królowej Różańca Świętego.\\nKościół leży wraz z kilkoma innymi kościołami ziemi lublinieckiej na Szlaku Architektury Drewnianej. Jest orientowany, zbudowany na rzucie krzyża greckiego. Jest to najstarszy drewniany kościół na Śląski na takim planie.\\nFundatorem kościoła był hrabia Andrzej Dzierżanowski herbu Gozdawa, właściciel Boronowa. Większość obiektów sakralnych znajdujących się obecnie w kościele pochodzi z XVII i XVIII wieku. Poza ołtarzem głównym z początku XVII wieku, w kościele znajdują się jeszcze cztery ołtarze boczne, ulokowane w południowej i w północnej nawach bocznych:\\nołtarz św. Anny z XVII wieku\\nołtarz Niepokalanego Poczęcia Najświętszej Marii Panny z 1659\\nołtarz Czterech św. Janów z XVIII wieku\\nołtarz św. Mikołaja z 1751\\nNastawa ołtarza głównego składa się z dwóch kondygnacji – na pierwszej zawieszony jest obraz MB Różańcowej, na drugiej natomiast mniejszy obraz św. Andrzeja, który w XVII był patronem kościoła. Po obu stronach obrazu MB Różańcowej znajdują się dwie rzeźby: św."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%AF%D8%A8%DB%8C%D8%A7%D8%AA_%D8%A7%D9%86%DA%AF%D9%84%DB%8C%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/JohnLocke.png","page_title":"ادبیات انگلیسی","context_page_description":"ادبیات انگلیسی به مجموعه نوشتجاتی گفته می‌شود که به زبان انگلیسی و به قلم سخنوران و ادبایی که اهل سرزمین انگلستان و دیگر ممالک جهان بوده‌اند سروده یا تصنیف شده‌است. گستردگی زبان انگلیسی سبب شده که گویندگانی نظیر رابرت برنز اسکاتلندی، جیمز جویس ایرلندی، جوزف کنراد لهستانی، دیلن تامس ولزی، توماس پینچن آمریکایی، وی. اس. نایپل ترینیدادی و ولادیمیر ناباکوف روسی که همگی جزو بزرگترین ادبای زبان انگلیسی به‌شمار می‌روند دست به خلق آثاری به این زبان بزنند. ادبیات انگلیسی به تنوع گویش‌های سخنوران این زبان در اکناف جهان است؛ کشورهایی که تحت استعمار و اسکان بریتانیا قرار گرفتند. با وجود گوناگونی نویسندگان ادبیات انگلیسی آثار شاعر شهیر انگلستان، ویلیام شکسپیر همچنان به عنوان برترین سروده‌های خلق‌شده به این زبان در سراسر دنیای انگلیسی‌زبانان به‌شمار می‌رود.\\nتا اوایل سده ۱۹ میلادی بیشتر آثار ادبی زبان انگلیسی توسط اهالی بریتانیا نوشته می‌شد. پس از آن، زمان پیدایش نویسندگان بزرگ در ایالات متحده آمریکا فرا رسید. در سده ۲۰ آمریکا و ایرلند بسیاری از مهم‌ترین آثار ادبی زبان انگلیسی را تولید کردند. پس از جنگ جهانی دوم نویسندگان امپراتوری سابق بریتانیا نیز نویسندگان بریتانیا را به چالش کشیدند. برای آشنایی با ادبیات انگلیسی دیگر کشورها به بخش جستارهای وابسته مراجعه کنید."},{"page_url":"https://fi.wikipedia.org/wiki/Meksikolainen_keitti%C3%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Enchilada_Rice_Beans.jpg","page_title":"Meksikolainen keittiö","context_page_description":"Meksikolainen keittiö yhdistää asteekkien ja espanjalaisten vivahteikkaita ruoka-aineita ja ruokakulttuureita. Myös Portugalin, Ranskan ja Itävallan keittiöillä oli vaikutusta meksikolaiseen keittiöön. Tunnusomaista meksikolaiselle keittiölle on etenkin chilipippurien, tortillojen eli vehnä/maissileipästen sekä mustien papujen käyttö. Mausteita meksikolaiset käyttävät runsaasti, ja ruoan tulisuus ja chilit ovatkin meksikolaisen ruoan sielu, vaikka kaikki ruoat eivät sisälläkään chiliä ja tulisia makuja. Meksikolaista ruokakulttuuria on kutsuttu yhdeksi maailman kolmesta tärkeimmästä gastronomiasta kiinalaisen ja ranskalaisen keittiön ohella.\\nEspanjalaiset toivat Meksikoon raaka-aineista etenkin sianlihan, sipulin, valkosipulin, kanelin ja riisin, kun taas esikolumbiaaniseen keskiamerikkalaiseen ruokavalioon kuuluivat Vanhassa maailmassa tuntemattomat avokado, bataatti, chili, kaakao, kurpitsa, maapähkinä, maissi, pavut, tomaatti ja vanilja.\\nMeksikolaisten perusruokaa ovat tortillat, maissista tehdyt rieskat. Tortillasta tehdään myös tacoja ja enchiladoja.\\nPerinteinen meksikolainen rosvopaistin valmistusmenetelmä on barbacoa, joka on antanut nimensä barbecue-grillijuhlille."},{"page_url":"https://en.wikipedia.org/wiki/Camera_di_San_Paolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Camera_della_badessa_02.JPG","page_title":"Camera di San Paolo","context_page_description":"The Camera di San Paolo or Camera della Badessa is a room in the former Monastery of San Paolo, in Parma, northern Italy. It is painted with frescoes by Correggio in the vault and over the fireplace."},{"page_url":"https://en.wikipedia.org/wiki/Rankin_family_of_Geelong","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cliff%2C_Teddy_and_Bert_Rankin_-_Geelong_and_Victorian_State_footballers.jpg","page_title":"Rankin family of Geelong","context_page_description":"The Rankins were a pioneering family of the Geelong district. The family produced a dynasty of champion Australian rules footballers, including three captains of the Geelong Football Club, two Carji Greeves medallists and played 582 games for Geelong, between them."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_FFH-Gebiete_in_der_Freien_Hansestadt_Bremen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Kuhgrabensee.png","page_title":"Liste der FFH-Gebiete in der Freien Hansestadt Bremen","context_page_description":"Die Liste der FFH-Gebiete in Bremen zeigt die 15 FFH-Gebiete des deutschen Bundeslandes Bremen. Teilweise überschneiden sie sich mit bestehenden Natur- und Landschaftsschutzgebieten."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Adam_Ries","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Ludwigsmedaille_voor_Wetenschap_en_Kunst.jpg","page_title":"Johann Adam Ries","context_page_description":"Johann Adam Ries war ein deutscher Medailleur, Münzgraveur und Grafiker am Bayerischen Hauptmünzamt."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B7%B1%E5%9C%B3%E5%9C%B0%E9%93%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/SZMetro_Hongshan.jpg","page_title":"深圳地铁","context_page_description":"深圳地鐵是中國廣東省深圳市的城市軌道交通系統。深圳地鐵截至2020年8月18日共有10條路線、266座車站、總長383公里的營運路線，構成覆蓋深圳市羅湖、福田、南山、寶安、龍崗、龍華、光明七個市轄行政區的地鐵網路。在營運方面，深圳地鐵由深圳市地鐵集團有限公司、港鐵軌道交通有限公司分別營運不同路線，在政府指導下執行統一的票價和服務。目前深圳地鐵日均客流量超過560萬人次，約占深圳市公共運輸客流量的56%，構成深圳市公共運輸的骨幹。\\n深圳地鐵的建設設想始於1980年代，一期工程則於1998年底開工，並於2004年底通車。2008年以來，深圳地鐵網路快速擴展，以2019年已通車的里程計算，深圳地鐵是中國第七大城市軌道交通系統。深圳地鐵三期及四期工程的多條路線正在建設，2025年路網長度將超過650公里。"},{"page_url":"https://ru.wikipedia.org/wiki/NGC_2558","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/NGC_2558_SDSS.jpg","page_title":"NGC 2558","context_page_description":"NGC 2558 — галактика в созвездии Рак.\\nЭтот объект входит в число перечисленных в оригинальной редакции «Нового общего каталога».\\nГалактика NGC 2558 входит в состав группы галактик NGC 2563. Помимо NGC 2558 в группу также входят ещё 13 галактик."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teaux_de_la_Vall%C3%A9e_d%27Aoste","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Castello_di_Avise_2.JPG","page_title":"Châteaux de la Vallée d'Aoste","context_page_description":"Les châteaux valdôtains sont nombreux et importants, et témoignent du passé illustre de cette petite région montagneuse, comme voie de passage alpine.\\nCes châteaux, auxquels est indissociablement liée l'histoire de la Vallée d'Aoste, autrefois principal moyen de défense, sont aujourd'hui une des plus importantes richesses de la plus petite région italienne. En dépit de ses dimensions, en la parcourant on peut trouver presque un château dans chaque village, dont la plupart ont été bien conservés, et constituent une des majeures attractions touristiques.\\nLe château le plus connu est sans doute celui de Fénis.\\nAu cours des siècles, les châteaux valdôtains ont évolué : à l'origine ils servaient de bastions de défense, comme les Tours en général, remontant au IIᵉ millénaire. Par la suite, les familles nobiliaires locales ont de plus en plus cherché à montrer leur richesse et leur autorité par leurs châteaux, c'est le cas de Fénis et d'Issogne. En ce qui concerne le Château Savoie à Gressoney-Saint-Jean, il répond à un désir de souvenir des gloires passées."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_Chiapas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Vendedora_Tzotzil.jpg","page_title":"Historia de Chiapas","context_page_description":"Chiapas es uno de los 32 estados de México. Está en la región suroeste del país, limitando al norte con Tabasco, al este y sureste con los departamentos guatemaltecos de Petén, Quiché, Huehuetenango y San Marcos, al sur con el océano Pacífico, al oeste con Oaxaca y al noroeste con Veracruz. En tiempos prehispánicos el actual territorio de Chiapas no conformó una unidad política ni étnica. Su gran diversidad fisiográfica y ecológica​ y su ubicación ístmica entre ambos océanos y entre Norte y Centro América lo configuró como un espacio sujeto a múltiples contactos demográficos, políticos y comerciales.​La región estuvo habitada por pueblos de diversas filiaciones lingüísticas y culturales. A diferencia de la opinión popular que considera a este rincón del mundo exclusivamente como parte del área maya, las investigaciones arqueológicas y etnolingüísticas han puesto en evidencia que a lo largo del tiempo, además de los mayas, distintos grupos como los mokayas, los zoques, los mixes y los chiapanecas ocuparon el territorio.​"},{"page_url":"https://en.wikipedia.org/wiki/John_Vance_Cheney","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/John_Vance_Cheney_001.jpg","page_title":"John Vance Cheney","context_page_description":"John Vance Cheney was an American poet, essayist and librarian. Educated in Geneseo, New York, Cheney practiced law briefly in Woodstock, Vermont and New York City before moving to California with his first wife Abigail Perkins Vance Cheney, teaching music, lecturing, and working as a postal clerk. In 1887 he assumed the position of librarian of the Free Public Library of San Francisco, where he oversaw the openings of the system's first branch libraries and hosted the first west coast conference of the American Library Association in 1891. In 1894 he moved to Chicago, where he served as librarian of the Newberry Library. In 1909 he retired and moved to San Diego with his second wife, Sara Barker Chamberlain.\\nCheney was a regular contributor to major literary magazines, including The Century, Atlantic Monthly, New England Magazine, and Harper's Monthly. His collected works, written between 1887 and his death in 1922, fill eight volumes.\\nHe married Abbey Perkins Cheney in 1876 and had two daughters, Janet Vance Cheney and Evelyn Hope Cheney."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Bistum_Trier","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Gentingen_088.jpg","page_title":"Liste der Kirchen im Bistum Trier","context_page_description":"Diese Liste der Kirchen im Bistum Trier listet die römisch-katholischen Kirchen und Kapellen im Bistum Trier auf. Vom saarländischen Teil des Bistums Trier fehlen einige Dekanate."},{"page_url":"https://de.wikipedia.org/wiki/Chon_Buri_(Provinz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Amphoe_Chonburi.svg","page_title":"Chon Buri (Provinz)","context_page_description":"Chon Buri ist eine Provinz in der Ostregion Thailands, sie wird aber verwaltungstechnisch zu Zentralthailand gezählt.\\nDie Hauptstadt der Provinz heißt ebenfalls Chon Buri."},{"page_url":"https://hsb.wikipedia.org/wiki/%C5%BDo%C5%82ty_%C5%BEonop","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/IsleofMancabbage.jpg","page_title":"Žołty žonop","context_page_description":"Žołty žonop je rostlina ze swójby křižnokwětnych rostlinow."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Oss_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sint_Odradakapel_Macharen_voorkant.jpg","page_title":"Lijst van gemeentelijke monumenten in Oss (gemeente)","context_page_description":"De gemeente Oss kent 194 gemeentelijke monumenten, hieronder een overzicht. Zie ook de rijksmonumenten in Oss."},{"page_url":"https://pt.wikipedia.org/wiki/Anna_Chrom%C3%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Anna-Chromy-OlympicSpirit.jpg","page_title":"Anna Chromý","context_page_description":"Anna Chromy é uma pintora e escultora. Nascida na região da Boémia e criada na Áustria, vive na França e trabalha na Itália. É considerada por muitos como a quintessência européia.\\nAo final da Segunda Guerra Mundial, a família de Anna Chromy mudou-se de Boémia para Viena, Áustria. No entanto, sua família não tinha dinheiro suficiente para que ela pudesse frequentar a escola de arte, por isso só foi possível fazê-lo depois de casar-se e mudar para Paris. Recebeu sua educação na École des Beaux-Arts e adquiriu uma reputação do mundo surrealista que ela representa.\\nUm acidente no qual ela sofreu risco de vida em 1992 causou lesões graves a Anna Chromy e por oito anos ela ficou incapaz de pintar. Ela voltou sua atenção a escultura usando bronze e mármore como seu meio."},{"page_url":"https://sk.wikipedia.org/wiki/Bartholom%C3%A4berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Bartholom%C3%A4berg1.JPG","page_title":"Bartholomäberg","context_page_description":"Bartholomäberg je obec v Rakúsku v spolkovej krajine Vorarlbersko v okrese Bludenz.\\nŽije tu 2 253 obyvateľov."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C5%93uvres_d%27art_public_dans_les_Yvelines","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Versailles-Parterre_Nord-Le_Flegmatique.jpg","page_title":"Liste d'œuvres d'art public dans les Yvelines","context_page_description":"Cet article recense les œuvres d'art dans l'espace public dans le département des Yvelines, en France."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B4%D0%B8_%D0%BC%D0%B0%D0%BD%D0%B1%D0%B0%D1%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Html-source-code.png","page_title":"Коди манбаъ","context_page_description":"Коди мабдаъ, ё коди манбаъ — дар дониши роёна, дастурҳои барнома ба забоне сатҳи боло ё забони Ассембли, ки қобили хондан барои инсон бошад ва роёна натавонад мустақиман онро бихонад."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%87%AA%E7%94%B1%E6%B0%91%E4%B8%BB%E5%85%9A%E9%9D%92%E5%B9%B4%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Kenichi_Mizuno_200609.jpg","page_title":"自由民主党青年局","context_page_description":"自由民主党青年局とは、自由民主党の組織局の一つ。主に、若手の議員によって構成される機関である。通例、「自民党青年局」と呼ばれる。\\n国会議員によって構成される党本部の青年局と地方支部の青年局があるが、特に断りがない場合、通常前者をさす。"},{"page_url":"https://uk.wikipedia.org/wiki/MAN_TGX","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/BAMAP-2019_exhibition_%28Minsk%2C_Belarus%29_%E2%80%94_%D0%92%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_%D0%91%D0%90%D0%9C%D0%90%D0%9F-2019_%28%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%2C_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%8C%29_00010.jpg","page_title":"MAN TGX","context_page_description":"MAN TGX — вантажні автомобілі, що виробляються компанією MAN з 2007 року.\\nАбревіатура TG розшифровується як Trucknology Generation.\\nАвтомобілі MAN TGX здобули титул \\"Вантажівка року\\" у 2008 році."},{"page_url":"https://nl.wikipedia.org/wiki/Noord-Willemskanaal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Noord-Willemskanaal.jpg","page_title":"Noord-Willemskanaal","context_page_description":"Het Noord-Willemskanaal is de scheepvaartverbinding tussen de Drentsche Hoofdvaart ten westen van Assen en de stad Groningen, ongeveer evenwijdig aan de A28. Het ligt in de Nederlandse provincies Drenthe en Groningen. Het kanaal is 38 km lang en heeft een diepte van 2 m.\\nHoewel de meeste vaarwegen in Nederland zijn aangelegd door overheden, is het Noord-Willemskanaal aangelegd door een commerciële maatschappij. Het kanaal is genoemd naar koning Willem III. Het werd eerst Willemsvaart genoemd en omdat in Noord-Brabant zich al een Willemsvaart bevond, werd de aanduiding Noord hieraan toegevoegd. Later werd de naam gewijzigd in kanaal, waarbij de toevoeging Noord bleef. Er zijn overigens nog twee andere Willemsvaarten: de Willemsvaart bij Zwolle en de Willemsvaart in Zuidoost-Drenthe.\\nIn Groningen is een verbinding via het Eendrachtskanaal met het Hoendiep en via het Verbindingskanaal met het Eemskanaal en het Van Starkenborghkanaal.\\nVia de Nijveensterkolk is het voor kleine boten mogelijk om van het Paterswoldsemeer naar het Noord-Willemskanaal te varen.\\nHet kanaal heeft drie schutsluizen:\\nSluis Peelo ten noorden van Assen;\\nSluis Yde-Vries, ongeveer 1½ km ten noorden van Vries;"},{"page_url":"https://ca.wikipedia.org/wiki/Arnaldo_da_Brescia","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Campo_Marzio_-_busti_del_Pincio_-_Arnaldo_da_Brescia_1000464.JPG","page_title":"Arnaldo da Brescia","context_page_description":"Arnaldo da Brescia va ser un sacerdot i reformador religiós que seguint les propostes del seu mestre, el filòsof racionalista Pere Abelard, i de la pataria, estableix el seu ideari moral que consisteix en: la renúncia de l'església a la riquesa i el retorn a l'austeritat dels primers cristians; l'abandonamnet del poder temporal; la no validesa dels sagraments administrats per clergues indignes; la predicació per laics i la confessió practicada entre fidels sense la necessitat de sacerdots.\\nLes seves revolucionàries idees van provocar que el papa Innocenci II el desterrés d'Itàlia el 1139. S'estableix a París juntament amb el seu mestre Abelard i amb ell polemitza contra Bernat de Claravall sobre la Santíssima Trinitat. Les seves opinions, considerades herètiques, provoquen la condemna de mestre i deixeble al Concili de Sens i la seva expulsió de terres franceses.\\nArnaldo es refugia a Alemanya fins que el 1143 es retracta de les seves idees i, mitjançant el suport del cardenal diaca Guido, aconsegueix el seu reingrés a l'Església en ser perdonat pel papa Eugeni III."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D9%88%D8%B1%D8%B4%DB%8C%D8%AF%DA%AF%D8%B1%D9%81%D8%AA%DA%AF%DB%8C_%DB%B2%DB%B4_%D8%A7%DA%A9%D8%AA%D8%A8%D8%B1_%DB%B1%DB%B9%DB%B9%DB%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/SE1995Oct24T.png","page_title":"خورشیدگرفتگی ۲۴ اکتبر ۱۹۹۵","context_page_description":"خورشیدگرفتگی ۲۴ اکتبر ۱۹۹۵ یک خورشیدگرفتگی از نوع خورشیدگرفتگی کامل است. این خورشیدگرفتگی در تاریخ ۲۴ اکتبر ۱۹۹۵ میلادی روی داد که زمان اوج آن، ساعت ۴:۳۳:۳۰ به‌وقت ساعت هماهنگ جهانی بوده‌است. مدت زمان و طول این خورشیدگرفتگی ۲ دقیقه و ۱۰ ثانیه بود."},{"page_url":"https://en.wikipedia.org/wiki/Old_Bering_Sea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Female_Figure_MET_AOA182.jpg","page_title":"Old Bering Sea","context_page_description":"Old Bering Sea is an archaeological culture associated with a distinctive, elaborate circle and dot aesthetic style and is centered on the Bering Strait region; no site is more than 1 km from the ocean. Old Bering Sea is considered, following Henry B. Collins, the initial phase of the Northern Maritime tradition. Despite its name, several OBS sites lie on the Chukchi Sea. The temporal range of the culture is from 400 BCE to possibly as late as AD 1300. Another suggested range is from about 200 BCE to 500 AD."},{"page_url":"https://fr.wikipedia.org/wiki/Houill%C3%A8res_et_saline_de_Gouhenans","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/2015-04_-_Puits_n%C2%B0_4_Gouhenans_-_06.JPG","page_title":"Houillères et saline de Gouhenans","context_page_description":"Les houillères et saline de Gouhenans sont un ensemble de mines et d'usines situées dans l'est de la France, exploitant et transformant du sel gemme et de la pyrite de 1831 à 1945, ainsi que de la houille de 1828 à 1921, des ressources présentes au même étage géologique du bassin keupérien. Le gîte de houille est identifié dans les années 1770, il s'étend sous les communes de Gouhenans, Athesans et Villafans, dans le département de la Haute-Saône, en Bourgogne-Franche-Comté. C'est avec l'exploitation des charbonnages que le sel est découvert. L'exploitation du charbon sur place pour l'évaporation de la saumure permet à la compagnie de baisser le coût de revient du sel. Une usine chimique et une verrerie sont ajoutées à ce complexe industriel qui marque une période de prospérité pour Gouhenans. L'activité chimique devient la propriété du groupe Kuhlmann en 1927 et le reste jusqu'à la fermeture en 1955.\\nEn 1847, l'exploitation du sel provoque un scandale impliquant des personnalités politiques de la monarchie de Juillet, le général Despans-Cubières et Jean-Baptiste Teste, pair de France et ministre d'État.\\nDes vestiges de ces industries subsistent au début du XXIᵉ siècle."},{"page_url":"https://sv.wikipedia.org/wiki/Ch%C3%A2tel-sur-Montsalvens","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Karte_Gemeinde_Ch%C3%A2tel-sur-Montsalvens_2014.png","page_title":"Châtel-sur-Montsalvens","context_page_description":"Châtel-sur-Montsalvens är en ort och kommun i distriktet Gruyère i kantonen Fribourg, Schweiz. Kommunen hade 285 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Wolseley,_South_Australia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Wolseley_fuel_tanks.jpg","page_title":"Wolseley, South Australia","context_page_description":"Wolseley is a small South Australian town near the Victorian border. It is five kilometres south of the Dukes Highway and 13 kilometres east of Bordertown. It was first proclaimed a town in 1884.\\nThe 2016 Australian census which was conducted in August 2016 reports that Wolseley had a population of 180 people."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%A1%D7%A7%D7%91%D7%99%D7%A5%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Abandoned_Moskvitch_headquarters_%284178033183%29.jpg","page_title":"מוסקביץ'","context_page_description":"מוֹסקביץ' הוא כינויים של דגמי מכוניות נוסעים שיוצרו בברית המועצות והיו נפוצים בגוש המזרחי כולו. זה גם היה שמו של המפעל בשנים 1992-2006."},{"page_url":"https://de.wikipedia.org/wiki/Browning_Automatic_Rifle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/HCAR.jpg","page_title":"Browning Automatic Rifle","context_page_description":"Das Browning Automatic Rifle oder kurz B.A.R. ist ein von John Moses Browning um 1916/17 zur Kampfeinheitenunterstützung entwickeltes, leichtes Maschinengewehr. Nach einer Vorführung vor Regierungsvertretern und der Presse am 27. Februar 1917 in Washington D.C. wurde es als leichtes Maschinengewehr bei der US-Armee eingeführt, kam aber zu spät, um im Ersten Weltkrieg noch eine Rolle zu spielen: Seinen ersten Einsatz hatte es am 13. September 1918 in Frankreich. Das B.A.R. hat ein 20 Patronen fassendes Magazin und wiegt geladen über 9 kg, was für ein Maschinengewehr leicht, für ein Sturmgewehr – als solches es ursprünglich gedacht war – aber zu schwer ist. Damit wog das B.A.R. fast doppelt so viel wie das amerikanische Standardgewehr Springfield M1903 und das spätere M1 Garand. Mangels eines geeigneten Nachfolgers war das B.A.R. auch im Zweiten Weltkrieg noch das Standard-lMG der US-Truppen. Es sollte den vorrückenden Einheiten mehr Feuerkraft verleihen, wenn diese die Stellung wechselten. Da das B.A.R. für ein Maschinengewehr mit einer so starken Patrone viel zu leicht war, konnte man es im Dauerfeuer ohne Zweibeinstütze nur schlecht kontrollieren."},{"page_url":"https://fr.wikipedia.org/wiki/Doron_de_Beaufort","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Beaufort_Savoie.jpg","page_title":"Doron de Beaufort","context_page_description":"Le Doron ou parfois Doron de Beaufort est une rivière française située dans le département de la Savoie en région Auvergne-Rhône-Alpes.\\nLong de 24,7 km, le Doron prend sa source dans le massif du Beaufortain. Il est un affluent de la rive gauche de l'Arly et donc un sous-affluent du Rhône par l'Isère."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sydney_FC_managers","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Branko_Culina.jpg","page_title":"List of Sydney FC managers","context_page_description":"Sydney FC are a football club based in Sydney, New South Wales who were founded in 2004. They have had nine different managers in their history including one caretaker who came back as a manager. Their first manager being Pierre Littbarski and the current being Steve Corica."},{"page_url":"https://en.wikipedia.org/wiki/Chaunay","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Chaunay-fresque_Armand_langlois.jpg","page_title":"Chaunay","context_page_description":"Chaunay is a commune in the Vienne department in the Nouvelle-Aquitaine region in western France."},{"page_url":"https://en.wikipedia.org/wiki/Omaha_Township,_Thurston_County,_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Map_highlighting_Omaha_Township%2C_Thurston_County%2C_Nebraska.svg","page_title":"Omaha Township, Thurston County, Nebraska","context_page_description":"Omaha Township is one of eleven townships in Thurston County, Nebraska, United States. The population was 1,204 at the 2010 census.\\nThe Village of Walthill lies within the Township."},{"page_url":"https://de.wikipedia.org/wiki/Feldh%C3%A4cksler","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Chopping_grass_for_silage_-_geograph.org.uk_-_1241307.jpg","page_title":"Feldhäcksler","context_page_description":"Der Feldhäcksler ist ein landwirtschaftliches Gerät zur Aufnahme, Zerkleinerung und Verladung von Erntegut wie Gras, Luzerne oder Mais, insbesondere bei der Bereitung von Silage bzw. Ganzpflanzensilage, daneben erlangt das Gerät in letzter Zeit wachsende Bedeutung bei der Ernte nachwachsender Rohstoffe. Ein weiteres Einsatzgebiet ist das Häckseln von Stroh. Hierdurch sollen bessere Eigenschaften bei Verwendung als Einstreu erzielt werden."},{"page_url":"https://pl.wikipedia.org/wiki/Patrick_Rothfuss","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/PatRothfussGnome.JPG","page_title":"Patrick Rothfuss","context_page_description":"Patrick Rothfuss – amerykański pisarz fantasy. Jest autorem powieści Imię wiatru."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Santo_Stanislao_dei_Polacchi","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Eglise_Santo_Stanislao_dei_Polacchi.JPG","page_title":"Église Santo Stanislao dei Polacchi","context_page_description":"L'église Santo Stanislao dei Polacchi est une église romaine située dans le rione de Sant'Angelo sur la via delle Botteghe Oscure. Elle est dédiée au patron de la Pologne, Stanislas de Szczepanów."},{"page_url":"https://az.wikipedia.org/wiki/D%C9%99niz_fili","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Breeding_colony_of_Mirounga_angustirostris.jpg","page_title":"Dəniz fili","context_page_description":"Dəniz fili — Məməlilər fəsiləsinin Əsl suitilər yarımfəsiləsinə aid cins. Yırtıcı məməlilər arasında ən böyüklərindən biridir. Onlar əsl suitilərə daxil olsalarda özlərini Qulaqlı suitilərə daxil olan canlılar kimi aparırlar. Onlar iki növə bölünür: Şimal dəniz fili və Cənub dəniz fili. Bu cinsin nümayəndələri hal-hazırda suitilərə aid edilir. Əvvəllər isə onlar Monax suitilərə aid edilirdi. 1996-ci ildə Binida-Emonds və Rassel bu məsələdə bir əlaqə aşkarlaya bilməmişdirlər."},{"page_url":"https://pl.wikipedia.org/wiki/%C3%96sterreichische_Bundesbahnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%C3%96BB_2080_001-7_in_Innsbruck_Hbf.jpg","page_title":"Österreichische Bundesbahnen","context_page_description":"Österreichische Bundesbahnen – austriackie państwowe i zarazem największe w kraju przedsiębiorstwo kolejowe, utworzone w 1923 r. Zarządza również siecią kolejową w Liechtensteinie.\\nSiedziba przedsiębiorstwa znajduje się w Wiedniu. Zarządza około 5700 km torów i zatrudnia około 44 tys. osób.\\nZ usług ÖBB korzysta około 436 mln pasażerów rocznie."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_stanic_metra_v_Pa%C5%99%C3%AD%C5%BEi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Lamarck_Caulaincourt_entree.jpg","page_title":"Seznam stanic metra v Paříži","context_page_description":"Seznam stanic metra v Paříži je abecední přehled všech stanic pařížského metra. Obsahuje nejen stanice, které se nacházejí na území města Paříže, ale i za jeho hranicemi na předměstích. Stanice, které byly zrušené a uzavřené nebo jsou pouze plánované či jsou dosud ve výstavbě a nebyly ještě zprovozněny, tento seznam nezahrnuje. Seznam rovněž neobsahuje samostatné stanice linek RER, které mají mnohdy totožné nebo podobné názvy.\\nSeznam je řazen podle české abecedy, takže stanice začínající písmenem Ch jsou řazeny samostatně. Stanice, které začínají členem určitým La, Le nebo Les jsou řazeny pod písmenem L. Názvy stanic jsou v úplném znění včetně podnázvů psaných kurzívou.\\nLegenda\\naž – linky pařížského metra\\naž – možnost přestupu na linky RER\\naž – možnost přestupu na tramvajové linky\\n– možnost přestupu na linky Transilien\\n– možnost přestupu na dálkové spoje SNCF\\n– alespoň jedna linka má ve stanici bezbariérový přístup"},{"page_url":"https://en.wikipedia.org/wiki/List_of_West_Bromwich_Albion_F.C._seasons","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/West_Bromwich_Albion_team_1920.jpg","page_title":"List of West Bromwich Albion F.C. seasons","context_page_description":"West Bromwich Albion Football Club was founded as West Bromwich Strollers in 1878 by workers from George Salter's Spring Works and turned professional in 1885. Albion won the FA Cup for the first time in 1888 and later that year became one of the founder members of the Football League. In the 1900–01 season, the club moved to its current home ground, The Hawthorns. Albion have spent the majority of their history in the top division of English football, including 24 seasons in a row between 1949–50 and 1972–73. From 1986–87 to 2001–02, they spent 16 consecutive seasons outside the top division, recording their lowest ever league finish of seventh in Division Three in 1991–92. Albion have been promoted 11 times and relegated 11 times, with 7 of the 22 changes of division coming between 2002 and 2010. The team played in the Premier League for the first time in 2002–03.\\nAlbion have won the League Championship once, the FA Cup five times, the League Cup once and the Charity Shield twice, one of which was shared. They have been runners-up in the League Championship twice, in the FA Cup five times and in the League Cup twice."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E4%BA%AC%E6%97%85%E6%B8%B8%E6%99%AF%E7%82%B9%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Hutong_1_%28Snowyowls%29.jpg","page_title":"北京旅游景点列表","context_page_description":"北京旅游景点列表罗列北京市市域内的旅游景点。\\n北京市有2处国家重点风景名胜区、1座国家历史文化名城、1座中国历史文化名村、99处全国重点文物保护单位、326处市级文物保护单位。全市共有6处世界遗产，是世界上世界遗产最多的城市。这六处是：长城、明清皇家宫殿的故宫、北京的皇家园林的颐和园、北京的皇家祭坛的天坛、明清皇家陵寝的十三陵、周口店北京猿人遗址。国家重点风景名胜区有八达岭的十三陵、石花洞。中国历史文化名村有门头沟区斋堂镇的爨底下村。"},{"page_url":"https://lt.wikipedia.org/wiki/Tolygusis_briaunainis","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Dodecahedron_t1_A2.png","page_title":"Tolygusis briaunainis","context_page_description":"Tolygusis briaunainis yra toks briaunainis, kurio sienos yra taisyklingieji daugiakampiai ir kurio viršūnės yra tranzityvios. Tolygaus briaunainio visos viršūnės yra tolygios, o pats briaunainis pasižymi didelio laipsnio atspindėjimo ir sukimo simetrija.\\nTolygieji briaunainiai gali būti taisyklingi, kvazitaisyklingi ir pustaisyklingiai. Šių briaunainių sienos ir viršūnės gali būti ir neiškilos, tad daug tolygiųjų briaunainių yra žvaigždiniai.\\nAtmetus begalines prizminių briaunainių klases, suskaičiuosime 75 tolygiuosius briaunainius.\\nIškilieji:\\n5 Platono kūnai – taisyklingieji iškili briaunainiai;\\n13 Archimedo kūnų – 2 kvazitaisyklingieji ir 11 pustaisyklingių iškilių briaunainių.\\nŽvaigždiniai:\\n4 Keplerio-Puanso kūnai – taisyklingi neiškili briaunainiai;\\n53 tolygūs žvaigždiniai braiunainiai – 5 kvazitaisyklingieji ir 48 pustaisyklingiai;\\n1 žvaigždinis briaunainis, turintis sutampančių briaunų poras, geometriškai vadinamas didžiuoju dinusklembtu dirombiniu dodekaedru, kurį atrado Džonas Skilingas, todėl neretai jis svadinamas tiesiog Skilingo figūra."},{"page_url":"https://no.wikipedia.org/wiki/MAN_Truck_%26_Bus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Katowice_MAN_bus_n%C2%B0256%2C_line_15.JPG","page_title":"MAN Truck & Bus","context_page_description":"MAN Truck & Bus AG er en tysk produsent av nyttekjøretøyer, og er det største datterselskapet i det multinasjonale MAN-konsernet. Frem til 1. januar 2011 het selskapet MAN Nutzfahrzeuge AG. Selskapet eier også det tyske bussmerket Neoplan, samt de tidligere lastebilfabrikkene Star i Polen og ERF i England."},{"page_url":"https://ast.wikipedia.org/wiki/Taxonom%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Species_Plantarum_primera_p%C3%A1gina.png","page_title":"Taxonomía","context_page_description":"La Taxonomía ye, nel so sentíu más xeneral, la ciencia de la clasificación. Davezu emplégase'l términu pa designar a la Taxonomía Biolóxica, la \\"teoría y práutica de clasificar organismos\\" Como-y la entiende na actualidá, la clasificación biolóxica tien que ser congruente coles hipótesis d'árbol filoxenéticu disponibles, nella, los organismos arrexuntar en taxones mutuamente escluyentes de la mesma arrexuntaos en taxones de rangu más altu tamién mutuamente escluyentes, de forma que cada organismu pertenez a unu y namái un taxón en cada rangu o \\"categoría taxonómica\\". En cada taxón, los organismos tienen calteres que los sos estaos del calter estremar de los organismos fuera del taxón, y son los atributos qu'en xunto s'utilicen pa delimitar los taxones."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%83%D9%86%D8%A7%D8%A6%D8%B3_%D8%AD%D9%84%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Dimitrius_church_Aleppo.jpg","page_title":"قائمة كنائس حلب","context_page_description":"تنتشرُ مجموعةٌ كبيرةٌ من الكنائس والكاتدرائيّات في مدينة حلب في سوريا، تتوزّع على الأحياء القديمة والحديثة التي يتركز فيها المسيحيون خارج سور المدينة القديمة، ويعود تاريخ غالبيّة الكنائس الحاليّة إلى القرنين التاسع عشر والعشرين. تتنوّع الانتماءات الطقسيّة لهذه الكنائس بين البيزنطيّة والسريانيّة والأرمنيّة والرومانية، كما تختلف أساليب عمارتها بين الشرقية القديمة والغربية الحديثة. يمتلك المسيحيون أكثر من 30 كنيسة في حلب، من بينها 8 كاتدرائيات، تتوزع بشكل رئيسي على 11 طائفة مختلفة هُم الأرمن الأرثوذكس، الأرمن الكاثوليك، الأرمن الإنجيليون، السريان الأرثوذكس، السريان الكاثوليك، الكلدان، الموارنة، الروم الأرثوذكس، الروم الكاثوليك، اللاتين والإنجيليون العرب. وقد كانت حلب قبل الحرب الأهلية السورية أكبر تجمّع للمسيحيين في سوريا والثالثة في الشرق الأوسط بعد القاهرة وبيروت، إذ شكّل المسيحيون 12% من إجمالي سكانها بمجموع 250,000 نسمة."},{"page_url":"https://fr.wikipedia.org/wiki/Canon_de_36_livres","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/French_naval_iron_canon_in_tower_of_london.jpg","page_title":"Canon de 36 livres","context_page_description":"Un canon de 36 livres est un canon tirant des boulets de 36 livres, armant les plus gros vaisseaux de ligne français et les batteries côtières, du XVIIᵉ siècle au milieu du XIXᵉ siècle.\\nLe calibre de ce canon est exprimé à partir de la masse du boulet, 36 livres étant égal à 17,6 kilogrammes, ce qui correspond à un diamètre de 174,8 mm."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AD%D0%B4%D0%BC%D1%83%D0%BD%D0%B4_%D0%91%D0%B5%D1%80%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Burke.jpg","page_title":"Эдмунд Берк","context_page_description":"Берк Эдмунд - қазіргі консерватизм негізін салушылардың бірі. Ағылшын саяси қайраткері. 30 жыл бойы Берк Ағылшын пар- ламентінің мүшесі болды. Оның саяси ғылымы Француз революциясын зерттеу нәтижесінде қалыптасты. Б. саяси лигитимді, индивидуалды ақыл-ой және қызығушылық негізінде үсынылған кез келген саяси теория мойындамады. Кез келген мемлекет институттары - адамдардың жылдар бойы жинаған даналығының озығы. Кез келген институт өзіндік қүндылыққа ие және сол қүндылығын сақтай отырып әрекет етеді деп есептейді. Егер институттардың пайдасы болмаса олар қүрып кеткен болар еді. Институт қүндылығының себебі оларды адамдар тарапынан мойындаған. Берк келесі консерватизмнің бір белгісі дәстүр деп көрсетеді. Ежелгі наным-сенім қайшылықты болса, соншалықты бағаланады, осы икемілігінен ол өзінің өмірлік қажеттілігін дәлелдейді дей келіп, мемлекеттің мақсаты - тәртіп пен заңды қадағалау деп көрсетеді. Оның пайымдауынша, бүл адамға қамқорлық жасаудың басты жолы."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE_%D0%A2%D0%B0%D1%80%D0%B0%D1%81_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%D0%9A%D0%B0%D1%80%D0%B0_%D0%BA%D0%BE%D0%BB%D0%BE%D0%B4%D0%BA%D0%BE%D1%8E_.jpg","page_title":"Шевченко Тарас Григорович","context_page_description":"Тара́с Григо́рович Шевче́нко — український письменник, класик української літератури, мислитель, художник. Національний герой і символ України.\\nБратчик Кирило-Мефодіївського братства. Академік Імператорської академії мистецтв."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%8F_(%D0%A0%D0%B0%D0%B4%D0%B5%D1%85%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/%D0%A5%D1%80%D0%B0%D0%BC_%D0%A1%D0%B2._%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B4%D0%B5%D1%85%D1%96%D0%B2.JPG","page_title":"Церква святого Миколая (Радехів)","context_page_description":"Церква Святого Миколая — дерев'яний храм української греко-католицької церкви у місті Радехів Львівської області.\\nХрам збудований у 1918 році, на місці значно давнішого який згорів в наслідок попадання блискавки.\\nВ 1991 році поруч було закладено новий храм Святого Миколая."},{"page_url":"https://es.wikipedia.org/wiki/Providenciales","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Providenciales_Airport.jpg","page_title":"Providenciales","context_page_description":"Providenciales, conocida como \\"Provo\\", es una isla perteneciente a las Islas Turcas y Caicos. Tiene una extensión de 98 km² y en ella viven 23,769 habitantes siendo la isla con más población y la tercera en extensión del país, y cuenta con los servicios del Aeropuerto Internacional de Providenciales, con vuelos diarios hacia las principales ciudades de los Estados Unidos, Canadá y el Reino Unido. En la isla se encuentra la única granja de caracolas conch del mundo.\\nEl primer hotel construido en la isla fue el Third Turtle Inn, pero el primer resort construido fue Club Med, en los años 1980. De ahí en delante hubo un gran crecimiento en el sector turístico de la isla.\\nEn Providenciales se encuentra una de las mejores playas del mundo, Grace Bay, con su fina arena blanca y un mar increíblemente turquesa, además de otros lugares de gran belleza natural como Chalk Sound, Sapodilla Bay y Long Bay.\\nProvidenciales ha sido elegida como el mejor destino de playa y sol del mundo, por TripAdvisor en 2010."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Bistum_Aachen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Kreuzau-Thum_Denkmal-Nr._47%2C_Thumstra%C3%9Fe_%281020%29.jpg","page_title":"Liste der Kirchen im Bistum Aachen","context_page_description":"Diese Liste der Kirchen im Bistum Aachen listet die römisch-katholischen Kirchen im Bistum Aachen auf. Die Kapellen des Bistums sind in der Liste der Kapellen im Bistum Aachen einsortiert, die profanierten Kirchen in der Liste der profanierten Kirchen im Bistum Aachen."},{"page_url":"https://ca.wikipedia.org/wiki/Real_brasiler","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/10_Brazil_real_First_Obverse.jpg","page_title":"Real brasiler","context_page_description":"El real és la moneda actual del Brasil. Es divideix en 100 centaus. També és el nom de la primera moneda brasilera."},{"page_url":"https://fr.wikipedia.org/wiki/Matthew_Broderick","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Matthew_Broderick_%284226269570%29.jpg","page_title":"Matthew Broderick","context_page_description":"Matthew Broderick est un acteur et producteur américain, né le 21 mars 1962 à New York.\\nIl est connu entre autres pour ses rôles de David Lightman dans Wargames, Ferris Bueller dans La Folle Journée de Ferris Bueller et du docteur Nick Tatopoulos dans Godzilla.\\nIl est marié depuis 1997 à Sarah Jessica Parker."},{"page_url":"https://en.wikipedia.org/wiki/Outremont,_Quebec","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Maison_Bouthillier%2C_Outremont.jpg","page_title":"Outremont, Quebec","context_page_description":"Outremont is a residential borough of the city of Montreal, Quebec, Canada. It consists entirely of the former city on the Island of Montreal in southwestern Quebec. The neighbourhood is inhabited largely by Francophones, and is home to a Hasidic Jewish community."},{"page_url":"https://eu.wikipedia.org/wiki/Rio_de_Janeiro-Gale%C3%A3o_nazioarteko_aireportua","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Fila.jpg","page_title":"Rio de Janeiro-Galeão nazioarteko aireportua","context_page_description":"Rio de Janeiro-Galeão nazioarteko aireportua Rio de Janeiro hiria zerbitzatzen duen aireportua da.\\n2012an 17.495.737 pertsonek erabili zuten."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%98%D7%95%D7%A0%D7%99%D7%95_%D7%92%D7%95%D7%98%D7%A8%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Ant%C3%B3nio_Guterres_-_2019_%2848132270313%29_%28cropped%29.jpg","page_title":"אנטוניו גוטרש","context_page_description":"אנטוֹניוּ מנואל דה אוליביירה גוטרש הוא פוליטיקאי פורטוגלי, המכהן מ-1 בינואר 2017 כמזכ\\"ל האו\\"ם. בשנים 2005–2015 כיהן כנציב העליון של נציבות האו\\"ם לפליטים, וקודם לכן כיהן כראש ממשלת פורטוגל וכנשיא האינטרנציונל הסוציאליסטי."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AC%E3%83%B3%E3%83%88%E3%83%BB%E3%82%AF%E3%83%AA%E3%83%96%E3%83%AC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Brent_Clevlen.jpg","page_title":"ブレント・クリブレン","context_page_description":"ブレント・アーロン・クリブレンは、アメリカ合衆国・テキサス州オースティン出身のプロ野球選手。右投右打。アメリカン・アソシエーションのウィチタ・ウィングナッツ所属。"},{"page_url":"https://ceb.wikipedia.org/wiki/Tall_Umm_al_Athl","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/UmmAtlTemple1.jpg","page_title":"Tall Umm al Athl","context_page_description":"Bungtod ang Tall Umm al Athl sa Ehipto. Nahimutang ni sa lalawigan sa Muḩāfaz̧at al Fayyūm, sa sentro nga bahin sa nasod, 60 km sa habagatan sa Caire ang ulohan sa nasod. 19 metros ibabaw sa dagat kahaboga ang nahimutangan sa Tall Umm al Athl.\\nAng yuta palibot sa Tall Umm al Athl kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 71 ka metro ug 3.9 km sa amihanan sa Tall Umm al Athl. Kunhod pa sa 2 ka tawo kada kilometro kwadrado Hapit nalukop sa desiyerto ug kamingawan ang palibot sa Tall Umm al Athl. Ang kinadul-ang mas dakong lungsod mao ang Ţāmiyah, 9.0 km sa habagatan sa Tall Umm al Athl. Sa palibot sa Tall Umm al Athl. Sa rehiyon palibot sa Tall Umm al Athl, mga kanal talagsaon komon.\\nAng klima init nga kamadan. Ang kasarangang giiniton 26 °C. Ang kinainitan nga bulan Hulyo, sa 36 °C, ug ang kinabugnawan Enero, sa 15 °C. Ang kasarangang pag-ulan 41 milimetro matag tuig. Ang kinabasaan nga bulan Enero, sa 14 milimetro nga ulan, ug ang kinaugahan Abril, sa 1 milimetro."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B0%D0%B7%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B5_%D0%BF%D0%BE%D0%B2%D1%81%D1%82%D0%B0%D0%BD%D0%BD%D1%8F_(1916)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/%D0%9F%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82_%D0%BA_%D1%81%D1%82%D0%B0%D1%82%D1%8C%D0%B5_%C2%AB%D0%9A%D1%83%D1%80%D0%BE%D0%BF%D0%B0%D1%82%D0%BA%D0%B8%D0%BD%2C_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87%C2%BB._%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%8D%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F_%D0%A1%D1%8B%D1%82%D0%B8%D0%BD%D0%B0_%28%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%2C_1911-1915%29.jpg","page_title":"Центральноазійське повстання (1916)","context_page_description":"Центральноазійське повстання — національно-визвольне антиросійське повстання 1916 року проти колоніальної політики Російської імперії та колонізаторів. Перша велика колоніальна революція XX століття.\\nРозпочавшись із протесту проти набору до тилових частин діючої армії, рух переріс у національно-визвольне збройне повстання, що продовжувалось у деяких місцевостях кілька місяців та примусило владу для його придушення відтягти військові частини з фронту.\\nЗа весь час панування у середньоазійських колоніях Російська імперія не знала повстання такого розмаху.\\nРеволюційний вибух охопив 1916 року ряд районів Узбекистану, Киргизії, Казахстану і перекинувся на території повітів Сибіру, Нижнього Поволжя та Північного Кавказу."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_la_Conquista_de_las_Islas_Batanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Jos%C3%A9_Basco_y_Vargas.jpg","page_title":"Condado de la Conquista de las Islas Batanes","context_page_description":"El Condado de la Conquista de las Islas Batanes es un título nobiliario de la Corona de Castilla concedido el 21 de enero de 1789 por el rey Carlos IV de España a José Basco y Vargas, Brigadier de la Real Armada, por haber conquistado para la Corona Española el archipiélago de las Islas Batanes, situado al norte de las Islas Filipinas cerca de la Isla de Formosa. Fue el primer título concedido por Carlos IV."},{"page_url":"https://no.wikipedia.org/wiki/Fylkesvei_1654","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/FV1_Hedmark_x_FV213.jpg","page_title":"Fylkesvei 1654","context_page_description":"Fylkesvei 1654 går mellom Bergseng og Freng i Ringsaker kommune. Veiens lengde er 7,9 km.\\nFrem til 2019 hadde veien betegnelsen fylkesvei 1."},{"page_url":"https://pt.wikipedia.org/wiki/Claus_Schenk_Graf_von_Stauffenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Bundesarchiv_Bild_183-C0716-0046-003%2C_Claus_Schenk_Graf_v._Stauffenberg.jpg","page_title":"Claus Schenk Graf von Stauffenberg","context_page_description":"Claus Philipp Maria Schenk Graf von Stauffenberg foi um oficial do exército alemão mais conhecido por sua participação na liderança do Atentado de 20 de julho de 1944, que tentou assassinar Adolf Hitler e remover o Partido Nazista do poder. Junto com outros oficiais, como Henning von Tresckow e Hans Oster, ele era um das figuras centrais da Resistência Alemã dentro da Wehrmacht. Após o fracassado atentado contra Hitler, ele e outros conspiradores foram executados pelos nazistas."},{"page_url":"https://pt.wikipedia.org/wiki/Crucey-Villages","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Dreux-Louvilliers_Air_Base.jpg","page_title":"Crucey-Villages","context_page_description":"Crucey-Villages é uma comuna francesa na região administrativa do Centro, no departamento Eure-et-Loir. Estende-se por uma área de 44 km². Em 2010 a comuna tinha 475 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Sauble_Beach,_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Sauble.JPG","page_title":"Sauble Beach, Ontario","context_page_description":"Sauble Beach is a beach community and unincorporated area in the town of South Bruce Peninsula, Bruce County, in the northern area of southwestern Ontario, Canada. It is on the Bruce Peninsula, along the eastern shore of Lake Huron, on the north edge of the Saugeen Nation. The beach takes its name from that given by early French explorers to the sandy Sauble River, originally \\"La Rivière Au Sable\\" also indicating that the river emptied into Lake Huron at a sandy beach. The river was labelled with the French name on maps until 1881, when it became the Sauble River; in early years, a sawmill was built on the river, and later, a hydro electric plant."},{"page_url":"https://es.wikipedia.org/wiki/Cristina_de_Sajonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Dronning-Christine.jpg","page_title":"Cristina de Sajonia","context_page_description":"Cristina de Sajonia. Reina de Dinamarca tras su matrimonio con Juan I. Por la herencia de su cónyuge, se convirtió en reina de la Unión de Kalmar, que incluía también a Noruega y Suecia. Era la mayor de los hijos de Ernesto de Sajonia e Isabel de Baviera y hermana de Federico el prudente."},{"page_url":"https://war.wikipedia.org/wiki/Barleria_oenotheroides","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Gardenology.org-IMG_2652_rbgs11jan.jpg","page_title":"Barleria oenotheroides","context_page_description":"An Barleria oenotheroides in uska species han Magnoliopsida nga ginhulagway ni Dum.-cours.. An Barleria oenotheroides in nahilalakip ha genus nga Barleria, ngan familia nga Acanthaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://hu.wikipedia.org/wiki/Marigny-en-Orxois","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/MarignyPNG.png","page_title":"Marigny-en-Orxois","context_page_description":"Marigny-en-Orxois település Franciaországban, Aisne megyében. Lakosainak száma 473 fő. Marigny-en-Orxois Bézu-le-Guéry, Bussiares, Coupru, Gandelu, Lucy-le-Bocage, Montreuil-aux-Lions, Veuilly-la-Poterie és Dhuisy községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Ringreiten","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Ringridning.5.jpg","page_title":"Ringreiten","context_page_description":"Ringreiten ist ein Pferdesport, bei dem der Reiter einen kleinen Ring im Galopp mit einer Lanze aufspießen muss."},{"page_url":"https://pl.wikipedia.org/wiki/%C4%8Cierny_vrch_(1181_m)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Mal%C3%A1_Chochu%C4%BEa_panorama_NT4.jpg","page_title":"Čierny vrch (1181 m)","context_page_description":"Čierny vrch (1181 m) – szczyt w zachodniej części Niżnych Tatr na Słowacji. Wznosi się po południowej stronie zabudowań miejscowości Liptovská Lúžna. Jego południowe i zachodnie stoki opadają do doliny potoku Patočiny, południowe do doliny Lúžňanki, wschodnie do potoku Banské.\\nČierny vrch jest porośnięty lasem, ale na jego szczycie i podnóżach są polany – pozostałości dawnych hal i pól uprawnych miejscowości Liptovská Lúžna. W stokach północnych są duże skaliste partie, a na szczycie zamontowano przekaźnik telekomunikacyjny. Przez szczyt przebiega granica Parku Narodowego Niżne Tatry, w obrębie tego parku znajdują się północne zbocza Čiernego vrchu.\\nWschodnimi stokami Čiernego vrchu prowadzi szlak rowerowy od drogi nr 59 przez uzdrowisko Korytnica-kúpele do miejscowości Liptovská Lúžna."},{"page_url":"https://es.wikipedia.org/wiki/Bernard_J._S._Cahill","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cahill_butterfly_conformal_projection_SW.jpg","page_title":"Bernard J. S. Cahill","context_page_description":"Bernard Joseph Stanislaus Cahill, cartógrafo y arquitecto estadounidense, fue el inventor del \\"Mapa de Mariposa\\" octaédrico. Así mismo, diseñó hoteles, fábricas y mausoleos como el Columbario de San Francisco.\\nSu Mapa Mundial de Mariposa, como el mapa Dymaxion posterior de Buckminster Fuller de 1943 y 1954, permitió que todos los continentes fueran ininterrumpidos y con una fidelidad razonable a un globo. Cahill demostró este principio al inventar también un globo de pelota de goma que podría aplanarse debajo de un panel de vidrio en forma de \\"mariposa\\", y luego volver a su forma de bola.\\nGene Keyes desarrolló una variante en 1975, la proyección Cahill-Keyes."},{"page_url":"https://es.wikipedia.org/wiki/Gonzalo_Torrente_Ballester","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Estatua_Gonzalo_Torrente_Ballester_Cafe_Novelty_Salamanca.jpg","page_title":"Gonzalo Torrente Ballester","context_page_description":"Gonzalo Torrente Ballester ​ fue un profesor y literato español, uno de los más aclamados de su generación. Fue galardonado con el Premio Cervantes, el Premio Príncipe de Asturias de las Letras y el Premio Nacional de Narrativa."},{"page_url":"https://sv.wikipedia.org/wiki/Dunkers_kulturhus","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Dunkers_kulturhus_2.jpg","page_title":"Dunkers kulturhus","context_page_description":"Dunkers kulturhus är ett museum och konstcentrum beläget i Helsingborg, vid Norra hamnen. I huset, namngivet efter företagaren Henry Dunker som bekostade hela museet, finns stora utrymmen för utställningar, scenkonst och pedagogisk verksamhet för barn och ungdomar inom konst, musik, media, dans och teater. Huset rymmer också bar, restaurang och butik. Totalt har huset en yta på 16 000 m², med 10 600 m² verksamhetslokaler och 3 200 m² utställningsyta."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%89%E8%A7%92%E6%B9%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Sanying_Interchange.jpg","page_title":"三峽區","context_page_description":"三峡区，原名为三角涌为台湾新北市的市辖区之一，位于台北盆地的西南隅，三面环山，仅西北一隅面向大汉溪河谷平原，为新北市面积次大的行政区。东为新店区、乌来区，南为桃园市复兴区，西为桃园市大溪区，北为莺歌区、树林区、土城区。\\n三峡市区早期由于地处山麓地带，又有溪流汇集，市况一度甚为繁荣，直到日治时代后期均有船舶运输，码头地点约在目前祖师庙前的桥头位置，其后因沙石淤积而不再有航运之利，发展渐趋停顿，人口数也长期停滞。1997年“台北大学特定区”设立，龙埔地区一带因此人口增加发展成新兴社区，2009年三峡人口突破10万人，同年龙埔里行政调整为龙埔里、 龙学里、龙恩里。目前台北县政府在台北大学特定区东南侧规划新成立的“麦仔园城市规划区”及规划兴建捷运三莺线，不过预计要征收86公顷民地与农地，但可能造成2千人被迫搬迁而引发极大争议，引起龙埔居民们组成三峡龙埔里自救会居民多次到新北市政府前抗议表达强烈不满，新北市府也做出回应表示，麦仔园城市规划将暂缓实施。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%BA%A5%E7%89%B9%C2%B7%E6%AD%90%E6%A3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Matt_Olson.jpg","page_title":"麥特·歐森","context_page_description":"马修·肯特·欧森，为美国职棒大联盟奥克兰运动家的一垒手。"},{"page_url":"https://ro.wikipedia.org/wiki/Gertrude_de_Saxonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Gertrude_de_Saxe.png","page_title":"Gertrude de Saxonia","context_page_description":"Gertrude de Saxonia, cunoscută și ca Gertrude Billung, a fost fiica ducelui Bernard al II-lea de Saxonia cu Eilika de Schweinfurt.\\nGertrude s-a căsătorit cu contele Floris I de Olanda în jurul anului 1050, la moartea căruia fiul ei, Dirk al V-lea a devenit conte. Dat fiind că Dirk era încă prea tânăr, Gertrude a devenit regentă a comitatului.\\nCând Dirk al V-lea a venit la putere, episcopul William I de Utrecht, a ocupat unele teritorii pe care le revendica în Olanda. Gertrude și fiul ei s-au retras în insulele din Frizia și Zeelanda.\\nÎn 1063 Gertrude s-a recăsătorit cu Robert \\"Frizonul\\", cel de al doilea fiu al contelui Balduin al V-lea de Flandra."},{"page_url":"https://hu.wikipedia.org/wiki/Alte_Pinakothek","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Alte_Pinakothek_-_Room_XIII.JPG","page_title":"Alte Pinakothek","context_page_description":"Az Alte Pinakothek München nagy múltú képtára a Kunstareal területén, 1836-ban alapították."},{"page_url":"https://pt.wikipedia.org/wiki/Backstreet_Boys","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Skyline_of_Orlando%2C_9_Feb_2017.jpg","page_title":"Backstreet Boys","context_page_description":"Backstreet Boys é um grupo vocal masculino estadunidense formado em Orlando, Flórida em 1993. O grupo consiste nos integrantes AJ McLean, Howie Dorough, Nick Carter, Kevin Richardson e Brian Littrell. O grupo conquistou proeminência através de seu primeiro álbum de estúdio homônimo de 1996. No ano seguinte, lançou seu segundo álbum de estúdio, Backstreet's Back, juntamente com seu álbum de estreia auto-intitulado nos Estados Unidos, que prosseguiu com o êxito comercial do grupo em todo o mundo. O Backstreet Boys chegou ao estrelato com seu terceiro álbum de estúdio Millennium e seu álbum seguinte, Black & Blue.\\nApós uma pausa de dois anos, o grupo se reagrupou e lançou o álbum Never Gone em 2005. Após a conclusão de sua respectiva turnê musical de apoio, Never Gone Tour, em 2006, Richardson deixou o grupo para buscar outros interesses. O Backstreet Boys lançou dois álbuns como um quarteto: Unbreakable e This Is Us.\\nEm 2012, Richardson retornou ao grupo de forma permanente. No ano seguinte, o quinteto comemorou seu vigésimo aniversário e lançou seu primeiro álbum independente, In a World Like This."},{"page_url":"https://sk.wikipedia.org/wiki/Tupolev_Tu-160","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Air-to-air_with_a_Tupolev_Tu-160.jpg","page_title":"Tupolev Tu-160","context_page_description":"Tupolev Tu-160 je sovietsky, resp. ruský diaľkový strategický bombardér s meniteľnou geometriou krídel zo začiatku 80. rokov 20. storočia. Je to najťažší bombardér na svete.\\nPiloti volajú Tu-160 „biela labuť” – kvôli bielemu povrchovému náteru. Bombardér Tu-160 bol konštruovaný, s cieľom prekonať svojho amerického konkurenta B-1B Lancer."},{"page_url":"https://en.wikipedia.org/wiki/Aleksandar_Ma%C4%87a%C5%A1ev","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Joseph-Goebbels-TM.svg","page_title":"Aleksandar Maćašev","context_page_description":"Aleksandar Maćašev, born in 1971, is a Serbian artist and designer known for his controversial Joseph Goebbels project in which Joseph Goebbels was depicted as the father of contemporary media culture."},{"page_url":"https://en.wikipedia.org/wiki/Decatur,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Adams_County_Indiana_Incorporated_and_Unincorporated_areas_Decatur_Highlighted_1817074.svg","page_title":"Decatur, Indiana","context_page_description":"Decatur is a city in Root and Washington townships, Adams County, Indiana, United States. It is the county seat of Adams County. Decatur is home to Adams Memorial Hospital, which was designated as one of the \\"Top 100\\" Critical Access Hospitals in the United States. The population of Decatur was 9,405 at the 2010 census."},{"page_url":"https://tr.wikipedia.org/wiki/Sheffield","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Sheffield_Peace_Gardens.jpg","page_title":"Sheffield","context_page_description":"Sheffield, Birleşik Krallık'ta, İngiltere ülkesinde Yorkshire ve Humber bölgesinde bir büyük kentsel yerleşim birimidir. Yerel idare açısından krallık seremoni bakımından Törensel Güney Yorkshire Metropoliten Kontluğu'na bağlıdır. 1989'da \\"Güney Yorkshire Metropoliten Kontluğu\\"'nun lağvedilmesi sonucu tek-seviyeli yerel idare olan Sheffield Şehri Yerel İdaresi'nin idare merkezidir.\\nTarihsel olarak \\"Yorkshire East Riding\\" kontluğunun bir parçasıydı.\\nSheffield kenti 1893'te verilen Kraliçe Viktoriya beratıyla şerefsel \\"şehir\\" statüsü taşımaktadır. İngiltere'de 1974'te fiilen yerel idare reformu yapıldığı zaman şerefsel \\"şehir\\" statüsü o zaman ikinci-seviye metropoliten yerel bölge olarak kurulan \\"Sheffield City District Konseyi\\"'ne geçmiş ve 1989'dan sonra bu tek-seviyeli metropoliten borough olmuştur."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A1%B0%EC%84%A0_%EB%8B%A8%EC%A2%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%EC%98%81%EB%AA%A8%EC%A0%84_%EB%8B%A8%EC%A2%85_%EC%96%B4%EC%A7%84_2.jpg","page_title":"조선 단종","context_page_description":"단종은 조선의 제6대 왕이다. 본관은 전주 이씨이고, 휘는 홍위이다. 1455년 숙부 세조의 정변으로 양위하였다가, 세조 측근들의 탄핵으로 강원도 영월군 청령포로 유배되었다가 사사 혹은 교살 되었다.\\n폐위되어 죽어서 시호를 받지 못한 채 노산군으로 불리다가 이후 중종 때에 복권 상소가 올려졌으나 거절당했고, 숙종 대에 가서야 성리학자들의 건의로 노산대군으로 진봉되었다가, 다시 정종과 함께 복위되어, '예를 지키고 의를 잡는다' 라는 뜻의 단종으로 묘호가 정해졌으며, 정식 시호는 단종공의온문순정안장경순돈효대왕이다.\\n세종의 장남인 문종과 현덕왕후의 외아들이며, 조선 최초의 왕세손이기도 하다. 또한 조선왕조 27명의 임금들 중 유일하게 국장을 제 때 치르지 못한 왕이기도 하다. 승하한 지 550년 만인 2007년 5월에 단종의 능이 있는 강원도 영월에서 국장이 치뤄졌다."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BE%B3%E5%B3%B6%E7%9C%8C%E7%AB%8B%E5%9F%8E%E5%8D%97%E9%AB%98%E7%AD%89%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%E5%BE%B3%E5%B3%B6%E7%9C%8C%E7%AB%8B%E5%9F%8E%E5%8D%97%E9%AB%98%E7%AD%89%E5%AD%A6%E6%A0%A1.jpg","page_title":"徳島県立城南高等学校","context_page_description":"徳島県立城南高等学校は、徳島県徳島市城南町二丁目にある公立高等学校。"},{"page_url":"https://sl.wikipedia.org/wiki/Cement","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Cementarna_Trbovlje.jpg","page_title":"Cement","context_page_description":"Cement je hidravlično vezivo, ki se po hidrataciji strdi in veže. Ob tem iz cementne paste nastane trd cementni kamen, ki prenaša visoke tlačne obremenitve in je zato zelo primeren gradbeni material.\\nNajpomembnejši področji uporabe cementa sta proizvodnja malte in betona, kjer sta uporabljena kot lepilo naravnih ali umetnih agregatov, ki skupaj ustvarijo močan gradbeni material.\\n'Cement' so prvi uporabljali Egipčani, kasneje Grki in Babilonci. Uporabljali so ga tudi Rimljani, ki so mu dodajali vulkanski pepel, podobno vezivo kot cement pa so pri gradnji uporabljali še Azteki. Vezivo ni bil cement, ki ga uporabljamo danes, temveč je bilo osnovno vezivo apno. Ker je apno zračno vezivo in ne veže v vodi, so dodaljali razne hidravlične dodatke in tako dobili beton oz. Opus caementitium. Prvi cement v današnjem pomenu besede so lahko pridobili šele v začetku 19. stoletja, ko so lahko dosegli temperature okoli 1500 °C, kolikor je potrebno za pridobivanje."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D8%AF%D8%B1%D8%B2%D9%8A%DA%86_%D9%83%D8%B2%D9%8A%D8%B1%D9%88%D9%8A%D9%86%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Andrzej_Czerwi%C5%84ski_Sejm_2016.jpg","page_title":"اندرزيچ كزيروينسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاندرزيچ كزيروينسكى سياسى من بولاندا."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D9%88%D9%86%D9%8A%D8%B3%D9%84%D8%A7%D9%88_%D8%B2%D8%A7%D9%84%D9%8A%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE_%D1%81%D0%B5%D1%80%D0%B5%D0%B4_%D1%82%D0%BE%D0%B2%D0%B0%D1%80%D0%B8%D1%88%D1%96%D0%B2.jpg","page_title":"برونيسلاو زاليسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبرونيسلاو زاليسكى كان صحفى من بولاندا و بيلاروسيا."},{"page_url":"https://sl.wikipedia.org/wiki/Manneken_Pis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Brussel_MP_Dressed_Up.jpg","page_title":"Manneken Pis","context_page_description":"Manneken Pis je znamenita majhna bronasta skulptura v Bruslju, ki prikazuje golega dečka, ki lula v vodnjak. Zasnoval ga je Hiëronymus Duquesnoy starejši in je bil narejen leta 1618 ali 1619. Trenutni kip je iz leta 1965.\\nManneken Pis je zelo znan simbol Bruseljčanov. Upodablja njihov smisel za humor in njihovo neodvisnost misli."},{"page_url":"https://de.wikipedia.org/wiki/Kommission_Juncker","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/V%C4%9Bra_Jourov%C3%A1.jpg","page_title":"Kommission Juncker","context_page_description":"Die Kommission Juncker nahm am 1. November 2014 als Nachfolgerin der Kommission Barroso II ihre Arbeit auf. Sie ist die erste Europäische Kommission, zu der für das Amt des EU-Kommissionspräsidenten Spitzenkandidaten bei der Europawahl angetreten sind. Der Kommission gehören neben dem Präsidenten 27 Kommissare an. Sie wird geleitet vom Luxemburger Jean-Claude Juncker. Die neue Kommission ist erstmals in Cluster eingeteilt, bei denen ein Vizepräsident der Kommission ein bestimmtes Aufgabenfeld leitet, dem dann mehrere Kommissare angehören und deren Bereiche in das jeweilige Cluster fallen.\\nDas Europaparlament stimmte am 22. Oktober den veränderten Ernennungen zu. Bei den Anhörungen, die ab dem 29. September 2014 stattfanden, waren nicht alle der vorgeschlagenen Kommissare akzeptiert worden. Kurz darauf wurde die Kommission auch vom Rat bestätigt.\\nDie Amtszeit endet offiziell am 31. Oktober 2019. Für die Folge-Kommission wurde Ursula von der Leyen am 16. Juli 2019 auf Vorschlag des Europäischen Rates durch das Europaparlament zur Präsidentin der Europäischen Kommission gewählt."},{"page_url":"https://cs.wikipedia.org/wiki/Kv%C4%9Btnat%C3%A1_louka_(zahradnictv%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Calamagrostion_villosae5.JPG","page_title":"Květnatá louka (zahradnictví)","context_page_description":"Květnatá louka je termín označující v zahradnictví druhově pestrý trávník, méně intenzivně udržovaný než běžné trávníky. Ve stejném významu je používáno označení květinový trávník. Květnatá louka může napodobovat přirozená společenství bylin. Dodává zahradě snadno eleganci, kouzlo venkova nebo přirozenost přírody. Úprava označovaná jako květnatá louka zahrnuje širokou paletu kombinací druhů především s ohledem na podmínky stanoviště a účel. Odlišné složení tak vyžaduje obvykle odlišné ošetřování a tak i důkladnější znalost problematiky pícninářství, pedologie a fytocenologie.\\nV jiných případech nenapodobuje přirozená společenství bylin a účelem je vytvořit prostor s porostem kvetoucích rostlin jehož je louka pouze estetickým vzorem. Jde o stylizaci louky. V takových případech jde zejména o směs s okrasnými rostlinami a zahradními varietami.\\nBohatě kvetoucí louku nelze rychle založit z běžného trávníku pouhým omezením počtu pokosů, je třeba delší doby. Neúspěšná může být i snaha dosít trávník směsí semen pro květnaté louky. Obvykle je doporučováno založit trávník zcela znovu. Lze očekávat, že zcela výjimečnou funkci mohou mít květnaté trávníky ve veřejné zeleni."},{"page_url":"https://ceb.wikipedia.org/wiki/Phrynichidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Damon_diadema_003_L.D.jpg","page_title":"Phrynichidae","context_page_description":"Pamilya sa mga mananap nga kaka ang Phrynichidae. Ang Phrynichidae sakop sa labaw pamilya nga Phrynoidea, kahanay nga Amblypygi, klase nga mananap nga kaka, ka-ulo nga mananap nga dinugtongan, ug kaginharian nga mananap. Ang kabanay nga Phrynichidae pagsakop 34 espesye, segun Catalogue of Life.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://vi.wikipedia.org/wiki/Dendrobium_milaniae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Dendrobium_milaniae_Fessel_%26_L%C3%BCckel%2C_Orchidee_%28Hamburg%29_47-_A131_%281996%29_%2839067803235%29_-_cropped.jpg","page_title":"Dendrobium milaniae","context_page_description":"Dendrobium milaniae là một loài thực vật có hoa trong họ Lan. Loài này được Fessel & Lückel mô tả khoa học đầu tiên năm 1996."},{"page_url":"https://en.wikipedia.org/wiki/Hillman_Husky","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Hillman_Husky_Series_I_front.jpg","page_title":"Hillman Husky","context_page_description":"The Hillman Husky was a line of British passenger vehicles manufactured between 1954 and 1970 by Hillman."},{"page_url":"https://en.wikipedia.org/wiki/Chang_Jung_Christian_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/%E9%95%B7%E6%A6%AE%E5%A4%A7%E5%AD%B8%E8%A1%8C%E6%94%BF%E5%A4%A7%E6%A8%93.JPG","page_title":"Chang Jung Christian University","context_page_description":"Chang Jung Christian University is a privately funded, research-intensive, Presbyterian, co-educational university located in Gueiren District, Tainan, Taiwan. Chang Jung means everlasting glory in Mandarin."},{"page_url":"https://hu.wikipedia.org/wiki/%C5%BDuljana","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Crkva_u_%C5%BDuljani05869.JPG","page_title":"Žuljana","context_page_description":"Žuljana falu Horvátországban, Dubrovnik-Neretva megyében. Közigazgatásilag Stonhoz tartozik."},{"page_url":"https://sv.wikipedia.org/wiki/Rhodospatha_oblongata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rhodospatha_oblongata_Poepp._%26_Endl._%289047287545%29.jpg","page_title":"Rhodospatha oblongata","context_page_description":"Rhodospatha oblongata är en kallaväxtart som beskrevs av Eduard Friedrich Poeppig. Rhodospatha oblongata ingår i släktet Rhodospatha och familjen kallaväxter. Inga underarter finns listade."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/%D0%9D%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D1%80%D1%82.JPG","page_title":"Новоросійськ","context_page_description":"Новоросі́йськ — найбільший торговий порт Півдня Росії, у Краснодарському краї, на Кубані. Був заснований 1838 року. Населення — 251 013 осіб.\\nМісто розташоване в Цемеській бухті, одній з найзручніших у Чорному морі, яка не замерзає взимку. Бухта 15 км у довжину та 2 — 9 км завширшки, глибиною до 27 м, дозволяючи цим здійснювати вхід у порт кожному океанському судну. Бухта поділяє місто на східну і західну частини. На північному заході і південному заході місто оточене горами.\\nУ районі Новоросійська безліч гарних місць: Абрау-Дюрсо; Широка Балка.\\nУ літній період до міста приїжджають тисячі відпочивальників з північних регіонів Росії відпочивати, засмагати, пірнати і купатися."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%A5%D5%AF%D5%AB%D5%B6%D5%AB_%D5%B4%D5%A5%D5%BF%D6%80%D5%B8%D5%BA%D5%B8%D5%AC%D5%AB%D5%BF%D5%A5%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/%E9%AD%8F%E5%85%AC%E6%9D%91%E7%AB%99%E7%AB%99%E5%8F%B0.jpg","page_title":"Պեկինի մետրոպոլիտեն","context_page_description":"Պեկինի մետրոպոլիտեն, Չինաստանի մայրաքաղաք Պեկինում գտնվող մետրոպոլիտենի համակարգ։ Երկրի առաջին մետրոպոլիտենն է, որը սկսել է գործել 1969 թվականից և բուռն զարգացում է ապրել 20-րդ դարի վերջից։ Ըստ գծերի երկարության և ուղևորների քանակի՝ աշխարհում երկրորդ տեղն է զբաղեցնում, ինչպես նաև Մոսկվայի մետրոպոլիտենից հետո երկրորդն է՝ ըստ օրական ուղևորափոխադրումների։"},{"page_url":"https://simple.wikipedia.org/wiki/List_of_Renaissance_artists","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Elizabeth1.jpg","page_title":"List of Renaissance artists","context_page_description":"Renaissance artists ended in the late 14th century and includes famous painters and sculptors.\\nEach artist is listed with their dates, place of birth, some places that they worked, their media, one or two most famous works and some art galleries where their works can be seen."},{"page_url":"https://it.wikipedia.org/wiki/Neto","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Fiume_Neto_in_Sila.jpeg","page_title":"Neto","context_page_description":"Il fiume Neto è un fiume della Calabria, il secondo per lunghezza e portata di tutta la regione."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%8A%D1%80-%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D0%B5%D0%B4%D0%B0%D1%82%D0%B5%D0%BB_%D0%BD%D0%B0_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Mitsumasa_Yonai_smiling_cropped.jpg","page_title":"Министър-председател на Япония","context_page_description":null},{"page_url":"https://nl.wikipedia.org/wiki/Z%C3%BCndapp","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Z%C3%BCndapp_KS_50_WC_TT_1978.jpg","page_title":"Zündapp","context_page_description":"Zündapp is een historisch Duits merk van auto's, bromfietsen, grasmaaiers, naaimachines, rijdende mijnen en motorfietsen.\\nDe naam Zündapp is een samentrekking van de bedrijfsnaam Zünder-Apparatebau-Gesellschaft mbH Nürnberg.\\nDe bedrijfsnaam was vanaf 1919 Zündapp Gesellschaft für den Bau von Spezialmaschinen mbH, vanaf 1939 Zündapp-Werke GmbH, Neurenberg en München."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Segovia_-_02.jpg","page_title":"Сеговия","context_page_description":"Сего̀вия e град в Испания с население около 55 000 жители. Административен център е на едноименната провинция Сеговия в Кастилия и Леон. Сеговия е разположена на 90 км северозападно от Мадрид, на скалисто възвишение между реките Ересма и Кламорес. Заедно с Толедо и Авила е един от трите най-известни древни градове около Мадрид."},{"page_url":"https://no.wikipedia.org/wiki/NTNU_Universitetsbiblioteket","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/NTNU_UB_Fine_Art_Library_1.jpg","page_title":"NTNU Universitetsbiblioteket","context_page_description":"NTNU Universitetsbiblioteket er en del av Norges teknisk-naturvitenskapelige universitet.\\nBiblioteket ble etablert i 1996, da NTNU ble opprettet ved en omdanning av Universitetet i Trondheim.\\nNTNU UB bestod frem til 1996 av de tidligere enhetene Norges tekniske universitetsbibliotek; Universitetsbiblioteket i Trondheim og Medisinsk bibliotek og informasjonssenter. Den første tiden etter 1996 het biblioteket Universitetsbiblioteket i Trondheim, men fra 2010 ble NTNU Universitetsbiblioteket det offisielle navnet. Ved fusjonen mellom NTNU, Høgskolen i Gjøvik, Høgskolen i Sør-Trøndelag og Høgskolen i Ålesund, ble bibliotekene ved de tre høyskolene innlemmet i NTNU UB.\\nBiblioteket har røtter tilbake til Det Kongelige Norske Videnskabers Selskabs bibliotek fra 1768, og er dermed Norges eldste vitenskapelige bibliotek, som i dag finnes både som fysisk bibliotek og e-bibliotek.\\nNTNU UBs primærbrukere er studenter og ansatte ved NTNU, men det er et offentlig bibliotek og alle som ikke får dekket sine litteraturbehov ved folke-, skole- eller andre bibliotek, kan låne fra bibliotekets samlinger.\\nBiblioteket har oppgaver som støtter forskning, undervisning, nyskaping og formidling ved NTNU."},{"page_url":"https://fi.wikipedia.org/wiki/Mihail_Eisenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Mikhail-einsenstein-0713-01.jpg","page_title":"Mihail Eisenstein","context_page_description":"Mihail Osipovich Eisenstein oli Riiassa vaikuttanut baltiansaksalainen art nouveau -arkkitehti ja insinööri. Koska Eisenstein kääntyi juutalaisuudesta ortodoksisuuteen ja vaikutti Venäjällä, mutta oli silti taustaltaan saksalainen, hänet määritellään usein sekä venäläiseksi, saksalaiseksi että juutalaiseksi. Hänen poikansa Sergei Eisenstein oli neuvostoliittolainen elokuvaohjaaja."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%80%91%E5%B8%83%E9%98%B2%E7%A9%BA%E7%81%AB%E7%AE%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Bundesarchiv_Bild_141-1898%2C_Peenem%C3%BCnde%2C_Start_Fla-Rakete_%22Wasserfall%22.jpg","page_title":"瀑布防空火箭","context_page_description":"瀑布防空火箭 是纳粹德国于第二次世界大战发明及生产的一种超音速地对空导弹。以当时的技术而言为一项划时代的尝试，但由于技术所限及战争后期德国资源愈趋贫乏，开发项目最终未能完成。\\n1945年纳粹德国最终战败，苏联缴获了瀑布防空火箭的相关技术，并于后来发展出其第一代防空导弹，即S-25/SA-1地对空导弹。美国亦同样基于瀑布防空火箭，应用于其爱玛士导弹计划中的地对空导弹分型之上。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D1%80%D0%BE%D0%BD%D0%B5_(%D0%B0%D0%B1%D0%B1%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Thoronet_Interior.jpg","page_title":"Тороне (аббатство)","context_page_description":"Тороне́ — цистерцианское аббатство во Франции, в Провансе, расположенное между городами Драгиньян и Бриньоль. Памятник романской архитектуры XII века. Монастыри Тороне, Сенанк и Сильвакан — три наиболее известных цистерцианских аббатства Прованса и часто называются «три провансальские сестры». Монастырь основан в 1157 году, закрыт в 1785 году. В настоящее время в аббатстве располагается музей."},{"page_url":"https://tr.wikipedia.org/wiki/Mavi_Durum_muharebe_d%C3%BCzeni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Ww2_map22_May7_July_1942.jpg","page_title":"Mavi Durum muharebe düzeni","context_page_description":"Mavi Durum muharebe düzeni:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Friedrich_Sellow_Bahia.jpg","page_title":"Баия","context_page_description":"Баи́я — один из 26 штатов Бразилии, расположенный на востоке страны на побережье Атлантического океана.\\nШтат Баия занимает четвёртое место в Бразилии по численности населения и пятое место по площади. Административный центр — город Салвадор — расположен на месте, где Бухта всех Святых соединяется с Атлантическим океаном."},{"page_url":"https://ca.wikipedia.org/wiki/Gegants_de_la_Seu_d%27Urgell","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Festa_major_de_la_Seu_d%27Urgell.JPG","page_title":"Gegants de la Seu d'Urgell","context_page_description":"Els Gegants de la Seu d'Urgell són dues parelles de gegants de la ciutat de la Seu d'Urgell, a l'Alt Urgell. Estan formats per quatre gegants, la parella més antiga construïda a la Casa Paquita de Barcelona data del 1943 i s'anomenen Abd al-Ramhan i Constança i representen a un rei moro i una vescomtesa de Castellbò. Els gegants nous van ser creats al taller Sarandaca de Granollers i són anomenats Ot i Urgell. Van ser estrenats l'any 2005 i van adoptar els noms dels patrons del poble. Ells, seguint la línea dels gegants vells volen representar una bella dama de la noblesa i un jove trobador els quals es diu que van tenir una troballa en el Castell de la Seu d'Urgell d'amagat per després fer públic el seu amor davant de tota la població Urgellenca. Cal afegir que aquests gegants han canviat de vestuari en una ocasió, l'any 2017.\\nEl 2009 van ser convidats a l’Aplec Internacional de la Sardana i Mostra de Grups Folklòrics a Luxemburg com també ho van ser l'any 2011 a la Ciutat de Grenoble. La Colla Gegantera i Grallera de la Seu d'Urgell és la colla que va acollir la Ciutat Gegantera de Catalunya 2011 on un centenar de colles geganteres hi van participar."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%A2%D7%93%D7%AA_%D7%94%D7%9E%D7%93%D7%A2_%D7%95%D7%94%D7%98%D7%9B%D7%A0%D7%95%D7%9C%D7%95%D7%92%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Binyamin_Elon.jpg","page_title":"ועדת המדע והטכנולוגיה","context_page_description":"ועדת המדע והטכנולוגיה של הכנסת עוסקת בענייני מחקר ופיתוח מדעי וטכנולוגי.\\nכבר בשנת 1973 ביקש חבר הכנסת מרדכי ביבי להקים ועדה למדע וטכנולוגיה, אולם מבוקשו לא ניתן לו.\\nהוועדה הוקמה בשנת 1997, במהלך כהונת הכנסת הארבע עשרה, תחת השם \\"הוועדה לענייני מחקר ופיתוח מדעי וטכנולוגי\\".\\nתחומי עיסוקה של הוועדה הם: מדיניות מחקר ופיתוח אזרחי בישראל, טכנולוגיות מתקדמות, מחקר ופיתוח סביבתי, מחקר מדעי באקדמיה הישראלית למדעים, מחקר מדעי שלא במוסדות להשכלה גבוהה, מכוני מחקר, מדענים ראשיים של כלל משרדי הממשלה, מועצה לאומית למחקר ולפיתוח, קרנות מחקר, מידע. כמו כן משולבת פעילות הוועדה בדיונים הנערכים בוועדות הכנסת השונות בכל הנוגע למחקר ופיתוח בתחומי תשתיות, בריאות, השכלה גבוהה, קליטת מדענים עולים ונושאים אחרים.\\nבשנת 2003 הוחלף שם הוועדה לשמה הנוכחי - ועדת המדע והטכנולוגיה.\\nלוועדה שתי ועדות משנה:\\nועדת משנה לנושא החלל\\nועדת משנה לקידום טכנולוגיות לאנרגיה מתחדשת - פיקוח ומעקב אחר יישום החלטות ועידת פריז"},{"page_url":"https://war.wikipedia.org/wiki/Futbol","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/CH-AL_Geneva_2003-06-11.jpg","page_title":"Futbol","context_page_description":"An futbol o futból nga tinatawag gihapon nga soccer usa nga Paugnat-ha-Kusog nga ginmumulayan han duha ka kampo nga mayda napulo kag-usa nga magmurulay kada kampo. Damo an nayakan nga amo ini an gisisikati nga Paugnatay-ha-Kusog."},{"page_url":"https://de.wikipedia.org/wiki/Nullebene","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Ansicht_Nullebene.svg","page_title":"Nullebene","context_page_description":"Nullebene ist ein Begriff aus der Bautechnik und bezeichnet die Ebene, auf die bei der Bemaßung von Entwurfs- und Ausführungsplänen für Gebäude und sonstige Bauwerke in der Vertikalen Bezug genommen wird. Häufig ist sie identisch mit der Oberkante Fertigfußboden des Erdgeschosses und wird angegeben als Höhe über dem Meeresspiegel oder als Höhe über einem Referenzpunkt wie etwa der Straßenmitte."},{"page_url":"https://en.wikipedia.org/wiki/Francis_Octavius_Bedford","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Former_St_George%27s_Church%2C_Wells_Way%2C_Camberwell%2C_London_%28IoE_Code_471458%29.JPG","page_title":"Francis Octavius Bedford","context_page_description":"Francis Octavius Bedford was an English ecclesiastical architect, who designed four Greek Revival churches in south London during the 1820s. He later worked in the Gothic style."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D1%85%D0%B7%D0%B0%D0%B4,_%D0%A4%D0%B0%D0%B9%D0%B7%D0%B0%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Amd_mug_faisal-shahzad.jpg","page_title":"Шахзад, Файзал","context_page_description":"Файсал Шахзад — американский террорист пакистанского происхождения, приговорённый к пожизненному заключению за попытку теракта на Таймс-Сквер 1 мая 2010."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Le_P%C3%A2quier_(Fribourg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Le_P%C3%A2quier-Montbarry_%28Le_P%C3%A2quier_%28Fribourg%29%29_%28autumn%29_4.JPG","page_title":"Le Pâquier (Fribourg)","context_page_description":"Le Pâquier sī Sūi-se Fribourg Chiu Gruyère Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://it.wikipedia.org/wiki/Dipartimento_di_Calingasta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Departamento_Calingasta_%28San_Juan_-_Argentina%29.png","page_title":"Dipartimento di Calingasta","context_page_description":"Calingasta è un dipartimento argentino, situato nella parte sud-occidentale della provincia di San Juan, con capoluogo Tamberías.\\nFondato il 17 dicembre 1869, esso confina a nord con il dipartimento di Iglesia, a est con quelli di Sarmiento, Zonda e Ullum; a sud con la provincia di Mendoza e ad ovest con la repubblica del Cile.\\nSecondo il censimento del 2001, su un territorio di 22.589 km², la popolazione ammontava a 8.176 abitanti.\\nDal punto di vista amministrativo, il dipartimento consta di un unico municipio, che copre tutto il territorio dipartimentale, suddiviso in diverse localidades:\\nBarreal\\nCalingasta\\nTamberías, sede municipale\\nVilla Pituil"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%81%D1%82_%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B8_%D0%84%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B8_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Queen_Elizabeth_II_Bridge%2C_Dartford%2C_England_-_Feb_2009.jpg","page_title":"Міст Королеви Єлизавети II","context_page_description":"Міст королеви Єлизавети II англ. Queen Elizabeth II Bridge — вантовий автодорожній міст через річку Темзу в Дартфорді, графство Кент, Англія. Поєднує Дартфорд з адміністративною одиницею Таррек графства Ессекс. Є частиною автомобільної дороги А282. Найсхідніший міст через Темзу. На момент відкриття це був найдовший вантовий міст Європи, а з 1996 є другим за величиною у Великій Британії, після Другого Севернського мосту."},{"page_url":"https://war.wikipedia.org/wiki/Ernassa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Ernassa_sanguinolenta_MHNT_dos.jpg","page_title":"Ernassa","context_page_description":"An Ernassa in uska genus han Lepidoptera. An Ernassa in nahilalakip ha familia nga Arctiidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://ms.wikipedia.org/wiki/Saya_Mempunyai_Impian","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Civil_Rights_March_on_Washington%2C_D.C._%28Dr._Martin_Luther_King%2C_Jr._and_Mathew_Ahmann_in_a_crowd.%29_-_NARA_-_542015_-_Restoration.jpg","page_title":"Saya Mempunyai Impian","context_page_description":"\\"Saya Mempunyai Impian\\" ialah suatu ceramah umum yang disampaikan oleh aktivis hak asasi Amerika Syarikat Martin Luther King, Jr. pada 28 Ogos 1963, di mana beliau menyeru penamatan rasisme di Amerika Syarikat. Disampaikan kepada lebih 250,000 penyokong hak awam dari anak tangga Memorial Lincoln semasa Perarakan di Washington untuk Pekerjaan dan Kebebasan, ucapan itu merupakan saat penting Gerakan Hak Awam Afrika-Amerika.\\nUcapan ini diletakkan sebagai ucapan terbaik A.S. abad ke-20 melalui suatu tinjauan pendapat sarjana 1999 terhadap ucapan umum. Pada tahun 2004, Perpustakaan Kongres Amerika Syarikat mengabadikan pidato ini dalam Registrar Rakaman Nasional negara tersebut.I"},{"page_url":"https://en.wikipedia.org/wiki/Guillaume_Thierry","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Guigui1.jpg","page_title":"Guillaume Thierry","context_page_description":"Guillaume Thierry is a track and field athlete from the Republic of Mauritius. He first represented his country at pole vault in which he competed at the 2003 World Youth Championships in Athletics held in Sherbrooke, Canada. He now competes in the decathlon and holds the Mauritian national record set on 11–12 September 2013 in Nice, France at the VII Francophone Games. He is the first Mauritian ever to score more than 7000 points in this event."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7%D8%B1%D9%8A_%D9%8A%D8%A7%D9%86%D8%B3%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Larry_Jansen_1953.jpg","page_title":"لاري يانسن","context_page_description":"لاري يانسن ‏ هو لاعب كرة قاعدة أمريكي، ولد في 16 يوليو 1920 في Verboort في الولايات المتحدة، وتوفي بنفس المكان في 10 أكتوبر 2009."},{"page_url":"https://en.wikipedia.org/wiki/World_War_II_in_Albania","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Map_of_Albania_during_WWII.png","page_title":"World War II in Albania","context_page_description":"In Albania, World War II began with its invasion by Italy in April 1939. Fascist Italy set up Albania as its protectorate or puppet state. The resistance was largely carried out by Communist groups against the Italian and then German occupation in Albania. At first independent, the Communist groups united in the beginning of 1942, which ultimately led to the successful liberation of the country in 1944.\\nThe Center for Relief to Civilian Populations reported that Albania was one of the most devastated countries in Europe. 60,000 houses were destroyed and about 10% of the population was left homeless."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B6%D1%83%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D1%85%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_%D0%BF%D0%BE%D1%82%D0%B5%D1%88%D0%BD%D1%8B%D1%85_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA_%D0%9F%D0%B5%D1%82%D1%80%D0%B0_I_%D0%BF%D0%BE%D0%B4_%D1%81%D0%B5%D0%BB%D0%BE%D0%BC_%D0%9A%D0%BE%D0%B6%D1%83%D1%85%D0%BE%D0%B2%D0%BE.jpg","page_title":"Кожуховский поход","context_page_description":"Кожуховский поход, или Большой потешный поход Кожуховский — крепостные манёвры русских войск, организованные Петром I со своими сподвижниками у села Кожухова, которое находилось в 4-х верстах от Москвы справа от Коломенской дороги неподалеку от Симонова монастыря, на правом берегу реки Москвы. Пётр I принял в маневрах самое деятельное участие в звании бомбардира Преображенского полка.\\nКожуховский поход был фактически первыми крупными инженерными военными учениями в истории России. Поход показал отдельные преимущества полков «нового строя» и вскрыл необходимость проведения военной реформы в русском государстве. Его опыт был использован в Азовских походах 1695—1696 годов и последующих военных кампаниях.\\n\\"Об екзерцициях военных можем сказать, что были весьма к прогрессу обучения его величеству и всем молодым людям. Напомню о той потехе, которая была под Кожуховым в Коломенских лугах, о которой могу сказать, что едва какой монарх в Европе может учинить лучше.\\n— Князь Б. И. Куракин. Гистории о царе Петре Алексеевиче и ближних к нему людях."},{"page_url":"https://pt.wikipedia.org/wiki/Aprigliano","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Aprigliano_fc.jpg","page_title":"Aprigliano","context_page_description":"Aprigliano é uma comuna italiana da região da Calábria, província de Cosenza, com cerca de 2.833 habitantes. Estende-se por uma área de 121 km², tendo uma densidade populacional de 23 hab/km². Faz fronteira com Cellara, Cosenza, Figline Vegliaturo, Parenti, Pedace, Piane Crati, Pietrafitta, Rogliano, San Giovanni in Fiore, Santo Stefano di Rogliano, Taverna."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%B0_%D0%9F%D0%B0%D0%B7%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Grb-StaraPazova.JPG","page_title":"Стара Пазова","context_page_description":"Стара Пазова — град и општина во Сремскиот округ во Војводина, Србија. Според пописот од 2011 година, во градот живеат 18,602 жители, додека во истоимената општина живеат 65,792 жители."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Gnas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Gnas_Pfarrhof_CIMG1123.JPG","page_title":"Liste der denkmalgeschützten Objekte in Gnas","context_page_description":"Die Liste der denkmalgeschützten Objekte in Gnas enthält die 21 denkmalgeschützten, unbeweglichen Objekte der österreichischen Gemeinde Gnas im steirischen Bezirk Südoststeiermark."},{"page_url":"https://sk.wikipedia.org/wiki/Uganda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ug-map.png","page_title":"Uganda","context_page_description":"Uganda, dlhý tvar Ugandská republika, je prezidentská republika, nachádzajúca sa vo východnej Afrike, ktorá hraničí s Južným Sudánom na severe, s Keňou na východe, s Demokratickou republikou Kongo na západe, s Rwandou na juhozápade a s Tanzániou na juhu. Súčasťou Ugandy je aj nezanedbateľná časť Viktóriinho jazera, ktorým tiež prechádzajú hranice s Keňou a Tanzániou. Uganda má rozlohu 241 038 km² a žije tu viac ako 30 miliónov ľudí. Z toho 50% sú deti do 14 rokov. Názov Ugandy je odvodený z názvu tradičného kráľovstva Buganda, ktorého súčasťou je južná časť krajiny vrátane hlavného mesta Kampala."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%B0%D0%B1%D0%B0%D0%BD%D1%89%D0%B8%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/03_368_Book_illustrations_of_Historical_description_of_the_clothes_and_weapons_of_Russian_troops.jpg","page_title":"Барабанщик","context_page_description":"Бараба́нщик — музыкант, играющий на ударных музыкальных инструментах и, в частности, на барабане или военно-учётная специальность в вооружённых силах.\\nВ музыкальном профессиональном лексиконе барабанщиками чаще всего называют музыкантов, специализирующихся на ударной установке."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BD%D0%B5%D1%80%D0%B8%D1%84%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/AlonsoFernandezdeLugo2.JPG","page_title":"Тенерифе","context_page_description":"Тенери́фе — самый крупный остров в составе архипелага из семи Канарских островов в Атлантическом океане. С относительно небольшой площадью в 2034,38 км² и населением в 906 800 человек, что составляет 43 % численности населения всего архипелага, он является самым населённым в Испании. Он занимает центральное положение относительно островов архипелага и вместе с тремя соседними островами Пальма, Гомера и Иерро входит в состав провинции Санта-Крус-де-Тенерифе с административным центром в одноимённом городе."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Wa%C5%BCne_M%C5%82yny","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Wa%C5%BCne_M%C5%82yny.JPG","page_title":"Station Ważne Młyny","context_page_description":"Station Ważne Młyny is een spoorwegstation in de Poolse plaats Ważne Młyny."},{"page_url":"https://eu.wikipedia.org/wiki/Cyrtodactylus_gordongekkoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Cyrtodactylus_gordongekkoi_distribution.png","page_title":"Cyrtodactylus gordongekkoi","context_page_description":"Cyrtodactylus gordongekkoi Cyrtodactylus generoko animalia da. Narrastien barruko Gekkonidae familian sailkatuta dago."},{"page_url":"https://fr.wikipedia.org/wiki/Marc_Eemans","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Marc.Eemans1930.jpg","page_title":"Marc Eemans","context_page_description":"Marc Eemans"},{"page_url":"https://en.wikipedia.org/wiki/Canadian_Charter_of_Rights_and_Freedoms","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Pierre_Elliot_Trudeau-2.jpg","page_title":"Canadian Charter of Rights and Freedoms","context_page_description":"The Canadian Charter of Rights and Freedoms, often simply referred to as the Charter in Canada, is a bill of rights entrenched in the Constitution of Canada, forming the first part of the Constitution Act, 1982. The Charter guarantees certain political rights to Canadian citizens and civil rights of everyone in Canada from the policies and actions of all areas and levels of the government. It is designed to unify Canadians around a set of principles that embody those rights. The Charter was signed into law by Queen Elizabeth II of Canada on April 17, 1982, along with the rest of the Act.\\nThe Charter was preceded by the Canadian Bill of Rights, enacted in 1960, which was only a federal statute rather than a constitutional document. As a federal statute, the Bill could be amended through the ordinary legislative process and had no application to provincial laws. The Supreme Court of Canada also narrowly interpreted the Bill of Rights, showing reluctance to declare laws inoperative. The relative ineffectiveness of the Canadian Bill of Rights motivated many to improve rights protections in Canada."},{"page_url":"https://en.wikipedia.org/wiki/James_T._Conway","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Gen_James_Terry_Conway_June_2005.jpg","page_title":"James T. Conway","context_page_description":"James Terry Conway is a retired United States Marine Corps general who served as the 34th Commandant of the Marine Corps. Among his previous postings were Director of Operations on the Joint Chiefs of Staff, Commanding General of 1st Marine Division and I Marine Expeditionary Force, taking part in the 2003 invasion of Iraq and the First Battle of Fallujah."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Shel%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Volkhov-Ilmen.png","page_title":"Río Shelón","context_page_description":"El río Shelón es un corto río de la parte noroccidental de la Rusia europea, uno de los principales afluentes del lago Ilmen. Tiene una longitud de 248 km y drena una cuenca de 9.710 km².\\nAdministrativamente, el río discurre por el por el óblast de Pskov y el óblast de Nóvgorod de la Federación de Rusia."},{"page_url":"https://mg.wikipedia.org/wiki/Gurbanguly_Berdimuhamedow","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Gurbanguly.jpg","page_title":"Gurbanguly Berdimuhamedow","context_page_description":"Gurbanguly Berdimuhamedow dia mpanao politika, mpitsabo nify, Dokotera teraka ny 29 Jiona 1957"},{"page_url":"https://de.wikipedia.org/wiki/St._Ingbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/St._Ingbert_Fu%C3%9Fg%C3%A4ngerzone.JPG","page_title":"St. Ingbert","context_page_description":"Die Mittelstadt St. Ingbert ist die fünftgrößte Stadt im Saarland.\\nDas Stadtgebiet umfasst die Stadtteile St. Ingbert-Mitte, Rohrbach, Hassel, Oberwürzbach und Rentrisch."},{"page_url":"https://az.wikipedia.org/wiki/Mirz%C9%99_Q%C9%99dim_%C4%B0r%C9%99vaninin_%C9%99s%C9%99rl%C9%99rinin_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Warrior_by_Irevani.jpg","page_title":"Mirzə Qədim İrəvaninin əsərlərinin siyahısı","context_page_description":"XIX əsr Azərbaycan rəssamı Mirzə Qədim İrəvaninin yaradıcılıq irsinə portretlər, rəsm-trafaretlər, divar rəsmləri, zinət əşyaları və şüşə üzərində rəsmlər daxildir. Yalnız üç ölkənin - Azərbaycan, Gürcüstan və Rusiya - muzeyləri öz kolleksiyalarında İrəvaninin əsərlərini saxlayır. Aşağıdakı siyahının tərtib edilməsi zamanı istifadə edilmiş əsas mənbə Natalya Miklaşevskaya tərəfindən yazılmış və \\"Azərbaycan incəsənəti\\" toplusunda çap edilmiş \\"XIX əsr rəssamları: Mirzə Qədim İrəvani və Mir Möhsün Nəvvab\\" adlı məqalə olmuşdur. Məqalədə İrəvaninin 23 əsəri haqqında məlumat verilir ki, onlardan da iyirmisi Azərbaycan Milli İncəsənət Muzeyində, ikisi Ermitajda, biri isə Gürcüstan Dövlət İncəsənət Muzeyində saxlanılır. Həmçinin məqalədə XIX əsrin 50-ci illərində İrəvandakı Sərdar sarayı üçün çəkilmiş və hazırda Güsrcüstan Dövlət Muzeyində saxlanan bir neçə böyük portretdə İrəvaninin imzasının olması təsdiq edilir."},{"page_url":"https://sq.wikipedia.org/wiki/Qarku_i_Beratit","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Berat.jpg","page_title":"Qarku i Beratit","context_page_description":"Qarku i Beratit është një nga 12 qarqet në Shqipëri me një sipërfaqje prej 1,798 km². ISO 3166-2-Code është AL-01. Qarku i Beratit i përfshin rrethin e Beratit, rrethin e Kuçovës dhe rrethin e Skraparit.\\nQendra e Qarkut të Beratit ndodhet në qytetin e Beratit. Qarku i Beratit është i vetmi qark që nuk ka dalje në det dhe nuk kufizohet as me ndonjë shtet tjetër. Qarku i Beratit kufizohet në veri me Qarkun e Elbasanit, në perëndim me Qarkun e Fierit, në Jug me Qarkun e Gjirokastrës dhe në Lindje me Qarkun e Korçës. Qytetet e këtij qarku janë Berati, Kuçova, Çorovoda, Poliçani dhe Ura Vajgurore. Qarku i Beratit ka një popullsi prej 131,942 banorë."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D0%BD%D1%82%D1%83_%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D1%81_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Fortaleza_Int%27l_Airport_%28FOR%29_3.jpg","page_title":"Пинту Мартинс (аэропорт)","context_page_description":"Международный аэропорт Пинту Мартинс также известен под названием Международный аэропорт Форталезы — аэропорт, расположенный в городе Форталеза, штат Сеара.\\nВ 2008 году аэропорт обслужил 3 465 791 пассажира и 47 703 рейсов, занимает 11-е место среди самых загруженных аэропортов Бразилии с точки зрения пассажирооборота."},{"page_url":"https://es.wikipedia.org/wiki/BMW_3.0_CSL","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/BMW_2000_CS_champagne_vr.jpg","page_title":"BMW 3.0 CSL","context_page_description":"A principio de los años sesenta se creó el Campeonato de Europa de Turismos, dicho campeonato alcanzó pronto un gran éxito con lo que numerosos fabricantes mostraron interés por el mismo. El arma definitiva de BMW para afrontar dicho reto fue el BMW 3.0 CSL. Derivaba del coupé CS 3.0, un elegante y rápido deportivo al que se sometió a una importante cura de adelgazamiento. Con ello se consiguió un excelente automóvil capaz de circular legalmente por carretera abierta o de triunfar en los circuitos más exigentes."},{"page_url":"https://it.wikipedia.org/wiki/Segnaletica_stradale_nella_Repubblica_Ceca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/C10acr.jpg","page_title":"Segnaletica stradale nella Repubblica Ceca","context_page_description":"I segnali stradali nella Repubblica Ceca sono regolati dal decreto legge n. 30 del 2001 e sono decretati congiuntamente dal ministero dei lavori pubblici ceco e dalla polizia. Sono installati lungo il ciglio della strada sul lato destro della carreggiata e sono suddivisi in segnali di pericolo, di precedenza, di divieto e restrizione, di obbligo, di regolazione stradale, di indicazione, di aiuto alla guida e pannelli integrativi.\\nSe vi è del testo nei segnali, questo è in lingua ceca, senza traduzioni in altre lingue. La maggior parte dei segnali sono basati su disegni come nella maggior parte dei Paesi europei, eccezion fatta per quelli con scritte come il segnale di Fermarsi e dare precedenza o quello di Dogana.\\nAgli incroci non regolati da segnaletica stradale o semafori vige la regola generale di dare la precedenza ai veicoli provenienti da destra, a meno che non sia altrimenti specificato."},{"page_url":"https://sv.wikipedia.org/wiki/Brit_Sandaune","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Brit_Sandaune_seriemester_2003.jpg","page_title":"Brit Sandaune","context_page_description":"Brit Sandaune, född den 5 juni 1972 i Skatval, Norge, är en norsk fotbollsspelare. Vid fotbollsturneringen under OS 2000 i Sydney deltog hon i det norska lag som tog guld."},{"page_url":"https://en.wikipedia.org/wiki/List_of_MPs_elected_in_the_1886_United_Kingdom_general_election","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Campbell-bannerman.jpg","page_title":"List of MPs elected in the 1886 United Kingdom general election","context_page_description":"This is a list of Members of Parliament elected to the 24th Parliament of the United Kingdom at the 1886 general election, held over several days from 1 July to 27 July 1886.\\nNotable newcomers to the House of Commons included H. H. Asquith and George Curzon."},{"page_url":"https://ro.wikipedia.org/wiki/21_martie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Code_Civil_1804.png","page_title":"21 martie","context_page_description":"21 martie este a 80-a zi a calendarului gregorian."},{"page_url":"https://de.wikipedia.org/wiki/Nelken","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Dianthus_gratianopolitanus0.jpg","page_title":"Nelken","context_page_description":"Die Nelken bilden eine Pflanzengattung in der Familie der Nelkengewächse. Die 320 bis 600 Arten kommen in den gemäßigten Gebieten der Nordhalbkugel vor."},{"page_url":"https://pt.wikipedia.org/wiki/San_Mango_d%27Aquino","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Panorama_San_Mango_D%27Aquino.jpg","page_title":"San Mango d'Aquino","context_page_description":"San Mango d'Aquino é uma comuna italiana da região da Calábria, província de Catanzaro, com cerca de 1.864 habitantes. Estende-se por uma área de 6 km², tendo uma densidade populacional de 311 hab/km². Faz fronteira com Cleto, Martirano Lombardo, Nocera Terinese."},{"page_url":"https://eu.wikipedia.org/wiki/Zintzarrotsak","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Figaro_wedding_02.jpg","page_title":"Zintzarrotsak","context_page_description":"Zintzarrotsak, toberak edo xaribariak Europa osoan zehar egin izan den ohitura da. Erregimen Zaharrean ohiturak mantentzeko eta epaiketa moralak egiteko erabiltzen ziren, baina denborarekin, salaketak egiteaz gain, herri antzerki edo ohitura etnografiko ere bilakatu dira. Zintzarrotsetan jendetzak ahalik eta zarata gehien egin nahi zuenez, zintzarririk izan ezean lapikoak eta zartaginak joz edo eskuz iritsitako edozer gauzaz desfilatzen zuten.\\nOro har, desfileak hiru motatakoak ziren: lehenengoan, gehienetan formarik bortitzena, gaizkile bat edo gaizkile batzuk etxetik edo lantokitik eraman zitezkeen, eta indarrez desfilatzen zuten komunitate batean zehar. Prozesuan, jendetzak iseka egiten zien, jazarriak izan zitezkeen eta, sarritan, biktima bat edo batzuk jarduketen amaieran uretara jaurtitzen ziren. Modu seguruagoa zen gaizkilearen bizilagun batek biktimatzat jotzea, kaleetatik eramaten zuten bitartean, askotan asto baten gainean. Jakina, imitatzaileak ez zuen zigorrik jasotzen, eta sarritan oihu egiten edo kantatzen zituen izkinako bertsoak, gaizkileari iseka eginez."},{"page_url":"https://no.wikipedia.org/wiki/J%C3%B8rn_Lande","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Jorn_live_at_Brewhouse_-_G%C3%B6teborg.jpg","page_title":"Jørn Lande","context_page_description":"Jørn Marumsrud Lande er en norsk heavy metal-vokalist best kjent som Jørn Lande eller Jorn.\\nLande er mest kjent som vokalist i det tyske power metal-bandet Masterplan, og for sin solokarriere Jorn. Men han begynte tidlig å spille i et band som het «Motgang». I 1998 ble Lande vokalist i Whitesnake-coverbandet The Snakes med Sid Ringsby og Willy Bendiksen og de tidligere Whitesnake-gitaristene Bernie Marsden og Micky Moody. Mot slutten av 1998 forlot Marsden og Moody bandet og Tore Moren erstattet dem på gitar. Marsden og Moody startet i 1999 The Company of Snakes som varte frem til 2004. Samtidig som Tore Moren ble med i The Snakes spilte også nordmennene i bandet Wild Willy's Gang med Ronni Le Tekrø fra TNT. The Snakes ble oppløst i 1999, og året etter startet Lande bandet Jorn som har eksistert siden den gang. I tillegg var han vokalist i det tyske power metal-bandet Masterplan fra 2001-2006. 25. juli 2009 ble det kjent at Jørn hadde gått tilbake i Masterplan, etter tre års fravær på grunn av uoverensstemmelser. I 2012 ble det kjent at han atter forlot bandet.\\nLande var solist på fotballsangen «Alt for Norge» som herrelandslaget i fotball spilte inn før VM i fotball 1994."},{"page_url":"https://ast.wikipedia.org/wiki/Guerra_de_Cand%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Fran%C3%A7ois_de_Bourbon_Duke_of_Beaufort_by_Jean_Nocret_%28Baltimore_Museum_of_Art%29.jpg","page_title":"Guerra de Candía","context_page_description":"La guerra de Candía, tamién conocida como guerra de Creta, llibrar ente la República de Venecia y los sos aliaos, los Caballeros de Malta, los Estaos Papales, voluntarios franceses y los pirates de Mani contra'l Imperiu otomanu y los Estaos de Berbería. La guerra desenvolver en Creta y nel Mar Mediterraneu y terminó con una victoria otomana."},{"page_url":"https://cs.wikipedia.org/wiki/VL_Tuisku","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/VL_Tuisku.JPG","page_title":"VL Tuisku","context_page_description":"VL Tuisku byl finský dvoumístný víceúčelový cvičný letoun vyvinutý společností Valtion Lentokonetehdas. Sloužil k základnímu výcviku, pokračovacímu výcviku stíhacích pilotů a dále k výcviku palubních střelců. Sekundárně mohl být využíván k průzkumu a podpoře pozemních jednotek."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Halsbr%C3%BCcke","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Falkenberg%2C_einstige_Erblehnm%C3%BChle.jpg","page_title":"Liste der Kulturdenkmale in Halsbrücke","context_page_description":"Die Liste der Kulturdenkmale in Halsbrücke enthält die Kulturdenkmale in Halsbrücke.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D1%80%D0%B8_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Terry_County_Texas_Courthouse_2019.jpg","page_title":"Терри (округ)","context_page_description":"Округ Терри — округ штата Техас Соединённых Штатов Америки. На 2000 год в нем проживало 12 761 человек. По оценке бюро переписи населения США в 2009 году население округа составляло 12 142 человек. Окружным центром является город Браунфилд."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Gothic_brick_buildings_in_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/St._Marien_%28Gro%C3%9F_Salitz%2905.JPG","page_title":"List of Gothic brick buildings in Germany","context_page_description":"This list is a part of the international List of Gothic brick buildings.\\nFor the parts of this list on the various countries see:\\n– In long tables, vertical arrows link to the navigation boards above and below. –"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%BC%D1%96%D0%BD%D1%8C_%D0%B1%D0%B5%D0%B7%D0%BF%D0%B5%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Aircraft_Seatbelt.jpg","page_title":"Ремінь безпеки","context_page_description":"Пасок безпе́ки — засіб пасивної безпеки, що призначений для утримання пасажира автомобіля на місці у випадку аварії або раптової зупинки."},{"page_url":"https://en.wikipedia.org/wiki/Lists_of_nuclear_disasters_and_radioactive_incidents","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Sl-1-ineel81-3966.jpg","page_title":"Lists of nuclear disasters and radioactive incidents","context_page_description":"These are lists of nuclear disasters and radioactive incidents."},{"page_url":"https://en.wikipedia.org/wiki/Neral,_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Neral.jpg","page_title":"Neral, India","context_page_description":"Neral is a town in Raigad district in the Indian state of Maharashtra. It is 83 km + developing city of a Raigad district which is well connected to Panvel, Mumbai, Thane and Pune. Neral along with Karjat is also known as Eastern Mumbai District."},{"page_url":"https://en.wikipedia.org/wiki/FitzGerald_dynasty","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/USS_Fitzgerald_DDG-62_Crest.png","page_title":"FitzGerald dynasty","context_page_description":"The FitzGerald / FitzMaurice dynasty is a Cambro-Norman and Anglo-Norman, and later Hiberno-Norman, aristocratic and royal dynasty. They have been peers of Ireland since at least the 13th century, and are described in the Annals of the Four Masters as being \\"more Irish than the Irish themselves\\" or Galls, due to assimilation with the native Gaelic aristocratic and popular culture. The dynasty has also been referred to as the Geraldines. They achieved power through the conquest of large swathes of Irish territory by the sons and grandsons of Gerald of Windsor. Gerald of Windsor was a Norman castellan in Wales, and he is the male progenitor of the FitzMaurice and FitzGerald dynasty.\\nGerald's Welsh wife Nest ferch Rhys is the female progenitor of the FitzGeralds and Fitzmaurices. She was the daughter of Rhys ap Tewdwr, last King of Deheubarth and through her the FitzGeralds and Fitzmaurices descend from the Welsh rulers of Deheubarth. The clan claim kinship with the Tudors who descended from the same Welsh royal line. Consequently, the Fitzmaurices and FitzGeralds are cousins to the Tudors through Nest and her Welsh family."},{"page_url":"https://en.wikipedia.org/wiki/Aspatria_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Aspatria_Railway_Station.jpg","page_title":"Aspatria railway station","context_page_description":"Aspatria railway station serves the town of Aspatria in Cumbria, England. The railway station is on part of the scenic Cumbrian Coast Line 20 miles south west of Carlisle. The station is operated by Northern who provide all passenger train services."},{"page_url":"https://en.wikipedia.org/wiki/Gliese_581g","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Gliese_581_system_compared_to_solar_system.jpg","page_title":"Gliese 581g","context_page_description":"Gliese 581g, unofficially known as Zarmina, is an unconfirmed exoplanet claimed to orbit within the Gliese 581 system, twenty light-years from Earth. It was discovered by the Lick–Carnegie Exoplanet Survey, and is the sixth planet orbiting the star; however, its existence could not be confirmed by the European Southern Observatory / High Accuracy Radial Velocity Planet Searcher survey team, and its existence remains controversial. It is thought to be near the middle of the habitable zone of its star. That means it could sustain liquid water—a necessity for all known life—on its surface, if there are favorable atmospheric conditions on the planet.\\nGliese 581g was claimed to be detected by astronomers of the Lick–Carnegie Exoplanet Survey. The authors stated that data sets from both the High Resolution Echelle Spectrometer and HARPS were needed to sense the planet; however, the ESO/HARPS survey team could not confirm its existence. The planet remained unconfirmed as consensus for its existence could not be reached. Additional reanalysis only found evidence for four planets, but the discoverer, Steven S."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Nied%C5%BAwiedzia_w_Bydgoszczy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Bdg_Niedzwiedzia_3_07-2013.jpg","page_title":"Ulica Niedźwiedzia w Bydgoszczy","context_page_description":"Ulica Niedźwiedzia w Bydgoszczy - ulica na terenie miasta lokacyjnego Bydgoszczy."},{"page_url":"https://nl.wikipedia.org/wiki/Universit%C3%A9_catholique_de_Louvain","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Louvain-la-Neuve_JPG.jpg","page_title":"Université catholique de Louvain","context_page_description":"De Université catholique de Louvain of UCLouvain is een katholieke universiteit in Louvain-la-Neuve in België. Het is de grootste Franstalige universiteit van België, met ongeveer 30.000 studenten. Vanaf september 2018 gebruikt de universiteit de benaming UCLouvain, in de context van een fusie met de Universiteit Saint-Louis - Bruxelles."},{"page_url":"https://fr.wikipedia.org/wiki/TRAF3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Protein_TRAF3_PDB_1flk.png","page_title":"TRAF3","context_page_description":"La protéine TRAF3, de l'anglais TNF receptor-associated factor 3, est codée chez l'homme par le gène TRAF3, situé sur le chromosome 14. Elle fait partie des facteurs associés aux récepteurs de facteurs de nécrose tumorale. Ces protéines sont associées à plusieurs récepteurs de facteurs de nécrose tumorale et en assurent la transduction de signal.\\nLa protéine TRAF3 participe à la transduction de signal de la protéine CD40, membre important de la famille des récepteurs de TNF pour l'activation de la réponse immunitaire. Elle est elle-même un composant essentiel du complexe de signalisation du récepteur de la lymphotoxine β, lequel déclenche l'activation du facteur NF-κB et la mort cellulaire par liaison de lymphotoxine β. La protéine LMP1 du virus d'Epstein-Barr peut interagir avec la protéine TRAF3 ainsi qu'avec d'autres protéines TRAF, ce qui est peut-être essentiel pour les effets oncogènes de la protéine LMP1."},{"page_url":"https://ro.wikipedia.org/wiki/Prin%C8%9Besa_Louise_de_Saxa-Gotha-Altenburg_(1756%E2%80%931808)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Luisesagoaltroda.jpg","page_title":"Prințesa Louise de Saxa-Gotha-Altenburg (1756–1808)","context_page_description":"Prințesa Louise de Saxa-Gotha-Altenburg, germană Luise, Prinzessin von Sachsen-Gotha-Altenburg, a fost membră a Casei de Saxa-Gotha-Altenburg și Prințesă de Saxa-Gotha-Altenburg prin naștere. Prin căsătoria cu Friedrich Franz I, Mare Duce de Mecklenburg-Schwerin, Louise a devenit și membră a Casei de Mecklenburg și Ducesă consort de Mecklenburg-Schwerin de la 24 aprilie 1785 până la 1 ianuarie 1808."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1973","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Erik-bouwman-1423854570.jpg","page_title":"Lijst van personen geboren in 1973","context_page_description":"Dit is een lijst van personen die geboren zijn in 1973.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%A4%E3%81%B0%E3%82%81_(JR%E4%B9%9D%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Kyushu_Railway_-_Series_800-1000_-_01.JPG","page_title":"つばめ (JR九州)","context_page_description":"つばめは、九州旅客鉄道が主に九州新幹線の博多駅 - 鹿児島中央駅間で運行している特別急行列車の愛称である。このうち一部の列車は西日本旅客鉄道山陽新幹線に乗り入れる。\\n本項では、1992年から九州新幹線開業までの間、鹿児島本線博多駅 - 西鹿児島駅で運行されていた在来線特急「つばめ」、ならびに九州新幹線部分開業時に新幹線「つばめ」に接続していた在来線特急「リレーつばめ」についても記述する。"},{"page_url":"https://fr.wikipedia.org/wiki/Austin_Westminster","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Austin_Westminster_A110_1966.JPG","page_title":"Austin Westminster","context_page_description":"La série des Austin Westminster sont de grandes berlines et breaks qui ont été vendus par le constructeur Britannique Austin à partir de 1954, en remplacement de l'A70 Hereford. La ligne Westminster fut produite sous les dénominations A90, A95, A99, A105 et A110 jusqu'en 1968, quand la nouvelle Austin 3 Litres prit sa place. Des versions de la Westminster Farina ont également été produites sous les marques Wolseley et Vanden Plas. 101.634 Westminster ont été construites.\\nLe nom Westminster fut précédemment utilisé par Austin dans les années 1930 pour des versions quatre fenêtres des 16/6 et 12/4 \\"Lourde\\"."},{"page_url":"https://en.wikipedia.org/wiki/Commemorative_Works_Act","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Map_Number_869-86501_-_US_National_Park_Service_-_24_June_2003.jpg","page_title":"Commemorative Works Act","context_page_description":"The Commemorative Works Act of 1986 is a United States federal law which bars the construction of commemorative works on the National Mall and the National Capital Area unless they are approved by the National Capital Memorial Advisory Commission. The law also establishes criteria a memorial must meet in order to be approved the NCMAC, and establishes a seven-year deadline by which construction must begin or the memorial loses its congressional authorization. As of April 2014, the law has been amended five times, most notably by the Commemorative Works Clarification and Revision Act of 2003."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_Lissa_(1811)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Battle_of_Lissa_1811_Map.png","page_title":"Battaglia di Lissa (1811)","context_page_description":"La battaglia di Lissa fu uno scontro navale tra la flotta franco-veneta e quella britannica che si svolse il 13 marzo 1811 vicino all'isola omonima nel mar Adriatico.\\nNon è da confondere con la ben più famosa battaglia di Lissa del 1866.\\nL'11 marzo 1811, una flotta comandata dal capitano di vascello Bernard Dubourdieu, composta da fregate francesi e italiane, salpò da Ancona in direzione di Lissa trasportando truppe destinate ad attaccare l'isola. Lissa era diventata di importanza cruciale poiché gli inglesi nello stesso anno vi avevano fondato una base militare per consolidare il blocco continentale. Già nell'ottobre del 1810 le navi francesi avevano forzato la rada di Porto San Giorgio e liberato alcuni prigionieri francesi ivi detenuti."},{"page_url":"https://de.wikipedia.org/wiki/Glockenblumen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Campanula_distribution_map_Campanula_arvatica.png","page_title":"Glockenblumen","context_page_description":"Die Glockenblumen sind die größte Pflanzengattung in der Familie der Glockenblumengewächse."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%83%D0%BA%D1%83-%D0%A5%D1%96%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Atlas_pittoresque_pl_054.jpg","page_title":"Нуку-Хіва","context_page_description":"Острів Нуку-Хіва — найбільший з Маркізьких островів у Французькій Полінезії, заморській території Франції в Тихому океані. Нуку-Хіва або «Величний острів», розташований за 1500 км на північний схід від Таїті та 4800 км на захід від Північної Америки. Нуку-Хіва — другий за величиною острів у Французькій Полінезії. Нуку-Хіва знаходиться в Північній групі Маркізьких островів і розташувався майже в центрі Тихого океану."},{"page_url":"https://vi.wikipedia.org/wiki/Ophrys_speculum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Ophrys_speculum_Mallorca_01.jpg","page_title":"Ophrys speculum","context_page_description":"Ophrys speculum là một loài thực vật có hoa trong họ Lan. Loài này được Link mô tả khoa học đầu tiên năm 1800."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%B2%A2%E5%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Shannan_Counties.png","page_title":"貢嘎","context_page_description":"貢嘎係中華人民共和國西藏山南嘅一個縣。"},{"page_url":"https://de.wikipedia.org/wiki/Magnolia_Bakery","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Magnolia%27s_cupcakes.jpg","page_title":"Magnolia Bakery","context_page_description":"Magnolia Bakery ist eine Kette von Bäckereien, die ursprünglich in New York City gegründet wurde. Die erste Filiale eröffnete 1996 unter der Adresse 401 Bleecker Street im populären West Village. Die Bäckerei ist vor allem für ihre Cupcakes bekannt und gilt als einer der Ursprungsorte für den Cupcake-Trend, der seinen Anfang in den späten 1990er Jahren nahm. Zu den Spezialitäten der Bäckerei, die sich der Südstaatenküche verpflichtet sieht, zählen aber auch Red Velvet Cakes. Der Magnolia Bakery wird zugeschrieben, an der wieder zunehmenden Popularität dieser Kuchenart beteiligt zu sein, die typischerweise eine hell- bis dunkelrote oder rotbraune Farbe hat, die aufgrund einer chemischen Reaktion von Kakao mit Buttermilch entsteht."},{"page_url":"https://ca.wikipedia.org/wiki/Rometta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Rometta.svg","page_title":"Rometta","context_page_description":"Rometta és un municipi italià, dins de la ciutat metropolitana de Messina. L'any 2007 tenia 6.523 habitants. Limita amb els municipis de Messina, Monforte San Giorgio, Roccavaldina, Saponara i Spadafora."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B0_(%D0%A1%D1%8B%D1%87%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%B2%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B0_%28%D0%A1%D1%8B%D1%87%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BE%D0%B2%D0%B5%D1%82%293.JPG","page_title":"Ленина (Сычковский сельсовет)","context_page_description":"Ленина — агрогородок в составе Сычковского сельсовета Бобруйского района Могилёвской области Республики Беларусь."},{"page_url":"https://en.wikipedia.org/wiki/Matrox_Mystique","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/MatroxMystique2MBcard.jpg","page_title":"Matrox Mystique","context_page_description":"The Mystique and Mystique 220 were 2D, 3D, and video accelerator cards for personal computers designed by Matrox, using the VGA connector. The original Mystique was introduced in 1996, with the slightly upgraded Mystique 220 having been released in 1997."},{"page_url":"https://et.wikipedia.org/wiki/Ardennide_vastupealetung","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Battle_of_the_Bulge_progress.svg","page_title":"Ardennide vastupealetung","context_page_description":"Ardennide vastupealetung, tuntud ka kui Ardennide operatsioon, oli Saksamaa viimane massiivne pealetungioperatsioon Teises maailmasõjas ning toimus 16. detsembrist 1944 kuni 25. jaanuarini 1945 Belgia, Prantsusmaa ja Luksemburgi territooriumil Ardennide tihedates metsades. See oli Natsi-Saksamaa viimane meeleheitlik operatsioon, mille tulemusena üritati leida vaherahu kokkulepe lääneliitlastega, mille tingimusi dikteeriksid teljeriigid. Lõpptulemusena Saksa väed peatati enne oma taktikaliste eesmärkide saavutamist ning ressursside puudumise tõttu sunniti nad taganema. Operatsioon kurnas terve Saksa läänerinde võimekuse ning lõi head tingimused liitlastele läbimurdeks Siegfriedi liinist."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%BCnstliche_Ruine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Hietzing_-_Sch%C3%B6nbrunn%2C_r%C3%B6mische_Ruine.JPG","page_title":"Künstliche Ruine","context_page_description":"Künstliche Ruinen wurden zunächst als Staffagebauten im englischen Landschaftsgarten, so genannte Follies, später auch als Aussichtstürme in der offenen Landschaft errichtet. Sie sind stimmungssteigernde Elemente, die Gefühle der Erhabenheit und Einsamkeit erzeugen sollen, vor allem jedoch an die Vergänglichkeit des Menschen und seiner Werke erinnern."},{"page_url":"https://nl.wikipedia.org/wiki/NGC_995","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/NGC_0995_DSS.jpg","page_title":"NGC 995","context_page_description":"NGC 995 is een lensvormig sterrenstelsel in het sterrenbeeld Andromeda. Het hemelobject werd op 8 december 1871 ontdekt door de Franse astronoom Édouard Jean-Marie Stephan."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%88_%D9%8A%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Hou_Yao.jpg","page_title":"هو ياو","context_page_description":"هو ياو كان مخرج افلام من الصين."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%99%BD%E9%A6%AC%E5%A4%A7%E6%B1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Map_of_Nagano_Prefecture_Ja.svg","page_title":"白馬大池","context_page_description":"白馬大池とは、長野県北安曇郡小谷村の標高2,379mにある池。北アルプス山中では、北東5km先に位置する風吹大池に次いで2番目の大きさを誇る。\\n第四紀中期から後期にかけて活発に活動した白馬大池火山の噴出物により堰き止められてできた火山性の湖である。通年の流入河川は無いが、池周辺に降る雪や雨と、夏場でも残る大きな雪田から融け出す水が池の水を湛えている。\\n池に魚類は生息しないが、クロサンショウウオが多く生息しており、肉眼でも確認できるほどである。周辺には白馬乗鞍岳、小蓮華山、白馬岳などの山がある。夏には池周辺にチングルマやハクサンコザクラ、ハクサンイチゲなどを中心とした高山植物のお花畑が広がる。湖畔には白馬大池山荘がある。\\n登山道は栂池から白馬乗鞍岳を経て白馬大池に至るルート、蓮華温泉から白馬大池に至るルート、白馬大池から小蓮華山・三国境を経て白馬岳方面に向かう稜線上の縦走路がある。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%A2%D7%99%D7%A8%D7%99%D7%99%D7%AA_%D7%91%D7%AA_%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/PikiWiki_Israel_7702_bat-yam_municipallity.jpg","page_title":"בית עיריית בת ים","context_page_description":"בית עיריית בת ים הוא משכנה של עיריית בת ים הממוקם ברחוב נורדאו 17."},{"page_url":"https://de.wikipedia.org/wiki/Aabenraa_Amts_Jernbaner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Apenrader_Kreisbahn%2C_Gro%C3%9Fer_Atlas_der_Eisenbahnen_von_Mitteleuropa%2C_1902.jpg","page_title":"Aabenraa Amts Jernbaner","context_page_description":"Die Aabenraa Amts Jernbaner war ein Eigenbetrieb des dänischen Kreises Aabenraa Amt. Die Bahnstrecken wurde zur Zeit, als Südjütland zu Preußen gehörte, unter dem Namen Kleinbahnen des Kreises Apenrade im Norden der Provinz Schleswig-Holstein gebaut und betrieben. Ihre beiden, miteinander verbundenen Strecken waren Meterspurbahnen mit einer Länge von insgesamt 86 Kilometern."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%83%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Massawa_harbour.JPG","page_title":"Массауа","context_page_description":"Массауа також відоме під ім'ями Мітсіва, Батсі, Баді — місто в Еритреї, столиця зоби Семенаві-Кей-Бахрі, розташоване на березі Червоного моря.\\nМассауа була важливим портом протягом багатьох століть в складі різних держав таких як Аксумське царство, Медрі-Бахр, халіфат Омейядів, держава Беджа, Османська імперія, Єгипет, Британія, Італія та Ефіопія, а з 1991 року і Еритреї, яка здобула незалежність. До перенесення 1897 року столиці Італійської Еритреї до Асмери, Массауа була центром колонії."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%B0_%D0%BA%D0%BB%D0%B0%D1%81%D0%B8%D0%BA%D0%B0_%D0%B1%D0%B5%D0%B9%D1%81%D0%B1%D0%BE%D0%BB%D1%83_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Fukuokadome_ground.jpg","page_title":"Світова класика бейсболу 2013","context_page_description":"Світова класика бейсболу 2013, — третій розіграш бейсбольного турніру між національними збірними країн з участю гравців Вищої ліги бейсболу. Пройшов з 5 по 23 березня 2013 року на стадіонах міст Токіо та Фукуока, Сан-Хуан, Тайчжун, Маямі, Фінікс, Скоттсдейл і Сан-Франциско. Турнір організовувала Вища ліга бейсболу з дозволу Міжнародної федерації бейсболу. Чемпіоном Світової класики стала збірна Домініканської республіки, обігравши у фінальному матчі збірну Пуерто-Рико 3-0.\\nПочинаючи з розіграшу 2013 року, Світова класика бейсболу отримала від IBAF статус офіційного чемпіонату світу, а переможець отримував титул чемпіона світу.\\nНа відміну від перших двох розіграшів Світової класики, у яких всі 16 команд брали участь за запрошенням, цього разу було проведено кваліфікаційний відбір. Відбір пройшов у 2012 році у 4 групах за системою «вибуття після двох поразок». Право грати у фінальній частині здобули збірні Канади, Тайваню, Іспанії і Бразилії. Дві останні дебютували на турнірі. Ще 12 команд брали участь за запрошенням від організаторів."},{"page_url":"https://pt.wikipedia.org/wiki/Chromium_OS","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/ChromiumOS_Zero_-_login_screen.png","page_title":"Chromium OS","context_page_description":"Chromium OS é a versão de desenvolvimento de código aberto do Chrome OS, um dos sistemas operacionais do Google. O Chromium OS é baseado no núcleo do Linux e usa o navegador Chromium como a sua principal interface do usuário. Como resultado disso, o Chromium OS suporta primariamente aplicativos da web."},{"page_url":"https://cs.wikipedia.org/wiki/Nov%C3%BD_dv%C5%AFr_(Lednicko-valtick%C3%BD_are%C3%A1l)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Castle_Nov%C3%BD_dv%C5%AFr_04.jpg","page_title":"Nový dvůr (Lednicko-valtický areál)","context_page_description":"Nový dvůr je empírová stavba hospodářských budov v Lednicko-valtickém areálu zbudovaná v letech 1809 - 1810 podle projektu Josefa Hardtmutha. V roce 1819 byl Statek se nachází v katastru Charvátské Nové Vsi asi 3 km jižně od Lednice nedaleko Prostředního a Mlýnského rybníka. Areál je chráněn jako kulturní památka České republiky."},{"page_url":"https://ast.wikipedia.org/wiki/Tom_Cruise","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Tom_cruise_1989.jpg","page_title":"Tom Cruise","context_page_description":"Thomas Cruise Mapother IV, más conocíu como Tom Cruise, ye un actor estauxunidense. Protagonizó películes como Risky Business, Top Gun, The Color of Money, Díes de truenu, Rain Man, Interview with the Vampire, Eyes Wide Shut, Minority Report, The Last Samurai, Valkyrie, Rock of Ages y la saga de Mission: Impossible. Tamién llogró tres nominaciones pal Óscar al meyor actor: en 1990 por Born on the Fourth of July, en 1997 por Jerry Maguire y en 2000 por Magnolia. Consideráu unu de los sex symbols del cine, la so vida sentimental viose espuesta nos medios de comunicación. Casóse con trés conocíes actrices: Mimi Rogers, Nicole Kidman y Katie Holmes. La so rellación con Penélope Cruz tamién dio que falar, al igual que la so afiliación y propaganda a la Ilesia de la Ciencioloxía, a la que Cruise atribuyi procura-y una meyor conciencia espiritual y otros beneficios, como la so cura de la dislexa. La mala fama de la organización, causada por denuncies d'estafes y demás, afectaron nos últimos años a la so imaxe pública y al so progresu profesional."},{"page_url":"https://es.wikipedia.org/wiki/Charlie_Faumuina","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Charlie_Faumuina_2013.jpg","page_title":"Charlie Faumuina","context_page_description":"Charlie Faumuina es un jugador de rugby neozelandés, que juega de pilier para la selección de rugby de Nueva Zelanda y para los Blues en el Super Rugby.​\\nDebutó con los All Blacks en un partido contra la selección de rugby de Argentina, celebrado en Wellington el 8 de septiembre de 2012. Formó parte de la selección neozelandesa que quedó campeona de la Copa Mundial de Rugby de 2015."},{"page_url":"https://fr.wikipedia.org/wiki/Jim_Cornette","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Jim_Cornette_2014.jpg","page_title":"Jim Cornette","context_page_description":"James Mark Cornette est un manager, booker, podcaster et promoteur de catch américain."},{"page_url":"https://en.wikipedia.org/wiki/Morya_Gosavi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Morgaon.jpg","page_title":"Morya Gosavi","context_page_description":"Morya Gosavi or Moraya Gosavi alias Moroba Gosavi was a prominent saint of the Hindu Ganapatya sect, which considers the elephant-faced god Ganesha as the Supreme Being. Morya Gosavi is considered the chief spiritual progenitor of the Ganapatyas and has been described as the \\"most famous devotee\\" of Ganesha.\\nThe lifetime of Morya Gosavi is speculated between the 13th to 17th century. Numerous legends recall his life. Morya became devoted to Ganesha when he started visiting the Morgaon temple of Ganesha. It is believed that due to the hindrance in Morya's services to the god in the popular Ganesha shrine, Ganesha told Morya that he would appear in Chinchwad for Morya to worship, so Morya moved from Morgaon to Chinchwad, where Morya built a Ganesha temple. Consequently, Morya took sanjeevan samadhi by burying himself alive in his tomb.\\nMorya had a son called Chintamani, venerated as a living incarnation of Ganesha and addressed as Dev. Chintamani was succeeded by six more Devs. The tomb of Morya Gosavi and the Ganesha temple at Chinchwad still attract many Ganesha devotees."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8C%97%E5%86%B0%E6%B4%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Ruysch_map.jpg","page_title":"北冰洋","context_page_description":"北冰洋又稱北極海、北大洋或北極洋，位於北極圈內，大致以北極點為中心。北冰洋是世界五大洋中最小最淺的。面積1405.6萬平方公里，約占世界大洋面積的3.6%。平均深度1200-1300米，為世界大洋平均深度的三分之一。最深處為南森海盆，深度為5450米。國際海道測量組織將北冰洋視為洋，不過一些海洋學家稱之為「北極陸間海」或是「北極海」，分類為陸間海或是大西洋的河口灣。北冰洋有巴倫支海、波弗特海、楚克奇海、東西伯利亞海、格陵蘭海、哈得遜灣、哈得遜海峽、喀拉海、拉普捷夫海、白海和巴芬灣等邊緣海和陸間海。洋面上有長年不化的冰層，占北冰洋面積的三分之二，厚度多在2－4米左右。中央的海冰已持續存在300萬年，是永久性的海冰。水溫大部分時間在0℃以下。當海水向南流進大西洋時，瓦解的冰山就隨之流入大西洋，給航運帶來威脅。1912年4月15日，鐵達尼號客輪就是撞到漂流的冰山而沉沒的，造成巨大的人員和財產損失。北冰洋島嶼很多，數目僅次於太平洋，面積達400萬平方公里。主要島嶼有格陵蘭島、斯瓦爾巴群島、北極群島等。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Mount_Olivet_(Kentucky)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Downtown_mt_olivet.jpg","page_title":"Mount Olivet (Kentucky)","context_page_description":"Mount Olivet sī Bí-kok Kentucky chiu Robertson kūn ê chi̍t ê chng-thâu."},{"page_url":"https://de.wikipedia.org/wiki/Karl_Lehrmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Kobli%C5%BEn%C3%A1_21%2C_Brno_-_spo%C5%99itelna.JPG","page_title":"Karl Lehrmann","context_page_description":"Karl Lehrmann war ein österreichischer Architekt und Hochschullehrer.\\nSeine Bauten in Brünn, Linz und Wien sind gekennzeichnet durch moderne Formen, die in Verbindung mit historisierenden Stilelementen eine monumentale Wirkung erzielen."},{"page_url":"https://pt.wikipedia.org/wiki/Bichl","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bichl_Rathaus.JPG","page_title":"Bichl","context_page_description":"Bichl é um município da Alemanha, no distrito de Bad Tölz-Wolfratshausen, na região administrativa de Oberbayern, estado de Baviera."},{"page_url":"https://nn.wikipedia.org/wiki/Hallwang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hallwang_-_Ansicht_4.jpg","page_title":"Hallwang","context_page_description":"Hallwang er ein kommune i Salzburg-Umgebung i forbundslandet Salzburg i Austerrike. Kommunen har ei flatevidd på 13,1 km² og i kring 4 200 ibuarar. Landsbyen Hallwang ligg 524 meter over havet, ei seks-sju kilometer nordvest om byen Salzburg."},{"page_url":"https://pt.wikipedia.org/wiki/Gyula_Horn","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Gyula_Horn_%282007%29.jpg","page_title":"Gyula Horn","context_page_description":"Gyula Horn foi um político húngaro. Foi primeiro-ministro do seu país, entre 15 de julho de 1994 e 6 de julho de 1998.\\nEm 1989, Horn teve um papel importante no processo de abertura da \\"Cortina de Ferro\\" para os alemães orientais, contribuindo para a posterior unificação da Alemanha.\\nHorn recebeu vários prêmios por suas realizações em relações internacionais, entre outros, o prêmio Carlos Magno de Aquisgrano em 1990."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%AF%D5%B6%D5%AB%D5%BD%D5%BF%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Akniste13.JPG","page_title":"Ակնիստե","context_page_description":"Ակնիստե, քաղաք Լատվիայի հարավում, վարչական կենտրոնը գտնվում է Ակնիստեի շրջանում: Մինչև 2009 թվականի հուլիսի 1-ը քաղաքը գտնվում էր Էկաբպիլսկիի շրջանում:\\nԳտնվում է Դիենավիդսուսեյա գետի ափին, Ռիգայից 135 կմ դեպի հարավ-արևելք, իսկ Դաուգավպիլսա քաղաքից՝ 69 կմ դեպի հյուսիս-արևմուտք:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8F%E8%B7%97%E5%AE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Former_Residence_of_Feng_Mengzhuan_01_2016-01.JPG","page_title":"伏跗室","context_page_description":"伏跗室是浙東藏書家，目錄學家馮孟顓的藏書樓，位於中國浙江省寧波市海曙區孝聞街91號。伏跗室得名於王延壽《魯靈先殿賦》「狡兔跧伏於跗側」，取謹慎治學之意。伏跗室建築坐西朝東，面闊五間，2005年3月列入浙江省文物保護單位。樓內設有《馮孟顓先生生平事跡陳列》。"},{"page_url":"https://fi.wikipedia.org/wiki/Vigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Vigo_0945.JPG","page_title":"Vigo","context_page_description":"Vigo on Atlantin rannalla Espanjan luoteisosassa Galician itsehallintoalueella sijaitseva kaupunki, joka kuuluu Pontevedran maakuntaan. Se on Galician suurin ja Espanjan 14. suurin kaupunki. Vigossa on 292 817 asukasta. Vigon suurkaupunkialueen väkiluku on noin 370 000.\\nVigo on tärkeä teollisuuskaupunki, jossa on paljon etenkin autoteollisuutta. Koko Galician tärkein työnantaja on PSA Peugeot Citroën, jonka Vigon tehtaassa valmistettiin lähes puoli miljoonaa autoa vuonna 2003. Myös kalastus on perinteisesti ollut tärkeä elinkeino alueella: kaupunki on Euroopan tärkein kalastussatama ja Vigon satama on vilkkaimmin liikennöityjen joukossa koko Espanjassa. Kaupungissa toimii myös Euroopan kalastuksenvalvontavirasto.\\nIlmastollisesti Vigo sijoittuu lauhkean ja subtrooppisen vyöhykkeen rajalle: vuoden keskilämpötila on +15 °C ja kylmimpänäkin aikana keskimääräinen vuorokauden keskilämpötila on kahdeksan astetta. Vigoa ympäröivät vuoret muodostavat lähes yhtenäisen ketjun, joka luo kaupunkiin mikroilmaston.\\nHistoriallisesti Vigo on hyvin nuori kaupunki, sillä vielä 1800-luvun lopussa asukkaita oli vain muutamia tuhansia. Esimerkiksi Vigon yliopisto perustettiin vasta vuonna 1990."},{"page_url":"https://fr.wikipedia.org/wiki/T%C3%A9lir%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Champs_a_T%C3%A9lir%C3%A9.jpg","page_title":"Téliré","context_page_description":"Téliré est une ville et une sous-préfecture de la préfecture de Mali dans la Région de Labé au nord de la Guinée."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%AF%CF%87%CE%B1%CE%B5%CE%BB_%CE%92%CE%AF%CF%84%CF%84%CE%BC%CE%B1%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Bundesarchiv_Bild_101I-299-1802-09%2C_Michael_Wittmann.jpg","page_title":"Μίχαελ Βίττμαν","context_page_description":"Ο Μίχαελ Βίττμαν ήταν ένας από τους πιο γνωστούς Γερμανούς αρματιστές.\\nΚατετάγη στην 1η Μεραρχία Πάντσερ SS \\"Σωματοφυλακή Αδόλφος Χίτλερ\\" το 1937 και έμελλε να γίνει ο πρώτος άσσος των αρμάτων μάχης μέχρι τον θάνατό του στη Νορμανδία στις 8 Αυγούστου 1944. Μέχρι τότε ο Βίττμαν είχε καταστρέψει σε διάστημα τριών ετών 138 εχθρικά άρματα και πυροβόλα. Οι επιτυχίες του Βίττμαν εξαρτώνταν κατά πολύ από τον, για μεγάλο χρονικό διάστημα, πυροβολητή του, τον Μπαλτάζαρ Βολ, ο οποίος διακρινόταν από μία σχεδόν υπεράνθρωπη ικανότητα να ευστοχεί, ενώ το άρμα βρισκόταν σε κίνηση. Με τον βαθμό του δεκανέα διακρίθηκε στις επιχειρήσεις στην Πολωνία το 1939 και στη Γαλλία το 1940. Κατά τη Γερμανική Εισβολή στην Ελλάδα διακρίθηκε ιδιαίτερα στην Κατάληψη της στενωπού της Κλεισούρας, ως επικεφαλής άρματος εφόδου. Οι προοπτικές του φάνηκαν από τις πρώτες μέρες της εισβολής στη Σοβιετική Ένωση. Προωθήθηκε στη Σχολή Αξιωματικών του Μπαντ Τελτζ και καθιερώθηκε ως άσσος των αρμάτων στη μάχη του Κουρσκ. Χαρακτηριστική των ικανοτήτων του ήταν η δράση του στο Βιγιέρ Μποκάζ. Ο Βίττμαν αρνήθηκε στη συνέχεια την τοποθέτησή του ως εκπαιδευτή σε σχολές τεθωρακισμένων των Waffen SS."},{"page_url":"https://ca.wikipedia.org/wiki/Darney","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Map_commune_FR_insee_code_88124.png","page_title":"Darney","context_page_description":"Darney és un municipi francès, situat al departament dels Vosges i a la regió del Gran Est. L'any 2007 tenia 1.238 habitants.\\nEl primer president txecoslovac Tomáš Garrigue Masaryk va visitar allí les seves legions txecoslovacs el 8 de desembre de 1918 a Darney. PRECLÍK, Vratislav. Masaryk a legie, viaz. kniha, 219 p., first issue vydalo nakladatel´stvo Paris Karviná, Žižkova 2379 vo spoluprácii s Masarykovým demokratickým hnutím, 2019, ISBN 978-80-87173-47-3, pages 167-9, 186"},{"page_url":"https://en.wikipedia.org/wiki/Subhash_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Sabarmati_Riverfront_Ahmedabad.jpg","page_title":"Subhash Bridge","context_page_description":"Subhash Bridge is a bridge over Sabarmati River and an important area in Ahmedabad for its association with Mahatma Gandhi. Gandhi Ashram is 1.5 km away from Subhash Bridge. Gandhi Ashram Shopping area is a storehouse of Khadi. Subhash Bridge stands as a residential area of Ahmedabad with more than 80 residential societies spread across this place. It has been separated from rest of the city by a railway line in the west and Sabarmati river at its eastern side.\\nIn August 2019, Subhash bridge went under major repairs after 50 years and hence, was made to close it till eight Sundays."},{"page_url":"https://de.wikipedia.org/wiki/1536","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Buenos_Aires_shortly_after_its_foundation_1536.png","page_title":"1536","context_page_description":"30. Mai: Englands König Heinrich VIII. vermählt sich elf Tage nach der Hinrichtung Anne Boleyns mit Jane Seymour. Sie ist seine dritte Ehefrau.\\nSeptember: Charles Brandon, 1. Duke of Suffolk, schlägt den Lincolnshire-Aufstand nieder.\\n8. Oktober: Im Norden Englands bricht unter der Führung des Juristen Robert Aske die Pilgrimage of Grace aus, eine Rebellion der Katholiken gegen die Abspaltung der englischen Kirche von Rom und die Bastardisierung der Prinzessin Maria. Innerhalb weniger Tage breitet sich der Aufstand in den Gebieten Yorkshire, Richmondshire, Sedbergh, Nidderdale und Mashamshire aus. Die Zahl der Pilger wächst in die Tausende. Unter ihnen befinden sich Angehörige des Klerus, einfache Bauern, Angehörige der Gentry und des höheren englischen Adels, die sich zum Teil gewaltsam Zutritt in Städte und Häuser verschaffen. Da Heinrichs Armee den Aufständischen zahlenmäßig weit unterlegen ist, muss er mit ihnen verhandeln. Er bietet einen Generalpardon an und macht weitreichende Zugeständnisse. Unter anderem soll seine Frau Jane Seymour in York zur katholischen Königin gekrönt werden."},{"page_url":"https://es.wikipedia.org/wiki/Combustible_f%C3%B3sil","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Petroleum.JPG","page_title":"Combustible fósil","context_page_description":"Un combustible fósil es aquel que procede de la biomasa producida en eras pasadas, que ha sufrido enterramiento y tras él, procesos de transformación, por aumento de presión y temperatura, hasta la formación de sustancias de gran contenido energético, como el carbón, el petróleo, o el gas natural. Al no ser energía renovable, no se considera como energía de la biomasa.​\\nLa mayor parte de la energía empleada actualmente en el mundo proviene de los combustibles fósiles. Se utilizan para combustible de motores, para la generación de electricidad, para climatización de ambientes, para cocinar, etc."},{"page_url":"https://es.wikipedia.org/wiki/Charles_Raoul_Verlet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Nantes_-_Statue_Georges_de_Villebois-Mareuil.jpg","page_title":"Charles Raoul Verlet","context_page_description":"Charles Raoul Verlet, fue un escultor francés."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B1%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Buddha_soup2.jpg","page_title":"汤","context_page_description":"湯是主要成分為流質或半流質菜餚食品的總稱，冷熱皆可。和其他菜餚的區分並不十分明確。一般習慣上把液體成分占主導地位的稱做湯，不占主體成分的稱作燉菜，或按製作、食用形式稱作砂鍋、湯麵等。\\n湯一般分為濃湯和清湯。法式濃湯根據增稠劑分類，如奶油濃湯或海鮮濃湯。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9A%D0%B0%D1%80%D0%B0%D1%92%D0%BE%D1%80%D1%92%D0%B5%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/HRH_The_Crown_Prince_of_Serbia.jpg","page_title":"Александра Карађорђевић","context_page_description":"Александра Карађорђевић била је последња југословенска краљица, супруга краља Петра II Карађорђевића.\\nКао потомак грчких и данских монарха, пре брака је носила титуле принцезе од Грчке и Данске. Била је прва грчка принцеза која је међу ближим прецима имала Грке, и то са мајчине стране; њен отац је био немачке крви, као уосталом и већина европских владара."},{"page_url":"https://vi.wikipedia.org/wiki/Di_s%E1%BA%A3n_th%E1%BA%BF_gi%E1%BB%9Bi_h%E1%BB%97n_h%E1%BB%A3p","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Jordan_WadiRum4_tango7174.jpg","page_title":"Di sản thế giới hỗn hợp","context_page_description":"Di sản thế giới hỗn hợp là một loại di sản thế giới kép, đáp ứng đủ cả hai yếu tố nổi bật về văn hóa và thiên nhiên. Một địa danh được công nhận là di sản thế giới hỗn hợp phải thỏa mãn ít nhất là một tiêu chí về di sản văn hóa và một tiêu chí về di sản thiên nhiên."},{"page_url":"https://fr.wikipedia.org/wiki/Fran%C3%A7ois-Charles_d%27Autriche","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Habsburg_Franz_Karl_%26_Sophie_of_Bavaria.jpg","page_title":"François-Charles d'Autriche","context_page_description":"François-Charles Joseph, archiduc d'Autriche, né à Vienne le 7 décembre 1802 et décédé dans la même ville le 8 mars 1878 est le troisième fils de l'empereur François Iᵉʳ d'Autriche et de Marie-Thérèse de Bourbon, et le père de l'empereur François-Joseph.\\nHéritier du trône sous le règne de son frère l'empereur Ferdinand Iᵉʳ, il renonce au trône en faveur de son fils aîné, après l'abdication de son frère suite à la révolution autrichienne."},{"page_url":"https://sv.wikipedia.org/wiki/Herpysma_longicaulis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Herpysma_longicaulis_-_The_Orchids_of_the_Sikkim-Himalaya_pl_367_%281898%29.jpg","page_title":"Herpysma longicaulis","context_page_description":"Herpysma longicaulis är en orkidéart som beskrevs av John Lindley. Herpysma longicaulis ingår i släktet Herpysma och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://az.wikipedia.org/wiki/Hanafuda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Koi-Koi_Setup.jpg","page_title":"Hanafuda","context_page_description":"Hanafuda — Yaponiyada yaranmış oyun kartları."},{"page_url":"https://fr.wikipedia.org/wiki/Divonne-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Divonne_rivi%C3%A8re.JPG","page_title":"Divonne-les-Bains","context_page_description":"Divonne-les-Bains est une ville thermale française de l'Ain, dans l'arrondissement de Gex et dans le pays de Gex. Divonne se trouve sur la frontière avec la Suisse romande, entre le pied du Jura et le lac Léman. Elle fait aussi partie du Genevois français et du Grand Genève.\\nLes habitants de Divonne-les-Bains sont les Divonnais et les Divonnaises."},{"page_url":"https://vi.wikipedia.org/wiki/Leptodactylus_leptodactyloides","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bonner_zoologische_Monographien_-_Leptodactylus_leptodactyloides.jpg","page_title":"Leptodactylus leptodactyloides","context_page_description":"Leptodactylus leptodactyloides là một loài ếch trong họ Leptodactylidae. Tên gọi bản địa của nó là sapito leptodactilo.\\nNó được tìm thấy ở Bolivia, Brasil, Colombia, Ecuador, Guyane thuộc Pháp, Guyana, Peru, Suriname, và Venezuela. Các môi trường sống tự nhiên của chúng là các khu rừng ẩm ướt đất thấp nhiệt đới hoặc cận nhiệt đới, xavan ẩm, đầm nước ngọt có nước theo mùa, vùng đồng cỏ, vườn nông thôn, và các khu rừng trước đây bị suy thoái nặng nề. Nó không được xem là bị đe dọa theo IUCN."},{"page_url":"https://de.wikipedia.org/wiki/Deutscher_Orden","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/7_Schnellbootgeschwader_Wappen.JPG","page_title":"Deutscher Orden","context_page_description":"Der Deutsche Orden, auch Deutschherrenorden, Deutschritterorden oder Deutschorden genannt, ist eine römisch-katholische Ordensgemeinschaft. Mit dem Johanniter- und dem Malteserorden steht er in der Nachfolge der Ritterorden aus der Zeit der Kreuzzüge. Die Mitglieder des Ordens sind seit der Reform der Ordensregel 1929 regulierte Chorherren. Der Orden hat gegenwärtig 1100 Mitglieder, darunter 100 Priester und 200 Ordensschwestern, die sich vorwiegend karitativen Aufgaben widmen. Der Hauptsitz befindet sich heute in Wien.\\nDer vollständige Name lautet Orden der Brüder vom Deutschen Hospital Sankt Mariens in Jerusalem, lateinisch Ordo fratrum domus hospitalis Sanctae Mariae Teutonicorum Ierosolimitanorum. Aus der lateinischen Kurzbezeichnung Ordo Teutonicus leitet sich das Ordenskürzel OT ab.\\nDie Ursprünge des Ordens liegen in einem Feldhospital bremischer und lübischer Kaufleute während des Dritten Kreuzzuges um 1190 im Heiligen Land bei der Belagerung der Stadt Akkon. Papst Innozenz III. bestätigte am 19. Februar 1199 die Umwandlung der Spitalgemeinschaft in einen Ritterorden und die Verleihung der Johanniter- und Templerregel für die Brüder vom Deutschen Haus St."},{"page_url":"https://it.wikipedia.org/wiki/Space_Shuttle_Discovery","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/STS-133_patch.png","page_title":"Space Shuttle Discovery","context_page_description":"Lo Space Shuttle Discovery è uno Space Shuttle della NASA. Il suo primo volo risale al 30 agosto 1984. Fu il terzo Shuttle a essere operativo e il più vecchio rimasto in servizio dato che i suoi predecessori Columbia e Challenger sono andati perduti in missione. L'orbiter ha concluso con successo la sua ultima missione il 9 marzo 2011.\\nDeve il proprio nome alla nave HMS Discovery, che trasportò l'esploratore James Cook nell'ultimo dei suoi tre viaggi principali. Non ufficialmente, lo Shuttle trae il proprio nome da Discovery, l'astronave del film 2001: Odissea nello spazio.\\nFu lo Shuttle che mise in orbita il Telescopio Spaziale Hubble e due delle tre missioni di manutenzione del telescopio vennero effettuate con la stessa navicella. Ha anche lanciato la sonda Ulisse e tre satelliti TDRS. È stato sempre il Discovery a riprendere i voli della NASA dopo i disastri del Challenger e del Columbia."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%95%D7%97%D7%99%D7%AA_%D7%96%D7%99%D7%9B%D7%A8%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bodenplatte.JPG","page_title":"לוחית זיכרון","context_page_description":"לוחית זיכרון, לוחית הנצחה או לוחית הקדשה היא לוח הקבוע בחזית בניין, על אנדרטה, ברצפה, מדרכה או דרך, והנושא כיתוב המנציח אנשים שנהרגו, אישיות או מאורע היסטורי, או כיתוב המספר על ההיסטוריה של המקום.\\nלוחית זיכרון עשויה מתכת, קרמיקה, אבן, עץ או חומר אחר. פרט לטקסט, לעיתים היא כוללת גם תבליט, תחריט או ציור. לוחיות זיכרון משמשות גם לאזכור שמות תורמים למוסד. לוחיות הקדשה ניתנות גם כמתנה, למזכרת, כהוקרה על הישג או על שנות עבודה."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B0%D0%B1%D1%80%D0%B8_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Far_side_29A.jpg","page_title":"Фабри (лунный кратер)","context_page_description":"Кратер Фабри — большой древний ударный кратер в северном полушарии обратной стороне Луны. Название присвоено в честь французского физика Шарля Фабри и утверждено Международным астрономическим союзом в 1970 г. Образование кратера относится к донектарскому периоду."},{"page_url":"https://fr.wikipedia.org/wiki/Philippe-Jacques_de_Loutherbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Philipp_Jakob_Loutherbourg_d._J._002.jpg","page_title":"Philippe-Jacques de Loutherbourg","context_page_description":"Philippe-Jacques de Loutherbourg, connu aussi sous les prénoms de Philip James et Philipp Jakob, dit le jeune, né le 31 octobre 1740 à Strasbourg et mort le 11 mars 1812 à Chiswick, est un artiste anglais d’origine franco-suisse."},{"page_url":"https://it.wikipedia.org/wiki/Tempio_di_Apollo_(Siracusa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Syrakus_-_Tempio_di_Apollo.jpg","page_title":"Tempio di Apollo (Siracusa)","context_page_description":"Il tempio di Apollo è uno dei più importanti monumenti di Ortigia, antistante alla piazza Pancali a Siracusa. È certamente il più antico tempio dorico dell'Occidente greco."},{"page_url":"https://es.wikipedia.org/wiki/Unionoida","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Anodonta_anatina1.jpg","page_title":"Unionoida","context_page_description":"Los unionoides son un orden de moluscos bivalvos de agua dulce. Muchos de los bivalvos dulceacuícolas de mayor tamaño pertenecen a este orden, incluyendo las náyades, que pueden alcanzar un tamaño de hasta 20 cm. Todos los moluscos pertenecientes a este orden tienen en común un estado larvario parasitario en peces y conchas nacaradas con alto contenido en materia orgánica, que pueden agrietarse si se secan. No pueden sobrevivir profundamente enterrados en fondos sedimentarios debido a la escasa longitud de sus sifones.\\nExiste aproximadamente 900 especies dentro de este orden, todas ellas de agua dulce, distribuidas por los seis continentes. Muchas de estas especies están amenazadas debido a la degradación de su hábitat o a la sobre explotación, provocada por el interés que suscita sus conchas nacaradas."},{"page_url":"https://pt.wikipedia.org/wiki/Theresa_Kachindamoto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Theresa_Kachindamoto.jpg","page_title":"Theresa Kachindamoto","context_page_description":"Theresa Kachindamoto é a chefe suprema, ou Inkosi, do distrito de Dedza na região central do Malawi. Ela tem autoridade informal sobre mais de 900.000 pessoas. É conhecida por actuar energicamente contra casamentos infantis dissolvendo-os e por insistir na educação das crianças sem fazer distinção entre os sexos."},{"page_url":"https://mg.wikipedia.org/wiki/Ken_Burns","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Kenburns.jpg","page_title":"Ken Burns","context_page_description":"Ken Burns dia talen-koronantsary mizaka ny zom-pirenen'i Etazonia teraka ny 29 Jolay 1953"},{"page_url":"https://de.wikipedia.org/wiki/Valkhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Gravure_van_het_Valkhof%2C_vanuit_het_noorden_gezien_-_Nijmegen_-_20407383_-_RCE.jpg","page_title":"Valkhof","context_page_description":"Der Valkhof war eine mittelalterliche Königspfalz in Nijmegen in den Niederlanden."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AE%E1%83%9D%E1%83%90%E1%83%9C_%E1%83%9A%E1%83%90%E1%83%9E%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Joan_Laporta_-_001.jpg","page_title":"ხოან ლაპორტა","context_page_description":"ხოან ლაპორტა ესტრუჩი — ესპანელი პოლიტიკოსი, ბიზნესმენი, ადვოკატი, საფეხბურთო კლუბ „ბარსელონის“ 39-ე პრეზიდენტი 2003-2010 წლებში.\\nლაპორტა პროფესიით ადვოკატია, დაამთავრა ბარსელონის უნივერსიტეტის იურიდიული ფაკულტეტი. მის მიერ დაფუძნებული „Laporta & Arbós“ დღემდე ერთ-ერთი გავლენიანი სააგენტოა ესპანეთში. ხოანმა თავდაპირველი პოპულარობა პოლიტიკური კარიერით მოიპოვა. 1990-იან წლებში იყო „კატალონიის დამოუკიდებლობის მომხრეთა“ ლიდერი, თუმცა პარტია 1998 წელს გაუქმდა.\\n2002 წლიდან მუშაობა დაიწყო საფეხბურთო კლუბ „ბარსელონაში“. 2003 წლის საპრეზიდენტო არჩევნებში მან ხმათა უმეტესობა, 52.7% მიიღო და გახდა კატალონიური გრანდის პრეზიდენტი. მისი უდიდესი მიღწევა პრეზიდენტობის პერიოდში კლუბის მსოფლიოს ვარსკვლავი ფეხბურთელებით დაკომპლექტება იყო. ლაპორტას დროს „ბარსელონამ“ ფრანკ რეიკარდის ხელმძღვანელობით შეძლო 14 წლიანი პაუზის შემდეგ უეფა-ს ჩემპიონთა ლიგის მოგება, პეპ გუარდიოლას გაწრთვნილმა კლუბმა კი 2008/09 წლების სეზონში ტრიპლეტის დაუფლებით დაიწყო ახალი ერა კლუბისა და ფეხბურთის ისტორიაში.\\nხოან ლაპორტას საპრეზიდენტო ვადა 2010 წლის 30 ივნისს ამოეწურა, რის შემდეგაც დაუბრუნდა პოლიტიკურ კარიერას."},{"page_url":"https://de.wikipedia.org/wiki/Liste_donauschw%C3%A4bischer_Pers%C3%B6nlichkeiten","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ferenc_Schafarzik.jpg","page_title":"Liste donauschwäbischer Persönlichkeiten","context_page_description":"Die Liste donauschwäbischer Persönlichkeiten enthält eine Übersicht bedeutender in den donauschwäbischen Siedlungsgebieten angesiedelter oder geborener Personen."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Itaqui","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bandeira_do_itaqui.png","page_title":"Itaqui","context_page_description":"Itaqui sī ūi-tī Pa-se Rio Grande do Sul chiu ê chi̍t ê chū-tī-thé.\\nChe sī chi̍t phiⁿ koan-î Pa-se tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://pl.wikipedia.org/wiki/Gminy_w_Szwecji","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Uppsala_Municipality_in_Uppsala_County.png","page_title":"Gminy w Szwecji","context_page_description":"Szwecja podzielona jest na 21 regionów administracyjnych i 290 gmin. Niniejsza tabela zawiera listę szwedzkich gmin."},{"page_url":"https://hu.wikipedia.org/wiki/Radnalajosfalva","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kirlibaba-kath.jpg","page_title":"Radnalajosfalva","context_page_description":"Radnalajosfalva település Romániában, Suceava megyében."},{"page_url":"https://fr.wikipedia.org/wiki/Fontaine_%C3%A9rig%C3%A9e_en_l%27honneur_de_Claude","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Fontaine_%C3%A9rig%C3%A9e_en_l%27honneur_de_Claude_MBALyon_2018_3.jpg","page_title":"Fontaine érigée en l'honneur de Claude","context_page_description":"La Fontaine érigée en l'honneur de Claude a été découverte en 1967, à l'occasion du percement du tunnel de Fourvière. Cette borne-fontaine se dressait à l'origine sur la rive droite de la Saône, sur les pentes de la colline de Fourvière, au bas de la montée de Choulans. L'eau s'écoulait à travers la bouche d'une tête de Cyclope. Au-dessus, l'inscription indique que la fontaine a été offerte par deux personnages qui l'ont dédiée à Jupiter en l'honneur de Claude. Ce monument lyonnais est un unicum."},{"page_url":"https://nl.wikipedia.org/wiki/Christchurch_(Nieuw-Zeeland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Christchurch_178_Brill_car.jpg","page_title":"Christchurch (Nieuw-Zeeland)","context_page_description":"Christchurch is de grootste stad op het Zuidereiland en de op een na grootste stad van Nieuw-Zeeland met ruim 380.000 inwoners. De stad is vernoemd naar het Christ Church-college van de Universiteit van Oxford en ligt halverwege de oostkust aan de monding van de rivier de Avon. Op 31 juli 1856 werd Christchurch per Royal charter een stad en is daarmee de oudste stad in Nieuw-Zeeland.\\nVeel gebouwen in Christchurch zijn in neogotische stijl gebouwd en in de stad zijn veel parken en plantsoenen te vinden. Hierdoor doet de stad erg Europees aan. Hij wordt ook wel 'de meest Engelse stad buiten Engeland' genoemd. Christchurch Botanic Gardens is een bekende botanische tuin in Christchurch."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D0%B4%D0%B5%D1%80_%D0%A4%D1%80%D0%B5%D0%B4%D1%80%D1%96%D0%BA%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Peder_Fredricson.jpg","page_title":"Педер Фредріксон","context_page_description":"Педер Фредріксон — шведський вершник, олімпійський медаліст."},{"page_url":"https://eu.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Plas_Gronow%2C_1794.jpg","page_title":"John Ingleby","context_page_description":"John Ingleby margolaria eta miniaturista izan zen."},{"page_url":"https://pl.wikipedia.org/wiki/Premierzy_Wielkiej_Brytanii","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Henry_Campbell-Bannerman_photo.jpg","page_title":"Premierzy Wielkiej Brytanii","context_page_description":"Chronologiczna lista premierów Wielkiej Brytanii"},{"page_url":"https://sv.wikipedia.org/wiki/La_Harmoye","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Map_commune_FR_insee_code_22073.png","page_title":"La Harmoye","context_page_description":"La Harmoye är en kommun i departementet Côtes-d'Armor i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Plœuc-sur-Lié som tillhör arrondissementet Saint-Brieuc. År 2009 hade La Harmoye 425 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Minister_for_Foreign_Affairs_(Finland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ahti_Karjalainen.jpg","page_title":"Minister for Foreign Affairs (Finland)","context_page_description":"The Minister for Foreign Affairs handles the Finnish Government's foreign policy and relations, and is in charge of the Ministry for Foreign Affairs. The Minister for Foreign Trade and Development is also associated with this ministry.\\nThe current Minister for Foreign Affairs is Pekka Haavisto of Green League."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AB%98%E9%9B%84%E6%B0%B4%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/%E9%AB%98%E9%9B%84%E6%B0%B4%E9%81%93%E6%B0%B4%E6%BA%90%E5%9C%B0%E5%B9%B3%E9%9D%A2%E5%9C%96.jpg","page_title":"高雄水道","context_page_description":"高雄水道，原稱打狗水道，為台灣日治時期高雄市的自來水供應設施，於1913年10月完工。其水源為發源自中央山脈，由荖濃溪和楠梓仙溪匯合的高屏溪，在九曲堂附近的高屏溪沙洲設有集水井取水；取水後經唧筒送至「小坪頂水源地」及淨水廠，再送至「壽山淨水池」以供應高雄市用水。其現今仍運作中，由台灣自來水公司管理。\\n高雄水道是台灣繼淡水水道、基隆水道、彰化水道、臺北水道後的第五個水道系統，而在初期設置的規模僅次於台北水道，為當時台灣南北兩大上水道系統。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%81%E5%AE%B6%E5%82%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Alan_Leong_2013.jpg","page_title":"梁家傑","context_page_description":"梁家傑，SC，廣東新會人，香港資深大律師，公民黨主席，前任黨魁及副主席、香港立法會議員、泛民會議及前香港大律師公會主席，代表東九龍。\\n2014年度香港立法會工務委員會主席。在立法會政府帳目委員會與官員對質著稱，任內參與調查廉政專員湯顯明隱瞞應酬帳目案、旅遊事務署盛事基金亂花公款案等。\\n梁家傑任公民黨副主席時，曾參加2007年香港行政長官選舉，稱「要顯示小圈子選舉的不公義」。在該次選舉與爭取連任的曾蔭權一對一競選，兩人在電視直播辯論上針鋒相對，成為一時佳話。是次選舉亦令梁家傑名望大增，後來在2014－2015年，雨傘革命期間成為泛民會議召集人。"},{"page_url":"https://cs.wikipedia.org/wiki/2._stolet%C3%AD_p%C5%99._n._l.","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/%E6%BC%A2%E6%AD%A6%E5%B8%9D.jpg","page_title":"2. století př. n. l.","context_page_description":"2. století před naším letopočtem je období od roku 200 př. n. l. do roku 101 př. n. l."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Walsrode","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Lange_Stra%C3%9Fe_16_Walsrode.jpg","page_title":"Liste der Baudenkmale in Walsrode","context_page_description":"In der Liste der Baudenkmale in Walsrode sind alle denkmalgeschützten Bauten der niedersächsischen Gemeinde Walsrode. Der Stand der Liste ist das Jahr 2001.\\nDie Baudenkmale in den Außenbezirken stehen in der Liste der Baudenkmale in Walsrode."},{"page_url":"https://en.wikipedia.org/wiki/CO-methylating_acetyl-CoA_synthase","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/PDB_1ru3_EBI.jpg","page_title":"CO-methylating acetyl-CoA synthase","context_page_description":"Acetyl-CoA synthase, not to be confused with Acetyl-CoA synthetase or Acetate-CoA ligase, is a nickel-containing enzyme involved in the metabolic processes of cells. Together with Carbon monoxide dehydrogenase, it forms the bifunctional enzyme Acetyl-CoA Synthase/Carbon Monoxide Dehydrogenase found in anaerobic organisms such as archaea and bacteria. The ACS/CODH enzyme works primarily through the Wood–Ljungdahl pathway which converts carbon dioxide to Acetyl-CoA. The recommended name for this enzyme is CO-methylating acetyl-CoA synthase."},{"page_url":"https://en.wikipedia.org/wiki/Mike_Pence","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mike_Pence_swearing_in_ceremony.jpg","page_title":"Mike Pence","context_page_description":"Michael Richard Pence is an American politician and attorney serving as the 48th and current vice president of the United States, since 2017. He previously was the 50th governor of Indiana from 2013 to 2017 and a member of the United States House of Representatives from 2001 to 2013.\\nPence was born and raised in Columbus, Indiana, and is the younger brother of U.S. representative Greg Pence. He graduated from Hanover College and earned a law degree from the Indiana University Robert H. McKinney School of Law before entering private practice. After losing two bids for a congressional seat in 1988 and 1990, he became a conservative radio and television talk show host from 1994 to 1999. Pence was elected to the United States Congress in 2000 and represented Indiana's 2nd congressional district and Indiana's 6th congressional district in the House of Representatives from 2001 to 2013. He served as the chairman of the House Republican Conference from 2009 to 2011. Pence described himself as a \\"principled conservative\\" and supporter of the Tea Party movement, stating that he was \\"a Christian, a conservative, and a Republican, in that order.\\""},{"page_url":"https://de.wikipedia.org/wiki/Joachim_Tilsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Joachim_Tilsch_2019_-_02.jpg","page_title":"Joachim Tilsch","context_page_description":"Joachim Tilsch ist ein deutscher Kunstmaler. Seine Spezialität sind Acrylbilder, häufig in Verbindung mit Spachtelarbeiten.\\nJoachim Tilsch ist das fünfte von sechs Geschwistern. Er besuchte von 1966 bis 1976, von der ersten bis zur zehnten Klasse, die POS I „Arkadi Gaidar“ in Schöneiche. Als Schüler wirkte er am Kinderstudio der Komischen Oper in Berlin mit und erlernte hier auch Musikinstrumente zu spielen. Nach der Schule folgte die Berufsausbildung mit Abitur im Zementwerk Rüdersdorf. Während dieser Zeit besuchte er auch Malkurse und Malzirkel. Nach der Ausbildung leistete Tilsch zwischen 1979 und 1981 seinen 18-monatigen Grundwehrdienst ab. Danach wurde er an der Komischen Oper Bühnenmaler und studierte zudem Malerei an der Kunsthochschule Berlin-Weißensee im Abendstudium. 1984 begann er ein Studium an der Hochschule für Bildende Künste Dresden, das er 1987 beendete. Es folgte von 1987 bis 1988 eine erneute Tätigkeit an der Komischen Oper, seit 1989 ist Tilsch selbstständiger Künstler, der in seinem Heimatort Schöneiche lebt und arbeitet. Bei der Gemeinderatswahl 2014 trat er als unabhängiger Kandidat auf der Liste von Bündnis 90/Die Grünen an, erlangte aber knapp kein Mandat."},{"page_url":"https://hu.wikipedia.org/wiki/VIII._Kelemen_(ellenp%C3%A1pa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Palma_Antipapa_Clemens_VIII.JPG","page_title":"VIII. Kelemen (ellenpápa)","context_page_description":"VIII. Kelemen néven lépett fel a katolikus egyház történetének harminchatodik ellenpápája. A nyugati egyházszakadás történetének utolsó felvonásaképpen a XIII. Benedek, Avignoni pápához hű klérus tagjainak egyike volt, akit Benedek halála után a megmaradt három bíboros megválasztott a pápai trónra. Mivel mindössze két másik bíboros választotta meg, és mivel nem állt mögötte jelentős világi hatalom, tulajdonképpen minden hatalom nélkül birtokolta a pápai címet, amelyről 1429-ben le is mondott."},{"page_url":"https://pl.wikipedia.org/wiki/Tomasz_K%C5%82osowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Tomasz_K%C5%82osowski_SCz_01.JPG","page_title":"Tomasz Kłosowski","context_page_description":"Tomasz Kłosowski − polski fotografik i dziennikarz, autor filmów przyrodniczych, podróżnik.\\nJest bratem malarza Grzegorza Kłosowskiego, z którym wspólnie wydają albumy fotograficzne z własnymi zdjęciami przyrody polskiej. Tomasz Kłosowski jest współautorem cyklu przyrodniczego „Dzika Polska” i „Tańczący z naturą” realizowanego dla Telewizji Polskiej."},{"page_url":"https://en.wikipedia.org/wiki/List_of_synagogues_in_Hungary","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Gy%C3%B6ngy%C3%B6s_City_Television_building._Former_synagogue._Listed_ID_5670._-_Eszperant%C3%B3_St.%2C_Gy%C3%B6ngy%C3%B6s%2C_Hungary.JPG","page_title":"List of synagogues in Hungary","context_page_description":"This List of synagogues in Hungary contains active, otherwise used and destroyed synagogues in Hungary.\\nAt the beginning of the 20th century, there were several synagogues in Hungary. Most of them had extremely artistic exterior and interior designs. There were many classicists, many romantic, many eclectic, and some Art Nouveau style. Several of them were designed to be monumental in size to show the greatness and richness of Judaism – similar to contemporary Christian churches.\\nHowever, during World War II, several synagogues were destroyed or significantly damaged. Much was demolished immediately after World War II. Many buildings could not be supported by Hungarian Jewry, which was reduced in number due to the Holocaust, and were sold by local governments in the 1950s and 1960s. These bodies were renovated for more of their cultural purposes - but there was one that was used as a warehouse without any preservation. Some were transformed into shops – and unfortunately some were dismantled as well. Examples of the latter include the huge Eger Synagogue, the Makó Neolog Synagogue and the Salgótarján Synagogue."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D8%A8%D9%86%D9%82%D8%A7_%D8%AF_%DA%A9%D8%A7%D9%85%D9%BE%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Iglesia_de_Revenga_de_Campos.jpg","page_title":"ربنقا د کامپس","context_page_description":"ربنقا د کامپس ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و پالنسیا اوستانینده یئرلشیب. بۇ شهرین مساحتی ۲۲ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۱۷۹ نفر و اها‌لی سیخلیغی ۸٫۱ اینسان کیلومتر موربّع دیر."},{"page_url":"https://cs.wikipedia.org/wiki/Pavel_Albieri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Marshall_Pass_Eastern_Slope_Albieri.jpg","page_title":"Pavel Albieri","context_page_description":"Pavel Albieri, vl. jm. Jan Mucek, byl česko-americký spisovatel, básník, novinář a fotograf. Byl velmi aktivní a podnikavý. V mládí se proslavil řadou populárních, umělecky nepříliš hodnotných povídek, hlavně z vojenského prostředí. V letech 1884–89 vydával v Jaroměři a Hradci Králové regionální časopis Ratibor. Roku 1889 organizoval pobyt českých návštěvníků na Světové výstavě v Paříži, v roce 1895 působil jako korespondent Národopisné výstavy. V letech 1890–95 a po roce 1898 pobýval v USA, kde se zabýval obchodem a redigoval časopisy pro českou menšinu; do Čech zasílal cestopisy a reportáže, ilustrované fotografiemi a mapami. Tragicky zahynul při pádu pod vlak na dovolené v Texasu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%8C%D0%B5,_%D0%9B%D0%B5%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/L%C3%A9on_Cogniet_-Tintoretto_Painting_His_Dead_Daughter.jpg","page_title":"Конье, Леон","context_page_description":"Леон Конье — французский художник, представитель неоклассицизма и романтизма."},{"page_url":"https://pl.wikipedia.org/wiki/Monthou-sur-Cher","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Le_Gu%C3%A9-P%C3%A9an_castle%2C_aerial_view.jpg","page_title":"Monthou-sur-Cher","context_page_description":"Monthou-sur-Cher – miejscowość i gmina we Francji, w Regionie Centralnym, w departamencie Loir-et-Cher.\\nWedług danych na rok 1990 gminę zamieszkiwało 867 osób, a gęstość zaludnienia wynosiła 43 osoby/km²."},{"page_url":"https://de.wikipedia.org/wiki/Elektronenr%C3%B6hre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Elektronenroehre_real.png","page_title":"Elektronenröhre","context_page_description":"Eine Elektronenröhre ist ein aktives elektrisches Bauelement mit Elektroden, die sich in einem evakuierten oder gasgefüllten Kolben aus Glas, Stahl oder Keramik befinden. Die Anschlüsse der Elektroden sind aus dem Röhrenkolben nach außen geführt. In ihrer einfachsten Form als Diode enthält eine Elektronenröhre eine beheizte Kathode und eine Anode. Elektronenröhren dienen zur Erzeugung, Gleichrichtung, Verstärkung oder Modulation elektrischer Signale.\\nAus der Glühkathode treten negativ geladene Elementarteilchen als freie Elektronen aus und werden durch die Wirkung eines elektrischen Feldes zur Anode bewegt. Dieser Elektronenstrom lässt sich durch ein Steuergitter zwischen Kathode und Anode beeinflussen, denn durch unterschiedliche Gitterspannungen bzw. elektrische Felder wird der Elektronenfluss stärker oder geringer gehemmt. Darauf beruht die Verwendung der Elektronenröhre als Verstärker oder Oszillator.\\nElektronenröhren waren bis zur Einführung des Transistors die einzigen schnellen aktiven Bauelemente der Elektronik."},{"page_url":"https://de.wikipedia.org/wiki/Fleischfressende_Pflanzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/D_capensis_fang.jpg","page_title":"Fleischfressende Pflanzen","context_page_description":"Als fleischfressende Pflanzen, auch Karnivoren oder Insektivoren, bezeichnet man Pflanzen, die mittels umgewandelter Blätter meist Einzeller oder Gliedertiere, aber auch größere Beutetiere bis hin zu Fröschen fangen und verdauen und so ihre Versorgung mit Mineralstoffen, vor allem Stickstoff, an extremen Standorten wie Mooren oder blanken Felsen verbessern."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A2%D8%B1%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Centum_Satem_map.png","page_title":"آریا","context_page_description":"سنسکرت زبان میں آریا کے معنی ”بزرگ“ اور ”معزز“ کے ہیں۔ یہ اُس قوم کا نام ہے جو تقریباً اڑھائی ہزار سال قبل مسیح وسط ایشیاء سے چراگاہوں کی تلاش میں نکلی اور ایران کو پامال کرتی ہوئی پاکستان میں وارد ہوئی اور یہاں کے قدیم مہذب قوموں دراوڑ کو جنوب کی طرف دھکیل کر خود ملک پر قبضہ کر لیا۔ آریاؤں کے کچھ قبیلوں نے یورپ کا رخ کیا اور وہاں جاکر آباد ہو گئے۔\\nآریہ سفید رنگت، دراز قد اور بہادر تھے کردار کی بلندی اور تنظیم کی صفات ان میں موجود تھیں۔ ابتدا میں ان کا پیشہ گلہ بانی تھا جو رفتہ رفتہ کھیتی باڑی میں تبدیل ہو گیا۔ نہایت سادہ زندگی بسر کرتے تھے۔ دودھ، مکھن، سبزیاں اور اناج عام خوراک تھی۔ میلوں اور تہواروں میں مرد و عورتیں آزادانہ شریک ہوتے تھے۔ سورج، آگ، پانی، بادل اور دیگر مظاہر قدرت کی پوجا یعنی عبادت کی جاتی تھی۔ دیوتا کو خوش کرنے کے لیے جانوروں کی قربانی کا رواج تھا۔"},{"page_url":"https://en.wikipedia.org/wiki/Lake_Pavilion,_Copenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/S%C3%B8pavillionen_1920.jpg","page_title":"Lake Pavilion, Copenhagen","context_page_description":"The Lake Pavilion is a historic building at The Lakes in central Copenhagen, Denmark. Situated on the north side of Gyldenløvesgade, on the embankment that separates Peblinge Lake and Sankt Jørgens Lake, it was completed in 1895 to a Historicist design by Vilhelm Dahlerup and listed in 1984."},{"page_url":"https://da.wikipedia.org/wiki/Morten_Harket","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Morten_Harket_Kongsberg_Jazzfestival_2018_%28221359%29.jpg","page_title":"Morten Harket","context_page_description":"Morten Harket er en norsk sanger, sangskriver, musiker og komponist, der er kendt som forsanger i det norske synthpop-band a-ha, der blev dannet i 1982.\\nFør a-ha var Harket sanger i blues-bandet Souldier Blue. Han har sidenhen udgivet fire soloalbums og var i 1996 vært for Eurovision Song Contest i Oslo. I 2002 fremførte han UNICEF's officielle sang sammen med Hayley Westenra. Morten Harket har desuden optrådt fire gange ved The Nobel Peace Prize Concert; som soloartist i 1995 og 2007 og med a-ha i 1998 og 2001.\\nMorten Harket har siden 2000 været indehaver af verdensrekorden for at holde samme tone længst tid ved en live-optræden. I sangen Summer Moved On lykkedes det ham at holde tonen i hele 20,2 sekunder.\\nHarket har engageret sig i bistands- og miljøspørgsmål, bl.a. gennem Amnesty International."},{"page_url":"https://ceb.wikipedia.org/wiki/Saint-Hippolyte_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/St-Hippolyte_QC_1.jpg","page_title":"Saint-Hippolyte (munisipyo)","context_page_description":"Munisipyo ang Saint-Hippolyte sa Kanada. Nahimutang ni sa kondado sa Laurentides ug lalawigan sa Québec, sa habagatan-sidlakang bahin sa nasod, 140 km sa sidlakan sa Ottawa ang ulohan sa nasod. Saint-Hippolyte nga nahimutang sa lanaw sa Lac de l'Achigan.\\nAng klima hemiboreal. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -14 °C. Ang kasarangang pag-ulan 1,133 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 155 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 54 milimetro."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BB%D0%BE%D1%88_%D0%A6%D1%80%D1%9A%D0%B0%D0%BD%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/sr/f/fe/%D0%A1%D0%B2%D1%98%D0%B5%D0%B4%D0%BE%D1%87%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%9F%D0%B5%D1%82%D1%80%D0%B0_%D0%88%D0%BE%D0%BA%D1%81%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%9B%D0%B0.jpg","page_title":"Милош Црњански","context_page_description":"Милош Црњански је био српски књижевник и један од најзначајнијих стваралаца српске литературе 20. века. Истакао се као песник, приповедач, романсијер и публициста. Бавио се и ликовном критиком. Убрајан је и међу 100 најзнаменитијих Срба."},{"page_url":"https://nl.wikipedia.org/wiki/Franklin_(Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/4th_ave_main_street_historic_franklin_tennessee_2010.jpg","page_title":"Franklin (Tennessee)","context_page_description":"Franklin is een plaats in het midden van de Amerikaanse staat Tennessee, en valt bestuurlijk gezien onder Williamson County. De stad is vernoemd naar Benjamin Franklin."},{"page_url":"https://sl.wikipedia.org/wiki/Murviel-l%C3%A8s-B%C3%A9ziers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Canton_de_murviel_les_beziers.png","page_title":"Murviel-lès-Béziers","context_page_description":"Murviel-lès-Béziers je naselje in občina v južnem francoskem departmaju Hérault regije Languedoc-Roussillon. Leta 2009 je naselje imelo 2.796 prebivalcev."},{"page_url":"https://bs.wikipedia.org/wiki/Stra%C5%BEi%C5%A1%C4%8De_(Cerknica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Strazisce_Cerknica_Slovenia_-_spring.jpg","page_title":"Stražišče (Cerknica)","context_page_description":"Stražišče su naseljeno mjesto u sastavu općine Cerknica, regija Primorsko-notranjska, Slovenija."},{"page_url":"https://en.wikipedia.org/wiki/Carrollton_Manor","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Manor_House_on_Carrollton_Manor.jpg","page_title":"Carrollton Manor","context_page_description":"Carrollton Manor was a 17,000 acre tract of land in Frederick County, Maryland, United States, which extended from the Potomac River on the south, Catoctin Mountain to the west, the Monocacy River to the east, and Ballenger Creek to the north. It included the towns of Lime Kiln, Buckeystown, Adamstown, Doubs, Licksville, Tuscarora and Point of Rocks.\\nCharles Carroll of Annapolis granted the entire estate to his son, Charles Carroll of Carrollton. It is from this tract of land that he took his title, \\"Charles Carroll of Carrollton.\\" While Charles Carroll of Carrollton never lived on Carrollton Manor, he erected a manor house there, Tuscarora, where he spent a few days or weeks at a time. The eldest daughter of Charles Carroll of Carrollton married Richard Caton and was the mother of the \\"three American graces\\" who married British noble men: the eldest, Marianne, marrying the Marquess Wellesley, K.G., a brother of the 1st Duke of Wellington; the second, Louisa Catherine, first to Sir Felton Hervey-Bathurst, 1st Baronet and later the 7th Duke of Leeds; and the third, Elizabeth, the 8th Lord Stafford."},{"page_url":"https://da.wikipedia.org/wiki/Fredede_bygninger_i_Bornholms_Regionskommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Nex%C3%B8%2C_K%C3%B8bmagergade_33%2C_Amtsg%C3%A5rden%2C_2019-07-27%2C_yj.jpg","page_title":"Fredede bygninger i Bornholms Regionskommune","context_page_description":"Denne liste over fredede bygninger i Bornholms Regionskommune viser alle fredede bygninger i Bornholms Regionskommune, bortset fra kirker. Listen bygger på data fra Kulturarvsstyrelsen."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%BB%D1%83%D0%BD%D0%B8%D0%B5_(%D1%80%D0%BE%D0%BC%D0%B0%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Twilight_Saga.jpg","page_title":"Новолуние (роман)","context_page_description":"Новолуние е роман от жанра фентъзи-романс от писателката Стефани Мейер. Това е вторият роман от сагата Здрач. Тази книга, за разлика от предходната, е по-скоро за загубата на любовта. Първоначалното изданието е публикувано с твърди корици през 2006."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Gerlachsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/199007Gerlachsheim01.jpg","page_title":"Kloster Gerlachsheim","context_page_description":"Das Kloster Gerlachsheim, auch Prämonstratenserpriorat Gerlachsheim, nach 1803 Schloss Gerlachsheim, ist ein ehemaliges Frauen- und späteres Männerkloster des Prämonstratenserordens in Gerlachsheim im Main-Tauber-Kreis. Zu dem Kloster gehört auch der anliegende Park, der früher als Klostergarten genutzt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Mangere_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Mangere.jpg","page_title":"Mangere Island","context_page_description":"Mangere Island ist eine kleine Insel, die zu den Chatham-Inseln gehört, die sich insgesamt auf eine Seefläche von rund 7000 km² verteilen. Die Insel liegt rund 650 km südöstlich der Nordinsel Neuseelands und rund 860 km östlich von Christchurch entfernt. Die Insel ist unbewohnt. Politisch gehört sie zum Chatham Islands Territory, der kleinsten Verwaltungseinheit Neuseelands.\\nMangere Island und die angrenzende Little Mangere Island sind die erodierten Überreste eines erloschenen Vulkans aus dem Pliozän. Der höchste Punkt der Insel, Whakapa, liegt 292 Meter über dem Meeresspiegel.\\nDie Insel war bis in die 1890er Jahre bewaldet und wurde dann abgeholzt, um Weideland für Schafe zu schaffen. Kaninchen und später Katzen gelangten im Rahmen der landwirtschaftlichen Nutzung ebenfalls auf die Insel. Die landwirtschaftliche Nutzung endete 1966, die neuseeländische Regierung ließ die Insel aufkaufen und als Naturreservat ausweisen. Die letzten Schafe wurden 1968 von der Insel verbracht, seitdem wird versucht, die Fauna und Flora der Insel wieder zu regenerieren. Mehrere für die Chathaminseln endemische Vogelarten sind seitdem auf der Insel wieder eingeführt."},{"page_url":"https://fr.wikipedia.org/wiki/Longueval","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Demarquay%2C_Jean-Nicolas_%28phot._Sarrault%29.jpg","page_title":"Longueval","context_page_description":"Longueval est une commune française située dans le département de la Somme, en région Hauts-de-France."},{"page_url":"https://et.wikipedia.org/wiki/A._H._Tammsaare_m%C3%A4lestusm%C3%A4rk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/A._H._Tammsaare_monumendi_avamine_78_%2803%29.jpg","page_title":"A. H. Tammsaare mälestusmärk","context_page_description":"A. H. Tammsaare mälestusmärk on skulptor Jaak Soansi ja arhitekt Rein Luubi 1978. aastal eesti kirjaniku A. H. Tammsaare mälestuseks tema 100. sünniaastapäeva puhul valmistatud kuju, mis asub Tallinna Kesklinnas Tammsaare pargis.\\nTammsaaret on kujutatud mõtlikuna pingil istumas. Kuju asukoha valikul arvestati, et praeguse Tammsaare pargi kohal asunud Uus turg oli Tammsaare meeliskoht, kus ta armastas inimesi jälgida."},{"page_url":"https://it.wikipedia.org/wiki/Colle_della_Gragliasca","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Colle_e_punta_gragliasca_dal_gran_gabe.jpg","page_title":"Colle della Gragliasca","context_page_description":"Il Colle della Gragliasca è un valico alpino delle Alpi Biellesi situato tra la Provincia di Biella e la Provincia di Aosta che collega la Valle Cervo con la Valle del Lys, ed in particolare i paesi di Rosazza e di Fontainemore."},{"page_url":"https://simple.wikipedia.org/wiki/Yanka_Kupala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Yanka_Kupala_in_Saint_Petersburg%2C_1909.jpg","page_title":"Yanka Kupala","context_page_description":"Yanka Kupala was the pen name of Ivan Daminikavich Lutsevich. He was a Belarusian poet and writer. Kupala is said to be one of the greatest Belarusian-language writers of the 20th century."},{"page_url":"https://en.wikipedia.org/wiki/Pearl_River_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Pearl_River_train_station.jpg","page_title":"Pearl River station","context_page_description":"Pearl River is a railroad station in Pearl River, New York. It serves NJ Transit and Metro-North Railroad trains on the Pascack Valley Line. It is located at 35 South Main Street between West Central Avenue and Jefferson Avenue. Pearl River is the last station in New York, heading from Spring Valley towards Hoboken Terminal."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8F%B2%E5%BE%8B%E5%AE%BE%E7%A9%BF%E5%B1%B1%E7%94%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Philippine_Pangolin_area.png","page_title":"菲律宾穿山甲","context_page_description":"菲律賓穿山甲也稱 巴拉望穿山甲，是產自菲律賓巴拉望島及其附屬島嶼的一種穿山甲，曾被認為是馬來穿山甲的亞種，2005 年起獨立成為一個新物種。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AC%D8%B3%D9%85%D9%87_%D8%B1%D8%A7%D8%A8%D8%B1%D8%AA_%D8%A7%D8%AF%D9%88%D8%A7%D8%B1%D8%AF_%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Robert_E_Lee_Univ_of_Texas.jpg","page_title":"مجسمه رابرت ادوارد لی","context_page_description":"مجسمه رابرت ادوارد لی یک تندیس اسب‌سوار از فرمانده ارتش مؤتلفهٔ ویرجینیای شمالی در جنگ داخلی آمریکا رابرت ئی. لی است که در پارک آزادی بردگان در شهر شارلوتزویل، ویرجینیا قرار دارد. در اوت سال ۲۰۱۷ در اثر تصمیم شهرداری شارلوتزویل به حذف این مجسمه گردهمایی اتحاد راست‌گرایان ۲۰۱۷ در این شهر برگزار شد."},{"page_url":"https://sk.wikipedia.org/wiki/Je%C4%BCena_Ostapenkov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Jelena_Ostapenko_%2834970618791%29.jpg","page_title":"Jeļena Ostapenková","context_page_description":"Jeļena Ostapenková je lotyšská profesionálna tenistka a víťazka ženskej dvojhry na French Open 2017, rovnako tak i wimbledonskej juniorky 2014."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D0%BA%D0%B0%D1%82%D0%B5%D0%BB_%D1%82%D0%B5%D0%BB%D0%B5%D1%84%D0%BE%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ot735.JPG","page_title":"Алкател телефони","context_page_description":"Алкател је француски бренд мобилних телефона у власништву финске компаније за електронику и користи се под лиценцом од стране кинеске компаније за електронику ТЦЛ Корпорејшон. Алкател бренд је лиценцирала 2005. године бивша француска компанија за електронику и телекомуникације Алкател-Луцент за ТЦЛ за мобилне телефоне и уређаје, а тренутна лиценца истиче крајем 2024. Нокија је купила имовину Алкател-Луцент-а 2016. године, а тиме и наследила уговоре о лиценцирању за Алкател бренд."},{"page_url":"https://sk.wikipedia.org/wiki/Karlovsk%C3%BD_mier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Territorial_changes_of_Poland_1699.jpg","page_title":"Karlovský mier","context_page_description":"Karlovský mier alebo Karlovický mier je mierová zmluva ktorou bola zakončená Veľká turecká vojna z rokov 1683 až 1697 medzi Svätou ligou a Osmanskou ríšou.\\nZmluva bola uzavretá roku 1699 v dnešnom srbskom meste Sriemske Karlovce. Označila definitívne stiahnutie osmanských Turkov zo strednej Európy, s ich prvými veľkými územnými stratami po storočiach expanzie a ustanovila Habsburskú monarchiu ako dominantnú mocnosť v regióne."},{"page_url":"https://fr.wikipedia.org/wiki/Plage_de_Durr%C3%ABs","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Durres_beach2005.jpg","page_title":"Plage de Durrës","context_page_description":"La plage de Durrës est la plage la plus grande et la plus visitée d'Albanie. Elle borde le front de mer de la ville de Durrës et mesure environ 10,5 kilomètres de longueur. Un certain nombre d'hôtels surplombent la plage, comme l'hôtel Adriatik.\\nCette destination est populaire auprès des Albanais, du Kosovo et de la Macédoine du Nord. C'est également une destination d'été et de week-end populaire pour les habitants de Tirana et Durrës. Le nombre estimé de touristes, dont la plupart fréquentent la plage pendant la période estivale, est d'environ 600 000 par an."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_gi%E1%BA%A3i_th%C6%B0%E1%BB%9Fng_c%E1%BB%A7a_Pro_Wrestling_Illustrated","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Sting_March_2015.jpg","page_title":"Danh sách giải thưởng của Pro Wrestling Illustrated","context_page_description":"Đây là danh sách các giải thưởng Pro Wrestling Illustrated còn hoạt động hoặc không hoạt động được bầu chọn bởi độc giả của Pro Wrestling Illustrated mỗi năm kể từ năm 1972, và ngày càng mở rộng thêm nhiều hạng mục hơn.\\nKhông giống như Wrestling Observer Newsletter, PWI là tờ báo lớn viết về những cảnh giới giả tưởng của đô vật chuyên nghiệp và các giải thưởng công nhận những điều đó."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%95%D1%80%D1%81%D0%B5%D1%80%D0%B0%D0%BD%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mairie_Herserange.JPG","page_title":"Ерсеранж","context_page_description":"Ерсеранж — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Мёрт а, Мозель а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://hu.wikipedia.org/wiki/Varga_Krisztina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Krisztina_Varga_in_the_Persona_dance_play.png","page_title":"Varga Krisztina","context_page_description":"Varga Krisztina magyar fizikai színházi rendező, koreográfus, színművész."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BA,_%D0%9E%D0%BB%D0%B5_%D0%AF%D0%BA%D0%BE%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Statsraad_Dr_O_J_Broch_-_1891.jpg","page_title":"Брок, Оле Якоб","context_page_description":"Оле Якоб Брок — норвежский математик, физик, экономист, педагог и политический деятель."},{"page_url":"https://vec.wikipedia.org/wiki/Les_Pinthi%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Les_Pinthi%C3%A8res_mairie_%C3%A9glise_Saint-Martin_Eure-et-Loir_France.jpg","page_title":"Les Pinthières","context_page_description":"Les Pinthières el xé on comun de 178 abitanti del departemento de Eure-et-Loir che el fa parte del rejon Sentro-Vałe de ła Loira in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2004/Ringen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Wood_vs._Zamanduridis_in_second_pool_round_of_66_kg_Greco-Roman_wrestling_at_2004_Summer_Olympics.jpg","page_title":"Olympische Sommerspiele 2004/Ringen","context_page_description":"Bei den XXVIII. Olympischen Sommerspielen 2004 in Athen fanden 18 Wettkämpfe im Ringen statt. Bei den Männern gab es je sieben Gewichtsklassen im Freistil und im griechisch-römischen Stil. Erstmals auf dem Programm standen vier Freistil-Gewichtsklassen bei den Frauen. Austragungsort war die Ano Liossia Olympic Hall."},{"page_url":"https://cs.wikipedia.org/wiki/T%C5%99ebovice_(Ostrava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/T%C5%99ebovice_CoA.jpg","page_title":"Třebovice (Ostrava)","context_page_description":"Třebovice jsou bývalá obec a od roku 1990 také městský obvod statutárního města Ostravy o rozloze 281,96 hektarů. Rozkládají se nad soutokem Odry a Opavy.\\nMěstský obvod je známý hlavně svými kulturními památkami, společně s kulturními akcemi, přírodní památkou Turkov."},{"page_url":"https://hr.wikipedia.org/wiki/Zgrada_Op%C4%87ine_u_Zvorniku","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Zgrada_op%C5%A1tine_Zvornik.jpg","page_title":"Zgrada Općine u Zvorniku","context_page_description":"Zgrada Općine je građevina u Zvorniku."},{"page_url":"https://war.wikipedia.org/wiki/Phocoena_phocoena","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ecomare_-_skelet_bruinvis_%28bruinvis-skelet-sd%29.jpg","page_title":"Phocoena phocoena","context_page_description":"An Phocoena phocoena in uska species han Mammalia nga syahan ginhulagway ni Linnaeus hadton 1758. An Phocoena phocoena in nahilalakip ha genus nga Phocoena, ngan familia nga Phocoenidae. Ginklasipika han IUCN an species komo diri gud kababarak-an."},{"page_url":"https://it.wikipedia.org/wiki/Okskaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/MosMetro_Okskaya_-_entrance.jpg","page_title":"Okskaja","context_page_description":"Okskaja è una stazione della linea 15 della metropolitana di Mosca. Inaugurata il 27 marzo 2020, la stazione serve il quartiere di Rjazanskij. È una delle poche stazioni della rete ad avere banchine laterali e non ad isola. Particolarità della stazione è data dall'illuminazione, composta da dei led circolari inseriti nel soffitto blu, che danno l'effetto di riflettersi come cerchi nell'acqua sul pavimento, realizzato in granito grigio siberiano."},{"page_url":"https://es.wikipedia.org/wiki/Soskil","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Ficha_por_1_Tramo_de_Sosquil_de_la_Hacienda_Oxtapacab_%2801%29%28anverso_y_reverso%29.jpg","page_title":"Soskil","context_page_description":"Soskil o sosquil, nombre en lengua maya que se da en la península de Yucatán, México, al cáñamo o fibra natural obtenida de las pencas del henequén, mediante un procedimiento de desfibración que permite extraer de la planta su contenido celulósico en forma de filamentos finos, con los que se elaboran tejidos, jarcias, cordeles y diversas artesanías. Según el Diccionario Maya - Español de Alfredo Barrera Vásquez, editado por Cordemex en Mérida, en 1980, Soski, es el:\\ncáñamo de esta tierra que está ya sacado de las pencas; la expresión xen ch'a u soskiil, significaría: ve trae el cáñamo.​"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A2%E1%83%9D%E1%83%9A%E1%83%94%E1%83%9C%E1%83%A1%E1%83%98%E1%83%A1_%E1%83%A0%E1%83%94%E1%83%90%E1%83%92%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Formic_acid.svg","page_title":"ტოლენსის რეაგენტი","context_page_description":"ტოლენსის რეაგენტი — ქიმიური რეაგენტი, რომლის საშუალებით ხდება ალდეჰიდების, ალფა-ჰიდროქსი კეტონების და არომატული ალდეჰიდების ფუნქციონალური ჯგუფების აღმოჩენა. მისი ფორმულაა [Ag(NH₃)₂]ОН. ამ რეაგენტის ხსნარი შედგება ამიაკში გახსნილი ვერცხლის ოქსიდისაგან. რეაგენტს სახელი ეწოდა გერმანელი ქიმიკოსის ბერნჰარდ ტოლენსის საპატივცემულოდ, რომელმაც აღმოაჩინა ეს რეაგენტი. მაგალითისათვის, როდესაც ტოლენსის რეაგენტი რეაქციაში შედის ალდეჰიდთან, ალდეჰიდი დაიჟანგება მის შესაბამის კარბონმჟავამდე, ხოლო მეტალური ვერცხლი დაილექება არა სინჯარის ფსკერზე, არამედ სინჯარის კედელს გადაეკრება თხელ ფენად. ამიტომაც ამ რეაქციას ასევე ვერცხლის სარკის რეაქციასაც უწოდებენ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%BB%D1%83%D0%BF%D0%BF,_%D0%94%D0%B6%D0%B5%D1%84%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Jeffrey_Schlupp_vs_Real_Madrid.png","page_title":"Шлупп, Джефф","context_page_description":"Дже́ффри Шлупп — немецкий и ганский футболист, левый защитник английского клуба «Кристал Пэлас» и сборной Ганы."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B8%D0%BD%D1%8C%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Iglesia_de_la_Asunci%C3%B3n%2C_Cari%C3%B1ena%2C_Espa%C3%B1a%2C_2015-01-08%2C_DD_17.JPG","page_title":"Кариньена","context_page_description":"Кариньена — Испаниядағы муниципалитет. Арагон автономды бірлестігіне қарасты Сарагоса провинциясының құрамына кіреді. Муниципалитет Кампо-де-Кариньена ауданында орналасқан.\\n2010 жылғы мәліметтер бойынша тұрғындарының саны 3725 адамды құрайды. Алып жатқан жер аумағы 82,5 км² шамасында. Провинцияның әкімшілік орталығына дейінгі қашықтығы — 48 км."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Bracken","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Paul_Bracken.jpg","page_title":"Paul Bracken","context_page_description":"Paul Bracken is a professor of political science and business at Yale University.\\nBracken is a respected thought leader in global competition and the strategic application of technology in business and defense. His research and teaching focus on solutions for senior management as it deals with a changing strategic environment and conditions of intense uncertainty. He is a leading teacher in executive education and has run programs for companies in finance, technology, retail, and health care. He is also a frequent teacher at One Day University on topics such as Problem Framing in Business, the Future of the Corporation, Big Business and Democracy, and the Second Nuclear Age.\\nHe is a member of the Council on Foreign Relations, and has served on the Chief of Naval Operations Executive Panel, the Board of Advisors of the Naval Postgraduate School and the U.S. Naval War College; and an advisory group for Los Alamos National Laboratory. He has been a visiting scholar at the CIA and Beijing University; and has consulted with many other branches of the US Government."},{"page_url":"https://vi.wikipedia.org/wiki/Armstrong_Whitworth_A.W.16","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/AW_16a.jpg","page_title":"Armstrong Whitworth A.W.16","context_page_description":"Armstrong Whitworth A.W.16 là một loại máy bay tiêm kích hai tầng cánh của Anh, do hãng Armstrong Whitworth Aircraft thiết kế chế tạo."},{"page_url":"https://tr.wikipedia.org/wiki/Rautj%C3%A4rvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Rautj%C3%A4rven_kirkko_3.JPG","page_title":"Rautjärvi","context_page_description":"Rautjärvi, Finlandiya'nın Güney Karelya bölgesinde bulunan bir belediyedir. Belediye, bölgenin doğusunda yer almaktadır. Yüzölçümü 401.89 km² olan belediyenin nüfusu 31 Ağustos 2017 tarihi itibari ile 3,495'tir."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A5%D9%85%D8%A7%D8%B1%D8%A7%D8%AA_%D8%A7%D9%84%D8%B9%D8%B1%D8%A8%D9%8A%D8%A9_%D8%A7%D9%84%D9%85%D8%AA%D8%AD%D8%AF%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Hatta_Fort_02.jpg","page_title":"الإمارات العربية المتحدة","context_page_description":"الإمارات أو هي دولة عربية اتحادية تقع في شرق شبه الجزيرة العربية في جنوب غرب قارة آسيا تطل على الشاطئ الجنوبي الخليج العربي لها حدود بحرية مشتركة من الشمال الغربي مع دولة قطر ومن الغرب حدود برية وبحرية مع المملكة العربية السعودية ومن الجنوب الشرقي مع سلطنة عُمان، قبل 1971 كانت دولة الإمارات العربية المتحدة معروفة باسم الإمارات المتصالحة أو ساحل عُمان، في إشارة إلى هدنة في القرن 19 بين المملكة المتحدة والعديد من شيوخ العرب كما تم استخدام اسم ساحل القراصنة في إشارة إلى الإمارات في المنطقة من القرن 18 إلى القرن 20 في وقت مبكر ويتكون النظام السياسي في دولة الإمارات العربية المتحدة إستناداً إلى دستور عام 1971 من عدة هيئات مرتبطة بشكل معقد الإدارة. الإسلام هو الدين الرسمي واللغة العربية هي اللغة الرسمية.\\nتعدّ دولة الإمارات العربية المتحدة المعاصرة جزءاً من الإقليم الذي عرف تاريخياً باسم إقليم عمان وذكره كثير من المؤرخين والكتاب العرب وغيرهم والذي يشمل حالياً سلطنة عُمان ودولة الإمارات العربية المتحدة من هذا المنطلق فإن تاريخ الدولة المعاصرة يدخل في إطار التاريخ العماني والعربي الشامل وقبل ميلاد دولة الإمارات العربية المتحدة كانت المنطقة تسمى مشيخات الساحل العُماني، ثم أطلق عليها الإستعمار ساحل القرصان، ثم تغير هذا الاسم ليصبح مشيخات الساحل المهادن."},{"page_url":"https://tr.wikipedia.org/wiki/Manisa_Saat_Kulesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Clock_tower_-_manisa_saat_kulesi_2004.jpg","page_title":"Manisa Saat Kulesi","context_page_description":"Manisa Saat Kulesi, Manisa ilinin Şehzadeler ilçesinde bulunan saat kulesi. 1366'da yılında tamamlanan Manisa Ulu Camii'nin kuzey ana giriş kapısının çıkıntısı üzerine 1672'de eklenen saat ile oluşturulmuştur. 1672 tarihi doğru kabul edilirse Türkiye'deki ilk saat kulesidir. 1922 yılındaki büyük Manisa Yangını'ndan etkilenmemiştir. Cumhuriyet'e kadar sağlam olan saat yapısı sonraları tamamen yıkılmıştır.\\nGünümüzde Ulu Cami'nin kuzey kapısı önünde yer alan kule sanılanın aksine aslında yeni bir yapıdır. Mevcut kule 1975 yılında inşa edilmiştir."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%80%D1%82%D1%83%D1%80_%D0%93%D1%8C%D0%BE%D1%80%D0%B3%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Gorgei_Artur_monument_in_Budapest.jpg","page_title":"Артур Гьоргей","context_page_description":"Артур Гьоргей е унгарски военачалник по време на Революцията от 1848 година. Победил австрийците в много битки, той е най-известен с капитулацията си пред руските войски през август 1849 г., след която борбата за независимост на Унгария стихва."},{"page_url":"https://en.wikipedia.org/wiki/Sam_Snead","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Sam_Snead_Cemetery.jpg","page_title":"Sam Snead","context_page_description":"Samuel Jackson Snead was an American professional golfer who was one of the top players in the world for the better part of four decades and widely regarded as one of the greatest players of all time. Snead was awarded a record 94 gold medallions, for wins in PGA of America Tour events and later credited with winning a record 82 PGA Tour events, including seven majors. He never won the U.S. Open, though he was runner-up four times. Snead was inducted into the World Golf Hall of Fame in 1974.\\nSnead's nicknames included \\"The Slammer\\", \\"Slammin' Sammy Snead\\", and \\"The Long Ball Hitter from West Virginia\\", and he was admired by many for having a \\"perfect swing\\", which generated many imitators. Snead was famed for his folksy image, wearing a straw hat, and making such statements as \\"Keep close count of your nickels and dimes, stay away from whiskey, and never concede a putt.\\" and \\"There are no short hitters on the tour anymore, just long and unbelievably long.\\" Fellow West Virginia Golf Hall of Fame Inductee Bill Campbell has said of Snead, \\"He was the best natural player ever. He had the eye of an eagle, the grace of a leopard and the strength of a lion.\\""},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%9A%D1%80%D1%8B%D0%BC%D0%B0_(%D0%BD%D0%B0%D1%87%D0%B0%D0%BB%D0%BE_1920)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%D0%9B%D0%B5%D0%BD%D1%82%D0%B0.jpg","page_title":"Оборона Крыма (начало 1920)","context_page_description":"Оборона Крыма в начале 1920 года — защита полуострова силами 4 тыс. бойцов Крымского корпуса генерала Я. А. Слащёва от многочисленных попыток захватить Крым со стороны двух советских армий общей численностью в 40 тыс. бойцов в январе — марте 1920 года."},{"page_url":"https://es.wikipedia.org/wiki/Wilhelmsdorf_(Baden-Wurtemberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Wilhelmsdorf_W%C3%BCrttemberg_Blick_zum_Saalplatz_Betsaal_2005.jpg","page_title":"Wilhelmsdorf (Baden-Wurtemberg)","context_page_description":"Wilhelmsdorf es un municipio situado en el distrito de Ravensburg, en el estado federado de Baden-Wurtemberg, con una población a finales de 2016 de unos 5003 habitantes.​\\nSe encuentra ubicado al sureste del estado, en la región de Tubinga, cerca del lago de Constanza, de la frontera con Austria, y de la orilla oeste del río Iller —un afluente derecho del Danubio— que lo separa del estado de Baviera."},{"page_url":"https://simple.wikipedia.org/wiki/Body_dysmorphic_disorder","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Mirror_Shaving.jpg","page_title":"Body dysmorphic disorder","context_page_description":"Body dysmorphic disorder is a mental illness where people think they look different to how they really look. People are usually said to have BDD if they are extremely critical of their body, even though there may be nothing noticeably wrong with it. If there is something wrong with their body, it is usually so small that a person without BDD would not be unhappy about it at all. People claim that they are insecure, but BDD is far worse.\\nMost people without BDD may not like some parts of their body, but people with BDD believe that they are so ugly, even though they are not, that they find it difficult to talk or exist with other people, or live normally, scared that other people will be mean to them because of the way they look. People with BDD often do not look for help because they are afraid others will think they are just vain, or they may feel too embarrassed to talk to other people as they think they are so ugly.\\nBDD is a somatoform disorder. People with BDD may look at themselves in the mirror too much, or some people with BDD may actually try not to look in the mirror. Both of these are possible for a person with BDD."},{"page_url":"https://de.wikipedia.org/wiki/Port_Royal_(Jamaika)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Map_showing_the_harbours_of_Port_Royal_and_Kingston%2C_Jamaica_Wellcome_L0063041.jpg","page_title":"Port Royal (Jamaika)","context_page_description":"Port Royal war eine wichtige Hafenstadt auf Jamaika, bis sie am 7. Juni 1692 von einem Erdbeben und einem nachfolgenden Tsunami vollständig zerstört wurde und zum größten Teil im Meer und im so entstandenen Treibsand versank."},{"page_url":"https://nn.wikipedia.org/wiki/Bajkalsj%C3%B8en","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/26_swiatoinos.jpg","page_title":"Bajkalsjøen","context_page_description":"Bajkalsjøen er ein innsjø i det sørlege Sibir i Russland, mellom Irkutsk oblast i nordvest og Burjatia i søraust, nær Irkutsk. Han vert òg kalla «Det blå auge i Sibir».\\nMed eit djup på 1637 meter er han den djupaste innsjøen i verda og den største innsjøen i verda ut frå volum. Innsjøen inneheld om lag 20 % av det totale ferskvatnet som finst på jordoverflata.\\nSom Tanganyikasjøen er Bajkalsjøen forma i ein eldgamal riftdal og er derfor lang og halvmåneforma med eit overflateareal på 31 500 km². Bajkal har over 1700 dyre- og planteartar og to tredjedelar av desse finst ingen andre stader i verda. og vart innskriven på verdsarvlista til UNESCO i 1996. Med ein alder på over 25 millionar år er han den eldste innsjøen i verda."},{"page_url":"https://en.wikipedia.org/wiki/NewYork-Presbyterian_Lower_Manhattan_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/New_York_Downtown_Hospital_Staff_Residence_69_Gold_Street.jpg","page_title":"NewYork-Presbyterian Lower Manhattan Hospital","context_page_description":"NewYork-Presbyterian Lower Manhattan Hospital is a nonprofit, acute care, teaching hospital in New York City and is the only hospital in Lower Manhattan south of Greenwich Village. It is part of the NewYork-Presbyterian Healthcare System and one of the main campuses of NewYork-Presbyterian Hospital.\\nThe Lower Manhattan Hospital operates 170 beds, and offers a full range of inpatient and outpatient services, as well as community outreach and education. It is also a leader in the field of emergency preparedness and disaster management. The Hospital serves the area’s diverse neighborhoods including Wall Street, Battery Park City, Chinatown, SoHo, TriBeCa, Little Italy, and the Lower East Side. It is the closest acute care facility to the Financial District, to the seat of the City government, and to some of New York’s most popular tourist attractions."},{"page_url":"https://es.wikipedia.org/wiki/Chuanqilong_chaoyangensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Chuanqilong_chaoyangensis.png","page_title":"Chuanqilong chaoyangensis","context_page_description":"Chuanqilong chaoyangensis es la única especie conocida del género extinto Chuanqilong de dinosaurio tireóforo anquilosáurido que vivió a mediados del período Cretácico durante el aptiense hace aproximadamente entre 125 a 112 millones de años en lo que ahora es Asia. Sus restos fósiles, un individuo inmaduro bastante completo aunque muy fragmentado, parecieron en la formación Jiufotang, en la provincia de Liaoning, China. Es un taxón hermano de Liaoningosaurus.​ Media cerca de 4,5 metros de largo y su peso se estima en unos 450 kilogramos.​"},{"page_url":"https://it.wikipedia.org/wiki/Mungo_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Mungo_Park_portrait.jpg","page_title":"Mungo Park","context_page_description":"Mungo Park è stato un esploratore scozzese."},{"page_url":"https://it.wikipedia.org/wiki/Sala_(architettura_buddhista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Watbenchamasalanam.jpg","page_title":"Sala (architettura buddhista)","context_page_description":"Una sala [ ศาลา], conosciuta anche come sala Thai, è un padiglione aperto sui lati, assimilabile al gazebo, dotato di panche o di un piano elevato dal terreno su cui sedersi o sdraiarsi, in uso in Thailandia, Laos e Cambogia. Tale struttura si trova anche in Myanmar, dove però prende il nome Zayat.\\nLa parola deriva dal pali साला, che viene traslitterato sālā e significa casa, tettoia o sala.\\nViene utilizzata per proteggersi dal sole e dalla pioggia e se ne possono trovare frequentemente in questi paesi, ad esempio nelle spiagge e nei parchi cittadini. A seconda del luogo e della destinazione per la quale sono costruite possono assumere i seguenti nomi:\\nsala rim thanon, quando è situata ai bordi delle strade, ad esempio come pensilina di attesa alle fermate delle corriere\\nsala tha nam, quando è costruita in corrispondenza degli approdi delle barche.\\nsala asai, capanno aperto sui lati nelle aree rurali, dove di solito sono delle rudimentali strutture usate per pranzare e riposarsi nelle pause lavorative\\nSono anche parte integrante dell'architettura dei wat, i complessi templari del buddhismo Theravada, in tal caso possono prendere i seguenti nomi:"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%B8%D5%B7%D5%A1%D5%BE%D5%A1%D5%B6%D6%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Gochavank_detail.jpg","page_title":"Գոշավանք","context_page_description":"Գոշավանք, Նոր Գետիկ վանք, հայկական կրոնական կառույց Հայաստանի Տավուշի մարզի Գոշ գյուղի եզրին, Գետիկ գետի աջ ափին: Միջնադարյան կրոնական, կրթական և մշակութային խոշոր կենտրոններից: 1188 թվականին, իշխան Իվանե Զաքարյանի աջակցությամբ, հիմնադրել է Մխիթար Գոշը երկրաշարժից ավերված Գետիկ վանքի մոտակայքում և այստեղ տեղափոխել միաբանությունը: Գոշավանքը համարվել է ժամանակի լավագույն կրթական համալիրներից մեկը։ Այստեղ են սովորել այնպիսի գործիչներ, ինչպիսիք են Վանական վարդապետը և Կիրակոս Գանձակեցին։ Սկզբում անվանվել է Նոր Գետիկ, Մխիթար Գոշի մահվանից հետո նրա անվամբ կոչվել Գոշավանք:"},{"page_url":"https://en.wikipedia.org/wiki/Caber_toss","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Caber_Toss.jpg","page_title":"Caber toss","context_page_description":"The caber toss is a traditional Scottish athletic event in which competitors toss a large tapered pole called a \\"caber\\". It is normally practised at the Scottish Highland Games. In Scotland the caber is usually made from a Larch tree and is typically 19 feet 6 inches tall and weighs 12.5 stone. The term \\"caber\\" derives from the Gaelic word cabar, which refers to a wooden beam.\\nThe person tossing the caber is called a \\"tosser\\" or a \\"thrower\\".\\nIt is said to have developed from the need to toss logs across narrow chasms, lumberjacks needing to transport logs by throwing them in streams, or by lumberjacks challenging each other to a small contest.\\nThe record for most caber tosses in three minutes is currently held by the Canadian Danny Frame. He managed to perform 16 successful caber tosses on 20 July 2018 at the Heart of the Valley Festival in Middleton, Nova Scotia, Canada."},{"page_url":"https://it.wikipedia.org/wiki/O%C4%8Dihov","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Ocihov_LN_CZ.png","page_title":"Očihov","context_page_description":"Očihov è un comune della Repubblica Ceca facente parte del distretto di Louny, nella regione di Ústí nad Labem."},{"page_url":"https://en.wikipedia.org/wiki/Nandi_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Tea_Plantations_Kenya.jpg","page_title":"Nandi County","context_page_description":"Nandi County is in the North Rift of Kenya, occupying an area of 2,884.4 square kilometres. Its capital, Kapsabet, is the largest town in the county while other towns include Mosoriot, Kaiboi, Kabiyet and Nandi Hills. According to a 2019 census, the county had a population of 885,711, made up of a number of Kenyan communities, the majority of whom belong to the native tribe called Nandi.\\nGeographically, the unique jug-shaped structure of Nandi County is bound by the Equator to the south and extends northwards to latitude 0034’N. The western boundary extends to west. The county's major area is covered by the Nandi Hills."},{"page_url":"https://ro.wikipedia.org/wiki/Gorode%C8%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Coat_of_Arms_of_Gorodets_%28Nizhny_Novgorod%29.png","page_title":"Gorodeț","context_page_description":"Gorodeț este un oraș situat în regiunea Nijni Novgorod, Federația Rusă. Orașul se află ca. la o altitudine de 90 m, ocupă suprafața de 17 km² și are în anul 2009 o populație de 31.357 loc."},{"page_url":"https://eu.wikipedia.org/wiki/Fleurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Fleurus_JPG00.jpg","page_title":"Fleurus","context_page_description":"Fleurus, Belgikako hegoaldeko udalerria da, Valoniako Hainaut probintzian dagoena. 2011ko erroldaren arabera, 22.604 biztanle ditu."},{"page_url":"https://es.wikipedia.org/wiki/Asunci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Omnibus-asu.jpg","page_title":"Asunción","context_page_description":"Asunción es la capital y ciudad más poblada de la República del Paraguay. Es un municipio de primer orden administrado como distrito capital y no está integrado formalmente en ningún departamento, pero para censos y estadísticas, se la considera como jurisdicción de primer orden. Está ubicada en el centro-oeste de la Región Oriental del país. Limita al norte con el río Paraguay que lo separa del departamento de Presidente Hayes y a su vez, de la Región Occidental; al este y sur con el departamento Central; al oeste con el río Paraguay y próxima al río Pilcomayo, que lo separa de la República Argentina. Fue fundada el 15 de agosto de 1537, por Juan de Salazar y Espinoza, lo que la hace una de las ciudades más antiguas de Sudamérica y del Cono Sur.\\nSegún estimaciones de la DGEEC para el año 2020, la ciudad cuenta con una población de 521 559 habitantes, siendo así la ciudad más poblada del país.​ Su Región Metropolitana ronda los 3 000 000 de habitantes, convirtiéndola así en una de las aglomeraciones urbanas más grandes de Sudamérica."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_expedi%C3%A7%C3%B5es_%C3%A0_Esta%C3%A7%C3%A3o_Espacial_Internacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/ISS_Expedition_10_crew.jpg","page_title":"Lista de expedições à Estação Espacial Internacional","context_page_description":"Esta é uma lista de expedições que estiveram na Estação Espacial Internacional nos 19 anos e 9 meses desde a Expedição 1. Desde o ano 2000, a estação recebeu a visita de cerca de 228 astronautas de 19 países diferentes, sendo que a primeira tripulação era formada por um estadunidense, um russo e um ucraniano. Geralmente os astronautas revezam-se acerca da ocupação da estação de seis em seis meses. No ano de 2006, Marcos Pontes tornou-se o primeiro brasileiro a viajar para a EEI durante a Missão Centenário, em homenagem aos 100 anos do voo de Santos Dumont.\\nCom 109 metros de largura, 73 metros de comprimento, 20 metros de altura e cerca de 450 mil kg, depois da Lua, a EEI é considerada como o segundo maior objeto no céu. De acordo com a NASA, ela é do tamanho de um campo de futebol americano. Para ser construída, a EEI contou com a participação de 15 nações, EUA, Rússia, Japão, Canadá, e outros 11 países da Agência Espacial Europeia. A estação espacial internacional começou a ser construída no ano de 1998 com a missão STS-88, que conectou em pleno espaço o módulo norte-americano Unity Node ao módulo russo Zarya."},{"page_url":"https://en.wikipedia.org/wiki/Tourism_in_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ahu_Tongariki.jpg","page_title":"Tourism in Chile","context_page_description":"Since the mid-1990s, tourism in Chile has become one of the main sources of income for the country, especially in its most extreme areas. In 2005, this sector grew by 13.6%, generating more than US$500 million, equivalent to 1.33% of the national GDP.\\nAccording to the World Tourism Organization, Chile was the eighth most popular destination for foreign tourists within the Americas in 2010, after the United States, Mexico, Canada, Argentina, Brazil, the Dominican Republic, and Puerto Rico. That year, 2,766,000 tourists entered the country, generating a revenue of US$1,636 million. The majority of these visitors came from American countries, mainly Argentina; however, the biggest growth in recent years has been in visitors from Europe, especially Germany.\\nIn 2017, a record total of 6,449,993 international tourists visited Chile, a 13.3% increase from 2016. Argentina remained the most common country of origin, followed by Brazil. European tourists were third in terms of total numbers. The average tourist stayed for 10 nights."},{"page_url":"https://en.wikipedia.org/wiki/Princess_Sophia_of_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Daughters_of_King_George_III.jpg","page_title":"Princess Sophia of the United Kingdom","context_page_description":"Princess Sophia of the United Kingdom was the twelfth child and fifth daughter of King George III and Charlotte of Mecklenburg-Strelitz. Sophia is perhaps best known for the rumours surrounding a supposed illegitimate child to whom she gave birth as a young woman.\\nIn her youth, Sophia was closest to her father, who preferred his daughters over his sons; however, she and her sisters lived in fear of their mother. The princesses were well-educated but raised in a rigidly strict household. Though he disliked the idea of matrimony for his daughters, King George had intended to find them suitable husbands when they came of age. However, the King's recurring bouts of madness, as well as the Queen's desire to have her daughters live their lives as her companions, stopped would-be suitors from offering for most of the princesses. As a result, Sophia and all but one of her sisters grew up in their mother's cloistered household, which they frequently referred to as a \\"Nunnery\\".\\nThough she never wed, rumours spread that Sophia became pregnant by Thomas Garth, an equerry of her father's, and gave birth to an illegitimate son in the summer of 1800."},{"page_url":"https://nl.wikipedia.org/wiki/Ford_Transit_Bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Montebello_Municipal_Bus_Lines_17_at_IRM%2C_repainted_as_West_Towns_343_%282015%29.jpg","page_title":"Ford Transit Bus","context_page_description":"De Ford Transit Bus was een autobus geproduceerd door de Amerikaanse busfabrikant Ford Motor Company tussen 1936 en 1947.\\nFord bouwde de chassis, dat weer gezet werd op een carrosserie van Union City Body Company. De Canadese versies werden gebouwd op een chassis dat gebouwd werd in Windsor en carrosserie dat gebouwd werd door Brantford Coach & Body.\\nAanvankelijk werden er 11.000 Ford Transits gebouwd."},{"page_url":"https://da.wikipedia.org/wiki/Krenkerup","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Krenkerup_Gods.JPG","page_title":"Krenkerup","context_page_description":"Krenkerup er en gammel hovedgård, som nævnes første gang i 1330. Krenkerup blev kaldt Hardenberg fra 1815 til 1938. Gården ligger i Radsted Sogn, Musse Herred, Maribo Amt, Guldborgsund Kommune. Hovedbygningen er opført i 1490-1510 og ombygget i 1620-1631-1689-1780-1815.\\nKrenkerup Gods er på 3700 ha med Sæbyholm, Idalund, Rosenlund, Nørregård, Nielstrup og Christiansdal."},{"page_url":"https://hu.wikipedia.org/wiki/Debby_Ryan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Debby_Ryan_2011.jpg","page_title":"Debby Ryan","context_page_description":"Deborah Dun amerikai színésznő, énekesnő."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%82%D9%8A%D9%8A%D8%AF_%D9%83%D9%85%D9%88%D9%85%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Potential_energy_well.svg","page_title":"تقييد كمومي","context_page_description":"تقييد الكم ‏ يعني بصورة مبسطة حبس الإلكترون داخل صندوق أي إبقاءه ضمن حجم محدود وحصره بداخله، ويحدد طول هذا الصندوق وعرضه وارتفاعه خواص نقطة الكم والتي يعبر هنا \\"بئر جهدي\\" ومستويات طاقته وشكلها، ويعد الإلكترون المرتبط بالنواة الذرية واقعاً تحت تأثير جهدها الكهربائي فيكون كما لو كان مقيداً داخل صندوق، وأحياناً يكون هذا التشبيه بأن الإلكترون منحصر في \\"بئر كهربائي كولومي \\"، يتطلب الإلكترون امتلاك طاقة معينه تسمح له بالخروج من البئر.\\nإذا كان الإلكترون موجوداً في صندوق كبير فإنه يتصرف كما لو كان حراً، فهو لا يقع تحت تأثير أي جهد، في تلك الحالة يمكن للإلكترون امتلاك طاقة بحيث تكون مستويات الطاقة له متداخلة مع بعضها البعض هذا هو تصرف الإلكترون أو الجسيم عندما يكون حجم الصندوق كبير ويضمحل تأثير حجم الإلكترونات فيه، إذن ما معيار كبر حجم الصندوق؟ ما هو طول التقييد الملائم؟ المعيار هنا هو تحدده خواص الإلكترون."},{"page_url":"https://ceb.wikipedia.org/wiki/Campanula_hercegovina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Campanula_hercegovina.jpg","page_title":"Campanula hercegovina","context_page_description":"Espesye sa tanom nga bulak ang Campanula hercegovina. Una ning gihulagway ni Árpád von Degen ug Franz Fiala. Ang Campanula hercegovina sakop sa kahenera nga Campanula sa kabanay nga Campanulaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://pt.wikipedia.org/wiki/AK-47","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Gp_wasr-10_63_Field_Stripped.jpg","page_title":"AK-47","context_page_description":"O AK-47, ou AK como é oficialmente conhecida, também conhecida como Kalashnikov, é um fuzil de assalto de calibre 7,62x39mm criado em 1947 por Mikhail Kalashnikov e produzido na União Soviética pela indústria estatal IZH. É a arma de fogo originária da família de fuzis Kalashnikov.\\nO trabalho de design na AK-47 começou em 1945. Em 1946, o AK-47 foi apresentado para testes militares oficiais e, em 1948, a versão de estoque fixo foi introduzida no serviço ativo com unidades selecionadas do Exército Soviético. Um dos primeiros desenvolvimentos do design foi o AKS, que foi equipado com um estoque de metal de subcobertura. No início de 1949, o AK-47 foi oficialmente aceito pelas Forças Armadas Soviéticas e usado pela maioria dos Estados membros do Pacto de Varsóvia.\\nMesmo depois de quase sete décadas, o modelo e suas variantes continuam sendo os fuzis de assalto mais populares e amplamente usados no mundo devido à sua grande confiabilidade em condições adversas, baixos custos de produção comparados às armas ocidentais contemporâneas, disponibilidade em praticamente todas as regiões geográficas e a facilidade no uso."}]`),T={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],H={key:0},R={key:1};function N(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",L,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",F,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),f(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",G,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",R,"Loading...")):(t(),n("span",H,"See more"))],8,I)):p("",!0)])}const K=g(T,[["render",N],["__scopeId","data-v-d89a4212"]]),V